                            + "እዞም ዓበይቲ ፊደላት(Capital letter)አብ እንጽሕፈሉ እዋን SHIFT ቁልፊ ተጻዒና ክኸውን አለዎ፡፡ አብ\n"
                            + "ናይ ፊደል መአዲ ክልተ ናይ SHIFT ቁልፊ ዝርከቡ እንትኸውን ሓዲኡ ናይ ጸጋማይ SHIFT ቁልፊ\n"
                            + "እንትኸውን ናይ ጸጋማይ ኢድና ንእሽተይ አጻብዕቲ እነዕርፈሉ እዩ፡፡ እቲ ካልአዋይ ድማ ናይ የማናይ SHIFT\n"
                            + "ቁልፊ እዩ እዚ ከዓ ናይ የማናይ ኢድና ንእሽተይ አጻብዕቲ እነዕርፈሉ እዩ፡፡\n\n"
                            + "አጻብዕትና እነዕርፈሎም ቁልፊታት\n\n"
                            + "እዚ ሶፍትዌር አጻብዕትና እነዕርፈሎም ቁልፊታት ብሕብሪ ፈልዩ የርእየና እዩ፡፡\n"
                            + "ቁልፊ ENTER አጻብዕቲ ብናይ የማናይ ኢድ ንእሽተይ አጻብዕቲ\n"
                            + "ቁልፊ SPACE አጻብዕቲ ብናይ የማናይ/ጸጋማይ ኢድ ዓባይ አጻብዕቲ\n"
                            + "ቁልፊ BACKSPACE አጻብዕቲ ብናይ የማናይ ኢድ ንእሽተይ ወይ ድማ ናይ ቀለበት አጻብዕቲ\n\n"
                            + "ብዝተፈላለየ ቋንቋ ዘለዉ ትምህትታት\n\n"
                            + "ትምህርትና ካብ እንግሊዝኛ ናብ አማርኛ ወይም በተቓራኒ ክንቀያይር እንተለና ናይ ፓወር ግዕዝ መፍለዪ\n"
                            + "ምልክት(አይከን)ናብ ትኽክለኛ ዓይነት አይከን ክንቕይሮ አለና፡፡ ንአብነት ናይ ትግርኛ ትምህርቲ አብ\n"
                            + "ንወስደሉ እዋን ነቲ አይከን ናብ ፎ ዝብል አይከን ምቕያርና አገዳሲ እዩ፡፡እዚ ንምግባር ድማ ብቐጥታ\n"
                            + "ናብዙ አይከን ብምኻድ ክልተ ጊዜ ብምጽቃጥ እዩ፡፡\n\n"
                            + "መተሓሳሰቢ: አብ ፓወር ግእዝ ክልተ ፎ ኮይኖም ዝረአዩ አይከናት እንትህልዉ እቲ ናይ መጀመርያ\n"
                            + "ድሕሪቱ ቆጽለዋይ ኮይኑ ብቢጫ ቐለም ፎ ተባሂሉ ዝተጽሓፈ ነዚ ሶፍትዋር ዘየገልግል ብምኳኑ እቲ\n"
                            + "ቀጺሉ ዘሎ ናይ ፎ አይከን ምምራጽ ክህልወና እዩ፡፡ እንግሊዝኛ ትምህርቲ አብ እንወስደሉ እዋን ነዚ\n"
                            + "ናይፓወር ግዕዝ አየከን ካብ ፎ አይከን ናብ ኢ አይከን ክንልውጦ አለና፡፡\n\n"
                            + "ትክክለኛነትን ፍጥነትን\n\n"
                            + "አብ ኮምፒዉተር ፅሕፈት እንትንለማመድ ትክክለኛነት በጣዕሚ አገዳሲ እዩ፡፡ ብዝተኽአለ መጠን\n"
                            + "ስሕተት ንዘይምስራሕ ብምሙካር ናይ ትክክለኛነት መጠንና ካብ 5 ሚእታዊ ብላዕሊ ንምግባር ክንጽዕር\n"
                            + "አለና፡፡ስሕተት አብ እንሰርሃሉ እዋን እዚ ሶፍትዌር ስሕተትና እስካዕ ነስተካክል ናብ ቀጻሊ ፊደል\n"
                            + "አየሕልፈናን፡፡\n\n"
                            + "ትምህርትታት\n\n"
                            + "ሓዲኡ ወዲኦም ናብ ካሊእ ቅድሚ ምካዶም ብዙሕ ልምምድ ንኽገብሩ ንመክር፡፡\n\n"
                            + "ናይ ቁጽሪ መአዲ\n\n"
                            + "ናይ ቁጽሪ መአዲ ንምምሃር እንተደልዮም ብመጀመርያ እቲ ናይ ፊደል መአዲ አቀማመጥኡ ካብ እንግሊዝኛ\n"
                            + "ናብ ቁጽሪ ክቕየር አለዎ፡፡ ካብዚ ብምቕጻል NUM LOCK ቁልፍ ምብራሁ የረጋግጹ፡፡\n\n"
                            + "\t* ቁጽሪ አብ ንለማመደሉ እዋን እንጥቀሞ የማናይ ኢድና እንትኾን:\n\n"
                            + "\t\t* ሓባሪት አጻብዕቲ አብ ልዕሊ ቁልፊ 4\n"
                            + "\t\t* ማእኸል አጻብዕቲ አብ ልዕሊ ቁልፊ 5\n"
                            + "\t\t* ቀለበት አጻብዕቲ አብ ልዕሊ ቁልፊ 6\n"
                            + "\t\t* ንእሽተይ አጻብዕቲ አብ ልዕሊ ቁልፊ ENTER\n"
                            + "\t\t* ዓባይ አጻብዕቲ አብ ልዕሊ ቁልፊ 0 ክኸውን አለዎ፡፡\n\n"
                            + "CAPS LOCK\n\n"
                            + "ዝኾነ ትምህርቲ ቅድሚ ምጅማሮም CAPS LOCK ቁልፊ ምጥፋኡ የረጋግጹ፡፡እዚ CAPS LOCK\n"
                            + "ቁልፊ ዘድልየና ሸ፣ ኀ፣ ኸ፣ ጸ ከምኡ እውን ፀ ንምጽሓፍ እዩ፡፡\n\n"
                            + "ልምምድ ይጀመር\n\n"
                            + "ብመጀመርያ ናይ ክልቲኡ ኢድና አጻብዕቲ አብ ትኽክለኛ ቁልፊ ነቕምጥ፡፡ ካብኡ ብምቅጻል ነቲ አብ ስክሪን\n"
                            + "እንሪኦ ሕብሪ ብምክታል አጻብዕትና ካብ ሓዲኡ ቁልፊ ናብ ካሊእ ነዕርፍ ቀጺልና ድማ አጻብዕትና ናብ\n"
                            + "ዝነበሩዎ ቦታ ንምልሶም እዚ እናገበርና ልምምድና ንቅጽል፡፡ ሓደሓደ ግዜ ካብ ሓደ ንላዕሊ ቁልፊታት\n"
                            + "ብዝተፈላለየ ቀለም በሪሆም ክረአዩ ይክእሉ እዮም፡፡ ከምዚ አብ ዝኮነሉ እዋን እንጥቀመሉ ናይ ሕብሪ\n"
                            + "ቀደም ተከተል ነዚ ይመስል ፡-\n"
                            + "(እዚ ቅደም ሰዓብ በቐሊሉ ብናይ ኢትዮጵያ ሰንደቕ ዓላማ ቀለማት ምስትዋስ ይከአል እዩ፡፡)\n\n"
                            + "\t\t* መጀመሪያ ቆጽለዋይ\n"
                            + "\t\t* ቀጺሉ ቢጫ\n"
                            + "\t\t* ቀጺሉ ቀይሕ\n"
                            + "\t\t* ቀጺሉ ሰማያዊ\n\n"
                            + "ንአብነት፡ ናይ ግእዝ “ሹ“ ፊደል ንምጽሓፍ እንትንደሊ ብጫ፣ ቐይሕን ሰመያዊን ቐለም ዘርእዩ ሰለስተ\n"
                            + "ቁልፊታት በሪሆም ንርኢ ኢና፡፡ አብዚ ግዜ እዚ ነዚ ልዕል ኢሉ ዝተጠቐሰ ቅደም ሰዓብ ብምክታል እቲ\n"
                            + "ዝደለናዮ ናይ ግእዝ “ሹ“ ፊደል ምጽሓፍ ይክእሉ እዮም፡፡ ንዝጸሓፉዎም ፊደላት አብ ስክሪንኩም አብ ላዕሊ\n"
                            + "ዝርከብ ጻዕዳ ናይ መጽሓፊ ቦታ ተጻሒፎም ይረክቡዎም፡፡ ዋና ዕላማታት ካብዚ ናይ መጽሓፊ ሰሌዳ ልዕል\n"
                            + "ኢሎም ዝርከቡ ፊደላት ምጽሓፍ እዩ፡፡ ነዚ ናይ ሓገዝ ጽሑፍ ዝሓዘ መሽኮት ምዕጻው ከምኡ እውን አብ\n"
                            + "ዝደለዩዎ እዋን “ሓገዝ” ዝብል መማረጺ ብምንካእ ምምላስ ይክእሉ እዮም::\n\n"
                            + "                                ሰናይ ልምምድ!\n";

