            amharicWords[0, 0] = "ሃይማኖቶችና ህንደኬ ሀሴትን ሄሮዱተስ ሀሜትና ሀገርሽን ሃይለማርያምና ሀለቃ ሀብቶቿንና ህዳሴያችን ሀላፊነትና ሂሩትን ሃጢያትን ሀይድሮሜት ሃዋሣ ሆናቹህ ሃዘንሽ ህጻናትም ህዝባችሁ ሃትሪኩን ሀብ ሀብታሞችሽ ሀላፊውና ህወህት ሃገራችንንም ሆኜአለሁ ሃይዌይ ሁለመናዬን ሀላፊና ሆቴሎቹም ሃይለኪሮስን ህዳጣን ሆነውን ሃይማኖቷን ህመማቸውም ሃይማኖታችሁ ሀርድ ሀስቡነላህ ሃዲዱን ሃኪሞቹ ሄዶዋል ህየንተ ህዝባቸዉን ሄይ ሄኒከን ሆነዋላ ሀገራችሁን ሃብቴን ህብረተቡን ሃይለማሪያምና ሂዎትን ሃሳብሽን ሆኖልሃል ሀዘናችሁ ሆቢው ሀብታትን ሀዘኑን ህሊናችንን ሀፍረተቢስነትን ሄደዉ ሂደዋል ሂሳብም ህዋሳትን ሃይለሥላሴ ሆቴሉንና ሄግልና ሃላፊውን ሂያ ሃያውንም ህሊናዋን ሀፊዝ ሆኖላቸው ሁተኛዋ ሀሙስለት ህልፈታቸውን ሆነንለታል ሃላፊነቶች ሁለነገራቸው ህውሀታዊ ሄኒከንም ሂትዝፊልድ ሆናችኋል ሃይማኖቱንና ሆኗላ ሃይላትን ሀግሪቱ ሃጥያት ሄሮድሱ ሃማ ህንዳውያኑ ሆናት ህላዌና ሃያዎቹ ሃራ ሀላፊዎችና ሀይማኖታችን ሀጢያቱ ሀይላት ሀላፊነታችንን ሁኔታ ከሰማሁት ሂሳብህን ሁለን ሃቨልን ሃውልትም ሆሆይ ሂሳቤን ሀግ ሀዘናችንም ሀቆች ሃገሪትዋ ሄዳለሁ ሀሳባቸውንና ሃሎች ሃይልማሪያም ሀብታቸውና ሁልቀን ሃቨር ሀብታሙም ህልሟ ሁነነን ሂጃብ ሁላችሁ ሆቴሌ ሀገራችንም ሃይማኖቷ ሀሣብ ሃይሞኖታዊ ሃሰተኝነት ሀገሪቱንም ሃበ ሆልሞስ ሃባ ሃያም ህጎቻቸው ሃይለኛና ሆዳምና ሂደት በሽብርተኛ ሆድዋ ህውሃትና ህመሟ ሀጢአት ሀዳጣን ሁስኒ ሃላፊነታቸዉን ሀብቶቻችን ሆርቲፍሎራ ሃዋርድ ህፃኗን ሆነውላችሁ ሂግስ ሃረጎች ሃገራችንንና ሀብተማርያም";
            amharicWords[0, 1] = "ሃስብ ሃማድ ሃሎችን ሀዉልት ሆኖብን ሃለፊነት ሁቱዎችን ሃያሲ ህወሀቶች ሁለተኛዎቹ ሀጎስም ሆፕን ሀብተጊዮርጊስ ሂዮማን ሁላችሁንም ሃይማኖተኛና ሃይማኖተኛ ሄርማን ሀገርዎንና ሃይኩ ሁነዋል ሃይኪ ሃይካ ሃይኬ ሆኖብኝ ሀቀኛው ህጋው ሀገርህን ህልፈቱ ሃይማኖቱም ሂወታቸው ሁላችም ሀቀኞችና ሀብቱም ሆይሆይታው ህዳሴን ህይወትስ ሁዳዴ ሄዶም ሁኔታወችን ሆኑብን ሆመር ሃገሮቻቸውን ሁዱርን ሀገርዋ ህተመቱን ሃደሬ ሀብተወልድ ሀጥያተኛ ሆርጌ ሄንሪክ ህዝባችንም ሀርቡ ሄኒከንና ሀይታን ሀዲያ ሀንጋሪ ሆሊጋንሲቲክ ሀገሮቹ ሃይደን ህጓ ህወአት ሃይለማርያ ሀጢያቶች ሆነውባቸው ሆንም ሁልህም ሀውዳል ሀገረስብከት ህጋዊው ሀብታሟ ህሊናቸዉ ሃፍቶም ህንፍሽፍሽ ሃብታሞቹ ህክምናዎች ሀብቶምን ሃጄ ሃድሩ ሃኪምና ሁላቸውም ሂሴን ሀረጋትንና ሄሎ ሆኑዋል ሃብቱም ሆስት ህላዌስ ሆነውበት ሃርጌሣ ሃይሎቸም ሁኔተ ሁኔታውንና ሃሳብህ ሃማኖቶች ሀራም ሀያው ሃንቆሬ ሀብትንም ሀይሎችም ሃድሽ ሃብትነት ሄፓታይተስ ህውሀትነት ሀርነት ህልዉና ሃይላቸውም ህራይ ሁጎ ሀፍረተቢሱ ሃሰትን ሆኖላታል ሀቀኛውን ሀገርንም ሆትስፐር ሃንጋር ሃገርነት ሄኤማን ሁሴንም ሀሌሉያ ሃዲያ ህዝቄል ሆሜር ሀገራቸዉን ህሊናና ሆኖን ሆኗልና ሃገራችንና ሁካታና ሆናችሁም ሃዘናችንን ሀዘኔ ህይማኖትም ሁለተኛቸው ሁልአቀፍ ህይዎት ሃይላንዶች ሀዘኗ ሄድኩላችሁ ሃይሉዋ ሄልቦክ ሂሞግሎቢን ህብርን ሃሞታችን ሀቆችን ህፀፅና ሆርስ ሀንሰን ሃዲያነታቸውን ሆስፒታሎቹ ሀሪ ሀስተኛነት ሃውልታቸው ሁለም ሁለተኛውስ ህዝቦቻችንንም";
            amharicWords[0, 2] = "ሃማስ ሂር ሆነልኝ ህብረተሰባዊ ሀብታምና ሃሜታ ሂዝቡል ህመሙን ሃሃሃ ህሊናን ሀዘኑ ህብረብሄራዊ ሂሳቸውን ሀገራቸዉ ሃገራትም ሃበሾች ሆኖኝ ህንዳዊው ህመምተኞችን ህብረታችን ሁናታ ሃብተማሪያም ህልው ሃሳባቸውንና ህጻኑ ሃተታውን ሀይቁ ሀኪሞች ሃብትም ሃሳን ሆናል ህጻኗ ሆንግኮንግ ህልምም ሃይላችንና ሁናለች ሆስፒታሉም ሆዜ ህብረተሰቡንም ሂሳቦችን ሆናም ሃይሏ ሁኔታዎችንም ሃኒባል ሆርሞኖች ሃሚሶ ሆያ ሁኔታዬ ሃሜታና ህገወጥነት ሂትለርን ሆሣዕና ሃድልስተን ሁሉቱ ሃሪኬን ሀዲስ ህሊናዬን ሀላፊነትን ሆዷ ሁነቱን ህዳጣኑ ሃማቶ ሆተል ህግዴፍ ሆሊቃ ሃዳስ ሃይልም ሀገሪቱም ሄኔኬንስ ሄልሲንኪ ህረተሰቡ ህውሐት ሆስተን ሃይማኖትንና ሃሮዬ ሀገራችንና ህፃኑን ሀዘናችንን ሃይማኖተኝነት ሁኖም ሃብቷ ህብትና ህወሃትም ሀያል ሁንልኝ ሃንገር ሀብትንና ሀጋዊ ሀብቶችን ህሆ ሆኖባት ሁኔታዉን ሆንስዊዝ ሃሠት ህዝብንም ህጻናቶች ሀገሮችና ህሊናዉ ህዝቡዋ ሂሳባችን ሂደትንና ህሊናዋ ሃገሮቹን ሀቢሶ ህብረህዋስ ሄርሜላ ሀዋርያ ሄቴል ሃዋሳን ሃሃ ሃብትንና ሃትሪክ ህልማቸዉ ሃሌ ሃላፊን ሂዳችሁ ሃረግ ሄሊኮኘተሮችን ህልዮት ሀገርኛ ህትመቱ ህብረትሥራ ሂሶች ሁነትን ሁናቴውን ህልማቸው ሃይለማሪያምን ህትመቷ ሄደናል ሆነውብኝ ህጎችም ህዝብታት ሃቀኛና ህወሐትን ህክምናዋን ሀገራዊና ሀይላችን ሆእንው ሃበሻን ሄዶበታል ሀገርህ ህዝባዊት ህዳሴዋን ህዝቧንም ሆነሃል ሃያስድስት ሄትሮው ሃብታዊና ህዝባዊው ሂደታችን ሃብ ሃውኪንግ ሀዘናቸው ሁዋዌ ሄራን ሄነሪ ህዳሴውን ሃቢሶ ህንፃውን ህወኃት ህግጋቶች";
            amharicWords[0, 3] = "ሀብታሞችን ህዝብነት ሄዠ ሀጥያት ሃብተ ሃምዲ ሄሊኮፕተሮችንና ሃይለማርያምም ህዝቦችም ሂክማ ሀገሯ ሀገራትና ሂዳ ሃዋላው ሂሱን ሂጄ ሃሰንዲ ሁለተኛዋን ሃል ሃሎ ሆድን ሂዎታቸውን ሃሰቦች ሃሪ ሆቴላቸው ሆኖአቸዋል ሃያኛው ህንጻዎቹ ሃይንላይንን ህብረተሰባቸውን ሃይማኖታቸው ሁለታችሁም ህፀፆች ህጻናቱ ህዝባችንና ሂጂራ ህልሜ ሁም ሂፕ ሀውልቶች ሁለተኛውም ሆነውብናል ሆላንድና ሆነላችሁ ሆላንድን ሂላል ሃይን ህሊናችሁ ህውሃትን ሄሊኮኘተሮች ህልሙን ህዙናን ሃውልቶች ሆልዲንግ ሃይላት ሁምቦ ሂሣቡ ሃጢያት ህዝብስ ሃሞት ህልመኞች ህይወቱንም ህዳሴና ህወሃትን ሃሜታዎች ህዝ ሆስፒል ሀይማኖቱን ህይወቱና ሀኪሟ ሃይለቃል ህልሞችን ሃወር ሃሳባቸዉን ሃያሲያን ሃቢባ ሀተታዎች ህልፈታቸው ሄርማንስ ህጄ ሁሉንተናዊ ሀውስም ሃኒሽን ህግወጥነት ሃጢአት ሁገአዘ ህይወቴና ሃዘናቸወን ሃበሻዎች ሀውልትን ህይወታችንን ሀሳባዊ ሃራዳ ሀዘናቸውን ሂሊኮፕተሩ ህይወትህን ሃያቱ ሁሉነገር ሃሴት ሄላሪ ሆነሻል ሃንፍሬ ሆነላቸው ሆራየር ሁላችንን ሂደቱና ሄከታር ሃገርቤት ሆምስ ሄሊኮፍተሮች ሃውልትና ሃረጋቸው ሃራጥቃ ሃብታሞች ህይወቷን ህጎቹ ሃሊማ ህክምናም ሃሳቦችንና ህብረቱና ሆነዋልና ሁለተኛውንና ህወሓትም ሃኪሙ ሄሪኬን ሃገራችሁ ሀፍረትን ህውሓት ሄስ ህዓናት ሃሳበ ሄገና ሀይማኖቶች ሁለመናው ሃሰትና ህብረተሰቦች ሃላፊነቶችን ሀገሩንና ሆድህ ህዋስን ህጻኗን ሄዱና ሃገሮቹ ሃይማኖትህ ሃይማኖታችንና ሀመልማል ህውሓቶች ሃፒ ሄሊኮፕተርና ሆዳሞች ሃርቢ ሃለፊው";
            amharicWords[0, 4] = "ሃሳቤ ሃብቷን ሃበሻ ሃቅን ህጎቹን ሃይሎችም ሀዝብ ሃራካት ሆኗ ሂሳብና ሀይለኛ ሃይሎችንና ህዳሴው ህዳግ ሃምሊን ሃሳቦችም ሃያው ሃብታቸው ህይወትህ ህልውናም ሃበት ሃይላቸው ሃሳቦችንም ሂትለርና ህውከት ሀይሎቹ ሀገሬው ሁለመናቸው ሀረግ ሆንዋል ሁሪሳ ሂያጅ ሁለትኛ ሃይለኛው ሃላፊነታቸው ሄዳለች ሆጅበርግ ሃዘኑ ህዘብ ሀና ሄንዚ ሄድ ሁሉና ህውሀት ህልውናችን ሆቴሎችም ሀቀኛና ሄድኩ ህሊናችን ህዘብን ሃይሎቹ ህሊናዊ ህብረተሰባችን ሃይላንድ ሁኔታዋን ህሊናው ሃይንዝ ህሊናውን ሆእን ሄክቶር ህንጻዎችና ሃይማኖተ ሁለታችን ሁልግዜ ሁኔታነት ህገመንግስትን ሀይማኖትና ሃቁ ህብረቱም ሃውልቶችን ሀይማኖትን ህልውናን ሄርኩለስ ሀይሉን ሃዋርያ ሂደቱንም ሃቨ ሂላላ ሆኖል ሁነቱ ሁኔታዎችንና ሁነት ሀረርጌ ሃይቆቹ ህልቆ ሁለትሺ ሆስቴል ህልፈተ ሀይታንን ህዝቤን ሃቆች ሃሣብም ሆቴልንና ሃሳባችን ሁዳይዳ ህትመትና ሃቢብ ሂደቶችንና ህልፈትን ሆሄ ህንጻውን ሆኖዋል ሃሚድ ሃውልቱን ሃዉልት ሄድህ ሆም ሆሞ ህጉና ህጋዊውን ሁንደቱ ሆዳቸውን ህንጻና ሀብታዊ ሀቀኞች ህንጻን ሆነችው ሃዋሪያ ህወሀትን ሂወት ሁለቴም ሆቴልም ሁቱዎች ሃይለኪሮስ ሁኔታንና ሃሳቧ ሃያኛ ሆታ ሁኔታዉ ሃሳባዊ ሄደውም ህትመቶችን ሁለተኛም ሃገሬን ሆኔ ሆቴሎቹ ሄደት ህይወታቸውም ሃይማኖታችን ህግመንግስቱን ሃይሏን ሄይንዝ ሃይማኖተኞች ሃራም ሆነብን ሄፕታይተስ ሃሳቦቹ ሆኖለታል ሃሌሉያ ህንዶች ሃምዛ ሆይሆይታ ሆኖልኛል ሆኗታል ሁሉት ሆኖው ሆዳችን ሁለቃ ሆጃ ሃኒሽ";
            amharicWords[0, 5] = "ሆሮ ሃያት ሃጅ ሃየሎም ሆኑና ሃርቃ ሀይለ ሆቴላችን ሂደን ሀብታችንን ሆኖና ህግንና ሀዘናችን ሃብታዊ ሀብቴ ሁኗል ህጻናትንና ሆጀሌ ሁኔታስ ሃውልቱ ህራየር ሆላንዳዊ ሂዳሴ ሆዬ ህገመንግስቱ ሀብታሞችና ሃለፊ ህንጻው ህዝቅኤል ህመምተኛ ሀጎስ ሁልጊዜው ሃይለማርያምን ሆፐ ህዝቤ ሃይማኖታቸውን ህሸ ሃይሌን ሃይለማሪያም ሁሎችም ሃድያ ሀረር ሁሰን ሀብቶም ህትመቶች ሆነውም ሃያል ሁለትዮሽ ህእ ህዋሳት ሆስፒታሎችም ህዋ ህወሃትና ሃንስ ሆስተስ ህማማት ሁኔታዎቹን ሃይላቸውን ሁኚ ህንድና ሄክቶ ህንድን ሀይለስላሴ ሀብቷን ሆኑት ህፀፅ ሃሳቡም ሂዱና ሆናቸው ሁኖው ህፃናትም ሄደሽ ሀበሾች ህጋዊነቱን ሁካታ ሀይማኖተኛ ሆላንዳዊው ሆስፒታሉን ሄክታሩን ህገመንግሥቱ ሃይድሮ ሁኔታዋ ሂጅራ ህልውናቸውን ሃገሮችም ህገወጥነትን ሆሎኮስት ሆዷን ሄሪተጅ ሆንኩኝ ሂሊኮፕተሮች ሆኔሽ ሃምሣኛ ሀተታ ሄደና ሆኗቸው ህልውናዋን ሂደው ህልውናዋ ሆማር ሃይማኖቶችን ሁለትን ሃይለኛ ሃርበኛታት ሃዋሳ ሄዶአል ሃገራቱ ህያዉ ሃላፊዎችን ህዝቡንና ህንፃና ሂደቶችና ሀላፊነቱን ሃቪየር ህይወትም ሀይ ሃገራትና ሆርስት ሄሮድስ ሂሳቦች ህጉም ሁሉጊዜ ሃይማኖቱን ሂደቶቹ ህጻናቱን ሄነከንስ ሃላፊዎችም ሃሺም ሄሮይን ሆኜም ሃብታችን ህንዳዊያን ሀገራችንንም ሆነውበታል ሃቁን ሀኪሙ ሃዘንና ሁንዴሳ ሀብል ሁለታችሁ ሀሳቤ ህዘቦች ህዝቦቿን ህሊናዬም ሀይልን ሆነሽ ሆነባት ሀብትነት ሆልደር ሆራ ህልምና ሁነቶች ሀሳብም ሁዳ ሆኖት ሃላፊነትና ሃያና ሀገራትም ሀያሁለት";
            amharicWords[0, 6] = "ሀሰንና ህዝቦቹ ሃጢያቱ ህዝቦቻቸው ሆቴስ ህብርተሰብ ሃላፊዎቹም ሁቱ ህጋዊነትና ሁለንተናዋ ሀይቅ ሀይለማርያምን ሃሣቦችን ሃራሬ ህመምን ሆኔታ ሁለተኛውና ህወሐት ሆኗቸዋል ሃይሌና ሃሣብን ሆራይዘን ሃገርና ሀፍረት ሁሴንና ህይወቷ ህጋዊነትን ሁሴንን ሃረርጌ ህሊናቸውን ሀይማኖታዊ ሃቀኛ ሄዳችሁ ሆንሽ ሀብትም ሀይሌ ሀብተ ሃዋላ ህገወጥና ሆነብኝ ሃንሰን ህወሓትና ህክምናን ሂቦንጎ ህም ሄሊኮፕተሮችና ሃዲስ ሆርቲካልቸር ሄሊኮፕተሯ ሀላፊው ሁነታ ሀይለየሱስ ሄንሪ ህዱር ህፃኗ ህዝብንና ሃደራ ሆዳቸው ህብረተሠብ ሄድሁ ሀገራችሁ ህመማቸው ሂሳባቸው ሂትለር ሃገሪቷን ህንፃዎችን ሀውልቱ ሂል ሃዲድ ሀሳቤን ሁለተኛዉ ሆነኝ ሂድና ህገመንግሥት ሆኖብኛል ህብር ሁመራን ሁከቱን ህልውናችንን ሂደታዊ ሀይሎችን ሂዶ ሂጂ ሃይሎችና ሃንድስተን ሃቨል ሀምሳ ሂደታቸውን ሃገሮችና ሀጂ ሀጢያት ሀብታችን ህንዳውያን ህብርተሰቡ ህመሙ ሆንግ ሃምሣ ሃዱሽ ሄንግሎ ሀውስ ሃያላን ሀውልቱን ህይወቴ ህሙማኑ ሁነን ሁርሶ ሁዳድ ሃሣቡ ሁኝ ህግጋት ሃፍረት ሃይ ህይወቴን ሄጃለሁ ህጎችንና ሃፋሽ ሃሳቧን ህዝቡንም ሀገሮችም ሆስፒታልም ሃሜት ሁልግዜም ሂርጳሳ ሃምሳኛ ሁኔታዎቹ ህበረት ሁመራና ሂሳዊ ሃሳቤን ሆንክ ሀረጥ ሃኪምዎን ህንፃን ህውሃቶች ሃይላይ ሁለተና ሁከትን ህቡዕ ሃሳቦቹን ህበረተሰቡ ሃይማኖቱ ሄድኩና ሆኖናል ሀቢባ ሃብተወልድ ሆረስት ሃይለስላሴ ሄድኩኝ ህሊናዬ ህንፃም ሄግል ህዝቦቿ ሆነም ህፃኑ ሆፕኪንስ ሃረር ህልፈት ሆንሁ ህልማቸውን ሁናችሁ ሆሆ ሆነባቸው ሀይልና ሃብታችንን ሀሜት ሀዲድ ህልውናቸው ሁከቶች ሁነቶችን";
            amharicWords[0, 7] = "ህጻናትና ህብረትም ሆኛለሁ ሃይማኖታዊና ሄክታሩ ህግም ህምራ ሁ ሂሊኮፕተር ሃኪም ሀላፊዎች ሁለተኛዋ ሃገራችንን ሆዱን ሃሳባቸው ሃብቴ ሃኪሞች ህሩይ ሃተታ ሁለትም ሁኔታዎችና ህዝባችንን ሃይለማርያም ሃገራቸውን ሁላችሁም ሄደህ ሂላሪ ሆቴሎችን ሀቅን ሆል ሀይለማሪያም ሁኔታቸው ህዝቡና ሀሙስ ህገመንግስቱን ሀምሌ ሀገራትን ህገመንግሥቱን ሁላችን ህላዌ ህልውናና ሂሩት ሀሳቡ ሃይሉን ሁኜ ሀገሪቷን ሃሣቦች ህሊናቸው ሀሁ ሄልዝ ህልውናውን ሃርነት ሃይማኖትና ሂሳባቸውን ህክምናቸውን ሁኔታቸውን ሃለቃ ሃሳቦችና ሀብታቸውን ህበረተሰብ ሀብታሞች ሂዎት ሁለተናዊ ሀገራቸውን ሀዋሳ ህወሃት ሆንን ህልውናው ህዝቧ ሃላፊና ሆቴሉን ሁለ ሃጎስ ሃገርን ሆዴን ሁኔታዎችም ህግጋትን ህዝባዊና ህገወጦች ሆኖብናል ሃይማኖታችንን ሆዴ ህመምና ሆኖባቸው ህገወጦችን ሀገሮችን ሆርዶፋ ሃይቆች ህመሞች ሂስና ሃገሪቷ ሁኔት ሆኖኛል ሀሰተኛ ሆኘ ሀሳባቸው ሆስፒታሎችን ሆደ ሃረካት ሆፕ ህዝቧን ሆዳም ህያዋን ሀሳቦችን ህዝባቸው ሂውስተን ሃገሬ ሃዘናቸውን ሄዋን ሃገራዊና ሃይላችን ሁና ሀበሻ ሆለታ ሀውልትና ሃለዋ ሂሳቡን ሃ ሃላፊነትን ህብረተሰቡንና ህፃናትንና ህፃናቶች ሃላፊዎቹ ሀብታቸው ሀብቷ ሀቁ ሁንዴ ሆነበት ሁኔታውንም ህፃናቱን ሃሣቡን ሄድን ህዋስ ሁከቱ ህይወታዊ ሀቁን ህንጻዎችን ሃይማኖትም ሀገሪቷ ሀሳብና ሆኖበት ሀገርም ህንፃው ህብረተሰብአዊ ሀኪም ህይወታችን ሆሊውድ ሃጃጆች ሃውልትን ሆልብሩክ ሄኖክ ሁኑልኝ ሃሳባችንን ሀገራቱ";
            amharicWords[0, 8] = "ሀይማኖት ሀገራቸው ሁሌም ሁላ ህንጻዎች ሆ ሃያን ሀገራችንን ህሊና ህልም ሂዩማን ህይወትና ሀላፊ ህዝባችን ሆላንድ ሆነና ህብረ ሄግ ሁከትና ሁነኛ ህጋዊነት ሃብቶች ሂደትም ሀገርን ሁለተኛና ህትመት ህብረትን ህይወቱን ሀውልት ሃብታሙ ሆስኒ ሀሳቦች ሃይቅ ሂድ ሃብቶችን ሆቴሎችና ሃላፊነታቸውን ሂደቶችን ሀሳብን ሃጂ ሁነው ሁለታችንም ሂልተን ሄደን ሃይማኖትን ህዝቢ ህጋዊና ሃገረ ሆቴልና ህይወትን ሀገሩን ሁመራ ሆናችሁ ሃሳብና ሀይሉ ሃይልን ሁናቴ ሁልጊዜም ሀገሩ ሃይማኖቶች ህብረተሰቡና ህገመንግስታዊ ሆቴሉ ህብረተሰብም ሃገሪቱን ሄደች ህውሃት ህጻን ህፃናቱ ህጎችና ሄዳ ህክምናና ሆድና ህሙማንን ሃይንላይን ህወሓቶች ሃይለ ህብረተሰብን ሁለቴ ሆርን ሆኖባቸዋል ሁዋላ ሃላፊዋ ሆኖበታል ህወሃቶች ሃሰት ህመምተኞች ሆዱ ሄራልድ ሁላችንንም ህክምናውን ሃብቱን ሃውስ ሀብቶች ሃላፊነቱን ሂዱ ሀሳቡን ህላዊ ሆስፒታልና ሆስፒታልን ሀብታሙ ሀሳባቸውን ህብረቱን ህጎችን ህገመንግስት ሆሳዕና ሃምሌ ሆነህ ህዝቦችና ሆነናል ሁኔታውም ሀብቱ ሃገሩን ሆኖታል ሁን ሂሳቡ ሃይልና ህክምናው ሂደታቸው ህብረተሰብና ሀገርና ሂውማን ሃና ሆቴልን ሁኑ ሀገሬን ህ ሃብታም ህዝባቸውን ሂደቱም ሃብቱ ሄንዝ ሃላፊነቱ ህገመንግሥታዊ ሀብቱን ሁነኛው ሆስፒታሎችና ህያው ሀሰት ህወሓትን ሀገርንና ህወሀት ሃገሮችን ሃገሩ ሀቀኛ ሀብትን ሃሣባቸውን ሄለን ሃሳብም ሀረካት ሃላፊዎችና ሆነዉ ሆንኩ ሃብታቸውን ሀሰን ሃገራትን ሁሌ ሄሊኮፕተሮችን";
            amharicWords[0, 9] = "ሀ ሁኔታ ሁሉ ሁለት ሆነ ሂደት ሆኖ ህዝብ ሆነው ሁሉም ህብረት ሃሳብ ሁለቱ ሄክታር ህግ ሆኖም ህዝቦች ሆቴል ሁለተኛ ሆኗል ሁለቱም ሁኔታዎች ህብረተሰቡ ሆስፒታል ህዳር ሀገር ሃይል ህብረተሰብ ሃብት ህገ ህዝቡ ሁኔታውን ሃገር ሁሴን ሀብት ህይወት ሁኔታው ህፃናት ህጋዊ ህክምና ሆኑ ሃላፊ ሁሉንም ሁኔታዎችን ሆነዋል ሁለተኛው ሃገሮች ሄደው ሂደቱ ሁለገብ ሃያ ህዝባዊ ሆና ሁከት ሁለንተናዊ ሁለቱን ህብረተሰቡን ህዝቡን ሃይሎች ህገወጥ ሃገራት ሆን ሃይማኖት ህጉ ሂሳብ ሁኔታን ህብረቱ ሁላችንም ሀሳብ ሂደቱን ሃላፊው ሄዶ ሁሉን ህዝብና ሃላፊነት ሁኔታም ህልውና ሃሣብ ሁልጊዜ ሃሳቦች ህንፃ ሆስፒታሎች ሁኔታና ህጻናት ህወሓት ሂደቶች ህዳሴ ሃሳቡን ሀገሮች ህመም ሆቴሎች ሆነን ህዝብን ሆኖአል ሆይ ሀገራት ሃሰን ህግና ሁለቱንም ሆናለች ሃይሉ ሀ ሃላፊዎች ህፃናትን ሀገረ ሀገራችን ሃይማኖታዊ ሃይሌ ሃገራቸው ሆድ ህብረትና ሀገራዊ ሀይል ሄደ ሃሳባቸውን ሃምሳ ሆስፒታሉ ሂደትና ሄዱ ሃገሪቱ ሃሳብን ሁለትና ሆኜ ህይወታቸውን ሆነች ሃሳቦችን ህግን ህይወታቸው ህፃን ሁኖ ሂደትን ህጎች ሀቅ ህንድ ሃብትን ህጉን ሃሳቡ ሂስ ሃገራዊ ሀገሬ ሀይለማርያም ሀገሪቱ ሀብትና ሄደዋል ሄጄ ህጻናትን ሀብታም ሁለተኛውን ሀይሎች ሃገራችን ህዝበ ሄሊኮፕተር ሃብትና ህሙማን ሃቅ ህዝብም ህዝቦችን ህፃናትና ሀላፊነት ህዝቡም ሀያ ህንጻ ሃዘን ህብረተሰቡም ሄሊኮፕተሮች ሀዘን ሁል ህይወቱ ሃውልት ሃይሎችን ሄዷል ሀገሪቱን ሃሰተኛ ህንፃዎች ሃሙስ ሂሣብ";
            
           
            
            amharicWords[1, 0] = "ለሚያስተዳድራቸው ለማጠንከርና ሊሠጥ ለተከሰሱት ለተቋቋሙት ሊታደጋቸው ለማስመሰልና ሊያውክ ለነደፋቸው ሊነጣጠሉ ልብስን ልግስና ለመቀለብ ልሒድ ለመመገብ ልዩና ሊያደርጋቸው ለአቅመ ሊሰጠን ሊራዘም ለባንክ ለምሥራቅ ለጥፋት ለአስኳል ለሁላችንም ለቀዋል ላቀረበችው ለ ላይ ልማት ለማድረግ ልዩ ሌሎች ሌላ ለዋልታ ለውጥ ለማወቅ ለኢትዮጵያ ለመከላከል ለምን ለመስጠት ሊቀመንበር ለማሳደግ ለማረጋገጥ ልጅ ሊቀርብባቸው ልታሸሽ ለሚጠብቋቸው ለተመሰረተ ሊበጠር ልቦናዬ ሊሸውድ ሊያመጡት ሊጨርሱን ለሚያምኑ ለዛምቢያዋ ለመናጢ ሊያሳፍራቸው ልቦች ልትሰጣቸው ለሚወስዳቸው ለምፃም ለፒዮስ ላዕሌሃ ልናደንቅለት ለዋሾዎች ለግብፆች ለሚያመርተው ለውይይቶችና ሌጋል ለሀቅ ሊበከል ልንማርበት ልፍጠር ለመፈክር ለዘራችን ለውቅያኖስ ሊሳተፉበት ለማዳመጥና ለባህላችን ሊበታትነን ሊደፋፈሩ ለማለፋቸው ሊቃውንትን ላዕለ ለግቡ ለመሰረቱት ሊያስለቅቋቸው ልከላከልላቸው ለማረጋገጫ ለሀይማኖቱም ላለመከሰቱ ሊከራከሩና ለመቁረስ ለሙን ላይቀርላቸው ልትፈርዱት ልጣጭና ለእህቴ ለጸሐፊነት ሊያፈጥብኝ ሊያደናቅፋት ለቁሣዊ ለጓደኞቻቸው ሊመስሉ ላምነው ለመርዝ ሌሎች የአልኮሆል ልታስቀጥለው ላለመተርጎም ሊቀርፅ ለወገብ ሊወለድ ልጽፍልዎ ሊጋፈጡት ለሕሊናዬ ሊያቃኑ ለዝክረ ሊያስፈርሱ ለቤታችን ሊጎናፀፍ ለሙዚቀኞች ለመጠርነፍ ለጥራቱ ለማሳጠርም ሌሞዚን ሊያስተባብሩን ለህሊናችን ለሐኪም ሊያሻሽለዉ ለማያለማው ለሰባትና ልቅር ለሰብአዊነት ላካስ ለጉዲፈቻ ሌላቸው ልኬልሃለው ልሣነ ሊታከሙ ለየእለቱ ለወዳጆቻቸው ለእርቅና ለመገናኘትም ሌኒንም ልባቸውንና ለመጽናናት ልምረው ለመፈንዳት ለጠላቶቹ ለላከው ለፈጣሪም ሊወረስ ላለማወቅ ለሚናገሩትን ልቅቅ ለመታዘዝ ልንካው ሊያድጉበት ለመጥፋትም ለመዋዋል ለተሰናበተ ሊሸጣቸው ለጥቂቶቹ ሊያስወግዱት ለጠላቶቿ ለሚጥሩ ለተሰጠኝ ለራሳቸዉም ለጠላቸው ለዛማሌክ ለሠራተኛዋ ልንጠይቀው ሊያናግሩን ለድረግ ለማስገደድም ለሚጥሱ ለፍኮው ለማስፈጸምና ላይስምምነትንና ለእኔማ ሊያመነጩ ለቀጠለው ሊጠቀስና ሊሰራለት ለበደልና ለጥምረቱ ለግርድናና ሊሞግት ለወሰንሰገድ ሊኖራቸውና ልምላሜዋ ልትቀየር ለድብድብ ለጎረቤቱ ሊያደርሰን ልቀቁልን ለመሆሉ ለመማገጥ ለፍርፋሪ ሊጠብቃት ልታዘዝ ለምንገነባው ልክፍተ ለእነዚያ ላስተማራቸዉ ላላው ለሚተላለፈው ለኅሊናቸው ሊያሳጣን ልንቃወመው ሊያስገባው";
            amharicWords[1, 1] = "ሊወስዱት ላለመድገም ለሕይወቱ ለጦርነትና ላይታይ ለከፈተው ለመጋዘን ለቀለም ለወገኔ ለማይፈልጉት ለህሊና ላደረጋቸው ለይምሰል ለሚኒስቴሩ ለግዥ ለደረጃ ልዕልናን ላስቀምጥ ለቴሌቪዥን ለስዎ ሊዋጋ ለሚወጡ ለኢንተርናሽናል ላጣው ሊሞ ለሚከታተለው ሊነግረን ለእሥራትና ሊጠቁ ላብራቶሪዎች ለምዝበራ ለጉራጌ ሊተካ ለመብቱ ልከናል ለማቃናት ልንገርዎ ለአባላትና ለማስኬድ ሊገፋበት ሊፈፅሙ ለአነስተኛ ልንል ለማስወንጀል ሌሊቶች ሊፈተኑ ለውጧታል ሊያቆይ ለተረዳን ሊጥሉት ለሀገራችሁ ለድፍን ሊፈተን ለማጋለጥም ላለመሰለፍ ላስፈፀሙት ለብሶት ለሙዚቃው ልጆቿንም ለማባባስና ለገደላችሁት ለጨቋኞች ለመቃም ለምእመኑ ለጋና ለሠሩ ሊበቅልብህ ሊቆጠሩ ሊሟላ ሊከፈለው ሊዘህ ልጠብቅ ለክርስቲያን ለተሳሰሩት ለቢሮና ለራዕይ ሊዘል ለልመናና ሊደፋ ለባሕል ለማያጣራው ላይፈታ ለሚያውቁት ለበዓሉም ለሚመረቁ ልትለው ለማያምኑበት ሊከበሩላቸው ሊበሳጩብኝ ለመደራዳር ለመለመድ ላለብን ለሱዳንም ለብሶና ላጉርስህ ለሱም ሊያናግሯቸውም ሊያወሩ ለመቀጣጫ ለተሻሻለ ለዓረቡ ለወንዶቹ ለሚታገሉት ላደረከው ለምንመኘው ሊጨብጥ ለብሰውታል ሊኮሩ ለመቆረጥ ላሳተመው ሊጠቅመን ለመንደፍም ለዲኑ ለዳያስፖራው ላነሱ ለፍለጋ ለሜድረገው ላነሳ ልናሸንፋቸው ለጥረታቸው ሊፈትሹ ላለመጋለጥ ለማርባት ለጥቀው ሊበራሎች ለመፈታቱ ለባህርና ለማስተኛት ለሕንፃው ላኩት ልገልጽልዎ ለመመስረቱ ሊቀዱ ለጎሳቸው ሉዊስና ሊነግሩኝ ለተመልካቹ ለመጎሰም ላቀረቡለት ላገኘናቸው ለፌስቲቫሉ ለሒሳብ ለቂም ለምፅፋቸው ለድጋፉም ለጃንሜዳ ለዴሞክራሲያዊና ለሚጓዘው ሊሻክር ለኤጲስ ለሃቅና ለማሾምጥረው ለጥሻ ልብሽ ሊስተው ልትሠራበት ልቃቂቱ ላምበረት ልንጠቁም ልጋልባችሑ ሊያለያዩትበሚጥሩት ሊያዛባው ለጣለባቸው ሊያወርድ ሊቀጭ ለብልጣብልጥነት ለጣውላ ላፉት ለተለመደው ለጌታዬ ለእስረኛው ለጥቅማጥቅም ልያዝ ለእነነርሱ ሉያንግ ላደረሰባቸው ላሞኛችሁን ሊገምቱ ልክፈል ሊሸፍነዉ ለቤተሰቦቹና ለመጠመቅ ልጅነትን ለዳይሬክተሮች ሊመሰርትባቸው ለኮንትራክተሩም ላይብረሪና ለሕሊናና ሊፈቀድለት ለመጸዳዳት ላለመያዝና ለደብር ለፍጥጫ ለምትወዱ ሊያሳስበን ለምሆኑ ለተመጋቢ ለቭላድሚር ለዳንስ ለማኒስትሩ ላደርሰዎ ሊሰኙ ሊረሱ ልኡካኑን ለኣንተ ሊጨምረው ሊፈጠርላቸው ለሕወሀት ልንይዝ ለማነጋገርም ሊቃውንትቱ ለመድን ለሆነች ለወጠ ለሁለተኛና ሊሰካ ለመፈልፈል ሊያስማሙ ላይገናኝ ለሚላቸው ለጉልበትና ሊመራን ለሚቀርቧቸው ለጎራባች ለተሠራ ለኤፌሶን ለመተርጎምና ለቤተክርስቲያናት ለጠበቆቹ ልሳኖችን ለመሳለም ልናደርጋት ለባህላቸው ለጭፈራ ሊዘጋቸው ለመግለጽም ሊያፈርሱት ሊጤኑ ለጭቁኑ ለቁራጭ ሊመልሷቸው ለሁለትኛው ለመፍሰስ ሊያስረዱኝ ሊያገኙን ላወጋችሁ ልጅት ላቀረቡዋቸው ላክሳቲቭ ለሕትምት ለገጠማት ለመክሸፋቸው ሊልከው ሊገነባላቸው ለፓርቲዬ ሊያመላክቱ ለመሸማገል ልታጣው ሊሰማም ለልጆቻችንና ለመሰጠቱ ለማፍታታት ለብሩክ ሊወር ለዕርምጃ ለሚጠይቁት ልናረጋግጥላችሁ ሊያገኙኝ ሊያስደንቀን ላስተላለፈላቸው ለዩኒቨርሲቲዎች ሊቆጥሩ ለቃሚዎቹ ለማይቆይና ለምንድንነው ለክፍተቱ ለመንደሩ ሊያመላክት ለመዳንና ሊረዱልን ለሚከታል ለእሱና ሊወልዱኝ ለድምፃዊት ሊገለጽልን ሊጠሩበት ለካህኑም ለሃገራቸውና ሌባውም ለመባረክ ለካድሬዎቻቸው ላይረዱት ለማያቋርጥ ልንይዘው ለማነኛውም ለዛሬዎቹ ለሚያከማቹ ሊያጋጫቸው ልትወጣው ለሰሊጥ ለመቅሰፍት ለእርስዎና ለዕቅድ ሊናገሩት ለጉልበተኛው ለዶሮም ልንመረቅ ለኤኮኖሚ ሊያደርጋትይመኛል ለከተማውም ሊያንገላቱትም ሊንዱ ሊያጥረን ለጤንነታቸው ሊቆጥሩት ሊያስመስሏቸው ለህወሓቶች ሊጨርሱት ለማለዳ ላይክ ለመስጊድ ለሚቆሙ ለሚያሳስት ሊመለከቱት ሊረካ ልናወራ ለሆዳቸዉ ላገልግል ልሁንለትና ለሚያበረክቱት ለባለድርሻዎች ለፋሺስቱ ላኪዎቹ ለዘልአለሙ ለመገናኝት ለባእዳኑ ለሚቀረፀው ልውሰዳችሁ ልንገዛ ለዘመናችን ለተስተናገዱበት ለኤሮስፔስ ለመመለስዎ ለሚጠቀምበት ልውደደው ለባሽዋ ሊጋው ላወጣውና ልነሳ ለሆነዉ ልነስ ላለመኖር ሊያስነሱ ላፎንቴን ለተሰማሩትም ለቀሙት ለመነዳት ላለማሰልቸት ልንወስድ ለመጥ ልቀምስላችሁ ልታሳካ ልማትንም ለመቅጠፍ ሊጽፍ ለዲያቆን ለሰይፉ ልደታቸው ለሰራቸው ሊያስፍቃት ለብሪታንያ ለሃይማኖታቸውና ልናስብ ለበርሀ ሊቃናት ለማከምም ሊያወጣና ልንተወው ልንቀበላቸው ለጥፋ ሊታሰበን ለማንበርከክና ለተሰበሰብነው ለመንጋው ሌላውማ ሊያስጨንቀን ልሽቀት ልዑላንና ለእግዚአበሐር ሊያረካ ለማይባል ለራሳቸዉ ልናሳጥረው ላደርጋቸው ለማደንዘዝ ለመጋባት ለሚደራጁት ለውበት ላላሉ ላሊጋ ለመዋኘት ለመካተት ሊባኖስና ለጎበና ሉሲዎቹ ለሚደረገዉ ለሚተላለፉ";
            amharicWords[1, 2] = "ልሂቃኑም ለወራትና ለቤተክርስቲያናቸው ለሰከንድም ለመጽሐፉ ሊክሳቸው ለእንክርት ልናወጋ ላንቃም ለክፍፍልና ሊገነጠሉ ለተረገጠው ሊቃና ለወገኖቿ ሌሎቻችንን ለጨፈጨፈው ላልተፈለጉ ለደካማው ለይተሽ ለዜማ ላለመፍቀድ ልሂቃናቱ ሊመረቅ ለመንጎቿ ለሚኖራቸው ሌሊሣን ለብዙሐኑ ሊፈራረሙት ላበረከተችው ለጀርባ ለመከላኪያ ለግዜዉ ሊሆንብን ለመልቀቃቸው ለፉት ልገልጽልህ ለእግዚአብሔርም ለማዕከል ለቋንቋቸው ለብሄራችን ለሰርካለሞቻችን ለደጋፊነት ሊመሰገንም ለሚገነባቸው ሊዘነጉት ለምናውቅ ለሚያንሱ ለማቅርብ ለመፈተሽም ሊለይ ሊወርስ ለሚጓዝ ለመቃወምም ሊያሳስብና ልትወስደው ሊተወው ሌዝቢያን ለጉመው ለድርጅቱና ላንድክሩዘሯ ለወትሮዉ ለሚያምኑት ለኩባንያዎቹ ለመዘጋት ለዘረኝነትና ለሚያዙ ላጠቃልል ልስን ለእህቶቿ ለመስለብ ለመገዳደል ሊዝናኑበት ልከራከር ሊያንሳት ሊቀነስና ለሚሌኒየም ለማስተማሪያነትና ለሚመሯቸው ሉቃስና ሊሽሯቸው ለሚያጋጥሙት ለባሱት ለደረሱን ለማንዴላ ለማሊ ሊወረውሩ ለሚኒስትርነት ለሕንዱ ለመበትንም ሊታደስላቸው ሊሉም ለመሆነ ለቁልፍ ልዖላዊነት ለመታመን ልወደው ለተስፋና ለማህበረ ለሚመረጥ ልሾም ለማክረር ሊያሳስቡ ለሚገነዘብ ለቅርሶቹ ሊያበላሽበት ሊተኮስ ሊጠበቅለት ለመሳደብ ሊዘነጥል ሌቦቹንና ሊማርባቸው ሊለያየን ልተኛ ሊያሳልፋቸው ለጠበቀ ልጫወት ልኬዋለሁ ለሁዳ ለቅርሶች ለየትኛዉም ላንዳንዶች ለእንስሳ ለሌሊቱ ለምጥረግ ልንገራችሁና ሊበደር ለመመካካር ለባለጠመንጃው ለማድግ ለማይሰጡ ሊጣረሱ ልዕና ለመደበኛው ሊዝበን ለምሽቱ ለየፓርቲዎቹ ልህልና ለማስወጣትና ላርሰን ሊጠነቀቁና ላስቸገረው ልወስድ ሊተውት ሊያዩም ላይተገብሩት ለጸጥታ ሊያስቀድሙ ለከተማዋም ለቂሊጦ ልቡናና ለእስራኤሉ ለቤተክርስትያን ሊሳት ሊያስወጣቸው ልቀቱን ልፋቱ ለእግርኳሱ ለባህረ ለመጠራጠር ላጨበት ለመላስ ለጥፈውበት ላልሰጡት ላቀረቡልን ለየብቻው ለጋዜጠኛነት ልጥቀሰው ለመብታቸዉ ሊያነሱ ላላያችሁት ለዓላማዬ ለሌ ለምእመናኑ ልትቀሩ ልለፈው ሊያባብሰው ለሚተቹት ለመከመር ልቦናውን ልትቀር ሊወስዱበት ለማጭብርበር ለማብራሪያ ለዘፈን ልበልሃ ለቃለሁ ሊያስቀኝ ልታስተናግድ ለሕገወጦች ለመለገስና ሊወክልና ሊፈነዳና ሊወለድና ሊወዱት ለመጠፋፋት ሊበራሊዝምን ልብሶቹ ሌብል ላስተዋውቃችሁ ለማዳላት ለኦሮሞውም ለማሳያነትም ለኅብረተሰቡም ለማስፈንም ለዘጠና ለተሰደዱ ለመሥርያ ሊገፉት ልጅህም ለውጥኑ ለወንዶገነት ለመጻሕፍት ለልጆቹም ለበዓለ ለካፒታሊዝም ለመተረጎም ለማሸበር ለማስረክብ ለመሻትና ለደማቅ ለእህታቸው ለጠራራ ላይከፍት ለማታልፍ ለመኩራራት ለዝናና ለሊብያ ለማስፈጸምም ለጠበኛ ለሚፈልሱ ልብሳችንን ለዘመናዊው ለሬስቶራንት ለኬ ለክለቡም ለመክበርና ሌለዉ ለሚልክልኝ ለሊግ ለኮሚቴውና ሊያነብ ለኳስ ላላችሁ ለወንዙ ለመስለብና ልናስታውሳችሁ ሊመስልህ ለማያ ሊያስቀሩት ሊያፀድቀው ልጨርሰው ሊያዜሙ ሊያስጀምሩ ሊኖራችሁ ለጠብም ለጥሩነሽ ልባችንም ለመማማር ሊገለባበጥ ልታገኘኝ ልነግርዎ ሊዋጥላቸው ለካድሬ ለመልማት ላጫውትህ ሊያስቀድሱ ለእናንተው ለባለዕዳው ለየራሳቸው ለምጥቀስ ለሒደቱ ለሚሄድ ሊያነጣጥሉ ለጥንካሬዬ ላያውቁት ለቆመ ለህዘብ ለማሻረክ ለወላድ ለሚጠበቁ ላልታሰበለት ለቤተሰባችን ላለማስደሰት ልናዝንላቸው ለለውጥና ላለማድማት ለተሰበሳቢዎች ሊመራመርበት ለሚያንሱት ለዝች ለባዛር ልዩነታችሁን ለእነዚህና ለማዕከላዊው ለጠጠር ልናውቃቸው ለቤኒሻንጉል ለእንግሊዞች ለማሳሰብና ለወደዳቸው ሊመሰርቱባቸው ልተውና ለማፋጥን ለጠቆመ ለእናታችን ሊያነጋግረን ለሚያተራምስ ለብዙም ልናስብበትና ለቤቱና ሊሰቅሉ ለፍቅረ ለፍቅሩ ለማንጻት ሊሉኝም 