ራለት ለሚከፈቱት ሊጋልብህ ልባይ ለብሮድካስት ለሰማ ለክርስቲያኑም ሌቱም ለማላበስ ለህገመንግሰቱ ሊጨበጥ ለመታገስ ለከንፈር ለማጁም ለመመደብም ሊታሰብባቸው ሊያማርሩ ላለመጋፋት ልናስተላልፍ ለግርፋት ለቤተሰቡና ሊቀድም ለሚጋፈጣቸው ልናስታውስ ልገላገል ለገዢዎችና ለሐሰት ሊያስወግዷቸው ሊያስቡበትና ለዘረፋው ለእንቅልፋችን ሊያነብበው ለመምጠጥ ለምትሉ ለግለሰቦችና ለማርዘም ሊቆምና ለተሰጠበት ለማመሳሰል ልንባል ሊያስብበትና ለመጠቆምና ሊያስመስሉ ላለመድረሱ ሊኾናቸው ለተሰጠ ለሚያስገነባቸው ለማስኮብለል ላሳለፋቸው ለዬቅል ለተቃራኒ ላይወዱት ሊያጥር ሊያወድም ልከውልኝ ለማስደመም ልኮልናል ሊያድናት ለሕገመንግሥቱ ሊያጎለብቱ ለጎንደር ሊከፈለኝ ሌሶቶ ለፎር ለባዕዳንና ልንፋረደው ለህረር ለቀቁብን ሊያረግዙ ላምቩዲን ሊፈጠርበት ለመግራት ልቀቀውና ሊፈጥረው ሊፐብሊክን ላጠቃል ለገራዥ ለምናቀርብ ሊጻፍ ልጃችሁ ልንገርዎትማ ለመከሰስ ልጠይቃቸው ለጥፈዋለሁ ለክስና ልማታዊነት ለማሞቅ ላቦራቶር ለሙሶሊኒ ለማላላት ለውሣኔው ላሳዩበት ለጾታዊ ለእርሷም ለማሣደድ ለፈረሙት ላፍታም ሊጣራ ሊቆጨው ለማጧጧፍና ለሀገራችንና ለማንናውም ለዝምታ ለወገንና ልቡናችን ልንከተል ለዕንግልት ለጋምካ ለተቀላቀሉት ሊገድላቸው ልሰልስህ ለሚስተዋሉ ለመፈጸምና ልትመርጥ ሌሊሳን ለፓርኪንግ ሌላዉንም ለማዘጋት ሊባልበት ለጀሌዎቹ ለማንነቱ ልጆቼንና ልኮታል ለሚኒስቴሩና ሉይስ ለማጥለቅለቅ ለባል ሊከብደን ለቋንቋዎቹ ለሚያዘጋጁት ለፕሬዘዳንት ሊንክድኢንን ሊያስቀራቸው ላለመዳፈርና ልትፈጥር ለፆሙ ላዘጋጀው ለፊሊፒናውያን ለቁጣችን ልትለን ሊሰብክላቸው ሊንድብሉም ለሃሳቡ ለመንከራተት ላለማለፍ ሊያበሳጫቸው ለሙሰኞች ልንመልሳቸው ሊያሰኙ ለፕሮቶኮል ለዘዝ ሌለውም ሊነግሩት ሊገልጹት ሊያስብላት ለማሽን ለማብጀት ልንጋለጥ ለልማቷ ለምደገፍ ላሳድግበት ለመከፈል ለወፎች ለመስተማር ለማሸበርና ለመንፈሳዊነት ልመዱ ለመሳሳብ ለማስተግበር ለማሠራትና ልጃቸዉ ለምእራባዉያን ለመናገርና ልንሰብረው ሊያግዘን";
            amharicWords[1, 3] = "ላስተዋለ ለቀም ልጠይቅዎ ለማራገብ ለአሳር ላለመቀማት ለማስቀጠልም ላላነሱ ሊስማሙ ልስጥዎ ላመረቱት ለእለ ለፓትሪያርኩ ለተመዘገቡ ሊዘከሩ ለመሳተፍና ለጉዱ ሊሆኑበት ለኅሊናዊ ላልከው ለግብፅና ለቀሪ ልታካሂድ ልሸጥ ለውጤታማነት ሊጠይቁዋቸው ሊያጠቁ ልገልፀው ልፋታቸው ለሊቢያ ላማደበር ለትግራዩ ለሚሟገትላት ሌዕላአ ልባስ ለዩኒሴፍ ለህይወትህ ለውንጀላ ለማድፍረስ ለመሰኘት ለማክበረ ለዘማች ለዲያስፖራ ሊያደርግባቸው ለመንግስትም ሊመጣና ላቀረብናቸው ለማክሸፍም ለቀሽ ሊያተኩርበት ልናስተውለው ለሞኝ ሊቀመንበሩም ለማጣመም ልጥቀምህ ለቻይናዎች ሊንዱት ልሳንም ለምዶበት ሊያከናውናቸው ለልደታ ለሰውን ለአካባቢያዊ ለመበልጸግ ልትቀጥል ለጳጳስ ላስትን ላሳክም ለክለቦቹ ሊገባና ለሚያውቅ ለላብራቶሪ ሊደግፉት ልዩነታቸዉን ላይሳካ ላለመታየት ለምደዋል ልብንና ሊያሰጠው ለማርዳት ለበለፀጉ ለማእከላዊ ልመናቸውን ለሚለውና ላስቀምጠው ለማይጠቅም ላለመሄድ ለመታሠራቸው ለቤተክርስቲያናችን ለመጀመርያው ለመቀናቀን ሊገኝበት ለአንዳችን ሊችለው ለማጥባት ለወንድሞቹ ላገኛቸው ለፍቶ ለመሰለል ለኢንተርኔት ለፍቺ ለክፉም ሊፈጥርበት ላቤን ላበረታታችሁ ለተደፈሩ ለራሴድ ሊያቅፍ ሊከፍትብኝ ሎል ለሰበአዊ ለሰልፉ ለደጋ ለመጨረሻም ለመሪነት ለመትረፍ ለጌጣጌጥ ሊጠረጥር ልንቀሳቀስ ሊፈልጉ ሊፈርሱ ላለመምጣቱ ሊቀመንበርነቴ ለኢሕአዴግም ሊዋቀር ለከንቲባው ለተሟላ ለማስነገር ሊታይና ሊላቸው ለናርዶስ ላስገኙ ለሚያራምደው ሊያስቸግር ለጨርቃ ሊያሳምኑን ለሚፈለገው ለመረዳትም ለጠቃሚ ሊያቀራርብ ለታህሳሱ ሊያሰማ ለማባበል ሊያካሄዱ ሎቄ ላለመከላከል ሊመሰክረው ሊያስቆም ሎማኒ ለጋዜጠኞችም ለብልጽግና ለአፍሪካዊቷ ለወለጋ ላለቃ ለጉዞው ልፍ ለቡድናቸው ላለመምጣት ሊተገብር ለአለቆቻቸው ለሚያስተዳድሩት ለሚፈፀመው ሊሰራው ለእኛስ ለተከሰተባቸው ለማሸማቀቂያነት ለእምነታችን ሎቨ ለክርስቶስ ለጦርነትም ለማቃላለል ለምስክሯ ለሰከንድ ለፓኪስታን ለአደራዳሪዎቹ ሎቲ ለስድስተኛው ሊዝናና ለውህዳኑ ልጁንም ሎት ለሚታገሉ ሊያሰራ ላፕቶፖች ልዑለ ለከተሰተው ለዮሐንስ ለተለየ ለዞኖች ለተለዩ ለማነጋገርና ለገሰም ለማስጨነቅ ለማስተካከልም ሊያጠና ልንሠራ ለሚዋደቁት ለነፃነታችን ለአብዱል ሊወጉን ለኮማ ለቪዛ ለመስበክ ለማዋረድና ለተቀናሽ ለህይወቱ ላልታወቀ ሊያነጥፉ ለሚያምኑበት ለአንባቢዎቹ ለፋብሪካ ለሰብዓዊና ለክትትል ለተበዳሪዎች ለፍልስጥኤም ለተገኘውም ለምትፈልገው ለታዳጊው ሊከለከሉ ለህዝቦቿ ለማያንሱ ለማህሌት ለማወረድ ሊፈረድ ለእንግሊዙ ሊቀትጉሃን ለሰሚ ለመበዝበዝ ለቀረበላቸዉ ለሚገዙ ላለቁት ሊጠይቀኝ ሊከለከል ለታዳሚዎቹ ለማስተንፈስ ለምስክሮች ለቢን ለቀዶ ለነበረበት ለሰሩ ለልዑኩ ለማብጠልጠል ለማጠናክር ለቢሮነት ሊረጋገጡ ሊተገብሩት ለማስረጃነት ለአንባቢዎቼ ለአበዳሪዎች ለሩሲያ ሊያወያይ ለአባሎቹ ሎጋ ለሰማይ ለአክቲቪዝም ሎጎ ልናጤን ልትነፈግ ለመጨቆን ሌግዋሊያ ሊያራዝም ለመከለልና ልዕልተ ለማሣለፍ ለእዳ ለማለዘብና ለርክክቡ ለደጉም ለኅሊናችንና ለአጫጭር ለወያኔዎችና ለዛሬዋ ለእንግሊዟ ሎጥ ለዓለምአቀፍ ለአካባቢዋ ለአሸባሪዎች ለሰሜንዕዝ ለባለታሪኩ ልንገልጸው ለማሳለጥና ለዕውቀት ላሙን ለመጻፍም ለታና ላለመድረስ ልረፍ ለእንጦጦ ሊመነጭ ሊነፍጋቸው ለመከተብ ሊጣሉ ለታላላቅ ለይግባኝ ለማጠብ ለመፍጀት ለቀላል ላኩለት ለሚንቀሳቀሱት ለሸዋ ለምዶታል ለመላከክ ለብርሃንና ልፈልግ ለመጠየቅና ለዝምብ ለመሀል ለደረስንበት ላዘጋጅ ለአዳሪ ለኢቴቪ ለሲቪሉ ልዑኩም ሌጊዋላ ለሻዕቢያና ሊያብራሩ ልኳቸው ለፕሪሚየር ልዑክን ሊከተው ላወጡት ለሀገሩም ለመቆየ