 ለስታዲየሙ ልማር ሊጠይቋቸው ልለምንሽ ለሽርሙጥና ሉናር ለስብሃት ሊያሻሽለው ለእስረኛ ለክቡራን ለጠንካራ ሊሠጡ ለማሳደገ ለማውረድና ለወቀሳ ለክሳቸው ሊፕቬልድ ሊንቦርግ ለማሸጋገርም ልተግብራቸው ሊሂቃን ልትሰጧቸው ለተከሰተውና ሊፈነዱ ለመሆኑም ለስታዲየም ለአውስትራሊያ ለመገርሰስና ለማዬት ለጥቅማችን ልትሠሩ ለመግጨት ለዚህማ ላሸነፉ ለፈረንጅ ለአስፓልት ሊብሬሽን ለኅብረት ሊይዛቸው ለመኳንንቱ ለሕይወቴ ለእኝሁ ለቀስተኛውን ሊሰማው ለሉሲ ለሕዝቦቿ ለእኔም ለእናትነት ለሻዕብያ ሊነቀል ለወከላቸው ሊያሳስበው ለመወዱደር ልሰማት ለመገነጣጠል ላለውም ለመኮረጅ ለተጠያቂነት ሊያወጣው ልቧም ሊታገሏቸው ሊያስረዳንም ሊያደርግልን ለአሜሪካዊያን ለተካፈሉ ሊመክት ለህዳዊያን ሊያስተካክሉት ለመዛወር ለኩሉ ለፀቡ ለአስክሬን ለመሳሪያ ለአለው ለኃይለማርያም ለኮሚሽነሮችና ለኩል ለእስላሞች ለአስታራቂነት ሊያገኝበት ለመፈፀሙ ለመመላለስ ሌላዉም ሊዳኝ ሊገጥምህ ሊሞላቸው ላልሆኑት ለእነኝህ ላፈላልግ ሊቃረጡ ሊቀብሯት ለኩማ ለማሌዥያ ለምትለው ሊያቆያቸው ለውጦችም ልናርቃቸው ለመንኩት ለማስተባብርና ለገናዥ ሊቀለብሱ ለጎል ለመክሸፍ ላስፈራራው ለመሆንዋ ለመብላትና ለሚገኝበት ለመተላለፍ ለጽሑፍ ላይሰማም ለመጸለይ ለዲግሪ ለተመራቂዎች ሊዮናል ሎንሊ ለሚሹት ሉሙምባን ላለመወገን ላዘጋጅላቸው ልንጋፈጠው ሊፈነጭ ልታዪው ልወለድ ለተሰማሩባቸው ላይችሉ ለህመሙ ሊሰልሉት ሊከለክላቸው ልቦናችሁ ለመርማሪዎች ለቦሌ ለመፅሃፉ ሊምሩት ሊያስወስዱን ልንከታቸው ሊከሱ ሊደምቅ ለመገኘትም ለባላቸው ላይኖረን ሊሞግተኝ ለደቀመዛሙርቱ ለጄነራል ላስቀድም ለጠቋሚዎች ለጭፍን ሊያሰራችሁ ለዘረኞች ለመረጋጋት ለሆናችሁ ለመዋሸት ሊነገራቸው ሊቀይርና ሊቃዉንት ልጃቸውስ ለመዉደቅ ለህዳሴያችን ለቃቅመው ላካፍል ሊያን ለጥጋበኞቹም ለዛላምበሳ ለይስሐቅ ሊበክል ልቀትን ልቧን ለብራዚል ሊደብቁን ለቤተሰቧ ለተሰባሰቡ ሊሻል ላንድም ልታጠቃን ልስራ ለብርበራ ሊያደረጓቸው ለሚፈልጉና ሊላላቸው ለኦሮቶዶክስ ሊቀመንበርነትም ለመኳንንቶቻቸውና ለኮብል ለፈጠረን";
            amharicWords[1, 4] = "ሊጠይቁት ልቦናቸውን ልጆቹም ለተነሳ ሊሠራበት ሊወጡና ለኢንቨስትመንትና ለመስገድ ለማጠናቀር ለግዢ ለሚያነሷቸው ሊያስተላልፍ ለኢትዮያ ለበርታ ለአድልዎ ላደረገችው ልኑር ላውራ ለሚቋቋሙ ለአረቦችና ለታጋይ ልሂቅ ሊዘናጋ ልጃቸውም ሊጠመዘዝ ሊፈቀድ ለሚመደቡ ለአኅጉሪቱ ለሚገመት ሊያወጣለት ልብሳቸው ለብሰውና ልንገለገልባቸው ለመሸርሸር ለጽድቅ ለተጠቀመበት ለተሳፋሪዎች ለማስላት ላውቅ ለመሠረቱት ለዶላር ለታማኝ ለሕክምናው ለመኝታ ልታጣሉኝ ለጽሑፉ ሊሰይም ሊጠራበት ላይኖርም ለሚሻ ለኢትዮጽያ ልዋጭ ለፈልሳፊዎቹ ለመደራደሪያነት ለሰጧቸው ልመክር ለደምበኞቹ ለመጀመርም ላገሬ ለመሆኑስ ለተረጋገጠ ለመቀልበስና ሊያጋጭ ለሴቲቱ ለደረሰችበት ለአፋጣኝ ለአንቶኒ ሉጋርድ ለሚይዙት ለትዳራችን ሊታሰር ለቄሣር ለኩሶ ሊጠብሳት ለኢነርጂ ሎሎች ለማዕከላቱ ለሕዝባቸውና ለሚጠየቁት ላልሰሙት ለመፍትት ለሳኒ ሊያዘገየው ሊያሳርፍ ለመገጣጠም ሊወስዱን ላምላኩ ለተብርሃን ላቡራቶሪ ለአይ ሊመረመሩ ሊዋሃዱ ለምታቀነቅኑ ለሚጀምረው ለቅርሳቸው ሊመደብ ለተገነባው ለሼል ለዛው ለማዝለቅ ለግብጽና ሊቀመነር ለተገኘ ለደንበኞችና ልነግረው ለባለሙያዎቹ ለሬውተርስ ለቴሌቶኑ ለሞያዊ ሊገመገሙ ሊያቆያት ላገባ ለእልቂቱ ለማካለልና ለክርስትና ሊያስፈራሯቸው ለመክተብ ለግፍ ሊያድጉ ልንቋቋመው ለመንቀል ሊመታው ልንከፍል ለሸዋው ለተገደሉ ሊሰርዝ ለሚያመርቱት ለማስተርስ ለሚያደርሰው ለመናድና ለነርሱም ሊያስተናግዱን ለማርያምና ለዩኒቨርሲቲ ለማመልከትና ለሰፈሩት ለሚፈፀሙ ሊቀላቀሉ ለጎረበቶቻችሁ ለዘጋቢያችን ለተደራሲያን ለአክራሪ ልሂቃኑ ለልዩነቱ ለባለሀብቶች ሊቸረው ለወቀሳው ለሚጠጋ ሊያውጅ ላጋልጣችሁእንደምችል ሊፈጅህ ልማዴ ለቤተሰብና ለክፍፍል ለግንባታና ሊረጋጋ ለመጣር ሊቀላቀል ለሚጠይቋቸው ላስታውሰው ለፈረስ ለመገንባትም ለተመደበበት ሊቆጠርም ለወጋገን ለጥፈው ለተመለከተው ለኣለም ለአፈናው ሊተገብረው ለጉዳትና ለማያውቁ ሊብሬ ሉክስ ለተመራቂ ለስደቱ ለተቅማጥ ለቤተክርስቲያኒቱ ለሚያሠራው ላምራ ለተቸገረ ለመስማትም ሊወልዱ ለመወያያ ለነፍሰ ለአንባቢዎቻችን ለሃይድሮ ለማቆምም ሊያስብል ሊደበድብ ለውጠን ለተፈፀመ ለባንክና ለሰበካ ሊቀሰቀሱ ለሕዳሴው ለጠላቴ ለዜጎቹ ለመጋፈጥ ለተወካዮቹ ሊያሳልፍ ሊያንበረክከን ለዳግመኛ ለባለመብቶች ልመልስ ለእዉነት ላላቸውም ሊመነዘር ለዜጎቿ ለመመራት ለመማሪያነት ለቦታ ለከርሰ ላብራቶሪዎችን ለኃይድሮ ለማጫወት ለደጋማ ለኢታኖል ለኤምባሲ ልብሱና ለትብብሩ ለትምህርቴ ለማሠር ሊሆንባቸው ልናወጣ ለወንጭፍ ለማራራቅ ለመስረት ሊደበቅ ሎሬንሶ ለሚለዉ ለአስመጪዎቹ ልሳናትና ለፓርላማና ለመፍጨት ለቀጥታ ለመድረስም ለታራሚዎች ሌትም ለካርቱም ለትምህርቷ ለመግዛትም ለቃጠሎ ሊቋቋሙት ለእንግሊዛዊው ለሚሌኒየሙ ሊገቡና ለቦኖ ለተቃዋሚዎቹ ለመጠለያ ላምት ላቦራቶሪው ሊዋጥለት ሉዓላዊነትም ለማጋለጥና ለማስተማርም ለጥያቄዎች ለመካስ ለሚሊዮን ሊደመጡ ሊቀመበር ሊያበጅለት ለይርጋው ለአገዛዛቸው ለኅሊናችን ሊቀጣው ለሞረሽ ላቀረብኩት ልናልፍ ለሚመረጡ ለመታደም ለመታጠቅ ልዑካኖቻቸውን ሊተኮር ላደረሰችው ሊያከብሩትና ለሊቀ ለቅሜ ለሚደረግለት ለሕንድ ለቅሞ ለዓባይ ለሚዘረጋው ለውይይትና ላይገርም ለፋሽስት ሊያስገርመን ለደህንነትና ለኤልያስ ለማያውቀው ለማስወሰን ለታምራት ለዚህኛው ሌሊቱንም ልጆቻችንንና ለድኻ ለመሳም ለፑንትላንድ ለቀረበላቸውም ለአርቲስት ሊሞግታቸው ሊይዙና ለጠበቃ ለጎጂ ለተመለሱት ሊያደፈርስ ለማዱን ለመነኝ ለሚሰለጥኑ ሊያደራጅ ለማስፈራራትና ለራሳችንም ለአርአያነት ልዑካቸው ለማስገልበጥ ለባህል ለቅንጅቱና ለባለ