            amharicWords[1, 5] = "ላምም ለቁርስ ሉጉዌላ ሊለካ ሊፈሩ ለማጋበስ ለወገኖቼ ሊቆምላቸው ለግዋይላ ሊያስከትልባቸው ለከርሞ ሊብሱ ላሉትና ለመደበቅና ለፕሬዚዳንትነት ላገኘ ላልተፈለገ ለተወዳዳሪ ሊያሳልፉ ለነፍሱ ላገኝ ሊያሰማራው ሌኒንን ሊሙና ሊደረስባቸው ለማሰወገድ ለአሰራር ለግንኙነቱ ሊያጸዳ ልንፈታው ለመቁጠር ለመስተካከል ለመተንተን ሉላዊነት ለመማሪያ ለዚህን ሊለዩ ለቆላማ ለሚጓዙ ሊቋጭ ለምርቶቹ ለእስረኞች ላስቲኩን ለነጋዴዎቹ ለዕድገታቸው ለማግበስበስ ላለውና ለወንድማማችነት ለኢንቨስትመንትን ለደህንነታችን ልታለማ ለካንሠር ለደረሱ ሊያስጠይቃቸው ላንጋኖ ልትጠይቅ ሊያሻሽል ለማውራት ለገጽታ ለገሠን ለመርዱት ለሚወሰደው ሊደመጥ ሊቢያውያን ለመሳል ለብሳችሁ ለመስዋእትነት ለፉገራ ለብቻችን ሊያጠናክሩት ለቅሶና ልካችንን ላስመሰከሩ ለስልክ ለኖቤል ሊሰጧት ለማታገል ለገንዘቡ ለተከፈተው ለሚስቱ ላለመቃወም ልናስወግድ ላብዮቱ ለሠራዊት ለኩባንያዎች ለቀረበውም ለመተኮስ ለመመዝገብና ለአሸባሪ ሊፈቅድ ለታገል ለመንግስታቸው ሊባኖሳዊ ላይኖረው ሊቀጥሉበት ለመልመድ ለስጋት ለሴቷ ለኦሮምኛ ለሊቱ ለይታ ለመዲና ለሚሏቸው ልማታዊው ለተማሪዎችና ለሚመገበው ሊዘርፉ ሊርጀት ለሰውነት ለማሰናዳት ሎጋው ልትገቡ ለአመራሩ ለወንጌል ሊያነሣ ልሥራ ሊፈረካከስ ለቤተሰቦቻቸውና ለማዛመድ ሊኖረኝ ለሽብርተኞች ለመካከል ለባለአንድ ለመርታት ለሚኒስትሮቹ ላንድና ለጃንሆይ ለየክፍለ ለማራመድና ለልማታቸው ልመናም ሊኖርብን ለዓላማ ለተሰለፉ ለኢትዮጵያውያንና ለኢኮኖሚያዊና ለሚያውቀው ሊደርሰን ሊኖርም ሊያገባ ለገዛው ለሚያደርሱት ለመወለጥ ለቅኔ ሊያርፍ ለወሰደችው ለሚሰሩት ሊያቆመው ለጨፌው ለማኙ ለአርሲ ለሺ ለዕልቂት ለማራዘምና ለነዳያን ለበሽታና ልጠይቅህ ለመፀዳጃ ለሚጠባበቀው ልንሰማ ለመግደልና ለወገኖቻችን ለብ ሌጋሲው ለዚምባቡዌ ላረጋግጥላችሁ ለኢትግሬ ሊከታተለው ለውጡም ለናይጄሪያ ለማዶችን ለጉበት ልንሰራ ለፈረንሣይ ለማስጠበቅም ሊያስፈልግ ለሚገዛው ልቦናቸው ልብህን ለኢሠፓዋ ሌጦን ልትገኝ ለፃፈው ለአንተም ልዩነቶችና ልጃቸውና ለጋናው ልእልት ለመጠናቀቅ ሊደብቅ ለሚጠቀሙ ሊያስፈራራ ለማስባል ልቀበል ለምስራቅና ሊማሩበት ላለማስተናገድ ለአልጄዚራ ለተሰራው ለአንድነትን ሊተባበሩ ለተወዳዳሪነት ለሞታቸው ሊያዩት ለሥራችን ላሏቸው ለእግረኛ ለድሆች ሊመረምር ለዩ ልሔድ ለቤንዚን ሊቀመንበርነትን ሊሆነን ሊቆረጥ ለተዘፈቁት ለፓርቲውም ለማንጠግቦሽ ሊያስከትልበት ለንጹህ ለተማሪዎቻቸው ለስማቸው ለሐዋርያት ሊያፋጥን ለህይወታቸውም ላዲንን ላይኖራቸው ሎሬንዞ ለባለሁለት ሊጥልበት ለሲአይኤ ለአገልግሎ ለማስደንገጥ ለማናወጥ ልባቸውም ልኬት ሊተማመኑ ለመርከብ ለመንፈስ ለሚወደው ለማይችል ለመመስረትም ለወላጅ ላመሰግን ለካሣ ላልነበራቸው ለታዩት ልኬን ሊዎንቴቭ ለሥልት ለመንፈሳዊ ለመፀዳዳት ልሰጣችሁ ለሐውልት ሊገርመን ላይሰንስ ለዛሬውም ለፋውንዴሽኑ ለልማታችን ሉና ለአድርባይነት ሊሠነዘር ለማቻቻል ለአስተያየት ላቦራቶሮች ለእሳቱ ለመንግስታዊ ለርስ ልትገነዘቡ ለእንባ ለኃዘን ለሚጠይቀው ለተቀሰቀሰው ለኢንተር ለኢንቬስትመንት ላላቸውና ሊከበርለት ለማስወግድ ለካብ ለሐሳብ ሉዎ ለምዕተ ለመዋረድ ለፈቃደ ለየወረዳዎቹ ለኢራን ለኃላፊነት ለማረፊያ ለአይዲድ ልትከፍል ልምዴ ሊቆጣጠሩ ለማገዝም ለማምታታት ላለመቅጠር ለሚያወሩት ሉንድ ላኪዎችም ለተመራው ለቀልድ ላህያ ሊሆናቸው ለሚፈጥሩ ለዜግነት ሊያስገነባ ለመተንፈስ ሊጎበኙ ለመድረሱ ሊሽር ሉጫ ሊያስተምር ለመናገርም ለስዬ ሊሴ ሊስ ለጋዜጤኞች ሊደፍር ለማደስና ለዕርቅ ለመባባል ልምጣ ልመናው ለመምህርነት ላሎቶ ልገሳ