ደግ ለግድያው ለማንገሥ ሊያወሳስበው ለማድበስበስና ለመለቀቅ ልጆቻችሁ ለጥጥ ሊያቋርጥ ለማምለክ ለመጠጋገን ለቅርስነት ለደቂቃዎች ላሞኛችሁ ሌሎቸ ለቱሪዝምና ልቦናው ለሚሠሩት ሊጠናከርና ሊጥሩ ለልጆችህ ለማስረጃ ለጉሮሮ ለአቅራቢዎች ለተከተለው ሊያዘጋጅ ሊሴፓሴ ሊያሰፍር ሊፈቱት ለሰአታት ለእንቅልፍ ለግራ ለሩጫ ለመተንተንና ለስዕል ላኪው ላያገኝ ለሃይማኖትና ለግጥሚያው ለመዘረጋት ልጆቻቸውንና ለባለጉዳዮች ለከፈሉት ለጎበኙ ሊስተባበል ሊበጠስ ለመቆዬት ለኢሮብ ለፀሐይ ሊያጠፉባቸው ለኳታር ሊያደግ ለብሦ ሊያራዝመው ለዋጋው ለቤተመንግስቱ ለኣንድ ሊያገለግሉት ላይቤሪያና ለማራቶን ለካሳሁን ለማስቀጣት ለብሼ ለኢትዮኒውስ ለዉጥ ላለመግዛት ለመንገደኞች ልብነድንግል ለአስተማማኝ ለእህት ለማለፉ ለሕወኃት ልንላቸው ለምዕራባውያኑ ልመለስና ለማኅበራት ሊያሟሏቸው ሊጨርሱ ለተከሰቱት ለዜጎችም ለሚጥለ ለያዥ ለመተኛት ለሚገነቡት ለጭቆና ልትረዳ ለኑሮአቸው ሊመሰርቱ ለመሩት ለተፈቱት ሊያወጡ ለማፈግፈግ ለተራዘመ ልጆችህን ልደትን ለሚገኙበት ሊያነጋግሯቸው ለዝቅተኛ ለአጋጠማቸው ላቸው ልናውቀው ለአልሚ ላዘጋጁት ሊያስተላልፉ ሊጠየቅለት";
            amharicWords[1, 6] = "ለድርጅቶች ለገስ ልምጭ ለመንገር ልንቀበለው ለጨዋታው ላስቆጠረው ለከብቶቻቸው ሊቀመንበሩን ሊና ለክርክር ልመናውን ለምደባ ልጆቿም ለተራቡ ለተረጂው ለሚሠራ ለማውገዝና ሊደራጅ ለክብር ለስቃይና ለማገኘት ሊገድለው ሌኒኒዝም ሊያ ለገበያው ለመቁሰል ለባለሀብት ልንነጋገርበት ለሚባሉ ለአባት ለሚኖሩና ለሌባ ለዞን ሌሊሣ ሊጥ ለጋምቤላ ላንቺ ለጠላትም ልቀቅ ሊገልፁ ሌሊሳ ለመጠቅለል ለማወዳደር ለሕዝብም ለማስገባትም ለገዛ ላዕከማርያም ለማጽናት ለመታሰር ለቀረጥ ለመያዝም ለክብራቸው ላለመካፈል ሊቆች ለሚንቀሳቀሰው ሊላኩ ለሥጋ ልየው ልምዷን ለሆቴሉ ለኮንፍረንስ ለኛው ለኮንግረስ ለሆቴል ለኮንደሚኒየም ሊያሳዩ ልብሷን ለሸማቹ ለኋላ ልቋጨው ለተራው ለአጣሪ ለመጽሔቱ ላከናወኑ ሊያጠፉት ለኮምፒዩተር ለማቀድ ለመንግሥትም ላዲን ለበዛብህ ሊዛመት ሊፈፅም ሉቃስ ለጵጵስና ላውንቸሮች ሊተገብራቸው ለአልሸባብ ሎንዶን ለእከሌ ልቅሶውን ሊሸለም ለስዊስ ለአፈርና ለማጋየት ሊያተኩሩ ሊያስመዘግቡ ለንጉስ ሊያገኘው ለልጆቹ ለልጆቼ ለመግባትም ልትኖር ለሥራዎቹ ለሚያስፈልገው ለመፈተን ሉአላዊነትን ለጥቁሮች ሊያነጋግራቸው ሊጠየቁበት ልቃ ለመጥረግ ለሚነሳ ለሰብዓዊነት ለመድረክ ላልተፈቀደላቸው ሊያጤኑት ላለችበት ሉዐላዊነትን ሊሔድ ላቦራቶሪዎች ለሻዓቢያ ለጽሕፈት ለማቀፍ ልምምዱ ለባለሃብቶቹ ሊገዙ ሊሸጠው ለማደርጀት ለተፈጠሩት ለኦጋዴን ለስንብት ለመጠባበቂያ ለመበታተንና ለሰውና ሊያደርገን ለወሰዱ ላቀረበችላቸው ልንገደድ ልንጀምር ለማጠራቀም ለሚያየው ለብድሩ ላባደሮች ልዪ ለተሰዉ ልይ ለማብዛት ሊገዛው ሊደራደሩ ለአልሚዎች ለማሻጋገር ልጅቱን ለዲፕሎማቲክ ለድምፅ ለትላልቅ ለዲፕሎማሲ ለክልሎቹ ለሴፍትኔት ለቢራ ላላገኙ ለቢሮ ለሐራዊ ለማራቅ ሊቃለል ለማጅራት ለትውስታ ለመመዘን ለመውቀስ ሊያካሄድ ሊፈጽመው ልትጠቀም ልመንህ ለማፈስ ሊሰፍር ሊገባው ለማቅናት ሊቃወመው ሊሞላ ሌበር ለወጡና ለጀግናው ለመልሶ ለርካሽ ለሚደራጁ ለቄሳር ለጥርጣሬ ለአለቃው ለነፃነትና ለተፈናቃዩ ለወጪና ለመምጣቱ ለማብቃትና ሊፈተሽ ለኤሪትሪያ ሊሰበሰቡ ለቅቃችሁ ለክፍያ ለሞባይል ልጃችሁን ሎካል ሊጣል ለወረራው ለሚጠቁሙ ለቅድስት ሊስተናገድ ለአውሮፕላን ለመተግበርና ሊፈጽም ሊሰራጩ ለአንድነታችን ለሰሩት ለብርሃነ ለአርኪዎሎጂ ሊጠቀምበትና ለአክሲዮን ለየቅል ለታይ ለደረሰባት ልናሳስብ ለመብቃት ለሰጣቸው ለማሰተዋወቅ ልማቶችና ሊጠይቀው ሊታገዝ ለድርጊቱ ሊያካሂዱ ሊያሳዩን ሊያስወጡ ለጥቅሙ ለወርቅ ሊታመን ለኢትኦጵ ሊታገድ ለመጠለል ለቀቀው ለሶማሊያዊያን ለበታች ለማጣሪያ ሊከበርላቸው ልማቱም ላስታውሳችሁ ሊያሟሉ ሊያሟላ ለአቴንስ ለዋቢነት ለመገናኘትና ላደረሱን ሊሰሙ ለመሄዱ ለመረባረብ ሊያልቅ ሊሰማ ለእንቅስቃሴው ለመርህ ለሰፋሪ ለፍልሚያ ለመጥፎ ልዑኩን ለግብዓት ለሐረሪ ሊያጠፉ ለማቀላጠፍና ለተጓዦች ለተሰበሰቡ ለመሳ ለመሰዋት ለቢሮው ለመጋበዝ ለመምህራንና ላስመዘገበው ሊጠቀሙና ለታችኛው ለሰማዕታት ልትቀበለው ለሚከናወኑት ለማደል ሊያሸንፍ ለየብቻቸው ለያዘችው ለሕወሐት ለሚያጠቡ ለወይዘሪት ለቀረበበት ለባህልና ለመገፋፋት ለመላቀቅና ለሕሊና ለመብቱና ለተቀመጡት ለድብደባ ሊያጋጥመው ለማስደገፍ ሊወክል ለመነ ለነበረ ለልጃቸው ሊሰነዝሩ ለሩብ ለመክፈልና ላጠናቀቁ ለማልቀስ ለመወጋት ልከክልህ ለዕድገትና ልግዛ ለተጠቁት ለሚከተለው ለቤተሰቦቹ ለሥርዓት ሊቀረፍ ሊሰለፍ ለርዳታ ለፋይናንስ ለመመንጠር ልሙጥ ሊቀለበስ ለግሷል ለህሊናቸው ሊሰማራ ለግልግል ሊመዘገቡ ሌፍኮ ለመጫር ለወዳጅነት ለዩኔስኮ ለሠሩት ለመምከርና ለሰይጣን ሊንዳ ሊታገለው ለመኖርም ለመገበያየት ለሌሎቹም ለሃይማኖታዊ ለመታቀፍ ለማረምና ለነዚህና ለሚጠቁ ሌተቀን ለሚያስችሉ ለዘመን ለባእዳን ልነግርህ ለመጣ ለዘለዓለሙ ሊሰፋ ለማስጠራት ለግሌ ለመቅዳት ላስመዘገቡት ሊያተርፍ ለተተኪ ልጅቷን ለምሁራኑ ለብሰዋል ለጉባኤ ልጆችስ ለወንጀሉ ለመቅርፍ ለማዘጋጃ ለሕልፈተ ሊባኖስን ለማሣወቅ ለተሰብሳቢዎች ሊሰረዝ ለብር ለፍተሻ ልማቶቹ ለዉጭ ላይኛው ለማስጣል ለያዙ ሊያገኙበት ለመመሰረት ሊቀነስ ልቅም ላስታ ሊለቃቸው ላለመከራከር ለዘመድ ለመፈጸማቸው ለተሳተፉት ለሰፋሪዎቹ ለቴክኖሎጂ ለአብ ለማሳፈር ለትግበራው ለቀኛዝማች ለቆሙለት ለመስመሩ ለኅብረተሰብ ለሚሉ ለተመራቂዎቹ ሊያሠራ ልንደርስበት ልታደርገው ሉኡካን ለእኩልነትና ልጃችነን ለመርማሪዎቹ ለመስረቅ ልትባል ሊያንሰራራ ለፓኬጁ ለመታሰቢያቸው ለዓሳ ላገሩ ለአንጋፋው ለእድገትና ላጲሶ ለዓላማቸው ለማግባባትና ሊዳርግ ለምንድ ሊገጥም ሊያናጋ ሊያስገርም ለማስፈፀምና ሊወሰንበት ሌባው ለሕንዶች ለእገሌ ለሚዋደቀው ለማስቀየስ ለሚቀርብለት ለልባቸው ሊጠነቀቅ ለማተም ላደረጉላቸው ልጆችዎ ለተከሳሽ ለመነሻ ለቤተክርስቲያኑ ለምርታማነት ለደህንነቴ ለመላበስ ለቤተሰቤ ለሦስትና ለንደንና ሊገመገም ለሚከፈተው ልናረጋግጥ ልናገኘው ለጥገኝነት ለደህንነቷ ለፍተው ለሆኑና ላከልን ለመጣስ ላንድሩ ሊከት ለመኖርና ለአቤቱታዬ ለኮንጎ ለማያውቅ ለተሳተፉና ለማምጣትም ለጠላቱ ለማወናበድ ለአደን ለቦብ ለቅድሚያ ለመቃለል ላለመጥራት ሊያሰፍን ሉተራን ለተደራጁና ለባለድርሻ ላንድክሩዘር ሊስፋፉ ሊያዩ ለዕስር ለላሊበላ ላምባ ለሚበልጥ ለመርጨት ለማዝመት ለማንቃት ለአዲስና ለማበራከት ለመከወን ለከተሜው ለሦስቱም ለገሠና ሊክደው ሊቀጣጠል ሊሎይድ ለግለሰቦቹ ለመስኖና ለሼክ ለማደፍረስና ልንኖር ለጨዋታ ሊሻን ለምርኮኞቹ ሎንደን ለቫይረሱ ለሕፃኑ ለአራትና ልጠጣ ለዉጦችን ሊከፍለው ልጓሙን ለሚያስተዳድረው ላለመስማት ለታሪካዊ ላጠፋው ለሺዎች ለማስታጠቅ ለህብረተሰቡም ሊቃጣ ልጆቻቸውንም ለሚነፉትም ላካሄደው ለተጎዱት ለወንድሜ ለረዳት ለማብራራትና ልገሣ ሌትና ለመስተናገድ ሊቀመንበርን ለይስሙላና ሊገፈፍ ለማስከበርም ለአልጀዚራ ለዝምታው ልንሰጠው ለዕድሳት ለመልቀቅና ሊያነሳ ለኢሚግሬሽን ለመካላከል ለመኖራቸው ለትጥቅ ላንተም ለዶሮ ለማጉደፍ ልገባ ለማትነን ለአትሌቱ ሊደግፉ ለግላጋ ለማስደረግ ለሕንፃ ሊያጣራ ልዩነቱም ለመፎካከር ሊመረምረው ለማህበራቸው ላለመቀበልና ለጠብ ሊያልፈው ለነ ለቀናል ሊጨነቁ ለማፈንና ልምሻ ሊሰሩበት ሊሻገሩ ለሥልጣኑ ለዕድሜ ለይቷቸዋል ለውጦችና ለኢትዮጵያዊነት ለዘለቄታ ሊያስብለን ለማላከክ ልከዋቸው ልኳቸዋል ሊቆጣጠሩት ላቲን ለመባረራቸው ሌጦው ሊያፋጥኑ ለውህደቱ ለርስዎ ሊገድል ልከሰስ ለብዙኃኑ ለማስጠናት ለአሸናፊዎች ልምምዱን ለአንባቢያን ሉል ለማከራየት ለመገበር ለእሥራኤል ለቅቀህ ለመማርና ለተሰማሩና ሊዮኔል ለኮንትሮባንድ ለጽህፈት ለመሐል ለማስፈፀምም ለነሱም ሊገለጽ ሊያጋልጡ ልጃገረዶቹ ለመነገድ ሌጋሲውን ሊማር ልዑላን ለአድማጭ ለማግነት ለነአቶ ለአንበሳ ለስነ ለህዝቡም ላሳያችሁ ልብስዋን ለትግርኛ ለሃይማኖቱ ሊያሰባስብ ለሚቀርበው ለምንፈልገው ለኪነጥበብ ልዕልናና ለማሳዳግ ለመመለስም ለሚባሉት ለመምራትና ለማዝናናት ለማፅናናት ሊቀጠሩ ልንቀጥል ለማሣመን ለጻፈው ልትወረን ለኮሚቴ ላከናወነው ሊሙ ለመግፈፍ ልበልና ሌሽሜንያሲስ ለውሻ ላለማስከፋት ለመቀረጽ ለጨረታው ልጆችዋን ለማንኳሰስ ለመበየን ለዕርቀ ሊሰነዘርበት ልጁም ሊወሰድበት ልትወረኝ ለብቻዬ ለሚኖሩት ለስደተኞቹ ለመጫንና ልሄድ ለጥንካሬያቸው ለሴራሊዮን ላስረዳ ለመከለከል ልብሶችና ሊዘነጋ ልንናገር ሊገናኙ ለማጣት ለበሱ ሊፈቀድላቸው ልሮጥ ሊያስ