ሸጋገርና ሉ ሊ ለባሕር ሊደርሳቸው ለማይበልጥ ለፈጠሩ ሊገኝባቸው ለቁጥሩ ላየንስ ለዳዊት ልንገባ ለመፈፀምና ለህጋዊ ለግዛት ለዓለማቀፉ ላሁኑ ልናያቸው ለወላይታ ለማስተናገድና ለተጎጂዎቹ ለማንበብና ለዘጠነኛ ልጅነትና ለያይተው ልንመለከተው ሊሸፍነው ላይማ ለመጠገንና ለማሸንፍ ለማደፈረስ ለመጓዝና ለሺሕ ለማባረርና ለሁለንተናዊ ለጥሪው ለዚያው ለቴክኒዎሎጂ ሊረሳ ለአገሪቱና ለሁላችን ለመኑ ለመንዛት ለመውሰድም ሊነጋጋ ሌላኛዋ ለቋል ሊያስማማ ለንስሐ ለተሰጣቸው ለኬንያውያን ሊሰለፉ ለማርጋገጥ ለማሳያነት ለአስተዳደርና ለማካካስና ለባቡር ለማስቀደም ሊጋባ ለልምምድ ለስህተት ልቦናና ላይት ሊበራሊዝም ሊዘጉ ለኢሓዴግ ለሕመም ለእንደኔ ሊያወጣት ለጥበብ ለአፍሪካም ሌሎቹንም ላግባሽ ለህልውናዋ ለሽርሽር ሊያስወግደው ላይመለስ ለእንደኛ ለማብሰር ልትሄድ ለዳኛ ለእርስ ሊሰደዱ ለሚኒስትሯ ለዕጩነት ለአስፋልት ለዘመኑ ለደረሱበት ልጅሽን ልጆቻችሁን ሊያዘናጉን ለኢንጂነር ሊፈለግለት ለካቢኔው ለመደለል ለኢፌድሪ ለስለስ ሊያስከብሩ ላስቲክ ሊያሟላቸው ለመተረክ ለማለፍና ሊዳረግ ለሪል ለመሻማት ለባህርዳር ልውውጥም ልኩን ለታሪክና ሊያስከብር ለፕሮፌሰሩ ለመከለካል ለጌጥ ላቦራቶሪና ለአስመራጭ ለሚቀርብላቸው ልንለያይ ለተጫወቱት ለመከላክል ልትሉኝ ለጥፋታቸው ለምሁራን ለማረጋጥ ልጆችሽ ሊበረከትላቸው ለቅድመ ሊያደርጉላቸው ሊከበሩ ለድህረ ለማምርት ለኦዲት ለወይን ሊጋጩ ሌላውስ ለሴቶቹ ሊዛወሩ ለሰላት ለማክሸፍና ለኢሠመጉ ለብሳ ለሱዳንና ለእህቱ ለማሳደድ ለምዕመናኑ ላለመክፈል ለመሞገት ለአገራችንም ለደጃዝማች ሊያድን ላይብረሪ ለያዘ ለፀረኤችአይቪ ለጉባዔ ላሳየው ለመቻልና ለማስመለስና ሊቀርፍ ለማከፋፈልና ለገዢዎች ለስርአቱ ለመቋደስ ለማጨለም ለርሳቸው ልሣኑ ለሰበር ላላስፈላጊ ሊወጡት ለማብረድና ለሚሰቃየው ሊወስኑ ለመከራከርና ልምምድና ለዘለአለም ለአደገኛ ለኮፐን ለመፈፀማቸው ሊያውለው ለመቀጠልም";
            amharicWords[1, 7] = "ለፍትሕና ለፈፀመው ለሚላኩ ላለማጣት ለዋለው ሊነግሩን ለአፈር ሊደረግለት ለጌታው ልብሴን ለሐረር ለሚያደርጉ ለጥሩ ልብሰ ለተመልካች ላሳዩ ሊመቻች ለማልበስ ልለው ልጃችን ለህይወታቸው ለመላክና ለማሳወቅና ለጋብቻ ለሚከሰቱ ላቀረቡላቸው ለተጎጂዎች ለሚያቀርቡት ሉዓላዊነታችን ሊንክ ልብዋ ለነሐሴ ልዑኮች ለማምረትና ላካፍላችሁ ሊንግ ለቃሚ ለካህናት ለጦሩ ሊያውቁ ልኡል ለነፃና ለኩባንያው ለመሰረታዊ ሊዳሩ ለመታደግና ለአጠቃላዩ ለማባባስ ሊመሰርት ለመሸንገል ለኢትዮጵያን ሊዘረጋ ለመካከለኛው ሊወስን ለጅብ ሊመልስ ለተደረገው ለሳይንስና ላደርገው ለመቅጨት ለእቴጌ ለድጋፍ ለዕለቱ ለቤተሰቡ ለህበረተሰቡ ለማጥመድ ሊብሮ ልዑካኖች ለዜሮ ለሁለትና ለትብብር ሊያይ ለአከባቢው ለእውነትና ሊሰጧቸው ሊመሰረትባቸው ሊያጡ ለማርሻል ለዘጋቢው ለመደራጀት ሊኖርህ ለመደልደል ለእሁድ ለመጀመሪያው ሊናገሩ ለሲኖዶሱ ለካቢላ ለናሙና ላለችው ለመደጎም ለአስመራ ሊቀጥልበት ለማስመስከር ልናገኛቸው ሌቦችና ለህዝብና ለማዳ ሊከፍቱ ለጉባኤተኛው ልእልና ለእስራትና ለአንደኛ ሊስትሮዎች ላልቻሉ ለሜሳ ለልምድ ሊጎዳ ለሐውልቱ ለመሰየም ለሠፈራ ሉክ ለጥንቃቄ ለእሳት ለማበልፀግ ሊመስለን ልማታችንን ሉባባ ልጆቻቸውና ልጅህን ለኢዴአፓ ልምላሜ ለተሳታፊዎቹ ሊደረግባቸው ልታገኘው ልምዓት ለሚያካሂዱት ለሚከሰተው ለቆዳና ለማሳከት ለመሃል ለአረጋውያን ሊፈፀሙ ለኢትዮጵያው ለሚታተም ለታላቁ ለከብቶች ለታላቅ ለዕዳ ለጥቃቱ ለእምነት ላቀደው ለቤቶች ልውውጡን ለፊታችን ለማሠራጨት ለቅቀን ለነርሱ ለምሳ ለመቀጠልና ለመስቀል ላዩን ለፈጸሙት ለአትክልትና ለተባረሩት ላባ ለፓርቲዎቹ ለሚፈልገው ልቀት ሊተገበር ለበጀት ለገዳሙ ለብዙሃኑ ለማያያዝ ለማዘዋወር ለኮንግረሱ ለምድር ለማሰጠት ላው ለሚወዳደሩ ለመደምደም ሊላክ ለንፅፅር ላዩ ለመዝናናት ለማፍረስና ለሚያከናውኑት ለመርገጥ ለረጂም ሊጋለጡ ለእናቶች ለአዳዲስ ለግብጽ ሌቪ ለመስማትና ለአብዮቱ ለዳግማዊ ሊሸለሙ ለንጉሠ ለመጓጓዝ ሊከተሉ ለውጤታማ ለማለትም ለውጤታማነቱ ሉዐላዊነትና ለማሳያ ሊያቆም ለማጎልበትም ለጉድ ለማስታወቅ ለመጠጥነት ሊገባኝ ለማህበራት ልጇ ለነገር ለመስፈር ለባለስልጣናት ሊጠቀምባቸው ሊፈርስ ሎስ ላምፓርድ ሎቢ ለሕጋዊ ሊቀመናብርት ለእንስሳቱ ለቀጠናው ሊፀድቅ ለፋሲካ ለዘረፋ ላብቃ ሊሞቱ ለአንባቢ ለሚገባቸው ለሚከናወነው ለሰፊው ለአዋሳ ለጋስ ለገሰች ለተሠማሩ ለባሰ ለምርጥ ሊያስብበት ለገበሬዎች ለሩዋንዳ ለፕራይቬታይዜሽን ለሰልጣኞች ለተከሰሱበት ለአልሻባብ ሊያሳድሩ ሊያያዝ ሊያጠፋ ለሰፈረው ልግባ ሊቀጣ ለምዝገባ ልቃቂት ላቀረባቸው ለተለያየ ለማዘጋጀትና ለማጥላላት ልብነ ለማከማቸት ለማግኘትም ሊገነዘቡ ለዳር ለማሠማራት ለታቦት ለችግሮች ለዘንድሮው ሊያመልጥ ለስለላ ለፖሊስና ሊተክል ለሚገባው ሊያሳድገው ለለጋሽ ለወሲብ ለጉምሩክ ለስራዎቹ ለማሰናበት ለመንካት ለመርዳትና ለጸጥታው ለማረስ ሊሰየም ሊዳረጉ ለቆየው ለአሰብ ለሚፈጠረው ለሥልጠና ለክልላቸው ለማድረቅ ለማግኝት ላይቤሪያን ለአረጋዊያን ለጋዜጠኛው ሊዘጋጅ ለመኪና ለቀረቡለት ለዋናው ለመክበር ለትግራይና ለጥቂቶች ለሕግና ለሚል ላቀረበለት ለቅስቀሳ ላለመጠቀም ልክፍት ለማጣላት ለማኅበረሰቡ ለፍጥረት ሊያስቆጥር ለንፁህ ለመመስረትና ለተከሳሹ ለድሉ ለነገሩማ ለደረሱት ልደቱና ለተሰጠው ለራት ለመፋቅ ሎጂክ ለተቸገሩ ለሚስስ ለአጼ ለብሄረሰቦች ላልሆነ ለትከሻ ለሚሰማራው ለእርስዎ ሊግን ሊገደሉ ለልማታዊ ለማስከፈት ሊሞላው ሌላዉን ለዓላማው ላምና ልምዶችንና ላንዳፍታ ለማሻሻልም ለመሆኗ ለቴክኒክና ሊከፍል ለይቼ ለጋሾችና ለአዕምሮ ለ