ስባቸው ለማስተላለፍም ለሕወሓት ለጅቡቲው ለአረብ ለምትገኘው ሌትር ለመምዘዝ ሊቀመንበርነቱን ለትርጉም ለሕወሃት ሊፈናቀሉ ልፋትና ለረሃብና ሊያሳስብ ለሚፈጠር ሊቀበሉ ለለውጡ ላይተር ለወሳኝ ሉዋንዳ ለስፖርታዊ ለማቀዝቀዝ ለሃምሊን ለተመረጠው ሊያናግረኝ ለአብያተ ለመክፈትና ለፈጠረው ለማሳመንና ለመሳቅ ሊናገር ለኢንፎርሜሽን ልስጥ ሊቀመንበርነትና ለነጮች ለትራንስፖርትና ለተከበረው ለማስገባትና ሊገኝለት ለሷ ለአልጋ ልበልህ ለተግባራዊነት ሊያወግዘው ለካድሬዎች ለነጻነቱ ሊገደብ ለፓትርያርክነት ሊደግፍ ሊታወቁ ለግጭቶች ሊገታው ለነዚሁ ለፓርቲያቸው ሊግባቡ ልንገርሽ ለታዋቂው ለዝውውር ለባለስልጣኑ ለስርዓቱ ለወሰደው ሌጦና ለይርጋ ለኢቲቪ ልኳንዳ ለአንድም ለገባው ለዜጎቻቸው ለመውሰድና ሌዊስ ለተራቡት ለተሰነዘረው ሊሰጣት ለአውሮፓና ለሚሆኑና ሊወስድበት ለጨጓራ ሊያረጋግጡ ለነፍሳቸው ለማኅበራዊ ልበለው ለውሣኔ ሉሉ ለኢህአዴግም ሊያጤነው ልኬቱ ለነዋሪዎቿና ለአድዋ ሊለውጠው ለግርማይ ለዝርዝርና ልውጣ ለመምታትና ላለመሆኑ ለፖሊሶች ለእፎይታ ለሚመሩት ላብራራ ልትገዛ ለክረምት ሊያራምዱ ሊወርድ ለሚያልፍ ለቀውሱ ሊያግደው ልንደርስ ለትልቅ ለወታደሮቹ ለሰብኣዊ ለወታደሩ ለመካድ ለሚመለከት ለወታደር ሊወስድባቸው ለነጻነታቸው ለተወሰኑት ልታናግሩኝ";
            amharicWords[1, 8] = "ለእስራት ለመሸለም ሉዓላዊነቷን ላብ ሊጠፋ ለመጭው ሊወገድ ለክለቡ ለሚገቡ ለመቋቋምና ለመስከረም ለክፉ ለጥገና ልማትም ለማቃለልም ለተፈፀመው ለማሰር ለሚዲያ ልቤን ለማዞር ለደብሩ ለአስቸኳይ ለማጽደቅ ለዩኒቨርሲቲው ሊያጋጥም ለማድመቅ ለማሳሰብ ለማሳጣት ለሠራተኛው ልጆችና ለሚባለው ለማደራደር ለባለሙያዎች ለሚቀርቡ ለቦታው ሉሌ ለጠቅላላው ሊሉ ለማስቀጠልና ለማስታወቂያ ለአሥራ ለማገድ ልዩነቱን ለክቡር ለአስተዳደር ልጅነት ሊያገለግሉ ሊያገለግል ለመራመድ ልባሽ ለልጅ ሊያቀርቡ ለባሹ ለመጻፍ ለፖለቲካው ሊንቀሳቀስ ለስድስተኛ ለትንሽ ለጥበቃ ሊወሰን ሊያውም ሊመዘገብ ለማሳረፍ ሊወሰዱ ላንዴና ለሚሰማሩ ሊያወጣ ለመታረቅ ልምድን ለሚሹ ለቱሪስቶች ለሌሎቹ ለሚጠጉ ለመደገፍና ለሚከበረው ለኢሳያስ ለግለሰቦች ለመሰደድ ለመመልመል ለመከራከር ልፋት ለመጥፋት ለሚሆኑት ለእነርሱ ለመሳሰሉት ለኪራይ ለመቀመጥ ለተገኙት ለጊዜያዊ ላይኔን ሎሌዎች ለተነሱት ለሞትና ለሚነሱ ለማፅደቅ ለቦርድ ለማሰራት ለእነዚሁ ለምስክርነት ለማብራራት ሊደረጉ ለአመታት ለአትሌቲክስ ለኮፊ ለኮሚቴው ለፍትህና ለእሳቸው ሊኖራት ላይን ሊጥል ለኪሳራ ለብዙዎች ለማርያም ለእድገት ለጅማ ልብስና ለአገሪቷ ለመተርጎም ለመቃኘት ለዲፕሎማቶች ልሂድ ልውውጥን ለመዳኘት ሊከፈት ለቅቄ ሊያሳድጉ ለመነሳት ለማዳመጥ ለኢትዮጵያም ለነዋሪዎቹ ለሚችሉ ለመነጋገርና ለቀረቡ ለሃይማኖት ለገሱ ላይኔና ለሚደረጉ ለተፈጥሮ ለብክነት ለማጋጨት ለዝርዝር ሌሊቱ ሊያሳይ ለባንኮች ለዋንጫ ለደን ለማመላከት ሊበረታታ ለማስደሰት ለኢዴፓ ለማስቆጠር ለሳቸው ለትግሉ ለኤርትራና ለመላ ለቀሪው ላድን ለሕዝባዊ ለወጡ ለሳምንት ለመወጣትና ለምንስ ለነዋሪው ለመስተዳድሩ ለውሳኔው ለአብነትም ልጆቿ ለመመደብ ሊጫወት ለጠፋው ለማስወገድም ለማመልከት ለመክሰስ ልደቱን ለባዕድ ለማዕከሉ ልምዱን ለማሟላትና ለማወቅና ለማዋጣት ሊሻሻል ለመሻገር ለሚሰጡ ለእስራኤል ለሀገራችን ለመጨበጥ ለነዋሪዎች ሊተላለፍ ለፕሮጀክቶቹ ሊይዝ ሊደረግበት ለሙያው ለአገሬ ሊደርስበት ለተቋቋመው ለተገልጋዩ ላለመመለስ ለተከሳሾች ሊቆይ ለመዝለቅ ለማካተት ለመሞት ለመለወጥና ልል ለሕገ ሊበን ለገጠር ለእሱ ለህልፈት ለታህሳስ ሎይድ ለግራዚያኒ ሊያደርሱ ለማወያየት ለውድቀት ላቦራቶሪ ሊቀር ለመስራትና ለጠየቁ ሌብነት ለመቅረፅ ለመለየትና ለዳግም ልብሱ ሊያገኙት ሌክና ሊባሉ ለማደር ለአማራጭ ለሚኒስትሩ ለእንግልት ላጋጠማቸው ልጆቼ ልኡክ ለየብቻ ልምዶችና ለአባ ሌላውንም ሊሳካልን ለመኸር ለቤተሰብ ለደህንነት ለመስማማት ለአጤ ለኤድስ ለአፈ ሉዓላዊነቱን ልብሱን ለውዝግቡ ለባህር ለማኝ ለእግር ለጂቡቲ ሊዘገይ ለማካሄድና ለዕለታዊ ለማሳሳት ለሠራተኞች ላቀው ለስቃይ ሊጠቀሱ ለማድመጥ ለጡት ለማስፋትና ለመሣተፍ ለማረጋገጥም ለአፋር ለቃችሁ ለመምሰል ላባድ ለሹመት ልብሳቸውን ለንግዱ ሌተና ሊቢያና ለማስለወጥ ልዑካንን ለትርፍ ለአመጽ ለጎንም ለማኮላሸት ለጥቅም ለህወሓት ለድሬዳዋ ለጠቅላላ ለመሥራትና ለተሰኘው ለፊታውራሪ ልትሰጥ ለሚያዝያ ለእውነተኛ ለዝግጅቱ ሊያመልጡ ለጥያቄያቸው ለወረዳው ለዘላቂነት ልጆችም ለዘብተኛ ሊያጋጥሙ ለባለቤቱ ለመሆንና ለመወያየትና ለህብረቱ ለሰዓታት ለማልማትና ለፈፀሙት ለግንዛቤ ለኢዜአ ሊዊስ ለሰፈራ ለወትሮው ለሁለገብ ለፎርቹን ሊከሰሱ ለመዋሃድ ሊፈጅ ለተፈናቃዮች ልበስ ለክልልና ለመከታተልና ለሚጀመረው ለቀረበ ለማቀናጀት ሊድን ለኢንዱስትሪው ለመዋል ለሠራተኞቹ ልምዱ ለማፈራረስ ለገቢ ለመንደፍ ልናገኝ ለምረቃ ለቀጣዮቹ ለድርድሩ ለመከራ ለኢነጋማ ለውይይቱ ለተሳናቸው ልጓም ለኢፌዴሪ ሊወገዱ ለእንዲህ ለልብ ለተጠየቀው ሊፈጸም ለማስመር ሎሌ ለምነትን ለመደብደብ ለአህጉሪቱ ሊቀመንበሯ ሌላኛውን ሎጅ ለዘብ ለዘመቻው ለማውገዝ ለአበባ ሊቀየር ለዩናይትድ ለማሳተም ለአነስተኛና ሉአላዊነታችንን ለተረጂዎች ለበረራ ለራሳቸውና ሊታዩ ለሥርዓቱ ላቀረቧቸው ለእናት ልጅን ለቀረቡት ልንሆን ለዘመቻ ለማካሄድም ለኢትዮጵያውያኑ ሊመራ ለማቆየትና ለስኬታማነቱ ለበልግ ለማበረታታትና ለትክክለኛ ለመቀጠር ለሁሉ ለግዜው ለያዘው ሊብያ ሊፈጠሩ ሊገጥመው ለልጆቻቸው ሌቦችን ለግጭት ለመበታተን ለዛ ሊከፍት ሊያረጋግጥ ለተከታዩ ለማስቻልና ሊጠቀሙ ለፊፋ ለአባላት ለመንግስትና ለፈተና ለመቅረት ለማሰናከል ለማገዶ ሊያስገኙ ላነሱት ሊያመጡ ለበጎ ለአምስተኛ ለማመጣጠን ለማስታገስ ልቆ ለጉዞ ልበ ለተጠቃሚ ለወይዘሮ ሌላዉ ሊያከናውን ለማዳበሪያ ለማየትና ለሕዝብና ለቪኦኤ ለህገ ላንድሮቨር ለሚጠበቀው ለመመለስና ለማናቸውም ለመለያየት ለወር ለመረዱት ለአንዱ ሊስተካከል ለሚሳተፉ ለተሳተፉ ለወህኒ ለመዝራት ለፕሮፓጋንዳ ልዩነታቸው ለትናንት ሊሸጡ ለተባሉ ላለመግባት ለተያያዘችው ለእርቅ ሊያስነሳ ለዳኞች ለመባል ለቀብር ለመድፈር ላለመውጣት ለጎዳና ሊመታ ላኪነት ለአቡነ ሊመስል ለሕዝቦች ለሚያከናውኗቸው ለራሳችን ለመሸከም ለናንተ ለሚኖረው ሊቀበሉት ለተሰብሳቢው ለልመና ለመጠቀምና ለሶሻል ለምታካሂደው ለዚህች ለአሰራሩ ለባርነት ሊታሰብ ለማክበርና ለመቀየርና ለቀረበባቸው ሊመረት ሊቀበል ለማጥራት ለተመረጡ ሊቀመንበርነታቸው ለሆነችው ለይተን ለዋጋ ለአጃንስ ላወጣው ለት ለመብራት ለማጥፋትና ለተቋማቱ ሊሆንም ለተደጋጋሚ ለኤምባሲው ለግዳጅ ሊይዙ ለመግባባት ለመነጠል ላለመሳተፍ ለገቡ ሊበልጥ ላይቀር ለሚያካሂዳቸው ልቀቁ ለካናዳ ለእውነት ለምቶ ለሙዚቃ ለድርጅታቸው ለማቅረብና ልጆቿን ልባቸውን ለውትድርና ለንጉሥ ለማሳካትም ሊደረስ ለማገዝና ለክስ ለፍጻሜ ለኔም ለስፖርቱ ሊገዛ ለፈጣን ለማረጋጋትና ለሞቱት ለእኛም ሊያስተናግድ ለማዘዝ ለምስክሩ ለሽልማቱ ለበሽታ ለማኖር ሊረዳው ለፖሊሲው ለተወጣጡ ሊለቀቁ ለመቀዳጀት ለጤናው ለምክትል ለመምህራኑ ለማዋሃድ ልብህ ለማስከፈል ለሕይወታቸው ለመቀበልና ለወጪ ልታደርግ ለስደትና ለሚያቀርቡ ለመጠጋት ለእርሷ ሊያውቅ ሊከናወኑ ሊረዳ ለማመቻቸትና ሌጉዋላ ልዩነታችን ለመቆፈር ለልዑካን ለህብረት ለሬዲዮ ለመተው ለሕይወት ለሚኒስቴር ሊለቁ ሊከፈል ለሼህ ልሣኖች ለሚሰጠው ሊጠየቁ ለማደራጀትና ሊጠየቅ ለጆሮ ለቤተሰባቸው ለማንበርከክ ለዘመናዊ ላሳዩት ለመውረስ ለአቃቤ ለሚሰራው ለኢሰመጉ ለጠየቀው ለይ ለመንግሥትና ለሰጠው ለጥ ለጋዜጠኞቹ ለኤርትራውያኑ ልመናን ሊመረጡ ለኢኮኖሚያዊ ለስልጠና ሊሰጥበት ለቅጣት ልቡና ለሚሠሩ ላንቃ ለስምምነቱ ለንብረት ለባለአክሲዮኖች ለመኖሩ ለጀመረው ሊያገኛቸው ልንጠቀምበት ለደርግ ላጭር ለውርደት ለሚመጣው ሊጠፉ ለችሎት ለእንደዚህ ለተከሳሾቹ ለደም ለማዘናጋት ሊበተን ለተቀሩት ለታቀፉ ለመመስከር ለመጋራት ለመቋጨት ሌላስ ለማዘግየት ለኤፈርት ለቀቅ ለግብርናና ለአብዮታዊ ለወደብ ለብድር ለሚገኝ ለማድበስበስ ለመጠገን ለሀገርና ለጎብኝዎች ለፓሪሱ ለጊዮርጊስ ለሟች ሊገነዘቡት ለሲቪል ለካንስ ለመቅበር ለዘሞኒተር ለሶማሌያ ለተተኪው ለማሰባሰብና ለትግል ሊመሰረት ለመብረር ልብና ለቋሚ ለአያሌ ለምጣኔ ለብይን ልዩነቶቻችንን ልኩራ ለግሰዋል ልሳኑ ለኃይል ለዚች ለዘለዓለም ለወንጀል ሊቃውንትና ለመሻር ለሆቴልና ሊጎለብት ለጎረቤት ላጫውታችሁ ለተመደቡ ለግላቸው ልማታዊና ለማገገም ለሰብል ለትምህርቱ ለሚችለው ለተጠቀሱት ለፋሽስቱ ለማተራመስ ለኢንቨስትመንቱ ላበረከተው ላብራቶሪ ሊያበረክት ለመገልገል ለዝናብ ለሕዝቧ ሊሉን ለምሳሌም ለአትሌት ሊ