እኩልነት ለመገላገል ለመተንበይ ለአዳም ለፖሊሲ ሊገጥማቸው ለእርሳቸው ልላቸው ለማጭበርበር ለመመልከትና ለሰኞ ለመሰረተ ሊያውቁት ላደረሱት ሊኾን ሊቀመንበሮች ለኢጋድ ለወሬ ለአሜሪካው ለመሸጥና ለህጻናት ለያይቶ ለማናገር ላራሹ ለራሳችሁ ለተደረገላቸው ለህዝባቸው ላ ለከፍተኛው ለሚመጣ ለኢጣልያ ለቁጥር ለወረዳና ለትዝብት ለዓቃቤ ለኤሌክትሪክ ልብን ሊሰበስብ ልጅቱ ሊጤን ለአፈና ሊበራል ሊሰማሩ ለማስጠንቀቅ ለህዝባችን ላንድማርክ ለሚኒስትር ለማውደም ለኤክስፖርት ለጥቅማቸው ለኃይሌ ለፓትርያሪኩ ለማዋልና ሉአላዊነቷን ለትዳር ልሁን ለዕርዳታ ሊወያዩ ለማጣጣል ለምዕመናን ለማሣየት ሊቀይረው ለሚታየው ለማውቅ ለሬውተር ለጀርመን ለሪፓርተር ሌላውና ለዓሣ ሊያደርጋት ለማጣራትና ለእንግዶች ለድሃ ለዲፕሎማቶቹ ለባሾች ልጆችዋ ለእልቂት ለግብፃውያኑ ለአረንጓዴ ለሰብለ ለኮንስትራክሽን ለወደቁት ለኢንቨስተሮች ላገኙ ለመዋጋትና ለአፄ ለሚካሄድ ለካንሰር ልጇን ሊረዱት ለአገልግሎቱ ለጥያቄዎቹ ለደረሰበት ሊያጣ ለማገናኘትና ሊሻሻሉ ለመፍቀድ ለሥራቸው ላቅርብ ለእስርና ለመከለል ለማንሣት ሊያሳድግ ለተፈናቃዮቹ ለኢሳይያስ ለቀድሞው ሊያቋቁም ለማሳድግ ለምክክር ለሚ ለበቀል ለባለሥልጣኑ ለመመርመርና ላገኘው ለገጠማቸው ለሱማሊያ ለአንደኛው ላሞች ለማስገደድ ለሚፈናቀሉ ለመሳሰሉ ላሊበላና ለአፍሪካና ለመርሳት ለመቋቋሚያ ለዕድገታችን ለመስፋፋት ልውጥ ለፍቅር ልፍስፍስ ላየን ልምምዳቸውን ለችግረኛ ለኮሌጁ ለህሙማን ሊጠሩ ሊያጋጥማቸው ለመጠጣት ለተሰየመው ለቀረው ለሚቋቋመው ለመኢአድ ለወገናቸው ለጋዜጠኞችና ለሥነ ለመውደቅ ሊቆሙ ለመከራየት ላጋር ለመቀራረብ ሊመርጥ";
            amharicWords[1, 9] = "ለመስራት ሊግ ለማቃለል ለመቆጣጠር ለማሻሻል ልማትን ለማቅረብ ለመሆን ልማትና ለፍርድ ለመገንባት ልውውጥ ለዓለም ለመጀመሪያ ልደቱ ለማድረስ ላለፉት ለመመለስ ለአገልግሎት ለማሳካት ለማስከበር ላይም ለውጭ ለአፍሪካ ልክ ልዑክ ለሙሉ ለጋዜጠኞች ለጉዳዩ ለመጠቀም ለማስፈን ለሌሎች ልብ ለህዝብ ለማለት ለማፋጠን ለሚገኙ ለልማት ለዴሞክራሲ ለመጠበቅ ለመግባት ልዑካን ለመወጣት ለአዲስ ለማስጠበቅ ለሰላም ለመውሰድ ለማዋል ለዝግጅት ለማከናወን ለማቋቋም ለመቀነስ ለማውጣት ለአንድነትና ለማስፋፋት ለመውጣት ለመሥራት ለቀው ለማስቻል ለረጅም ለአገር ለመሆኑ ለማጥፋት ለማየት ለመቀበል ለቀረበላቸው ለሁሉም ለምሳሌ ለተለያዩ ለማክበር ለመጀመር ለሚሆኑ ለመያዝ ለመንግሥት ለመከላከልና ለመሳተፍ ለህብረተሰቡ ሊሆኑ ለማፍራት ለመሰብሰብ ለማጎልበት ለምርጫ ሊኖር ለማልማት ለትምህርት ለአርሶ ለመቅረፍ ለአገሪቱ ለቆ ለፊት ለአቶ ሌሎቹ ለበርካታ ለመግዛት ላለው ላይኔ ለመሄድ ለጠቅላይ ለመታደግ ለከፍተኛ ለማረጋጋት ለጎን ለማስመዝገብ ለማገዝ ለመነጋገር ለመወያየት ሉዓላዊነት ሌሊት ለውጡ ለዚሁ ለማሟላት ሌክ ለማስገባት ለብዙ ለሌላ ለመቀጠል ለመለወጥ ለመግታት ለማዳረስ ለሶማሊያ ለሪፖርተር ልብስ ለሶስት ለግል ለ ለመቋቋም ላቀ ለሁለተኛ ለሦስት ለመኖር ለመርዳት ለማጣራት ለማስተናገድ ለገሰ ለገበያ ለማምረት ለፖሊስ ሊከሰት ሊቀመንበሩ ለመደገፍ ለማስቀረት ሊሰጥ ለመላክ ሌላውን ለክልሉ ለማስተዋወቅ ለማዳን ለመጣል ለውጥን ለሚደረገው ለይቶ ለአካባቢው ለሻዕቢያ ለአራት ላሉ ለማነጋገር ለዲሞክራሲ ሊያደርግ ለመዋጋት ልማዳዊ ለመቀየር ለማስተላለፍ ለአምስት ለማ ላንድ ለማንኛውም ለማሰባሰብ ልምምድ ለሚካሄደው ለሥራ ለመመስረት ለመክፈል ለሚለው ለመክፈት ለጋሽ ለዘመናት ለጦርነት ሊኖረው ለመድረስ ለችግሩ ለንደን ለተባበሩት ለሕዝቡ ለምክር ለእስር ሌሎችንም ለአሜሪካ ሊቀ ሊካሄድ ለጋዜጣው ለብሔራዊ ልዑል ለማሳየት ለመግለፅ ሊሰጠው ለመናገር ለመጨረሻ ሊቀጥል ለኢንቨስትመንት ለመንግስት ላስመዘገቡ ለመጠየቅ ለማስቆም ሊደርስ ለመሰማራት ልማቱ ለማሸጋገር ለውጦች ለማድረግና ለመፈፀም ለማስመለስ ሊደረግ ለማስፈፀም ለሚበልጡ ሊያስከትል ለፓርላማ ለማዘጋጀት ለውስጥ ለሁለቱ ለሞት ለሆኑ ለሰው ለምግብ ሊትር ሌንጮ ለኢህአዴግ ለማጠናቀቅ ለመሸጥ ለረዥም ለመለየት ለህዝቡ ለውይይት ለመከታተል ለመሸፈን ለራሱ ለመወሰን ሊቢያ ለድርጅቱ ለማሳደግና ሌሎችን ለክልል ለመተግበር ለመገኘት ለሁለቱም ልማታዊ ሌጦ ለችግር ለማሸነፍ ለመዘርጋት ለሚገኘው ለማስቀጠል ሊወጡ ለመንቀሳቀስ ልምዶችን ለተግባራዊነቱ ለመልቀቅ ለማስተካከል ለመግለጽ ሊፈጠር ለወደፊቱ ሊያደርጉ ለዓመታት ለፌዴራል ለመምረጥ ሊገኝ ለማቆም ለማመቻቸት ለተወካዮች ልጆቻቸውን ሊጉ ለሚመለከታቸው ለአደጋ ለሕግ ላሉት ልሳን ልማቶች ለመወዳደር ሊወጣ ለጋሾች ለተሰማሩ ለስደት ለተጠቃሚዎች ሌላም ለማስፋት ለጤና ለመላው ለትግራይ ለቀጣዩ ለየት ለሆነው ለኢትዮጵያውያን ለጦርነቱ ሊኖራቸው ልጃቸው ለስድስት ለማሳወቅ ለማስገኘት ለስራ ለማድረግም ለነገሩ ለሱዳን ለፖለቲካ ሌላኛው ላላቸው ሊባል ላስት ለጥቂት ለኔ ለዘርፉ ልማቱን ሊመጣ ለማስረዳት ለማንም ለማስተማር ለእኛ ለመመከት ሊያገኝ ለቀጣይ ለሴቶች ልጆቻቸው ለም ለኢሳት ለቢቢሲ ላቀረቡት ሊታወቅ ልዩነቶች ለማቆየት ሊንቀሳቀሱ ለመተካት ለመካፈል ለማርገብ ሊሰሩ ለመጪው ልቦና ለችሎቱ ለማበረታታት ለማፍረስ ለፍትህ ሊያገኙ ለትውልድ ለማላቀቅ ለቤት ለከፋ ለቅቆ ለገሠ ለህግ ለማዕከላዊ ለማስወጣት ለተባለው ሊቀመንበርና ለማደናቀፍ ለመከላከያ ለጋራ ላ