            amharicWords[2, 3] = "ሐሳቦቹን ሕንዳውያን ሐአድ ሐረጉ ሕጎቹ ሒደታቸውን ሐምቢሳ ሐዲዱ ሕዝብስ ሕክምናን ሒስ ሒትለር ሔደዋል ሕያዋን ሕመሞች ሐሺሽ ሐሰንና ሐሳቡም ሐቲም ሐሳቦችንም ሔንዝ ሕሊናዊ ሐረጋቸው ሖርን ሔደህ ሓሰን ሕግጋትም ሐጎስን ሓላፊነቱ ሐጃ ሕልፈትን ሐራጥ ሕብረብሔራውያን ሐዋሪያው ሕግማ ሐጌ ሕፃንም ሓላፊነታቸውን ሕንዱ ሐበሻን ሕዝቦችዋን ሐዲዶችን ሐመርን ሕግጋትንም ሕወሓትንና ሐሳቡና ሕፃኗም ሐረጋትን ሒዝቦላህ ሕመሜ ሐይቅም ሐደሬ ሐዋሪያዊት ሔሮድስ ሕገወጡ ሕጋችሁ ሑዱርን ሕትመቶችን ሕይወታቸዉ ሐማርሻ ሕፃንን ሔዋንም ሕዝባችሁን ሕገወጥነትና ሕያውነቷ ሕንፃዎችም ሑሞራ ሐገራትና ሐማስ ሕልሟን ሐውልቶችና ሐሳብስ ሔም ሓላፊዎቹ ሐማ ሐዋሪያት ሒደቱንም ሐሣቡን ሔሪ ሐሩሩና ሕልሜ ሐማስና ሐሪ ሕዳሴውን ሐዋላን ሕልሟ ሔሮዱተስ ሒደትንም ሐዲሶች ሕብረተሰቡንእያግለን ሐሳባቸውንም ሕፃናቶቿ ሐሰሳን ሐረጋት ሕጻናቶችና ሔድኩኝ ሕዘቦቿን ሕብረቶቹ ሕመምተኛም ሐያሲ ሐሴትና ሓ ሔሊኮፕተርና ሕብዝ ሕይወትዎ ሐሳቡንና ሑዱር ሐጢአታችንን";
            amharicWords[2, 4] = "ሕመሟ ሕሊናዋን ሕግስ ሐሴት ሐመረ ሐርገሌ ሐላፊነትና ሓሳቡን ሕሙማኑ ሒዩማን ሐዳር ሐይቁን ሕይወቴም ሐኪሞቻቸው ሕትመቱ ሕይወታችሁን ሕሊናም ሐብታም ሕይወታቸውም ሕውሃት ሑዳድ ሓቫቋሾ ሐይቁ ሐረሪን ሐሳቡንም ሕይወተ ሐውልትና ሕንፃን ሕብረተሰቡንና ሐዋርያቱ ሐይማኖቶች ሐይቅና ሕዝባዊነትን ሐሚ ሓደጋ ሐይቅን ሐረካ ሐሜትን ሕክምናዎችን ሕሙማኑን ሔሮ ሕንፃውን ሐቆች ሐሮ ሐብሊ ሕጻኑ ሕወሓትም ሕሊናና ሕጻናቱ ሐብል ሐዋዝ ሐበሾች ሒሊኮፕተር ሐሳባችን ሐምሌት ሐብትና ሐዘኑ ሐዘኔ ሕጎችም ሐብትን ሕገወት ሕልውናቸው ሒሣብና ሐሳቦቹ ሕጎቹን ሐግቤስ ሕንጻው ሐለዋ ሔዳለች ሕጎቻቸው ሐሩን ሕዝቅኤልና ሐላላ ሕግጋቱን ሕዝብች ሐገሪቱን ሐበሻው ሐሞቱ ሐኪምም ሕይወታቸውንና ሐዋርያዊቷ ሐሞት ሓውልቱን ሕወሐትን ሕንጻዎቹ ሕንዳዊው ሐኪሙን ሒስና ሕልውናችንን ሐፊዞች ሐን ሐገራችን ሐውዜን ሕይወቱና ሐይለኛ ሔደን ሐሜተኛ ሕዝብዎን ሐምቡርግ ሐኪምዎን ሐሳባቹን ሓምሌ ሓውዜን ሔሊኮፕተሮችን";
            amharicWords[2, 5] = "ሕልማቸውን ሕጉንም ሕጋቸውን ሕጻናቱን ሑመራና ሐራካት ሕፃኑን ሕገመንግሥቱንና ሕዝባዊው ሕዝቦቹ ሕልውናን ሕጎቻችን ሐረጎች ሕብረተሰባዊ ሕክምናዎች ሒሳቦችን ሐይለማርያም ሕመምተኞች ሐመር ሕብረተስብ ሕሊናችን ሕጎችንና ሓላፊዎችና ሐሳብና ሕወሀት ሓድነትን ሕንጻውን ሕጉና ሐሜትና ሔር ሐተታው ሒድና ሓፋሽ ሕይወቱም ሕዝቦቻችን ሕዴግኤ ሕመሙን ሕወሃትን ሕንድን ሕይወቱንም ሕ ሕዝባች ሐርቆ ሐዩሃ ሕብረቶች ሐዱሽ ሔደች ሕዝባችንም ሕውሀት ሕገወጡን ሕይወትህ ሐገራችንን ሕብረተሰብም ሐሳባዊ ሒሳቡ ሐቀኝነት ሐኪሞችም ሒደቱም ሕይወቶችን ሐዋሪያ ሐዋ ሐሰንያስ ሐንሰን ሕዝብንም ሐናን ሕጋዊነቱን ሕዝቦቿን ሐርቫርድ ሐዘኑን ሕምራ ሐገን ሐሜታ ሕዝብነት ሕዳሴው ሒደቱና ሕክምናዋን ሓይል ሕልማቸው ሕብረተ ሐርኮት ሕገወጦችን ሐውልትም ሕይወታቸውንም ሑመላ ሐንስ ሓውዜኖችን ሓላፊና ሐዘንን ሐረጋትና ሕዝባቸውም ሐያስያን ሕውሓትን ሕጸጾች ሕልውናዋን ሐሜተኞች ሐፃኒ ሐፍረት ሕፃኑ ሕዝቦችዎ";
            amharicWords[2, 6] = "ሕትመቶች ሕግነት ሐረገወይን ሐንቲንግተን ሕሙማንና ሐኪሞችና ሐሩር ሕፀፅ ሐሳብም ሕዝቦቻቸውን ሕብረብሔራዊ ሕጉንና ሕወሃትም ሕያውነት ሕሊናቸውን ሕግጋትና ሐማድ ሕዝቤን ሓቢሮም ሐሳቧን ሓሳብን ሕዝባዊውን ሐር ሐይቆችና ሔድን ሐራዊ ሔክቶ ሓሳቦች ሐና ሐገሪቱ ሐርጌሳ ሒላሪ ሕልውናም ሐራጅ ሔሮይን ሕውየት ሐሚድ ሕዝቤ ሐይለማሪያም ሐዘንና ሕልምም ሕጋዊውን ሕሩይ ሐኪሞችን ሐኪሞቹ ሔሊኮፕተሮች ሕልውናዋ ሐይማኖታዊ ሒክማ ሕዝቦቿ ሕዝባዊነትና ሑመራ ሐብታሙ ሐረሪና ሐጊግ ሕጸጽ ሐዲዶች ሐሊማ ሕገወጥነት ሕልሙ ሒጅራ ሓንቲ ሕገወጥነትን ሔዋንን ሒሩት ሐሳቦችና ሕጋዊው ሕንድና ሓጎስ ሓቢሩ ሓውልት ሕዋስ ሒደቶችን ሕጋዊነትና ሕክምናም ሕብር ሕመምን ሕፃናትም ሐገርን ሕንፃዎችና ሕጋዊም ሐቀኛነት ሕዝቦችም ሔራልድ ሐቁን ሐሰትና ሕንዶች ሓፂን ሕብረሰተቡ ሔሊኮፕተር ሐቢብ ሒስቶርይ ሒውስተን ሐዘናቸውን ሐዲሽ ሔዳ ሐለፎም ሐሜት ሐዋሪያዊ ሓይሊ";
            amharicWords[2, 7] = "ሐረሪዎች ሐዲስ ሐሳባቸው ሕዝባዊና ሔጄ ሐዋርያው ሕይወትም ሕፂናት ሕፃናቱን ሕይወቴ ሐይማኖት ሕይወቴን ሕብረተሰቡና ሕሉፍ ሐሮዬ ሕፃናትንና ሐረርና ሕክምናና ሕዝቧን ሒደትም ሐብታዊ ሕልውናቸውን ሔግ ሐቅን ሕልምና ሓድነትና ሕዘብ ሕማማት ሔልዝ ሐፋሽ ሑማን ሐማሴን ሕክምናው ሒደቱን ሕዝቡንና ሐሳባችንን ሕዝቦቻቸው ሕገመንግስቱ ሐዋርያትም ሐላፊ ሕገወጥና ሐገረ ሔዷል ሐቁ ሗላ ሕይዎት ሓድነትናን ሐመልማል ሐሰትን ሒሮ ሕይወታችንን ሐይሉ ሐዋርያዊ ሐላፊነት ሐኒሽ ሕጋዊነቱ ሐገራዊ ሕይወቷን ሕሊናዬ ሔለን ሐየሎም ሐይማኖትን ሔድኩ ሐዋርያዊት ሕዝቦቿም ሓዱሽ ሒሳቦች ሓምለ ሐምሌና ሐውልቶች ሐዲዱን ሐበሻ ሒሳባቸውን ሕሊናው ሐድጉ ሔዋን ሕዝባችንና ሓላፊነቱን ሕቡዕ ሕመምተኛው ሕንፃና ሕትመትና ሐጋይ ሐቂ ሕገመንግስታዊ ሕላዊ ሕይወታዊ ሕመምና ሕጋችን ሓቂ ሕሊናቸው ሐርምስ ሐሳበ ሐሳቤ ሕንፃዎችን ሐኪምና ሕብረትም ሐቢባ ሐረርን";
            amharicWords[2, 8] = "ሕገመንግሥት ሐረግ ሐውልትን ሕጻናትን ሕፂን ሕመማቸው ሕብረትን ሓላፊዎች ሐዋርያ ሕዚ ሕግጋት ሕወሐት ሐሰተኛ ሓላፊ ሕገመንግስት ሕመምተኛ ሐጅ ሐሳብን ሕጎችና ሐያ ሑሴን ሕብረቱን ሒልተን ሕብረተሰብን ሕዝብንና ሕያው ሕጉም ሕገመንግሥቱን ሐራሬ ሐዲድ ሐውስ ሐሣብ ሐሳቦችን ሕልውናውን ሕብረተሰብና ሐሳባቸውን ሕዝቡንም ሐያት ሕገመንግስቱን ሐይሌ ሒደትና ሕጻን ሐይቆች ሕወሓትን ሕንጻዎች ሕገወጦች ሐይል ሐረማያ ሕሸ ሓዳስ ሕክምናውን ሒደቶች ሕግጋቱ ሐሳቡ ሕንፃው ሕግንና ሕወሃት ሕመሙ ሓጂ ሕዝባቸው ሕዝባቸውን ሓላፊው ሕብረተሰቡም ሕልፈተ ሕሙማንን ሕልውናና ሒሳቡን ሕገመንግሥቱ ሐዋርያት ሐርቃ ሒደቱ ሕዝባዊነት ሕይወታችን ሐሙስና ሐረካት ሐኪሙ ሕፃኗ ሔኒከን ሕግጋትን ሕወኃት ሐረርጌና ሕጋዊነትን ሓድነት ሓሳብ ሕፃናቱ ሔዱ ሐገሮች ሒደትን ሕልውናው ሕዳሴ ሐገራት ሐዋላ ሐራ ሕሊናን ሐይሎች ሕወሓትና ሐሳቤን";
            amharicWords[2, 9] = "ሒደታችን ሔዊት ሖኗል ሐሳብንና ሕዝባችንንም ሒሳባቸው ሐዋርያትና ሕንዳዊያኑ ሕንጻዎቻቸውን ሐሳባችሁ ሐሞተ ሐዜብ ሕወሐትና ሐራም ሐተታዎችን ሐላፊዎችና ሐተታም ሐኪሙና ሐሜቶች ሕጻናትና ሐዋርያትን ሕጎቻቸውን ሓላፊነታቸው ሓሳባቸውንና ሓቅ ሕሊናቸውም ሐክሲሊ ሕግጋተ ሓይሎች ሕመማቸውን ሕጓን ሕገወጦቹ ሕዝቧም ሕይወትንና ሐሰተኛውን ሕግጋቶች ሐዲሳት ሕንፃዎቹ ሓላፊውንም ሐኪምን ሐሳብዎ ሐሳብህ ሐዲያ ሕቡእ ሐቀኞችን ሒወት ሕዝብነቱ ሐረጓ ሐረካትን ሔክታሩን ሕዝቧንም ሒሶች ሐሳባቹ ሕወሀቶች ሕገውጥ ሓማሴን ሕክምናዬን ሐውልታቸው ሕይወታቸውንእንዲመሩ ሐበሽ ሕበረሰቦች ሐይለ ሐምሳ ሕወሃቶች ሓውዜኖች ሕዝቢ ሓይሉ ሕይወቷም ሕይወታችንም ሓሳባቹ ሒደታቸው ሕንፃዎቹን ሐ ሕዝብ ሕግ ሐምሌ ሕዝቦች ሕዝቡ ሕይወት ሕገ ሕብረት ሕጋዊ ሐሙስ ሕዝባዊ ሕክምና ሕዝቡን ሕጉ ሕብረተሰብ ሕፃናት ሐዋሳ ሕገወጥ ሕዝብና ሐሰን ሐሳብ ሕዝብን ሐውልት ሐረር ሐረርጌ ሕብረተሰቡ ሕግና ሕዳር ሕይወታቸው ሕልውና ሕይወታቸውን ሕመም ሕንፃ ሕግን ሕወሓት ሕጉን ሕዝብም ሒደት ሕይወቱ ሕዝባችን ሕዝቡም ሕብረተሰቡን ሐውልቱን ሐኪም ሕጻናት ሐጂ ሕሙማን ሕብረቱ ሕይወትና ሕፃን ሐውልቱ ሐቅ ሕጎች ሕዝበ ሕጋዊነት ሐ ሕፃናትን ሕልም ሐይቅ ሕዝቦችን ሕይወቱን ሓርነት ሐኪሞች ሐሰት ሕፃናትና ሐገር ሐብት ሐጎስ ሕጋዊና ሐርነት ሕብረትና ሕዝቅኤል ሕዝቦችና ሕዝባችንን ሕገመንግሥታዊ ሕግም ሕንፃዎች ሔኖክ ሐረሪ ሐቀኛ ሒሳብ ሔዶ ሕንድ ሓደ ሔደ ሕሊና ሕልፈት ሕብረ ሓላፊነት ሐሳቦች ሔክታር ሔደው ሕዝቧ ሕትመት ሕክምናቸውን ሕንጻ ሐዘን ሕጎችን ሕዝቡና ሐተታ ሐሳቡን ሕይወቷ ሕይወትን";
            
            amharicWords[3, 0] = "መጻሕፍቶቻቸውን መትረፉ መታመሙን ማድረቂያ ማህሌትንም መሰብሰብን መሥፈሪያ ምዕራፉ መጽናናቱን መሳሪያዎቹም ምጽፍ መርማሪና መማፀናቸውን ሞላሁና ማስተዳደሪያ መጠቀምንና መልሣቸው ሚዛንና መተኮሳቸውን መርሃጽድቅ ሚሌኒየምን መሐሙዳ ምርጥና ምጣኔን ማስታጠቅ ማቅሪዝ ምስልን መግለጫዎችም ማስቀረቱን መመለሳቸውንም መሰርት ሞዐ መጣበትና መቀነሻ ሙሳና ማዕከልንና መዘጋጃ ማህሌትም ማዝነብ ማስለቀቂያ መሸነፍና መቀላቀሉን ማፅደቅና ማስወጣታቸውን መርጧታል መከሩበት መምረጤ ሙሉና ማስረዳትና መግባባታቸውን መርጃዎች መልሶታል ማንነቷን መደናገጡን ማመጣጠን ማስገባትና ማስፈሪያ መልክቶች መገርሳና መዘርጋትን መገደልና ማመላለሻዎች መስራቱንና መዝነው ማህቡብ መምህራቸው ሚናዋ መለኪያም ማጌጥ መከበቡ መንግሥትማ ማጉያው መጠጋታቸው መንገላታታቸውን ሙግትና ሞልቶአል መረጃቸው ማምሉክ መቀበሩን መራቡን ማይድማን መውሰዱም ማቃናት ሚኒስተርና ማክተሙን ማንንና መስኮቶቹ መደምሰሳቸውን መበርከቱ መብትዎን መቆጣጠሪያው ምስክርነትን ምቱራን ማህበረሰበ መመሥረትና መገረማቸውንና መርጣችሁ መመሳጠር መንዝሮ ሙሰኞቹን መማረራቸውን መቀመር መግለጹንም ማስተላለፍን መታወቅም ማስቻሉንና መከላከያናመቆጣጠሪያ መመሥረትን መድፍም መራሹን ማብቂያም መጽዳት መግደያ መገናዘብ መለስኩት መገለላቸውን መስላለች ማበጠር ማስፈሯን መስከረምና ሞተሩ መንደረተኛነት መሻረክ ሟቿ መጠለላቸውን መሪያቸውን መከራም መስተካከሉን መከበሪያ መጣለት መልካሚቷን መገደዳቸውንም ምእመናት ማስጠራት መናወጥ መርሆና መጠለልን መሳተፋቸውም መራጮቹ ምስቅልቅላቸው መቀነት መናገራችን ማከፋፊያ ማርኪያ ማሳደሻ መጀመራችውን መኮምኮም ምሥጋናውን ማሳሰቧን መስታወቱ መስጊዱን ምትል ማለታቸሁ መመኪያችን ማሳያው ምሐባው ሜትሪን መልቀቃቸውንና መንበርም መሪዎችንም መጠልያ መተካካቱን መቀበሉና መግደርደር መፋፋም ሞርሌ ሞስት ምሥክሮችን መንጭቶ መኮና ማለዱ መስማማታቸውንም ማድሪድና ማግረብ ሟሟያ ምልከታና መሞከራቸውና መታመንን መወድስ መደረሱንና መጥበብና ማሽንን ማንበቡ ሜክአፕ ማስቀረታቸውን ማሠራቱን ምስሎችና መሰናክሎችና መመረቁን መታው ማትረፉ መነሳሳታቸውን ማሳል መቁጠሩ ማስጠበቁ መሻማት ምስሎችን መመልከቷን መነሻዉ መሻሻሎችም መንገድህን ማወናበድ ማድበስበስ ምትክም ማሐሙዳ ማገዝና ማስጠንቀቅና ማኅተሙን መገዝገዝ መንፈሰሳዊ ማናቸው መመሰጣቸውን መጯጯህ መሄዱንም ማስታወቂያዎቹ ማራገቢያ ማፈሪያዎች መዘርጋታቸውንም መተቸቱ መታገላችን ማባከኑን ማህበራቸውና ምላሱን መልሷታል መታከት ማካሮቭ መረቀ ምንባር ማወቃቸው መንፈሳዊው መሣሪያህን መፋቀር ማንነታቸውንም መልሱና መዠንገር ማስፈራራቱን መግልጫ ማርክስን መከታተያ መሰረተች ማወያየቱን መጀመሪያውንም መተሳሰራቸው ማምረቻውን መብራትም ሙሃሙድ መታገድና መቅረቧንና ማህበራቸውን ማሕበረሰቡን ማሳቅ መጫሚያ መታጠቂያ ምክኒያቶች ምስሉን መንጠቆ መደገፈ መቼት ማዋሌን መልስታት ማዋከቡ መጣጮች ማኀተም ማገርሸቱን መግልጽ መነሻዬ ሚጥሚጣ ምስጦች መከፋፈሉንም ማካሄጂያ መሆናችሁ መጥሪያውን መጠለያዎችን መጫወቻና መጋት መዘራታቸውን መረት ማባረራችን ማደራቸው ምስጢራቸውን መዝለቃቸው መዋሰኛ መጨናገፍ መቀዛቀዝን መበራከቱን ማታለልና ማሠባሰብ ማስፈራሪ መዳረሳቸውን መሰጠትና መዘንጋትንና መመረቁ መሳሪያዎችንም መበለት ማዘውተሪያና መምጫው መጓዝና መፈጸሟን ማበብና መቀጠራቸው ሙኡዝ መዋያና መላሸቅ መንከር መምረጥና መቋቋሙና መናኸሪያዎች መፈክርና ምህፃረ መፈርጠጥ ማሰኘት ምጥጥ መዓልት መውጣታቸውም መቃወሚያም መከራት ማሕተመ መደባደባቸውን ማስገበር መስ