            amharicWords[3, 1] = "ሚነኒስትር መልበሻ ማንቃት መረሸች መመልመላቸው መኩራራት መቁረጡ ምጥቀት መግፋታቸው ማዋሉንና ማዘናጊያ ማልሽ መጣኔው ማለማመድ ሞመር መሓሪ ሚሽኖች መጻፌን መንገሻም መባሉና መዘምራንን መቀጣጠልና መቅረቡና ሙዜየም መታገሥ ማፋሰስ መስታወታቸው ማወደስና መዶሻ መኬዱን ምክንያቶቻቸው መኒ ማንቀሳቀሱ መናፍቃንና መገባደዱን መርማሪዎችን ማፋሰሻ ምፍአም መታወክን መረሸኑ ማፈናቀሉን መዝገብም መሰልኩህ መሥራትም መቆጠባቸው ሜክሲኮና መሳተፉንና መቃብያን መከራውንም ምሥጢርህን መጥቶበት መናፈስ ምሕረትአብ መሰለል መመረታቸው መመረጥዋ መፍረዱን ማሰታወቂያ መዥገሮችን መጣራቸውን ምስጢራዊነት መጠርጠራቸውን መስጊድም ሜጋዎች መጋለጣቸውንም ማናቸዉም ሙጂብ መታየታቸውንም መታፈኑን መስለዋቸው ማስቀጣቱን ማክስ መቋቋማቸውንም ማስረጃችሁ ማስጠናቱን መምራትና ማንበርከክ ማህረሰብን መዛ መወገኗን መዝ ማቀረቡን ምህረቴ መገደዳቸውንና ማረምና ማስተናገዳቸው መሰረታችን መግቢያቸው መዋቀሩ መስል መንገዴንም መዩ መልእክቱም ሞዳሉ መውሰዳችን መሬታችሁን መስደድ ማሳመኛ ማዘዣዎች መከልከላቸውና መልምያቸዋለኹ ማዋቀርና ማስገንባት ማግለሏን ሙታን መዠመሪያ መመዝገቧን መነኩሴዉ ማንገላታቱ መስርተውት ሙቀጫ ሞታችን መላምታቸውን መቋረጣቸው መያያዛቸውን መገላመጣቸው ሞትሁ መልሰንለታል ማስለመድ መጠለያነት ማኤዳ ሞከረች ማስፋፊያዎች ማይተብ ምቹው ማስመዝገቡንና መቀየርን መንግስትየህጻናት መቅደሶችን መጥ ማደረጋቸውን ማፈናቀልም መጽሀፉ መቅጃ መገደላቸውንም ማንጣፈፊያ ማይሎች ሞዛምቢክና መፃህፍቱ መስተዳድሮችን መሀይም ማሰራቱ መቀዳጀታቸውን ማስነበቡ ማስታወቂያዎችና ማክራማራን መቆራቆዛቸው መግደልን ማስታወቋ ማልቀስና መሟላታቸውንና ምኒስትርና መስጪያ መሠንዘሩ ሚኒስትሮቹን መመስከራቸውን መርካቶና መጠኑና ምኒስትርን መለያየታችን መቆሟ ማትያስ መገታቱን ማይክራፎን ማውራቱን መብቱንም መጽሃፉን መንፀባረቁ ማለቂያው ማሳሳት ምክትልነት መጭበርበርና መካል መግለፃችውን ማታገል መድሃኒትን ማጣትን ምሁራኖቻቸው መዛነፍ ማስጨነቁ መሸጥና ማግኘታቸውም ሚሊሽያና መድመቅ መርሳታቸው ማጣታችን መስማቷ ማፍቀር ማቆምም ሞዬስም መጉዳቱ መጠው ማሳሳቻ መቀማትና መቅረታችን ማንነታቸውንና መናከስ ማሠማታቸው ምክንያን ምደባውን መኪናዎችም መታከማቸው ማቻር መከሠት መጉዳት መወነጃጀሉ ማነጣጠር መሳሪያነት መምራታቸውና ሚራዥ መታመሙ ማስገባታችን መህመድ መውደቋ ምጻት መሰናዶዎች ምክርም መንፀባረቅ መዘርዘሩ መስኮብ መሟገቻ መክበር መምሕራንን ማሰራጫው መቀማጠላቸው ሙስናዎችን መስቀሎችና መንግስታቸዉ ማስተላለፋችን ማረሻውን ማጣቀሻ መሰየማቸውን መስታወቱን ማኔፌስቶ ማነስም መቆሸሽ መካስ ማስጠንቀቅያ ሙንኤ መድሃኒዓለም ሞታችው መጧጧፍ ምናብ መሥራቷን ማጣጣላቸው መስኮቱ ማሰሪያው ማቀላቀል ምሥጋናችንን ምስጋናም መቆምን ምሥራቃዊው መልምለው መሥራቾቹ ማስቆጠራቸውን መመስረቷን መዛበት መንፈሶች ሜኒንጃይትስ ማንኳሰስ መጠሪያው መግለጽና ሚኒስትርነትን ማናፈስ ሙዲ ሙዳ መጋባትን መቀዛቀዙን መታመስ መንገሥ ምሥጢረኛ መወደድና መገፋቱ ምሶሶዎችን መልማዮች ማለያየት ሙጃ መጥቱዋል መመህራን መብርሃቱ ምልክቶቹን ማሽመድመድ ማለትሽ ምንያክል መልሰውኛል መስተደድር ማዱሮ መልስልኝ መጎሳቆል ማከናወናቸውንም መዝዞ ምንቸገረኝ ሙከራዎቹ መላዎችን መተን መስማትም መግንስታዊ ማሰብን መታጣቱን ማስደሰትና መስፈርትን ማከናወኗን ማዳመጣቸውን ሚትሪክ መጠጫ መተኛ መንገስ መረጠች መከፈላቸውን መጨቆን መሆናቸንው መርአዊ መውደማቸው ማቅለያዎች ምዝራብ ሞትክ ሚዲያወች መክበሯን መከረቻት መቀዳጀታቸው 