            amharicWords[3, 2] = "መላዕከሕይወት መሳሳቱን መረጋጋትንና ምእራባውያን መጣንበት ማስታወሻዎች መወሳቱን ሚኒስትርዋ ሞሽኑ መቀጥቀጥ ማናጀሮች ማወደስ ማስገኛና መተያያ ማቀባበያ ሙሴቬኒና ማናጋት ማድርጉን ሙሉው መሰስ ሚክስ መለስዜናዊ መዛታቸውን ሚሰጥር መውረዳቸው መሰሎቿ ምሥክር ማደግም መሐክል ማቋረጫ ምደባዎች መልአኩ መዝረክረክ መሳሪያንና መጋበዙን መቀመቅ መታለል ሚኒስትሮችንና መመጣቱን መውጫያ ማንቀሳቀስና ሚኒማውን መፈክራቸው ማዕድኖች መንፈሥ መንጠቅና ሚልኪ ማህበረሰባችን ማስረጃዎችንና መጠገኑን መዋዕለንዋያቸውን ሞተሮችና ማጠራቀማቸውን መዘረፉ መጎዳታቸውን መለያየቱን ማምታታት ማስፈለጉንም መቋጫው ማዴቦ መኢሶንን መመኘታቸውን መገዳደር መቼስ መቀጣቱ ማንበቤ ሚኒስትሮቻቸውን መሞላት ማነጋገሩን መክረር መቀየሩንና መገደዱንና መነሻዋ መሞከራቸውንና መቀጣጠል መሠረትነት ማዕከልዘግቧል መሰረዙንና መዝረፍና ሞላን ምሩን መንፈቀ መመደቧ መደራደርና መፍታቱ ማኑዋል መጻሕፍትም ማሙዬ ሞኖፖል መሳፍንትን መንሻውን መሰዳደብ መኮንኖችም መደልደል መዛግብቱ ሙ መጠየቃችን መጋዘኑ ሜ ማፍለቅ መጠቃት ማጠጋጋት መደራደርን መሰክ መረቅ መታሰቢያነቱን መንስኤውም መንጠቁ መሸጧ ማስረጃችን መጤና መጽሃፍትና ሞርጋንና ሚሸል መሯሯጥና ሚሮስላቭ መቸብቸብ መደላድል ማሪዮ መልሳችሁ ማሳየቱና መለከት መንገዶችንም ማሳደጋቸውን ማእከላዊነት መገመትና መጽሐፎችን መዘርጋታቸውን መደረግና ማሰኘቱ ሚታል ማኒስትር ማካካስ መቆሟን መጋበዛቸው ሙዋይ ምንዱባን መዘየድ ማሰቃያ መግለጫችን መፅሔቶች መክረውና መንስዔውና ምጸታዊ ማላገጫ መስራታቸውንና ማትያሶች መዝሙሩ መሰነጣጠቅና መኖሪያነት መዋላቸውንም መሳደድ መገኘትም መፈፀሙና መግለፁንም ማሳለጥ ሜሪኩሪ ማሰልጠንና ማኅበረሰቡን መቀጠልን ማብቃቱ ሚኒስቴሯ መመረጣቸውንም መሻርና ማሕበሩን መንከራተት ማራቅ መሬቶቻችን ሚስታቸውን ማስፈራሪያም መያዶችና መደራጀትን ሞኤንቻ ምንድነዉ መመለሷን ሞቱም መወለድን መቀራረብም ማነሽ መመሪያዎቹ መቆፈራቸውንና ማጥመቅ መስጂድና መቋቋማቸውንና ማስጀመሪያ ምሉዕነት ማንቋሸሽና መደርደሪያ መቀመጥና መዘጋጀትና ሚኒሰትሩ ማስተጋባታቸው መቀረጹን ሞኒተሪንግ ማስወጣቱ መደሰታቸውንም መዋጮና ምኒሊክም መዋቅርም መተዳደሪያቸው ማጫወቻ መኮነናቸው ማሪዋና መታዘዙንና መቸገራቸው ሙያተኛው መከተላቸውን ምዕመናት ማቅለል መጠቃቀምና መኳንንቱና መቅረቷን ማረፊያም ማፈሪያ መጥቆ መወትወት መስተዳደርነት ማካሄዳቸውና መዘገበ ማስታውቂያ መምከርና መዝዘው መሸመት ማዋላቸው ማከማቸታቸውን መካሔዱን መለያን ማጋየቱና መዘገቧ መላካቸውንና መቻልና መድበዋል መውጣታቸውንም መቻልን ሜካናይዜሽን መሟጠጥ መገፈፍ ምርጦቹ ማጠናከረ መንግስታችንም ማቀነባበር መበላሸትና ማጠናከሩ ሜሊንዳ መነሣታቸው መድኅኔ ማወዳደር ማሳወቂያ መጣልኝ መቆናጠጫ መኝታና መታደስ ማሴሬ መረፃ መክፈቱንም መምጣትም መዘግየትና ምሥረታም ማከማቸቷን መስተንግዶና መቆራረጥን ማበጣበጥ ማስደንገጡን ምስጋናንና መቃብሮችን መታሰራቸውና መዛወርን መሐመድኑር መግቢያዎች መልሶበታል መጫውቻ መልዕክትን ማቀዳቸውንም መንግስትንም መስተዋላቸው ማንነታቸውና ሚኔሶታ መሥተዳድሮችና መደምደሚያው መለጠጥ መጽሐፍም መከለልና ማፍሰሳቸውን መሆንዋንና መጋብት ሞተናል ማነንም መፋጠንና መደፈሩ ማኔጀሩ መገንጠሏን መነሳታችን መጉረፍ መትረፋቸው መጠይቁ ምንድንነው ምድርባቡር ማጠቢያ መከናወናቸውንም ማለታችሁ ምደባም ሚታወቀው መምጣቴ መዋሉም ምክንቱም ሞክራችኋል መፈጸምና ማውጣቱም ማፍረስና መጥበሻ መምጣቷ መሰለችና ማጠናቀቅያ ምቾትን መናገሪያውን መሬቱም መሳፍንቱም ሞንሳን