            amharicWords[3, 3] = "መሃይምነት መዋጮው ማዳበሪያነት ሙስናም መገደቡ መታወጁን ሚስጥሮች መሥመራችን ምንነትን መፈናቀልን ማዕበሉ መታጠፍ መለያው ማንነትህን መውለብለብ ምቾትና መመራቱን ሚሳኤል ማረፊያቸው መግፋትና መሲህ መክሰሩን ምልዐተ መፈለጓን ማሻሻሉ መፈጠሩንና መደብደቡ ሜንክሃውስ መንበርና መከማቸቱን መላክተኛው ምሽቱም ምሽትና ማደራጀቱ ሞናኮ ማሳውን መብሩክ ማሀበረሰብ መሻሻሉንና መሆኑንንና መመካከር መለኩሴ ማሙሻን መጋባታቸው ሙስዬ መቸገር መሥርተዋል ምራቅ መሄዱንና ማለፍና መዝሙርን ማስተዋልና መስቀልም ማኪን መጠይቆችን ማዘግየት ማስፈሯ ማሰልጠኛና መስፈኑ ሞቡቶ ምድሪ ሚኒስርት መግባታችን መዝሙሮችን መሃመድና መስፈረት መቃብሬን ሞክሩ ምራቁን ሞልታ ሞሶሎኒን ምንዛሪም መጮኹ መመሳሰል ማማው መጨዋወት መበርበሩንና ማርክሳዊ መንግሥትት መጽደቁ ማጭበርበርን መገንባታቸውንና መስጋቱን ማሰገኛ መድሃኒቶችንና ማርኬቶች መብቱም መንገዱንም መመኘቱ መታሰቢያዎች መለሲዝም መመኘት ማጥመጃ ምህረትአብ መልካሙና ማእከሉን ምሁራት ማፈላለግና መታለፍ መበሳጨት ማኮሮኒ ማጥበቅ መመለሱም መገኘትና ምሁራኖችና ሚሊየብ ማሻገር መተራመስ መጠቀሟ መጠጧን መንሸራሸር መጽሔትም ምሁራኖችን መዉጫ መምህዳር መፍረዱ መንስት ምንስቴር መትከላቸው መሰራጨቱንና መድረኽ ምሳሌው መወከላቸውና ምኞቶችና ማምሸታቸውን መወሰድና መስመሮቹን ሚችልበት መሪት ማወራረድ ምነዉ መሠልጠን ማፋጨት ማካፈሏ መማረኳን ማፊያ መቶሺ መታዬት መሰደዱን መቅደስና መገለፃቸውን መብቶ መሻሻያ ሚዳቆ ማጥቃትና መብትዋ መሳሌ መሣሪያውንና ማስቸገሩን ሚሊሜትር መሳም ማርገሬት ሞትንም ምሳቸውን ምሽጋቸው መውደቃቸውንና መጠለፋቸውን መስክር መፍትሄና መገበያየት መጠመቅ ማትሪክ ምልልሰ ማውገዝና መወራረስ መደብደባቸውንና መልዕልተ መጀመራቸውና ማስደሰቱ መጥቆር መልእክታቸውን ማቀነባበሪያና መግነን ማሰናዳት ምርጫዋ መሰበር መዋረድ መያያዙን መበላታቸውን መገረዝ ማዝዳ ማካሄዳቸውም ሙስናውን ማሠሩን ሞክሼዎች መስርቻለሁ መሪያ መስቀያው ማርቲ ማረፋቸው መቀሌንና መድሃኒቶቹ ምሥረታና ሚሊሺያን ምሥረታን ማንጓጠጥ መልካሳ ማስረጃውም መኖሪያዎች ምንያህል ማሸነፏ ሙቭመንት መቃረባቸው መዛኝ መደዳውን ማንኛው መቀሰር መትረየሱ መጠላለፍ ምልምሎችን መማረኩ መነኩሴውን መሸሽም መዝጋታቸውን መራሔ መታተሙ መታሰርም መደቡን ማሳሰቢያው መሰሪያ ማግኘታቸውና ማዛባት መግደላቸውንና ማካለልና ማርኬ ማደርጀት መገንባቱንና መጫዎት ማግኘቷንና ማሽነሪዎችና ምትሕግጋዝን መገንጠሉ መከልከልና መልእክትና መሳቀቅ ሚንስትራችን ሙዚቀኛው ሚሊየነር መራቁ መዋኘት ማጋደል ማእረጉ ሙሁራንና መልእክተኞች ምስሏን መሰንጠቁ ማስከተላቸው መብራህቱና መካክል ማዕከሉና መስተጓጎሉን መለኮቱ ምክሮችን ማዳመጫ መንደሪን መሆናችው ማጥፋትን ምርቱም መድርክ ሚደቅሳን መወርወሪያ መሳተፏ ማቋቋማቸውንና ምንኩስናን መቋጠር ሚስጥሮችን መቀየሪያ መጋራቱን ማስተባባሪያ መትቷል መባለግ መበላሸቱ ማስተናገዱ ሚኒያፖሊስ መታወቂያም መንገደኞቹን መጠርጠሩን ምላሷ ሞላሰስ መጨለሙን ማቋቋሙንና መሞቱንም መጋዘኖችና ማበላለጥ ምርኮኞችንና መብላቱ ምሥራቃዊና ማስታወሻውን መካሄዳቸውንና ሙከራቸውን ማርሌይን መክሰስና መጽሐፍትን መወገዙ ሙሰሊሞች ማኅበራቱን መግባታችው ሞትንና ምክንያቶችንም መገለልን ሚቲኦሮሎጂ ማደናቀፉን መያዝም መንቃት ሚልዬን መጨረሱን ማቅናቱ መደለዝ ማደሪያቸው መሰዋት ሟጨራ መድረክንና ማድረጌ መቆየታቸውና ማስረጃን ማስተካከያዎችና መሰረታቸው ሙገሳን መምህራኖቹ ምኝታቸው ማፍረሱን መፍሰሱን መግደላቸውና ሙያችንን መነሳቱም ማጀት መሳጭ ማክሰኝ