            amharicWords[3, 4] = "ማስፈራሪያዎች ማስገር መዘጋጀታቸውንም መግባታቸውና መስርቶባቸዋል ማካተቱ መታገልና መወሰዱንና ምእ መክሸፍ ምርጫቸውን ማድሪድ መክት ማይክሮፎን መስካሪ ሚሲዮኖችና መብረር መሬቶችና መከበባቸውን ማብራትና መቃናት ማቀዳቸው መሠወር ማጣቱንና መርዳትና መርጃነት መጽሔቶችና ምናላቸው መለየቱን መቅረታቸውንና መዘጋጀቷ መሪዎቻቸውን መቁረጥና ሚሌኒየሙ ምስጋናው መጣብን ምንዳ መከላከያውን መልቀቅና ምንድ መወዳእታ ሞቼ መነኮሳትን መሃይምነትን ማጠናቀቁንም መቅዳት ሚናዋን መታዘዛቸው መልሱም መሓመድ ማስማሚያ መለያየታቸውን ማጣሪያውን መርቆሬዎስን ማሳደጊያዎችን መዝናኛና መጣችሁበት መስገድ መታጠቅ መጎዳቱን መስማታችን ማወዳደራቸው መነጋገርያ ማሳያና መመታቱ መሳደብ መስጠታቸውንም መጠይቁን መፈትፈት ማስጀመሩን መድፈኛ ማምጣታቸው ማቅረቡም ሙግታቸውን መሸነፋቸው መጠለፍ መውጫው መሆናችነን መድኃኒትን መንዳት መድኀኔዓለም ማንዋል ማፈራረስ መከፈሉን መለያየቱ መካተታቸው መሰሎች ማፈግፈጉ መስራቷን መንሴ ማረጋገጫም ማጥባት መስተዳድሮቹ ማእምራን መዋዕል መጠናት መጋላ ማውጣቷን ሞባይሎች ማየቱንና ማሰባቸው ማሪኝ ሙስሊሙንና መንፈሴ ማረፊያውን መንፈስም ማስፋፋቱ ሚኪኤለ መመለስም መሻሻላቸው ምኅረት ሙሰኞች መቆጣጠርያ ሜይዴይ ማጣቷን ማየትን መንጠቅ ምርጡን ሙዚየሙ መርምሯል መሰደድን መደገፏ ማበላሸት ሚኒዮን መሰናዶና መኮንንኖች መስኮችና መጓዝን ማኒፌስቶው ማደፍረስ ማባረሯን ማሕተም መሣሪያን መፍቀዷን መርማሪዎቹ መታሰሩንና ምትኬ መብታችንና መትመም ማሳን ማሠባሠብ መፍጀቱንና መገኘታቸውና መበተንና ሚሊየነሮች ሚንስትሯ ማስገንቢያ ሞኒክ መሪያቸው መመሪያዎችንና መቀልበሱን መዲአ መሠረዝ መኖሬ መጠናቀቅን መቆየትን መነካት መዋጋታቸውን ማቲያስን መረጋጋቱን ማጫወት መንግሥትዎን መነገድ መደረጋቸውም መነደፋቸውን መድረሻውም መጣስን መገንዘቡ ማብረድ መተባበሩ መወጣቱን መጥብ ሚሊየኖች መፃህፍትን መግለፃቸውም መርገምት ሚዛኖች መንግሥትንም ምግብን መቅረቧን መሰተዳድር መንግሥታችንም ማሴር መወዛገብ መርጣለች መሰናዶው ማቅረባቸውም መሸማቀቅ ማድነቃቸውን መጓዙን ምንቾች ምንጣሮ ምርቃና መዋዕለነዋይ ማኑፋክቸሪንግ መድረሷ መስዕዋትነት ማስፈለጉ መገረም ማውጣቷ ማጨሻ መተባበርና መርዘኛ መሄዳቸውና መሰራቱንና መዳከምና መዋልና መዋልን መፈጸምን ምፀት መመረዝ ማስወሰን ማበደር ማሊን መቀላጠፍ መጣጥፌ መሆንህ ምስኪኑ መዋእለ ማሊክ መወያየታቸውንና ማጥፋታቸው መኦሕዴፓ መሽገዋል ማዋለድ ማብራሪያቸውን መባሉንም መቀዳጀቱን ሞቡቱ ማካሄድን መገለጽ መንግሥታዊም ማነሳሳትና መጠበቅም ማኅበራችሁ መውጣታችን ማመልከቻና መመታታቸው ሞክራ መግል መንደስ መዘጋታቸው መያዛቸውና ምሉዕ መስኖና ሚዲያዎቹ ሞታለች መዳበሪያ ማጥመድ መስተናገዳቸው መክተት መሆናቸወን መመረጧ መውረድና መደበኛውን መንቀጥቀጡ ምህረትም ማራዘሚያና መስተጋብሮች መረዳትና መዘጋጀቱም ምግብነት ማዕከላዊውን ማህበረስብ ማርሸት ምልክትና መቀጠር መዝረፉን ማዶካ ምርታማነታቸው መግለጻችን መከናወኑም ምልክትን መጎዳት ማኔጀመንት መተንተን ማስቃምና ሞተርስ መከማቸቱ መጥቶባቸው ማርዳት መፈራረሙ መወያየቱንና ማከማቻና መልአከጽዮን መልዕክታችንን መለቀቅና መንፈሳቸውን መቅድም ማህጸን መቅረታቸውና መልሳችን መጠየቅን መቅረቱም መፈራረሟ መገኘታቸውም ማሠልጠኛዎች ማስወጣታቸው ሜትሮሎጂ ሞያዎች ሜርኩሪውን መፅደቅን መሳል ምልዕተ መባልም መርዕድና መገስገስ ማረጋገጫውን ማስከተል መካኖች መጉዳቱን ሚኒስተሩ መስመራቸው መረጣና ማሾም ማግኘትም ሞልቶታል ማስደሰት ማስጠንቀቂያም መዛት መንገዳችንን መወቀስ 