            amharicWords[3, 5] = "ሙሽራው መክሸፉ መያዣዎች ሚዲያውን ማመልከቻቸውን መፍጠርን ማስቀደም መጣሱ መጣሽ መመርያውን ምንአልባት መሰማራቱ መንገዱም መርዳትን መመረቃቸው መገላገል መድከም መቃጠሉን መቅረባቸውንና ማግለላቸው ማስመሰል መነኮሳትና መጋዘንና ሞቴ ሙባረክን መሰብሰብና ሞአ ምርቶችም መልስና ማየትም መቀዛቀዝ መመርመሩን ሙሉን መብታችሁን ሙሉእ መቃቃርና ማረጋጊያ ሞጣ መክፈላቸው ምኞታቸው መዋከብ ማሽኖችና መቼውንም ማርሊን መድፈርና መታኝ መስመርም ማዛወሩ መታሸግ ሚስጢር ምድብተኞች መታፈን ሞራላቸው መምታታቸው መታከሚያ ምምህዳር መረር ማዘጋጀ መድኃኒታችን መጠራታቸው መንጋዎች መራቆትን ሙስሊሞቹ ማሸጋገሩን ምግብም መዐህድን መሐመድን ሞላው መቀነሱንና ማኅብረሰብ መሸለማቸው መምህርት ማቋረጫዎች መላዕክት መልእክቶችን መድፍና መፈንዳቱን ምስክሩን መንፀባረቁን ሙዚቃና መንጌ ምንቅስቃስ መዝብረዋል መስማቱን መውጣቷ መንገዱና መያዶችን ምህዋር ማሰማቱን ማውጣቱንና መበደር መርጨት መተጋገዝ ማወላወል ማጣፈጫ ሙራዎች ማስረጃዎቹን ማስቀመጫ መፍትሄም መድረሳቸውንና ሚዲያም ሞገሴን መቆማቸው መጣልን ምስሎች መፅሃፉ መደበቂያ መገለጫና መኖን ምክንያቶችም መናገሻ ሙግቶች መፈናቀልና መድረሳ ማህበራትንና ሚሊሺያዎችና ሞሪታኒያ መዋቀሩን መሳለቂያ መኪናዋን መቀጣጫ መፅሄቱ መዳቢ መሟላታቸውን ሚሲዮን ሚስጥራዊነት ማዳበርያ መድረኮቹ መትታ ማይክ ምግባራዊ መቃም መቋቋሙንም ማስፈሩ ሙሉአለም መታለፉን ማናገር መጥሪያው መትከልና መባከኑ ማጭበርበርና መግዛትና ሚንሊክን መሐዲ መዛሙርቱን መዳረጋቸውንና መብል መጨናነቁ ሚሊተሪ መጥቶአል ማተም ሙዘሚል መሰባሰቢያ መሳካትና መብረቃዊ ማቆርና ማስጠንቀቂያዎች መውጣትም መቀጠሩን መገኛዎች መገለጫችን መፈጠሩም ማስተንፈሻ ማጥበብ መሞቷን ሞግዚትነት መነቃነቅ ማጠንከር መስፈሪያ መሰጠቱና መዐሕድና መሥዋዕት መግለጻቸውንም መኖርያ መጭመቂያ ማስቀመጥና ማርኬት መካሰስ ማጣራትና መሳተፋቸውንም መንቀሳቀስን መርጠን ሜዲያዎች ምክርቤቱ ሞራሉን ምረጡኝ ማስተባበላቸው መካኒሳ መናገርም መሆናችውን መንደሮቹን መሸጋገራቸውን መከራከሩ መግዛታቸውን መሣርያውን መመዝገቡንና መልክተኛ ማንኛዉም ምስሉ ማይክሮሶፍት መግለጫውም መደወል መስርቶባቸው ማስወጣቱን መኮብለላቸውን መተማመንና ምንጭም መላወሻ መበየኑ መልሳችንን መቀዳጀት መነሻውን ምላሸ ምዝግባ መመኪያ ማረፋቸውን ምሽቶች መከራየት መጽሐፉም መንግስቱንና መገለልና ሜዳም መድባ መቀጠሉንም መካኒካል ማሰጨበጫ መቆጠሩን ምንትዋብ መፋለም ማከናወናቸው መወገዱ መፈንዳት መሳሪያን መደብደቧን ሜንዶን ምስግና መሔዳቸውን መዋን ምጽዋት ምርቃ መፅሃፍት መለወጫን መሥዋዕትነት መኖነት መስጠታቸውና መቃብሩ መርጊያ ሜዳን መዝሙሩን መስሪያና መሥራታቸው ሞኞች መስፋፋትን መፅሐፍት መለዋወጫና መንግሥቴን ማብላት ማርክስ መሰቃየት ማለቃቸው መዘከር ምርምሮችንና መዋጥ ማቁሰላቸውን መዋጋትና መድረሱም መያዝን ምላሻቸው መምህራንንና መልሶችን ማዘጋጀቷ ምስጋናችን ማቃጠሉን መመርያና ማኅበረሰብኣዊ መመርያን መተላለፊያዎች መጃ ማስፈቀድ ማርጋሬት ማድርግ መቀመጫነት መሰናበታቸውን መጪ መሠረቶችን ሙርሲን መንገዳችን መላስ ማህበራችን ማሠራጫዎች ማጨብጨብ መርካቶን ሙቶ ሙሰኛ ሜዳሊያን መንፈሳቸው ሚሊኒየሙን ማልዋል ሙና መገናኘታቸው መቃወምና ሚትዎሮሎጂ ሞራላቸውን ምስራቁ መትከያ መፈተሸ መስጊዶችን መለሰልኝ መጽሔታችን ማገናዘብ መደራጀታቸውን መሥራቾች መጽሐፉን መጠራቱ ሞክራለች መዲናይቱ መርሃግብሮችን መለቀቁ መትረየሶች መውረስ መፋቂያ መታየቱንና መስዬ መገምገማቸውን ማሸት ሞራላዊና መንቀል መወንጀላቸው