            amharicWords[3, 6] = "ማድረጋቸውና ሚሊሺያዎቹ ማስዋብ ማራገፊያ መቆጣጠሩ ማጠር ማጋጠሙን መንገላታትና መንገዶቹ ማቲንጌ ምድሩ መወያየቱን ሞክሬ ማቀዷን መብታቸውንና ማህበርም መወርወር መሰረትና ማስረጃነት ማቅረቡንና ማንበብና መግሥት መሸነፉ መጽሃፍት ማቆሙ ማይልስ ምንአልባትም መጠጋቱን ምደባና ማበረታቻዎች መገደድ መጠቀሱ ሙገሮች መጠየቅና ማካፈል ምእራብ መደረጋቸውንና ማርያምም መዋቅርን መጋፈጥ መጥራቱ ሚዴቅሳ ምኑም መኢአድን ምሁራዊ ማቋረጣቸው ማሰባሰብና መተኪያ መማረክ ማቲያስ ማርኮ መደናገጥን መቅሰማቸውን ማሞዓለም ማኔጅመንትና መተማመንን መፈረሙ ማምሻ መጥፋታቸው ሞረሽ መተያየት መውደማቸውን መሸለሙ መርሆችን ማመልከቻውን መንፈሱን ማንሳታቸውን መጎብኘቱን መል መንጋጋ መሰረቱን መላክተኞች ማርያምን ምገባ መሬቷ ምልክቱን መዋቀር መቀለጃ ምስጢሮች ምኅዳሩ መረከቡን ምዕምናን ማውገዙን መስማቴ ሞሶሎኒ መክፈሉን መሞታቸውና መዘርዘር ምስጋናችንን መልካቸውን ሚሌ ምድቦች መውረር መረብና መለየትና ምክክርና መታመማቸውን መዝገቦችን መኪኖቹን መንስኤና ማስጠንቀቂያው መርካ መቅረቱንና ማንስ መፃፋቸውን ማሰቡ መጠየቁንም መሣሪያቸውን መከላከያን መስጠቱም መሸፈናቸውን መያያዝ መሃንዲስ መካሄዱንም ማባዛት ማጎልበቻ መሰሎቻቸው መቋቋምና መሾሙን መስሎአቸው መገደላቸውና ሙሉውን መቀጠሉንና መስቀሎች ምስክሮቹን መወሰኗ መጋፋት ሚኒሊክ መመለሻ ምርመራን መነሻም መደነቃቸውን መቻሌ መሸኘት ማመሳሰል መከሰታቸውን ማሌዥያ መፈጠራቸውን መዳረሻችን መታዘዙ መለማመጃ ማራከስ መስርቷል ምናምን ምኞቴ መርከብን መመታቱን መድኖች ማባረራቸው መልክዕ ማረፉን ማተኮሩን ማስነሳቱ ማሳየቱንም ሙዚቃም መኪናዋ መላላት ምርቶቿን ሚኪያስ መኪናዬ ሞያተኞች መዛግብትን ሞኖፖሊ ማፈን ማ ማቋረጡን መሐመድና ማከራየት መልማቱ መጠየቋ ማነህ መቀጠልና ማሚት ማሽኖችንና መከራን መውደቋን መልዕክተ መስፋትና ማጥፋቱ ማሽኑን መደገፉን መሆናቸዉን ምሑር ሙሶሎኒ መጣስና መፃህፍትና መያዶች ሚስትር መወገዳቸው መርከቦችና መኮብለላቸው መኖና መግዛቱ መቆየቱም መሻሻልና ማሳደጉ መሰላችሁ መድረኮችም መአሕድን ማቁላላት መጨረሻውን ሚስትና መመልከታቸው መለስተኛና መመለስን መጣሱን ማካሄድና መሣሪያዎችንና መጅሊስ ምግቡን ምሣሌ መሪም መንግስታዊም ምልመላው መክረማቸውን ሟቾች መሳርያ ማስገቢያ ምርቶቻቸው ማናችንም ማምራታቸውን ሙከራቸው ምርጫውም መድኃኔዓለም መገማገሚያ መወሰኗን ምክኒያት መገርሣ ማሳረፍ መስጫዎች መብራህቱ ማጽደቁ መመናመንና መርጠናል መኳንንቶች ማኅሌት ሚሊሺያና ማስመዝገቧ ማስኬድ ሚስታቸው ሞገስና ማገር መአዛ መጽደቁን ሚኒስትርም ማዕድ መናፈሻዎች ሙናዬ ምሕንድስና መንግሥቱንና መፍትሔውም ምዘናው መታወቂያዎች መዛወሩን መሻሻሎችን መዳከሙ መወገዝ ምኳኑ መኪናዎቹ መለያየትን ሙያዎችን መተካታቸው ማስመስከር መብለጡን ማጠራቀም ማስፈንና መማርና ማምለጣቸውን ማመስገን ሚኒስትራቸውን መሪውን መዛባትና መላቀቃቸውን ማድለብና መምጣታቸውንና መቅረጽ መግለጿን መጻህፍትና መፈጠሩና መታገሉ መግደላቸው መሳሳት መስረት መገንባትና መልበስ መዝለፍ ማበረታቻዎችን ምልክትነት ማደሻ መስኩን መናፍስት መግባቢያ ማልማትና ማግኘትና መንገደኞቹ ምቱር ሚሊዩን መድህንና መባረርና ምኅዳሩን መንግሥትዎ ማብራራት መግለጫዎቹ መናቆር ሙር መድረሳቸውንም መግጠም መወሰኑንና መጠቃታቸውን መግላጫ መስማቱ መጣሏን መሟገት መዝኖ መድፋት መቆጠባቸውን መካሻ መወነጃጀል መሞቱንና ማስታወቂያዎችን መቸከሉ ማንሳታቸው ማንሳትና ምልስ መቁሰላቸውንና መሰብሰቡንና ማሰባቸውን መመደቡንም መበረታታት ማበረታታትና መደሰታቸውንና መሰልጠን መናፍቃን መወሰኑና መጻፋቸው ማስተባበል መሪዎቿ መጠበቁን መርቆሪዎስ ማግኘታቸውንም መጓደልና ምላሽና መተከል ምላሽን መንገሻን ማጣሪያና ምስረታን መንሥኤ ማለቱንና መደርጀት መፈናቀሉን መንግስታቱ ማራመጃ መንግስቱም መስጊድና መድሃኒቶችን ምልጃ ማንገራገር መሰጠታቸው መሳሪያዎችም መስጫው ማንዳ መደገም መኪኖቻቸውን መለዋወጫዎች ምስክሯ መልካቸው ምጣድ መፍትሔውን ምንቸት መስተዳድርነት መሿለኪያ መጠየቃቸውንም ሙስሊሞችም መሥርቶ መጥቀሳቸውን መደንገጥ መድብለ ማብራሪያም መልቲ ምቱ ማበደሩን ማክሰኞና መዲናችን ሚኒስትራቸው ማደናገሪያ መድሐኔ መታወቂያውን መርከቦቿን መቻለ መፍረክረክ መሰየም መሠረትና መንግሥታዊነት ምስላቸውን ማሳሰቡ ምስጋናዬን መጠለያው መሰማራቱን ማቅረብና መሰልጠናቸውን ምኞቱን መውሰዳቸውንና መወንጀል ማስተባበያውን ምላሾች ማዕከላዊና ማካሄዱንና ማሳለፊያ መማዘዝ ሚናው ማስተላለፍና መጣያ መክሮበት መፍጀቱን መተግበራቸውን መሸኛ መብቶቹን ምክንያትነት ማሽላና ሞርሲ መስፍንም ማህደረ መቀነስን ሚኒስትርነቱን ምእመናኑ መጤን መናርን መሥፈርት መባላቸው መጋቤ መመዘኛውን መዘምራን መመረቅ ሙሴን ማስመጣት መሠሪ መድሐኒት መመቻቸታቸውን መደራጀትና መከፈቱ ሞግዚት መጎልበትና ምግባቸውን መገታት መጎልበቱ መመረት መብትንና ማኅበረሰብም መተረክ ማስቀመጡ ምርቶችንም መሰጠቱም ምንጫቸውን ሚጉኤል ማስጠንቀቂያውን መግቢያው ምስክርነቱን ሟችን ማድረጊያ ሙዓመር መሀንዲስ መታሰቢያቸው መድረሻው ማይን ማመላከት መንፈግ መንግሥትነት መንሰኤ ማራዘሙን መልሳቸው መትቼ መስሪያቤቶችና መንግሰታዊ መመዘኛዎችን ማሰናበት መለዋወጫዎችን መርቆሬዎስ መዝለል መምህራኑን መዝፈን መጽሃፉ መከሩ ማጠብ መዘዋወር መሀላ መኖሩም ሟቾቹ መነገሩን መጽደቅ መሀሪ ምህጻረ ማድረቅ መገልበጥ ሜቲዎሮሎጂ መቅረብና ማህበራቱን መቅረቱንም መለገሳቸውን ሚካኤልን መብዛትና መፍትሔነት መጠቀስ ማጎሪያ ሚስቱን ማንሣት ማረፊያን መፍትሄን መደምደም መሸርሸርን መመዝገባቸውንና ማጽደቋ ማዕከለ መሳቡ መቆየቱና ምክያት መሳቂያና መጥቻለሁ መሳት መለስኩለት መወለዳቸው ማጉረምረም መቆጣጠራቸውን መተሳሰር ማንኩሳ ሞታቸውን መስፋፋቱ መረሳት መላልሶ መግለፃቸውንና ማቅረቧ መነሳትና ማሽነሪዎችን መቁጠሪያ ማመንጫና መንግሥታዊው መጋበዛቸውን መጻሕፍትና መወሰንና መሄድና መልዕክተኛና ማጥለቅለቅ መለያየትና ሙክት መፍታትና መገንጠልን ማቅናታቸውን መጠቀሚያነት መመርያዎችና መተሳሰብ መካኒክ መወሰኑም መገርሰስ መቆርቆር መቀራረብን መስጂዶች ማስቆጠሩን መሰራጨት መረቦችን ማኅደር ማዳከም ሞቴን ማእርግ መላኩና ማስረጃዎቹ ምርምሮቹ መታገስ መስተጋብር ሜዳሊያውን መድህንን መውደሙ መወገዳቸውን መኳንንትና መቀየርና ማስመዝገባቸው መመቻቸቱ መኪናዬን መታሰርና መከሰሳቸው ማድረጉና መቀጣታቸው መደራጀቱ ማኅፀን መከፈታቸው ምኞቴን መርሁ ማጣቀስ መንስዔና መተሐራ ማቋቋሙ መሥራታቸውን መከሰቱንና መናገራቸውንና መስማማቷን መከባበርና ምርመራዎች ሚል ሚሊን ማቅረባቸውንም ማዕቀፉን መነጋገርና መካተቱን መባባሱ ሚዲያውም ምልክታቸው ሞሪስ መዞር መደሰቱን መለየታቸውንና መወያየትና ማክበሩ ማህመድ ሚኒሊክን መክፈሉ መሰደዳቸው መቸገሩን መቆፈር መቀየሩ መስቀላቸውን መታገያ ማስ ሜይል መቃወሙ መሃዲ መድበል መጅሊሱን ማቴ ሞከርኩ ማና መርጣ ማገናኘት ማስወገዱን ማሰቡን መድሃኒያለም መቀበሉንና መሰረተቢስ ማለትዎ ሙዚየምና መናቅ ማንኪያ ማኪያቶ መገንጠያ መንትያ መድኅንና ማጥናት መካተቱ መሰረዛቸውን መቀነሳቸውን ሚኒሥቴሩ ማሸማቀቅ መሰዋእትነት መቀጠራቸውን መቃሚያ መጨናነቅና ማኖር መፍረሱን መድረክን መዘጋቱ ሙዳይ መስፈንና መዘውር ምስረታ