            amharicWords[3, 7] = "መቀስቀሱ ሜድሮክ ማበብ መበላሸት መፍጨርጨር ሚስቶች መቋቋማቸው ምንዛሪን ምርር መባላቸውን ሙሉቀን በሙሉ መምሰል ሜዳይ ምቹና መመዝገቢያ ሚኒስትሮቹ መውደም መኖራቸውም መራዘሙ ማለፋቸው ማስገኘት መስኩ ሚድያ መሰለች መጠራት መርጧቸዋል ማፍያ መመዘን መቆራረጥ ማብራት መጫወቱን ማማ መፍጠሪያ ማኅበሩን ማረሻ መፃኢ ምእት ማሸነፋቸው ሞራሉ ሜትሩን መንፈሳዊነት ሞርጋን ማረፊያዎች መልሰን መሰንዘራቸውን ማሻሻልና ሞክረናል ማኸል መሳሪያዎቹ መስፈራቸው ማለፋቸውን ማኅበረሰብና መብረቅ መሰማት ማንሳቱን ማኀበራት መኪናና መሰንዘር ማይጨው ምሥጢራዊ መሆኔ መድኀን መቅሰፍት ማየትና ሚዛኑን መረቡ መባቻ ምኞታቸውን ማመንታት መሻሻሉ ምርምርን መቀመጣቸው መሣሪያው መተማመኛ መስራቱ መብራትና ማፅደቁ ማግለላቸውን መድኃኒዓለም መድቧል መለዮ መቀየሱን መቆየታቸውንም መደምሰሱን ማቅለያነት ማቆያ መሸጋገሪያ ምኑን መጨመርና ማስረጃና መጠቀምን መሸፈኛ ማለታቸውንም ማህበራቸው ማዕቀቡን ሚዛናዊና መምረጣቸውን መጣጣም ማርያምና ማስገባቱን መታ መንግሥታቱ መስማማቱ መልዕክታቸው መያዝና ማስረሻ ምህረተ መጎብኘት መጣላቸው ማሳወቁን ማጥቃቱን መፍጠሩንም መቆሙ መዘጋቱን መስጂድ መጨበጥ መስፈርቶችን ምዕራብና ማሻሻያና ማዋቀር ምእመናንን መሰረቶች ሙከራም መፈረማቸውን መጀመሯ ማካሄዱ ማረም መስፈሩን ማዘዝ ማሸነፋቸውን መጣበብ መብቱንና መጓዛቸው መስቀሌ መድረክና መልሳ መርጌታ ምድርና መሸሸጊያ መርተው ምልዓተ ማስፈራሪያና መልኩም ማውረድ ማሰለፍ መጣች ማጉደል ማስቀመጡን ማዕከላትና መነገሩ ምጣኔና ማላቀቅ መፈናቀላቸውን መካካል ሞጆ ማደረጉን ማድረሳቸውን ሚስጥራዊ መታጠቢያ ማዛወር መቃኘት ማሪን ማሳወቁ መብቴን መወደድ ምልክቶችን ምህዳሩ ማማከር ማሳለፉ መስራትን ማሳጅ መዘገብ ማዕከላዊው መሻሻልን መቀመጡ መቀጣታቸውን መዝራት መወሰኑንም መጨነቅ ማውገዝ ሚኒሥትሩ መጅሊሱ ማቀዳቸውን መጓጓዣ መጠናቀቁንም ማስከበርና ማግባት ማንዴት ምሬታቸውን ማርሊ መገኘቱም ሙዚቃውን ማስመዝገቡ መረከባቸውን ማጽደቅ ማስተላለፋቸው መጠየቃቸውንና ማስከበሩ መነሾ መሰንጠቅ መምጣቱም መሠረታዊና ማሰባሰቡ መደፍረስ ማዳበሪያን መኳንንቱ ሜትሩ ማስገባታቸውን መሰየሙን ምረቃና መፅሀፍ መጠበቁ ማጣታቸው ማሳጣት ምዕመኑ መዝጋት ምዕመን ምርምራ መቀመጫቸውን መለገስ መጨረሻም ሙያውን ሞከረ መረብን ማራዘም መስተዳድርም ማትያስን መሸጡን መልሳቸውን መጋባት ሚስቱ መዘጋታቸውን ማእበል መልክም ማጅራት መንገዲ መስሏል መጠናቀቂያ መውረጃ መጠናቸው ማቲዎስ ምንግዜም መታዘዛቸውን ማዞሪያ ማስፋፊያና መጎብኘታቸው መሰረዙ መግለጿ መማረኩን መታከም ምረጡ መቀላቀል መርሆች መጥቀሱ መኢዴፓ መዘጋጀቱንና መለቀቃቸው መሸሻን መሞከራቸውን መስበር መቅሰም መግቢያና ምናለበት ማቀነባበሪያ መስኮችን መጀመሪያው መንበራቸው መሐላ መሪዎቻቸው ማማር መጠቀማቸውን ማሳየታቸው መለኪያዎች መለኮታዊ ማጠናከሩን መንገደኛው ማምጣቱን መራቢያ ማምጣቱ መንቀጥቀጥ ማሰልጠኛዎች መቆየቱንም መገመቱን መከፈቱን መርከቧ ማስተማርና ምፅዋን መለስካቸው መሪዎችንና ማለታቸውና ማግኘቱንም መሰንዘሩን ምልአተ ምላሹ ምስጢሩን መስቀልና መሻሻሉን መረጋገጥና መስቀልን መንጋው መረበሽ ማባረሩን መስህብነት መንፈሣዊ ማኀበሩ መነጽሩን መስርተዋል መወያየቱ ማሙሸት ማውጣታቸውን መቺ መረዳቱን ማስተዋል መመስረታቸውን ማክሮ ማቃጠል ሙዚቀኞች ሙሣ ማንገላታት መፈታታቸውን ማስገኘቱ ማጣራቱን መውለድ መዝሙሮች መላከ መላኳ መደምሰስ መታቀብ ማምራታቸው መታጣት ማቀዱ ሞቃት መስጠትን መታገዝ ማንሻ መጣላቸውን መካድ መንስዔው ማለትና ማሻሸያ 