            amharicWords[3, 8] = "መልስን መቆራረጦች መሐመድንና መተማመናቸውን መመሪያውንና መከራከሪያው መረረን መወንጀልና መቋረጥም መሬቱንና መወረሩ መወለጃ መልዕክቶቻችንን መረረኝ መነጋገራችን መወረሱ መልሳችሁስ መቀባበል መከራከርም መሸት መባቀያ መታተሙን መመለክ መርምረዋል መልሻለኹ መቀላቀሏ መቆጠጠር መነኩሳት መረከባቸው መሄዳቸውንም መሰኘት መርከቡም መልስዎ መክረውበታል መቸርቸሪያ መሣቂያና መማሳደግ መልእክትም መሥራቱና መልአኩም መረረው መሀከልና መሥራቾችና መስከረምን መሿኮት መቁረጣቸውን መረጋገጡና መለስኩላቸው መስቀሌን መሰዋዕትነትን መሳለጫ መሣሪያቸው መለያህ መንጣጣት መታሰሯ መሠለፍ መሳለቁንና መማከር መቀጣጠሉ መረሣ መለኮትን መረረ መቀሰርያ መክረዋለሁ መርዓት መርሖዎች መሆነ መባሌ መከላኪያ መባሏ መርቀን መሸጉ መርሰዲሶች መረቁ መልከፄዴቅ መስካሪዎች መንኖ መቻልም መቁጠሪያው መከጀላቸው መሣርያዎቹን መላላኩ መለያየትም መወስድ መርክነህን መለስኩኝ መንቀፍም መታሰቡም መስበቅ መመርያቸው መከከል መቼን መኢተማ መተማመናችንን መረርና መቀራረቡን መምረጥን መንዜ መሰማታቸው መርዘም መሠራ መክሬያቸው መቅበዝበዝ መሸነፋችን መካንነት መሥመሩን መስክራለች መመቸት መነኮሳትንና መቻላችንን መህረት መቁያ መንቀርፈፍና መዐዛ መርገጧ መሰዋዕት መሳሰሉትን መሄጃውን መብቴው መቋጨቱን መበራከትም መነሳሳታችን መወራወር መንደሮቹ መራባቸውን መወለድና መርዓዊ መንሰራፋቱን መሰባሰቢያችን መስህብና መለሰችላቸው መሬታቸውንና መስፋፋትም መነባንብ መስህብን መሪነታቸውን መተኮሱ መነሻዎችን መሮጥም መከልከሏን መነሣትና መናፈሻነት መባዕ መመዘኛም መሰቀሉ መርገፍ መሯሯጣቸው መልክቴን መለሰን መወሰናችንን መወረዱ መመሪያችሁ መሓንዲሱ መቀቀያ መሆኗስታይ መሰናዳቱንም መስመሩንም መሐሙድን መንቀሳቅ መክረዋቸዋል መሀሙድ መሠረቱና መንጫጫት መኖራችሁ መባቻና መናፍቃንም መስበኩ መስሎኛል መብጠልጠል መስዕዋት መወትወታቸውን መሰለኝና መክረሙዋን መናሩን መርካትና መቋረጥን መነሳቴ መነሳቷ መኾናቸውን መላከሰላም መቀያየም መንግሥቶችን መረሸናቸው መምጣታቸውስ መረገም መተንኮስ መመርያችን መሰናክልን መልካምድር መምህሩም መስተንግዶን መታወሻ መሬዎች መተንኮሻ መታወቅና መኮትኮት መላቅጡ መነሻቸውን መስፈሮቶች መስጊዶቹን መብትስ መንክር መቻኮሉ መረጃዉ መሰናዘሪያ መረጃዉን መቀነቱን መልአኩን መከሰቻ መሰፍርቱ መካናትን መስረቁን መሲሕ መንፈጉ መለሎ መወለዳቸውን መከታተፍ መረሳቱን መስርያቤቶች መለያያ መርዳቱ መቆረጡ መሸነፍንና መራሒና መቆሚያው መኮንኖችንና መነገሩንና መረጃየ መሪነትም መንግሥታዊነትን መመዘኛዉም መለብለብና መንግስትነት መቸገሩ መርሃችን መንገደኛውን መዋረድና መክሊታቸውን መርጠህ መወጫና መቆማችን መረባቸውና መላምታዊ መመሳቀል መኝታዬ መቸገራችን መታረቁ መነሻየኮ መመዘኛቸው መታደኑ መላእክቱ መረባቸውን መስፈርትም መቆላለፍ መንደሬ መተግበርና መሥርቶበት መሪህ መለከፍ መልኳን መንገዶቿ መካረርና መቀላጠፍና መቋደስም መወርወሩን መነቀፉ መስርያቤት መተያየቱን መሆናችንና መሻትና መዓረግ መማክርቶቹ መስራቾችን መኮንኖቸ መልሰውታል መሳሪያቸው መጥራት ማርች ማድረሱን መብቶቻቸው ሜጄር መብቶቻቸውን መርሃግብር ምናለ ማዕድንና ማጠናቀቂያ መርዝ መነሻነት መንገላታት መንበሩ መከልከል መመስረቱ መገናኘት ምርጫም ማሽላ ማድረግን ምንዛሬን መሳተፋቸው ምክንያቱን መርጠው መፈረም መስማማት ምኒልክን ሙት ምዝገባና መለቀቅ መራመድ ሚንስቴር ሚሽን መገለፁን መስመሩ መርካቶ መሆንና መፋሰስ ሚኒስትርነት መሥፍን ማደያ ሞያሌ መለዋወጥ ማራዘሚያ ምጽዋ መንከባከብ ማስፋት መነሻና መልኩ