            amharicWords[3, 9] = "መልሰውለታል መከላከልም መንገስታዊነት መንገሩ መተባበርንም መወደድን መላኬ መብራቶቹ መቆጣጠሪያውን መልካምነቱ መስማቱንም መራቤን መብሰሉ መርቦ መከሩን መለወጥም መብሰል መሳለቂያና መርታ መወራረዱ መካና መልካምንም መክበብ መክረንና መንቀሳቀሳቸዉ መንገዱንና መረጠን መመርያዎቹን መነጋጋሪያ መናፍቅነት መንሻና መሥራ መቀዳጀትና መርህም መንሻን መንግሥቶቻቸው መንገብገቡን መታዘቡን መምረጣችንን መስፈሩንም መሰልጠኑ መቅመስ መምጠጫ መመረታቸውን መናገርዎ መናፍቃኑ መንገዶቻችን መቀደድ መካፋፈል መንገድዎን መከሰሷን መንግሥቷም መመደብና መመርያዎችም መላጣ መብላትን መንግስታቶች መወረሩን መወርወርን መከርከሚያ መረጋገጣቸውን መቁሰሉና መንዲስ መስሎታል መክተቱና መሆኗስ መነኮሣትና መሸፈታቸውን መርድ መከላከያነት መታገዷ መካከለኛውና መንሻው መሻኮትና መበቴ መምዘዝና መሪትን መመኪያውን መሥክ መበላቱ መልአክም መበረዝና መልክቶችን መአርግ መለያየትንና መታዩትን መርሃዊት መታደማቸው መስጂዳቸው መቆራረጥም መንግስትዊ መቱኝ መስቀለኛውን መንግሰትን መሳጂዶቻችን መልካሞቹን መተረካቸውን መልዓከሰላም መክላከያ መራቁን መሰለፏን መለካትና መነሻቸውም መልዐክ መሆኗና መሪዎቻችሁን መሣተፋቸውን መስክሪና መሃላቸው መሠረታችሁ መሰባሰቡ መቀኘት መራጭና መንግሥታትንና መኖራችውን መብልም መራራት መሠላችሁ መክሰም መቅላት መመዝበሩ መንገዷ መልሰውላቸው መተካከልን መኬድ መክሰሩ መሬትዋና መሳደብና መባላቸውንና መቺና መታጠቋን መሃትማ መነስነስና መብቴንም መከጀል መቀየራቸው መከበቡን መራራን መንግሥታዊነቱ መሥዋዕትነትና መነግስት መረታዊ መስማታቸው መቀመጫዎቹ መቀጫና መመረጣቸውና መንፈሳዊን መሮጡ መሻሩንም መርገመ መመጠን መምሰሉን መስያቸው መቁላት መረዋዎቹ መለወጣቸው መርዝነቱ መመለሰ መሠለኝ መሰናዶም መሰጠትም መሞቻቸዉ መሽከርከሪያ መራብን መመለሷ መልክቱ መቋሚያዎች መስደብና መስራቾችም መተርኮሻ መቃረኑ መምህሬ መታሰራቸዉ መክታ መቀመጫዬ መሥዋዕታቸው መንኩራኩሮች መናገራቸዉን መንጨት መታጎር መልካችን መንበሯ መነሻችንን መረጡኝ መስመሮቹም መልማትና መብረቁ መርዛዊ መቆራቆስን መስመራቸውን መሰማራቷ መቀለድና መንደርደርያ መነፈጋቸውን መስተዋል መብለጡ መንገሳቸው መስጂድም መተከዙ መቆየትም መበጠሱ መክዳትና መ መሆኑን መንግሥት ማዕከል መንግስት መካከል መግለጫ ሚሊየን መንገድ ምክንያት መሆኑ ምክር መለስ መሆናቸውን ሚኒስትር ምን ሚሊዮን መሰረት መሠረት መብት ሚኒስቴር ምርጫ ምንም ምንጮች መረጃ ሙሉ መሬት መንግሥታት ምላሽ መስከረም ማድረግ ምርት ሜትር መልኩ ምክትል ሚኒስትሩ ማለት ማህበር መሪዎች መልካም መልስ መሆን መናገራቸውን መጋቢት መሆናቸው ሚና መሪ መጠን መድረክ መቶ መስጠት መስሪያ መስፍን ሚያዝያ መንግስታት መሆኑንም ማህበራት መምሪያ ሚስተር መሰረታዊ መስተዳድር መምህራን መከላከያ ምርመራ መግለጫው መመሪያ መልክ መንግሥቱ መፍትሔ መሣሪያ መሐመድ ማዕከላዊ ምንጭ ሙከራ መጀመሩን ማህበሩ መጨረሻ መብቶች መደበኛ መደረጉን ምቹ ማግኘት ማስረጃ ማህበረሰብ ምርቶች ሙያ መገናኛ ምግብ መንግስታዊ መስራት መጀመሪያ ማብራሪያ መንግሥታዊ ምርምር መቻሉን መሆኑንና ምልልስ መንገዶች ምንጮቹ ማን መሥሪያ ምሽት ማኅበር መኖሪያ መቀሌ መስቀል ማድረጉን መልዕክት ማንኛውም መስመር መምጣቱን ምንጮቻችን መስኮች መፍትሄ መኮንን መሳሪያ መረጃዎች መሆኗን ማረጋገጫ ማህበራዊ መንፈስ ምሁራን መነሻ ምክንያቶች መከላከል መስክ መኪና ሙስና ሞት መሠረታዊ መንግስቱ ማለትም ምኒልክ ሚያዚያ ምግባር መኖር ማንም መልሶ ማክሰኞ ምድር መጠጥ መሰል መቀጠል 