 መንደሮች መቆም መቻሉ መንግስታቸው መምህራንና ማራቶን መስኖ መካሄድ መርጃ ሜጋ ማፍራት ማስወገድ መኩሪያ ሞክረዋል ማለፍ መረጋጋትን ሙስሊሞች መዋጮ ማጎልበት ማልማት መሆናቸውም መድረሳቸውን ሚኒስትርና ማምረቻ መረጋገጡን ም ማሳየት ሞቃዲሾ መገለጫ መስጠታቸው ማቋቋም ምት መልእክት መዋሉን መገመት ሙዚቃ መግባቱ መፈታት ሙስሊም ማስገባት መገለጹን ማህበራቱ መርሻ ማስገኛ መጫወት ማዋል ማቅረቡ መፈጠሩን መሣሪያዎችን መነጋገር መካሄዱ ማመላለሻ መዋላቸውን መስማማታቸውን ሚስት መንገዶችን ማለዳ መገልገያ መሰለኝ መመዘኛ ሞተዋል መሰብሰብ መንግስታዊና መጠናቀቁ ማሰባሰብ መድን መስማት መንገድና ሞቱ መምራት መማር መገኘታቸው መባሉን መመስረት ማሳ ሚኒስቴርና መጎልበት መሃመድ መዝገቦች መለስተኛ መለያ ማሕበር መገንዘብ ማኔጅመንት መራራ ማግኘታቸው ሚሌኒየም መወሰድ መቆየት መሞከር ማህተም ማስመዝገብ መቆየታቸው ሚልየን መምህራንን ማስፈራሪያ መስፈን ምስክርነት መታወቅ መሪው ማዕድን ማቋቋሚያ መልቀቅ መግዣ መዋል ሙቀት መከተል መደረጉንም መልቀቂያ መግለፅ ምርመራው መግለጫቸው ማስተላለፍ ማግኘቱ መዝናኛ መላክ መድኃኒቶች መምሪያው መድረኩን ማሳያ መፈጠር መግዛት መለስና ማሸነፍ ማዘጋጀት መገደላቸውን መቅረቱን መደረጋቸውን ማቅረባቸው ማስፈጸሚያ ማስተባበያ መቃብር መሪዎቹ ሞራል መዘገቡ መውሰዱን ምደባ ማክበር መክፈቻ ማሳወቅ መጓዝ ማቀዱን መጠየቁ መቅረቡን መሰሉ ሟች መታሰር መንግሥታትና ማስታወቂያና ሚድሮክ መሸጫ ማድረስ መቅረቡ መባረር ሚስ መከታተል መጻሕፍት ምርመራና መዘጋጀት መመሪያዎች መጠሪያ መካነ መቀየር መርጦ መጣስ ማንሳት መምህራኑ ምሁራንን ማንነታቸው ማስቻሉን መደረሱን መንግስቱን መሃከል ምርጫን ማግሥት ማጠናከሪያ መገንጠል ምስል መር መቋረጥ መጠቀሚያ ማርቆስ መላኩን መተግበር መደብ መጨረሻው መሸጥ ሙባረክ መለሰ መፈፀም ማስተናገድ መኖ መድረኮችን ሞተው ሚንስትር ምግብና መጨናነቅ ምክንያትም መንገደኞች መጡ መርማሪ ማተሚያ ማለፉን ሚኒስትሩን መውጣቱን መዝገቡ መዘጋጀቱ መደገፍ መገደዳቸውን ማደጉን መቀነሱን መዛባት መለየት መመለሳቸው መሞት መደሰታቸውን መመለሳቸውን መጠናቀቅ መቀጠሉ መስለው መቃወሚያ ማስወገጃ መግንሥት መጣል መንጋ ምሥረታ መዋጋት መመርመር መዋ ሙከራዎች መቻል መደረጉንና መስተዳድሮች መውጣቱ መፈጠሩ መከናወናቸውን መፋጠን መሄዱን መሰማራታቸውን መከናወን መዘርጋት መጋዘን መዛግብት መቅረባቸውን ማናቸውንም ሙሳ ሙያዎች መንበረ ሙስጠፋ ማዕቀፍ ሙያተኞች መሰማራታቸው መስጊድ ምርምሮች ሞዳል ምርመራውን መቀመጥ ማጭበርበር መድቦ መጠንና ማካሄዱን መቻቻል ምዕራባውያን መረጃን ሙርሲ ሚሊዬን መወያየታቸውን ሙክታር መዘገባችን ምንጊዜም ማሟላት ምዕራባዊ መምጣታቸው ምንነት ምግቦች ምክናያት መፈለግ ማገዝ ምርቱ መያዛቸው መንበር መሀከል መያዙ መጪውን መጥተዋል መውሰዳቸውን ሚልዮን ማለቴ መንግሥታዊና መከራከሪያ መሞታቸው መሆናችንን መውደቅ መውጫ ሞላ መግለጽ መቋቋሙን ሙላቱ ማዕበል መጠየቁን መውጣታቸው መታሰራቸውን ሚሊሺያዎች ማበርከቱን ሞልቶ መሬቱን ምሁራኑ ማስመዝገቡን መወያየት ማስታወሻ መባባስ መመልከት መርሆዎች መታየቱን መሰረትም መገለፁ መወገድ መሰጠት ሞትን መሰማራት መርቀው መተማመን መሬቱ ማር መቆጠብ መርጧል መውጣታቸውን መጠየቃቸው ማስረጃዎችን ማብቂያ ማውጣቱ መሥራች ምስጢራዊ መመዝገቡን መግለፁ መኝታ ማረጋገጣቸውን መዘዝ ምንጫችን መፈፀሙን መብቃታቸውን መጥሪያ ማሳየቱ ሚሊሺያ ማዘጋጀቱን መዋቅሮች መፅሔት መውረድ መሰናክል መቀበሉን";
            
            amharicWords[4, 0] = "መፈፀምና ማያያዝ መፈፀሙንና መምጫ መኪናም መበተናቸው ማስቻላቸውን መርምሮና መበጣጠስ ማቀላጠፍ መለወጥና መረቦች መገፋፋት ሚኒባሶች ምዝበራው መታቀፍ ማረፉ ሙሽራዋ ማጭድ መዋላቸውንና መቀነሳቸው ማዕድኑን መስፋፋቱን መፅሐፉ መጉላላትና መታሰራቸውንና መጓተቱን መጠየቁንና ማርካት ማነብ ምግቦችና ማኅበረሰቡ መጥላት መላኩንና ምድሪቱ መከራው ማህሌትን መመሪያዎችና መርዳቱን መገኘታቸውንም መገደብ መሪያችን መገደሉን መሆንም ሚዲያና መድኃኒቱ መስዋዕትነትን መኾኑን ማዕዘን መሻር መቆጣጠሩን መመሪያን መጽሐፍት ማሰማታቸውን ማርሽ ምልክቱ መበተኑን ማስረከባቸውን ማዕዘናት መጋለጡን ማዞር መጽናናትን መራር መብለጫ መስተጋብሩን መክረዋቸው መሃይምነትና መንገራቸውንና መታገዷን መርማሪዎቹም መለሷቸው መሸበትን መናቆሪያ መሟላታቸው መርሲነሪዎች መርኃግብሮች መሪያችሁ መክኗል መመርመሩና መሠረቱም መሠታዊ መታመመ መርቆርዮስና መረጡልን መመገብና መራራነት መታመሜ መለዋወጫቸውን መቃወምን መወሰኛችን መስጊዶችና መምራታቸውን መከለስና መልካቸውና መአረገ መመሪያዋን መተት መርሲ መመዘኛዉን";
            amharicWords[4, 1] = "ሥያሜዎች ሠረዘ ሥልቱ ሥብሰባ ሠነድን ሣሉ ሥልጡኖች ሥልጠናዎችና ሠይጣናዊ ሣይገልፁ ሠኔ ሠይፉ ሥልጣናቸውንም ሠራቂ ሠፋፊ ሥልጣኔያቸው ሥርዓቶቹ ሣይደረግ ሠፍረዋል ሥራአስኪያጅ ሣሩ ሠራዊቲ ሣይንቲስት ሥልጠናን ሣዲቅ ሥዕልን ሠላማዊውን ሥጋችንን ሠራውቲ ሠልፎችን ሠዓሊዎች ሣይሰጥ ሥሬን ሠራው ሥነሥርአት ሥራዊት ሥራዎቿን ሥራቸውንም ሥርአተ ሥርጭቶች ሥርጸት ሠንጋ ሥጋቷን ሠገነት ሦሰት ሠራተኞችንም ሠብሮ ሥራቸውንና ሣህሉ ሣይሳካ";
            amharicWords[4, 2] = "ሠለስቱ ሠማይ ሠፊና ሣይታወቅ ሣት ሥሬ ሣህን ሥቃዩን ሠለስት ሠራተኞቸ ሥርዓታዊና ሥፍራን ሥራዋ ሣይደርስ ሣምትን ሥርጭትም ሠቲት ሠንሰለት ሥማቸው ሠልጣኞቹ ሥዕላት ሣርም ሠራተኞቼ ሥልጣኔውን ሠፈርና ሥልጣናቸውና ሠባት ሠፈርን ሥጋቶችና ሠረቀ ሠጡ ሥትራቴጂ ሠንዝሮ ሥነስርዓቱ ሠልጥነዋል ሥጋም ሠርታ ሥርየት ሦስትን ሣጥናችን ሥልጣኔም ሠራተኞቹና ሥሠራ ሠረገላ ሥርዓቱንም ሠራተኞቻችን ሣይመንስ ሥልጣናችንን ሠገድ ሠርዶ ሥሩን ሠላሳና ሣውዲ ሥራዎቻችን ሥሌት ሣዋ ሥራዎቼን ሥፍራቸው ሥርዓቱንና ሥጋዊና ሠልፎች ሠርታለች ሡሪውም ሠራሽና ሣህለሥላሴ ሣይካሄድ";
            amharicWords[4, 3] = "ሠራዊቱንም ሤራው ሥራውንና ሥልጠናውም ሥነልቦናዊ ሠላሣ ሥዩምን ሠራን ሥቫ ሣርስ ሥራት ሥት ሥህተት ሥርዓቱና ሠርገኛ ሣይት ሥሜት ሥነልቦና ሦርያ ሣጥናኤል ሥራችሁ ሥማቸውን ሥልጣናቸውንና ሠርጉ ሠፊነት ሦት ሦስተኛና ሠላዮቹ ሥሪታቸው ሠዓሊ ሥርዓታቸውም ሠሞን ሥነሥርዓታቸው ሢመታቸው ሡዛን ሥርዓታዊ ሥርዓትንና ሠልፉን ሥጋዌ ሥጋው ሠንጠረዡን ሥጋቸው ሣቅ ሥርዐቷን ሠልጥነው ሥርነቀል ሥራስ ሠፈሮች ሥርና ሣምሶን ሥርም ሣዑዲ ሠላሙን ሠራተኛዋን ሠፋሪው ሥልጣኑም ሠራዊትነት ሥርዓቶችንና ሥራዓት ሠራነው ሣይቀርቡ ሥርዐቱን ሠርታችኋል ሠዎችና";
            amharicWords[4, 4] = "ሥልቶች ሥርዎ ሥራንም ሣይቱ ሥራህ ሠዒድ ሣያደርጉ ሥራህን ሠራተኛውም ሠዓሊው ሠርቼያለሁ ሥርዓቶችን ሥዕላይን ሣምንትም ሣይል ሠራወርቅ ሠርቲፊኬት ሠላዮች ሥራውንም ሥልታን ሦስተኛውና ሣራ ሠራተኛቸው ሥፍራዎችና ሥርዐተ ሠልፈኛ ሥጋቸውን ሥአኮ ሣያገኙ ሠፍረው ሣንድበርግ ሠፈሬ ሠርካለም ሥባሪ ሠውነት ሥራቸውና ሠላማዊነቱን ሡልጣኑ ሥንቁን ሠፍሯል ሠነዶችን ሠልፉ ሥዕሎቻቸው ሦስተኛም ሠርቻለሁ ሥራዎቿ ሥልጣና ሥጋቷ ሠርጎች ሥትለኝ ሥራዎ ሠሩ ሠፈሩን ሣጥኖች ሠራተኛዋ ሠብዓዊ ሥምሪት ሠብአዊ ሥፍራም ሣልሳዊ ሢሄድ";
            amharicWords[4, 5] = "ሠርቷል ሠለባ ሣ ሠንዝረዋል ሥልቶችን ሠኞ ሠጥቷል ሠነዶቹን ሠልፍና ሠይድ ሥጋትም ሠንደቅ ሡልጣን ሣይኖራቸው ሥልጠናም ሠፈራው ሠራሁ ሥቃይና ሥልጣኔዎች ሣይመለሱ ሥርአትን ሥርቆት ሥራዎችንና ሠጠ ሠፋሪ ሥርዓቷን ሠርግና ሠፋ ሥጋታቸው ሡዱን ሠራተኞቻቸው ሥንቅ ሠፍሮ ሠርጎ ሣሙና ሠሎሜ ሠፋሪዎቹ ሣላህ ሥላሴም ሥጋትና ሥርዐት ሣይኖር ሥርዓታቸውን ሥርዓቷ ሣባ ሥርአቱን ሠሌዳው ሣሕል ሥራዎቼ ሣይንቲስቶች ሥራአት ሠርፁ ሥርፀት ሠልጣኝ ሠራህ ሣርና ሠራዊቶቻቸውን ሥዕሉ ሥራተኞች ሥዩምና ሥጋቶችን ሠራዊቱንና ሥዕሎች ሢስተር";
            amharicWords[4, 6] = "ሣንቶሮ ሠራዊቶችን ሠልፈኞች ሥርጭቱን ሠራዊቷ ሠራተኞቻቸውን ሠርቪስ ሥልጠናዎችን ሥርዓታችን ሥፍራዎችን ሣያገኝ ሥፍራውን ሠመረ ሣይንስና ሥልጣንም ሥሪት ሠፈራቸው ሥጋን ሠጪ ሠልፈኞቹ ሦስቱንም ሣሞራ ሠርተን ሥጋዋን ሥነስርዓት ሠራተኛውና ሠበብ ሥጋዊ ሥርዓቱም ሥፍር ሥልጣኖች ሠራተኞችንና ሠአት ሠይጣን ሥራዎችንም ሦስተኛዋ ሠርተፊኬት ሠልጣኞችን ሥርጭትና ሥጋትን ሠፈሩ ሥነምግባርና ሣንበርግ ሥራዎቻቸው ሠሪዎች ሥንዴ ሥጋቱ ሥረ ሠዎችን ሥፍራና ሠሪ ሠዐት ሥራችሁን ሠርገው ሥራንና ሠማያዊ ሥራዋን ሠርቼ";
            amharicWords[4, 7] = "ሣሊም ሥነምግባር ሣይቀር ሥልጣናት ሠልጣኞች ሥውር ሠሌዳ ሥጋና ሠራዊቱም ሣህለ ሥርዓትም ሣምንታዊ ሥራዎቻቸውን ሣይሆኑ ሣጥን ሥልጠናውን ሣህኑን ሠጥተዋል ሥላሴን ሠሞኑን ሠራተኝነት ሠላምታ ሥራውም ሦስቴ ሥርአቱ ሥራዬን ሠላማዊና ሣሙኤል ሠነዶች ሠራተኛን ሥጋቱን ሠፈራ ሥያሜ ሥነሥርዓቱ ሠሪው ሠፋሪዎች ሥልጣኔና ሣይንስ ሠራዊታችንን ሠለሞን ሦስትና ሥርወ ሥርዓታቸው ሥላሴና ሥጋውን ሠይፈ ሥልጣኔን ሥልጡን ሠራ ሥልጠናዎች ሠራዊቱና ሠራተኛም ሠነዱ ሥሩ ሠርተናል ሣይቀሩ ሥምረት ሠዓታት ሠራተኛነት";
            amharicWords[4, 8] = "ሥልጣኔ ሠራዊትና ሥራም ሣቢያ ሥልጣንና ሠፊ ሥራዎቹ ሠላምና ሤራ ሠራዊቷን ሥም ሠራተኛና ሣር ሥልት ሥልጣናቸው ሦስቱም ሠራተኞችም ሥጋታቸውን ሠራተኛውን ሥርዓቶች ሥርአት ሥቃይ ሠራሽ ሥራዎችና ሥርጭትን ሥልጣኑ ሥዕል ሠላሳ ሠነድ ሠራዊታቸው ሠርተዋል ሠንጠረዥ ሠላምን ሣለ ሥራዎቹን ሠራዊትን ሥልጠናው ሠራዊትም ሥራችን ሠርተው ሠው ሠራዊታቸውን ሦስቱን ሦስተኛውን ሥልጣነ ሥጋቶች ሥርጭቱ ሥልጠናና ሠራዊቶች ሠራተኞቹን ሠናይ ሥምምነት ሠ ሥራችንን ሥራዬ ሠርግ ሥራዎችም";
            amharicWords[4, 9] = "ሠ ሥራ ሥርዓት ሠራዊት ሦስት ሥር ሠራተኞች ሥልጣን ሥራዎች ሥነ ሣምንት ሥራውን ሥፍራ ሠራተኛ ሥልጠና ሥጋት ሠላም ሠራዊቱ ሥላሴ ሥራዎችን ሦስተኛ ሥርዓቱ ሥራው ሥራቸውን ሥዩም ሣይሆን ሥርዓትን ሠላማዊ ሦስቱ ሥፍራዎች ሥራቸው ሠራዊታችን ሥርዓቱን ሠራተኞችን ሠራተኞቹ ሠራዊቱን ሥጋ ሥርጭት ሥዕላይ ሠራተኞችና ሠራተኛው ሥራና ሦስተኛው ሣንቲም ሥነሥርዓት ሥልጣናቸውን ሠልፍ ሥራን ሥርዓተ ሠዓት ሥርዓትና ሠፈር ሠርቶ ሠዎች ሥልጣኑን ሥፍራው ሣምንታት ሥልጣንን";
            
            amharicWords[5, 0] = "ምላሹን ሜዳዎች መግደሉን መታሠራቸውን ሚለየን ማኅበራትን ሚሊኒየም መቋረጡ መከልከሉ ሚናና ምርኮኞቹ ማሳደር ማፈግፈግ ማፍሰስ መከፈል ማመልከቻዎች መመደብ ማድረግም ማውጣትና መገንባቱ መጋበዝ ምኒስትሩ መኸር ሜክሲኮ መጽሐፈ መፅደቅ ማፅደቁን መዳን መኮነን መንገደኞችን መገንባታቸውን ማስቆም መኩዋንንት መኮንኑ መሸከም መጓዛቸውን ማመልከቻው መጠናከሩን ምህረተአብ መከባበር ማገድ መሸለም መዛባትን መጻህፍትን መቀመጣቸውን ምርምሩ ማስታወቁ መጤ ምኅዳር ማጉያ መጋረጃ መውደቁ መስሎዋቸው መወሰዳቸው መዋቅሩ መፍቀዱ መቅጣት መከልከላቸው ሚሊሻዎች ማቅረቢያ መደብደባቸውን መታቀዱ መግለጫን መሯሯጥ መፃፍ መሽገው ማጠናቀቁ መወሰኛ መቃቃር መፍራት መግለጫቸውን መፍሰስ መሸሽ ሞዛምቢክ መንከባከብና መሰወራቸውን መሞቱን መጥቀም መምርያ መከላከልን ማኀበራዊ ሙሉነት መዋቅሮችን ማክበራቸውን መመሪያም ማመቻቸቱን መኖሪያቸውን ሙዚየሞች መክረው መጀመራቸውንና ማረጋገጡ መቅደሱ መሥራችና መገኘቱንና መገናኛዎች ማቆር ማድረጋቸውንም ምርትም መታገዱን ማስፈለጉን መስጠቱንም ምድጃ መሳብ መቀሌና ማስተካከያዎች ምንጭነት መማክርት ማናጀር መዓዛ መስመሩን መተንበይ መግደላቸውን መገዛት ሙፍቲ መጠንን ማሕበሩ መንደፍ መውጣትና ማገልገላቸው መምሕራን ምሥራቅና ምህረቱ ማምራት ሞተሮች ምዕራባዊያን ምርቶቹ ማበርከቱ ማጣቱ መድረክም ሞሲሳ መንቀሳቀሳቸውን መመናመን ማጣቱን መሣሪያዎቹን መቻቻልና መምህርነት ምሰሶ መቀመጫው ምልምሎች መገደዳቸው መቅበር መጣራት ሙያው መጣህ መላቀቅ ሜጋዋት መጻፍ መልክት መጫን መደበኛው ማለቅ ማሙሻ መዝግቦ ምሁራኖች መያዟን ማለታቸውም ሞስኮ መጫወቻ ማህበረሰቡን መሸርሸር ማስመዝገባቸውን መምህርና ምቾት ምህንድስና ምርቃት መጥቼ መካሄዱንና መፈራረሙን መጠቆሙን ምሥጋና መንስኤዎች መካፈል ማስፈር ሚኒሥትር ምንጮችና መረጃዎችንና መድፎች ማመንጫዎች መቀሌን ምርቶቹን ማዳመጥ መካከለኛና ማክበርና መንደራቸው መሠማራታቸውን መታወቁን ማቋቋምና ምዕመናንን መራጩ መዋያ ምንጭና ምንጭን መጠራጠር ምህዳሩን ማሳመን ምሽጎች ምላሻቸውን መመቻቸት መካተታቸውን ሚሊዮኖች ሜዳውን መስርቶ መብራቶች መሰነጣጠቅ መስተዳድሩን መናፍቅ መለየታቸውን መክዳት ማሳደግና መሰንዘራቸው መጥፋትና ማቆሙን ማጥቃቱ መከናወኑ ማጣሪያው መሰልዎ መፈለጉን መፈቀዱን ማስፈፀም ሞራላዊ ማሰማታቸው መደባዊ መግባታቸውንና ማዘጋጀታቸውን መወያያ ማስታወቃቸው ሞያ መንሻ መቀጮ ማሳወቃቸውን መባባሱን ማጽደቁን መናገራቸውንም መልማት መስተዋት መስሏችሁ መሳፍንት መከሰስ መሠረቱን ማይል ማየቱን መፅሃፍ ማሰሩን ሞምባሳ መኖርና መልሷል መስሏቸው ሚዲያው መስክም ሚዲያዎችን ምሁራንም ማቀናጀት መድረሱንም መትከል ማከናወኑ ማነጋገራቸው ምሽጉን ሚሼል ምስቅልቅል መውረዱን ማስታወስ ማኒፌስቶ ሜዳልያ መክሯል ሙሼ መቆጣጠሪያና መቻሏን ምንጩን መከፋፈልና መነፅር ሜትርና መለመን መርፌ ማስረጃውን መግደሉ መልሼ ማዕድናትን መጠለያዎች መሞቱ ማክበጃ መጠናከርና መክቶ መሰየሙ ሜትሮች ማስተባበሪያና ማስከበሪያ መብቃቱ መልካምና መቁጠር መረጃም መያዙንም ምእመናን መቻላቸውንም ማዋከብ መታሰቡ መቁሰል መደበቅ ማስታወቂያዎች ሙሽራ መታወቂያቸውን መከፋፈሉ ምሑራን መገደላቸውንና መረጡ መግባባትና መንገዳቸውን መፈጸማቸው መበታተን";
            amharicWords[5, 1] = "ረዛቅና ሪትሂለር ርትእ ርገጥ ረቂቅን ሬዲዎ ሪፖርታችን ሪፕርት ራእዮች ርክክቡን ረከቦት ሩዶልፎ ሪፈሬንደም ረገጣም ራሷም ረቅቆ ረብየለሽ ሩቡን ረጋጭ ሯጮችን ሬድ ርዳታዎች ርጋታና ራእ ርእሳነ ሬዲዮኑ ረታች ረከቡ ርኅራኄም ሩሲያዊቷ ርጥበት ሮቢ ሬሳዎች ረብጣ ሬፑብሊክ ረዥሙን ሪጂን ራስነት ራሺያኖች ራዕያቸውን ራሺድ ረታን";
            amharicWords[5, 2] = "ርብርቦሽና ርእሶም ረጅሙ ሬሳህ ረሀቡ ርዕሳችን ራመድ ሮኬቱ ራቴን ሬስቶራንቱን ራፍ ረግጠህ ረክሶ ረሀቤ ራፐ ራሺያና ርዕሶችን ረዥሙ ርዳታውን ሮማንያ ሪፕብሊክ ርቦት ሪፈር ሬጌን ሬንቦ ርህሩህ ሪፓርቱ ሬባ ሮናልዶ ረቡ ራውተር ራም ራግቢ ርክክብና ረፍት ረዳቶቻቸውና ረዲን ረሶኡርቸስ ራእይና ራሥ ሮጬ ራሰ ሮባና ርዳታም ራክቶማላላ ረስተውት ራታችነን ሪከርዱ ሬና ርዕሶቹ ሪሌት ረግቶ ሪዘርቭ ርእዩ ረገጣዎችንና ራቁ ራምታኔ ረኢስ ርስቱ ርቋል ርኩሳን ርእሱ ርካሾች ርእሲ ሮሃ ሩቢዮ ሮካር ሩማኒያ ሮል ራቡ ርምጃቸው ሩጫችን ራትና ርምጃዎችንም ሮንዶስ ራሂም ሪፓብሊካውያኑ ሬጅመንት ረብሻውም ረክቶ ረሽድን ሪከርዶች ሪኮርዳቸውን ሮካርድ ራዲየስ ሪም ርበርበ ሪፖርተስ ሪሞት ርዕዩን ሬዲዮኖችን ረሀባቸው ረግፈው ሬስቶራንቶችን";
            amharicWords[5, 3] = "ራማዳን ረዳን ረዱ ራዲዮን ሮማኖ ረፖርተር ረዳኢ ረቡእ ሩለ ሮዶልፌ ርዋንዳ ራሴድ ሪኮርዶችን ረገፉ ሩስያና ረስቶት ሪፖርተሮችን ረታና ሬድዮኖች ሩዋንዳዎች ሮሚዬ ሮኬቶችን ሩጫን ርካታ ርግቦች ረቪአው ሬገንና ሪፖርተርና ራዳሩን ሩቶን ራሚስ ሬገን ሬፈረንደም ሪሆም ሮንዳሳ ሪትም ረቢዓል ሬሳቸውን ርህራሄና ርብራብ ርብርቦች ርቄ ርስዎ ራህየር ሪፖርቶቹን ሪፖርተርን ራድ ርህራሄን ርሳቸውም ርዕስም ራዮን ራጂ ራጃ ሮዝባንክ ርዕሱን ሪፖርተራችንም ረፎርም ረድቶናል ሩዋንዳውያን ሪሰርቸር ራሱዋን ራብና ራዕያቸዉን ራጄንደር ሪጊድ ራዲዮዎችና ሪያክ ሩማኒያዊቷ ርየዝናብ ሬንጅ ርካታን ሪፈረንደሙን ሬሳዬን ረሃብንና ርስበርስ ራሴንና ራዳሩ ራይድ ሩጫዋ ርዕዮተዓለም ርካሽና ረሳ ራሳችንስ ርብርብም ራስሽ ረዚስታንስ ራቱን ራትዚንገር ሪዮ ርቲዎቹ";
            amharicWords[5, 4] = "ሮምኒም ራሻይዳዎች ራሴንም ረቀቅ ሪፖርተርነት ሮጠች ራንዲ ራፐር ርቢ ሬሣዎች ሮቢትና ረግጧል ሪፖርቱም ሪባኖች ራብን ረሱት ሬዴዮና ረዳቶቹን ርቀትና ሮጠን ሮዝ ሮምኒን ሮይስ ሩዝን ሬዲዮውን ሬስቶራንትም ሮዛሊን ረዳታቸው ራዕይህን ራፕ ሪፖተራችን ሮብዓም ሪኮቬሪ ርዕሰች ራሱና ራይስና ሮቦት ሬመንድ ርቆት ረብ ሩዲኒ ራዕያቸው ሮማዊው ሩሲያዊ ሩሚኒ ረገዳ ራዚንገር ረዳቱን ሪፖርቶችንና ሩሲያዊው ርግብም ርቀን ርፖርት ሬጅስተር ሪጅናል ረትቷል ራቀ ረመጥ ርስተ ርምጃም ሩድ ሪፍረንደም ሬዱዮ ሬጉላቶሪ ረጅምና ረስቶታል ረስቼ ራስህም ርህራሔ ረዝሞ ረድቶታል ራዕዩን ሬኮርድ ርምጃውም ሪዞርት ረጋጮች ረግፎ ሮይተይርስ ሬጂስተር ርዳታን ርዕዮችን ራታቸውን ረፌራ ሮራ ሬሲን ረግጠዋል ራሔል ረቂቅና ሪስ ሪፍሬንደም ሩዶልፍ ርጭትና";
            amharicWords[5, 5] = "ረትተዋል ሮማውያን ሮጀር ራቁቱን ሪቮሉሽን ርዝመቱ ራስክን ራስሽን ረገጣውን ረሐብ ርዝራዦች ሮክዌል ሩሲያና ረዲዮ ረሳሁት ርግጠኛ ሩም ሪቼ ረባዳ ራዕያችን ራልፍ ራጀንደር ራያና ራዕዮች ሪልስቴት ረብሸኞች ራንድ ሮቤል ሮቦቶች ሩዋንዳን ሪኮርዱን ሪሶርስስ ሪቫን ረግፈዋል ሮዚና ረስ ራምቦ ረገድና ሩጫም ሪከርድስ ረቮሉቲኦናርይ ሮጣ ረሀብና ሩፓብሊክ ሪፈረንደሙ ራእይን ሩጫውን ራበኝ ረዘነ ረድቶኛል ሪፖርተርም ርስታቸው ረስቶ ሪከር ርሃብና ሬሳቸው ርቱዕ ሪሌ ሪዚስታንስ ራሴው ሩሲያውያን ርምጃና ረገጥ ሬዲዮዎች ራፋኤል ራን ሩጫቸውን ሪፐብሊካኑ ራእያቸውን ሪግህት ርኅራኄ ራቢጣ ሬድዮን ርዕሠ ሪፑብሊኮች ረብሻን ርቀዋል ራዳሮችና ርዕዩ ረሳችሁት ረመዳንን ረጭ ራሳቸዉን ሮድስ ሩሲያኖች ሪፖርተራችንን ረስተን ራይ ርግማን ረዥምና";
            amharicWords[5, 6] = "ሩቢን ሩማንያ ሪግህትስ ራማ ሬጅስትራሩ ራእዩ ርብርብና ራሚደስ ሩኒን ሮቤርቶ ራሳቸውና ሮሚ ረግጠን ራስንም ርብቃ ሩፓክ ረግረጋማ ረዳቶቹ ሬዲዩ ሩሕ ራሽያ ሩሲያን ረዱት ራድዮ ሪፐብሊካን ሪሊፍ ርዕሱ ራያ ራስዎ ሮጥኩ ራዳርና ሬዲዮኖች ርዕዮች ሩህሩህ ሪድ ርባታ ርቲዎች ሩሴፍ ረጃጅም ሮናልድ ራዳሮች ረጅሙን ራዕይም ሬከርድ ረቷል ርኅራሄ ርሳቸው ርዳታና ሪፓርተር ረድተዋል ራሴም ረዳትነት ርዕይና ረድቷቸዋል ሬድማን ረጂ ሪፐብሊካኖች ረብሻና ራሚሮ ርትዕ ረስቼው ሮን ረቂቆች ራያን ረግረግ ርርኣ ሮክ ሪክ ራጅ ራይዝ ርብ ሮናልዶን ራፋሌ ርዳታው ረዕቡ ረሃብተኛ ሮዳ ሪፖርቶችም ረስተውታል ራባት ሪያሌ ረዢም ሬሳው ሪፐብሊክን ራስጌ ራይስን ረፋድ ሮጡ ረግቦ ሬዝስታንስ ራዕያችንን ራ ሮርስ ሮ ሪከርዱን ርእይ ርኅራ ረቢያ ራቁት";
            amharicWords[5, 7] = "ረ ሪፖርት ረገድ ርዕሰ ሬዲዮ ረቂቅ ራሳቸውን ራሱን ርዕስ ርቀት ሪፖርተር ረቡዕ ራሱ ራስ ሪፖርተራችን ርምጃ ሩጫ ረዳት ራሳቸው ርብርብ ሩሶ ሩቋ ሪፖርቱ ሬድዮ ራዕይ ሪፐብሊክ ረጅም ረገጣ ርዳታ ራዲዮ ረሃብ ርእሰ ሩብ ረብሻ ራሷን ራስን ሪቻርድ ርዕሶች ሮይተርስ ሩዋንዳ ሩሲያ ሮይተር ሪፖርተሩ ረዥም ሮበርት ሩቅ ሬዲዮው ርዝመት ረገድም ሪከርድ ሪፖርቶች ሪፖርቱን ራሳችንን ረግጠው ሮም ራሳቸውንና ርጭት ራቅ ራይትስ ራሴን ርክክብ ራይስ ሬዲዮና ሮይተርስን ረግጦ ረታ ርብርቦሽ ሪፖርተሮች ርቆ ሪጅኑ ርቀው ሪፈረንደም ሪኮርድ ሬሳ ራሴ ረቂቁ ሪጅን ርቀቱን ረዘም ሮቢት ረጋሳ ራት ሮማን ሪፈራል ረገጣዎች ረፋዱ ሬውተር ራሷ ርዕዮተ ሯጭ ሪፖርታዥ ርዕሶም ራሳችን ርስት ርእስ ርዕይ ሪፖርትና";
            amharicWords[5, 8] = "ሪፓርት ሪፖርተርስ ራስዎን ረዳቱ ራቁታቸውን ሬዲዮን ሩስያ ረሃቡን ረጋሣ ርህራሄ ሪያድ ረስተው ሪፖርተሮቹ ሬስቶራንቶች ሮባ ርቃ ረዳቶቻቸው ረምረም ሬድዋን ርችት ርእሶች ሮዳስ ሩብል ሮጠው ሯቀ ሪሰርች ረሂማ ሯቦ ራድክሊፍ ሮጀርስ ረኃብ ራሳችሁ ርሃብ ሪሊዝ ሪፍት ርግብ ርግጥ ራሽን ረዛን ሪፌራል ራቢ ረዣዥም ርዝማኔ ሪፖርቶችና ራዕይን ሬድዮና ራኬብ ሪዛ ራህማን ሩጫው ሮኬቶች ረጂም ራህመቶ ራጉኤል ሮጠ ሬት ረገጣው ረሃብተኞች ራሳችሁን ርጥብ ረገጡ ሬንጀር ርካብ ሪሶርስ ራሶች ሩጫና ርኩስ ሬዲሽ ርምጃዎችን ሩቶ ሮዛ ራሄል ርዕዮትና ራእዩን ራዲዮው ረብዕ ሬሳውን ሬዲዮም ረድቷል ሮያሊቲ ርዝመትና ራሣቸው ሪስክ ሬጌ ሮቤ ራሳቸውንም ሩዝቬልት ርዕዮትም ሬዚስታንስ ርዝራዥ ረድፈኞች ሪፓርተራችን";
            amharicWords[5, 9] = "ርምጃዎች ሪፖርቶችን ረጋ ሪፑብሊክ ረመዳን ሪኖ ረድኤት ራሳቸውም ሪፖርተሮቻችን ሩኒ ረድፍ ራይት ረሺድ ሪፎርም ረሃብና ራእይ ረብሻው ራዕዩ ሮምኒ ሬኖ ረሃቡ ረቂቁን ሬስቶራንት ሩፋኤል ሪፓብሊክ ርስ ርዕዮት ርዕዮትን ሪል ርካሽ ረገጣና ራሣቸውን ሮጦ ሩዝ ራምኒ ሬጅስትራር ረዳ ሬውተርስ ርዮት ሪቪው ሪፖርታቸው ርእዮተ ረገብ ራሱንም ራሺያ ሪፖርትን ሩዋንዳና ራዳር ሪፖርታቸውን ሪፖብሊክ ሮማ ረጃ ሮብ ረዳቶች ርዕሳነ ሩት ሮኬት ሯጮች ራይላ ሪከርዶችን ራሱንና ሮያል ሬድዮው ርጭቱ ረሃብን ር ሮቢንሰን ሪታ ራስዋ ሬሣ ርምጃው ራይትስዎች ርቀቶች ራሱም ራስዋን ረሽድ ረገጣን ርእዮት ራዕይና ራስህን ራስህ ርክክቡ ረ ራብ ሮሜ ሮሮ ረቡዕና ረዲ ራዲዮና ሪፖርትም ርምጃውን ረብሻውን ሮቢን ረሀብ ሪያል ረገጣዎችን";
            
            amharicWords[6, 0] = "ሲከፈትና ስንላቸው ሰሜኑ ሰብልም ስለመመለሳቸው ስላላለቀ ስልጣኖችን ሲታገዝ ስህተተኛ ስናስወግድ ስለታዘነ ሲተራመስ ሲደገም ስለነገርኩህ ሲሞግቱ ስላካሄዱት ሳይወርዱ ሲዳርግ ስለሚያስከፍል ሲያልፍም ስርቆቱ ሲደበድብ ሲያመች ሴትነታቸው ስለማይበቃ ስለሚኖራት ሲወያይበት ሳይበዛ ሲዘፍኑ ሳያበቁ ሲሞግት ሲናገሩት ሲያስተናግዱ ሰንብቼ ሰፊውይይት ሳጥኖችና ሲልከሰከሱ ሰጣችሁ ሲቲቪ ሲዘፍን ሲዳመር ስለመሆናችን ሲደፋባት ሴቶቹንም ሰጥቼሃለሁ ሰጭነቱ ሲንቀጠቀጥ ሳርምድር ስንዋልል ስንጨነቅ ሲያለሙ ሰነዳቸው ስመኝሽ ስትሔድ ሲከፋፈሉ ሲከሰሱ ስለማይፈቅዱ ሰገድና ሲታገዱ ሲወነጅሉት ስለማውቃት ስለሚሸጥ ሲያቅተን ሱሳቸውን ሰገድን ሲከሰስ ሲጫወትበት ሲታይና ስብዕናችን ስለነገሩን ሲያመጣልኝ ሰምተህ ስንመኘው ሲገለጽላቸው ስረዛና ሰለሙ ሳንሠራ ሰርቫይቫል ሲቀበልና ስለሰላሙ ሲነገረው ስረዛን ሰርቲማ ሲያመነታ ሰነዓፌ ሲኖርና ስቱዲዮዎች ሲያምኑት ስላለመሆኗ ስጸልይ ስለውህደቱ ስፍራዎችና ስላልደረሰው ሴንተሩ ሰውዬም ስንመሰርት ስለተቀመጠው ሴሲ ሳይጠና ስለኹኔታው ሲግናል ስትችል ስላየው ስታረጋግጥ ሳንቲሞችን ሶፎንያስን ሰዓታችንን ሲሳይና ሲከፋቸው ስለመብትና ስሔድ ስለምትችል ሳቃቸውን ስቲል ስለመሄዳቸው ስክሪኖች ስናውቅ ስኬታማነቱ ሰላማቸው ስለሞራል ሳትነግረኝ ሳይበጅ ስለማይመስል ስትነቃ ሲተረጉም ስለሚያስቸግር ስላገኙዋቸው ስብከትን ሲወተውቱ ሰዶም ሰዓሊው ስለቃቅም ሳናቅ ሴተ ስለእናቶች ሲያስነኩት ስለሚያድሩ ሲያያት ሳናሰማ ሳያልቅብን ስቴይትሱ ሲደግፍና ሲተክዝ ስላገኘሁ ሰደተኛ ሲጨፍር ሳንቆጥር ሲያነሷቸው ሲሳደብ ሲያማርጡ ሲገባም ስታመለክት ስለሚውልበት ስንፈትሽ ሳይለየው ስትከዳ ሴኔ ሳይመረመር ስዋዚላንድ ሲቢኤስ ሲከተላቸው ስለተገነዘብን ሰፍረውበታል ሲቀርብባቸው ሳያስከፍል ስለማይችሉና ሲያሰራጩ ስተዋል ሰብአዊነትን ሶማሊያውያኑ ስለሚነካ ስታራምድ ስንቶቹን ሲያስተዳድረው ሲያሞቀው ሲኦን ሲያስቀምጠው ስለደረሱ ሳያስረክብ ስላለች ስደክም ሰብሳቢነትን ስፖኪዮ ሳላገኝ ስካሩ ስሌለው ሲበርድ ስለገመተ ስፔንሰር ስለደረሰብን ስለእያንዳንዱ ሲበረብሩ ስካር ሳይቀምሱ ሲያስለቅሱ ስፋቷ ሰነዘረች ስፅፍ ስለማያስረዱለት ሳልል ሲያሴሩ ሳንጠብቅ ሲያንጓጥጡ ሲነሳባቸው ሶህዴፓና ስትሠራ ስለመብታቸው ሴክቴሪያት ሲያደርግባቸው ሲታደኑ ስሮጥ ሳደን ሲጀመርም ሳላጠፋ ስለሚወስዱት ሲያቀርቡም ሲተነፍሱ ሰንብተናል ሲቸር ስለሆነውም ስብሐተ ሲወራረስ ስርዓታቸው ስብሐቱ ሲሰርቅ ስንጠራ ሲጎርፍ ሰበኗን ስታጫውተን ሰግቻለሁ ሳያዩት ስራዉን ስራንና ስለምኑ ስላለና ሳይከታተሉ ሲተነፍስ ስቅሉን ሳይወያዩበት ሲኮበልሉ ስለሚወጡ ሲያበሳጭ ስሉ ስቃዬ ሰደፍ ስቲት ሰለጉዳዩ ስለሚወጣ ሲዳብር ሲያነጋግራቸው ስለማይገኙ ሰደተኞች ሲጥሉት ሰመር ሲታማ ስለሚደግፍ ሲገልፁላቸው ሳይስቱ ሲቻልም ስለሚሞክሩ ስሰማቸው ስለሚከተለው ስንገናኝ ስመላለስ ስለሚያሳይ ሲያናግሩ ሲንኳኳ ስረ ሳተላይቱ";
            amharicWords[6, 1] = "ሳትጨምሩ ሳሕል ሰፍኖአል ስለተቀመጠ ሰርቫይቨርስ ሳይከፍት ስታስተባብል ስለአጠቃላዩ ስለሚደረግባቸው ሳንባን ስለማያመጣ ስሜትዋን ስትር ሰልፋቸው ስለሚታመንና ስለደቡብ ሲነሳበት ስዬም ስሩልን ስለነገው ሰላቢ ሲያስጠብቅ ሳይንሣዊ ሲነግድ ሰንገው ሲሰጥም ሳይገድሉ ሳይካሄድባቸው ሴክሬቶ ሳይገባው ሲፈቀድና ስመጥሩ ሰሐን ሲሽቀዳደሙ ስለታዩ ሲሆንም ሰንዘረዋል ሲሰማኝ ሲደርሱም ሰንሰለታማ ሰአትና ስለታሪክ ሰዉ ስለመነጋገራቸው ሲሞክሩም ሲነፃጸር ሲስተዋል ስትራተጂክ ሰላቱ ሲያባብስ ሲቆርሱ ሰዓሊያን ሲያጠጡ ሰላት ስለቀሩት ሶቬት ስላጠፉ ሳይጀምሩት ሳላፀዳ ስለሚቀጡ ስለሚታዩት ሲኮንኑት ስኮር ሲዘራ ሱለይማን ስለሞቱባቸው ስለማይቆጠብ ሰማዕታትና ስለመነሳታቸው ስፍራዬ ሳይበረዙና ሳልወጣ ሰቨን ሲያደርጉም ሴኩላሪዝምን ሲያስደምጥ ሳሊያ ሰምቼው ስለሚፈጥርላቸው ሲመለስም ስንደውል ሰራቸው ሱከር ስላልቻለና ሲገለገሉባቸው ሱማሌና ስላደረገኝ ስለውድድሩ ስለአላቸው ስታወሩ ሰምንት ስትራቴጅን ሲያቀርብም ሲያስፋፉ ሲዝቱ ስፌትና ሲያመላልስ ሲፈልጋቸው ስለእነርሱ ስብከቶች ስለቀረበላቸው ሳያሳኩ ስላገኘቻቸው ሳትወሰን ሶስታችንም ሰይቀር ሲሆንበት ሲያመለክትም ሲመቱን ስለሞተችበት ስለምናስብ ሲሰራጩ ሰንብቱልኝ ሲያስገኝ ሲደመደም ሳይወያዩ ሲነሳም ሳታስፈቅድ ስብስበው ስለትግሉ ሰይሞታል ስለማህበሩ ሲያሽግ ሰዎቸን ስለሚያመጣ ስርም ሲመስለኝ ሲኖሯት ሳይበቃው ሳታስበው ሲያምስ ሲያከትም ስለአለበት ሲያስተዳድሩት ስለመሳተፋቸው ስጋቴ ሱቁ ሳይጠናከር ሰልፋችንን ሲያበቃም ሳይወያይ ሲሰለቸው ሳይታይበት ሲሞቁ ሳይፈጠሩ ሳገላብጥ ሲሰብክ ሰርስረው ሰንዝሬ ሰፍ ሲጠናቀቀ ሲወነጅሉ ስለሚባሉ ሰማሽ ሳትጠብቅ ሲያነሳ ሲስማሙበት ሲንቀለቀል ሲጎድል ስቴትስም ስለወሰኑ ሳያነሱት ሰለሞንን ሲያካትት ሲቸበችብ ሲያቃና ሲጓተቱ ሱጊሳኪ ስለማለቱ ሲወዱ ሳይንቲፊክ ሲወነጅል ሰሪው ሰባቱም ሲተያዩ ሲያደናቅፍ ሲወልቅ ስልጣናቸዉን ሲውጡ ስናነሳ ሲንቅ ሲነሳሳ ስልቶችም ሲያበረታታ ስለሚያዙ ሳይተኙ ስርቅ ሳይጠይቃቸው ስታስታጥቅ ስለሚነሱ ሳምንታትም ስለተሰማ ስትራተጂያዊ ሲያጉረመርሙ ሳይተኛ ስላየሁ ሳይወሳ ሰፈርም ሳይተኩስ ስሜታችንን ሰዋራ ሱኒ ሲያቀርቡና ሰምተውም ሴራውት ሰጥቷት ስለሚጋፋ ስለናይል ስለደረሳቸው ስላልቀረበባቸው ሲደፈርስ ሳላሃዲን ስለአዲስ ስለታጠረ ስለሚታየው ስምዓ ሳትመለስ ስለሶማሊያ ስለጠናው ስርዓቶችና ሲፈፅሙት ሰላዮችና ስንወስደው ስነግራችሁ ሲሰሯቸው ሲወራት ሲታሰሩም ሰነዶችንም ሴክቱሬ ሳልቬሽን ስግብግብነት ሳይገደድ ሲያስመልስ ሰርስሮ ሲለምኑ ሰለፈኞች ሲያስመርጥ ሲነቃ ሲጠጋ ሶጂያ ሲሸነፉ ስታሸንፍ ሴፍቲ ሲኖርብኝ ሳይጠየቁ ሱዋ ሲቀርቡበት ስታከብር ስላላገኙ ሲቀብሩ ሲመጻድቅባቸው ስንሸጋገር ሳልሰማ ስለሚበዛባቸው ሲነግሩት ስሞችና ሲመዘበር ሲተፋ ስርቶ ሳይረግጡ ሱዛ ሲጋጠሙ ስንቀጥል ሲያወድሱ ስንዘምር ሲዘምሩ ስርቻ ስመው ስለሚቆይ ስለዴሞክራሲያችን ሲጉላላ ሲያቅራራ ስላልተጠናቀቀ ሲያረጋጉ ስትዘጋጅ ሲሸት ስለዝርዝር ስለቀውሱ ሰማና ስለማህሌት ስርካለም ስለተሰጠን ሳችስ ስለጥናቱ ስለሚመጡና ሱቆቹ ሰሜናዊና ስታልፍ ስላልቻልኩ ስብሰባዎቹ ሳደርገው ሲይዛቸው ስንቁን ስትቀር ስሎቬኒያ ሰለሆነ ሳሙናና ስለአልቻለ ሲከሰከስ ስትራቴጂዋ ስለውይይታቸው ሲያጠቃልልም ሲባልስ ስህተቴን ሰላጣ ስለግብር ሲጠርቡ ስለንብረታቸው ሳትለቅ ሲያላግጡ ሲያከፋፍሉ ስለመሆንዋ ሶዌታን ሰባክያነ ሲማ ስሜቷን ስለሚከሰቱ ሲዘረዘሩ ሰቅላ ስትመላለስ ሲለከፉ ሲያመርቱ ሴላቸውን ሰፈራችን ስለዚህች ሳንዘጋጅ ሳይገድለው ሲንክ ስለሚፈጅ ሰዋሰው ሲሴ ሲንጋፑር 