            amharicWords[6, 2] = "ሳይሳሱ ሲሻሩ ስዊድናውያኑ ሶማሌያና ስለቴክኒክ ሰውነቱም ስለሚጥል ሳይሳሳ ሲታሰብም ሳይኖረን ሲያስነሳ ሲላክለት ሲራክ ሳገለግል ሶማሌያን ሲያካሄዱት ስለመነሳቱ ሰንቀሌ ሲረገጥ ሲመቻቹ ሲገርመኝ ሲያስመሰክር ስለተመለሱ ስለሚሳተፉ ስራሕ ሲቀባ ሳላስተውል ሳያነጋግር ስለሚያቁ ሰርዛ ሳይፈታና ስለሚሰጡ ሴንሲቲቭ ስትሪንግ ሳልሞት ሶዳ ሳያስቡ ስለሚቀጥል ስብዕናቸው ስለሆነበት ሰነፍና ስስትን ስለታዬው ሰበንቲ ሳመኝ ስካርፍ ሳላዲንን ሳይኖረኝ ሳይነገር ሳያርሱ ሲፈራ ሳልፍ ስለተገለፀው ሲከለል ሲመቸው ስትተኮስበት ስጓዝ ሲሰልል ሲነጠቁ ስማቸውንም ስለእስልምና ሲደጉሙ ሲፈሱ ስቅሎ ሲመለከቱዋቸው ሰየመ ስኮትላንድ ስፋቱና ስትቸገር ስለትርፍና ሲዘልፉ ስዘፍን ሲነጠቅ ሲደጉም ሲከበሩና ስብስባም ስላልተሳካለት ሰዉም ስቀመጥ ሱዳኖቹ ሲታወሱ ስራቸውና ሳንበላ ስብእናቸው ስንመለከትም ሲያሳርፉ ሲበሳጩ ሰንቴ ሰምቻለው ስለመቻሉም ስሕተቱን ስላደረገችው ሲያምሳት ሶፋ ስንወዳደር ስለሚሻል ስለሚቀርቡ ሶማሊያዊያንና ሲድን ሲቀድም ሲሰየሙ ሲነገርላት ስለታማ ሲያሳርፍ ሰምቶት ስላገኛቸው ሲጠሩት ሳመው ስለማይፈጸም ሲቀያይሩ ስለሕግ ሰባብሮ ሲነግር ስትጨርስ ሰብሎቹን ስቴቶችን ሳልነግርህ ሰባተኛና ስላለፈ ስላቀረበው ሰብሯል ስንዋጋ ስለሕወሓት ስንኳንስ ሲስተምስ ሳይወስዱት ሲያነፃፅሩ ስለመከሩዋቸው ሳይጓዙ ስለሚመስሉ ስለመፈጸማቸው ሳይደግፉ ስለገባን ሳያጠናና ስላልደረሳቸው ሲነግስ ሲውለበለቡ ሲያጠቃልል ስላቃተን ስካልፋሮ ሰንሰለቶች ሳጠና ስለተገደሉበት ስራችነን ሰይጣንና ሳውዝ ሰይፋቸውን ሲንደረደር ሲደረግም ሲፀነስ ሱሪና ሲያማርር ሶቭዬት ሲሰደብ ስላልተገኘ ሰርቪይ ሰርታችሁ ሳይስተካከል ሲያስመስሉ ሰሙና ስጠይቃቸው ስትሮክ ሳንጨርስ ስጮህ ሲያደራጁ ሰሙን ሱባኤውን ስናናግረው ስትነጻጸር ሲከላከልና ሲበላሹ ሰፍኖባቸዋል ሲቲስካን ስለሚዘጋ ሲደውል ሳይወስን ሶፋንያ ስድብን ሲደንቀን ስላገኘች ሲተረክ ሶማሊያዊያንን ሰልጣኖች ስላቀረቡ ሲጠናከሩ ስቴትና ሳያገቡ ስንከራከር ሲያካሂደው ሲያሰለጥናቸው ሴቲቱ ስለሚሠራው ሲደገፍ ስለባንኩ ስዊዘርላንድና ስርቆትን ሰጠኋቸው ሲፈቅድለት ሲጋልቡ ሲያቅት ሳይሰመር ስለምሰራ ሲወስዳቸው ሲጮኽ ስለማይግባቡ ሳፔቶ ስምምነቶቹንና ሲጋልብ ስላሟላች ስትተዳደር ሰማይነሽ ስለመልዕክቱ ስታቫንገር ሳይፈቀድ ሲበተኑ ስናጣራ ስኮትላንዳዊ ሰአረ ሰጥተውን ስትራቴጂዎቹን ሶሪያን ሲንጋፖርና ስንሰራ ሰምቼም ስለመኖራችን ስትበላ ስላለችኝ ስላደረባቸው ሲያቋርጥ ሶርስ ሳይመሠረትባቸውና ሰልጣኞችና ሰማያዊው ሳይደፈር ሲሳደድና ሲያደርሱት ሳምራዊ ሰጥቶኝ ሲንጋሊያ ሲለወጡ ሲታዘዝ ስለማሸነፋቸው ስላነሱት ስለመሳተፉ ሲለቀቅ ሰዱቃውያን ስለኅብረት ስድቡ ሲደክማቸው ስለሚቆጠሩ ስለካንሰር ሲጋራና ስታጣ ስለማይዘገብ ሲያስቆጥሩ ስራዎቻችን ስቶኪንግ ሰለቸን ሲጋራን ስንቼዝ ሲመለከቷቸው ስላልነበረና ሰጥተውኝ ስለኢንፎርሜሽን ስለሚቆጥር ሰንብተን ሲማስን ሲያነጋግረው ሲኖዶስና ሳንቲምና ሲጤን ስራዋ ሲዘጋጅና ሴሚናሮች ስትመረጥ ስፈር ሲጀምርስ ሰዓቶችና ሳይመልስ ሲንቆራጠጡ ሳይቀላቀሉ ሳይኖርህ ሳይደክሙ ሲቀጡ ሲደርስብን ስለራስህ ሲያስሩ ስለተሰጠ ሳገኘው ስልጣኑም ስለመሰረታዊ ሲአርዲኤ ሳትችል ስላልመጣ ሳላየው ስትገነባ ሶማሊያም ሲኖኃይድሮ ሲፋፋም ስትናጥ ስንጨምቃቸው ሰባኪያንና ሳይበተን ስንደረደር ሳያደርግበት ሲጠቅም ስለሰጧቸው ስልጠናዎቹን ሳወጣ ሰንጎ ስትሞት ሰጠናቸው ሰማእታት ስላለበትና ሰፊነትን ስብዓዊ ስለሚገኝና ሳይሰበር ስለሚተላለፍበት ስታውል ሲልቪዮ ሲጨፈጭፍ ሳታወጣ ሶሺያል ስለጉዞአቸው ሲምፖዚየምም ሲያሳልፍ