            amharicWords[6, 3] = "ስጠን ስለአልቻሉ ስጠይቀው ሲደግሙ ስዊትዘርላንድ ስትስቅ ሰዋች ሳይፈረም ስለሚለይ ሰልፎችን ሲያስፈጽሙ ሲያንፀባርቁ ስክሪፕቱን ስሜታችን ሰርዟል ሶማሌያዊያን ሰጣት ሱሪያቸውን ስናዘጋጅ ሲፏልሉ ሳይረኖችን ሰብስበዉ ሲፈተሹ ሲሸበር ሲሰጥበት ስብስባው ሲያወግዙት ስለፈለገች ሳቄን ሰቀላ ሲያሰላስል ሰንአፌ ሶስተኛዋ ሲያስጠነቅቁ ስብአዊ ስራዋን ሲያሰለጥን ሲያምን ሰማየ ሶላር ስንቄ ሰለባነት ሲሞላው ስለማያምን ሳያውቁና ስለመመለሱ ሳይታወቃቸው ሰዋዊ ሲጋለጥ ስለሚጨምር ሲሟላ ሰግተን ሲቆፍሩ ሶማሊያዎች ሲሰሙት ስርዓቱና ስለገቡት ስለተናገረ ሲቆፍር ሰራና ስመለከታቸው ስለዜግነት ስናመራ ስለተነሱ ሲገደድ ሲከሰትና ስለሰሙ ስነቃ ሳጣራ ስለሰብአዊ ሲዘምት ስትዋጋ ሲሰበክ ሲደነግጥ ሶሻሊስቶች ስለተቋቋመው ስምንቱም ሳይሰበስቡ ሰጪነታቸውና ስልጣናቸውንና ስራተኞች ሲወርድበት ሳያፀድቅ ሰዎቹም ሳይነጋገርበት ሳትሞት ስናገናዝበው ስለፓርላማ ሲጋበዙ ስለኤድስ ሳሙ ሳይፈፅሙ ስብዕናን ሰድቦ ሲባዝኑ ሰርጀሪ ሲያሰቃዩ ሰለስቱ ስኩዬር ስሙንም ሲያድጉ ስያሜውን ሲያስታውሱት ስለማመሽ ሳይዘልቅ ሰርጋችን ስለፈሰሳት ሲያደርጋቸው ስሊም ስለነበረብን ሳቤ ሶማሊያዊ ሳት ስንጠባበቅ ስቴሽን ሳይሽር ሲቭል ስለሚወዳት ሲፈተን ስትቆም ስሌላቸው ስለሔደ ሳይሰጣት ሶሊዳሪቲ ስጋታችን ስላልተሳካ ስራችሁን ስንጥቅ ስለሞቱት ስለተጭበረበረ ስሮች ስለሚወሰደው ስናነሳላቸው ስለዓባይ ሲያባክኑ ሰርተፊኬትና ሰንብት ሳይሻሻል ስለሚሄዱ ሳዎ ስለሚፈፀሙ ሲያስወግድ ሲያስፈፅሙ ሲሞክሩና ስለወሰዱ ስልቻዋ ሰቋር ሲጠበቅባቸው ስብሰባችሁ ሲዋሃዱ ሰብሉ ሴሞችን ስለሚወድ ሲጨቃጨቁ ስለሚቀር ሲጨምሩ ስለጠፉ ስለማንነታቸው ሲሰጠን ሳያስፈልጋት ሲበደል ሲልከን ሰማያትን ሲታገሉና ስለምንም ስለተሰጠህ ስለተፈናቀሉ ሲሆንባቸው ሰንበል ሲስተሯ ሲሳናቸው ሲቆርጡ ሲንቀሳቀሱና ሲቀጠቀጡ ሲቆርጥ ሲከፋፈል ስለመጣበት ስለጦርነት ስለሚፃረር ስላላቸውና ሲሶውን ስንባል ሳጣ ሰቆቃዎች ስናስተውል ስሊዋገን ሰበቦችን ሴሩ ሲታመም ሲቲን ሲመረምረው ሳንምት ሰሞኑንን ሳንጨምር ሰጥተህ ሳታጣ ስለሚያገኙት ሲጣደፉ ሳይገኝለት ሲያደንቁ ሳያልፉ ሳትቀበለው ሲቃጣ ሲንገላታ ሰለዚህ ስልቶቹ ስለሌለባቸው ስታስቲካዊ ሴታ ሴቷ ሰጥታችሁ ስለጡት ስለማይፈልግ ስለግድቡ ሰገነት ስዩመ ሲዋከቡ ስትጠብቅ ስብዕናው ስለማላውቅ ሳይከፈላቸው ሲያስቀምጡ ሳንወሰን ስለሚችልበት ስለተሰማቸው ስናዳምጥ ስላልቻሉና ስፔሲፊኬሽን ሳናስበው ሳኢድ ስትራትፎር ሲያበላሽ ስልቻውን ስብስብና ሲአይኤ ሲሰቀልና ሲለፍፍ ሰጋሁ ስለጉዳዩም ስለሚጫወት ስለራሴ ስለተቸገሩ ሳደርግ ሲቀበሉት ስለመስጠቱ ሲያመው ሲመስላቸው ስላልተቀበሉት ስለማያውቀው ሰማይን ሶኒያ ስለሚጓዙ ሰብአ ሳይስተጓጎል ሰጪም ሰብእ ስላልተደረገላቸው ስለመፈፀሙ ሰልፈኞችን ስለሚያሳድር ሲዘረጉ ሲማሩ ሲሄድና ሲላኩ ሲዘረጋ ሲማር ሰኞና ሰይፍን ሳይወሰድ ሴራዎች ስለሀገሩ ሲታሙ ሰጋር ስለተጣሰ ሲጨቆን ስለኢትዮ ስላሳሰበው ስሚኝ ስላም ስንመለከተ ስፔሻላይድ ሲሠቃዩ ሲያግባቡ ሰርተሃል ሱፊው ሲያከማቹ ሳይሸማቀቁ ሳለም ሴኔተር ሲረግጥ ሲነሱና ስላላገኘው ስላወቁ ሳይቸገሩ ሰውነትም ስንቃችንን ሲተርቱ ስካት ሲፈራርሱ ሲጠይቀኝ ሳይዋጋ ስንቀርብ ስንጨዋወት ስለአንድነት ስለታወሳት ሳይጠራጠሩ ሳልሰጥ ስላንቲያ ሳይለውጡ ስለሚታያቸው ሲመዝኑ ስላሳ ሲከማችና ሲነግረን ሳይፈነዳ ሲለያይ ሲናከስ ስለመስፍን ሳሙኤልን ሲያጥላሉትና ስታገባ ስላስፈለገ ሲገዛው ሲያመቻች ሲታለል ሲመዝን ስላልሰጣቸው ስንዘጋጅ ስኮላርሺፕ ሰምታችሁልኛል ሳጥኖቹን ሲያስቡት ስምዖንም ሳንይዝ ስሞታዎችን ሰኔት ሲንከባከቡ ሳያሟላ ሲፈረድበት ሲወቅስ ስለበዓሉ ሲያስገነዝቡ ሳይተዋወቁ ስለሚበዛ ስካን ስለመያያዙ ስችል ሳይሻሉ ስህተታችን ሲያበራ ስለፊያሜታ ሲያውኩ ሴሜስተር ሲታተም ሲያጋልጥ ሲነግረኝ ስለተጠየቀ ስርየት ስኒ ሲያበር ሲያወሱ ሳይወጠወጥ ሲታረድ ስለታሰሩበት ስን ሳትሆኑ ሳዑድ ሰርታችሁዋልና ሲቲዚን ሲላክላቸው ሰሞነኛው ሳይወጣና ስትለምናት ስላደረገ ሲቀበሉና ሰክረው ስለማይፈቀድ ስለሁኔታውም ሰሚናር ስለከለከለ ሲደሰቱ ሳይንበረከክ ሲሰግዱ ሲተነትኑ ስላረጋገጠ ሳልፈታ ስለሚኖሩት ስለዲሞክራሲ ስላለዉ ስለባቡር ስታንዳርዶች ሲደሰት ሳይኮሎጂስቶች ስራውንም ስለመንግስት ሰውዬን ሲኖረን ስፕራይት ስለጤና ሲያገኙት ስህተንን ስው ስለሰሙት ሳይሰራ ሰለነበር ሳሮዊዋና ሲያዞሩ ስሞታው ስለፈራ ሴሴሴኮን ሰላሞች ሰራሕተኛታት ሳይቀናው ስለዝኣምን ሲያወያይ ስለተመሠረተ ስቴይት ሳይመዘገብ ሲታውቅ ስለሚያውቁና ሳሮዊዋን ሲያዞር ሳይስፋፋ ስለተዛባ ሳይቀመጡ ሰውየውም ስለሰራው ስንሰባሰብ ስፔስፊኬሽን ሲኖረኝ ሰብስባችሁ ስለሚወጡት ስለሚፈራ ሰለደረሰ ስያ ሲያስታውሳቸው ሳያሰፍር ስለመሰለን ሳምነት ሲባባስ ሳይገታ ስለትምህርቱ ሲገፉት ሲጉዋዙ ሲፈጸምባቸው ስለወጣው ሶከር ሲያንገላታው ሲያጣብቡ ስናበቃ ሲያጋጥሙት ስጦታዬን ስታንደርድ ሲፈልግም ሲያመጣ ስቅላቸውን ሲጠራው ስለሚረዳቸው ሰነዶቻቸው ሲገለጹ ሳትቀር ሲተርኩ ሲያጣራና ስቀጥል ስነጽሑፍ ሲፈጽመው ሳለና ስገድ ስለኢትዮጵያዊነት ሰብዓዊነትን ሳውል ሳትሳተፍ ሰውኮ ስልቶቹን ሲመታቸው ሲገባና ሶማ ስለማታውቅ ስናመጣ ሳያመለክቱ ስጠ ስሕተታቸው ስካይ ስታል ስለደርግ ሲነፈጉ ስኬቶችንና ሳይፈጽሙ ስለፈፀመ ሶሪ ስትጫወት ሶራ ስጭ ሶሬ ሲመለከተኝ ሳያጣ ሲያንዣብቡ ስለጠፋው ሲጋደሙ ስለፈፀሙ ሰርት ስታወዳድሩ ሲሽከረከሩ ሴናተሩ ሴቱን ሳይዛወሩ ሳይንስንና ሲፈፀምበት ሰብሳቢውም ስለተከለከለ ሲኒዎች ሲገፋፉ ሲያመቸው ሲደመድም ስትቸር ሰልፉና ሰቂር ስለተሰማኝ ሰንሰለታማና ስለማረጋገጣቸውም ስቴይን ሲለዩት ሳይሰምርለት ሳቁና ሳያስረዱ ስናመጣው ሰብስበዋል ሳይመረጡ ስፓይሩሊና ሲበትን ሳያውቀውና ሴቴኒስት ስለሚያስመዘግቡበት ስለመሰለኝ ሳምንቲም ሲቃወመው ሳያስፈቅዱ ስለነበራችሁ ስኬትና ሲሠሩበት ሲጣጣሩ ሲከፍትና ሶበ ስቃያችን ሲዖል ሲያራምደው ሳያቁዋርጥ ሲያዩዋቸው ሲሽከረከር ስለምትል ስትቃወም ሳይጨመር ስትሰጠው ሲያደርግም ስሚርዶን ስናገናዝብ ሲሯሯጥ ሲመኙት ሳይመሰረትብን ሲያውለበልቡ ስኬማ ሲቀባበሉ ስለታየች ሳውቅ ሳይንስን ሲያሴሩና ሶፍያ ሲያወግዝ ስትማር ስናልፍ ሳይቆጥሩት ስለእምነት ሰማያዊና ሰመድ ሰላማችንና ስለማይጠቅም ሰቆቃን ስንቀር ስለተባለውም ሱማሊያዊያን ሲያስተላልፉና ስውርነትን ሲስተሞች ስልጣና ሲፈናቀሉ ሰቀጠጠው ስሚዝን ሲገለገልበት ሰባክያንን ስትቀላቀል ሰዓረ ሳልፓክ ሰሌዳዎችን ሲያደረጉ ስንመላለስ ሲጨመርበት ሳይሆንበት ስኮትላንዳዊው ስላላው ሳይጠየቅና ሲያበቁም ሲታመንበት ሳይቀርብበት ስለሚታውቅ ሳዑዲና ሳይረጋገጥና ሰዓታቸውን ሲከንፉ ስላሰበው ስለሰማሁ ሳዑዲን ሲገመግም ስለምግብ ሲደማ ሲያሽከረክሩ ስለዲሞክራሲያዊ ስናስታውቅ ስራህ ሲያስነሱ ስህተታችንን";
            amharicWords[6, 4] = "ስታንት ስቃዩን ስንጮህ ስለሆንሽ ስለሚያደርጉ ሲያነጥፉ ሲገፋ ሲጨመር ስህተትም ሳይሻል ሲለዋወጥ ስልክን ስለተጠየቁ ሲደረስ ስናወራ ስምምነቶቹን ስትወርድ ሲነግሩዋቸው ሲነደፍ ሱቆቻቸውን ሰፈራዎች ስለሚያስብ ስለተረዳሁ ሲስቡ ስለሚሉት ሲጭኑ ሳትወድ ሰወችን ሰውች ስለማንኛውም ሰጪን ስንኩላን ሲያዘዋውር ስታደርጉ ስለፈሩ ሳያረጋግጡ ስሠራ ስለሴቶች ስፅፍም ሲለቅሙ ስለፌስቡክ ሴክሬተሪ ስለሚፈሩ ስቶኖቹ ስንባባል ሲያነሳው ስለአጼ ስናስታውስ ስለሚያገለግል ሲላጭ ሳንሰጥ ሳይቆም ሲያፀድቀው ሲያመጡ ስለሚያካሂደው ስለሚያቀርቡ ስለማግኘት ሰልችቶናል ስድብም ሰጭዎችና ሳይጠጣ ሴቡጃ ስለመያዝ ሲወጣም ሲመረጥ ሲያስታጥቅ ሳይፀድቅ ሳላስበው ሳናደርግ ሲዋኙ ስለተገደሉ ስልጤዎች ሲያስቡና ስዩምም ሳይረግቡ ሳይጣልባቸው ሲገባኝ ሳይሰረዝ ስለሚወስድ ሲያስደስት ሳያምንበት ሳይኖርብኝ ሲገኝም ሳስተውል ሲሊንደሮች ስለተከለከሉ ሰርተህ ስለሚሆንበት ስናካሂድ ሲንገላቱና ስቀልድ ሲሳደዱ ሳይመረጥ ሲጣጣር ስለተደረጉት ሲሠጡ ሳይለያዩ ስላዩት ሰቦች ሲቲዝን ሲጠይቀው ሰባክያንና ሰትራቴጂ ስለቀጣዩ ሳያስፈቅድ ሳብያ ሳይለያይ ሰላንቲያ ሰምተዋል ሶን ሲስተጋባ ሲደጋገም ስለሞላ ሳይቆጠሩ ሳይሾሙ ስለሚሠሩ ስታንሌይ ሳያገኝና ሳይንሳዊና ሲዛባ ስለሚሠራ ስሰራ ሳያሰልስ ሳይቆጠር ሲያደረግ ስራሕቲ ስትረዳ ስለሚመጣ ሲያንገላታቸው ሱላሞ ሲረገጡ ሲሻር ሲታከልበት ስታነቡ ሴቷም ሴሚናሩ ስለሚያደርሰው ስለገለፁ ሲፈቱና ሲድቤ ሲዋደቁ ሲሏቸው ሳይንቲስቶችና ሳያስብ ስለአገር ሲያዳምጡ ሲያደርጉን ሳይወድቁ ሲሰልሉ ሳያስቡት ስኬቱ ሳይተነፍሱ ሲጠመድ ሰሚራና ሲወቀስ ሳይቀርብለት ሰጥታኝ ሳይፈርሙ ስለደረሱበት ስኮላርሽፕ ሲያጠቃ ሰራዊቱና ሳይኮሎጂ ሲያከብሩት ሲከብሩ ሳይሠሩ ስለተገደለው ሲሳነውና ሰርጉ ስምምነቶቹ ስብሰባዎችም ሲሰነዘሩ ስለሚፈጥሩ ሶፊ ሲያሰናብት ሲበሳጭ ስግብግብና ሲነገርላቸው ሲከፋም ሳትገባ ሳያግዳቸው ሶማሊያንና ሰምታችኋል ሲሰየም ሲያንሰው ሲከለከሉ ሰጪነታቸው ስለተከሰተ ሲሰጥባቸው ሲኮንኑ ሶማሊያንን ሳይረታ ስለመግባት ስፍራም ሳይዘነጋ ስለሚቀርብ ስራተ ሰቶን ሰነባብተዋል ሳያድሩ ሰንአ ሳይሳተፍ ሲጀምርም ሳይኮሎጂካል ሲያንቋሽሽ ሰለሞንም ሳምንታትን ሰሙነ ሳያሰሙ ሰርፀ ስድሣ ሲከስ ሲወዛገቡ ሳንል ስጨነቅ ስለታሰሩት ሳቃቸው ሰርፆ ሰነዶችንና ስለገባኝ ሲወስዱት ስፔሻሊስቶች ሲወጣና ሲራጩ ሲበላሽ ስገልጽ ስትቀመጥ ስለሚመለከት ሰላሙና ሲቆሉ ሳይላቸው ሲያምራቸው ስለወሰዱት ሳይህ ሴቲት ሳይንቀሳቀሱ ስሜታዊና ሲስፋፋ ስብከታቸው ሲገኝና ስቲዲዮ ስካይፕና ስለገባቸው ሳንስ ሲቆጠሩ ስለተወሰዱት ሳታስታውቅ ሲነቀል ሲፒጂ ስትነግረኝ ስራዊት ሳማርያ ሲታዘዙ ስለፈፀሙት ሲፎክር ስለማሻሻል ሳያቆም ሲደበደብ ሰማቸው ስሜቱም ስለሚጠብቃቸው ስላልነበራት ሲያፈናቅል ሳይመልሱ ሳንቦጫርቅ ስንቆም ሳትገኝ ሳንቶስ ስለማይታይ ሰንዱ ሰፋሪዎቹን ስራዉ ሳይነኩ ስትጥር ሳወርድ ሰሞንም ሰጡን ሳይጠሩት ስንመካከር ሲያጠኑ ስለሌለውና ስለመሳተፍ ሰርጭት ስለሚገጥማቸው ሲያስር ስታሳውቅ ሰሩት ስለመኖር ሰውነትና ስለሚፈለጉ ሳይንቲስቱ ስክሪፕት ሳውዘርን ሳይሸጡ ስለመጣሱ ሳያንሳቸው ሳንቲ ሲመርረው ሳልናገር ሳይሳኩ ስለሆንኩኝ ሲሸልሙ ስለነዚህ ሶፍትዌር ስልኮችና ስሜቴ ስለታመሙ ስደቱ ስለማንም ሳይኖርባቸው ስለአካባቢ ስለተስማሙ ሳይፈራ ስላልታወቀ ስህተቶችም ስለሚፈታበት ስንገማገም ስናወጋ ሲመፃደቁ ስለተካሄደበት ሳንለያይ ሲበታተን ሳያነሱ ስለፈጸሙት ሳይገባን ሲገቡና ስለተገደዱ ስንገኝ ስግደት ስላጋለጡ ሳይቀበላቸው ሳያጠፋ ሲገልጽም ስለተሰነዘረው ሰንዝረው