            amharicWords[6, 5] = "ስለበዛበት ሴቭ ሳይመረምር ሰከን ሲታመስ ሲመዘገቡ ሰጡዋቸው ሲሳደቡ ስለሚያውቀው ስብሰባዎችንና ሰብሳቢነትና ሳንሄድ ሲያበላሹ ሲላት ሴኮ ስታርስ ሲታሰሩና ሲያዘጋጅ ሳልህ ስላገኙት ስለራሱ ሳላነሳ ሲቸሩ ሳይናገር ስለማንሳት ሱማሌላንድ ስላቃታቸው ሰምሀል ሲነገራቸው ስለማጠናከር ስትጓዝ ስምኦንና ስልጣንዎን ስምኦንን ሰውሮ ሳይርቅ ስታሊናዊ ሴፍ ስለማይገኝ ሲባባሉ ሲሰለቻቸው ሲከሽፍ ሲጣላ ሲከላከል ስላልፈለኩ ሲቪልና ሳትፈልግ ሶማሊዎች ስብጥርና ስለሌላቸውና ስትራቴጅዎችን ሳቀርብ ስልጠናዎቹ ሲገልፅም ሴራቸውን ሲጣሱ ሳይፈቀድላቸው ሰፈራን ሲቆረጥ ሲጣስ ስዕሉ ሲተኮስ ሲንከባለሉ ሳበቃ ስለየትኛው ስላሴና ሲጸድቅ ሲረግፍ ስንቅህን ሲተነትን ሲሳለሙ ሴሰኝነት ስለሕዝብ ሳትሉ ሲያያዝ ስብከቱና ሳትል ሰማዕትነት ሲዘረፍ ሲያተኩር ሰውኛ ሳይደረስ ስለቆዩ ስላልገባቸው ሲፀናባቸው ሳያረጋግጥ ሲገለበጥ ሳይጠቁሙ ሳውላ ስንወስድ ስለኦሮሞ ሲዳማና ሲገለፁ ሰረቀ ሰጭዎችን ሰርታ ሶሮ ሶቋሽ ሰውንም ሳመራ ሳይፈጽም ሳይስማሙበት ስላሳሰባቸው ስፊ ስርአትም ሲኖርባቸው ስጠይቅ ስለዜጎች ሳያመለክት ሴርኩላሩ ሰነበተች ስለሰጠ ሳዶን ስለቻሉ ሰፈራው ስለሚያስቀር ሲይዙት ስዊድናዊ ስለተነሳው ሲጎዳ ሲለውጥ ስልጣኖች ስነስርዓታቸው ሳይገነባ ሳይሰለቹ ስለሚወስደው ስናስገባ ሲሰቀዩ ሳይጠፉ ስለተወሰነ ሳያነጋግሩ ስዊድናዊው ሲፈናቀል ስልጣንም ሰዓታቸው ሲያውጅ ሲፈርሙ ሲለግሱ ስለመጀመሩ ስለሚደነግግ ስታተ ስፈልግ ሲኬድ ስለሚደርሰው ሲያደርጉና ሳይሸሽጉ ስስት ሲመዘኑ ስለተቃዋሚዎች ሲከተሉ ሲወረውር ሳዊሮስ ሳያማክሩ ስበሰባ ሳሊምና ሳይቀርብባቸው ሲፈርሱ ስራአጥ ሳይከሰሱ ሲገዙና ሰረገላ ስለመስማማታቸው ስታንድ ስለነበሩና ሳጥኔ ስማቸዉ ሰረዝ ስለሚያደርጋቸው ሰቆቃው ሲመልስለት ሰራተኖች ሲያጠቃልሉ ሳይገለጥ ሲሉዋቸው ሰንበትም ሴቲቱን ሲመረመሩ ሲካሄድበት ሳይዘገዩ ስሌቱ ሲያስረክብ ስለተናገሩት ሰንዴይ ሲከሱ ስትጠይቀው ስለድርጅታቸው ሰዎችስ ሰልችቶኛል ሲወዳደሩ ሰጪዎችም ሰአሊ ሴቷን ሲያሳድር ስለታወቀ ሲሸጋገሩ ሲቀጥልም ሲቀራቸው ሰፈራቸው ሲጠናከር ሲያፈናቅሉ ስንቶቻችን ሲሸጋገር ሲቆሙ ሳይጨነቁ ሲጽፉ ሲቀዳ ስትከሱት ሲፎክሩ ሲመዘዝ ስጦታዎችን ስለሞተ ስለኤችአይቪ ሲደርሰው ሳንቃ ሰምተሃል ሲኖዶስን ሲወነጃጀሉ ሲጠናቀቅና ሲሞላቸው ሲንቲያ ስለሚገኝበት ስላልነበረን ሲልቨር ሲያወርዱ ሰውነትን ሳንቴ ሲንከራተቱ ስታፍ ሲያቃጥል ስናጠና ሲያንቀሳቅሱ ስለመምጣቱ ሳይሰጣቸዉ ሰጥተናቸዋል ስትለኝ ስለሚፈለግ ሲሻቸው ሲደርስም ሲቀነስ ሳነብ ሲንከራተት ሲያስመዘግብ ሴኔጋልና ስለሰጣቸው ስርነቀል ሲጠቅስ ሲልክ ሲቪላዊ ሳይከፈልበት ስለሺህ ሳልጠቅስ ስለፍትህ ስለሚረዱ ስነስርዓቶች ሰገል ሲያንቀሳቅስ ስታስተዳድረው ሲለን ስትመጡ ስለተማሪዎቹ ሳናውቀው ስላለፈው ስሞታዎች ሰንሰለቱን ሲያረጋግጥ ስልካቸውን ሲያቀብሉ ስናወጣ ስለገባው ሲቆስል ሶፍትዌሮችን ሳይሰጡት ስጽፍ ሰእድ ስንሰማው ሲመሰርት ስለተካሄደው ሳይንቲስቶቹ ስልጡን ሲመጣም ሲሰበስቡ ሳይመደቡ ስብሰባዎቹን ሳቢሳ ሲጥር ሰሚት ስናወጣው ሳኒተሪ ሰርዓተ ሲመስሉ ሲያቀርቡት ሳጂን ስላመነበት ሰጥቶበት ሰብሳቢን ሰላሌ ስለፈጠረ ስትናወጥ ሲነጻጸሩ ሰሪ ሰጧት ሶፍትዌሮች ስጫወት ሲሰደድ ስትላቸው ስብስቡ ስለባ ሶማሌን ስለተወሰደው ሲመላለስ ስንጫወት ሲጠቃ ሲሰናዳ ሰገና ሲበጠብጡ ሲበደሉና ሲታከም ስኳሩ ሲቀየር ስለአየር ሲቋረጥ ሰጥታችኋል ሲያሰራ ስለሚሰሩ ሲጠግብ ስለፈለገ ሳይጠቀሙባቸው ሲያይል ሲተኛ ስለውሳኔው ስላልነበራቸው ሲያነታርክ ሳይግባቡ ሳያመሩ ስለኤፈርት ሲተኩ ሲርቲ ሲተነተን ሲያግዱ ሰይፉን ሲያሳልፉ ሰነፎች ሰዎ ሲጸልዩ ሲደመጡ ስለእሷ ሲወጡና ሲገልጹም ሲሞሉ ስለመያዛቸው ሳይራመድ ሳንወድ ሱሰኝነት ስለሚታዩ ሳይካተት ሰዓታችን ስለበዙ ሳራሶሮ ሳይፈጸም ሲያጠቃልሉም ስሜቴን ሲደረመስ ስለሌሉ ስለማይሰጣቸው ሲያወድም ሰይፈሥላሴ ሰጪዎችና ሲማረኩ ስንይዝ ሳትሰጥ ሳይገድበው ስጋን ሲመርቁ ስለአዲሱ ሶፍትዌሩን ሲመታቸውን ስላሰብኩ ስምዋ ሰራተኛውም ስለሚቻል ሳገኝ ሳይበግራቸው ሲያበረክት ሰማች ስላላገኘ ሳይበቁ ሲረባረቡ ሳይዞር ስለድርድሩ ስምምንት ስላላችሁ ሳይገጥመው ስሞችን ስለተጠረጠሩበት ሳይስማማ ሲወረወር ሲህዴድ ስብሰብ ሳላት ስትራክቸራል ስለመለስ ሱቆቹን ሳይታወቀው ሲያነብ ሲመገቡ ሴራውን ሲለ ሲገነዘቡ ስቅላት ሳይመርጡ ሳንርቅ ሲስተሙን ሲጫን ስለሚቀርበው ሲሸኙ ሰዎቻቸውን ሲያከራክር ስምንትሺ ሲጠፉ ስልኬን ሲቀርብለት ሲያሰላስሉ ስትከተል ሲቆፍሩት ሴቶቻችን ስለተሳናቸው ስለጉባኤው ሰማው ስለጀመረ ሲቀዘቅዝ ሰጠዋል ሲጠቆም ሰራዊቶች ስቶር ስሙም ስንገነባ ሰብረዋል ሲፈጸሙ ሲሰነዘርበት ሲሏት ስለችግሩ ሳንገባ ሲገደሉና ስነስርአቱ ሰብለወርቅ ስለመጠቀም ሳስስ ሰሃራን ስለሚመሰርቱት ስለሻዕቢያ ሲሻገሩ ሴቶቹን ሲያካሒድ ሶክራትስ ስትወዳደር ሳይታሰብበት ሲቀጣጠል ሳይጠራ ሲዘምቱ ሲያልቁ ሲያስጠነቅቅ ስታካሂድ ስለሚገኙና ሲታሰቡ ሲቀረፅ ሳይሞላቸው ሰውነቷን ሰልፈኛ ሰማሁኝ ስለቀረበ ሳይገልጡ ሳውንድ ስለሚውል ስጡም ስረዳ ስለቀረቡት ሳሊ ሳይነጋገሩ ሲያደርግና ሰፈርና ሰቅለው ስትፈጠር ሳሩ ሲያባርሩ ሰፈረ ሳይፈፅም ስለማይኖራቸው ሲስማማ ስደተኛና ሲረቀቅ ሲያሰቃይ ስለመከሰቱ ሰንደይ ሳይሰበሰብ ሴኩላር ስቶክ ስሙኝ ሲተከል ሳያጠናቅቁ ሳበ ሲደበድቡት ሲለመን ስላልን ሱስንዮስ ሲሰሩበት ሳይታዩ ስንነግራቸው ስለሰጠው ስላመነ ሰትራቴጂዎች ሲቆጣጠሩ ሲሰለፉ ሳይገኝበት ስንወስን ሲረከብ ሳይተላለፍ ሲፅፉ ሲመልስም ሲፅፍ ስለሚኖሩ ሰውተው ስለማናውቅ ሰማችሁ ሰልፋቸውን ስጋውን ሲያደርግላቸው ስለተረጋገጠበት ስልታን ሳታይ ስርአታችን ሳያመጣ ስታስተናግድ ሱዳንንና ስቷል ሲሰጠኝ ሰራተኛነት ሲታመሙ ሲያረጅ ሳቅና ሳቅን ሶስቴ ስኖር ሳይቀየሩ ሳታመነታ ሲራገፍ ሳይቀየር ስለሚጠበቅበት ሲጣደፍ ሰባኪያን ሲሟገቱ ስምህን ስለማይፈቅድ ሳያሻሽሉ ስለእሳቸው ሲያጋጥሟቸው ስለአገራቸው ስለነበርኩ ስቃኝ ሳያስረክቡ ሲጨዋወቱ ሲወተውት ሴልሺየስ ሲማጸኑ ስለሚኖርባቸው ሴትዬዋ ሲከፍል ሲገኙበት ስለጠቅላይ ስታስብ ሲወያይ ስቅስቅ ስቱዲዮው ሰባብረዋል ሲያሰራጭ ሲቀጠሩ ስለባድመ ስኬትም ሰጪነትና ሲያሳዩት ሲቀጠር ሲያስቀምጥ ሰልክ ሳይከፈት ስነስራት ስቴዲዮም ሳይከፋፈሉ ስለምታውቅ ስዕላዊ ሲቀሰቅስ ሲመሰክሩ ስቃዩ ስሞታና ሳለህ ሶሻሊስታዊ ሳይከፋፈል ስለተነገራቸው ሰውራ ስርዓቷን ሱሳን ስሱ ስለሀገር ስትልም ስጦታን ስህተቶቹ ሰውስ ሲሲአይ ሲሠቃይ ስቃ ስለተነገረው ስንጠቃ ሲያመቻቹ ሰባብረው ሰብለም ስሜትዋ ስንፈትሸው ሲያቀብጠኝ ስኖው ስለተባበሩት ስለሌሎች ሰንበቶ ሲጣል ሰጠህ ስለሚይዙ ሲገፈፍ ስንጣላ ስሌቶች ሰርቪስስ ሳይደርሳቸው ሲያጋልጡ ስታ ሲጠይቃት ስቲክ ስለሚያስቡ ስለሚታሰብ ሳልቫ ሳናነሳ ስለማይሰጥ";
            amharicWords[6, 6] = "ሲያራምዱት ሳይመዘገቡ ሰለባዎችን ሲገባት ሰርቲፊኬት ሲሰጡም ሳያጣራ ሳያዩ ሳይሰሩ ስለመኖራቸውም ስትኖር ሲራራ ሰጥቼ ሳይበርድ ስለመቻሉ ስላደረሰው ሲራመድ ሰውዬውም ሳያስሩ ሲነበብ ሰርቼ ሰርተናል ሲያሻቸው ስልጠናዎችም ስለተገኙ ሰብስቧል ሰቆቃና ስለማይገባው ስልጠናውም ሰማዕቱ ሳይጠፋ ስለአሰብ ሳያወጣ ስለነጻነት ስለኢትዮጵያና ስንክሳር ሲያቅታቸው ሰይሞ ሰብለና ሱፐርቫይዘሮች ሲሰጡት ስትራተጂካዊ ሰንቆ ሰፖርት ስውርና ሲገቡም ስትንቀሳቀስ ሲያዳምጥ ሳልገልጽ ሶጅያ ሳይኖራት ሰረዘ ሰረዙ ስለሚተላለፍ ሶሻሊዝምን ስለምንፈልግ ሲያብራራም ሰሞነ ሱዳናዊ ስደስት ሳይከበር ሳይፈፀም ሳይሳተፉ ስቅቅ ሰነዳችን ሲደውሉ ሲያሳስብ ሳይዘገይ ስለሚመስል ሳውድ ሰባኪዎች ሳይፈርስ ሲጓጓዙ ሲጽፍ ሲደበደቡ ሲበተን ሰሊጥን ሳይገባቸው ስንከታተል ስታቀርብ ሲቆጠር ሳይቃጠል ስለተደረገ ሰፈሩን ሳይመሽ ሲያቃጥሉ ስድስቱም ሶፍትዌሩ ሰርቢያ ሲያሳየን ሲያወጉ ሲዝናኑ ስለወሰደው ሲወጡም ሳያጠፉ ሲቀርብላቸው ሱስሎቭ ስምሪትና ስለሚደርስባቸው ስምሪቱ ሳይጀምር ሲሸልስ ስትባሉ ሲፈራረሙ ስለገንዘቡ ሲከታተሉት ሲያለቅስ ሲያስገባ ሲያስመርቅ ሰነዱም ሲመሽ ስለገንዘብ ሱሰኛ ስለማይጠበቅ ሲዘከር ሳይካፈል ስንሠራ ሲወሳ ስለሳቸው ሰማ ስብእና ሲሰደዱ ስምህ ሳያቋርጡ ሳያቋርጥ ሱናሚ ሲያሰባስብ ሶሎሞን ስለሚጠብቁ ሲከታተለው ስበብ ሲተዳደር ሰራተኞችንና ሲያቆም ስውሩ ሰለሆነም ሲያስተባብል ሲያሳልፍ ሲወገዱ ስለአጠቃላይ ሱሰኞች ስለምታምን ሴቶቹም ስላልሆንኩ ስበው ስታድዮም ሰንበትበት ስትራክቸር ስለሚጠቅም ሲያጠፋ ሲነጻጻር ስሜነህ ስታበቃ ሰብሳቢዋ ሲቀርብበት ስለራሳቸው ሴራው ሲፈቀድላቸው ሰማእት ስለማድረጋቸው ሳይደረግላቸው ስፖርተኞቹ ሳሚያ ስምነት ሲጠጣ ሳያሳዩ ስርዓታችን ሰንዓፌን ሰልጣኞችም ስለእኔ ሰብአዊነት ሱፍ ሲሆንና ስለድንበር ስያሜና ሰነዶችም ስያሜን ሴፍቲኔት ሳይደረግለት ሳይወሰኑ ሳይቆጥር ስለምናውቅ ሲና ሲጠይቁኝ ሲነግሩን ስርአተ ሰምቼያለሁ ሳይመለከት ሲሾም ሲዳሞ ሲያሻው ስንፈልግ ሲጠብቃቸው ሳሌህ ሲያፈርሱ ስለገቢ ስንጠይቃቸው ስታለቅስ ሳላ ሶላት ስእል ሳያረግቡ ሲዘገይ ስያሜው ሲተገበር ሲሔድ ሶማሊ ሳይሰጠን ሴትም ሲባልና ሳያደርገው ሲወስደው ሲሻሻል ስንኳ ስንጥር ሲገጥም ሲቃኝ ሲህን ስለተደረሰባቸው ሰክሮ ስለተፈጠረ ስለሚገደድ ስለነበርን ሲረከቡ ስሕተቱ ሰንዶች ስሜታዊነት ሳይደርስባቸው ስካውቶች ሱሉልታ ሶስትሺ ስለመሰላቸው ሲዋቀር ስለማልችል ሰክቶ ሰራተኝነት ስንሞክር ሳግ ሲሰበሰቡ ስለሚያስፈልገው ስለማይፈልጉ ስወርድ ሲመደቡ ስትነሳ ሲመደብ ሳለቅስ ስታስቲክስ ሲጨነቅ ሴቱ ሳቀና ሶሰት ሰዓትን ሲመዘገብ ስንቀበል ስላልነበረው ሴሎች ስሞኑን ሴትዮ ሰበቡ ስንጠቀም ሰማዕታቱን ስዕሎች ሰሪዎች ሳልሕ ሰልጥኖ ሰማይና ሲሰርቁ ስለእነዚህ ስንቶቹ ስንጽፍ ስልጣናት ስሞ ሲፈለጉ ሲዳማዎች ስትራቴጂዎችንና ስላማዊ ሳይርቁ ሲያጣጥሉ ሰጥቶኛል ሲሳነው ስላወቀ ስለማያገኙ ሰብሳቢዎቹ ሰባአዊ ሲከላከሉ ሰንበቱ ስትሄዱ ስላጋጠማቸው ሲተላለፉ ሲብስም ሳሳሁልህ ሲያቅተው ሳይደናገጡ ስሞክር ስለማትችል ሲዘፈን ሰብኣዊና ስትመራ ስለሆናችሁ ሲማቅቅ ሳይደናገጥ ሲኖዶሳዊ ሰጠሁት ሳያጣሩ ሰራዊትን ሳህለሥላሴ ስለደረሰባት ሳይቀንስ ሰርቄ ሰፍቷል ስላላደረገ ስጨርስ ሲንከባለል ሳይቀጥል ሶቅራጥስ ስባት ሲከተለው ስለሚያገኝ ሶል ሲሰናበቱ ስናደርገው ስብስባውን ሳለን ሲራመዱ ስለሚችሉበት ስለተቃዋሚ ሲጠናቀቁም ሲገባን ስታነሳ ስለሌላው ሲኖራት ሰለፍ ሲበትኑ ሳምባ ሳቁን ሳትወጣ ስለትምህርት ስላልተሰጠው ስንዴው ሴርኩላር ስለማንፈልግ ስቴትሷ ስንወያ