            amharicWords[6, 7] = "ሲያጓጉዙ ሳምሰንግ ስብስቦች ሲያበረክቱ ስክሪን ሲሠራበት ሳይመጣ ስምረት ሲላ ስድስቱን ስናነብ ሴክት ስለዝኾነ ሴሚስተር ስለተባሉ ሰብሰብ ሲያመራ ሲቀጥል ስጦታዎች ሲዳ ሳይዘጋ ስለመሆኑና ሰልማን ስናጤን ሲያትት ስብራት ስለሌለኝ ስለተረጋገጠ ሰብኣዊ ሰደው ሲመርጡ ስልታቸውን ሰሃራ ሲከፍሉ ሲቀሰቅሱ ሰበታ ስማችን ስነምግባርና ሰዎችንም ስብሰባቸው ስለማይታወቅ ስለሰው ሰጥቶበታል ስለማይኖረው ሲያወሩ ሳርናዬቭ ሴንቲግሬድ ስትገልፅ ሳይፈረድባቸው ስለመጽሐፉ ስጡ ስብሃትም ስማችንን ሲሯሯጡ ሲጠቃለል ሳይታለም ሲገጥመው ሲደርስበት ሳይፈልግ ሲነፃፀሩ ሴክሬታሪ ሳይሳካለት ስብሃቱ ስለታም ስርዓትም ሲፈቅድ ስላለብኝ ስዩምና ሳያደርሱ ስፔሻሊስት ስንጠብቅ ሰጣቸው ሰርተን ሰንዓፌ ስለሆንክ ስልኮችን ሰነዶቹ ስለሚሰጠው ሲዋረድ ሲያመለክቱ ስልትም ሳንዲ ሶማሌላንድ ሳይሞላ ስመለከተው ሲቃወም ሳይጠቀስ ሲያስተዳድር ሳይደርስበት ሲናፈስ ሲያዋጡ ሲተቹ ሰን ስለመሆኗ ስለኔ ሲጠቀም ሱራፌል ሲሸለሙ ስቴቨን ስጋትም ሲሞላ ሲወገድ ሶማሊላንድ ሰምታችሁ ስጋቱ ስልጤ ሲያጠፉ ሳይሞቱ ሲቃወሙት ሳይፈጠር ስድቦች ስመኝ ስራዎቻቸው ሲፈፀሙ ሲጉላሉ ሲብላላ ሶማሊያና ሲሆ ስትራቴጅዎች ሴትዮዋ ስተው ሲነግራቸው ሰልፎችና ሳይደርቅ ሰሞነኛ ስናቀርብ ስለገጠመው ሲሣይ ሱሌማን ስለሚል ሳይጠብቁ ሳንቼዝ ሲደረግበት ሰናይት ሰዎቻችን ስውርነት ሳቀ ስለፕሬስ ስትሰራ ስላደረገው ሳይጀመር ሲሮጥ ሰውነታችን ስላለመሆኑ ስለነሱ ሳይገልፅ ሳይሞላው ሴትን ሴም ሲሰበሰብ ሲያውቁ ሲዘጋጁ ሶማሊያውያንን ስንጀምር ስለተሰጠው ሰጥቷቸው ሲኖርበት ስለሄዱ ስለሚሆኑ ስተራቴጂዎች ሲያወራ ስለወደፊቱ ሳይሰሙ ሱንግ ሰነድን ስለአደጋው ስለወደፊት ስለመባሉ ሲነጋገር ስብከቱን ስዊዝ ስምንቱን ሲከፈል ሰካራም ሲታፈን ሳያሳውቅ ሳይፈልጉ ስለማውቅ ሲወረውሩ ሳይጠይቅ ስላጡ ሲያስተምሩ ስደተኞችም ሲድኒ ሰሞኑ ሲያስረክቡ ስለተገኘው ሲሰቃይ ስታዩ ስለራሳችን ሰሊጥና ሰንዓ ሲወድም ሰዉን ሲከፈላቸው ሲፋለሙ ሰጥቶናል ስለሚቆጠር ስትጠቀምበት ስፍራቸውን ስለሆኑት ሲጠቅሱ ሳይጀምሩ ስለድርጅቱ ሲያወጡ ሲያስገቡ ሰውነቷ ሳህሉ ስርዓቱም ስለሆኑና ሲቀጥሉም ስልቻ ሲገነቡ ሲታከሙ ስትመልስ ስታዲየሙ ስንናገር ሲደረግባቸው ሰነበቱ ስለሚባረሩት ስቅለት ሲሰራጭ ስለሚለው ስለሚባል ሲደክም ሳይያዝ ሳይበቃ ስለሚገኘው ሰቅሎ ስታስታውቅ ሳይለዩ ሰራዊትም ሲሾሙ ስለተያዘ ሳላድ ሶማሊኛ ስወጣ ስንቴ ሰጥቱዋል ስለሚደረግ ሳል ሳም ሲሰነዝር ሶላና ሲያባርር ስራዎችንና ሳይሟላ ሲቀሩት ሲሞከር ሰራዎች ሳታውቅ ስጡን ስጡኝ ስለመደረጉ ሰርቀው ስላጋጠመው ሴል ስለሆነው ሲያውቅ ሳምንቱ ሲንገላቱ ሰራዊታችንን ሳያልፍ ስረዓት ሰንጥቆ ሲኖዳ ስፋቱ ሲገዙ ስንዴውን ስቶክሆልም ሲላክ ስፍራቸው ሰብልን ስቲግሊትዝ ሲዳረግ ስትገልጽ ሲያዘዋውሩ ስላት ስለአገሪቱ ሰልጣኞቹም ሲከፍት ስለሙስና ስዊቾች ስርአቶች ሳንሱር ስጦታውን ሶማልያውያን ስፖንሰርነት ሲያወግዙ ስኬትን ስለማያውቅ ሲጮሁ ሴክሪታሪያት ሳይነሱ ሰመጉ ሶሕዴፓ ስለአገራችን ስለሚታወቅ ሲጠይቃቸው ሰርዞ ስልካቸው ሰነዶቹን ስለአንድ ሳይጠበቅ ሲፈሩ ስንታገል ስለወያኔ ሲመሩት ሰባትን ሲዘረዝር ሲቪሉ ስመኘው ሰራተኛውና ሳሎን ስቴትን ሲተባበሩ ስትቀበለው ሲሰፍን ስለሞት ስለውጊያው ሲኞር ሲለቅ ስራዬ ስካይፕ ሳተላይቶች ሳይቀበሉ ሳሊህ ስንችል ስርዓታቸውን ሲዘግቡ ሳይከናወን ስፍራና ሳይገናኙ ሲፈፀምባቸው ሲበረበር ስብሃትን ሰርቪሱን ሳይቀበር ሲገነባ ስለሚጠይቅ ሲያድር ሰቡ ሳይለቅ ሲያስተባብሉ ስድስትና ሳይከፈልባቸው ሰባራ ሰውነቱን ሲጋራውን ሰማዩን ሲተካ ሲወር