            amharicWords[6, 8] = "ስለመጣ ሲያወጣ ሲዘግብ ሰምተናል ስኳድሮን ሶማሌዎች ስልትና ስልትን ስርአቱ ሰፈሩ ሲያገለግል ሰርተዋል ሲመሰረት ስፍራዎችን ስልጠናም ስለማይቀር ሱፐር ሲያከናውኑ ሲጫወት ሲያጠናቅቅ ስሰማ ሰማያት ስለወቅቱ ሲያጣ ስመለስ ሲለው ሲቃወሙ ሲወስዱ ሴካፋ ስልጠናቸውን ስዬና ስርአቱን ስብሰባቸውን ሳይረጋገጥ ስላደረጉት ሱዱን ስንቱ ሲያልቅ ስንብት ስዎች ሲፈጥሩ ሰራተኛና ሲቆጣጠር ሳይገልፁ ሴተኛ ሰውም ስማ ስለሚቻልበት ሰፊውን ስትራቴጅ ስቶ ስምንተኛው ስንቅና ሲያልፉ ሰጠኝ ሲንጋፖር ሰ ሴክሬታሪያት ሰንጋ ሲከራከር ሳይውል ሳይቀበሉት ሲጥሩ ስርአትን ሰም ሲጠራ ስትሉ ስርዓትና ሲነሣ ስቴቶች ሳይባል ስጠኝ ስላልቻሉ ሳስብ ስርቆት ስለጦርነቱ ሲያብራራ ስፖርቱን ሳይወጡ ስላለን ሲኒማ ሲሰላ ሶፍት ሰቦቃ ስኬል ስለታመነበት ስትራተጂ ስንገባ ሰጡት ሰማያዊ ስሜን ሲውሉ ሱፍያን ሲሰጣቸው ሳይፈታ ሳየው ስለነበራቸው ሳልሆን ሰዓቱን ሰውነታቸውን ስለው ስፔስ ሳይለይ ሰላምንና ሰኢድ ሰጥተውበታል ስለሁለቱ ሰብለወንጌል ስኳርና ሲያበቁ ስፍራውን ስምምነቶችና ሴራሊዮን ስለበሽታው ሰርግ ስሜቶች ስለሆንኩ ስናደርግ ሰላሣ ሲሳተፉ ሳቢያም ስኬታማነትም ሲያትል ሰሜንና ስለተባለ ሲኖራቸው ስለደረሰበት ሰፍኗል ስሜትም ሲያካሄዱ ሳን ስለሚያስፈልግ ሴትና ሲዘጋጅ ሲደረግላቸው ስታገኝ ስልቱን ሲያስታውቁ ሲደመር ስላለብን ስደተኞቹን ሲዘዋወሩ ስሜቱ ሲሰማሩ ሳንካ ሲያስቡ ሳህል ሰነፍ ሲያብራሩም ስለተከሰተው ሶማሌና ስብስባ ሲጠቀሙ ሶስቱን ሰጥተውታል ሳንሆን ሲወሰዱ ሲገናኙ ሲገመት ሳይደረግበት ስነስርአት ሰባቱን ሳሚ ሲሸጡ ስለሌለን ሲያሳይ ሲመልስ ስለሌለበት ስስ ሲተላለፍ ሳስበው ስንዴና ስሪት ሲገለጥ ሰቆጣ ሲጠብቅ ሲከናወኑ ሴናተር ስልጣኑ ሳይከፍሉ ሲጠበቁ ሲፈቱ ሲያሸንፉ ስሜታቸው ሲነፃፀርም ስትራቴጂዎችና ሲያዙ ሲወድቅ ሲያለቅሱ ስቱዲዮ ሳይቻል ሰርዓት ሳዳም ስህተቱን ሱሪ ሲዘገብ ስለሚችለው ሲሞን ሲም ስጋትና ስመጣ ሶሪያ ሲቀመጡ ሲጠቁሙ ስትመለስ ሰመራ ሲዳረጉ ስንነጋገር ስድስተኛው ሲፀድቅ ስለሚያውቅ ሳያድር ሲቪሎችን ሳምትን ስሜታዊ ሰፋሪዎቹ ሳይነካ ሲመክር ስንመለስ ሲያዝ ሳይሰጣቸው ሰባተኛው ስለላ ሳይጠናቀቅ ሳይፈቱ ሰር ሳይወስድ ሱዳናውያን ሰንበትን ስርዓቶችን ስለሚደረገው ሲጠናቀቅም ሰጥቷቸዋል ስቴዲየም ሰንዝሯል ሳይጠብቅ ሳምንቱን ስለማንችል ሳይመለስ ስቶን ሲፈልግ ሲያጋጥም ሳይወድ ሲሰጠው ስለምን ስዊች ሳይጨርሱ ሲማቅቁ ስጦታው ሲመረጡ ስለሚኖራቸው ሲቀሩ ሲደርስባቸው ሰጥተውት ሲገልፁም ስራችን ሴኩሪቲ ሰጥቶት ስለሆንን ሲያስተዳድሩ ሲጠቀሙበት ሳይቀርብ ሲያነጋግሩ ሲያሰማ ስልኩ ስትራቴጂያዊ ሰማዕታትን ስግብግብ ሲሚንቶን ሳይደርሱ ሰጥቶታል ሳይስማሙ ሱዳንም ሲሰነዝሩ ስሄድ ስለሚገባ ሲጃራ ሰራተኞቹን ሳላዲን ሰዓትና ስለኤርትራ ሰርቪሱ ሳይጠቅስ ሰብልና ሲጣሉ ስቦ ሰብሳቢዎች ስለመኖራቸው ሴንቲ ስንዴን ሳያስፈልግ ሰጪና ሰብዕና ስለሚያደርግ ሰወች ስጥ ሱቆችና ሲያደርስ ስትናገር ስንቱን ስላጣ ሰዓቱ ሲገድሉ ሳርና ሲፈታ ስርዐት ሲወዳደር ሲዘዋወር ሰንዝረው ሲለወጥ ሳንባ ሶፍያን ስለተባሉት ሳይቆዩ ስልጠናዎችና ሰይፍ ሲመታ ሲፈፅም ሲያነጋግር ሳይመጡ ሲታሰሩ ሰፍረዋል ሰጭው ስሞች ሰርካለም ሲአን ሳቁ ስብሠባ ሲፈጥር ስትደርስ ሳይገልጽ ሰማኒያ ስለሚሄድ ስለሌላት ስንመጣ ሰሌዳው ሲጠባበቁ ሲጠባበቅ ሳይናገሩ ሴሜናር ስላለኝ ሰምታ ስታቲስቲክስ ስትሄድ ሰነድና ሰርቆ ሲያጋጥማቸው ስለአለው ሳይኾን ሲቃረብ ስፖርቱ ሰፈሮች ስሆን ስለተገኘ ሳይነሳ ስለማይኖር ሰጠው ሲቀንስ ስንደርስ ሰልጣኝ ስታይ ስንሰማ ሳላውቅ ሲመለከቱት ሱባዔ ሶስቱም ሲወድቁ ሳይሰጥበት ሲተመን ስፔሻላይዝድ ሰውነቴ ሲያስተላልፉ ሰርኩላሩ ሲጠሩ ሲያስተላልፍ ሰንብተው ሴትየዋ ስምም ሰራዊታቸው ስብሰባዎችና ስንሄድ ስንሻው ሲፈጽም ስትቀበል ሰጥተዋቸው ሱር ስምን ሱዳናዊያን ሴኔጋል ሲባልም ሲረዳ ሳይክል ሲፈጸም ስትታመስ ስብሰባውም ሲቀበል ስለሚያደርጉት ሰጥተናል ስለሚካሄደው ሶቭየት ሲመረምር ስለሚገቡ ስለቀረበው ሲያስረዱም ስለምርጫ ሲጨምር ስመለከት ሲያሳዩ ሰራሽና ስቴትስን ስለደረሰ ስደተኛው ሲፈጠሩ ሶሻል ሰጥቻለሁ ስዊቹ ሲስቅ ሲቸገሩ ሳይሰማ ስለነበሩት ሳይገቡ ስኳርን ሴኩቱሬ ሳይንት ሳለች ሰምተን ሲያደርገው ሰዓሊ ሳያውቀው ሳይጠይቁ ሲፈስ ሲፈርስ ሲያስተምር ስለተደረሰበት ስለሚፈጥር ሰይጣንን ሳጥኖች ሰነዘሩ ሲበሉ ሰዎችንና ስለደረሰባቸው ሲወስኑ ሰለቸኝ ሲጎበኙ ሳይቀበል ስጥቷል ሲኖሩት ሲጠቀምበት ስንቅነሽ ስናስብ ሳዳት ሰብሉን ሱሶች ሰጥ ስለምርጫው ሰንዝሮ ሶማሌያ ሳሪስ ሰውራዊ ሲላቸው ሰዐት ስደትና ስምጥ ሲቃ ስጋትን ሲጨርስ ስንጠይቅ ሶፎንያስ ስራችንን ስሚንቶ ሳይገልጹ ሲኦል ስደተኞችና ስላሉበት ሰላጤው ሳይኖርበት ሲመርጥ ሶማልያ ሶስትና ስለሄደ ሶሳይቲ ሲለያዩ ስልክና ሰተት ስድ ሲደግፉ ሳያቀርቡ ሳያቀርብ ሱቆችን ሰጠን ሲጮህ ስማኝ ሲዋጋ ሳምንትም ሳይቋረጥ ሰንካላ ስራውም ሲጓጓዝ ሳይመሠረትባቸው ሲለቀቁ ሴፕቴምበር ስኩየር ሲለቁ ሲያስቆጥር ስቴፈን ሲልኩ ስህተትን ሲለኝ ሲያመለክት ስናገር ሰውዬውን ሰርኩላር ሳንጃ ስለሚገኙበት ሲምፖዚየሙ ሳታገኝ ሲረታ ሰነበተ ሰላምም ሲያራምዱ ሲኾን ሳንወጣ ሲገመገም ስኬቶችን ሲፈተሽ ሳይቶች ሲዲ ሲታሰብ ስራዎቹን ሲያድግ ሱማሊያን ስትገባ ስለነበርና ሴኔቱ ሴይንት ሳያበቃ ሳይወዱ ሴሮ ሲዘርፉ ሰበር ሰጥተዋቸዋል ሲከሰቱ ሲያስተጋቡ ስረዛው ሲኖዶሶች ስነምግባርን ሰጠሁ ስጋቶች ሲጣራ ሴንት ሰላማዊው ሳያይ ሳያሳውቁ ስለመሆኑም ስታትስቲክስ ስላዩ ሳይመሰረትባቸው ስላልሆኑ ስትሰጥ ሲያካሂዱት ሰርዶ ሲያማርሩ ሲደፈር ስንመለከተው ሰዓቶች ሳይሄድ ሲቆም ሳያደርስ ሰቅጣጭ ሲቀጣ ሲያጠና ስለሚፈልግ ስለመጡ ሴኩላሪዝም ስጥተዋል ሲያረጋግጡ ሳይውሉ ስትፈልግ ስትመጣ ሲቆስሉ ስታዲየምና ሰውየውን ስለሱ ሳይዝ ስቴፋን ስኬቶች ሰይሟል ሲተች ሳይከተል ስላገኙ ስለሚጠበቅ ስላልተቻለ ሳይወስዱ ሰዋገኝ ሴክተሩን ስለእሱ ሳያልቅ ሲጠቀስ ሰንደቁ ሶፊያ ሰሜናዊት ሲሉኝ ስኮት ሲሚንቶና ስለብሔራዊ ሲወሰድ ሲጠጡ ሰርከስ ሱማሌዎች ሲሲ ስትራቴጅክ ሲዘጉ ስላልነበር ሲመሠረት ሲመረቅ ስለአቶ ሲያካሄድ ስለአፍሪካ ሲያስተባብሩ ስለተፈፀመው ስንዱ ሲቀመጥ ስነድ ሲገልጥ ሲአርቢሲ ስለሰላም ሰብላቸው ሲገዛ ሳንቲሞች ስላቸው ስገባ ስናከብር ስፔሻሊቲ ሲስቁ ሳይጨርስ ሰብሎችና ስለስብሰባው ሰነባብቷል ስንሆን ሲያደርሱ ስህተታቸውን ሰውየ ስለሚያደርገው ስንወጣ ሲመዘን ስደርስ ሲሰነዘር ስለሆነባቸው ሴክተሩ ስድብና ሳይሄዱ ሳዲቅ ሳምንታዊው ሳይገለጽ ሰላማችን ስለሚፈልጉ ሲመክሩ ሲበቃ ስላሉን ሳይሳካልን ሳይከሰት ሲለካ ሳህሌ ሲያሰባስቡ ሲኖዶሱን ስንዝር ስትሞክር ሰነ ስንኖር ሰሞኑንም ስትጀምር ስለማይሆን ሲመንስ ሲያራምድ ሲያነሱ ሲቃጠል ስለሚገኙት";
            amharicWords[6, 9] = "ሰ ሲሆን ስራ ሰዎች ሲሉ ሲል ስብሰባ ሰው ሰዓት ሳይሆን ስምምነት ስር ሰኔ ሰላም ሳምንት ሰሞኑን ስም ሴቶች ስልጠና ስለ ስራዎች ስርዓት ስድስት ሰፊ ስለዚህ ሰላማዊ ሱዳን ስለሆነ ሶስት ሳቢያ ሲሆኑ ሰለ ሰባት ስሜት ሰልፍ ሰራተኞች ስጋት ስምንት ሰኞ ሴት ስልጣን ሰጥተዋል ስዩም ሰራዊት ሰነድ ሰላምና ሰጥቶ ሶማሊያ ስደተኞች ሰዎችን ሲባል ስራዎችን ስዬ ስነ ስልት ስፖርት ስህተት ሰብዓዊ ስብሰባው ሰለሞን ሰጥቷል ሰጪ ስልክ ሰብሳቢ ስትራቴጂ ሰጠ ስቴትስ ሲነፃፀር ስርጭት ሲናገሩ ስፍራ ሰበብ ሲካሄድ ስብሰባውን ሲቪል ሰብአዊ ስላለው ሲታይ ስማቸው ሲመልሱ ሳምንታት ሳለ ስለሆነም ስምምነቱ ሲታወቅ ሰርቪስ ሰላምን ሰሜን ሰጥተው ሴቶችን ስለነበር ስትል ስራውን ስራው ሲሉም ሳይቀር ሳይንስ ስምምነቱን ስያሜ ሰለባ ሲያደርጉ ሰጪዎች ስልጠናው ስለዚህም ሲጠናቀቅ ሰንደቅ ሲደረግ ሳይሆኑ ስቃይ ስለጉዳዩ ሲያደርግ ሲሳይ ሰሞን ስምኦን ሰብል ስብሰባዎች ሰብለ ስኳር ሴራ ስርአት ሲሰጥ ሴክተር ስንዴ ሰዓታት ስምምነቶች ሲገልፁ ስታዲየም ሶስተኛ ስለመሆኑ ስፋት ስሙ ሲሰሩ ሲገቡ ሰፋ ሲደርስ ሰነዶች ሲሰጡ ስል ስኬታማ ሰራተኛ ሰብሎች ሰሌዳ ሲመለሱ ሰጡ ሲልም ሲጀመር ሲሚንቶ ሴቶችና ስርዓቱ ስነስርዓት ስለሚችል ሶማሊያን ሲገባ ስለነበረ ሲመጣ ሲወጡ ስልጠናዎች ሰነዱ ስብከት ስርዓትን ሲነጻጸር ሰሎሜ ስለሆኑ ሰፈር ስደተኞችን ሶማሌ ሰአት ሰሚ ስትሆን ስንል ሴኮንድ ሲከፍቱ ሳንቲም ሰውን ስማቸውን ስንት ሲኖዶስ ሲገባው ሲጀምሩ ስትራቴጂዎች ሳሊም ሰዎችም ሲሄዱ ስራቸውን ሲንቀሳቀሱ ሳምሶን ሰራዊቱ ስለሺ ስላለ ስደት ሰራሽ ሳያገኝ ሶስቱ ስርዓቱን ሱዳንን ሰይድ ስፍራዎች ስኬት ሲጀምር ሰንዝረዋል ስኬታማነት ስራን ሲነገር ሲሄድ ስጦታ ስራና ሳሙኤል ስጋ ሰራተኞችን ሲሞክሩ ሳይቀሩ ስምና ሰማይ ሰውነት ሰላማዊና ሲወጣ ሰገድ ስለሁኔታው ሱቆች ስልቶች ስራቸው ሲደርሱ ሰብሳቢነት ሱዳንና ሰብሎችን ሲጠበቅ ስልጠናዎችን ሰጪዎቹ ሰናይ ስደተኛ ሰልፉ ሰዎቹ ስላላቸው ስንቅ ሲሰራ ስፍራው ሰጭ ስልጠናውን ሳዑዲ ሲያገለግሉ ሲገልፅ ስምምነቶችን ሰይፉ ሲንቀሳቀስ ስርጭትን ሰብስበው ሰበሰበ ሰራተኞችና ሱዛን ሲሞቱ ሲያቀርቡ ስምዖን ሰላሳ ሲገባቸው ሰልጣኞች ሰባተኛ ስለሌለ ሲኖር ሰዎችና ስጋታቸውን ሲያካሂድ ስረዛ ስሙን ሲናገር ሲጋራ ሲነሳ ስሞታ ሱማሊያ ስላሴ ሰውዬው ስውር ሰነዱን ስላልሆነ ስፖርትና ስላሉ ሳዶ ሲያብራሩ ሰራተኛው ሳይሳካ ሲመጡ ሳዋ ሰሜናዊ ስቴት ሲከበር ሲምፖዚየም ስለነበሩ ሰርቶ ሰላምታ ስለዚሁ ስደተኞቹ ሲገኝ ሰውዬ ስህተቶች ሰነዶችን ሲገለፅ ሳይሰጥ ስብስብ ስንታየሁ ሰባ ሲኖሩ ስለመሆናቸው ሳይጨምር ስራም ሶስተኛው ሲያቀርብ ሶማሊያውያን ሳያገኙ ሳር ሲጠይቁ ስብሀት ሲቻል ሰንብቷል ስላለበት ሰባቱ ሲጠየቁ ስድስተኛ ሲከታተሉ ሳይንስና ሰብለን ስልጣናቸውን ስለሚሆን ሳህኑን ስለነበረው ሳይኖር ስምሪት ሰብስቦ ስነምግባር ሶህዴፓ ሲገልጽ ሲመለስ ስርጭቱ ስትራቴጂዎችን ሳይታወቅ ስብከቱ ሱቅ ሰብሳቢው ሲገልጹ ሲያስረዱ ሲቀርብ ሰይጣን ስልቶችን ሰራዊታችን ስለተባለው ስትራቴጂክ ሲስተም ስለሌለው ሳይንቲስቶች ሰፍኖ ስለሌላቸው ስትራቴጂካዊ ሰልፉን ሲገኙ ስብሐት ስልጠናና ሰምተው ሰማዕታት ሰቆቃ ስቴይትስ ሲመሩ ስድስቱ ስሜትና ሱልጣን ስብሃት ስለመኖሩ ሲፈጠር ስለኢትዮጵያ ሲታገሉ ሲያገኝ ሲነሱ ስሌት ሰጭዎች ሰውየው ሳባ ስታደርግ ሲቪክ ሰከንድ ሳላህ ሰላጤ ሰሎሞን ሰራተኞቹ ሳሞራ ሳይደርስ ሰለባዎች ስንመለከት ሲ ሰፊና ሲቪሎች ስትራቴጂን ሲያሰሙ ስብሰባዎችን ሲሞት ሳይንሳዊ ሶዶ ስርዓቶች ስዊድን ሲያከናውን ስድብ ሲሞክ