            amharicWords[7, 0] = "ማስቀመጥ ማስታወቁን ማሕበረሰብ ማከማቻ ምርጫዎች መራጮች ማበረታቻ ምርምርና ምርታቸውን ምስክሮችን ማድረግና ማዳበር ሙሐመድ መድረሳቸው ሞሐመድ ሞተ ሙዚየም መረጃና መቅረቱ መመለሱን መስህቦች መጠኑ ምሁራንና መርሐ መሰረቱ መመዝገባቸውን ማስፈራራት መዳረጋቸውን ምዝበራ ማህበሩን ማዳን ሚኒስቴርን ማሪያም መጉላላት ማቴዎስ መደምደሚያ መሰብሰቢያ መጨመሩን ማሰራጫ መቁሰላቸውን መጽሔቱ መጋራት ምርኮኛ መቅረት መምጣቱንና መስፈርቶች መለኪያ መዳረሻ መገኛ ሞባይል ማንንም ማዕከላትን መምረጥ ማመንጨት መከሰት መግለፁን መስተንግዶ መብታችን መግለጫም ማሩ መስዋዕት ማንን መክፈት መፍጠሩ መመለሱ መለያየት ሞገሴ መነጋገራቸውን መቻላቸው መወሰናቸውን ምሽቱ መቸ መብራቱ ማበርከት መሬቶችን መታሰራቸው መባረራቸውን መሄዳቸውን መስፍንና መቅረታቸውን መሰራት ምርቶቻቸውን ማስተዋወቅ መስተዳደሩ መስህብ መሸፈኑን ማረጋገጡን መጠቆማቸውን መክረዋል መከሰቱን መብታችንን መርዳት ምሁሩ መታወክ ማውጣቱን መዋላቸው ማፋጠን ማብራርያ መሠረትም መደረጋቸው መግደል መሰናዶ መሆኔን ሙገር ሙሴ መብቶችና መመሥረት ማመን መግለጹን ማእከል ማስገንዘባቸውን መገለጹ ማጠራቀሚያ መመሪያውን ማዋሉን መዘግየት ሙጋቤ መሬታችንን መቃወም ማራመድ መሄዱ መሠረቱ መወሰዳቸውን መፈናቀል መዝሙር ማቆሚያ መረጠ ማካሄዳቸውን ማሽኖች ምርኮኞችን መፈንቅለ መደራደር ምእራፍ መጓተት መግንስት ምልመላ ምፅዋ መረጃውን ማሠልጠኛ ማስተላለፉን መቀራረብ ሚኒስተር ማግኘቷን መብላት ማመልከቱን ማድረጓን መሬትና ማርቲን መታየቱ መቋቋሙ መደራጀት መላውን መነሳቱን መሪነቱን ሚስቴ መከናወናቸው መንደሮችን መቀመጫዎች ምክንያቶችን መናኸሪያ መ ሚንስትሩ መመዝገብ መግለጻቸው ማስፈን መካለሉ ምስጋናቸውን ማካለሉን ማስተር መስተካከል መናር ምስክሩ መድፈር ማህሌት መሰብሰቡ መተላለፊያ ማለፉ ማስወጣት መጠባበቂያ መፈጸም መሳሪያዎችና ማዘዣ ምኑ መመደቡ መነሻው መተባበር መጠንቀቅ ሚደቅሳ ሙስሊሙ መገደዱን መሳይ ማህበርና መቁረጥ መኮ መርዶ መግለጫዎችን ምታት ማስተማሩ መገባደጃ ሞቶ ሞኝ መቀነሱ ሞይ ማሰማት ሞተር ማድረጉንም መከፈት መንግሥታትን መመዝገቡ መከሰቱ መነሳታቸውን ማሽን መቋጫ መካለል ምሕረት መዋሉ መፈክሮች ሜዳው መተው ማዕድናት መንገድን መስሪያቤቶች መምጣቱንም ማዕከልና ማንነታቸውን መከፋፈሉን መሪና መፈፀሙ ማቅለያ መነጋገሪያ ማስተዳደር ማዳበሪያና መስተዳድርና ማስተካከል መፈፀማቸውን መውሰዱ ማሰር መላካቸውን መጣር መተላለፉን መፍቻ ሚናቸውን መጭው መብዛት መነኮሳት መመገብ ማስተላለፊያ መስራችና ሚስጥር መውደቁን መሰራቱን መልሱን ሜዲካል መነሳቱ ማረጋጋት";
            amharicWords[7, 1] = "ሾፌሩም ሹሚ ሸሂድ ሸመና ሽንጣቸው ሽፋኑንም ሻንጣና ሾመች ሸቀጦቹን ሻሻመኔ ሹሞ ሸክሙን ሸጠ ሽጉጥና ሸሪያ ሽብርተኝነትም ሽርም ሽብረተኝነትን ሽጉጤን ሻርኮች ሸጠሽ ሽመላቸውንና ሼልና ሽብርተኝነትንና ሽተው ሸዋፈራው ሸጪ ሻሚስ ሸዋንዳኝ ሹምሽሩ ሹሩቤዎች ሸፍቷል ሽፍታው ሽሮና ሾጥ ሸለቆዎችን ሽለላ ሽሮታል ሽንጧን ሸቀጦቻቸው ሽንኮር ሸርዐ ሸጣለች ሼኩ ሽሻዎች ሸቢይ ሽማግሌና ሽርክ ሸፋራዶነ ሹማምንቱን ሻሂ ሽግሽጉ ሽኑዋ ሻህ ሸፋን ሻላ ሽመልባ ሼሪፍ ሻሌ ሻርም";
            amharicWords[7, 2] = "ሻመና ሼርማን ሸዋሮቢትና ሻጩ ሸሽተን ሸልሞ ሻምፒዮንነት ሸኘኋቸው ሸማቾቹ ሽንቱን ሸንተረሩን ሻምፒዮኗ ሽማግሌዎችም ሾፌሮችን ሸለቆን ሹካና ሾመው ሻዕቢያስ ሽል ሽንኩርቱንና ሺኅ ሸርተት ሸርና ሽፈራሁ ሻቢያና ሸርሙጣ ሺናሻ ሺንን ሽምቅቅ ሽም ሸክፈው ሺፈር ሸዋለም ሸንዲ ሻንቆን ሽልማቶችና ሹምነቱ ሺጭላት ሸሪፊ ሺዎችን ሹመኞቹን ሹፌርና ሾፌሩና ሽረው ሻምፒዮናም ሹኮች ሽጧል ሾፌሩን ሼበ ሸሚዙን ሽፍቶችና ሽሻ ሸንቁጥ ሽሽ ሽግግሩን ሸንቃጣ ሻ ሸር ሾፌርና ሸማቾችና ሸክላ ሽብርተኝነትና ሼሪንግ ሽጥ ሻኛ ሻንጋይ ሻንጣዎች ሸንጎውን ሸምጋዮችን ሽግሽግን ሹለር ሽፍንፍን ሸንተረር";
            amharicWords[7, 3] = "ሻእቢያን ሻቬዝን ሹክሹክታ ሽሯል ሸኝተዋቸዋል ሺሻዎች ሽሪፍ ሽንፈቶች ሽግግሮች ሽፕ ሽጉጥም ሸርቆሌ ሸጠናል ሽፋራዶነ ሻወር ሽራሮንና ሼኹ ሻእቢያዎች ሻዕቢያንና ሻንጣዋን ሽያጩም ሻንታ ሾተል ሾፑ ሻምበሉን ሻንዲ ሸፋራዶን ሽሙጡን ሹመኞቹ ሽክም ሸምቶ ሻምባል ሸካራና ሻንጉል ሻሪፍ ሸርት ሹፌሮቹ ሽማግሌዎችንና ሻምፒዮኖቹ ሼኼዎችን ሽለላው ሻርክ ሺአንሰተኛና ሸረሪት ሺሞን ሼረን ሸክማቸው ሸክማቸውን ሹማምንትም ሽላሎና ሽጠዉ ሻይረስና ሽልብ ሾፌሮቹ ሾጣጣ ሸሽቼ ሸምገል ሽብርተኞችና ሹማምንትንም ሽመቶችን ሽለላና ሽዑ ሸርሽሮ ሻምፒየንስ ሼልፍ ሺኩንታል";
            amharicWords[7, 4] = "ሸበሌን ሸፋፍኖ ሻምፒዮኑ ሺሕዎች ሽብቁ ሻሼ ሻዓቢያን ሻሽ ሻካራ ሸሪፍና ሼሕ ሸጋው ሽጠው ሻራፍ ሽምጥጥ ሸለብ ሽፋና ሸፈተ ሻንቅላ ሸክፎ ሽወዳ ሹፌሮችን ሽምግልናው ሽብሮች ሹመቶች ሽንትና ሸዋቀና ሽድሽተ ሹገር ሸሽጎ ሽንቷን ሻንጣዬን ሻፊ ሹዋን ሾሟቸው ሽንታም ሽግር ሽንታቸውን ሽፈራዉ ሸኘው ሸገሮች ሼከና ሸፈን ሽክርክሪት ሼ ሽ ሸልመዋል ሽበታቸው ሾሞ ሽብርተኛነትን ሸካራ ሹል ሹማምንቶችም ሽፍቶችን ሸለሙ ሸንገታ ሽፋራዶነም ሽያጫቸው ሹሞችን ሽልንግ ሸማቹን ሽባባው ሽርጉድና ሽኩቻው ሻጭና ሽምብራና ሸጡ ሽጉጣቸውን ሽፍጥ ሽሮሜዳ ሸማቹም";
            amharicWords[7, 5] = "ሺኒሌ ሸፍቶ ሻዕቢያው ሸጠዋል ሺራሮ ሽብርተኛነት ሺራክ ሸማኔ ሸሽገው ሸልመው ሹፈት ሸኸ ሸምቀቆ ሸቀጦቹ ሸሽቷል ሸዋዬ ሽንሽን ሽርሽር ሽታየ ሽመላሽ ሽቦዎች ሻዕቢያዎችን ሸዋበር ሺብር ሸመታ ሽራም ሺዎቹ ሹፌሩን ሾህ ሸምሱ ሽግግሩና ሹመቶችንና ሺዓዎች ሽፍን ሸዋፈራሁ ሸሚዝ ሹምነት ሼባ ሻንጣውን ሻንጣው ሽልማትም ሾሟል ሸማቾችን ሻምፒዮንነቱን ሽርና ሾፌሮችም ሸጣ ሽሮደር ሸሪኮች ሻረው ሽቱ ሺራም ሺዴ ሽምግልናውን ሽራፊ ሸኝቷል ሼኸ ሾመዋቸው ሸምዴን ሸቀጣሸቀጥ ሽጉጡ ሸላሚ ሹመው ሹሻን ሸምበላላ ሸዋው ሻጭነት ሽፈራውን ሹታ ሸቀጣቸው ሸበጥ ሾምዋቸው ሸገራብ ሽታው ሽሪንክ ሽዕቢያ";
            amharicWords[7, 6] = "ሸክሙ ሸፋራዶነም ሻምፒዮናውን ሻዕቢያንም ሽመና ሸኖ ሸምጋዮቹ ሾኔ ሹምና ሸለቆው ሻይረሱ ሺፒንግ ሸዋንግዛው ሻይረስ ሸቀጣሸቀጦችን ሺፕ ሻውልና ሸህ ሽሩ ሺሰማ ሻይና ሺውን ሸሪኮቻቸው ሸማቂዎችን ሹሞችና ሸሸቢት ሹመትን ሽራሮና ሽፋኑም ሸጬ ሸንኮራ ሽኩቻና ሹምሽር ሹመትም ሻንጣቸውን ሽርጥ ሽሩደር ሻሎም ሸማኔው ሻጮችና ሻዓቢያ ሻኪሶ ሻሾ ሻሸመኔና ሺፋ ሽበታሙ ሽግራት ሸልሟል ሸለቆና ሻምበሎች ሽማግሌዎቹና ሾመዋል ሹልክ ሽጉጦች ሸጠን ሻባብ ሸሂቦ ሸሪፎ ሸ ሾመ ሻምፒዮናና ሸዋን ሽርፍራፊ ሽዋየ ሸሸ ሼፍ ሸፍተው ሹሜ ሹሙን ሻምፒዮንስ ሽኝት ሸዋረጋ ሻጥር ሸብ ሸብረክ";
            amharicWords[7, 7] = "ሸንጎው ሾን ሽዋ ሽላሎ ሽህ ሾህና ሻቢያ ሾላ ሸራ ሸንበቆ ሸጦ ሽፋንም ሻእቢያ ሻዕዲያ ሽያጭን ሽበት ሾልከው ሺኖዳ ሽቅብ ሹማምንቱ ሸማኔዎች ሾልኮ ሺው ሸቀጦችና ሸማች ሽመል ሻምፒዮናው ሽያጭም ሽዎች ሹመታቸውን ሸኽ ሸፍጥ ሽፋንና ሽልማታቸውን ሻምፕዮና ሽፍትነት ሾፌራችን ሽምጥ ሸባብ ሸለቆዎች ሽንኩርቱን ሻምፓኝ ሻለቆች ሽው ሸፍነው ሽንኩርትና ሽሙጥ ሺና ሽግግሩ ሸንቁጤ ሾሙ ሸቀጥና ሻወል ሽንፈትና ሸሽተዋል ሻሎ ሽፈራውና ሾፕ ሽንገላ ሽክ ሽንሸና ሼም ሽልማትን ሸራሮ ሾፌሩ ሸማቂ ሾው ሽንብራ ሻምፒዮናዎች ሹራብ ሸጋ ሸሹ ሸቀጣሸቀጦች ሽንጡን";
            amharicWords[7, 8] = "ሸገር ሸንጎ ሻለቃው ሽፋኑ ሽንፈትን ሸማቂዎች ሽያጭና ሽሚያ ሻጭ ሽታዬ ሽልማቶችን ሽማግሌው ሹመቱ ሽርጉድ ሻውልን ሻክሮ ሹመትና ሽግግርን ሻዲያ ሸሽቶ ሽሽት ሸምሰዲን ሻቬዝ ሽጦ ሽብርን ሽማግሌዎቹ ሸማቹ ሽያጩን ሸፍኖ ሹማምንትና ሻንጣ ሸዋና ሽንፈቱን ሽጉጡን ሺሻ ሹመቶችን ሹፌሩ ሸምጋይነት ሺመልስ ሸለመ ሸዋሮቢት ሻዕብያ ሼል ሸክ ሸሪዓ ሽግግርና ሸምበቆ ሺበሺ ሽኔ ሽንፈታቸውን ሽንጣቸውን ሹማምንቶች ሹመቱን ሺህዎች ሽማግሎች ሽብሩ ሻሮን ሸዊት ሸሪክ ሹማምንትን ሽብርተኞችን ሻርፕ ሻጮች ሽቶ ሽንሌ ሽንፈቱ ሺህና ሻል ሼሁ ሸካ ሹመታቸው ሾፌሮችና ሹክ ሹመኛ ሻንቆ ሽምብራ ሽኩር ሺሆች ሻምበሉ";
            amharicWords[7, 9] = "ሸ ሺህ ሻዕቢያ ሺሕ ሽልማት ሸዋ ሽፋን ሽያጭ ሻለቃ ሽፈራው ሽብር ሻምፒዮና ሹም ሻምበል ሼክ ሺ ሻውል ሽንፈት ሹመት ሼህ ሽማግሌዎች ሻዕቢያን ሽግግር ሺዎች ሹማምንት ሸቀጦች ሽመልስ ሸለቆ ሻይ ሽብርተኝነትን ሽብርተኝነት ሽፋንን ሽልማቱን ሽራሮ ሽልማቱ ሽማግሌ ሻዕቢያና ሸቀጥ ሽር ሸሪፍ ሻምፒዮን ሸቀጦችን ሸበሌ ሽታ ሽጉጥ ሹሞች ሸምጋይ ሹሙ ሽምግልና ሾፌሮች ሸሽተው ሽኩቻ ሸራተን ሸክም ሹፌሮች ሽምቅ ሽግሽግ ሽጉጤ ሸቀጣ ሽማግሌዎችና ሽሮ ሽፍታ ሽፋኑን ሽራሮን ሻዕቢያም ሺን ሸማ ሽንት ሾፌር ሼራተን ሽማግሌዎችን ሽፋ ሻማ ሽልማቶች ሽብርተኞች ሽብርና ሻሸመኔ ሸማቾች ሽብርተኛ ሽንኩርት ሽሬ ሽቦ ሽረት ሹፌር ሸምዴ ሻሺ ሹመኞች ሸምጋዮች ሽፍቶች ሽልማትና ሼር ሺፈራው ሽባ ሼኽ ሽርክና ሽያጩ ሻዕቢያዎች ሸጠው";
            
            amharicWords[8, 0] = "ቅጥርን ቁርጠኝነታችንን ቆጥራ ቂንዳሻ ቀላ ቀዳሚዎች ቀጠሮና ቅንጣቶችን ቆባቸውንና ቅቤን ቃለመጠይቁን ቆፍሬ ቀረቡና ቆፍር ቆጥሯል ቆያሄ ቀለደ ቅያሜ ቆረጡ ቃፍታ ቃሲምና ቆየኝ ቀማ ቋምጠዋል ቀም ቅዱሱ ቀኖናን ቆልፈው ቁጥሩንም ቅንድቡን ቀማሪ ቃላኡን ቀመሮች ቃልን ቅያሬ ቃልህን ቀሽም ቀልባቸው ቃለጉባኤ ቀይረናል ቂቤ ቂብ ቋም ቀራጩ ቆዳን ቃኝተው ቅያሶች ቅቡል ቁንጫና ቀርቤ ቅያስ ቀፀላን ቀለማትን ቋማት ቆሎና ቁርሾን ቀጥሉበት ቅጥነት ቀለሞችን ቃለምልልሳቸው ቆስቋሽ ቆርጠህ ቃልአቀባዩ ቀባጣሪ ቀልዱ ቆጥራችሁ ቀጣት ቅማልን ቀንበሩን ቅጅዎች ቋልቋል ቆንጆዎች ቁርጠኛነቷን ቀምሮታል ቆርጨ ቀጥቅጠው ቀርቶብኝ ቅፅሎች ቁርሾዎች ቆርኬዎች ቅርፃ ቆርጬ ቆለኛ ቆምስ ቀጥይ ቀጠሉበት ቆልቶ ቀንሶታል ቅጣታቸው ቆማጣን ቁፋሮዎችን ቅጠልና ቆይታና ቂምን ቀማኞችና ቁጣዋን ቅልና ቀድቼ ቁአሊትይ ቅሚያ ቀየውን ቃሊቲን ቅዱስነት ቀድመውን ቆዬች ቅበላን ቅንጣቢ ቀድማችሁ ቁርጣችንን ቀየሰ ቆንሱል ቃላቱን ቀንተው ቃለመጠየቅ ቁሣዊ ቀበቷቸውን ቆጥ ቀሚሱ ቀርበውላቸዋል ቀኛ ቀላጤዎች ቆጩ ቆንጥጦ ቆልለው ቅጥርም ቆይተውም ቅድሜ ቆጬ ቀላዋጭ ቀንዓ ቆሜልሃለሁ ቀብሯቸው ቀዱዱ";
            amharicWords[8, 1] = "ቅዱሶች ቀበኞችን ቆቡን ቁጥቋጦና ቅየሳ ቅራኔያቸውን ቆራጥና ቂጣቸውን ቀናዒ ቆርቾ ቋፍ ቆለጥ ቀረፃው ቃላታቸው ቀምሰዋል ቀጥሮታል ቁምነገሩ ቀመርና ቅዳሜም ቀፎውን ቁጥሯ ቋምጠው ቃጣው ቅንዓት ቀረርቶና ቀጥቅጦ ቀይረውታል ቆሻሻውን ቆረቆር ቁሶች ቆጠራና ቀደምትነው ቀርበዉ ቀጠሯቸው ቀይባህርን ቀጣዮቹን ቅብጠት ቅሬታቸውንም ቀጠረኝ ቆቦና ቄሶችን ቁጠረው ቅርንጫፎቻቸው ቀጥሮት ቅዳሴውን ቀደምቶቹ ቂሎች ቁጭቱን ቀጤሮ ቀብራራ ቆሌ ቀጠነ ቅዱስነትዎ ቆጠራዎች ቃሉና ቅልበሳ ቃለምልልሶች ቀናተኛ ቆሽቱ ቁባት ቆፍጠን ቀሳፊ ቀርጻ ቀንሼ ቅርበቱ ቁርዐንና ቆሽት ቀረሮ ቀረበው ቁስሎች ቂልነት ቅስቶች ቅንነትን ቆሮንቶስ ቅስቀሳን ቅጥል ቅጹ ቆዳቸው ቀድሞውን ቆጥሮታል ቀሚስሽን ቅንጭብ ቆሮሶና ቀለማቸው ቆለጣቸው ቅጅዎችን ቀጠናቸው ቅፁ ቄሱን ቀርፎ ቆጭቶኛል ቆስላ ቀልባችንን ቀርቦልናል ቁይ ቁጠባውን ቅንጥብጣቢ ቁልፍን ቁምላቸው ቀብሮት ቁጡነት ቁርጥምጥም ቅንጡ ቁመቴ ቂሙን ቋንቋቸውና ቆቡ ቆጶስነቱ ቀፎው ቀፈፈኝ ቁጣውንና ቅምጥል ቆየች ቀጣናዎችን ቅርንጫፍን ቁርጡን ቅርፅና ቆማለች ቀረጦች ቆባቸው ቀሣውስት ቅንድቦቹን ቀንሳለች ቀድር ቁጥ ቁጢጥ ቅሎች ቆጠራም ቁጫ ቀንዱን ቅንጣቶች ቀርባለች ቁርአንንም ቅርስን ቃለጽድቅ ቀድሶ ቁሳቁሶቹን ቁመና ቅድስናና ቁጥቁዋጦ";
            amharicWords[8, 2] = "ቁፋሮው ቄስና ቁፋሮውን ቀበሮና ቆሪቾ ቋቅ ቀንሰን ቁርጠኝነታቸውን ቀስመው ቅስቀሳቸውን ቀረኝ ቀላቅላችሁ ቂማቸውን ቅርጻ ቄሳር ቀደን ቀብረዋት ቀለጠ ቀርቼ ቀድተው ቁርጠት ቅቤው ቅባትና ቀጣናን ቆዬችና ቀንጭቦ ቅስና ቆፈን ቀንበርና ቅርሳችን ቅጥረኞችን ቀርቶባቸው ቀርና ቀኖ ቀራቢዎቻቸው ቀንዳቸው ቀሳውስቱ ቀንቀሎ ቀሚስና ቀብሩን ቅጽበት ቅሰቀሳ ቃጭል ቆራጥነትና ቁራም ቀይባህር ቀነኒሣ ቅንብራችን ቀዳሚነት ቁርጠኛነታቸውን ቃለምልልሱ ቀምሷል ቃየላዊ ቀለሜ ቁንጽል ቀይሩ ቀደው ቀይራ ቅዥት ቆጠረው ቅርፆች ቀኖናዊ ቀንዳም ቀፈፋ ቀጥቷቸዋል ቋጥሮ ቁሣቁስ ቀረብኩ ቀጥላበታለች ቀኖናው ቀዝቃዛና ቁንጮዎች ቀልዶች ቀየ ቀየሩት ቃሚ ቆንጆው ቋራን ቁሳቁሳቸው ቅንአትና ቀመሩን ቅስቀሳም ቀድሰው ቀጥያለሁ ቀልብሰው ቀደምትነቱን ቀለሙም ቀበሮም ቀጠናና ቁሳቁስም ቅጣቶችና ቀድሞስ ቀጂ ቃዳፊ ቆንስሉ ቁጭቱ ቃሉንም ቁርጠኝነትም ቃላትና ቃኝቶታል ቅመው ቁጥሯም ቁሙ ቆይታውን ቆጥረዋል ቋንቋቸውንና ቄሳራዊ ቅድስና ቃሚሶ ቁጣዉ ቅርስነቱ ቋሪቻ ቁመታቸው ቆጣሪዎችና ቁጥጥሮችን ቅሌትን ቁሪ ቀልብና ቀጭ ቀኑንም ቅርስነቱን ቀረጥን ቁጥሬን ቀጥሎአል ቁሳቁሳቸውን ቀጣጥለው ቀልሶ ቋጨ ቆርጠዋል ቀጥራ ቀንበራቸውን ቁምነገሮችን ቀረጡ ቀይስር";
            amharicWords[8, 3] = "ቃሶ ቅርቡ ቁል ቅንጅታቸው ቅጥቀጣ ቅጠልም ቀበሮዋ ቁሜ ቆምን ቆራጡ ቅንጭር ቅጸላ ቀጣናዊ ቆራጮች ቀይረዋል ቀልብን ቆመዉ ቁጥራቸዉ ቀነኒሳና ቀዳበት ቅርፃቸውን ቆይታዎ ቀጥረን ቅብብሉ ቀጠልን ቀጠለበት ቃ ቆየሁና ቁመትና ቀዳሚና ቅዋሜ ቁስላቸውን ቁብ ቀንዶች ቀፏቸውን ቅድመሁኔታ ቀሰቀሰ ቀአዴድ ቅምስና ቁሳቁሱ ቀንቷቸው ቅልጥ ቅጠሉ ቅልጥም ቆነጃጅቱ ቀይባሕር ቅርፁን ቀጠናም ቄሶችና ቆሰለ ቀድሞውኑም ቅሬታዎችንና ቃለምልልሱን ቋንቋውና ቀንሱ ቀስት ቅኝቱን ቀንሳ ቀልቷል ቀኑና ቆርኬ ቅጹን ቆጥረውታል ቀጥቶ ቆሬ ቆስቋሾች ቀጣናዎቹ ቀናዒነት ቀርቶታል ቆጨኝ ቁጥጥሩም ቁጥሮችን ቆቅ ቀይሮታል ቃልስና ቅርንጫፍና ቁፋሮዎች ቀጫጭን ቅራኔን ቄሰ ቁርበት ቁስላቸው ቆርሰን ቀልደኞች ቆሞም ቅዱሱን ቁጣም ቀነኒ ቁርአንን ቁሳቁሶቹና ቀርቦበት ቀዳሚዋ ቀልብሶ ቀዳሚዎቹ ቁጡ ቆንጠር ቀደሞች ቅጠሉን ቁጥቋጦዎች ቄጤማ ቅንጭብጫቢ ቅጥርና ቀርቶአል ቀፍድዶ ቀርቦላቸውም ቅቤና ቆጥሬ ቆዳቸውን ቀሎ ቀድሰዋል ቅድሚያና ቆርጫለሁ ቀደምትና ቆረጣ ቀስቃሽና ቆንጅዬ ቁሳቁሶችም ቁጥራችን ቀሚሱን ቀወት ቅባቱ ቅጽና ቁርስና ቅንብርና ቁስለኛውን ቅርሶቿን ቀርቱዋል ቀራጭ ቀነሰች ቁስለኞቹ ቅላጼ ቀርነትና ቀዝቅዟል ቅዳሴው ቀብሬ";
            amharicWords[8, 4] = "ቀቢፀ ቁሳቁሶቹ ቀብሪበያህ ቆሻሻው ቀነኒሳን ቀጥለናል ቀጣይነታቸውን ቀናው ቁቤ ቅሬታዎችም ቀኖናውን ቁልፉን ቀነስ ቀጥላም ቀመርን ቅሬታቸው ቅንጅቱም ቁራን ቀልቡ ቆይታችሁ ቃሎችን ቀንዲል ቀርከሃ ቀሌምንጦስ ቀየው ቀምሶ ቆንጥር ቆጥረውት ቀርፋፋ ቁርጡ ቀደሞ ቅኔው ቆንሲል ቀሪውም ቁንፅል ቁሳዊና ቀዛፊዎች ቆሮ ቁጥብ ቁሳቁስን ቁጥጥርንና ቀጠለናም ቀሪዎችን ቆልፎ ቅርጾች ቋጥረው ቁሳቁሶችንና ቆመህ ቅኔውን ቁርአንና ቅንጅቶች ቀዘፋ ቀብራቸውም ቃሮራ ቄሣር ቁርጠኛነት ቁጩ ቀኛዝማችን ቀበሮዎቹ ቀላቅለው ቀናችን ቀጠሮን ቁርጥራጮችና ቀይሯል ቁዘማ ቀዬው ቆጥረናል ቁርኝቶች ቆመስ ቅርበትና ቆሼን ቅልብጭ ቅጥረኝነት ቅስቀሣ ቅዱሳንም ቆርጠናል ቅልጥፍናና ቁጥሩም ቆራርጦና ቀርታ ቁርጠኝነቱ ቅርሶችንና ቀድቶ ቀዘባ ቃፊላ ቅነሳውን ቀየሩ ቃልአቀባይ ቀረብን ቀጣይነቱ ቀይሕ ቁልፎች ቃጠሎና ቁስቋም ቆመንለታል ቀናቱ ቅመሞችን ቀያይ ቅስቀሳዎችና ቋሂኖች ቀጫጫ ቆራጥነትን ቋጥኞች ቀዱማዊ ቀሚሳቸውን ቀልጠው ቄርሎስም ቀው ቃየል ቀንደኛው ቆመና ቀበኛ ቋንቋውም ቀብቶ ቀንዱ ቃሌ ቃሉም ቀኑም ቀዩን ቅዠታቸውን ቋንቋችንን ቁስለት ቅማልም ቅስቀሳዎችን ቀጠናነት ቀምበር ቀርጥና ቀዳሚት ቃሬ ቀዉጢ ቀራቢ ቀንቷቸውና";
            amharicWords[8, 5] = "ቆሞስ ቆፍሮ ቆይትዋል ቅንጅቱና ቀሲስ ቀሺ ቀርባ ቀብሪ ቅባቶችን ቅዱስነታቸው ቀረን ቅዱስና ቁስሉን ቀበሌን ቀልደኛ ቀጣዩና ቀኔ ቆጣ ቅድሚ ቀጠሮም ቆማጣ ቃላቱ ቅሬታም ቋጥኞቹ ቆስሏል ቀለሟ ቁጠባን ቀይሬ ቁርዓን ቀጨኔ ቅዱሳዊ ቀለምን ቁጫጭ ቆይታችን ቅርሶቻችንን ቆጶሳትን ቅዱስም ቁስለኞችም ቀጥሉ ቀዳዳዎችን ቅጣቶችን ቅርጽና ቆይታም ቋንቋውንና ቀቢጸ ቁራ ቅነሳን ቅርፊት ቁሶችን ቆፍረው ቅባቶች ቅድምያ ቅኔን ቀናቸውን ቆይቱዋል ቀርከሃን ቃኝ ቅስቀሳውን ቀረጢት ቀላጤ ቆራርጠው ቆጠራን ቁጥቋጦ ቅንብሩ ቆይማ ቀልዱን ቀጠን ቅንነትና ቃኝቶ ቀርበውለት ቆመጥ ቀድሞት ቅንብሮች ቀደስ ቃላቶቹ ቅጥፈቱ ቆየት ቃላቶችን ቅዝቃዜው ቀይረን ቀርቦለታል ቃልቻ ቀርበውላቸው ቀበራ ቅድሳትና ቀብረው ቀዝቃዛው ቅጂዎችን ቁዋንቁዋና ቀደመው ቀጥሎበት ቁምነገሮች ቀራፂ ቅልጥፍናን ቅርጥፍ ቀዬአቸውን ቀረበላት ቋት ቀስመዋል ቋጠሮ ቆረሳ ቆዳው ቅጥቅጥ ቀልቡን ቆንጅት ቀርተን ቃፊር ቀረበች ቅረቡ ቅጣትም ቆዬኝ ቀየርነው ቅሬታዎችና ቆሜለታለሁ ቀርቦአል ቅፁን ቀየረው ቀልቤሳ ቆንስላው ቆርሳ ቁስልን ቀርጸው ቆዳዎች ቀዩ ቅኝቶች ቀንጨብ ቀለስ ቂጥ ቀውስጦስ ቀንጥሱ ቀጠረ ቁልቁለቱን ቀጠናን ቀባብቶ ቀስፎ ቆፍጣና ቀዝቃዛውን ቀጋ ቅራኔውን ቆንጠጥ ቆሜአለሁ ቀሪውንም ቅርሳቅርስ ቋንቋም ቀጠልሁና ቁጣው";
            amharicWords[8, 6] = "ቀጥታና ቀናኢ ቀንድም ቅፅበታዊ ቃታ ቁምጣ ቀጠለችና ቀዳማይ ቆይታዬ ቅርሱን ቀማሾች ቀረርቶ ቀብራቸው ቆልፍ ቀርተውታል ቃኘው ቀምቶ ቀልድና ቆርቆሮዎች ቆጠራውን ቀረች ቁጥጥሮች ቀያቸውን ቀረና ቀርጿል ቀጥላለች ቁጣቸው ቆጥቦ ቁስለኞችን ቅርንጫፎቹ ቆርሰው ቅድስተ ቅጣታቸውን ቅኔዎች ቀበና ቅርበትነት ቅሬታው ቅርምት ቅጂዎች ቀርበናል ቄራዎች ቋያ ቅልቅል ቃለአብ ቅስቀሳው ቀበሌዎቹ ቀዳዳዎች ቅንድብ ቀጠናዎችን ቆራሄ ቀመሩ ቁ ቅ ቀጥሯል ቀኝና ቀድመን ቀፎዎችን ቅጽር ቀላሉ ቆረጣና ቀያሽ ቆሼ ቀረሽ ቆቃ ቆየችና ቅምጥ ቃልስን ቀድሜ ቂል ቀጣይነትና ቆጥረን ቆቱ ቁልምጫ ቀሪዎች ቆጶስነት ቅዝምዝም ቅንፍ ቀልቀሎ ቆራጦች ቀንቶት ቁልቁለት ቀለማት ቀልጠፍ ቀብሮ ቅሬታዋን ቆዬ ቆይቶም ቁመው ቂምና ቃሊቲና ቀየረ ቅርርብ ቆጨ ቆመች ቀረው ቀልጦ ቅራኔዎችን ቁርና ቀምተው ቋንጣ ቅመምን ቀዳሽ ቀናነት ቁጭታቸውን ቄሱም ቀነኔሳ ቆራጩ ቁር ቀናትና ቆይታዋ ቅጥያ ቆማችሁ ቆጣሪዎችን ቀምሰው ቅጠሎች ቆላና ቀረጦችን ቁጥሬ ቀጠለች ቆይቶዋል ቃኘት ቄጠማ ቆንስላዎች ቀናውን ቅዳ ቀረበላቸው ቁምሳጥን ቃላችንን ቁምስና ቀልቶ ቆባቸውን ቀሳውስትና ቀብድ ቅንጅትም ቆንሲላ ቃዲ ቀላፎ ቁጥራቸውም ቀጠልኩና ቀጣፊ ቀንሰዋል ቃለመሃላ ቀጣሪዋ ቁንጅና ቅቡልነት ቀጥረው ቁጥጥርም ቀራቸው ቁርጠኝነትን";
            amharicWords[8, 7] = "ቁርጠኝነትና ቄሱ ቂጤሳ ቅነሣ ቅመማቅመም ቀበሮዎች ቅድሚያውን ቆርሶ ቀማኛ ቃጠሎውን ቃላቸው ቀውስን ቆሜያለሁ ቅጠላ ቁልቢ ቆሜ ቀውሶችን ቀርቦባቸዋል ቁመቱ ቅርጫ ቆጥረው ቅርንጫፎችን ቆመን ቀጣይና ቃላትን ቁሞ ቆይቻለሁ ቀበሮው ቀበሌው ቆየሁ ቅጽል ቀረሁ ቆነጃጅት ቀስቶ ቆስጠንጢኖስ ቁርቋሶ ቅስም ቁልፍና ቀበል ቆዳውን ቆየን ቅንጦት ቀጣናውን ቅደመ ቋንቋዎችን ቅዱስን ቆይታቸውን ቅፅል ቃሌን ቀደሙን ቀውሱን ቅፅር ቀማኞች ቁስሉ ቀናቸው ቂ ቃዛፊ ቀረጻ ቀይመስቀል ቀርቦለት ቀለመወርቅ ቀደመ ቁርባን ቆጶሳት ቂሊንጦ ቀደሞቹ ቆይቼ ቀበሌና ቆርጣ ቆጣቢና ቅብብሎሽ ቅርሳ ቀጭኔ ቅርታ ቆይተን ቀ ቀለብና ቅርሳቅርሶች ቅሬተ ቃሏን ቋንቋችን ቀምሮ ቃሎች ቀርፀው ቅራኔና ቃላቶች ቅፅበት ቀርሳ ቅዱሜ ቁራጭ ቀበቶ ቋጭተዋል ቀለመ ቀጠል ቀዳሚነቱን ቀስቅሶ ቀርበን ቀለምና ቁራሽ ቀዬ ቅሪቶች ቅንና ቁልል ቅይጥ ቁስ ቀደምና ቀመስ ቀጥለን ቅጅ ቀለሞች ቅንስናሽ ቀስቅሰዋል ቅርሶቻችን ቋንቋቸውን ቆራርጦ ቁምቢ ቆጶስ ቀርነትን ቀረበለት ቀለሙን ቃድር ቅድሳት ቀጥለውበታል ቀዬአቸው ቁዋንቁዋ ቀኙ ቀዝቅዞ ቅመምና ቆላማና ቆይታቸውም ቆሻሻዎች ቂጣ ቅብ ቀጥል ቁልፉ ቋጭቷል ቀስቅሰው ቃና ቀይና ቅሬት ቆራሮ ቋጥኝ ቅመሞች ቀይሰው ቅጽበታዊ ቀርፃ ቅጾች ቁልቋል ቀጣሪ ቆጣሪዎች ቅርሶቹን ቀናኢነት ቀረበባቸው ቅንጅታችን ቀልቤን ቅርንጫፉን ቋራ ቀጸላ ቅርቃር ቀጥዬ ቀርቦበታል ቅርሱ ቀሳውስት ቀራንዮ ቆሻሻዎችን ቀናና ቀልዴን ቀስበቀስ";
            amharicWords[8, 8] = "ቀበሌዎችና ቁጥርን ቅደም ቀንበር ቀይሮ ቅዳሴ ቆይ ቅጥረኛ ቀራኒዮ ቀርፆ ቁጥሩን ቀውሱ ቀጠናዎች ቀማሽ ቁስለኞች ቀውጢ ቆሻሻን ቋንቋቸው ቀሚስ ቀረቤታ ቆራጭ ቁራኛ ቋንቋውን ቁርአን ቀለሙ ቃሉ ቅነሳና ቀውስና ቀጥሮ ቄርሎስ ቀስቃሽ ቀጠናውን ቀኙን ቃጠሎው ቆሟል ቅሪት ቅርፅ ቃሲም ቀዳሚውን ቁሳዊ ቀጥለው ቆሰሉ ቀስተ ቀፀላ ቅስቀሳና ቅባት ቆመናል ቆርቆሮ ቀነሰ ቆላ ቁሳቁሶችና ቀጣናዎች ቀጣይነትን ቀውሶች ቁጥጥሩ ቆጥሮ ቃልና ቁጥርና ቀንድን ቅንነት ቅበላ ቀጠሉ ቁጥሮች ቅጂ ቄራ ቀዳጅ ቁርሾ ቀፎዎች ቁማር ቅርጽ ቅርጫት ቅጥረኞች ቀለል ቅል ቆስለው ቅናት ቀጠለና ቀናትም ቅሬታን ቀንድና ቁስለኛና ቃልኪዳን ቀይሶ ቁጥራቸውን ቆማ ቀድሞውኑ ቄሶች ቀጥተኛና ቀናቶች ቅጣትና ቅጣትን ቀድሞም ቁጣና ቆመዋል ቆንስል ቀያቸው ቁሳቁስና ቆራጥነት ቀብሩ ቀጣይነቱን ቁጣቸውን ቀይረው ቀትር ቀጠሮው ቀሪዎቹም ቀደምነት ቁጥጥርን ቅርሶቹ ቀርቦባቸው ቁልጭ ቆሎ ቅነሳው ቀብሪደሃር ቁጥጥሩን ቀጥላ ቀርቦላቸዋል ቅጡ ቀድማ ቀዳሚው ቆርጠን ቀበሌዎችም ቅሉ ቅልጥፍና ቁፋሮና ቆዩና ቀኖና ቁመት ቀስተደመና ቋንቋዎችና ቃሪያ ቁጠባና ቆጣሪ ቀጣ ቅዱሳንን ቋንቋው ቀጠሮውን ቅጥ ቀደሰ ቆቦ ቅርሶችና ቁርስ ቅንጅቱን ቀኝአዝማች ቁጣውን ቁጣን ቀጠሉና ቀንሰው ቀናትን ቀርታለች ቀላቅሎ ቀጠልኩ ቅዱሳት ቆብ ቆራጭነት ቁጭትና ቅርስና ቃለመጠይቅ ቅስቀሳዎች ቀርተናል ቅራኔው ቆዬና ቀጠሮዎች ቀዝቀዝ ቀላድ ቅብብል ቀጥሎበታል ቃልም ቂርቆስ ቅንብር ቅርንጫፉ ቅዝቃዜ ቆሙ ቀድም ቅኝትና ቆየና ቆየ ቅራኔዎች ቅማል ቅጣቶች ቀባሪ ቀስቅሷል ቆይቶአል ቆንጂት ቀረፃ ቁና ቅጣው ቆስሎ";
            amharicWords[8, 9] = "ቀ ቀን ቀደም ቁጥር ቃል ቀናት ቃለ ቁጥጥር ቀጠሮ ቅንጅት ቀበሌ ቅድመ ቋንቋ ቀበሌዎች ቋሚ ቀይ ቅጣት ቅዳሜ ቅርበት ቅሬታ ቀንድ ቀድሞ ቀርቶ ቀውስ ቅርንጫፍ ቀጣይነት ቅዱስ ቀላል ቀርቦ ቁጥራቸው ቁልፍ ቀርበው ቀጥሎ ቅድሚያ ቆይቷል ቅስቀሳ ቀጣይ ቆይታ ቋቨቂሯቄቁ ቀና ቆይቶ ቆይተዋል ቆይተው ቅነሳ ቀጥሏል ቀርቷል ቀልጣፋ ቁጥሩ ቅርብ ቀሪዎቹ ቀርቧል ቀጥተኛ ቀጠና ቀሪው ቀረበ ቀረጥ ቀኛዝማች ቅርሶች ቅጥር ቁርጠኝነት ቁጠባ ቃለምልልስ ቁሳቁስ ቀስ ቆሞ ቀዳሚ ቆዳ ቅራኔ ቀርተዋል ቅሬታቸውን ቀኝ ቅኝ ቃላቸውን ቄስ ቁጭ ቀነኒሳ ቆይታቸው ቁሳቁሶች ቀጣዩ ቅንጅቱ ቀጥታ ቀረ ቅርስ ቁርጠኛ ቀጣና ቆሻሻ ቁም ቀንን ቁጣ ቀሪ ቀኑ ቀደምትነት ቅር ቃጠሎ ቀርበዋል ቅናሽ ቋንቋዎች ቃላት ቆዳና ቀኑን ቆመው ቆጠራ ቁፋሮ ቀዳማዊ ቁሳቁሶችን ቋሚና ቀረቡ ቀልጣፋና ቅጣቱ ቆርጦ ቀለም ቀጥሎም ቅን ቅሪተ ቀሪውን ቀልድ ቅድስት ቆጣቢ ቀመር ቆይታው ቁጥጥርና ቅዳሜና ቅርንጫፎች ቅርሶችን ቀጠለ ቃልሲ ቀድመው ቆይታለች ቃሉን ቁርጥ ቂም ቃሊቲ ቀልብ ቆንጆ ቀዶ ቀነ ቀር ቅኔ ቅሬታዎች ቀንና ቅንጅትና ቆርጠው ቅመም ቀርቦላቸው ቆዩ ቀብር ቆንስላ ቀጠናው ቀበሌዎችን ቅሬታውን ቀዳዳ ቅንጅታዊ ቅንጅትን ቀንደኛ ቅጽ ቀጥለዋል ቀሩ ቅድም ቅኝት ቀጭን ቀርተው ቆስለዋል ቀደምት ቀዳማዊት ቅፅ ቁርኝት ቆላማ ቁስል ቀጣናው ቀለበት ቀደሙ ቅቤ ቀርነት ቀንሶ ቀንሷል ቀለብ ቀዝቃዛ ቅጣቱን ቀላልና ቁጥርም ቁምነገር ቀንም ቅመማ ቀረብ ቋንቋን ቅዠት ቅጠል ቀበሮ ቀረጥና ቀድሞውንም ቀርጾ ቋንቋና ቀድሞው ቁንጮ ቅጥፈት ቀጥለውም ቅርስነት ቆመ ቀደምም ቅሬታና ቁጭት ቆም ቆጠራው ቅሌት ቁስለኛ ቅሬታዎችን ቆራጥ ቅዱሳን ቁልቁል ቀጣዩን ቅንጣት ቀጥ ቆይተናል ቀኖች ቀፎ ቀሪዎቹን";
            
            amharicWords[9, 0] = "በመጫና በጆሮዋቸው በተሰየሙበት በመኩዋንንት በቬንገር በብልጠትና በምትላቸው በመሪዎቻችን በሚጥም በቻይናና በማጨድና በዕዝ በመመሥረትና በማስጠንቀቂያው በግዞትና በመታረቅ በየጣልቃው በማስታከክ በውቅሮና በዳልጌዳ በማግባትና ባንግላዲሽ በመመልከትም በኔልሰን በመሰዊያው በሚቋቋሙ በብሮድ በውስኪ በአናታቸው በጨረፍታም በማውቀው በሚገዙት ብትፈልጉ ቦርዱንና ብርሃናት በመታገያ በማዳጋስካር ቤተክህነቱ በሕሊናው በመሞላቱ በሚደርሱባቸው በዕድ በሠራተኝነት በርገሮች በማያጠራጥር ብታደርጉ በተባባሪዎቹ በህንጻ በባየር በመሸኛ በየክፍል በተለጠፈው በየአውራ ባቄላና በእንቁላሉ በመዟዟር ባርከር በውሸትና ቢሏቸው ባለሃብቶቹም በግሃድ ብሎኬቱን ቢኖርማ በሰልፈኞቹ በኮሌጅና ባልደረሰ በአፈጉባኤው ባልኖር በቦታዎቹ በእስረኛው ባልደረሱ በተቀዳጀው በምስልም ቢቆሙም በሚጥስ በማግለልና ባስቆጠሩት በፀባይ በአለ በዕንባ ባመለካከታቸው ባቀረቡትና በየግዛቱ በጥቅምና በወንድማቸው ባለመሳካቱም ባሥራ በምሁሩ በመታገድ በማይበክል በመኝታቸው ብሶተኛና በሚወጡና በመድፈን በተወለደች ቢቋረጥ በመዘፈቅ ብሂልን በጌምድርና በኖኪያ በሚዲያዎቹ በምሁር በቁና በማጠቃለያ ቢቶክ በልዋል ቢመራ ባንክንና ባልጠበቅነው በጊዶሌ ብንቀበለውም ባለአክሲዮንነት በብሪትሽ በአስለቃሽ ባደረገኝ በሃይቆቹ በጓንታናሞ በኮለኔል በጥቅማጥቅም በፈጠነ በፖርቹጋል ባልተጣራ ቢፈቀድለትም በመፍረሳቸው በዱሮ በማዘግየት በመዋቀሩ በእናቷ ቢኖርስ በችንካር በቅዱሳን በመከፈሉ ባካበቱት በእብሪተኝነት በቀልም በሃይቆች በትግራውያን በእግራችን ባልንጀሮቹ በባንግላዴሽ በሙያዊ ባሰራጨችው በሙያዋ ባለመብትን ባመጣቸው በዕፀ በየአጥቢያ በጤፍና ቢጠቆምም በአሰልቺ በኮሙኒኬሽን በበርታ በመገነት በቀጣዮ በመቃረም በማትሞላ በስጦታነት በእውነታ በጎፈቃደኞች በሚያክል በአረጋዊያን በደረስንበት በጥንታዊት በአሠሪዎች ባስቆጠረ ብቃቱንም በአጽቢ ቢያጠኑ ብሔርተኛነት በመጽሀፍ በህውሓት በማይሰጡ በተገልጋዩን ባልንጀሮቼ በጅራፍ ብደክም በአንጋፋ በሚፈጥርበት በተሞከረው በሚመጥን ቢፈቅድ በጫካና በቂሊንጦ ቢገልፁልንም በእንስሳቱ በመጠየቅና በቅስቀሳው በንጋታው በጥንታዊቷ ባለማድረጓ በተሾመበት በመንግስ በጠበበ ብጽዕና በኢሰማኮ ቤተሰብንም በሚጠይቁበት በማይሰጥ ቡታጋዝ በማይገባው በቀላቸውን በተራዋ በያዝነዉ በየሰዉ ባህሯን ባስገነባው ብትን በፈረንሣዮች በሃሣብ በሕሊናዬ ባሳደረው በአዳፍኔ ቦዜኔዎችን በመቅርቡ በተቆጣጠራቸው በተሰናባቹ ባነጋገር በለምድ በቅሎዬ በቅሎዋቸውን በአሕጉሩ በዩኒቨርሲቲዎችና በጧቱ በአጋሮች ባይለይም በአማጺያን በፍኖተሰላም በአዲቋላ በላየ በርዝመቱ በመንዳት በማስተባበሩ በነሚሚ በቁይ በመንበሩ በላዬ ቢጋበዙም በቆይታውም በእሳትና ባሳለፈባቸው በጠየቁ በድሪስደን በእድሜም በእርዳታው በዘርፎቹ ቢያሰራጭም በፖለቲካውና በኒውዩርክ በእጅጉም በግሽበት ብርጌድን በሰላታት በምሠራበት ቢሞላው በተረዳበት በእርጥብ በሸዋና ብንፈታው ባላገሩ በገዥውና በኮንሶና ቢቀጡ ባመኑበት በጥራጥሬ በመገርም በመሰንዘራቸው ብንረዳም በመገንጠሉ በእጅግ በቁስለኞች በኢንስትቲዩቱ በምቀኝነት በሚሯሯጥበት በቃላትና በተከታይ በተገዥነት በኮሚኒኬው በሠፈረው በፀሎቱ በስእለት ቢመጣበት በምድራዊ በመሳሪያም በአሠልጣኙ በተራዬ በአጥቢያው በክፉም በማራኪ በጓደኛው በቆንስላው በሚፈቅድለት ባቀረብናቸው በኤግዚቢሽንና በአንዳንዶቹም በዋልጌነት በዙሪክና በክርስትናና በሰየመው በታሰረው በአኗኗራቸው በጎሰኝነትና በመሳተፍም በዕኩልነትና ባልታየበት በኮራ በተጠየቀበት በኢንተርፕራይዙ በንቡረዕድ በምግባር በጽሁ