            amharicWords[9, 1] = "ባሕሉ በማንስ በጋሻሞ በእኒህ በቴዲ ባለመዝነቡና በአንባቢያን በፈሳሽ በእርድ በመኮረጅ በሚያጋጥም በቡለን በኀብረት በረዶና በማዛወሩ ቦሮ በነጠላም በምረጡኝ በህልሙ በአረቢኛ በሚያሰሙበት በምናባዊ በገባነው በጣለበት ባለሀብትና በልሳኑ በሙያቸውና በፊስቱላ በሚያገኟቸው በደመነፍስ ባይሩ በድለው በሑዋላ በደህናችሁ በሚወክለው በዩኒቨርሲቲውና ብፁ በደብዱቤ ቢሾሙ ባራቴሪ በትግሬነት በፈታኝ በበቁት በአንደኝነትና ብትነሳ በሪጅን በመንገዳገድ በተመሠረተበት ቢሾም ብፍ በማገናኘቱ በየሬስቶራንቱ ባትፈልግም በሚያዋርድ በቢልዮን በቢሊየን በአደራዳሪ በማቁሰል ቢፈርስስ ቢመለስ በጎሳቸው በመፍትሔነትም ቦታውንና በስልጣኔ በህጎች ባወጡትና በመሥመራችን በሚወያዩበት በኤክስፖርትና ባለመወጣታቸው ቦቢ ብነግርህ በጨቅላ በየከተሞቹና በኃይለቃል በኒውደልሂ በጸሐፌ በአሳቻ ቤተሰቦቻቸውንም በተሻለው በአሰቡት ባይስብ ባገሩም በዳዉሮ በወረንጦ ቢያነሱ በምሥክር ቢበላሽ በፋርስ በማብጠልጠል በለጡ ባለመጠየቃቸው በባችለር በቢዘለዎ በሞቀና በሰማው ብርግድ በማዳረስና በሬጂስትራር በነሃሴ በሊስትሮ በአብራሪዎች በተመላሽ ቢለቅ በቱርኮች ቤተሰባችንን በክልሏ በሱባኤ ባይወዱም በተጨባጭና በመጽሃፉ ቢጤዎች ባንዲራቸው በካሽ ባፈሩት በተተከለው ቢሰለፍ ቢሻንጋሪ ባልተገባው ብብት ቦኩ በማስተባበያ ባህላችንና ባሰቡ ባልተሰጠበት በነቃ በቀደምቱ ባጋጠመኝ ባሕረተኞች በየአካባቢዎቹ በንግሥናቸው በነበር በኢንዱስትሪውና ባካበተው በመጽሃፍ በማደራጀቱ በመጥረቢያና በየዘመዶቻቸው በመንፈሳዊና በርኸም ቦናፓርቲ በእንግሊዘኛና በማኀበራዊ ባሕታ በታሰበለት ባስታወቁበት በየግል በኖርዌይና በሚመራባቸው በአንዳቸው በታሰረበት በምንኩስና በሐርገሌ በልብዎ ቢያሳውቁ በመራዘሙ በፍራንክፈር ቢነሱም ባታሊያኖች ቤንዚኑን በረዶው ቦዲ በምታቀርባቸው በስራዬ በሚዘንበው ባሕሬን በምንጩ ብናውቀው በግንኙነታቸው በሚበዙባቸው ባእዳን በኢቴኮ በሚጣልበት በሰፈር ብረታብረትና በሌለን በመሻረክ በሚንቀሳቀሱት ቢታሠሩ በታወቁት በላቸውና በመቻሉም በሰብዓዊና በረሃው በሚያመጣ በማሳጣቱ በሴካፋ ቢጤም በትግሬና በአዝማችነት ቢያነብ ባለመካተቱ ብክነቱን በሬክተር ብስጭቱ ባይክ ባልተገናዘበ በሚቀርብባቸው ባለማጤን በጥል ቡኢልዲንግ ባይሠራ በትናንትናውም በአሻቸው ቡርንዲ በመለያየትና በመሣሪያዎቹ በደጋፊዎቻቸውና በወዳጁ በናሚቢያ በጋብቻና በመተዉ በሞርጋን በኮከብነት በማቆያ ባይደርሳቸውም በፓርኮች በውርርድ በዋሽግተን በፓኬጅና በቤንሻንጉልና በአየርላንድና ቢያጤነው በሉና በሉን በተባባልነው በተፈለገበት ቢወስዱ ባለብረት ቢገልጥም ቢራገጥ ብመንፈስ በቢልቦርድ በማሞገስ ባይዋ በሚበዛባት ቦታቸውና በትግበራ በአባገሪማ በሳቸውና በኩፍኝ ባለመፍቀድ በሚያስወጡበትና ብሄረሰብና በአፍዴራ በስተመጨረሻው በሚላከው በበቀልና በለሎች በመጽሔቶች በመቁሰላቸው በመልቀም በተጋጋለበት በጉድጓዱ በቅጫምና በአሳዳጊያቸው ብሄረሰብን በስንተኛው ቢለዋ በፍየል በማስታወሻ ባሰበው በዘመቱበት ቤልፋስት በኤክስፐርቶች በወተትና በመማታት በትነት በአስቸኳይና በቋንቋችን በጨዋታውም በምናገኘው በስታዲዮሙ ባለፍቱ በዓረና ብሽሽቅ በዚያድ በመለኮቱ በታታሪነት በያኔው በፆምና በኤልያስ በጠራውና በየክልሉም በማጣደፍ በተባዩ በትንፋሽ በመረጋገጥ በዳይሬክተሮች በሚቆጠርበት በመጥበቡ በሌለዉ በመናሃሪያ በምንገባበት በቤተዘመድ ብኩን በርግጠኛነት በተቀር በትምህርትህ በካህን በህዝቦችና ቤቴል ቢጠይቁን በእብሪትና በሚኖረን ብሰማ በአዋኪዎቹ በሞከርኩት ቢያውቀውም ባለመግባታቸው ቢደጋገም በዐዋጅ በአሠልጣኝነት ብዕረኞች 