            amharicWords[9, 2] = "በማበሩ በዋዜማውም በተዘረጉት ባህርያቸውን በምትጓዝበት በበረዶ በተሰማራው ቢዘግብም ባለውለታው ብናይም በፀጥታና በጥንታዊነቷ በድርጅቴ በማስቸገሩ በኢሜልና በስብሳቢነት ብዙህ በጎሠኛነት በፕሪካስት ባልተዘጋጀበት በመቁረጣቸው በሚልዮን በመካከላቸውም ቢያስመዘግቡም በማውገዛቸው ብዴሕ ብሉናይል በቡዙ በመሻቷ በቀረብኝ ባልተገለፀ በተከናወኑና በመወንጀሉ በርህራሄ በጁነዲን በሶሻሊስት ብታዩት በሽታዎችለመከላከል በተመለከቱበት ቢኤች ባይመስልም ቢደረግለትም በሥውርም በመጓጓዣ ብንይዝ በኃይለማርያም በተመራጭነት በአምባሳደሮቻቸው በሊቀመንበር በመርሳ በየወህኒ በወላጅ በየትኛውስ ብትቀመጥ ባይረዱም ባሳክም በሚዲያም በተገመገመበት በጥበባዊ በሚገቡት በዓይኖቹ በጎቹን በሀሳቡ ባዶዋን በየጁ በመርሻ በተባለባቸው በወኅኒ በቁጥጥሬ በቡዱን ቢጠናቀቅ በአሜሪካውያኑ በተከላ በሻዓቢያ ባይወጣም በጥናትም በግርማዊነታቸው በቶርንቶ በዎል ቢራም ቡቡን በሆኑባት በማጎሪያ በቆጋ በሚደግፉና በመሰለፋቸው በአድማስ ባላሃብቶችን በዛና በመንግስታዊው በየጣቢያዎቹ በእና በራይን በጥቋቁር በገዱም በግጭትና በየውስኪ በተጋጩ በሶውን በእደጥበብ በተሰኙት ቦታዎችንም በማያወላውል በየነች በሚሊሻ በማህፀኔ ቦንቡ ቢዛወር በታሳቢነት በረራን ቢውሉና በዜናና በመንግሥታችን በመሰለች በድምፃቸው በሩዋንዳው ቢራሳ በሞኝ ብንጠራጠር በሞአ በውጩ ባደረግው በሚያሳፍርና በጋዜጣችን በማገጣጠም በሚቀንሱ በሻንጣ በእየለቱ ቢያጋጥማችሁ በአአድም ቢያሸንፉም በተዋበች በሬራ በመባላችን በጃፓኑ በጸሎተ በኢኮኖሚውም በሚጠናከርበት በጸሎቱ በአስፈሪ በጨለማውም በማቃጠልና በአንደበት በዱላው በሞቡቱ በየሃገራቱ በእንግሊዝኛና በተካተታይ በኢሰፓ በውስጣቸውም በፈለኩት በኖርዎይ በገለጡበት በኤፍኤም በችኮላና ባልበላ በየቤታችን በማጋጨትና በመቀባበል ባለሐብቶቹ በደሬዳዋ በዲስኩር በጠባቂ ቦርዶችን ቢያስቆጥሩም በፈረመው በአንዳንዱ በንጹሐን በአመቻችነት ባንኮቻቸውን ባለማምጣታቸው ብዛታቸውም ቤዞችን በገዛው በአንድነቷ ብሎጉ ብርሃናቸውን ቢሰጥበት ብዙን በእንሰሳትና በሕዝባችንና በአብዛኞች ቢለያዩ በትውልዶች በፍልስጥኤም በመፍረድ ባረጋገጡበት በእዝ በመበቀል በማማያዝም በማንገራገር በምናሴ በባለቤቴ በዕርቀ በደረሰበትና ቢመረምሩ ባስቆጠረበት በትንሹም በትቢት በዓይኗ በሊተር በኀዘኑ ቦርሳቸውንና በሚታገሉበት በሶማሊ በሰጡዋቸው በፊቱን ባለፈበት በእጃዙር በወቅት ባከማቹት በኀዘን በምናስብበት በሐሜት በጀርመኖች በሉላዊ በቴሌቪዝን ባለመድረሳቸው በሟቾች በእርምጃው ባሰናዳው በአስፈላጊ በእርሳቸውና ባለእዳ ባመራበት በሚልዮኖች በመክሸፍ ብንተወው በጀሪካን በመዝጋቷ በሐዲዱ በስሌት ባገኙበት በማዕቀፉ በመፍትሄነት በሞላው በሚልከው በመፈቃቀርና በማዋጋት በግጥሞቿ በአፍሪቃው በአምባው በመሪዎቿ በሰላዮች ባሳወቁበት በተፃራሪው በሚያስተላልፉት በኋለ በመሬታቸው በአቤቱታችን በአማካዩ በነበረባት በመጣላቸው በተክሎች ቢከፍልም በሰራተኞቹ በተግባራቸው በኋሏ ቢሰብኩም በክፉዎች በዘመዱ በአይሮፕላኑ ቢላቸውም በቅርጫት ብወዛው በማስረጃም በቤተክህነትና በፍትሃብሔር በዘገባውም ባህርያትና በትንንሽ ቢኖሩስ በዕብራይስጥ በሃይድሮ በጎሰኝነት ባግባቡና በስልሳዎቹ በተከላካዩ በመከራከሪያነት ባሰራው በመፍቀድና ብዙየ በመቀያየርም ቦንዱ በአጨቃጫቂ በተዋጣ በርበራን በመስማትና በምርጫቸው ባልተፈፀመ በማሳካትና በበዛባቸው ባየለበት በማይኖሩ ባይዳዋ በማድማት በግዳቸው በመከስከሱ በህሊና ቢራው በኮሎምቢያ ቢሰጣትም በርሊስኮኒ በሚፈጽመው በጄኔሬተር በሚስት በወጣትነታችን በየፍርድ በቅሎውን በመኪ