            amharicWords[9, 3] = "በፈለጋቸው በመንፈስም ባካሄደችው ባለቤትም በከንፈር በፊሊፒንስ ብራቲስላቭ በከፍታ በገነተ በቀራንዮ በአንዲህ በነፂነት በእስከ በመግፈፍና በፍልሰተ በጭልጋ በስተጀርባው በጥበብና በዲፕሎም ባልደረቦቹና በዓላትና በጊኒ በሮማን በኅብረተሰባችን በእሑዱ በምንከፍለው ቢንላዲን ባለሙያዎቹን ባለሙዎች በደማችን በዋናዎቹ በትርዒቱ በደምም በመሸርሸር በመትነን በተቀላቀለ በተጠቃሚው በምዕራፍ በኢህአዲግ በመተኛት በእጅህ ቢፈጸም በተሰነዘረበት በመንሸራተት በአሊተና በቪዛና በአዋሳው ብራኢን በማካፈልና በማስታረቅና ብሄሰቦችና በሚፈቅዱት በይሆናል ባይማርም በሚቆይ በሙያተኞች በባርካ በመለሱበት ባለመሰብሰቡ በመቅረፁ ቢሾፕ በዕውቀቱ በአምባሰል በእጅም ባለንብረቱ ባንካችን በፍቃድ በማጣቀሻነት በኤጄንሲው በሚጠራበት በተነሳችበት በሚያደርጉባቸው በዋቤነት በተፈፀሙ ባጠገቡ በተጋባዥ ብራውን በአውሮኘላን በማሳረፉ በአሲምባ በፊትህ ባጠገብ በመድረጉ ቢቀጥሉም በመውጫ በመያዝም በተቀበለው ቢቋቋምም በመድሀኒት ቢዘጋም በመፈፀምና ባልተረጋገጠበት በቅርሶቹ በለጋሾች በተከፋፈለ በመመዝገቡ ቦሎቄና በሙዚቃዊ ባለመፈጠሩ በሣዑዲ ቦታዉ ባለድርሻነት በምታዘጋጀው ባወጣዉ በእነሱም በመሉ በታንዛኒያዊው በተገደሉበት ባንዳነት በልዑኩ በኬን ቢተመን ባለመገለጹ በዑደት በማኅበረሰብ በማይታይበት ቢቨር ቤተመዛግብት በተድበሰበሰ በሰሯቸው በደሟ በሚፈፅምበት በቀኙ ቢታገድም በመክፈልና በጥጥ በሳሚ በሳማ ቢያመሩም በመቅደስ በማስቆጠራቸው በመክረማቸው በጋሻውና በፍሎረንስ በደራ ቦታዬ በሚተላለፉ በተራራ በቅቻለሁ በእድሜያቸው ባደረግኩት በሚያስተላልፉና ቢለምነው በመደፈሩ በተፈረሙት በሩቅም ብያቸው ብሎዋል ብሄሮችን በቀዝቃዛው በጋቦዴ በተነፃፃሪነት በአሉታ በሞምባሳና በፓርቲነት በአዲስነት በአንጃነት በመመራቱ በአለበት በፅናትና በማኖር ባይወስድም ቤናዚር በመተዳደር በሚያስፈራ በሚባለዉ ቢላኩም በመረሐቤቴ በደጃዝማች ባይነቱን በሰቲት ባሕሉን በፍርፋሪ በካሉብና በድራማዎችና በተገደሉት በተቃዋሚዎችም በሳምሶን በጊዜውም በአይፋ ባፈነገጠ ባልተጠቀሰ በተደፈረበትና በአዘዞ በሪፖርተርነት በማቅረባቸውና በተጨዋቹ ባሉና በስምረታዊ በመሆኗም ባሉን በወረዳውና በኤላፈርዳ በላሊበላና በየጊዜውም በቆሎው በላህ በፍቅራቸው በወንጌሉ በአልኮል በኋላቀር በሊግ በሚመጥነው ባልዋሉበት በቀጣና በየኬላው ቡኋላም ባምቢስ በተባባሪ በመና በሐርጌሳ በቤተክርስቲያናችን በመሰረዝና በማግባቱ ባፍዋ በገለጹ ባትሆን ባለቤትነታቸው ብንልስ ብልኃት በማተኮራቸው ባዝንም በመመስረትና በጹሑፍና ባልገቡ ባለመግባባታቸው በሕይወትህ በደብር በተባባሰ በመገለል በመደጋገም በመዘርዘርና በሠራተኛና በሠለጠነው በሚጥል በማስረዳታቸው በቅሎና በመጻጻፍ በተለያም በምዕራባዊያን በረከቱን በሚገባን በሐሙሱ በደሳሳ በማታገል በሐሙስ በአሳታሚ ባይከፋም በእግዚያብሄር በአብዛኛዉ በማይገኙበት በአጋሜ በማጥቆር በፈጠረባቸው በድምጽና በኢትዮጵ በዛሬማ በማራቅ በመስፈርቱ በሰምበል ባፀደቁት ብቸኛዋን በአረንጓዴው በማጉደል ባቢሎን በዕደ በታለመለት በአስፈፃሚነት በተቃጣው በኪንሻሳ በመፈቀዱ በርሸና በማገርሸት በመሆነ በአጋር በርሚንግሃም በስምንተኛ ቤተክርስቲያኑን ብሎዋት በሥራዎቻቸው ብይኖች በዚህኛውም በመጻረር በደጄ በየቢሮው በሚመስጥ በቀንጢጫ በተመለሰ በደንበኞቻቸው በአየርም በዳዊት በማገዶ ባይካድም ብሞክር በዛብህንና በመደነቅ በስድሳ በማዘግየቱ በኣባልነት በሃገራቱ በመወለዳቸው በመካኒሳ ቢቀጥልም በሕጋዊው በእንቁላል በሚሳይል በሻይረሱ በአፋን በኦቲዝም በኮሙኒቲ በጾታቸው በእዚያ ቢቀላቀል ቤትዋ