            amharicWords[9, 4] = "ቢሮዎቻቸውን በሚንቀሳቀሱባቸው በተወሰዱ በመቅደድ ብትችል በሃምሌ በክፉው በሎሌነት ብቻህን በመጸለይ በማሸጊያ በሚቆጠረው በመንደሯ ባያደርግና ባዕዳንን በማስያዝና በማሳመንና በቃት ባልደረቦችን ቡራኬው ባወጡ በተለዬ በባረቀ በእግድ በማሽተት ቦይኮት በጎንዮሽ በቤተሰቦቿ በማቀበልና በሚጻረር በደጋፊያቸው በአማፅያን በገነባው በምሥረታው በከፈተበት በተባበሩ በሰኞው በአምራች ቢከፋም በጎም ባይማር ባለሰልጣናት በመዉጣት በሳምንታዊው በቁርጠኘነት በተነው በተጠመዱ ባልጀመሩና በመዐህድ በአህመድ በሜዲካል በመፈራቱ በእድሜና በተጠቁት ብትመጣ በፍራንክፈርትና በረካ በማሳደጉ በአበው በተቀመጣላቸው ብሪያን በደስታውም ብዙኅኑን በተጋረጡበት ቢታሰብበት በመጠቀሟ በሚስችሉ በአቦሸማኔ ብፆትና በተስፋፋባቸው በሚከፈል በአቡዳቢ ቦደን በሚሸፍን በተሰደዱ በሚጭኑ በኩባያ በደርባ በዜግነታችን በአባይና በግዢው በዲዛይን በየመሐሉ ብላችሑ በአብያታ ብታምኑም በቢመዓልቱ በመስበሩ በሚያሰራጨው በመደጎም በካሪቢያን በካራቴ በማቅረቡና ባህርያቸው በውይይታችን ቢመሠረት በአሰቦት በመደብደብና በመጠይቁ በፖሊቲካ በጄኔቫው በመገጣጠም በቀጭኔዎች በማለዳ ባመዛኙ በሚፈፀምበት ባታሊየን በማስተካከልና ባስር በፓስፖርት በማከምና ባደርጉት በርእሱ በሚገርም ቢገልጡልን በማጣቱና በጀብሃ በማከራየትና በመስጅዱ ቢረሳ ባረጋገጠው በኤርትራዊነቱ በማይሰማቸው ቡልኮ ባለቤቶቹን በኢትዮጵያውያኖች በውቅቱ በቃጫ በቄራ በተደራራቢ ባለመጀመሩ በአልጄርስ ባርኔጣዬን በብኣዴን በየሰዓቱ በጹሑፋቸው በአሮጌ በግጭቱም በአህያህ በአምሳለ በደመራ በመካከላችሁ ባልታየ በሄድንባቸው ባሳደሩት በተጎራባች ቢቀበሉ በሀገርህ ቢያድግልኝ ቢቀበል በመስፋፋታቸው ብርሃነና ብዱን በሃኪሞች በየብስና በፊታችን በጣዕሙ በሶማሌላንድ ብሶቶች በመርማሪዎች በሚፈቅደውና ባለጊዜዎች በመድብለ በማሳጅ በእስልምናና በዳዩ በምንገኝበት ባይናገር በምትል በሚታወቀውና ቢሰማሩም በነቢዩ በክህደትና ባቀረቡ በቃላችን በአምባገነናዊ በሶላር በኢድ በዓርዓያነቱ ቢደረግበትም በመሳል በዘመናችንም በሚተላለፈው በክልልሉ በዝቋላ በመገደድ በኡጋንዳና በስካንዲኔቪያ በማዟዟር በዳጋ ቢታወስም በአድባራቱ በዘጌ በሰየሙት በሙሰኞች ባቋራጭ በየገበሬው በመፍረሱ በአሳማኝ በፈቀዱት ባላንጣነት ቢማሩ ቢልኩ በሲዲኒው ባቀናበረው በተገልጋዮች በጤናውም በሞባይሉ በኩዌትና በእነኝህ በመናቅና በአይሁድ በሚቀርብ በአረም በአድባራት በማጥበብና በማዘን በልዩነቶቻቸው በአስመጪነት በኃዘኔታ በፍቅርም በነዱጅ በተበተነ በልደቱ ቧንቧው በበደለ ቢሳተፍ በመተካቱ በአገሪቱን በመታለል በበዓታ በማነሳሳትና በማኅበራቸው በፈረስና በክልልም ብንጠብቅም በተቋረጠ በዕዳጋ በንጉስ በየራሱ በሰራተኝነት ባልነዉ በኢጋድና በሁላችን ባለንብረቶችም በሚያስተዋውቁ በዋርዴርና በዳላስ በቱትሲ ብዙኅንና በሩዝ በክሪስታል ባመነበት በመሳቅ በነሱም በጃፓንም በደንቆሮ በሌላት በማይገኝበት ብዙኅንን ቤቫን ባለሶስት ቢሶች በአርሰናል በሐሰን በልቷል በኣቶ በእምነቶች ቢቀየስ ባላነሱ በአገዛዙና በሜታ በመገናኛና ብልጫውን ብቻቸው በሐጎስ ብላችክ በደመና በካርታዋ በዘለፋ በሕብረተሰቡና ባንዱም በዘንድሮውም በመመስከር ቦዮችን በመትጋት በአጋጣሚም በእጆቻቸው በፋብሪካዎችና በኤሌትሮኒክ በሃሳቤ በእንግሊዛዊው በማብሰል በሚገነቡት በመቅጠፍ በመአከላዊ በኖሩበት ብሉምበርግ በያመትባሉ በነፍጠኝነት በግትርነት በተጠኑ በጦረኝነት በቆራጥነትና በተሸናፊነት በመድረሳችን ቢሻሻል በበሩ በተቀበሉት በነርስነት ባለመጣጣሙ በሚያስተምርበት በጉምሩክና በተወደደ ብትገኝም ቢነገ