            amharicWords[9, 5] = "በከፈተችው በተግባራዊ በሚፈጥረው በፍቼ ብቻችንን በምናደርግበት በመሰቦ በአቻነት በይዞታቸው በዲኬቲ ባህላቸውንሊያዳብሩ ቤርሎስኮኒ በየቡና በአክራሪ በባይድዋ ባለም ባይደርስም በፀፀት በአክሽን በማስመር በሲዳሞ በአይኔ በትኖ በእገታው ባለመውሰዳቸው በስብሶ በጋዜጣቸው በሉኝ በህውሀት ብንሰራ በማጋለጡ በጥሶ በደፈጣ ቢያሸንፉ በጋሞጎፋ በአረቦች በማሳነስ በጥምቀት በመቀራረብና በቁርባን በዩኒስኮ በኢንተርኔትና በደኖች በሰላይነት በሚሠሩት በተፈረመ በገለፁት በማስታወቁ በገባንበት በጠየቁበት በመጠየቁና በማሳበብ በሂደቱም በዘረኝነትና ባንድና በፕሮፌሽናልነት በማሰልጠኛው በድልድይ በተሰጣት ብሩንዲን በመሸነፍ በአዘጋጅ በተሣካ በታቀፉ በነጆ በፀና በመጠበቁ በሥጋና በሰራተኛና በተወለዱበት በለስላሳ በንጹሃን በሰባዊ በሰለጠነው በማጣመም በጅዳና በተፈጸመባቸው በኡጋዴን በባለሃብቶቹ በዲቁና በመጠጣት በእንግሊዝኛው በመጠርጠር ብዕሩን ቢበዛም በአድራሻው በፈለጉ በተተኮሰበት በማካሄዳቸው በመቅደም በኤርትራዊያኑ በህወሀት ቢሄድም በእርስና ባለሌላ በማመናቸው በአርያነት ባለስምንት በስብከተ በሐዋርያት ቢገባውም በአሰሪና በተራቆቱ በጊዳ በመግባታችን ባለኃብቶችና በሥጋዊ በጀታቸውን ባያውቅም በመግደሉ በተቀጣጠለው ባሉበትና ቦታዋ በአምባገነኖች በተጠማዘዙ ባነሱ በመቅደሱ በቀነ በእማኝነት ባላባቶችና በቆሎን ባለቅኔና በኣጠቃላይ በድርብ ብጹዓን በመርዳትና በማስመዝገባቸው በከፍተኛና በተከታታይነት በሳር ባለመረዳቱ በሆዳችን በፍትሃዊ በሚያጋጥማቸው ባለፈውም በተተከሉ በተፃረረ በሚተላለፍ በተቆጣጠረው በህዝበ በተሰብሳቢዎቹ በማወቁ በሕመምና ብስጭትና በመግረፍ በደመቀና በመደገፋቸው ቤካም ቢባልስ ባለቤትነቱ በየሃገሩ በድቅድቅ በለገጣፎ በድርጅትና በትርሓስ በየጋዜጣው በጎችና በማሳጠር በጎልጉል በደኑ በቶጎ በግምገማና በደኖ በሚያልፍበት ቢቀሩ በመጠራጠር በስዕለት በሞከሩበት በመቀስቀሱ በሚወጡት በወሩ በመሸጣቸው ብቻሽን ባካችሁ ባለማክበሩ ብዙሀኑ በሽሙጥ በረደኝ ቢጠቁሙም በመሰለፍና በድንበሮቹ በአቅምና በግዙፍ ባልያዙ በፖሊሶችና በምንድን ብላቴና በቴክኒካል በመፍጨትና በኢኮኖሚያችን ብላቴን በጋዛ በመምዘዝ ብትሉኝ በአገሪቱም በይልማና በመጫኛ በአቋማችን ቤተከርስቲያን በሚያመጣው በመሠለፍ በላብ በነዚህና በሚመቻቸው ብሮሜት በወጋጎዳ በማገዱ በደጅ ብንሰጥ በሂውማን በተመለሱ በደግ ባለሰባት በሚካኤል በአኝዋኮች በነዚያ በውንብድና ባልተማከለ በዩኒቨርስቲዎች በዕጩ በመቀጠር በሀይማኖታችን ቤታቸውም በመልበስና በመጓተቱ ባነሳው በከብቶች በማመልከቱ በድብደባና በትእግስት በመሣሪያነት በኋዋላ ቢያዙም በግልጽነት በአብዛሃኛው በክንፉ በእስላማዊ በሌፍተናንት በሚከናወን በስሜታዊነት በጌታ በምትፈልገው በመተባበርም ባይነትን በእግረ በቀንም በድስፕሊን በመዝፈን በሌሉ በተምቤን በዋጋው ቢሰጡን በሪልስቴት በቁጭትና በቤቶቹ በተወሰደበት በመንደፈራ በተሰነዘረ በምርትና በወጥ በተከሰሰበት በወጭ በአረንጓዴ በፕሮጀክቶች በውስጤ በርካቶቹ በሻእቢያ በጭፈራና በሚያደርሱት በከልሉ በትልልቅ በድንቁርና በማቅረብም በሞግዚትነት በታቀደበት ባለቤትዎ በማዋሀድ በመሸመት ባይቀርብም በጋምጎፋ ብለነው በሶርያ በኃይልም በኢትዮጵያዊያኑ ባለማሳየቱ በፍቅረ በስማ ቢቀርም ባለቤቶችም በቀልንና በሙስናም በየበረንዳው በሚያሳድግ በማሰናበት ቢረጋገጥ በመናገሻ በማለቅ በደኢህዴን በጉራፈርዳና በማድረስና ቢንቀሳቀሱ በልዑካን በሶማሊያዊያን በህዳሴው በኢትየጵያ በዲቪ በእኔም በወገናዊነት በማምከን በመፍትሔ በምዝበራና በበለፀጉ በቫት በባቡሩ በቃህ በመፈጸሙ በቃ