            amharicWords[9, 6] = "በተጓዙበት በአካላዊ በገደምዳሜ በሂውስተን ባለመታወቁ በጥልቀትና በላይነትን በደካማ ቦኖዎች በማከናወናቸው በተሻለና በጉዲፈቻ በፈትነት በቡድንም በኦሮሞዎች በአብሮ በፖሊሲና በጥቂቶች በሽማግሌዎች በሽበሽ በታዳሽ በመታቀፍ በዓሣ በቢሮአቸው በሚዘጋጅበት በመናገርና ባለሙያን በጃንዋሪ በሰባተኛ በመሰሉ በዚያኛው በሦስተኛነት በሰፋ በበሳል በማጀብ በሚገልጽ በስብሰባዎች በብሉይ በማብዛት ባክቴሪያ በሚፈጽሙት በታሪፍ በተጠቀሱ በማገባደድ በማኑፋክቸሪንግ በተወዳዳሪ ቦምብና በሚላቸው በሥፋት በሱሉልታ በሚነገረው በፍርዱ ቢይዙ በፎርፌ በሚፈልጉበት ባህላችንን በክርስቶስ በቴፕ በስኮትላንድ በየበረሃው በመረጣቸው በቀልጣፋ በየአገራቱ ባገኙ በዓረቡ በዳሰነች በብርድ በአይነ በቅባት በስዊዲን በኢነርጂ ባህሪያቸውን በዜጎቻችን በአሸናፊዎች በጦርነቱና በአውሮፓውያን በሽላሎ በተሰነዘረው በመስራች በማስከበሩ ብረቶች በማላመድ በመስመጡ በተሰበሰበት ብኩንነት በአንፃራዊ በተጠርጣሪዎች በማረጋገጣቸው በተነገረው በኦነግነት በሥር በኤግዚቢሽኑ በተኙበት በአምስተርዳም በርዕስ በማበጀት በኢትዮያ ቢውልም በቆራሄ በመፈናቀላቸው በሆነባቸው በዓላችንን በድንግልና በዙሪያ በፀዳ በቅሎዋን በሎሳንጀለስ በፈጠራቸው ቢመደቡም በዘፈኑ በአስፈጻሚው በደሌ በቢሮውና በደሙ በጤናማ በቸርችል በምትኩም በቃልና በጅጅጋና በተባለለት በአክሱምና በንጹሕ በሚመሰረተው በጋሽ በእምነቱ በመኮብለል በወልቂጤ በማስቆጠሩ ብናቀርብም በተፈረመበት ቢለቀቁም በወይን በገበሬዎች በማበረታታትና ባመጡት በርካታዎችን በማያገኙበት ባለቤትነቷ ቢመለከቱ በማጧጧፍ በተመልካች በወለድ በሚሸጡ በቤኒን ቢመለከት በክፍፍሉ በአንገቱ በዙሪያዬ በተቅማጥ ቤተሰቦቻቸውም በተመደበላቸው በአሉታዊ በተከለከለ ብትሉ በአብዮቱ በወልቃይት በመልካ በሚያገናኘው በመንግስታቸው በየእርከኑ በትግሬዎች በሆነችበት በደጁ በሚጥሱ በተሰሩት በመታገዱ ብታደርግ በእንክብካቤ ቢራዘም ባህሎችና በራችንን በፖለቲካም በቀደምትነት በጠበቁ በምኞት በኃላፊነትና ቦታዎቹን በጠበቃ በመነሳትም በኢሉባቡር በርሳችሁ በመደለል ባንዶች በማቻቻል ቢፈፀም ባለመክፈላቸው በግብአት በአገባቡ በግልጽም በመሄድና በአመዛኝ በኒዮ በገርባ ቢናገርም በባልትና በቅርበትና በገዳሪፍ በጽንሰ በእነአዜብ በገንዘባቸው ቢረጋገጥም በእነዚያ በኮፐን በምግባረ በአንደኛና በተጋነነ በጊዜያቸው በዲፕሎማና ባልደረቦቼ በተፈፀመባቸው በአዋቂ በውስጠ ባሳብ ባህሪያዊ በአዊ ባይደረግም በዬቤቱ በማመስገን በፈንታሌ በግድቦች በየምርጫው በፒያሳ በነባሮቹ በምትሰጠው በትብብርና በጨንቻ በመያዣ በሚያገኙበት ቡናማ ባላፈው በሕዝቡና ቢዝነስና በዛሬዋ በማሳወቁ በፊንላንድ በተዘጋጀላቸው በማለቁ በሚደረግለት በኮብል በአጠቃለይ በግቡ በወረረበት በፅሁፉ በመረዳዳት በሕብረተሰብ በስተ በሃሰተኛ በኢሣያስ በርቲኒ ብንገባ በራሱና ቢያሳውቁም በላከችው በሃራሬ በማለቴ በመከለል በዛሬይቱ በመለወጡ በኒጀር በሚፈጥር በተፈጠረባቸው በአቋሙ በተዘጋጀውና በኮፊ በልማታዊ ባለራዕዩ ባላይ ባዶነት በገበሬ በማደራደር በአማራነት በኤድመንተን በመሰረቱት ቤኒን በመንደር በጀተ በጥራቱም በያቅጣጫው በመንቀሣቀስ በተለያ በናዝሬቱ በቃች በማድረጌ ባለስለጣኑ በወለደው በሰጡትም በቀንድ ባይኖራትም በምንልበት በደሉን ቤተክርሲቲያን ቢወሰድ በደምሳሳው በማደጉና በጣሊያኑ በአያያዝ በኋላማ ቦሩሲያ ብዙኀንም በዓለማያ በሀገሬ በየአቅራቢያቸው በመሃከላቸው በተወጣጡ ብላኝ በእኛው በዘገባዎቹ በኢት በበዓለ በመትመም በመጥቀስም ባሌን በማጥፋትና በዋለበት በአሰልጣኝ በስኳርና በደብዳቤአቸው በል