            amharicWords[9, 7] = "በብይኑ በመዘገብ በሕይወቱ በቻርተር በህውላ ባንዲራዎች በህቡዕ በዬነ በአካባቢውም በነጠላ በታኅሣሥ በስልጤ በውነቱ ባሮች በጋምቤላው በላያቸው በተማሪ በሚወጡበት በቢሯቸው ባደረጓቸው ብትቆይም በፍላጎታቸው በሚያጠቃቸው በሔግ በየገጠሩ ባጅ በተደረሰበት ቤል በችግርና በአየርላንድ በጾታ ባፉ በመኾኑ በመንግሥታት በዕውቀትና በተስማሙት ባንዲራን በቦን በተፃራሪ በዩኒሴፍ በተመረቀበት ብዙሃኖች በስልክና በተዘጋጁት በፌስቲቫሉ በሳንጃ ቢሰሩ በመሰረተው በረሃቡ በመጣሉ ብጥብጥን በሴራሊዮን ቢገባ በቡሩንዲ በዘጠኙም በትግላቸው ቢታይ ብሔረ በመስጠቱና በመፈለጉ በተከለለው በሪጅኑ በልጅነት ባለመሆኗ በሚገኘውና በማስጠንቀቅ በሰዎቹ በመረጋገጡና ቦት በምገባ ቦካ ባሕላችን ብትለኝ በማሳጣት በምሥራቃዊ በወሰኑት በአንዳንዶች በተልዕኮው በእምነታቸው በመቆሙ በውኃና በመፈታተን በሊሙ በማፈራረስ በሸዋሮቢት በሊቀ በዚህችው ብይኑ ብአዴኖች በማድረሱ በፈነዳ በውኃው ባለፍው በመልስ በጋለ በረከትም በዕቃ በመፍቀዱ በደምቢዶሎ በተያዘበት ቢታዩም በሚደርስበት በመስማማታቸው በቅንፍ በማጋለጣቸው በመቻሉና በመክሰስ ባለውና በድርድርና ባለመፈፀሙ ባለማድረግ ቦትሊንግ በመዝነብ በንብረትና በፋሽስት በምርምሩ ቤቶቻቸውን በአፈጻጸም በልጃገረድ በቀበሌዎቹ በተገባደደው በማፈናቀል በረከትን በጌዶ ባለቤትዋ ባለመጠናቀቁ በዲማ በክላስተር በቸልተኝነት በደላሎች በፍራንኮ በመውረስ በርቀቱ ብንወስድ በፍጥነትና በማንነታቸው በጅሮንድ በጠየቀችው በኤሌክትሮኒክስ በማሳየታቸው በስብሃት ባከበረበት ባቀረበባቸው በዩኤስ በአየርና በየዞኖቹ በመታሰር በተወሰደ በመሰየም ቦሳሶ በፍርሀት በልቼ ባልጠበቀ በአውሮፕላኑ በጎንደርና በተጠናቀቀ በመማሪያ በደንበኞች ባለመፈለጋቸው በምሁራኑ በመጅሊሱ በሕዝበ በዚያውም በበሽታና ብወዛ በኣግባቡ በዋሻ በማስፋትና ባለሀብቶችና በአደማ በቁጥጥራችን በማወቅም በየዘመናቱ በንጽጽር በዘጠነኛው በገንዘብም በመለያየት በአገሪቱና በባህረ በልደት በፌዴራሊዝም በመጠንም በካህናቱ ቢስማሙም ባቀደው በወቅታዊው በመበደር በዋግ በምስል በሁለትዮሽ ቢመስሉም በገደል በጂማ ባመቻቸው በመሠራት በተከናወኑት በስልጠናና በማይጨው በኢንቨስትመንቱ በመስፈኑ ብዙዎችም በጥሪው ባናውቅም በቅጽል በድሃ በተዘጋጀበት በቤተሰባቸው በስነምግባር በተመቻቸ በድረ በታሰሩበት በሰጠን ባለሥልጣንም በጀርባው በሚፈልጉ ባህሪና በመጻፍ ቢጠይቅ በቻድ በዘጠኙ ባለቤቶችን በድንኳን ብትሄድ በስርዓቱ በአምባሳደርነት በነበረባቸው በመልዕክታቸው ቤንች በፈጸመው በትግላችን በመድፍና በመኖራቸውና ብልህና በኤችአይቪ ቢያደርገውም በትዝብት በድጎማ ብላተር ቢዘገይም በውኑ በየመኖሪያ በአፈንጋጮች በመገደዳቸው በየመስኩ በፈተና ብሩና በማንፀባረቅ በሞቱ በይርጋ በሞቴ በአግራሞት በክልላቸው በቆመጥ በሺሕዎች በብሔሮች በማከራየት በማባከን ባለማወቃቸው ባንዳንድ በዛላአንበሳ በፍትህና በኢተፖድህ በሰበታ ብስለትና ብቅል በፓርቲያቸው በባለቤታቸው በአስፈፃሚው በህይወቴ በዋጋድጉ በዛላንበሣ በሰከንድ ቢቆይ በንቃትና በደረቱ በውስጥዋ በሟቹ በመጨረሻዋ በሞምባሳ በስፖርታዊ በወልድያ በሰሊጥ በአንቶኖቭ በአያሌ በማድርግ በዓይነትም በሠላምና በመጥረቢያ ባሕልን ባንድነት በኮከብ በብሪታኒያ በሚደረጉት በለቅሶ በቤጂንግ በተመሰረተው በፊዚክስ በአፈሳ በበጀቱ በጅዳ ቢጀምርም በሥራና ብጹዕ ብሔርም ባይቻል ብዛቱ ቢታይበትም በአምባገነን በቲ በመቀመጥ በፋሲካ ቢወሰንም ባይገኝም በተፈጠረላቸው በተደረገለት በአያሌው በወንዞች ቢሠራ በጁ በስንቱ በመገስገስ በሲያትል በሚንቀሳቀስባቸው በበቀል ቡ