            amharicWords[9, 8] = "በዶሮ በመጠጋት በማጣጣል በምዕራብና በልምምድ በማጣጣም በካቴና ቦሎቄ በወይዘሮ በተፋሰስ በጸጥታ በኤርትራውያኑ በቬጋስ በመሸጋገር ባውዛ በሚታይባቸው በፓርኩ በማውረድ በጓሮ በወዲያኛው በመከናወኑ በምዕራባውያን በርበራ በማምረትና በሚኖራቸው ባለሞያ በአምባገነኑ በት በቤታቸው በኤሌትሪክ ባርካ ባህላችን በተዘረጋው በተቀሩት በማስተጋባት በመካሄዱ በሰፈነበት በእድሜ በሚጠቅም በመሮጥ በሰለጠነ ቤኒሻንጉል ቡቺሊት በገዳሙ በምስክርነት ብጡል በማህበረሰብ ቤን በጎደለው በማስተዋወቅና ባሕታዊ በመቆጠብ በመቀየስ በልጃቸው በሞራል በዚያኑ በመጠየቁ በመቻቻልና በረጅሙ ቦዘኔዎች በግድያ በሰፈራ በመንገዱ በቤተሰቦቻቸው በማዘጋጃ በስዊዘርላንድ በመብረር በጋሻው በአትላንታ በሐኒሽ በርግጥም በማያውቁት ብለሽ በዙሪያው ባለስልጣንና በመስኖና በቆዩባቸው በትራፊክ ባየርን ባድሜን በእርስዎ በአሊቴና በደብዳቤያቸው በኦርቶዶክስ በፈረንጆቹ ቦዘኔነት በተቋቋሙት በሚመለከትም በወጉ በእንጨት በሚካሄድባቸው በራሣቸው በመፈቃቀድ በመውረር በብረታ በተከናወነ በሠራተኛው በሚያካሂዱት ብሔረተኝነት በረሀ በታንዛኒያ በሆሳዕና በማስፈፀም በሚያቀርቧቸው ባለሁለት በአመፅ በረኛ በጎሳ በሀገረ በመታየቱ በሚቀርቡ በጥራትም ባላነሰ በዘመናችን በተወለዱ በማሰልጠንና በኢንዱስትሪው በመሬቱ ብቸኛዋ በየቀበሌዎቹ ባከናወናቸው በበላይ በተባለች በኤክስቴንሽን በጥምረት ባንዱ ባሬንቱን በማልማትና በማሳመን በመነጨ በሚሊየን በሚሆነው ቢመጣም በቅርስነት ብልሹነት በመግለፃቸው በመሪዎቹ በመሪዎች በዘመናዊና በመሆኑን በምስክር በትላንት በጉራፈርዳ በመንግሥትም ባቢሌ በተነሳበት በሰንሰለት በሙዚቃ በጠራራ በቤቱ በግጦሽ ባስቀመጠው በጨዋታ ብሔርና በመዘንጋት በሃላፊነት በትዝታ በሸምበቆ ቤተሰቦችም ብርሌ በማደጉ በማለትና በተፈፀመበት ባለጉዳይ በእንሰሳት በሚመስል በማካለሉ በማየታቸው በቦታ በየክልሎቹ ብረትና ብሶታቸውን በዐቃቤ በሽተኛው በአስመራና ባታሊዮን ቦን በኮንሶ በመደርደር በጉልበታቸው በማውጣትና ብስጭት በእዚሁ በማብራራት ባለንብረት በኅዳር በመልሶ በግብይት በያዛቸው በያዘበት ቢያደርግ በወታደሮች በተከተለ በዓውደ በማዘጋጀትና በመዝረፍ በተራው በካድሬዎች በስደተኝነት በመንበረ በመጀመር ቢጀመር በቀበሌዎች በሰንዳፋ በዲላ በካንሰር ቢመጡ በሚያደርጉ በስተምዕራብ በማጥበብ በተውጣጡ በዴሞክራሲና ቢደርስም በእነአቶ በተመሰረተ በአማካሪነት በሽንሌ ባሉባቸው ቢኖራቸው በውክልና ባለሀብቶችን በእድገት በዘዴ በንቲ በካምፓላ በታሰበው በኢሰመጉ በትግሬ በበቅሎ በመፃረር በሰማዕታት በታየው በሠራተኛ በማይችሉበት በየት በመዋቅር በአግባቡና ባቡርን በያሉበት በመሻት ባህሎች ቢውል በዛች በሀሳብ በአወሊያ በምዕራባዊ በሚመለከተው ባቡሩ በዜናው በመምረጥና በማከም በፖስታ በዓዲግራት በአይሮፕላን በተካፈሉበት በግምባር ብትባሉ በተከሰተባቸው በሚፈጠረው በማርካት በማጥናትና በዘላቂ በቅናሽ በጣልያን በመመልመል በርሃብ በኦብኮ በሁለተኝነት በዘለቀው በመደበኛነት በተፈረመው በማሰቃየት በንድፈ በክቡር በታሪካችን ቢከሰት በመቆፈር በሚሌኒየም በተሰየመው በመንከባከብና በመቶኛ በፕሮጀክት ቢጤ ባሻ በልዩነት ባላባቶች በነጋሪት በኮሎኔል በመግባትና በመከልከሉ በገንዘቡ ባሻገርም በተማሪው በመሰለ ብሔሩ በጥያቄው ባስመረቀበት ባለበትና በተጠያቂነት በካይ ባለኝ በባህሬን በተጭበረበረ በአካባቢያችን ብንመለከት ቤተክርስቲያናት በማስተባበል በከረን በፎቶ በሚያወጣው በመልሱ በሰሜኑ በሰልፉ በወሳኝ በመፍቀድ በክልላችን ቦታዎችም በአካባቢዋ በማጠቃለያው በምሳሌ በማስጨበጥ በውሃና ባ