            amharicWords[10, 0] = "በመማረክ በሞ በእለተ በናኖቴክኖሎጂ በመፈታትና በመዓልት በዜማም ቤተመንግሥቶች ባለበጀት በመጠፍጠፍ በአካዳሚ በተሰብሳቢው በፈቃድህ በሯ ብሮሱሚች በጉረፈርዳና በሬዎችና በሚማርበት በሃይማኖትም ባሕሪን ቦርደዴ በሶ በተላያዩ በባሕሪያቸው በየግንባሮቹ በኢምሬት በሚባክንባት ቢሮክራሲውንና ባሪያና ባለመሥራቱ በኢትዩጵያ በተኩሱ በምንችልበት በጮኸ ብርሃንን በቅናት በኮሶቮ በፈቱበት ብርቱካንን ብሄራችን በማስገበር በክፍለከተማው በግራዋ በቀትር በሚዘረጋው ብዛቷ በቋሚነትም ቢደራጅ በቀደመው በዊኒፔግ ቢወሰዱም በመታለፉ በሰፊውና በቆየንበት በቢ በጃፓናዊያን በሚመደቡ በማስኮብለል በማዳከምና በቀላልና ቢያጣጥሉትም ባነሷቸው ብስለታቸው በሚገጥማቸው በዐይን በአካበቢው በማይባል በሚያዝዘው ብችል ባይታይም በገንቢ በሒክማ በተረኛ ብትከተልም በባንክም በማገዳቸው ባይሳካ በቱርክና በየፌርማታው ቡርዣ በሰሩበት በኒ በማቀላቀል በና በተለቀቀ በየልማት ቦታወች በኢጣልያን ብልሹነትን በናሽናል ባለመገደብ በአ በኦጋዱጉ በራሴድ በዬሰርጉ በቁርጡ በኢ በመቀስቀሳቸው በአባትና ባሕርዳርና በተጨባጭም ቡድኗን በረሃውን በተቀረፁ ብንፈልግም በፓርቲና በየደረሰበት ባስጋጣቸው በተሾሙ ብርጭቆና በክብደታቸው በአፍዴርና በሥርዓቱና በቪድዮ በኅቡዕ በዕቃው በቁርኝት ባምስተኛው በጭፍኑ በእስራኤሎች በተሰራጨበት በወጀብ በመቁሰሉ ቢተጋ ብዕሮች በመካፈላቸው በእግርህ ባለድሎቹ በሴማናሩ በማስመለከት በጊንጥ በሚያከናውንበት በሙዚቃችን በሚዘጋበት በሽሬእንዳስላሴ በማደን በፓርላማዊ ባጠረ በአዝጋሚ በሕመሙ በአካውንቲንግ ቢከናወንም በምትልከው በማድመቅ ቢያመልጥም በዘ በሚያስተምሩበት ባያጠያይቅም በዴቪድ በቪየትናም በዳሸን በየዓይነቱ ቢፈጽሙ በዪ በክፍሏ በትንትናው በኦፊሲየል በደስታም በእሳቸውና በኢዴፓና በመምታታቸው ብርሃነየሱስ በመንከስ በእነአባይ በንድፍ በየምዕራፉ በአባሎቼና በለጸጉት በጀ በሚያጠናክር በወንዞቿ ባሪያው በሃያኛው በሚታዩት በየዋሁ በጉ በመልዕክት በመቶም በተገለሉ ቡሎ በሶሪያና በኖርዌያዊው ባለጋራ በመሰማረታቸው ቤ በተጠረጠርኩበት በማእድናትና ቡም በተጫዋችነትና በተማሪውና በእንዶድ በይሁንታ በስውርም በመከር በጥ በአንጃ በሽፍትነት በሼር ቡራ ብሪትሽ በድሎት በጥድፊያና በሞታችን በማዕከላዊና በቤተክርስቲያኒቷ ቢከሰቱ በመጭበርበሩ በሥልጣነ በሚዘገንን ባሳዩበት በፌብሩዋሪ ባሶችን በፊ ባትችልም በዜጎቿ በሚገመተው በብብቱ ቢያውጁም በአሰልጣኞቹ በተጣሉ በመታጠፍ በመድረስም ባይሞት በተከሠተው ባቀረብኩት ብቻነው በስተኋላም በሚያቋቁመው ባለታሪኮች ቢሆናቸውም በሚላክ በእርሰዎ በማዳበርና በአይቮሪ በፍራንኮቫሉታ በመቅረጽና በላይነቱን በሐይሉ በሚመሯቸው በአይነቱና በመገልበጡ በባንኩና ብንችል በአንቡላንስ በተካሔዱ በኢኮኖሚክስና በተለያዩበት በእጂጉ በታማኝ ባደረግናቸው በሐይል ባለቁበት በኋላቀርነት በኔፓል በባሕርዳሩ በማናቆር ቢቃወሙ በብሎኬትና በመግደሉና ቢገምቱም በሌለሁበት በሕንፃው በዝንብ በዝቶባቸው ባለማዘጋጀቱ በከፋፍለህ በተፈቀደ በተጨምሪ ቢወድቅ በይዘቱም ባለማደሱ በመታመስ በመግፋታቸው በፋኩልቲው ባስቶስ በስክሪኑ በማሸጋገርና በመገንባታቸውና ባሠራጩት በታሪክነት በአረካና ብፅዕት ብትገቡ በፈንጅ በተሰማ በሚንስትር በጥራዛቸው በቦታውም ብትገባ በብልህነት በአዳም በተሽከርካሪው በካሊድ በመከላከያነት በግብርናውም በርችት በአጥንታቸው በተጣራ በተወልደ በጦርና በፖሊቲካዊ በማስቀረብ ባርኮ በሚያደርሱ በመዋጡ በንግዱም በሔድኩ ባህላዊውን በባድመንና በርትተህ በደህነት በማስመለስና በተዋጊነት ባንዳው በጥንካሬና በሁለታች