            amharicWords[10, 1] = "በትክልል በረራዎቹ ቦምቦችና በሚተዳደር በዘርፈ በምክንያታዊነት በካህናትና በቅስና ባለመነገሩ ቦንኬ በበኩሌም በአይናችን በቃሊቲና ቡሩንዲን በመስጠታቸውና በእደ በመዋዕለ በፌዴራልም በአርማታ በሀብታም ባልሆነና በሬቻ በማቆጥቆጥ በማጉረምረም በበዓላት በማጅራት በለገሃር በሲዊድን በታዛቢ በወረደ በስራችን በኋል በዩኒ በሄሊኮፕተሮች በሚያስፈልጋቸው ባረጋገጠ በኢሜል በፍኖተ በሬና በማፍረሱ ብሔርተኝነትና በሞናኮ በሚዋሰኑበት በእንግሊዝኛም በዜሮ በኣባይ በአባላትና ብርጋዲዬር ባላጋራ ቢያቆም ብዕርና በሚካለልበት በመታሠራቸው በሺሻ በማስተላለፋቸው በድረገጹ ብሏት በተሻሻለ በተሻሻሉ ብለሽው በሚመረጡ በየአገሮቹ በመሰወሩ በውድድሩም በከሰሳቸው ባልተቋረጠ በጫትና በማይሆን ቦናፓርቲስት በሠለጠነ ብዙዓለም በምደባ በታህታይ በተዛማጅ ባካሄዷቸው ባለጉዱዮች በማህበረ በማግለላቸው በኢነጋማና ብክለትና በሲንጋፖር በጽድቅ በኢስላም ቢያድግም በማቅረባችን በትሩን በረብሻ በትላልቁ በየአድራሻቸው ባገለገሉበት በሚሠሩ ባደረሱበት በካቴድራል በኦሳማ በአውሮፕላኖች በተኑ ቢዮንድ በተደላደለ ቢታዘዝም በተሾሙበት በርማ በፍርሐት በመመርመርና በድሆች በፅንፈኞች ባለሃብቶቹን ባለማሳየታቸው በባሮ በሁርሶ ባለሟሎች ባለመምጣቱ በስተያ በሚያጋጥምበት በዓለምም በርሻ በተሰነይና በፍጥናትና ቢኖረንም በድምጻዊ በተሰማራባቸው ቢላክም በተለጣፊ ባላሰበው ብዋልያ ቢከተል በኢሚግሬሽን በሞቅታ በሐሮማያ በትስስር በላይኞቹ በአድማና በተመራማሪዎች በፍፃሜው በማጋየት በልማድ በማሻቀቡ በጉያህ በሚመለከትና በቆላና በመስማቱ በሰሙነ በአምላክ በሸገር በፈጀ ብቸኝነት በተዝናና በአፀደ በደላችንን በድካም በመቋቋሙና በቃችሁ በድንበራቸው ብሶቱን በዝማሬ ቢንቢና በርን በቀረጥና ባለመግባት በሚያመቸው ቦምቡ በኩርፊያ ባስገቡት በውጤታማነታቸው በመዘከር ባለመመለሳቸው በመካከለኛውና በቅራኔዎች በአባት ባለመገኘቱና በደረቷና በማደር በርኸ በሚፈፅሙት በነካበት ባህታዊያን ብሄራዊው ቢያስቸግርም በኃዘንና በኤርትራዊነታቸው በመጠየቃቸውና ብራመር በድሪን በእጽዋት በዕስር በማዋከብ በዘንድሮም በርትቷል በምህላ ባለመገኘት በዲፕሎማሲያዊና በመስፈኑና ባሰብኩ ብላችኋል በአንኮበር በቁመት በሒሳብ በቡርኪናፋሶው በዝች በዋለባቸው ባስገኘው ባልየው በማንኪያ በኦክስፋም ብቻዉን በተቀመጠለት በሚ በማ በመሰማቱ በማቆራኘት በዘረኛው ባላገኝም በማረስና በአሸዋ በራ በሚሰሩባቸው በንስሐ በኦዲተር ቢገለፅ በእነብርጋዴር በፀሃይ በጀበና በሚስማማ በአስረጂነት በዐይነ በጌዲዮና ብትሔድ በአሲዳማነት በንግግራቸውም በማስወራት በየወንዙ ብሮችን በኬ በአባሎቹ በሚያከብርበት በጓድ ባለአክስዮኖች በጡቷ በተገነባው በሰላምም በቤቴ በተጣለበት በመግቢያዬ በጥፋታቸው ቤተክርስትያናችን በዩ በእውቀታቸው በማበስበስ በለንደንና በመታመሙ በአባያ በሚኒሊክ በመለዋወጥና በነርሲንግና በሸራሮ በመረጃነት በናሙናነት በጅ በመለዋወጫ በተሳታፊዎች በአደባባይም በመውደድ በፖለቲከኞች በጭንቅላታቸው በሚላኖ በቁርጠኛነት በመዝገበ በመውቀስ በመሣተፍ በአቤኔዘር በሠፈሩ በርስዎ በተንኮልና በሚሰበሰብበት በጎሳና በጳጳሱ በእግርም ባሕሪይ ባለቤቴም በዌስተርን በጳጳስ ባባት ባልደረባው በሰለሞን በወረዳቸው በመላካቸው ቡቶ በማያንስ በግልገል በደሎችና በቤተመንግስት በሆነባት ባልደረባቸው ባያነሳ ቡዱኖች በሚልኩት በአቤቱታው በተቀየሰው በራዲዮና በራስሽ በሚተዳደረው በመጎብኘትና በተፈቀዱ ብሄረ በቫይረስ በመገልበጥ በሆታ ባሉትና በአዳሚ ባልሰሩት በጥንታዊ በአሰልጣኞች በአፈሙዝ ቤተክርስቲያናቸው በመሰለፉ ባለመፈለግ