            amharicWords[10, 2] = "በኢሳ በተሰጠዉ ባይገርምህ በምሳሌያዊ ባስገባው በመወገዱ በሚከናወንበት በአንጻራዊ በብርሃኔና በረኻ ባለመዋሉ በተከሉበት በኦክላሆማ በጎልማስነታቸው በተሻገረ በምናይበት በጨካኙ በማያስከብር በቀጠሮአቸው ቦቴዎችና በዲዛይኑ በምሰራበት ባልንጀራህ ቦደና በመራጮችም በመጋባቷ ቡርቦራ በአባሎቻቸውና በቀይባህር በረው በደመወዝና በሚያበረታታ ባሕሪያት በስታትስቲክስ በሸርቆሌ በማስታወቃቸው በሚሰሙት በህዋላም በደበደቡበት በከበበው በመቅረፍና በሃሤት በአሰልጣኙ በማኮላሸት በመስፈሩ ቢስክሌት በበላይነትና በሚያግቱበት ቢጠይቃችሁ በዩኤን በካምፖች በመሞታቸውና በመጣጣም በትናንትው ባልተተኮረበት በዕዳን በሽሮሜዳ በማይመጥናቸው ብመጣ በዳታ ቡልቶ በኃላፊዎች በፓስፖርቱ በረኪና በፍላጎትና በነገረኛነትም በጽሑፋቸው በጋዜጠኛዋ ቢልህ በግልጽነትና በተዋሕዶ በስነጥበብ በትግበራው በሚሳኤል በአጥፊነት በማሳው በኢጣሊያና በሰብዓ በሞባይልና በተንሰራፋበት በጃንሜዳና በብዙኃን በህዝባችንና በሚያሻግር በጩቤና ብክነቶች በተጻፉት በመሃከሉ ባነጋገርንበት ባዕታቸው በማይኖሩበት ባቃታቸው ቢንላደንን ባለሥልጥናት በሚፈፅመው በትከሻቸው በከፈተ በቴስታ ባህሩን በከፈተችበት በሚመራዉ በሚወራበት በተጠረጠሩባቸው ቢነሳና በቺሊ በበየነና ባትወጣ በስድነት ቢያልፈውም በተሳሰረ በሚወሰንበት በማስመዘገብ ብረቱን ባይነገርላችሁና በምንደኝነት በማሳለጥ በማዘንበል በቤኒሻንጉልና በተፈጥሮዬ በጎቼንም ብላው በጥገናው ብንኖርም በመሟጠጡ በሉቃስ ባለሃብቶቸ ባልተሳካው በወጥነት በቶኾምቢያ በአቅርቦቱ በማናቸዉም ባልፈጸሙት ባለገንዘብ ቢገድሉኝ በሚባልለት በማናጋት በመካላከያ ባገለለ በማኅበረሰባችን ቢገደድም በሚፈጸምበት በጠቀስናቸው በቬርጂኒያ ቢቆጠርም በመፅሄቱ ባለቤትዎን በሂትለር በገጽታው በተጠየቀችው በሪከርድነት ባቸው በማባዛትና በተቆጠሩበት በየሰከንዱ ባለመብቃቱ በመፈጸምና ቢመረቁም በመሰባሰብና በሰነዓ በጽዳትና በጸለምቲ ባይገለጥም በአባሎቻቸውም በአስከፊነቱ ባይንህ በሚታይ በወረደበት በማስማሚያ በሚያካሄዳቸው ቤተክርሰቲያን በወንዞቻችን በተቀመጡላቸው ብዬአቸው በሾፌርነት ባልቻሉ በፍተሻው በፌደራሊዝም ቢነገርለትም በመከሰታቸው በማብራሪያቸው ባለመፈፀማቸው በደጋፊና በየካና በትግራይበያዝነው በቀሎቹ ቦታላይ በማዞርና በመመናመኑ በስፖርትም በመዝሙራቸው በመሾምና በሚያመርቱት በተቀሰቀሱ ብትጠይቃቸውም ባስብ ቢገባን በነዋሪነት በማውንቴን ብጠቅስ በነገርና በተቀመጠ በካዛብላንካና በግድያና በጊዜአዊነት በታትኖ በሚገናኙበት ብዝሃን በሞከርንበት በመነሻው በለጠና በኮሚኒስት በአመራሩና በፍጥነቱ በአቻለአቻ ብልታቸውን በሪቻርድ በሎጂስቲክስና በጥንተ ባለህበት በሊማሊሞ በሚያደላ በችካል በጠየቁኝ በምስራቃዊው በመዘፈቃቸው በሥራዎቼ በአናሳ በትችት ቤዛነት በመለወጣቸው ባለብርቱ ቢፈለግም በተዘጋው ቢያምንም በቢላዋ በሰፊዋ በዳይ በመብል ቤተሰቦችህን በሥራዎቿ ባለስልጣኑም ቤተመፃሕፍትና በድንገትና ባካተቱ በሚያስቆጥሩት ባይፈልግም በማይ በታየዘለት በመዝመታቸው በእውነተኛዋ በመግለጡ ብላችሁን በኦሮሚያም በእግረኞች በእስራኤላውያን በተፈቀደበት በተቃጣብን በመከተልና በጠቀስክ በሐውልት ባሕርንና ባህርዛፍ በማዕርግ በቂምና በወለንጭቲ በከባዱ በመቶዎችና በቀዱሚነት በጣዕር በፊውዳሉ ባልተቤት በትግሉም ቢልና ብናወራ በማጠቃለያውም በያንዳንዳችን በመምታትና በሚዘሩ በስግደት ቢቂላል በኢትዮጵያዉያን በዙላ በሚናገሩ ባይገልጹም በሮይተርስ ባልተደረገ በርሣቸው በላክነው በታሰሩት በሚያስመዘግቡት ባለሟሎችና በሚያሰኝ ባስኮ በእውነተኛው በሚያናጋ ቢዳር በተማረው በሚ