            amharicWords[10, 3] = "ቢጠፋም በተጀመሩት በሞቃዲሾና በግለሰብም ቢዋይዲ በሚንቀሳቀሰው በምትፅፋቸው በሽታንና በሚስቱ በዝቶበት ባልጠፋ በልግስና በምናቤ በፀበል በአብርሃ ባሳደረባቸው ቡናቸውን በሜዳሊያ በፓርቲም በባሕል በሃይማኖታችን በድፍረትና በመቁረስ በተዓምር በተለጣፊው በቂርቆስና በአሠልጣኞቹ ቢኤስሲ በሚታወቅበት በመልክም በጎጥና በድንቅ ባለመስማት በገማል በሚያከብሩና በደናን በጽርሐ ባልዋን ቢዝነሳቸውን በተጠናቀቁት ባተኮረው በፌብርዋሪ በተራዘመ ቤኒአሚሮች በመብለጥ በኦቦ ቢገነባ በንፋሰ በአገርዎ ብሔረተኛነት በረሃዎችንና በማዕድናት በረከትነት በቡታጅራ በድረገፅ በጄዳ በመጠጥና ቢሸነፉ ባይቃወሙም ቢያደርጉት በአጫጭር በስቲያው በመታቀፋቸው ቤተክርስቲያ በማይበክልና በቀዘቀዘ በጅንአድ በሚሠራ በህወኃት በፓትርያሪኩ በሰብልና በጨለማና በጃንሜዳ በኮብልስቶን ባይናገሩም በተነ በፀጋው በኢሚግሬሽንና በማበደር ባላገናዘበ በዘጠነኛ ቢዝነሱ ቤተክርስቲያናትን ባራኺ በፈጠራና ባዮስለሪ በልማትም በማጉላትና በዶክመንት በቺካጎ በቢጫ በመሆኑንም ባልደረባና በትልማ በሞኖሮቪያ በካውንስሉ በተራራማ በቪኦኤ በደጋፊዎች በሎንደን በቆየሁባቸው በትርፍነት በደብረብረሃን በመታተም በገጠራማው በበጎች በጸጉር በተገናኙ በማዋልና በአሰላና በምዕራባውያኑ በሴተኛ በስማቸዉ በሕዝቦቻቸው ባይገልፁም በሚመስለው ብውል በወኔና በአደረጃጀቱ በስዕል በሰለጠኑበት ቢከተሉ በርቲዮም በሞከረበት በአስተዳደሩና ባልተጠበቀበት በሴቶችም በአጋጣሚና በማበርከቱ በመቃኘትና በሚከሰቱበት በኢሮብና በመታደግ በየማረሚያ በመሰኘት ባትሆንም በዛውም ባሎቻቸው በመቀነሱና በቻይናዊያን በመታሰቢያ በከረጢት በሚጋፋ በአገሮችና በጠመንጃና ብንወያይ በመስማቴ በተመከተ በተያያዙት ብዝተፈላለየ በንብረቶች ቦጋለን በስንዴና በሞላበት በአልን በሚያስታውቅ በመወጣታቸው ቢቀሩም በተቀመጡት በቀበሌዎችና በፈጠረህ በማሰማትና በመቆምና በነጻና ቢነግረን ባለመፈቀዱ ባንገት በሚዲያና በሠራተኞቹ ቡድንተኝነት በመቀናነስ በገለጸው በመሆናችሁ በአርቤጎና ባለስልጣኖቻችን በወታደሩ ባህታዊያኑ በታጋይና በራሴና በተወካዩ በአባተ በገባሁ በግብፃውያኑ በማየትም በማቃለሉ በአኅጉር በተባለበትና በአርተፊሻል በኦታዋ ቢሊዮንና በታያቸው ብቸኛውን በታክሲው በተነሳባቸው ብራቮ በተደረው በተሰውት በተወካይ ቢያሳዩን በተራራቁ በአድናቆትና በሚጀምሩ በደለኛውን ባትሪዎች ብአዴንም በኮነነኝ ባዩት ባካሔደው በዘገበው ቢፈቱ በማቀራረብና ብረቶችና በሚጠየቅበት በኾኑት ብራና በሚካሄዱበት በአሰራርና በዝቅተኝነት በፕሮግራማችን በስልሳ ቢያስተባብልም በመበላሸት በፓሊስ በሙዚየም በታህሣስ በመስጊዱ ቦረበር በበርካቶች በኃላም በሚወዳደርበት ቢያሰሙም በጠጅ በተኮሰው ብሌንን በጅጉ በአስተሳሰብም በኤክስፐርት ባለቤቷን ባህሪያትን በመጋዘኖች በክለቦቹ በጻፍነው በቦምብና በዐል በነጻው ቢጠራ ቡርኖ በርጋ በዝና ብርጭቆውን ቢቆምም በፋይናስ በሓላ ቢፈርስ ቢያሸንፍም በቡርኪና በዛግዌ በክለቦች በፋክስና በማተራመስ በሚያቀርቡበት በተያያዥ በፎርክሎዠር በግብታዊነት ቢያፈሱ በመተንበይ በሮማ በማቀፍና ቢሸነፍም በመግባታቸውና በሪ ብትቆይ ቢገለጽ በሷ በወሰዱ በመሰማት በወረቀትና በጋዜጣዋ ቢጨምርም በአዲካ በማረቃ ባላባትነት በቁመና ቢለወጥ ብቆይ በጥላሁን ባለሟል በኒዮወርክ ቢፀድቅም በሱዳንም በገዳማትና በአስተሳሰቡ በመቀላቀላቸው በአዲቀይህ በማይባሉ በጠፍ በተቀናቃኞቹ በፖፑ በያይነቱ በፓትርያርኩና ቢነገረን ብላቸው በሚገመቱ በቻ ብለውና ቤይርድ በሚመደብ በተወዳዳሪዎች በእሳቱ ቦራን በመጾም በመከላከያና በደሌና በኋ በፈዴራል በ