            amharicWords[10, 4] = "በፍትሃዊነት በሚሰማው ቦሩ ባገሩ በማቋረጥና በህልም በማዳቀል በጉና ባልደራስ በተሁለደሬ በትክክልም በወደፊት በፍሬ በማይክራፎን በማኅበራት ብርጋዴል በሉሲ ቢይዝ በደረታቸው በመቀበሉ በአርያም በብዛትም በኋይት በቀደምት በመተሳሰብና በመሻሻል ባለቀለም ባይገባም በመሳተፋቸው በእለቱም ባገኘ በዳኞቹ በሉት በኢትዮጵያው በአልጀዚራ በአካባቢና በአይን በከረረ በማንና በማዕረግ በድምበር በአፍዴር በሰዎችና በሕግም ብስጭቱን በነዚህም በመተሳሰር ብሔርንና በጤፍ በኤድስና ብልጣብልጥነት በማፋፋም ባዮችን በዚያድባሬ በአንጋፋው በሚያገኙ ባለቤቶቻቸው በሹክሹክታ በድልድዩ በቀውሱ በእንግሊዞች ባጠቃላይም በፎከስ በዴሞክራሲያዊና በተፈራረሙት ቢነሣ በተሰብሳቢ በዓላትን በወርቅና በሲና በፈቀደላቸው ቢፈቅድም ቤቱንም ቢሮአቸውን በቀላፎ በኢትዮጵይ ባርሴሎና በሚመጡት በማቅረቧ በንቅዘት በቴክኖሎጂና በአርቲስቱ በርዕሴ በሚያዋስናት በሃይማኖቱ ባለሥልታናት በትግራይም በሬፈረንደም በወደቦች በውድቀት በተጓደሉት በመያያዙ በሱፐር በንፅህና በተቃዋሚዎችና ባለማቋረጥ በደሉ በወጣቶችና ቢይዙም በመጫር ባህታውያን በጭፍጨፋው በጠላቶቹ በሰብሳቢነት በርማን በያላችሁበት በመከፈታቸው በሚፈቅድላቸው በአበረታች ቢመቻች በተሰበሰቡት በመቆማቸው በመኸርና ቤትህ ብርቱና በሰሜናዊው በጸሃይ በደቦ በሚኤሶ በተሰበሰበ በሰጠሁት በምታካሂደው በተሰበሰቡ በጠፋው በመቱ ባለሃብትነት በመመዘን ቤቱንና ባንኮክ በተገለፀበት በማሳወቃቸው በአርብ በቁሙ በጣቶቹ በዋሉበት በእስጢፋኖስ በተቀመጠበት በማያወላዳ በአግባብ ቤቶችንም ብንባል በመደሰት በሌቦች ባልፈው በጋዝ ባስቆጠሯቸው በመጨረሱ በመልክ በተሠራው በመጠናቀቃቸው በአህጉሪቷ በየጊዜዉ በቀረበት በአጋሮ በተስማማው በመኖሩና በስርቆሽ በቆዳው ቢሊን በልጠው በማርሻል ብትጠይቁ በተመቻቸላቸው በወንድማማቾች በቁልቢ በኦገስት በወኔ በተመዘገበበት በመሬታችን ባልሥልጣናት በቅተናል በማደናቀፍ በማወክ በእናቱ በጭማሪው በመላክና ቤቶቻችን በሴራ በዓባይና በወኪሎቻቸው በተመለከቱ በአርበኝነት በህፃናቱ ባደረሰበት በማብራት በማንቋሸሽ በጋዜጠኞችና በጌዲኦና ባዛሩን በሕይወትም በረደድ በማሰማታቸው በክንፍ በሃገረ በስድብ በማሰባሰቡ በጧት በአፈጻጸሙ በጭምጭምታ በራማና በአፈፃፀሙ በፕሮጀክቶቹ በሰማንያ በፕሮፌሰሩ በአኅጉሪቱ በሚዘዋወሩበት በወግ በራሱም ቢዘጋጅ ቦዘኔዎችን በባንዳነት በዶሮና በተመደቡ በሃይማኖትና በገሐድ በኮንዶም በሚኒስትሩና በታመነበት በብርጋዲየር በአበል በመምረጣቸው በጥንቃቄና በመሪው በትክክልና በዶክተሩ ቦርሳውን በመልቀቃቸው በመክፈቱ በኃላፊነታቸው ቡዱን በኢሜይል በመካነ በብረቱ በመውረሯ በማድረጋቸውና በአሮሚያ ቢዝነስን በስር በመፍትሄ በጎተራ በስሱ በበዛብህ ቡታጅራ በስድስተኛ በጠባብነት በኩልና በወንጀልም በደሳለኝ በአፕላይድ በትጋትና በማመላከት ባለሙያውን በሃገራዊ ብድሮችን በዳያስፖራ በሰቀቀን ባከናወኑት በነበረን በግብዓትነት በጥፋተኝነት በአማኑኤል ባደጉ በሞሪሽየስ በመኝታ በፕሬዚደንቱ ቢወሰን በፈረንሳይና በመበራከታቸው በመጥቀም ቢታሰብ በጸደቀው በፍጆታ በጥሩና በሚፈጥሩ በምስክሮች በአንጃዎች በረረ በረር ባለስልጣኖችን በየጤና በህገመንግስት በተሰማሩት በማንኳሰስ ባልደረቦችና በግዱ በልቧ በእውን ብርሀኔ በበቃው በኃይማኖታዊ በተለዩ በመነኮሳት በፈረንሳይኛ ባልተደረገበት ባልረባው ቢታሰብም በአሠብ በሚወዳደሩ በመፅሃፉ በኔና በዝቶበታል በመሣሪያና በሃይማኖታዊ በባለሙያዎቹ በሮኬት በሃምሳ በአሃዝ በገዋኔ በዳስ በልክ በማክሮ በመዋጋትና በሚያስገባው በየወረዳዎች ብላት በጨፌ በምትል