            amharicWords[10, 5] = "በአላማጣ በማርገብ በታዘዙት ባለማግኘት ብሆንም ቢሮዋቸው ባለድርሻዎች ባለማወቁ ቢሰራ ባመለከቱት ብሔረሰብን በሚዘጋጁ በሚቻልባቸው በጥበብ በትኗል በአኝዋክ በመንግስታት በድንጋይና በስማችን በቆመበት በዋነኛ በየአምስት በማዛወር ባለመሆን በሚልም በለጋ በካሣ በብሄረሰብ በማጠናቀቁ በሰፈሩ ባገኝ ቦግ በጸጥታው በመጥፋታቸው በሚሸፍነው ቤተሰቤ በህብረተሰቡና በሱባዔ በአሽከርካሪዎች በመተግበርና በመባላቸው በተጠየቁበት ቢለው ቢያሸንፍ በጸሎትና በአይናቸው ባይኖረንም በውሣኔው በእነዚህም በካቢኔ በማዋሃድ በበኩልዋ ቢነሱ በመረዳቱ በኮሜሳ ባሻዬን በመስማታቸው በማወዳደር ባላገሮችን በኢኮኖሚውና ባለመቀበላቸው በካፍ በመልማት በየተቋማቱ ባዮቹ ቢሞከር በማጣመር በድንበሮቻቸው ባለመኖሩም በማሳደሩ በትራንስፎርሜሽን በቀኑ በቶን በተጠናከረና ባላቸውና በቅዳሜ በቅንጀት ባሳለፍናቸው በመጀመሩና በስተግራ በጥቅል ብዙአየሁ በወንጌል በፀሐፊነት በማቅናት በውስን በመግጠም ባለማክበር በምዝገባ በመገፋፋት በመልኩ በሚሏቸው በሚከናወነው ባለይዞታዎች በክብ በመትከልና በሚከሰተው በስቴት ባይተዋር ብትር በመስረቅ በመዝለል ብለዋቸው ቢቃወሙም ባይደን በሚዲያዎች በአሳ በሬዎች በማስጠንቀቂያ በላው በሙት ቢላል በዉል በመጻሕፍት በጥናታዊ በኢንቬስትመንት ብሉይ በጫካው ቡድናዊ ባልሆነበት በባለሥልጣኖች በሚኖርባት በእስርና በኮንፌዴሬሽኑ በዋግህምራ በረከትና በትህትና ቤተክርስቲያኑ ባለመስጠት ባዘጋጀውና በኦብነግ በጣሊያንና ብሶትና በታጠቅ በበልግና በመሆኗና በደቂቃ ቢሰጣቸውም በኮንፌዴሬሽን ቢሊሚያ በመብላት ባለመክፈሉ በውይይታቸው ብዕር በሚደነግገው ቢወጡ በኢንጂነሪንግ ባለኃብቱ ባለቸው በቁልፍ በመመረት በመካድ በማታው በዓለማዊ በህፃናትና ብሔሮችና በሚግ በግልጽና በማድረጓ በጎውን በኃይሉ ባለጉዱይ በመጠቀሙ በትራንዚት በዳሳ በመግፈፍ በከተማውና ቢፒአር በሒደትም በትራንስፖርቱ በምሣሌነት በጎች በቢሊዮኖች በአዘጋጀው በኢጣሊያን በመያዣነት በሚያስከትለው በቁሳቁስና በመገኘቷ በአብላጫው በመጠናከር በኦባማ በአዲስና በቄስ በአምሳሉ ባህልም በታጠቀው በስካይፕ በሳምንታዊ በመመናመን በታቀደላቸው ብዙሐን በጎጂ ቢተውልኝ በሚነካ በጽዳት በተጠቁ በባህታዊ በምትከተለው በእነስዬ በማዛመድ ባለመገንዘብ በአካልና በአዕምሮዬ በብዕር በመግጨት ባይደዋን ቢገጥመው በሚመጡበት በሶደሬ በቅጽበት በእንግልት ባስመዘገበው በየአጋጣሚው በሪሁ በአፍሪካውያን ብቸኛና በተመሠረተባቸው በፈንታው በገለፃቸው በታተመው በሰይፍ በሚያስከብር በአውሮፓዊያኑ ባልቴት በተመደበለት ቢቀሰቀስ በናይሮቢና በገጠማት በተቀነባበረ በግርግር በፓን በመገለፁ በጫማ በምዝበራ ባቀረበላቸው በድሮ በሕክምናው በመቀበላቸው በማክሰኞ በሚያስጠብቅ በመስበክ በማስገባቱ በውጫሌ ባንቲ በመመረጥ ባስቀመጣቸው በቆየባቸው ብሎጋችን በለቀቁት በመጮህ በቀብሩ ቢኾን በቤተክህነት በኢሕአዴግና በአሠሪው በመሞት በዛሬውም በእሣት በሚበዛባቸው በሚታሰብ ባደረበት በስፔን በስርዓት በሃይማኖታቸው ባሩድ በቀብሪደሃር በመስፋፋቱ በመንግሥትነት በየግዜው ባለመቁረጥ በረሀብ በማኔጅመንቱ ብራይት በዛም በሚሊኒየም በኢሠማኮ በጥራቱ ቧልት በተጠረጠሩበት በመጋጨታቸው ቦረቦር በመሯሯጥ በማስተናገዷ በመስጠቷ በመፍሰሱ በምትካቸውም በራያ ባልታወቀበት ባካባቢው በባህሪው ብናደርግ በመታገልና በስተመጨረሻም በማንዴላ በቡጢ በአመክሮ በትናንትናውለት በዲሞክራቲክ በማጠናከሩ በመገመቱ በኮንቴይነር ቢንድሌይ በመምህራኑ በማይታመን በጄት ብሄራዊት በመምታቱ በፕሮፓጋንዳው በቴሌፎን በመጨበጥ በጭሮ ቡድናቸውን በመዳረጋቸው በ