            amharicWords[10, 6] = "በሁለተኛነት በጦሩ በመነሳቱ ብድርን በኮንጎ በመውሰድና በቅጥር በፈጠራ በመደበቅ በሠፊው በዘረጋው በወጡበት በማገድ በታቀደለት በዕጣ በእናት ቤተሰቦቼ በአመቱ በመከበር ባስቆጠራት በተነሱ ቤልጅየም በማዳከም በመክፈቻ በመግታት በፍተሻ ባክኖ ብሎናል በሚኖሩት ባለፈም በሽብርተኛነት በስጋ በኃይሌ በጩቤ በዳቦ ባልደረቦቻችን በአዳራሽ በቶሮንቶ በመንጠቅ ቡተፍሊካ ብርጭቆ በሚለዉ በማስወገድና በስልጣናቸው በምርኮ በንጉሥ በማዋቀር በሪል ብናደርግም በመሆናቸዉ በቀጣናው ባይናቸው በተከሰተበት በብሔረሰቦች በሚጠይቀው በመደቡት በስዋይን በምጽዋ በግብዣው በመብቃታቸው በቅመማ ብልት በመተጋገዝ በነገሩ በዘርና በመባባሱ በአጣሪ በየጦር በኢህኣዴግ በሚቆጣጠረው በማመላለስ በተደራጁ በአገርና በዛን በቤተክርስቲያኒቱ በየመንደሩ በተወዳደሩበት ቢገለጽም በመፈንቅለ በረብሻው በየመንና በሆነውና በቆላማ ብሔርተኝነትን ቢሞት በባለ ባራኪ በሚኒሶታ በመመታቱ በአዎንታዊ ባልሆነው በእንጨትና በመውሰዳቸው በመሠማራት በጨዋታው በሕይወታቸው ብንሞክርም ባለትዳር በም በማያውቀው በሕጋዊነት ቦርዱም በጉባዔ ቢኖሩትም በመከራ በያዙ ቢንያም በኢንቨስትመንትና በአጋጣሚው በባሕርዳር በጣለው በጄኔቫ ባሕርዳር በሚገኙና ብተና በሽርክና በሆድ በድምር በለውጡ ባልተከተለ በዴንማርክ በሽልማቱ በሁለትና በማስቻሉ በወንጂ በአፍሪካም በመምራትና በጠበቃቸው በተከሰቱ ባከናወነው ቢወጡም ብሮች ባለመሆኑና በብራስልስ በመገንዘብና በመነጋገርና በተነደፈው በመደራጀትና በቀረበለት በመፈለጋቸው በመሳሰለው በሰጡ በተቃረበበት በተመለከተና በመከራከር በገፅ በማመንጨት ባፀደቀው በገሀድ በነአቶ ባይኖረውም በቴፒ በማዕከላዊው በአንድና ባለቤትነትን ብለዋቸዋል በቃልም በኮንስትራክሽንና ቤተክርስቲያንን በቀረው በመክፈቻው ቢጠናቀቅም በመገልገል በርዕሱ በተለመደ በአጃቢ በማሳደር በአዳማና በሹመት በቀረጥ በመተንተን በሚያስገኙ በስፖርቱ በድሬዳዋና ባስመዘገቡት በደመወዝ ቤተክርስቲያናችን በአስተዳደርና በሚመለሱበት በመምህራንና በታክሲ በመተሳሰብ ብልዋል በመካሔድ በአሉ በጠዋቱ በተመጣጠነ በዱቤ በተነሱት በሚያስችላቸው በለንደኑ በደረሳቸው ባልደረቦቹ በበአሉ በመገንዘባቸው በማከማቸት በዚህኛው በውህደቱ በስዊዝ በእኛም በሚደረግላቸው በኬንያው በገቡበት በልሁ ቢመጡም በሪፈረንደሙ በአራቱም በመንቀሳቀሳቸው በጭነት ቤታቸውና በማሰራት በየግንባሩ ቡድናቸው በጎሣ በማር በእቅዱ በላስታ በፕራይቬታይዜሽን በየሜዳው በጋዜጠኛው በማግስቱም በሚታዩ ቢፈልጉ በአሶሳ በቢዝነስና በሲጋራ በኤርትራዊነት በመቀሌው በሌሎቹም በንጉሠ ቢቢሲን በታሪክም በሕዳር በቱርክ በይርጋለም ብርጋዴየር በመግለፁ በወረዳዋ በቡናና ቦንቦች በቻለ በባላገር በአግሮ ባህሪያቸው በህይወታቸው በድርቅና በማክበርና ባዘን በመቻል በመንግሥታቸው በችሎት ብዥታ ቢሮውም በገለፁበት ብዕሬን በፆታ ባህላቸው በጀታቸው በፖርት በኢህአፓ በካምፑ በቅፅ በሐቅ በሚዘጋጀው በመጽሐፍ በረዥሙ በማመኑ በሃዘን በመርሃ በነዋሪዎቹ በጉርብትና በየመድረኩ በመረጡት በኢትዮጵያዊነቱ በመወንጀል በማጠፍ ባድር በተናጠልና ብንጠይቅ በሚታየው በጸሎት በአቋማቸው በኢትኦጵ በፖሊት በማስቀደም በማታለል በሚገኙባቸው በሚፃረር በየግላቸው ቢችሉ በመጠቀማቸው በመፈረጅ በብርሃን በገጀራ በአንተ በዓፋር በማብቃት በመዲናዋ በሚንቀሳቀስበት በሚያደርጓቸው በኢንሹራንስ ብሞት በወጣበት ባለሃብቱን በመልበስ በዕረፍት በቁርጥ ባለመቻላችን በሚነገርበት በታዘዘው በአባታቸው በአንዴ በሐይማኖት በማይችልበት ባለሦስት በመወሰናቸው ባንጻሩ በችኮላ በመወያየትና ባርያ