            amharicWords[10, 7] = "በመንግሥታዊ በመጭዎቹ በማነሳሳት በአቋም በልብ በጠየቁት ባንኩን ባገናዘበ በቁሳቁስ በጎበኙበት በንዴት በራሴ በራሷ በሽያጭ በመለየትና በተወሰነው በሞጆ ብክለትን በርሔ በተስፋ በሚደረግበት በመስክ በስተሰሜን በጎረቤት በአሁኑም በየደረጃ ባላ ባሌ በእጩነት በመንግሥታቱ በቀላል ባለሙሉ በሰሜንና በመብራት በይግባኝ ቦይ በኢዴፓ በዕውቀት በጋሞ በሻዕቢያና በመንተራስ በቂም በወርቅ ቢመጣ ቤቶችንና በፅሁፍ በማግለል በሆቴል በቪዲዮ በተቀመጠው በሠጡት በህዝቦች በማስወጣት በማጥቃት ባሕላዊ ባደረገችው በጸረ በመዲናችን በባለሥልጣኑ በመመሪያው በቤንሻንጉል በደብዳቤው በማረጋጋት በመጠቀምና በከብት ቢሮዎችን በማፅደቅ በወጣት በቃሊቲ ብዙሃንን በተከሳሾቹ በመፍጠሩ በጋራና በሴፍቲኔት በመተካካት በሚስተር ባሬ ቤተሰቡን በውጭው በሚኒስትር በመጡበት በሕብረት በስተደቡብ በማንም በቀጣይነትም በመሰባሰብ በሚገባቸው ብርጋዴር በማቅረቡ ብቃታቸው በትናንቱ በትናንት በቡድኑ በድርጅታችን በአቃቤ በቂና በአጤ ቢቆዩም በአዳራሹ ብልህ በኢጣልያ በቅንጅቱ በጫካ በዘመነ በተቋሙ በግሪክ በኦሞ በካርታ በእግራቸው በየትምህርት በጽሁፍ በኮምፒውተር በሁሴን በመድፍ በማበረታታት በባዶ በርሊን ባደረገበት በዝግጅቱ በግጭት ባነጋገሩበት ብሔርተኝነት በሌሎቹ በመግባቱ በፌስ በዓላት በባድሜ በመያዛቸው በዚያች በመፈተሽ በኃላ በፊርማ በሚሰጡት በማሳደግና ቤተሰቦችና ቦታን በተከፈተበት ቢኖራቸውም በመኖር በአፍ በቃሉ በስጋት በዓባይ በሞባይል በሚሉት በውሉ በኮምፒዩተር በማበር ባሬንቱ በማስከተልም በወረዳዎቹ በዘመድ በተቋቋሙ በአባል በሰዓት በማባረር በመሞከር በዳ በሃገራቸው ቡላ በዚህን ባስከተለው በሽሬ በመግፋት በአንጻሩ በአራዳ ባልበለጠ ቡርኪናፋሶ በዓሳ በፕሬዝዳንት በመከላከሉ በዲፕሎማሲ በተከሰሱበት በሚመለከታቸው በአንዲት በመሔድ በከፈቱት ባስቻለው በየወረዳው በተካሄደባቸው ባይባልም በአመራሩ በሊትር በሚያቀርቡት በኦሮምኛ በመጀመራቸው በመደበኛና በፆረና ብቻዬን በአራተኛው በሆስፒታል በመሣሪያ በጥናትና በምክንያትነት በካናዳና በተኩስ በሥራው በጥቂቱ በግሎባል በሚሌኒየሙ ባሰ በእርሱ በዚምባቡዌ በፊንፊኔ በሂደቱ በሶስተኛው በጉዞ ቤይሩት በቆዩበት በኢኮኖሚያዊ በሳዋ በታቀደው በክረምቱ በዱር በሚከናወኑ በሚወስደው በግልባጭ በማግሥቱ በአክብሮት በማግኘታቸው በሆላንድ ባልቻ በጋዜጠኝነት በጥምር ቢጠበቅም በአብዮታዊ ቧንቧ በደረቅ በመምሪያው በባሰ በእናንተ በይ በኬኒያ በአሰቃቂ በምኒልክ ባለስልጣናትን በደብረዘይት በተከሰተ ባለማወቅ በአሥራ ቦቴ ቢሰጥ በፕሬዝዳንትነት በነገራችሁ በጥድፊያ በጥላቻ በጹሑፍ በሚደርስባቸው በወሎ በማኅበራዊ በሴት በጦቢያ ቤተክርስቲያኗ በፍራንክፈርት በገበያው ባለፈዉ በኢፌዴሪ በመስማማት በምክክር በማጭበርበር በሄዱበት በቅን በመሐል በተዋረድ ባለውለታ በአፋርና በነጻነት በራፍ በቡርኪናፋሶ ብሎግ በፓርቲ በአፈር ባደረሱት በረቂቁ በፖሊስና በሼህ በቆራጥነት በማካፈል በዚህና በነጋታው በወቅቱም በሕወኃት ቤቱና በማህበራት ባለመደረጉ በመቅረታቸው በጉራጌ በስለላ በቀረበ በኢትዮጵያውያኑ በደሎች ቦታም ቤተሰቦችን ባቀረበችው በሰልፍ በአሰብና በወረራው በህንድ በደብሩ ብዙሀን ባለንበት በእግሩ በወራሪው በፀሎት በከፍተኛው በታጠቁ ባዕድ በኢንተርናሽናል በየቤቱ በጻፈው ቢኖሩ በርካታዎቹ በማዳረስ በርካታዎች በተጀመረበት በክልልና ቢገልጽም ቢትወደድ በእሱ በሚያካሂደው በመውደቁ በተዋጊ በደረሱ በወረዳዎች በዕለቱም በቁጠባ በያዙት በመዐሕድ በመጠጥ በፋብሪካው በካፒታል በሳውዲ በውጭም በአቴንስ በማኅበሩ ቢሻው በውጭና