            amharicWords[10, 8] = "በ በላይ ቤት ብር በኋላ ብለዋል በኢትዮጵያ ብቻ በዚህ በኩል በማለት በአሁኑ ቤቱ በፊት ባለፈው በመሆኑ ቡድን በአዲስ በርካታ በማድረግ በሚል በተለያዩ ብሎ ቤቶች በተለይ ብዙ በቅርቡ ቢሆንም ቦታ በመቶ በኤርትራ በበኩላቸው በዚሁ ቢሮ በክልሉ ብሔራዊ በሙሉ ብለው በሌላ በሰጡት በአንድ በተጨማሪ በተለይም በተመለከተ ባለፉት ባንክ ባለሥልጣናት በዓለም በአገሪቱ በጋራ ብሏል ባለሙያዎች በዚህም በደቡብ በጀት ባለው ቦርድ ቢሆን በአፍሪካ በጣም በመሆን በአካባቢው በከፍተኛ ባደረጉት በዓል በውጭ በተያያዘ በሆነ በሶማሊያ በቂ በሁለቱ በተጨማሪም በወቅቱ በሌሎች በመስጠት ብድር በኢትዮጵያና በመሆኑም ባለሥልጣን በአማርኛ በተካሄደው ቡና ባሻገር በእንዲህ በቁጥጥር በትግራይ ባወጣው ቦታዎች በተደረገው በተደጋጋሚ በመሆናቸው በመንግሥት በመጠቀም ባለቤት በአሜሪካ በሽታ በስቲያ በአጠቃላይ ቢሊዮን ቤተ በአቶ ብዬ በአግባቡ በሰላም በአገር በሁለት በስተቀር በሚገኙ በስፋት ብለን በሁሉም በተያዘው በእስር በተመሳሳይ በዞኑ በትምህርት ብቃት ብዙሃን በየነ ባለ ቢሊየን በአማራ ቡድኖች ቡድኑ በኦሮሚያ በመንግስት ባህል ባለሃብቶች በመጪው ብዛት በሰጠው በይፋ በከተማው በጉዳዩ ባደረገው በበኩሉ በሚገኘው በሚደረገው በር ብርሃኑ በሻዕቢያ በሰላማዊ በየጊዜው በነበረው በመተባበር በሰሜን በሱዳን ባለሙያ በምርጫ በማቅረብ በአስቸኳይ ባለስልጣን በየደረጃው በነፃ በድሬዳዋ በሕዝብ በአጭር በራሱ በዛብህ በአንዳንድ ባለስልጣናት በግል በመቀሌ በቀጥታ ቤተክርስቲያን በመካሄድ በቅርብ በግልፅ በሥራ በቀጣይ በጅቡቲ በመጨረሻም ባለበት በመስራት በመቃወም በብዙ በተግባር በኃይል ቢሮው በስብሰባው በልዩ በመግባት በረከት በደል በፖሊስ በቀለ በመግለፅ በምስራቅ በዕለቱ በአዲሱ በሚመለከት በድጋሚ በመጥቀስ ባቀረቡት ብሄራዊ በድንበር ባሉ በታች በዘርፉ በቀር በከተማዋ ብልጫ ባሉት በአብዛኛው በአዳማ በመላው በልማት በምን ብላ በየዓመቱ በተባበሩት በቀላሉ በተፈጠረው ባላቸው በአገራችን በተለያየ በማጠናከር በሁለቱም በመጀመሪያ በማካሄድ ብሔር በሕግ ቦርዱ በመፍጠር በሚካሄደው በሚገባ በዚያ ብሄር ብሔረሰቦች ባህርዳር ቢቢሲ በማከናወን በ በፖለቲካ ባድመ በምርጫው ቤቱን ቤቶችን ባንኮች በሚቀጥለው ባህር ቤተሰቦች በሰው በፌዴራል በእጅጉ በምሥራቅ በተባለው ባለሥልጣኖች ቢያንስ በሶማሌ በመያዝ በዝርዝር በኋላም በአየር በራሳቸው ባንኩ በህዝብ በጦርነቱ በሆኑ በኬንያ በቀጣይም በተሻለ በትክክል በድርጅቱ በግልጽ በዓመት በጤና በብዛት በላከው በመንቀሳቀስ በመግለጽ በርስ በተጠናቀቀው በያዝነው በቅንጅት በሌሎችም በኢህአዴግ በቅድሚያ በመልካም በአለም በሙስና በማስመልከት በተገኙበት በወረዳ በጋምቤላ ባቀረበው ቤታቸው በቀጣዩ በዘር በፍጥነት ባካሄደው ቢሮዎች በአራት ባህላዊ በሚለው በሆነው በግንባር በተደረገ በገጠር በጦርነት ብሔረሰብ በክልል በዛሬው በመውሰድ በምዕራብ በማሳደግ በመሄድ ባለመሆኑ በመጨረሻ ብሄረሰቦችና በስራ በሕገ በደርግ በሁዋላ በሞት በዓሉ በፍርድ በጠቅላይ በቀን ቤትና በውይይቱ በመነሳት ብዙዎች በተሰጠው በጎ በበጀት በመገንባት በመባል ብሎም በአውሮፓ በማስገባት በግብርና ቤቶችና በመስኖ በዚያው በሰፊው በጦር ቢኖር በአንድነት በማንኛውም በሚበልጥ ባለሙያዎችን በዓሉን በተከታታይ በንግድ በአፋር በማውጣት በምግብ በብሔራዊ ባንድ በገንዘብ በከተማ በአሰብ ብዙዎቹ ብይን ባሉበት በዋናነት በዘላቂነት በዝግጅት በዋሽንግተን በመከላከል በመግለጫው በረራ በተካሄደ በሶስት በመምጣቱ በመቀጠል በጀርመን ቤተሰብ በማስፋፋት በኩልም በሥ