            amharicWords[10, 9] = "ቨ ቪዛ ቫይረሱ ቫይረስ ቪላ ቪኦኤ ቪዥን ቪዲዮ ቪን ቬንገር ቪ ቫይረሱን ቫሊ ቫሉታ ቫቲካን ቪሌጅ ቨርዴ ቬጋስ ቬሌ ቪሲዲ ቪሳት ቫት ቪዥ ቪክቶሪያ ቪዲዮዎች ቪክቶር ቪዲዮውን ቬትናም ቮኦኤ ቨርጂኒያ ቫን ቬክተር ቫይዘሮች ቬነስ ቨርነር ቮ ቪሲዲው ቪአይፒ ቬርማስ ቮይስ ቬተራል ቪዥዋል ቬሎ ቫይዘሮችና ቮልስ ቪዝን ቮልቮ ቬንገርና ቪቫ ቫይረስን ቭላድሚር ቫርኔሮ ቨርጂንያ ቪየና ቪዝ ቬለ ቪድዮ ቮኢቸ ቫሌሪ ቪንቸንዞ ቪላዎች ቪያ ቪታሚን ቪላና ቫይታሚን ቫሌዚ ቪድዮውን ቪኖ ቪንሴንት ቨቂሾ ቫሉአ ቪኦኤን ቫተርስ ቮልት ቪኪ ቪታሎ ቬኒዙዌላውያን ቫሊዛ ቫርኒሽ ቪዛና ቪቶሪዮ ቪየትናም ቪዛው ቫንዲለን ቮተ ቪዲች ቮል ቫኔል ቬስታል ቬጅቴብል ቪዛዎች ቮረስ ቪክራም ቪላዎችና ቭላዲሚር ቪያና ቪሳ ቪዛውን ቪክተር ቪው ቫሪዮላ ቬና ቬርቡንድ ቫንደር ቮልከር ቫላንታይን ቫሌንሲያ ቬሌም ቪዲዮና ቫትስላቭ ቯር ቬጌ ቬንገርም ቬርባል ቪኤይት ቪድዮን ቫንኮቨር ቪላው ቫልዳኖ ቫትና ቬትናምና ቬበር ቬንቸር ቮልቴር ቮድካ ቪላዎችን ቪዲዩዎችን ቨርዴና ቪላቸውን";
            
            amharicWords[11, 0] = "ተመልክተናልም ተደጉሶ ተዋውለን ታላላቁ ተጫወት ተደረመሰ ተሸማቀህ ተሰደድን ተጫዎቾችና ታፍረንና ተበክሎ ተስምቶ ተቀይጦ ተብሰልስሎት ተተቃሚ ተቆንጥሮ ተንደርድረው ተደረግን ተቀጣሪው ተበይኖባቸው ተፈጠረና ተስፋንና ተሳሰርን ተቆለፈ ተቆራርጦና ተቀብሎአት ተምኔቱ ተግብሯል ቲፎዞ ተጥዶ ተግባቦት ተወሰደች ተከታዮቹም ታድጎ ተሳደዋል ተናድዶ ተዘርፈናል ተገረሰሰ ተፈናቅለናል ታዞላቸው ታጭቀን ተፋፍሟል ተጠርጣሪውም ተደምሜና ተግዳሮቶቹን ተቋጥሮላት ተሳፋሪዎችም ተቀርጾባቸዋል ተሰደናል ተዉን ተሸጉጠው ተኳሦች ተሰደድኩ ታነባለህ ተስፋፉ ተሳትፏቸውም ተቀባይነትንና ተደፍተው ተቃዋሚውም ቴሬንስ ታስበህ ተገፍታ ተሰባስበን ወደ ቃሊቲ ተጠያቂነትም ተቃሞ ተብትበው ተኩሰናል ተሰማርቶየተገኘ ተጠምዝዘው ተውኔትነት ተደብቋል ተገልፆል ተሳስቶም ታቦትን ተሰሚነትም ታሪካዊነቱንና ተጠጋጉ ታጠቡ ተጠናክረውና ተርጉሞታል ተደርበው ተጮኸ ተጋጠመ ተገነደሰ ተጋጭታ ተጋጠሙ ተገነደሱ ተደመምን ተለዋውጠን ተጋምዶ ተስማምተንም ቴክኖሎጂያቸውን ታዜማለህ ተስፋፍቶና ተዘቅዝቀው ተታለን ተወስዶና ተፅዕኗቸው ተበዝባዥ ታቅዶበት ተሰቀለ ተታልሎ ተመልሰውም ትምህርቶችም ተስፋሚካኤል ተስበን ተወለድኩ ተቀበሎ ታወራለች ተመልክታችሁ ተቀላቅለናል ተወዳጅነቷን ተርፋለሁ ታስቦበታል ተልኮዋን ተግባሯን ተመለሰው ተመላለሰባቸው ትሁቶች ቲማቲሙን ተከቶ ተብረቀረቀ ተቃኝቶ ቴድሮስን ተርጉመውታል ተቀመጥኩ ተደብቆና ተመሰቃቅላ ታፈራለች ተለጥፋለች ተውሳኮች ተዓማኒነቱን ተቀብሮአል ተይዞም ታላቅን ተማክራ ተነካና ተቀብልን ታሊባን ተደናግጠን ተቆማት ተገኝቶላታል ታልቃለች ተገፈፈ ተከሽኖ ተርንኪ ተባብራችሁ ተቀዳሚና ተመፅዋችነት ተዛምዶና ተከለሰ ተፍርዶባቸዋል ተጋድሎም ተጋላጭነታቸውን ታስባ ተከላከለው ተውነው ተንፍሼ ተጠቀምንበት ተመድቤ ተሓሕት ተጠየኩ ተዋበችም ተገናኘኝ ታድለን ተኝቻለሁ ተመሥርተዋል ተጨፍልቀዋል ተፈጠረው ተጫዋችና ተደራሲ ታርቀዉ ተዘፍቀናል ተናገሮ ትሰማለህ ተረጋግቶና ተላብሳ ታምሷል ተፈጥሮንና ተሰማንና ታጥቀን ተፈጥሮዉ ተመዝገብ ታሰታምማለች ተጨብጭቦላቸው ተዘልዝላ ተደራዳሪው ቴሌኮሚውኒኬሽን ተፈጥሮዋ ተከተይኝ ተቃዋሚውንም ቱልቱላው ተኣምረ ተቀናቃኟን ተከብሮለት ተከብሮላቸዋል ተገዢነትን ተናግረውም ተለጣፊዎን ተኪዎቹ ተጎሳቁለው ተምሮና ትስቃለች ትሰለጥን ተዳቅሎ ተቋማትስ ተንብይ ታላላቆቹን ተቀባብሮ ተቆላልፈው ተማሪዎቼ ተሰነጣጥቆ ተቆልፎ ተማጸኑን ተዘጋጀላት ተሰብሳቢዎችን ትሒድ ተስፋዎችን ተረፍረፍ ተመላኪነትና ታስታውቃለች ተስተናግዷል ተጋርጠውበታል ተግተዉ ተቀራረቡ ተናግሮም ተያይዛ ተቆጥሮለታል ተግባራቸዉን ተሳልመው ታቸርን ታድለው ተቀባብሏል ተቆጥቶም ተፈትሿል ተጠቂዎቹም ተሸጋግሬያለሁ ተስተጋብቷል ተቀላቀሉኝ ትላለህን ተሰሚነቷን ቴአትሮች ተጠቀመች ተኩላዎቻቸውን";
            amharicWords[11, 1] = "ተበዳይን ተናግረተዋል ተናጋኔ ተቀይሮዋል ቲሸርትና ታበረታታለች ተሰለፍኩ ታውኳል ቲሸርትን ተርካልናለች ተገለጠልን ተቃውሞዎችም ተከትሏቸው ተካሄደባቸው ተቀበልነው ታጎሩ ተናድዳችሁ ተቀምጦና ቲቪው ተባበረው ታጋሽነት ተጠነሰሰ ቴሌኮሚዩኒኬሽን ተቆናጠዋል ተገብቶላቸዋል ተጎንጭቷል ተሸነፍን ተመኝተው ተጋጣሚዎቻቸው ተከላክላ ተመላሽን ተቋሞቿን ታድሎ ታፔላን ቱሪስቱን ታሪፉ ተስቶናል ተቃናቃኝ ተረዋ ተሰርቷ ተፈቃቅሮና ታማኞኝ ትምህርትስ ተዋጠች ተደቀነ ተኖረ ተሳስታ ቴዎድርስ ተባበል ተቅማጥን ታደርገዋለች ተወላግዶ ተቃዋሚዎችጋ ተዋግታለች ተቀናቃኝነት ተገዳይ ተውኔቱ ታዛቢዎቼና ተዋከቡ ተሸብቧል ተሰናዱ ታፍጓል ተሳሰረው ተጠርጣሪዋ ተመዝጋቢው ተጻርራሪ ተስተናጋጆችን ተደርሶአል ተነስቶና ተመጥኖ ተከፈተዉ ተወልን ተቆናጠው ተወስኦ ትለው ተጎትታ ታግለንና ተጨምረውበት ተደርጉዋል ተደራድረውና ተበሰረ ታስታውሳላችሁ ተዘጋጅቼያለኹ ታመራለች ተባበር ተኮትኩቶ ተፈናቃዮቹስ ተከርችመዋል ተሻሽለዋል ታግደን ተበትኖአል ተደርገውም ተዘጋጅተውባቸዋል ተለከለን ተግሣጹ ተጎዳንባቸው ተለይተኸን ተቀባይነታቸውና ተጉዣለሁ ተራክቦ ተደቅነዋል ተጠግተን ተመሥርቼ ታክከው ተቀርፀዋል ተግዳሮቶቹ ተክስተ ትሰራበት ትለናለች ተረድተህ ተከበን ታትመዋል ቱሪስቱ ተካተውበት ተንደርድሬ ተለውጦአል ተመርማሪዎቹ ተጋፎ ተጠብቆለት ተቀርድዶ ተዳርጌ ተጨማልቀው ተዘረፉ ተሰዳደቡ ቴክኖ ተነባቢነትን ታሣሪዎች ተገኛኝተው ተማከሩ ተስማምቶኛል ተዉኔት ተቀንሶላቸዋል ተገልጦለት ትመኛለች ተፀንሶ ተመኙ ተቃቅረው ትሰጣቸዋለህ ተጯጯሁ ተረድተውና ተልፈስፍሶ ተጠሪትነቱም ተቋሚ ተገዝቶላቸዋል ተኮልኩለዋል ተጠምዳችሁ ትለያለች ተጠጋግተው ተብሎበሚጠራዉ ተበርክቶለታል ተወያይተንበት ተከብበው ተቡለው ተጠቅሜበታለሁ ተበሳጨ ተሰነይና ተገላገሉ ትመርጣለች ተሟልተዋል ተሰናባቾቹ ተርጉሞላቸዋል ተጨንቀናል ታዝባኝ ታጋዮቹም ተዋኒያንም ተሰለፍን ተሠወረ ተወደስ ተገጭቶ ተቸንክሮ ተስማምተንና ተመርኩዤ ተማርከን ተዋዝቶ ታጥበዋል ተሳልሞ ተገምዶ ተገትረን ተሳክቶለትም ተርኮአል ተተኪዎቹ ተቁራጮችም ተበጅቶ ቴሌኮምና ተማምነህ ተበጠሰ ተኮሳትራ ቱቦዎቻቸው ተርነር ታሰረች ተማጽኖዬ ተንትኖታል ታግጄ ተበከለ ትለቁ ተበከሉ ተነሳስተን ተገዝታ ተገልጸዋል ተበልተዋል ተንሰፍስፈን ታማኞቹ ታሪግ";
            amharicWords[11, 2] = "ተሸክመህ ተቆናጦ ተደጓሚ ተዋርዷል ታዩኛላችሁ ተበይኖባታል ተስ ተልእኮዋን ተገደዉ ተጥለቀለቀች ታውኮ ታመሻለች ታምሞ ተጋብዛ ተፈቅዶላት ተጠቅሞና ተዝለፍልፈው ተቀንብባ ተማጽነዋቸዋል ተንከባሎ ተርበው ተዋናይና ታሰማለች ተመሳጥረህ ታምሳ ተፈጥሯ ትላቅ ተገለጸልኝ ተማሪዎቹንም ተባበሩን ተጸኖ ተገናኝቼ ታዋድሮስ ተለማማጭ ተቋምዎች ተንቀባርሮ ተዋህደዋል ተመስለው ታደርጋላቹህ ተራን ተላላኪዎችና ተመሠረተበትን ታውቀዋለህን ተነ ተፈጥሮኣቸውም ትሞክራለህ ተውኔታዊ ተሸማቀን ተኙ ተነስተውብህ ተቁዋቁሞ ተጠረጠሩ ተቀላቅሎና ተጨንቆና ትህትናውን ተደናግጦና ቱቀማ ትላለችሁ ተኮ ተቆጣጣሪም ተለምነዉ ተማዕጽኖ ተነቃነቀ ተቃዋሚዎቹንና ተዋት ተፈርዶብን ቴሌቭዥኑን ተፎካካሪው ተመርጠናል ተባባሪነትና ትመዘግባለህ ታገልን ተበትነን ቲዎድሮስ ተሰፋዪ ተጻረዋል ታሪኮቻችንን ተጋርጦባቸዋል ታጃበው ተራዉ ተዋናኝ ተቋሙም ተቀበልነውም ተቋራጮቻችን ተፎካካሪዎቻቸውን ቱርካውያን ተንከባክበን ተቃኝቱዋል ተገልጋዮችና ተፈጥሯችን ተማምነናል ቱሎ ተታልዬ ተቃዉሟል ተገኘሁ ተክለያሬድን ታከለን ተውላጅ ታሟልና ተገናኝን ተሳስረዋል ተውኔቱን ተሠርቶለታል ተለጥፋ ተጎብሮ ተስማማሁ ተላልፎአል ተሸማቅቄ ተወዳድረዉ ተለቃቅሞ ተሽረዋል ተቋሞቹን ተረካቢው ተማሮ ተሳልቀዋል ተኮርነት ተፈጥሮአዊውን ተንፍጎ ተሸከርካሪዎችና ትላቀቅ ተመስክሮላቸዋል ተጭበርብረናል ተወሰኑትን ቲቶና ቴኖፎቪር ተምረነዋል ተጨመረላቸው ተነጥቄና ተረድተዉ ተዋረደ ታክሲም ተቻችሏልና ተመረቀለት ተከራክሬያለሁ ተጫወተው ተደራጊ ታወራልን ተመልተን ተቃውሟቸውንም ታዲዮስና ተካሒዷል ትልልቁ ተሳፋሪን ተቦካክቶ ታመልጣላችሁ ተማረን ተጋሪዎቻቸው ተኩራርቶና ተቀያይሯል ተቀጥቅጠዉ ቱርካውያንን ተዋበችን ተባለው ተግባርዎ ተኝተህ ተዋዶ ትረስቲስ ተገጥመውላታል ትኅትና ተገንዝበህ ተቀይሰው ተወያይተውና ተስማምተውና ተገተሩ ተስፋለም ተዳብላ ተደራርቦና ተፍሲር ተግባቢና ተነሳሁበት ተረበኞች ተሳቀቅሁላቸው ተከሳለች ተራችንን ተኮልኩሏል ተፈቃሪው ተመሰከረ ተቀጥያዎች ተለጥፈሽ ተቀዋሚዎቹ ተነቅለው ተንጓጉቶ ተደልድለዋል ተነሥቶላቸው ተሸከርካሪዎችን ተረክበናል ተቀይሮና ተጨምሮአል ተክለሐዋርያት ቲሺ ተማኅፅኖ ታጡታላችሁ ተራምደን ተከታይን ተደፍኖ ተጋፉት ታውቋቸዋላችሁ ተደብድባለች ተያዘች ተመሳስለዋል ተጋቦት ተሸራረፈ ተጋለብንለት ተቀይረውበታል ተወያይታችሁ ታቦታቱን ተንኮልንና ተወግሮ ተንቦጨቦጨ ተማፀነኝ ታጋዮቼን ተርጓሚዎቹ ተቀፍቅፎ ተሸከመ ተጨማሪዎቹን ቴሌቪዥናችን ታዝባችሁ ተፍረክርኮ ታግደናል ተገኝቶባቸው ተድላድለው ተሓት ተገበያይ ተጨዋቾቻቸውም ተሰነባብተው ተቃዉመዋል ተከራክረንበታል ቲን ተመገቡ ተሻግረዋል ተያዘና ተሳፈርን ተዋጸዖን ተሰኝተዋል ታውፋንያ ተሰዷልና ተነድፎለት ተዳራሽነት ተለቪዥን ቲኬ ተወርውሬ ታይቶበትም ተደናግሮ ተቀምጠውም ተመልሶልኛል ተጣድፌ ተሸውደናል ተፈልቶ ተፅዕኖች ትላንትናዎቹ ተሬዛ ታሪክዋ ትምክህትን ተመዝብረው ተበራክተው ተቆጣጠሩት ተሸሮአል ታአማኝነትንና ተፈናቀሉበት ተፍተው ታውቆል ታስባላችሁን ቴዎዶር ተወላጆችስ ተሠራጭቷል ተከትለህ ታጥቀውና ታሪኮቻችን ተመጽዋቾች ተጨናንቃ ተናግሪያለሁ ተጋድሎው ተጠያቂውስ ተሰማችሁ ተሸሽቶ ተከታዮቻቸውም ተፈሪያኑ ተጠርጎለት ተጨፈጨፉ ታየች ተከሰውበት ታም ተምሳሌነታችን ታውቃለሃ ተበረታቶ ተከስሦም ተሰሚነታቸው ተገድቦላቸዋል ተቀጢላው ተሳልቆበታል ቲንሴት ተጋዳላዮቹ ትመርጣላችሁ ታቀብ ቱባዎቹ ትህትናቸው ታደለን ተናግረውት ተወርሯል ተጠቀምኩ ተበርዞ ተጋድሎአቸው ተጫወትክ ተንጠልጥላ ተዋረዱን ተቀባይንት ትልቅዋና ታ