            amharicWords[11, 3] = "ተመንዛሪ ትምህርትንና ተፈጽመዋል ተሳካለት ትዝብቴ ትሆናላችሁ ተቃልሎ ተናዳ ትቀላቀል ትክክልኛ ትሪቡኑ ተጋርጧል ታዛቢዎችንም ትከሻውን ተስተውሎአል ተፈርዷል ተደናግጧል ታስተምር ተወድሰዋል ታርደው ተበታትኗል ተቀየሩ ተፋጥጦ ትንቢታዊ ተፈጽሞበት ተክዘው ተከፍለዋል ታከናውናለች ተቃውመነዋል ታስፈልጋታለች ትዳራቸው ተኮራርፈው ተቃወሚዎች ተግባቢነት ተገዥነትና ቷል ተነጥፎ ታቅዶና ተክተዋል ትቃወማለች ትባል ታስታውሰኛለህ ተገፋፍቶ ተነሺዎች ታዋቂዎችን ተጨምረው ተከሥተ ተጽፎላቸው ተሸነፈች ተከፍሎበት ተጋጣሚያቸው ተቀባዩም ተከተሉን ተገነዘቡ ትታይ ተጉዤ ታትሟል ተጣሞ ተልካ ተመልከቺ ተቋሞቻቸው ተገደለች ተሟግቶ ትንኮሳዎችን ተንኮሉን ተመለከተውና ቴሌቭዥንና ተስረቅራቂ ተይዛችሁ ትዕግስታችንን ተሽከርካሪዎችንና ተጋብዛችኋል ተስፋነሽ ተመሥርተን ተቋሟት ተመላልሰዋል ተንደላቆ ተገልጽዋል ታችና ትዞራለች ተገናኘተው ታችን ተቀናጀቶ ተጎጂዋ ትላንትናም ትጋጫለች ተዋሳኝ ተጫምተውና ተጎጂው ተክኖሎጂ ተቀለበሰ ታድለዋል ተውኩትና ተደረገበት ተፈልቅቀው ተመራጮቹን ተቀበልን ተከላክለዋል ተቃዋሚዮቼ ተሻርከው ተመልካቾችም ተባልንና ትጓዝ ተለዋዋጭና ተክቷል ተጓድሏል ተዋጽኦዎች ተከብረዋል ተያያዘ ተዳድራ ተከራዮችን ታመዉ ትሄጃለሽ ትራንዚተሮች ተወካዮችንና ታያለች ተወዳጇ ተጋምሷል ተጠብቀውና ታስቢያለሽ ተጋባን ታሰሩበት ተነሳሽነታቸው ተዋርደውና ተከላከለ ትግራውያን ተችሎዋል ተልእኮዎች ተለዋወጡ ቶሬስ ታውቃታለች ትነግረኛለህ ተቆጠበ ትመክረዋለች ተወልደመድኅን ተፍቼ ተሰብስባችሁ ታስመዘግባለች ቶፖግራፊ ተጠናውቶ ተናገሩት ተሳናቸው ተመቷል ቲቪሽን ታዳሚው ትንኮሳና ተጨባጭነትና ተገንና ተቃርበናል ትእዛዛቸውን ተቀጽላ ተቀጣጥረን ቱኒዚያን ተቀበልኩ ተነግሮት ትዕግስቱን ትብብራችንን ተባራሪዎች ታዝበናል ተመላኪነት ተደማጭ ተጠራጠርኩ ተሞክሮዋል ተታሎ ተሻለን ቴሌቪዥኖችና ተረስተዋል ተገብቶልናል ተጠርጣሪና ተጠይቅው ተቀበላቸው ቶምሰን ታመጣለች ትታያላችሁ ቲልሞ ተከታዮቿ ተግባብተዉ ተቀበለችው ተያይተው ተቀናጀ ተርፏል ትዕዛዛትን ትርጓሚ ተደፋ ተኸላይ ታሪኳንና ታሪኩንም ተሸጋጋሪ ተጠቅመውበት ተደርጎዋል ተነደፈ ተወሳስበው ተሞገሰ ተዋግተዋል ትረዳ ተጠናቅሯል ታማኞችን ታይዋንን ተጠናክረወ ታከስ ተሰምቶን ተመለከትኩት ተወክሎ ትንፋሻቸው ተሰባብሮ ቴሌም ተሰማርተን ተመሳሳዩን ተጋድመው ቱርካዊ ተሳፋሪውን ትልቀቅ ተቀባይነቱን ተቀረፀ ታግሦ ትቷቸዋል ተቀምጣለች ትግሬዎችም ትጥቁ ተከራይተን ቴአትርን ትርሓስና ትደርሳለች ተሰሙ ተመክረው ትርሓስን ተጠሪዎቹ ተጠናቅቀዋል ቲሞር ትቀመጣለህ ተሰላፊነት ተመሳጥረዋል ተቀዶ ትከሻዋን ትርኢቶችን ተሰሩ ትመታለች ታሪቅ ተደጋፊነት ተፈጸመባቸው ተሿሚው ትንታኔዎችና ተገቢውንና ተገፎብን ቶፊክ ተክለሀይማኖት ተሰውሮ ተዓማኒነቱ ታቀርባላችሁ ቱራቲ ተደረገች ተግበራትንና ትመልሳለች ተጓጉሎ ተቋማችን ትልቅነቱን ትግላችሁን ታልፈዋል ተቆጥራ ተወረወሩ ተጠቂና ተለወጥን ተጋዳዮች ታክቲኩ ታፋቸው ተዋንያንን ትንታኔዎችን ተጨዋቹን ተሞክሮዎቿን ተገለጸለት ትራኦሬ ተሰጥቶች ተሸከርካሪዎች ትሰማላችሁ ትበታተናለች ተመችቶት ትግላቸውም ትዳሩ ተባዩን ተጽፎላቸዋል ትወጣ ትመርጥ ተዋህዶን ትመታኛለች ተቀሩት ተክለኃይማኖትና ተጋድሎውን ተከዜና ተከምሮ ተወርቷል ተሟሙቆ ተሸክመውት ትከረት ተጠጋሁ ትንኮሳው ተሰቃይተው ተቃላሳይነትን ተዘጋጀላቸው ትንቢተ ተደረገና ቴውድሮስ ተንትኗል ታካሚዎችን ታወቋል ተካቶበታል ተገኑና ተማሪዋቹ ተበዳሪዎችም ተላትማችሁ ተናግረዉ ታሪከ ትርምሱን ታቦቶችን ታደርጉ ተመጋቢዎች ታክቲካ