            amharicWords[11, 4] = "ተቆናጠጡ ተልዕኮአቸው ትሻለህ ተማጓች ተከፍላ ተዳፋት ተርጓሚነት ተፈጭቶ ተሰንዝሮ ተሽጠዋል ተዓምረኛ ተነጥቀናል ተጋበዘ ተቀላቅለን ተሠልፎ ተሰላችተው ተመጋጋቢ ትገባላችሁ ተበለው ተቀጥቅጦ ታታሪነትና ቴክኒሻያኖችን ታይፕ ተግባራትንና ተወርች ተገልፆላቸው ተምርምሮ ተመድባ ተለውጠው ትግሌን ተምረናል ተያዩ ታክሲዎችና ተምሳሌትና ታዩዋቸው ተስተናግዶ ተነሳች ተፋቅሮ ተፈልፍለው ተነጥቋል ታክሲዎችን ታደርገዋለህ ተበድረን ትጠይቀኛለህ ተወክላለች ትወነጅላለች ተጓጉዘዋል ተመለከቱና ታዛቢና ቴክኒሺያኖችና ተነሳን ተተችቷል ተናድደው ታጣቂው ተጠይቄ ታላቅዋ ተጋብተዋል ታውላለች ታዝዞ ትከፍላለች ተሰውተዋል ተረጂነት ተከታይም ታዝዤ ተፅእኖዎች ተፈቀደለት ተገዥዎች ትኩረቷን ተገንጣዮችን ተመራርጠው ተወሰደው ትኑር ተለያይተን ተሻገሩ ተደልድሎ ተግባራችንን ትኩሳትን ተጋብቶና ተቋምም ትሪያንግል ተከባለች ተመትተዋል ተመካክረዋል ታዝበን ተጠየቀው ተቃውመውት ተነግሯት ተመሥርቶበት ተሰጣት ተነስተሽ ተካትተውበታል ተባባሪነታቸውን ተባራዊ ተዋረድን ቴምብር ተብየ ቴዲን ተደባድቦ ቴታሎች ተካፈሉ ትልሞች ተሰባስባችሁ ተጠቅሞበት ትረዳለህ ተረጋግጦበታል ተወጥተናል ታምኖባቸው ተረሻኝ ተንጋግተው ትመለከታለች ታሃኒ ትሕዴን ታልፋለች ትቸር ትከብራለች ተናፋቂ ተብትቦ ታመጪው ተመሳሰለ ታግተን ተረካቢና ተወንጅለዋል ተሰኝቷል ተቀምጦዋል ተጋጥሞ ትሩማን ቲሸርቱ ተዓዋታይነትናን ትግሬም ተሸርሽሮ ተቀያይመው ተፈጠርን ተዳርጋለች ተይዞና ተከትለዋል ታስቦበት ተሸበረ ታፔላ ተማጽነው ተከባካቢ ተስተናጋጆች ትብብሩም ተጠያቂነቱ ተሎ ተክሎቹ ታስበዋል ተምሳሌነት ትገምታለህ ተማፅኖውን ተነሺ ትንሽነት ተኩት ተማፀነ ተፈርጃለች ተነሽ ተግባራዊም ተጎድተናል ተቋራጮቹ ታዝበው ተግባብተናል ተጓጓዘ ተዋጋን ተራችን ተሳዳቢዎች ታሪክህ ታንዛኒያንና ተጣልታችሁ ተወሰነልኝ ተዳክመዋል ተወስኖብናል ተፈሪያንስ ተቃ ትልቅነትና ተመስርታ ቴክስታይል ትሠራለች ትጽፋለህ ተስጥቷቸዋል ትምክተኝነት ተዝናንቶ ታለቅሳለች ተወህዶ ተጧጡፎ ተኩኖ ትሬዛ ተጫራቾችን ተጓዞች ተሟጥጦ ትዳርም ተንቀሳቅሳ ተልባና ትሆንላቸዋለህ ተደርገን ተካከለ ተልእኮአችን ተንበርክካ ተከልሶ ተያያዙት ተሳስረን ተመርምሮና ተችለዋል ተናካሽ ተንጋላ ትውላለች ተፈጽሞባት ተናነቀኝ ታያይዞ ተባብለን ተኖ ትሂድ ትግሬነታችን ታረግላቸው ተጨባጨ ተከተልኩት ተኩሶች ተቋቁመ ተቆጣጣሪዎችና ተክለህን ተመሥርቷል ተባበሩኝ ተኪ ተኬ ታርጫ ታቦቶቹ ተቋቁሜ ተበሳስቶ ታምብሪጅ ተቋዋሚ ተቀላቅላለች ተነገረኘኝ ተመልካችም ተፎካካፊ ተነቃነቁ ተጋፍቶ ተጎበኙ ተከትሎና ተንታኞችም ተንኩሶ ቱርካውያኑ ተሰፋየ ተፈናቀለው ታዝባችሁልኛል ተቀምተዋል ተሠራጭቶ ታግዛለች ተቃውማለች ተባለና ትተውልን ተቆልፎባቸው ተደምረን ተንከራተተ ተፈጥሮአችን ተከሳሽነት ተረዳድተን ትላን ተለጣፊውን ተሳስቦና ተከብሮልኛል ትላንትን ተቆርቁሮ ተለውሶ ተቆጥሮበት ተጋ ቱል ትመጣበታለች ተጠገኑ ታመጫለሽ ታሪካዊትና ተጋደመ ቲዬሪ ተፀፅተው ተሸክሟል ተጎዱ ተዘርረዋል ተጎዳ ተገናኘ ተግኝተዋል ተሸጋግረዋል ተማረ ትውፊት ተጠመቀ ተወዳጅነትንና ተዳፍኗል ቶማስም ተፈቃቅረውና ትግረዋይ ተረሽኗል ታሪኮቻቸው ትውስታና ትውውቃቸው ተደራጀ ተጠቃሏል ትደበደባለህ ተቆርጣ ተጠራጠረች ተርፋለች ተሰንዝሮበታል ተዘመዱ ቱቱ ተመክሮን ታጥቀዋል ተመዝግባ ታሳካለች ተገድደን ተፈጽሞብኛል ተበድረዋል ተናገረች ተካፍላ ትሃት ተረጋግጦና ተወስዶባቸው ተንኮታኩቶ ተልዕኮውም ተጠቀመው ተካሰሱ ተጽፎአልና ትኩረታችንን ተሟጋቾቹ ተፈራርመን ተድቅኗልና ተሹሟል ተዘምቶ ቶባኮ ታ