            amharicWords[11, 5] = "ቴንስ ታፍኗል ትክከለኛ ተነፍገናል ተሰምቷቸዋል ተነስተህ ተወያይቶበት ተመላሾችን ተማሪዎቹና ተሳስቻለሁ ተጨማሪም ተቀብለውት ተኩረት ተበልተው ታቅፈን ተስማሚና ተግባሯ ተቆጣጥረናል ተረባርቧል ተመሳጥሮ ተንትነው ተበታትነን ታንብብ ተግባሮቻችንን ታካሚ ተገደድኩ ተመዝገቡ ተወስዶበታል ታጠናክራለች ትተዳደር ተጠያቂነታቸውን ትብብሮችን ተቀባይነቱ ተፈቶ ተታለው ተገደበ ተመኘሁ ተገርመን ታማኝነትና ተደግፌ ተሰማረተው ታማኝነትን ተርጉመው ቴምብሮችን ተመስጦ ተሠርተው ተሥፋዬ ቱትሲዎችን ተስተካክሏል ቴዎራልድ ተመልሻለሁ ተጋጣሚዎች ተዎድሮስ ተካፋይና ተመስገንም ተጫርቶ ቴዎፍሎስን ተጠቅሰው ትበላለች ተጀምሮአል ተቋምነቱ ታክሱን ታሪካዊት ተጠያቂና ተሰነዘረበት ተዘግቶበት ተደመሰሱ ተኩሼ ተጠንቅቀን ተግኝቶ ትንፋሼን ተያዩና ተስፋፈተዋል ተገለጹ ትራጀዲ ተነጥቀዋል ተተኳሽ ትሰጣለህ ተሳካ ተቀዳሚው ተጎብኝቷል ትጠራጠራለህ ተቀራርበን ተራበ ተቀናጀተው ተነገራቸው ተቀምረው ታጣቂዎቹን ተመልክቶአል ተረቀቀ ተማሪዎቻቸው ተገርመው ተከስሼ ቲኬቶች ትወስዳለህ ተገምግሟል ታምሬ ተሰጥቷት ተባ ተብላችኋል ተጭኖበት ተሰግቶ ተወካያቸው ተፈቅዶልናል ትእዛዞች ተሽከርካሪው ተሟጋቹ ተጭኖት ተጀመረና ተዋቸው ታምቆ ተላላነት ትንቢትም ተወሰድን ተኚ ተሁኖ ትጠፋለች ትዳራቸውን ተራኪ ትሪፖሊን ተገልጻል ተሊላ ተለጥጦ ታምቦ ትጫወታለች ተያያዝነው ተወ ትይዛላችሁ ተለዋውጠው ተንኮለኛ ተገርሜ ተዋቅረዋል ተገርሞ ተባባልን ተዪ ተቃዋሚነታቸው ተይ ተሽለው ተሞልቷል ቱላ ትውስታችን ተግ ተቆጣጣሪዎችን ተደግሟል ተጠያቂዋ ተባዝተው ታሪካቸውና ተጋልጠን ተጨንቄ ታግሏል ቲሸርቶች ተነፈሰ ተሻግራ ተቀልብሶ ተፍ ተቀንሰው ትግስት ተነዳ ተሰበረ ተቀብቶ ትግሬና ተኮትኩተው ተቀይረዋል ተናንቆ ተወዳዳሪን ተናግቶ ተረቱን ትተዉ ተሻላሚ ተጽፈዋል ታስወጣለች ተነሳሳሁ ተፈታች ተከታይነት ተለጥፏል ተቀመጡና ተሬሳ ተስተናግደዋል ታስረናል ተጠላ ተቀናቃኖች ትርጓሜና ተጎድተዋል ተሽሎ ትንኞች ትቻለሁ ተጋግዘን ታጭተዋል ተቀዳጁ ተግባራትንም ተወስዶብናል ተወጥረዋል ተደፈርን ተከስክሳ ተሰጥተው ተጠያቂውም ተማረኩ ተለክፎ ተዳብሎ ቶክቹማ ተልካሻ ተሸብሮ ተቀንሰዋል ታማኝነታቸውን ትግሬውን ተስፋይቱ ተዳዳሪነትን ተቀያሪ ተነፋ ትገባ ተሸማቀው ተክሏል ተይው ታሪኩም ተክነውበታል ተመርጣ ቴክኒካዊና ተቆጥሮላቸው ተቀምቷል ተደወለልኝ ተፋሰሱን ትውከትና ተይዤ ተስማምታ ተረገጠ ተጠቅሎ ተሀድሶ ተከበናል ተሸላሚነት ቴሌግራም ተጫዋቾቻቸው ታክሰ ተሳተፈ ታፈሰና ትርኢቱና ታይቶኛል ተፈላጊነትና ታውቁት ትምህት ቲቲ ተጠቅሜ ተዝናንተው ተፈናቀልን ተቆራኝተው ተንከባክባ ተነፈሰና ተሳትፈውበት ተኪው ታሪካዊነት ተዝቆ ተነባቢነት ተረጋግታ ተሰባብሯል ተወርውራ ተገድዳ ቲኪ ተመሳስሎ ተጠያቂነታቸው ተረብሸው ተረዳሁ ተገኘች ተጥሰዋል ተጠቃሚዎቹም ትምክህትና ተጣድፎ ተወዷል ታፍሶ ተጠናቅረው ተስፋይና ትዝታዬን ተዋርደን ተሞክሮነቱ ተፎካካሪነት ተገድጄ ታክሲና ተረድቼዋለሁ ተገኘና ተደስቷል ተጨምሯል ተጽእኖና ታል ተጠሪን ተወገደ ተጨናንቆ ተሃድሶውን ተጠይቆበት ተላላፊና ተኛዋን ታማ ተገኝተናል ተመዝግበውና ተገልጽውል ትመልሱ ተደውሎለት ተከራካሪዎችን ትርጓሜው ተከታቶች ተድርጓል ተጠርጣሪዎችና ተወረርኩ ታደለና ተደራደሩ ተፈጥሮባቸዋል ታዲያላችሁ ተውከት ተፈራርሙ ተወግቶ ቲፕ ተወዳደሪዎች ተከተልን ተንኮልና ተመዝጋቢ ታደግ ተመራቂዎችና ተገነዘብኩ ተቀጣጥለው ተከልለው ተቀጥቶ ተጠጉ ተዋህስያን ተማርን ተያያዝኩት ትተናል ቴክኒሺያን ተከድኖ ታን ተዘፈቀ ተወጣው ተዋርደናል ተመራቂዎችን ተጠመዱ ተወሰደባቸው ተሐድሶው ታላቋን ታየው ተድርጎ ተከትላችሁ ተስተናጋጅ ተጸጽተው ተንበርክከን ተናጋሪን ተሜን ተሳስቷል ተዓምራትን ተፈጽሞበታል ተጠምቶ ተከታዮችም ተነክሮ ተጨናግፏል ተፈጻሚነቱ ተውሶ ተሳሳተ ታረካዊ ትገልፃለች ተኩሰዋል ተመክሮችን ተፈፅሞብኛል ተላለፉ ተወነጀሉ ትናንትን ቴሊ ተስማምቶና ትነግረናለች ተዘርተው ታጥቋል ተንሳፍፎ ቴፑን ተደራሽነቱን ተስጥቶኝ ታጩ ተለውጣ ተዓምራዊ ተወዱድሮ ተዋፅኦን ተቅሟትን ቲቸር ተቃውሞዬን ተጠናቀቅው ተከላካዩን ታላላቆቻቸውን ተስተናግደው ተዛምቷል ተደናቂ ተሳትፌያለሁ ትነሳለች ተከተላት ተባባሪዎቻቸውን ቴሊቪዥኖችን ተመክሯል ተውና ትርንስፖርት ተቀምጠናል ተአማኒነትና ተጫዋቾቼ ተሳትፏቸውንና ተረዳን ተንታኝና ታውቆና ተጽእኖዎች ተቋርጦባቸው ተቀበለን ተንኳሽነት ታጣፊ ታቀፉ ተዘጋግቶ ታሰበው ተምራ ተወዳዳሪዎቻቸውን ተመጣጣኝና ተደጋግፎና ተሰምቶል ተሰጠኝ ተፋጠጡ ተቃውሞአቸው ተፋጥኖ ተዝናኑ ተከስቶአል ተከማችተዋል ተቃውሟችንን ታይቶአል ትም ተሰማውና ታውቃቸዋለህ ታመጣለህ ትሪ ታረቁ ተወካይነታቸውን ተንቀሳቃሽና ተመዝግበን ተኮፍሶ ትባላላችሁ ተተኪዎቻቸው ተጨፈኑ ታለጌታ ተገዝተን ተቆጣጠረች ተዳፍነው ትቸ ተንቀሳቅሰናል ትግባር ተወቀሰች ተዘፍቆ ተለቀሙ ተብለውም ትሬዠሪ ተደጋጋፊ ተሰባበሩ ተጎልቶ ታዝዟል ታዳሚዎቹ ተተብትበን ተገባዶ ተምሳሌታዊ ተወራሪ ተደርምሶ ተፈትቷል ትጉህና ተስኗታል ተቀያይረዋል ተሳዳቢ ትስስሮች ተጨዋቾችና ተግባራትጋር ተከላካዮችና ተነገሯል ተሳፍረን ቴራፒ ቴክኒሻኖችን ተጋድሎዎች ታስባለች ተዘግቦአል ተደላድለው ታንጸው ተወራራሽ ተነክረው ትግርኛና ታሳሪው ተናግራችሁ ተግባራዊና ቶማ ትቅደም ተተችተዋል ተጠሪዎችና ተነሳሽነቱን ታክመው ትጠይቅ ተገመተ ተስፋዝጊ ተዋናዮቹ ታዝቧል ትሰራ ተጫዋቾቹም ታመሙ ተርባይኖችን ትጠብቃለህ ተካርሮ ትግበራም ትዝብቱን ተሳስተን ተወዳድሬ ታጥቃ ቶኑ ትእቢት ተከትቦ ተሠጥቷቸው ተዋግቼ ታግቷል ታዳሚትሱ ትምርቱን ትቀላቀሉ ታንኮችንና ተገናኝተናል ተዘጋጀሁ ተጣለበት ተነጋግራችሁ ተከላካይነት ተቆርቁረው ተመቻችተው ተቆጣጣሪዎቹ ተንታኞችን ተንትኖ ታስታውሱ ትርንጎ ተረኺቡ ቱርካዊቷ ተፈጽሞብናል ተሸፍነው ታወጀ ተክላይን ተፈቃሪዎች ተከለከልን ተቀዱሚ ተቆጠረ ቶጎ ቴክኖዎሎጂ ተሻግረን ተጠራጥሮ ትዝብታቸውን ተቀብለህ ቴክኒዎሎጂዎችን ትምሕርታቸውን ተሠጥቷል ትግሬነት ቴሌኮሙኒኬሽንና ታማኝን ተሸንሽኖ ተንኮሉና ተፎካካሪነቱን ቶራያ ተተከለ ተንጠልጥለው ተስጥቷቸው ቶፋ ተታልለው ተጋጭተዋል ተጫኔ ተቃውሞአችን ታዝበናልም ተንገላተው ተዳዳሪዎቹ ተጠቃሚነቷን ተነሱና ተዘግቶባቸው ተምሬአለሁ ተረስቷል ታግለህ ተነጋግሬ ተቃዋሚዮች ተዋድቀው ቴሌቪዥኑን ትበልጣለች ትጠቀም ተዋዋሉ ተቀባይዋ ቴሌኮሙኔኬሽን ተናንቀው ትግሬዎቹ ተስተውሎ ተቻችለን ተባራሪዎቹ ተሸማቆ ተደፋፍረው ተጠያቂውን ተሳለሙ ቴሌኮሙኒኬሽንን ትኩሎች ተቃውሞኣችንን ትሰራላችሁ ተጨቋኝ ተደራዳሪዎቹ ትገዛለች ተቀኘ ተሻለና ታግዳችኋል ተካሒዶ ትምህርታዊና ተራኪዎች ትግበራዎች ትከፍላለህ ትንበያን ተንገላተዋል ተራማጆች ትወና ተንፀባርቆበታል ተገዥው ተከታትለውታል ትራንስፎርሜሽኑ ተስፋዬም ታውጇል ተምሳሌትነት ተሠግቷል ተዘጋጅቶለት ቴሌስኮፕ ትከሻችን ተረማምዶ ቱቦዎችን ተበድለናል ተረድቶት ተኮሰ ታደርጉታላችሁ ተሰምቶኝ ታጥረው ተቀባሪ ተክሌና ትንታግ ተከታትላ ተካፋዮችም ትንበያዎች ቲክሲ ታላቅነትን ትጎዳለች ተንጠባጥበው ተቃውሚ ተከታታይነትና ታግባ ተመስገኝ ተገጿል ተሠራጩ ተቀጨ ተሰቅሏል";
            amharicWords[11, 6] = "ታሪክም ተንጋሎ ተጠቀሙ ታስታጥቃለች ተሰምተው ተበክሏል ተጨባጩ ተቋቁማ ቶንና ተስተጓጉሏል ተጋቢዎች ትርሓስ ታስታውሳለህ ትዝታዎች ተጠርጣሪዎቹም ተናገርሁ ተልኳቸውን ታምኖ ተንሠራፍቶ ተረካቢነት ተራዬ ታነሳላችሁ ተጨንቆ ተመረጮች ቱራ ትላንትናው ተወጥተዋል ትድሃር ታሪፍና ትግስቱ ትራፊኮች ታደሰም ትምህር ቱኑ ተንጠለጠለ ተዋጂ ታምመው ተደፍቶ ተከራከሩ ታገኘዋለህ ታኀሳስ ተቆጣጥሮታል ታልቁ ተባብለው ተጠቁ ታክሞ ተቋማቱም ትብለጽ ቱንም ታጥበው ተማረው ትራክተሮች ተፈረሙ ተነሳስታ ተዛውረዋል ታሸንፋለች ተጨማሪው ተፈለገ ተሳነኝ ተማሪዎቻቸውን ተናግሬያለሁ ተጋድሞ ተላልፎባቸዋል ቲቺንግ ተከናንቧል ተካሮ ተጠቃልሎ ታቅቧል ተሻምቶ ትክክልም ተዳፈነ ተከተሎ ታዝለው ተመድቦለታል ተገትሮ ትቀርባለች ተሰላፊ ተገልጾዋል ተናጋሪዎቹ ተቆጣጥረን ተስሎአች ታክሲውን ታዋቂነትና ተቀብሏቸዋል ተበሉ ተቃዋሚና ተስፋፍቷል ተውቦ ተከሳሽን ትምህርታችን ተኛሁ ተውት ተጎትተው ተቆጣጥሮት ተመልክቶታል ታያቸውና ተጫዋቾቻችን ተስፉ ትሉናላችሁ ትችቱን ተነጋገረ ትተውታል ተቀብዬዋለሁ ተጨናንቋል ተመርጣለች ተወቀጥ ተሰጠን ታድጋለች ተቀበለኝ ተሳፋሪዎቹ ትንተናዎች ታጁዲን ተሸናፊዎች ተሾመን ትሪሊየን ቴፒ ተርማል ተከፋፍለዋል ትግባራ ታግደሃል ተጧጧፈ ታቦታት ታጋች ተሰጥቶኛል ተግባብተን ተጠሪነቱም ተቀባይነታቸው ተሸጋግረው ተፈናቃዮቹን ተመንን ተመራጭነት ተሰብረው ተሠምቷል ተኽሌን ትቀበላለች ተከሣሾቹ ተጋጥመው ተወልዱዋል ተሰንዝሮባቸዋል ተገንብተዋል ትጉ ትለኛለች ቶሚ ተገርስሶ ተስተጓጉሎ ተባባሰ ተፃፈ ትሪቢዩንን ተፈፀመበት ቶች ቱቦዎች ተማሮች ተሃድሶው ትክክልና ተዘጋጅቻለሁ ተደርጎም ተችቶታል ተጋብተው ታዳጊው ቴሌቪዥኑ ትናትን ተናዶ ተቀላቅሏል ትዕግሥቱ ታከብራለች ተቃዋሚዮቻቸው ተወዳጅነትና ተቀየሰ ተቆጣጥረውት ተቆጠሩ ተገኝታለች ተጉዛ ተኝታለች ተችሎል ተፈርዶ ታብሌት ተዘቅዝቆ ተቋውሞ ትሔዳለህ ተራቁቶ ቲዎሪ ታድነው ተጠልለዋል ተነፃፃሪ ተላላኪው ታደርጋለህ ተወዱዱሪ ቴክኒሽያን ተሰናብቼ ተመራጮችም ትጠቀማለች ተሰረቀ ተጠናክሮና ታዝዘዋል ተማሪውና ተወጥራ ትራንሰፖርት ታድመው ተማሪዎችንም ትራፊኩ ተመዝኖ ታጥፎ ተሯሯጡ ተጠቀሰው ተጠልሎ ተነገረን ተቀይሞ ተሰለፈ ተነጣጥለው ተአምራዊ ተጠግቷል ተኝታ ቱራቢ ታንዛኒያን ታላቅነትና ተሰማም ትርፍም ትምህርቱና ትችታቸውን ተቋሞቻችን ተረኛው ታፈሱ ተቆርጠው ተወዛዋዦች ተሰማራ ታገኛላችሁ ተጓዥች ተቀጣጥሏል ታየችኝ ቱርካዊው ተባብሮና ትራንስፖርተሮች ተቆርቋሪና ተለምኖ ተቆጥሮባቸው ታሳቢዎች ተረድተዋል ተረድቶና ትዝታን ታውረው ተንበርክከው ታለንት ተመሰርቶ ትእዛዝና ተስፋዎች ትህትና ትቆማለች ታግለናል ታጅባ ተሰጥቶን ተግዳሮቶችን ተሸጠ ተሽከርካሪና ቴኳንዶ ተንበርካኪነት ተፈሪያውያን ተሽሯል ትቸዋለሁ ተወራ ተተኪዎች ተንሰራፍቷል ተነገረው ተችተው ተሰርዘው ተሰዶ ተንትነዋል ተነስተናል ተሞልተዋል ተወለደ ተሰማቸውና ተመሳጥረው ትግረ ትርፋቸውን ትግሉንም ተንጠላጥሎ ተገዢዎች ታዲያኮ ታወሰው ተዳርገናል ተፈረደባት ቲ ተገንዝበውና ታውቀዋለህ ተስፋጽዮን ተመክቶ ተጠጋና ተከታታዮች ተግሣጽ ተጨዋቾቻቸውን ተሞክሯችን ታንዛኒያዊው ተጠርጣር ተመሣሣይነት ተስማምተውበት ተናግቷል ተዳርጋ ተራርቀው ትቀራለች ተደናቂነትን ተወግተው ተራራዎችን ተዋሃዱ ተሰጥቱዋል ተሰናብቷል ተረጋጉ ተዘፍቋል ተጠግነው ተጠቁሞዋል ተሰብሰበው ተገኘበት ተደቅኖ ትርጓሜውም ተርጉመን ተመጋቢ ተፈርጀዋል ተደምስሷል ተከፈቱ ተወንጅሎ ተወውና ታጭቀው ተወያዮቹ ተከባ ተሻረ ተወርቶ ተንፍሶ ተፈጠሩ ተገለዐ ተዋናዮችን ትራንስና ተ