            amharicWords[11, 7] = "ቴሶ ተቸግረናል ተገኝቼ ተወካዮ ተቀብየዋለሁ ተፈጥረው ተለይታ ተያይዘውታል ትግርኝ ተሞክሮው ተዘፍቀው ትክክለኛነቱን ተራሮችና ተአማኒ ትራፎርድ ተከትላ ተለቅቀው ተገነባ ተሰማቸው ቱጃሮች ተፈርቶ ተቃቅፈው ታክሲዋን ተበላልጠው ተለቀቀ ተጣምሮ ተረከቡ ተካተዋል ታጥሮ ተከሷል ተከልክሏል ተበይኗል ተጻፈ ተሟልቶላቸው ተጫነ ተሰጥቶናል ተረግጧል ተጫውተው ተከፍሏል ተለመደው ተሳስተው ተደበደበ ተዋበች ታጋይና ተገምግመዋል ታይቶም ቴሌን ታግለን ተቀይረው ተቀመጠች ተሰነይን ትኩረቴን ተሰረዘ ታግለው ተወሰዱ ተከስተን ታዬና ተሰውረው ተመስርቶባቸዋል ታነሪ ተጣጥሞ ትምህርትቤት ተከባብረውና ተደባልቆ ተምሬያለሁ ትምህርቷን ትቼዋለሁ ተቃርኖ ተቀራርበውና ተጉዟል ተምትም ትቶት ተደርጎበታል ተለያየን ትርፉን ተሽከርካሪዎቹ ቴክኒሻን ቴሌኮም ተወስኖበታል ታረቀኝን ትጠብቃለች ተመቻችቷል ተደራጅተዋል ተጠልፎ ተመረተ ትሁት ታተመ ተከሰሰ ተፈቷል ተስፋፍተው ታንዛንያ ተላብሶ ተደማምሮ ቴክኒሽያኖች ተመርኩዘን ተበልቶ ታቦቱን ተቀጣጥሎ ትገባለች ትዕግስትና ትሪሊዮን ተገደን ተባበሩት ተበረከተላቸው ተከሣሽ ተቃዋሚዎቻቸውን ታዳሚውን ቴሌኮምኒኬሽን ቲሸርት ተዓማኒ ተነሣ ተወስኖባቸው ተሰጥቶባቸዋል ተንሰራፍተው ተክህኖ ተመረጠ ተራድዖ ተጠርጥረዋል ተገደዱ ታወራላችሁ ተነካ ትግራይንና ተክለወይኒ ተሸሽገው ተሰባስበን ተጓጉዘው ተለጥፎ ተጠናቅሮ ቱቦ ቱታ ቱት ተዋረድ ተረክቧል ተበትነዋል ተሰድደው ትካዜ ተሰምቶኛል ተከታትለናል ተረቅቆ ተልዕኮም ተገንዝቧል ትዕዛዞች ተብዬዎቹ ትዝብትን ተብዬዎች ተሳተፊዎች ተገድዶ ተጋጣሚውን ታግዷል ትውጣ ታወሮች ተፈሪያን ተከብረው ተፅፏል ተደጋግመው ተግባራዊነቱ ተሰሚነትና ተዘርዝሯል ተብለሃል ተዋልዶና ተጠናከረ ተጨዋቹ ተግባራችን ተቃዋሚን ተለቅቀዋል ተዋርደው ተሳስታችኋል ተጠቃሚውን ተሸልሟል ተተብትቦ ተናበው ተገትቶ ተቆጡ ተፈጥሮአዊና ታሳዝነኛለች ተለይቼ ቴድ ተቀጥረዋል ተባባሪዎቻቸው ቴሌቶኑ ተከሳሹም ተሸሽጎ ተማጽኖ ትንሽና ተክለኃይማኖት ተሿሚ ታዉቋል ተቀማሁ ተቀድሞ ተፈቅዷል ተሰርቀው ተወርውረው ተካሄዱ ትግራዮች ተቀርፀው ተቀበለው ታውቃለች ተፈታኞች ትጥቅና ተመክሮዎችን ተላልፈዋል ተጋዳላይና ታዳጊዋ ተፈቅዶለት ተቆጣጥረው ተመልከቱ ተጣሉ ተመልከት ተቀብሯል ተልዕኳቸው ተቃዋሚዎችንና ተጨናንቀው ትንግርተኛ ቶኪቻው ተሰናብቶ ትብብራቸው ተስማምታለች ተነክቷል ተረባርበው ተጠሪነት ተዘርዝሮ ተብራርቶ ቴክስት ታዳጊዎቹ ተባባሪያችን ተስፋም ትዕቢተኛ ተፈትኖ ተቆፍሮ ተብለዉ ቶኪዮ ተጠራጣሪ ትስስሩ ተቋራጮችን ተጠልፈው ተወጥቶ ተሸፋፍኖ ተሳትፎአቸውን ተጫውታለች ተለምዷል ተባብረዋል ተሰናባች ተቆጥቶ ተገዢነት ተሰርቆ ተወሮ ተግባራዊነቱን ተይዞላቸው ታሪካዊውን ተሳክቶ ትናንትናና ተቻችለውና ተሰማን ተቀበሉት ተጥሏል ተስፋማሪያም ትለኝ ተሞክሮዎችንና ቴሌቪዥኖች ተሳስቼ ተንቀሳቀሰ ተሸናፊው ትብስ ተቆጣጣሪነት ታቦተ ትብብርም ተጠርተዋል ትግበራውን ትሑት ተከሳሾቹም ትፈለጋላችሁ ትዴኢ ተቃውመናል ተላላኪ ተቀብለዋቸዋል ተከፍቶባቸው ተዉት ተባብረውና ታቅበው ተቀባዮች ተፈጥሮና ተጠየቀች ተፈጥሮን ቱሪስቶቹ ተወርሶ ትውስታ ተቆርቋሪነት ተሰላፊዎች ተጋጭቶ ተሰልፈን ተሰቅለው ተወያዮች ተቃውሞታል ትእዛዙን ትራጄዲ ተወዛገቡ ተገናዝቦ ተማምነን ተክሉን ቴዎድሮስም ተገንጣዮች ታርመው ተቀዋሚ ተገረመ ተበታተኑ ተለክቶ ትእምት ተካሂዶበታል ተካሂዶበት ታውቅ ተጋርተው ተፈናቅሎ ተግባራቸውም ተጥሎበት ተሰውረዋል ተወርሰው ተውሳክ ተወካዮቹን ተገድደናል ታስባላችሁ ታዝቤያለሁ ተሰቅሎ ታገቱ ተዘጋጀተዋል ታውቀው ተነቦ ተሞክሮ