            amharicWords[11, 8] = "ተሽከርካሪዎችና ተፈተው ተገምቶ ተገልጋዩን ትምህርትም ታጋቾቹ ተሰባስቦ ተክለው ተከሰዋል ተማርከው ተሸጋግሯል ተሠማሩ ተሰምተዋል ተያይዘን ተሟልተው ተነፍገው ተዛማች ታጋቾቹን ተሰንዝሯል ተደግፈው ትኩረታቸውን ተጠናክሯል ተኩሱ ተዋኅዶ ተንታኝ ተበድረው ታገኝ ትርታ ተገልፆ ተርሚናል ታደሰና ተፈፅሞ ተተርጉሞ ተነጋገሩ ተርፎም ትብብራቸውን ትመስላለች ትውልድም ተጨዋቾችን ታስቧል ተሰራጭቶ ተሞክሯል ትሆን ተሣትፎ ተጫውተዋል ተሳፍረው ተቀባ ተጀምረው ተመልክተዋል ተግባብተው ተጎራባች ታዛቢዎችና ታጋዮችና ተያይዞታል ተፈርዶባቸዋል ታማኞች ተጨዋቾቹ ተመልሼ ተሰናብተዋል ተመልካቹ ታጣለች ታላቅና ተሐድሶ ተበርክቶላቸዋል ተፈላጊነታቸው ተሰብስቧል ተዋፅኦ ተጠቃሚዎቹ ተደናግጠው ቲቦር ተሳትፎም ተባልን ተጠይቀዋል ታደሰን ታየኝ ተጠቃሚነቱን ታሰረ ተጠያቂዎቹ ተመርቋል ተቋቋሙ ተፈራርመው ቴዎድሮስን ተቀናሽ ተሳታፊዎችን ተማርከዋል ተሰብስበን ታጣቂዎችና ተከላካዮች ተክለብርሃን ትንሣኤ ትጥቁን ተወጥሮ ተደረገላቸው ትምህርቶችን ትውከት ተተክለው ተሰማኝ ተጭበርብሯል ተመሥርቶ ተሰልፈዋል ተመራማሪዎችን ተፈቅዶለታል ትልቁና ተከስሰው ተፈቅዶ ተከቦ ትራክ ቶታል ትብብርን ተማምነው ተሜ ተመልካቹን ትግልም ተደርጎባቸዋል ታቦቶች ተቋዳሽ ተቋማትንና ተከታዩ ተስማምተን ተክለማርያም ተመርቀዋል ተልከዋል ተገድደው ተደረሰ ተንጠልጥሎ ቱትሲዎች ተጠሪው ተፋጠው ተመኝተዋል ተከፋፍለው ተኽሌ ተጠቅመን ተስተውሎበታል ተመልክቻለሁ ትጋት ተጓዦችን ተሰራ ታፈረ ተዓማኒነት ተቆርቋሪዎች ተጠሪነታቸው ተከስተዋል ታያቸው ተክለማሪያም ተነሳሁ ትኩር ተቀብለውታል ተጠግተው ታክስን ተሞክሮዎቻቸውን ተደራሽ ተፈቅዶላቸዋል ተደራጀተው ተደርጎበት ተፈቅዶላቸው ተዛማጅነት ትርዒቱ ተነጥለው ተመልካቾቻችን ተራማጅ ተገድደዋል ቴክኖሎጅዎችን ትግሉም ተለወጠ ተሞክሮዎችና ተስቦ ተመራማሪዎቹ ተፅዕኖና ትደግፋለች ትልም ተስፋቸው ተጠቅሰዋል ተስኖታል ተገንጥሎ ትኩረቱን ተስፋችን ትሰቀል ታይላንድ ተናኜ ተባርረዋል ተሰናብተው ተደረጉ ቴክኒሺያኖች ተቆፍረው ተወስኖባቸዋል ተተከሉ ቴይለር ተፈተዋል ተሰደዱ ትግበራን ተከፋይ ተቆጥቦ ተቆጥበው ተከላና ተስፋና ተወያየ ታካሚዎች ተሰርተዋል ትርጉምና ተስፋዬና ተዘረፈ ተወቃሽ ተቆጣጥሯል ተገደለ ተደመጠ ተነቅሎ ተከልክሎ ተረጋግጦአል ተፈታ ተላቅቀው ታምራትን ተማፀኑ ቲማቲም ተብለናል ተረባርቦ ታዲዎስ ተውጣጥተው ቴርጋት ተከሳሾቹን ታዛቢዎችም ትርፉ ተጨባጭነት ተሠማርተዋል ተከሳሾችም ተነጥቆ ታታሪ ተፈርሟል ተስማማ ተማሪወች ተዛምቶ ታሪኮች ትብብሮች ትታ ተማፅኗል ተግባብቶ ተቸግረዋል ቴክኖሎጂውን ተህዋስያን ተነጥቀው ተወላጆቹ ተሰራጭቷል ተረድቻለሁ ተዘርፈው ተፈትሾ ተጫራች ተደበደቡ ተማሪና ተቻችለው ተጠያቂነትና ተቆጥተው ታሳሪ ትግሪኛ ተሟጦ ተቀርጾ ተከፋፍሏል ተሰጡ ቱኒዚያ ታዛዥ ቴክኖሎጅን ተሻሽሏል ቱ ተቀዳጅቷል ተጠቃሚነታቸው ተጠቃሚዎችን ታይቶባቸዋል ተገንጣይ ተቀበለ ተከሰሱ ተሠርቶ ተቀላቅሎ ተግቶ ተጫውቶ ታገለ ተሻገር ተስኖት ትስስርና ተክሎች ተሰጥተዋል ተስተካካይ ታምር ተቀጠረ ተቀምጣ ተሰራጭተው ተደራሽነትን ተስፋማርያም ተወላጆችም ተመርኩዘው ተቀጥራ ተቋሙን ተተክተዋል ተወርውሮ ተሸለመ ተሞክሮና ተላከ ተኽላይ ተደጋግፎ ታዞ ተመራቂዎቹ ተገኔ ተካፍለዋል ተከማችተው ታዘው ተናጋሪው ተቀላቅለዋል ተርፋ ተደርጎለት ታያለህ ተጋጭተው ተቃጥሏል ትልቅነት ተጣለ ታመነ ተባባሪነት ተጣሰ ትባላለች ተራራን ተቀጣ ትመና ተደነቀ ተካተው ተሰየመ ታደርግ ተማምኖ ተገምግመው ተጠርጣሪዎቹን ተሠራ ተሰማው ተነግሮናል ትዝታችን ታክሎበት ታይዋን ትያለሽ ተንፀባርቋል ቴክኖሎጂዎችንና ተለየ ትምክህተኛ ተለያይቶ ተግባረዊ ተፎካካሪዎች ተግባራቱን ተመስርቷል ተቀብላለች ተግበራዊ ቶንስ ተቃርቧል ተቀጠሩ ትራንስፖርትን ተሰንዝረዋል ተቋምን ተደርሶበት ታሪካዊው ተከፋፍለን ትጥቃቸውን ተሳተፎ ተሸፍኗል ትፈልጋለህ ታዘዋል ተጋደልቲ ትርኢቱ ተረክበዋል ትክል ተጥሎባቸው ተቅማጥ ተጋብዘዋል ተማሪዎችንና ተበላሽቶ ተቀይሯል ተሰምቶም ተዳፍኖ ትርምስና ታሠሩ ትሰራለች ታጋዩ ተከራክሯል ትንሿ ተልባ ትናትና ተፈፅሞባቸዋል ተደብድበዋል ተጫዋቹ ቲኬት ተሰምቶት ተጠምደው ትምህርቲ ተኮላ ተደርሶበታል ታንዛኒያና ቴያትር ተነጋግረናል ተሰናባቹ ታግዞ ተጥሷል ተቀብለናል ተነጋግሯል ተቀሰቀሰ ት ትኖራለች ተዛውሮ ተሸኝተዋል ተወደደ ተችተውታል ተይዞለት ተለቅመው ተገናኝተዋል ተገድዷል ተዘርፈዋል ተመራጮችና ተመረጠች ተደርጎባቸው ተጣልተው ትሪቢዮን ተጥሎባቸዋል ትርጉሙን ተወካዮችም ቴክሳስ ተጠቀሚ ተጥሎበታል ተወላጅና ተደራጁ ተጠንቀቁ ትንሳኤ ተቀጥላ ተፈቀደላቸው ተገንጥለው ትረዳለች ተጋጣሚዎቻቸውን ተፈራረመች ተነሳሽነትና ተነሳሽነትን ተከናንቦ ትልማ ተደስቻለሁ ተንበርካኪ ተአማኒነትን ትኩረታችን ተቋራጩ ተፈልተው ተፈላጊው ተወጣጥተው ተቋማቱን ተዘርግተው ተቆጣጥረዋል ተጠምዶ ተቃዋሚው ትንኮሳዎች ተራራዎች ታግዘው ተሰራጨ ተለይቷል ተገንዝበዋል ተሣታፊዎች ታዳሚ ታመዋል ተወስነው ተንቀሳቅሷል ተገልጋይ ተባይን ተጨምሮበት ታዛቢነት ትረካ ተሳትፈውበታል ተፈትቶ ትጥቃቸው ታዋቂነት ተራራና ተረስቶ ተልእኮው ተመለስ ተወንጅለው ተፈትተው ትግሪኝ ተፈራርሟል ተወለዱ ተንተርሰው ተቀላቀለ ተሰጥቶበታል ተመላላሽ ተደርሶባቸው ተመርተው ተስፋዬን ተከፈለ ተከስተው ታሪካችንን ተመራማሪዎችና ተማጽነዋል ተፈርዶበታል ተዳዳሪዎችን ተልኳል ተከራይ ታዋቂና ተረጋግተው ተወንጫፊ ተመለስን ትውልዱ ታዋቂዋ ትሻለች ትዉልድ ተክትሎ ተበዳዮች ተመርምረው ተማም ቱሳ ተግባራቱ ተላልፎላቸዋል ተዋፅዖ ታንክና ተሰማርቷል ተቀናቃኛቸው ተንኮሉ ተርፈው ቲቢ ተነጋግረን ታስባለህ ተጠምቀ ትችትና ተፈራርሞ ተከተሉ ተሞክሮን ተፋጠዋል ተጫዋቾችና ተውጠው ታዩ ተጠንተው ትምክህተኝነት ተናጠል ተመልካቾችን ተገንጥላ ተዋንያን ተቃጥሎ ቴፕ ተራሮችን ትን ተቀባይነትና ተኛው ተሰርዟል ታይቶበታል ተክሎ ትንሹ ተዛምዶ ተቀጣሪዎች ታጥቦ ትላለህ ተከራካሪዎች ተቀጣጣይ ተተርጉመው ቴኒስ ተፋሰሶችን ተመላልሰው ትችል ታሳሪዎቹን ቲሞቲ ተጠርጣሪውን ተፈርቷል ታሪኳ ተዳረጉ ተፈጽሞባቸዋል ተሹሞ ተሸጦ ታሽገው ተጓዙ ታምናለች ተዘጉ ተወጥተው ተተክቶ ተልዕኮአቸውን ታይቶና ተከተላቸው ታዬው ተበዳይ ተገድሏል ተችሎአል ታጋዮቹ ታድያ ተጓዦቹ ተወልጄ ተገፍቶ ተባብራ ትዕቢት ትሁን ተቀበል ቴክኒሻኖች ተክለሚካኤል ተፈጥሮአል ተደማምረው ተውጣጥቶ ተቆጥሯል ተዳክሟል ተገኝቶበታል ተመለስኩ ታስበው ትተህ ተዘግቦ ተመካክረው ተወጥሯል ተሸነፈ ተከራክረው ተወልደን ተጠገነ ተመለከተና ተቀምጠን ተመላሾቹ ቱባ ትግሬን ተካፍሎ ተቸግሮ ተቃዋሚዎቹን ተጠቃሚና ተዋጉ ተለውጠዋል ታደስ ተጠራ ቱፋ ትሰብከዋለች ተጠቅማ ተጠግቶ ተወሰነበት ተካትቷል ተቀብዬ ተወገዱ ትጉህ ተጋግዘው ተሞልቶ ትኩረታቸው ተሸንፈዋል ተከተለ ተመለከተው ታዋቂነትን ተልዕኮዎች ተመራጮቹ ተናጋሪዎችን ተዘዋውረን ተወያይተናል ተልዕኮን ተዋናይነት ትተውት ተገዳ ተቀድማ ተውጦ ተበጀ ታንድ ተከሣሾች ተገፎ ተሸላሚዎቹ ትምክህተኞች ተመርቷል ተማሪዎቹም ተጎድተው ተከላከሉ";
            amharicWords[11, 9] = "ቱሉ ትተው ተግባሩን ትዝ ተረት ተመድበው ተማሪው ተመልካች ተመራማሪዎች ተፈጥሯል ተቆጣጣሪ ታይምስ ተለይተው ተደምጠዋል ተመርጠው ተናጋሪ ተግባሩ ተቀዳሚ ቶጋ ተሳታፊዎቹ ተወያይቶ ተከሳሹ ተሰጥቶት ተቃውሞአቸውን ተፈራረሙ ተደርገው ተሰባስበው ተስማምተዋል ተፈላጊ ተጠይቆ ተጋድሎ ተለይቶ ተሰጥቷቸዋል ተገንዝቦ ተመልሰዋል ተመራማሪ ተስማሚ ተወስደው ታትሞ ተፈፃሚ ተሰምቷል ተከብሮ ተሰብስቦ ተቀራርበው ተተኪ ተጠብቆ ተቀዳ ታሪፍ ተራራ ተሳትፎና ትቶ ተመራጭ ትራንስ ተክል ተከታይ ቱለማ ተመዝግበው ተከበረ ተከፈተ ተመለከተ ተጣርቶ ተዋናይ ታፍነው ተቋቁመው ተገንብተው ተጠናቅቆ ቴክኒክ ተቀራርቦ ተጉዘው ተቆርቋሪ ተሽከርካሪዎችን ተቀጥረው ተመርጠዋል ተግባሮች ተጠርጣሪ ተዕለት ተወስኖ ተጨዋቾች ተስማምተው ተረክበው ተገንዝበው ትራንዚት ተያዙ ተከራካሪ ተባብረው ተመሣሣይ ተያይዘው ቴክኖሎጂዎች ተጠርጣሪዎቹ ታዛቢዎችን ተማሪዎችም ተሞክሮዎች ትራፊክ ትውልደ ታዋቂው ተንቀሳቃሽ ተመን ተሳትፈዋል ተጓዳኝ ተላላፊ ተፅእኖ ታረቀኝ ተገዢ ተወስዶ ተከፍሎ ተጠቃሽ ተከሰው ታች ቶኒ ተመልክቶ ተፈናቅለው ታምሩ ታራሚዎች ተዘጋጀ ቴሌፎን ተራድኦ ተቃውሟቸውን ተስማሙ ተጫዋች ተልዕኮውን ተዘዋውረው ተቋማዊ ተነገረ ተነሱ ተዋልዶ ተመትቶ ታሰሩ ተፎካካሪ ተከታትሎ ተገድለዋል ተመላሽ ትግርኛ ተይዟል ታስሮ ተማሪዎቹን ተጠርተው ተድላ ትንኮሳ ተረፈ ተሰልፈው ትዕግስት ቴክኒክና ተሰሚነት ተደርሷል ተያያዥነት ተጠያቂው ታሪክና ተቆጥበዋል ተቃውመዋል ትብብርና ተዘጋጅቷል ታንዛኒያ ተፈፅሟል ተከብሯል ተከስተ ትግልና ተሻሽሎ ተሳትፎን ተወያይተዋል ቲያትር ትናንሽ ተጭነው ተያዘ ተመርቆ ተግባራቸው ትንታኔ ተፋላሚ ታሪካዊና ተቃራኒ ተደራጅቶ ቴክኒካዊ ተስፋየ ተዛማጅ ተገናኝቶ ተጠቂ ታንኮች ተልከው ትክክለኛውን ተፈፀመ ተፈረመ ተሰበሰበ ተደጋግሞ ተፈጠረ ተከታትለው ተዳምሮ ትግራይን ተምሳሌት ታደለ ተባረሩ ትዝብት ታመው ትምህርቱን ተግባራቸውን ተብላ ታርሶ ተደምጧል ተከተል ተክሉ ተቀማጭ ትክክለኛነት ታቦት ተመልሷል ትርፋማ ተከላካይ ተናገረዋል ተጠቃሚነታቸውን ታንክ ተጉዞ ታፈሰ ትግሬ ተልእኮ ተሰጥቶታል ተወዳድረው ተቀማጭነታቸው ትኬት ተመለሰ ተቀባይ ተዳርገዋል ተፈላጊነት ተነሳ ትዝታ ተንኮል ትችላለች ተመልካቾች ተረጋግጦ ተዘጋጅተዋል ታዛቢዎቹ ተከታታይነት ታሳቢ ተሰብሳቢዎች ተችተዋል ተያያዥ ተወላጆችን ተሰልፎ ተዘዋውሮ ቴሌ ተገደዋል ተከስቷል ተቀብያለሁ ተመርቀው ተመረጡ ተገዥ ትላለች ታህሣስ ተገደሉ ታፍሰው ተከፍቶ ተቀብላ ተካ ቱን ተቋቋመ ተባረው ተደራራቢ ተወያዩ ተዘጋጁ ተጠናቅቀው ትምህርቶች ተጓዦች ተመድቦ ትሬዲንግ ተመዝግቦ ተከናውኗል ትርምስ ተቆጥሮ ተጠናቅቋል ተሳትፏቸውን ተፈፃሚነት ተዘጋጅተው ተመረቀ ተጠርቶ ተነስቷል ታጥቀው ተግባርና ተሰማርተዋል ተይዘዋል ተሃድሶ ተቀናጅቶ ታግደው ተወስደዋል ተቃዋሚዎቹ ተጠልለው ትርኢት ተካልኝ ተካፋዮች ተቀብለዋል ተመልክተናል ትችላላችሁ ተናጋሪዎች ተኝተው ተሳትፎውን ተወያይተው ተወካዮችን ትክክለኛና ትግላችን ታማኝነት ተጋላጭ ተመዝግቧል ተገቢና ተመሳሳይነት ታሪኩን ታሪካቸው ተክላይ ተቀማጭነቱ ታኅሳስ ታቅፈው ታሪክን ትምርህት ታቅዷል ተብራርቷል ትልቁን ታውቆ ትግላቸውን ትልልቅ ተቀናቃኝ ተቃውሞና ተጨዋች ተናግራለች ተልዕኮው ተወላጆችና ቴሌቭዥን ተሰርቶ ተነስተዋል ተፈጽሟል ትላንትና ተረጋገጠ ተገን ተወዳጅ ተባይ ተወስቷል ተገዝተው ተቃወሙ ተጠሪዎች ታግዶ ተአምር ተረድቶ ተበትኗል ትዕዛዙን ትግልን ተሰብሳቢዎቹ ተዘዋዋሪ ተሰጣቸው ተልኮ ታጅበው ተለጣፊ ተመዝግበዋል ተሰግቷል ተመስርቶባቸው ተቋራጮች ተላልፏል ተፈጥሯዊ ቴክኒካል ትርጓሜ ትፈልጋለች ቶሎሳ ተፈጻሚ ተጠቃሚነትን ተሸንፎ ተሸለሙ ትናንትና ተገኝ ተገዷል ተገደው ቴሌኮሚኒኬሽን ተገኙ ተላልፎ ተንከባካቢ ተፈናቃይ ተነጋግሮ ተቀጡ ተወዳዳሪዎችን ተደንግጓል ትከሻ ተመታ ተቀምጧል ተቀመጡ ቴክኖሎጂን ተመራቂዎች ተደማጭነት ተፈናቃዮቹ ተጠናቀቁ ተባረዋል ተስፋፍቶ ትተን ታሳሪዎቹ ተስተውሏል ተቃውመውታል ተከሳሾችን ታክሲዎች ተዘጋ ትክክለኛው ተአቅቦ ተናግሮ ተጠርጣሪዎችን ተለውጦ ተቀባይነትን ተቃወመ ታዳሽ ተዳዳሪዎች ተቀይሮ ተለያይተዋል ተፈቱ ተረካቢ ተቋራጭ ተመራቂ ተደርጎላቸው ተቀን ተሻግረው ተጋባዥ ትሆናለች ተጋዳላይ ትንተና ተመረቁ ተካሄዷል ተረጂዎች ትኩረትና ተገልጾ ታክሲ ተለቀዋል ተጠያቂዎች ተክለሃይማኖት ተለቀቁ ተወዳድሮ ተቃዉሞ ተጠርጣሪው ተላቀው ተወያይቷል ተግባርም ተባብሶ ተወዳዳሪነት ታትመው ተነጋግረዋል ትዕዛዙ ተፈራርመዋል ተጠቅሶ ትላላችሁ ቴሌቶን ተነጋግረው ተብለዋል ተለቀው ተንቀሳቅሰዋል ተጭኖ ተዋሕዶ ተቋማትም ተችቷል ተራሮች ተሸክሞ ተርፎ ተሳታፊና ቴክኖሎጅ ተሹመዋል ተቀብለን ታምኖበታል ትግራይና ተገድለው ተዘግቶ ታክሲያችን ተወስዷል ተቀላቅለው ተከልክለው ተስማምቶ ታውቃለህ ተላለፈ ትንበያ ትሪፖሊ ተዋናዮች ተመዘገቡ ትምህርቱ ትኩሳት ታጉረው ተገደናል ተኛ ተንተርሶ ታሳሪዎች ተቆጣጥሮ ተዘግተው ተወልደው ተቀጥሮ ተሾሙ ቶላ ተዘራ ታጅቦ ተጥሎ ትዕይንት ተግባራትም ተከናውነዋል ተማፅኖ ታፍኖ ተማፅነዋል ተጫዋቾችን ታየ ተፈጻሚነት ተገኑ ተወግዶ ተቋቁሟል ተኩላው ታጣቂዎችን ተነድፎ ታዬን ተወካዮቹ ተከፍቷል ተዘርፎ ተከሰተ ተግባርን ተዘጋጅተናል ታገዱ ተሻግሮ ተገናኝተን ተሸፈነ ተግባራትና ተጠብቀው ተሰማርቶ ተፈጥሮአዊ ታጣቂዎቹ ተስፋው ትግበራው ትዕይንተ ተገልጋዮች ተግዳሮቶች ተጠይቋል ተቀበሉ ተአማኒነት ተግተው ተጠቃሚው ተቆጥቧል ተደብድበው ታግሎ ታግደዋል ተምረው ተመደበ ታጠቅ ተግዳሮት ትርኢትና ተቋርጧል ተው ታገደ ተፈረደባቸው ተመልሰን ተዋጽኦ ተቃውሞው ታገኛለች ተሳፋሪዎች ታዘዘ ተሸክመው ተቀምጠዋል ቶማስ ተመርኩዞ ተቃውመው ትግላችንን ተወክለው ተመቶ ተጠየቁ ተሳትፈው ታደርጋለች ተቀመጠ ተክለወልድ ተጎጂ ተሟጋቾች ተነጥሎ ተፈናቃዮችን ተከማችቶ ተፈጸመ ተደራሽነት ተሸልመዋል ተቃውሟል ተሠማርተው ተቻለ ተጠሪነቱ ታዳጊዎች ተግባሮችን ተሰደው ተዘርግቶ ትዳር ተጠያቂነትን ተልዕኳቸውን ተከራይተው ተናገረ ትስስርን ተሰብሳቢ ታርጋ ተቋምና ተረድተው ተከፍተው ተፃራሪ ተጠንቶ ታክሲዋ ታምኖበት ተመርምሮ ተገዶ ትችቶች ተረክቦ ትውልድን ተገዝቶ ተስፋይ ተገንብቶ ተደብቆ ተስተውለዋል ተፈርዶባቸው ተንቀሳቅሶ ተክተው ተሰምቶ ተነስተን ተበታትኖ ተጋልጠዋል ተገምግሞ ተወካይና ተመሰረተ ተጋላጭነት ትዕግሥት ቱሪዝምና ተክቶ ተጠቂዎች ተከናወኑ ተለይተዋል ተረኛ ተጽፎ ተለዋዋጭ ተነግሯቸዋል ተከዜ ተቻችሎ ተጠይቀውም ተገልጦአል ተመላሾች ተለያይተው ተሰብሮ ተፋሰሶች ትቀጥላለች ተመድቧል ተቆጣጣሪዎች ተመትተው ተሰማሩ ተወግደው ተባርረው ተሻጋሪ ታንኮችን ቱሪስቶችን ተከናውኖ ተሰብሳቢው ተሟልቶ ተመልክተው ታግተው ታክሶች ታሪካቸውን ቴክኖሎጂና ተመድበዋል ተፈረደበት ቲቪ ተጋልጠው ተጋለጠ ትሰጣለች ተስፋሁን ትርጉሙ ተወዳጅነት ተደርሶ ተፈጽሞ ተፈላጊውን ተጫራቾች ተቀብሏል ተማሪውን ታክቲክ ታቦር ተከላው ትንቅንቅ ትኩስ ተወልዶ ተንቀሳቅሰው ትንፋሽ ትችላለህ ተብዬ ትራንስፖርትና ትንንሽ ቱም ተገናኙ ተመርጦ ተዋጊዎችን";
            
            amharicWords[12, 0] = "ቴሬዛ ተነስተንም ተስማሙና ተፈጻሚነቱን ተቀባብለውታል ቴሌኮምም ታፍነዉ ቲምበር ተመተዋል ቱፍቱፍታውን ታደርጊያለሽ ተገፍተዋል ተወዳድሯል ተንከባላይ ተቃውሞውንም ትሆኑ ተጉዙ ተሸማቅቀው ተነድፏል ተገነዘበ ተንጫጫ ተነስቶላቸው ተጋሩን ታመን ቴክኒኩ ተንጠላጥለው ተመርቀህ ተጨፍልቋል ተሰብሰቡና ተጋገረ ተንገላታ ተጠቀመበት ተክብራ ተጫኑ ተመርራማሪዎች ታትማ ተተከሎ ተካክለዋልና ተማራችሁ ተሰጥቶዋቸው ተዛዝኖ ተቺዎችን ተሠልፈን ተከተሉኝ ተከመረ ተጠቂዎቹ ተፍቆ ተመልክቼዋለሁ ተነድቶ ተጠርናፊዎችን ተጠይፈው ተዋደውና ተላልፈን ተንቀሳቀሱና ተቺዎቹ ተዋቅሮና ተቀስፎ ተከስቶልናል ተጠንቅቀህ ተመርጠዉ ተባባሪም ተጋርጦ ታዘቡኝ ተያያዞ ተባይና ተዘፍኖለት ተመልካቾቻቸውን ተገልለናል ተነሥቶአል ተሳትፈናል ተቀቡ ተቋሞቻችንና ተጉዘናል ተሠምተዋል ተማምኖና ተያይዞው ተሰማርቼ ተፎካካሪዎቻችን ተሸመ ተረዱልኝ ተሞርክዞ ተጫራቾቹ ተሹለክልከው ተለቅቃ ተምሳሌትነቱ ታዳኙ ተከትለዉ ተለጉሞ ተስማምቶበታል ታዳኝ ተገቢነትና ታጅበዉ ተረቶችን ተምራችሁ ትምህርቴ ተጠቋሚዎች ተከፋች ተጋድሏቸዉ ተሸወደ ተጣጥፈው ተናንቆታል ተገርሞና ተገልጋዩና ትምህርቷ ተደራድረን ተማፅነን ተደጋገመ ተሟሉ ታቆማለች ተስፋጋብር ተከስቻለሁ ተብያለሁና ተሟላ ተፈቃቅደው ተነድተው ተመላልሰውበታል ተንቀን ተስፋህ ተብሉዋል ታከም ተሠርቶበታል ተዘሎ ተጠራጠርክ ተነጋግረውበታል ተገድሎብኛል ተቀባይነቱና ተሐራሚ ታሰበኝና ተጠፍጥፈው ተንሰራፋ ተባረናል ተጠያቂዎችም ተደፋፍረዋል ተስገብግበን ታግዶባቸው ተሳለቀ ተገኝታችሁ ተዘንግተዋል ታውቃቸዋለኽ ተረትተረት ተዋዋቂ ተዐምራት ትሆንና ተቀጠረች ተሳለቆ ተደርድሮ ቴዎፍሎስም ቴአትርና ተገርመናል ተኮሱ ትመኛለህ ተሰሚ ተቀምጠውና ታዝቤዋለሁ ተፋረድ ተብዬውም ተደፍቶበት ተፅኖዎች ታገኛቸዋለህ ተለያይተንና ተመነደገ ተሸክመናቸው ተረካቢውን ቴርዬ ተረቅቋል ተሰውራ ተሰግስጎ ተቀማጭን ተጋድለው ታደሠች ተጋሪዎች ተቃውሟቸው ተሳታፊዎቹን ተቋማቷ ተፍጽሟል ተወሰኑ ተሳታፊዎችንም ተፋላሚነት ተገድጄያለሁ ተዘርሯል ተጋግሞ ተማሪዉም ተነግሮኝ ተመንጥረው ተጣብቃ ቴለቭዥን ተቀላቅለውታል ተፍሲርና ታጅሎ ተመልሶም ተንሰራርቶ ተርፈውም ተማሪዎ ተስፈንጥረን ተቃዋማቸውን ተዘግቶአል ተነሳሽነቱም ተተኪነት ተናደደባቸው ታምሜያለሁ ታዛም ተገናኝታለች ተቀባይነታችን ተዘጋጅተውላቸው ተከፍላለች ተበጅቶለታል ተሳተፍዎ ተቋማቱንም ተንኮሎች ቲቪሽ ተነጋጋሪ ታስመርቃለች ተወለደች ተሰውሮአል ታሳሪዎችም ትመራለህ ተሳትፎበት ታስተውላላችሁን ተአምራዊነት ተቆጥሮብናል ተከፋዩ ተሰኔ ታከው";
            amharicWords[12, 1] = "ተፈተለከ ተዋጊው ታማኙ ተባብሎ ተኽላይን ተጋብተናል ተፈተለኩ ተከሉ ተብሎላቸዋል ተዳዳሪዎችና ታጠቂ ተከናንበው ተቋሜን ተዘጋጅቼ ተገጣጥመው ተጠራንና ተነሥተን ተከብቤ ተቀይሷል ተገጭተው ተቀናብረው ተለጣፊዎች ተግበራትን ተካሯል ተበላሽተው ተስፋፅዮን ተጠርጣሪዎችንም ቴሌኮምኑኬሽን ትጉሐን ተብየዎች ቱለማን ተፈፀመብኝ ተመልክቶት ተጫማሪ ተለት ተነሳሽ ተጀመሯል ተተኮሰ ታንዛንያና ተተኪያቸው ታሽቶ ተረድታችሁ ተፋላሚዎቹ ተብዬዋች ተልእኮአቸውን ተነሳሺነት ተከራክረናል ተዘርረው ታሪክንም ተጠቁሞአል ተገዢው ተገትቷል ተገዥነታቸውን ትገነዘባለች ተልእኮአቸው ትጥቆችና ተስማምቶበት ትዕግስታችን ታመጣዋለች ተቀዳጅቻለሁ ተጣልተን ተቀባብሎ ትላንትናና ተነክሰው ተዋወቁ ታዝቦ ቱኒዝ ተከላውን ታምሩና ትኩዕ ተደማጭነታቸውን ተግባረ ተማሪነት ተቀላቅለ ተግባራ ተግባሬ ተጠቃሚውም ተጓዳኞች ተዘዋውሯል ተፋቅረን ተነሣስቶ ተመችቶናል ተስፋስላሴ ታይፔ ታካሂዳለች ቶክን ተጣልን ተርሚናሉን ትንታኔያቸውን ተቀበሩ ተፈርተው ተግተን ታስብ ትደግፈዋለች ተርፌሳ ተመላሾችንና ተጥለቅልቃ ተናገሪ ታይለር ትርጓሜም ተቀምጠውበት ተያያዘችው ተሸንፈን ተጠርጥሯል ተጠቃሚም ተዋጊነት ተራፊውን ትራስፖርት ተደልለው ተወርውረዋል ታምሊን ተጠቅሶአል ትቀልዳለህ ቴሌኮሙዩኒኬሽን ተስበው ተሽመድምዷል ተርከዋል ተጨዋቾቻችን ተነጥለን ተጋብቶ ተገረሙ ተቃራኒው ትህትናንና ተደፈሩ ተበታተነ ትጉሃን ተቀላቀሉን ተሰባስበውና ታስቦላቸው ታዳሚዎችም ተረድተውታል ተግባቡ ታርቆ ተቀባይነቷ ተጠይቂ ታጅቧል ቴምብል ተመርቄ ተከሰቱ ተዛባ ተመልሰህ ተከዳ ተዘርዝረዋል ተቃዋሚዎችንም ተቻኮሉ ተጠጋጉለት ተነስታለች ተጨነቀ ተሠይሞ ትምሕርትን ተፈርዶባቸዉ ተሻገረ ትቸገራለች ተወረረች ተፈጥሮባቸው ተመልክቶና ተሳትፎአችን ታውሮ ተመካከሩ ተቀዳጀሁ ተሰላችተዋል ተናፍሷል ትግሬዎችና ተናገሯል ተተኪዎትን ትወርዳለች ተከታትዬ ተጠርጣሪዎችንና ተለማማጅ ቱርክና ተረጋግጦላቸዋል ተጫዋቹም ተሳቦ ተክለሰውነት ቱርክን ታውቂ ትዕይንቱን ተለምዷዊ ታፔላዎች ተከብረሽ ትዕግስትን ተባባሪዎቹን ትግሬዎችን ተነጫነጨ ተፈቀዷል ተቀናቃኞቹ ታዛዥነታቸውን ተጋዳይነት ተከታዮቿም ተንጨረጨረ ተገልብጦአል ታሥራ ተብይ ተጠያዬቁ ተኩሳ ታርዘናል ተካፈል ታገስ ተደምጦ ተሰብረዋል ትስተዋለህ ተለኩሶ ተደርድረዋል ተራድአ ተፈጁ ተወዳጆች ታናናሾች ተምዘግዝጎ ተያዥም ተጨዋቾችም ተጣልተናልና ተመርቼ ተዘናግተው ተነቃቅተው ተቀብለውን ተጠንቷል ተነሥ ተመዝጋቢዎቹ ተፈጡ ተበድራ ተረትን ተጠቀመና ተቆርቋሪነቱን ቲያን ቱሞሮ ተጨዋወትን";
            amharicWords[12, 2] = "ተጽዕኖውን ተዋጽዖ ተሰጠች ትልና ትውፊታዊ ተደንቀዋል ተወያየን ተመስርቶበት ትርምሱ ተችልውል ተገታ ትኩስና ቱሪስቶቹን ተቋራጮቸን ተዋንያኑ ተገፍትሮ ተከተቡ ተበረከተ ተቀበለና ታተመች ታዘን ተያዝኩ ተፈልጋ ተቆጪ ትልልቅና ተቃዋሚዎቹም ተገነ ታስተምራለች ትካላት ተፅዕኖው ተገርፌ ታድርግ ተመርቃለች ተገኝቶበት ትግርኙ ተቆርቋሪዎችና ትግራዋይ ተረከቡኝ ተፋስስ ተሰንጥቆ ተቀጥያ ተሳቅቄነው ትከፍታለች ተናገርኩኝ ተስማማን ትሄዳለች ተሸፍኖላቸው ተሌት ተነፍጓል ትዳሮች ተጠቅመንበታል ተንቆጥቁጠው ተውሰው ታሸገ ታሸጉ ተረባርበን ቴራዞ ታጋሽ ታዩኝ ተከራይታ ተከባሪ ተሸልሞ ተወካዮቻችን ተማሪውም ተፀፅተናል ተርጫ ተቋሞቻቸውን ተጋብተን ተኛች ትወጋኛለች ተሸመድምዶ ተቃጥላ ትራንስሚሽን ተጠያቂዎችን ተነጥቀን ተሟገቱ ተግሳፅ ተሟገት ተከራይቼ ትምህረት ተሰብሳቢዎችም ተኛን ተረዳው ታዝዣለሁ ትጠየቃለህ ተመልካቶች ታመመች ተጧጥፏል ተበቺሣ ተማሪያቸው ተገልፆዋል ታዲሱ ትውልዶችም ተጠቂዎቹን ቴለቪዥን ታዛዥና ታቦታቱ ተፈጸመብን ትኬቶችን ተረድቼያለሁ ተፈተሸ ተፈረጁ ትቻት ታነበዋለህ ተበቺሳ ተውጬ ታወቅ ትቀጣለህ ተደናገጥን ተዋንያኖች ትራንስፓረንችይ ተመሳሰይ ተናጠች ተመጋቢው ተመለከትን ተፈቀደልኝ ትያትርና ተጋባሁ ተመንና ተበርብሮ ተቋቁሞለት ተለጥፈው ተምሳሌትነትን ተረዳሁት ተባባሉ ተረፈች ትርሐስ ተሠጥቷቸዋል ተነጣጥለን ተጠናክረን ተስተጓጉለው ታሪካችንም ተዓዋታይነትን ተወስነን ትተውኝ ተገለጿል ተገድበው ተውኔቶችን ተርጓሚውን ትንቅንቅና ታዳጊን ተናግዋል ተድላም ተብሏልና ታዘብን ተጠቂዎችም ተያይዘነዋል ተንከራትቼ ተቃዉሞዎችን ትይዛለች ተራገፉ ታንግ ተወላጆችንም ትግርኛን ተከታተል ታመጣላችሁ ተረፈን ተገፊ ተራመድ ትታወቅ ተሥፋ ተናዝዞ ቴሊቪዥን ትከሳሾች ቶሬ ተአቅቦና ተመስርተን ተሸርሽሯል ተደርጌያለሁ ተብለህ ታፍነን ተሣትፎአቸና ተገፋን ተባባሪያቸው ተጠርጣሪነት ተቀጣሪዎችን ተልከስካሽ ተመላለሱ ታመመ ታይፒስት ታስረውብኛል ተረተሩን ተሰውሯል ትጨነቅ ተገልፆአል ተበዳሪዎችን ታንጾ ተለሳልሶ ተጨምሮባቸው ተናግሬአለሁ ተሞሉ ተወካዩም ተጠራና ትራንስፎርም ተረሽነዋል ቶት ተዬይዘው ተጨንቀን ተንጣሎ ተቀነባብረው ተጓትቶ ተደረጎ ትዕግስቱ ተነድሮ ተውልኝ ተወረናል ተንዛዛ ተይይዞ ትእዛዝም ትመጣለህ ተደፍረው ታይላንድና ተአምራት ትረዳላችሁ ታሪካዊነቱን ትርዒታቸውን ታጥቄ ተጎራብቶ ትመለሳላችሁ ትንሸ ተወከል ቶርቸር ተሰናባቹን ትሞክራለች ተሠላፊ ተቆጣጣሪና ትልክለት ተጠቅሳለች ተሠርተዋል ተናደደና ትዝብቱ ተጠራቅመው ተጫምተው ተቃውሞዋቸውን";
            amharicWords[12, 3] = "ተመዝግባለች ታዘናል ተገልለዋል ተለይተን ተመልካቹም ተገባራዊ ቴንዳይ ታጣቂዎቹም ቴሌና ቱዋት ተሰደደ ተቀርፏል ተቋጭቷል ተማራማሪዎች ተዘጋጅተን ተፈጥሮም ተጋጣሚያችን ተወካዩን ተቃርበዋል ቲማቲምና ታዋቂዎቹ ተማሪዬ ተማምና ተረሳ ተስካር ተፈቃቅሮ ተነግሮኛል ተዋጽኦን ታጅቤ ተተግብሮ ተመልክታ ተፎካካሪያቸው ተነጋገርን ታጋቾችን ተሞክሮቻቸውን ተስኖአቸው ትልቅም ተኛውን ተጋቢ ተቀምጣችሁ ተሰው ታለፈ ተኮላሽቷል ተጠልቶ ተቀዳጅታለች ተቆልሎ ተፋጧል ተመግበው ተነሥቷል ተሰጥቶአል ትገደዳለች ተላልፋችኋል ተደግሞ ቴሌግራፍ ትዝታው ተሸካሚዎች ተቀመጠና ተጨፍልቀው ትመጣ ተገናኝቷል ትትኢ ታራሚ ትንፋሹን ተወያይ ትንጳዬ ታክሶችን ተረክ ተኝቷል ተንጸባርቋል ታጋዩና ተወስቶ ተወለድ ተሰብሰቡ ተመስሎ ታማስላለች ተጋርቷል ተንጠላጥላ ትሪፓሊ ተቀርፎ ትመደባለች ተመራማሪውን ተባባሪና ታማኝነቱ ተጥለቅልቀው ቴሌቪዥኖቹ ተዘርቶ ተርፈዋል ተሰቅለዋል ተወርሷል ትልልቆቹ ተገለጠልኝ ተመሊ ተወጡት ትራንስፎርመር ትመክራለች ትርክት ተሰፋ ትልልቆች ተበዳዩ ተመመ ተወስና ተቀላቀል ተጠለፈ ተመታች ተጭና ታፍራና ተሽቀዳድሞ ተሰማዎት ተችሎ ተመሪ ተዳምረው ተመለስህ ታሳይ ተዘንግቷል ትጠበቅ ታንከሮች ተረድቼ ተጋንኖ ተላቅቆ ትምህርታቸውንና ተመልከቱት ትገባለህ ቲዩብ ተለጥፎበት ተረጨ ተሞክሮአቸውን ተበደልን ትምርቴን ትምክህቱን ተሿሚዎችና ታንዛኒያዊ ተኮልኩለው ተደልድለው ታፍኖና ተነሥታ ተፋፍገው ተመዝነው ተወጉ ተመቺ ታድኖ ተወጋ ትዕዛዝን ተቀበሉኝ ተዳርጎ ተጠሪነታቸውም ተማከረ ተሰባሪ ቱኒዝያን ተሰጥቷታል ተገጥሞ ተደሳች ተችቶ ተሩብ ተግባብተውና ተግባሮቻቸውን ተገልፀዋል ተብዬውን ተዋጊዎቹን ተወልደመድህን ትጠቀምበታለች ተልዕኮዋን ተጫወቱ ተጓቷል ተባባሪዎችን ተከታዮቻቸውን ታስረውበት ተሳታፊዎቹም ተጨናገፈ ተለጣፊም ተዘጋጀው ተያይዛለች ተክለውልድ ተዓምርአየሁ ተገጣጣሚ ተሳፋሪዎቹን ተቀብለዉ ተረጋጋ ታቅቦ ታክቲኮች ተሳክቶልኝ ቴክኖሎጂስ ትዕዛዙም ቲኬትና ተጠየቅ ተሰውቷል ቱሪስቶችንና ትረግጣታለች ተጫዋቾቻችንን ተዋጥቶ ተፈፀመብን ተቀራራቢነት ተቀምጠህ ተወካያቸውን ትመራለች ተነጣጥሎ ተንሸራቶ ተመለከቱት ተናድጄ ተቃራኒና ትደግፋለህ ተረከበች ተከለ ትዛዝ ተሳካላቸው ተመድም ተከብቦ ተወዳዳሪነትን ተበደለ ተቃናቃኞች ተሰላፊዎቹ ተከፍተዋል ቱርኪ ተስፈንጥሮ ተቆራርጠው ታጠበ ተጠርቼ ተጫዋቾችም ተሠረዘ ተሳትፋችኋል ተከሳ ተጋልጦአል ተፎካካሪና ትጥቃችንን ቴላቪቭ ታምናላችሁ ተዘርዝረው ታንዛንያን ትኖራላችሁ ተናገራቸው ተሻሻሎ";
            amharicWords[12, 4] = "ተዳፍረዋል ትሉታላችሁ ትራንስፖርቱን ተጠራጥሬ ተቋቋመው ተፈናቃዩ ተደስተው ተገዥነትን ትከሻቸው ተጠብቆላቸው ተመኑን ትኩርት ተጣራ ተሳሳትኩ ተደምስሰዋል ታጋይም ተጎድቶ ተበይኖባቸዋል ተቀጥተው ተስብስቦ ቱሉማ ተቋማቸው ተላብሰው ትሆናለህ ተመልማዮች ተወዛዋዥ ታዬውና ተዳብለው ተጨንቀው ተገብቶላቸው ተወቃሽነት ተነጋግረንበታል ትምህርተ ተራምዶ ተከለከልኩ ትቼው ተቋማቶቻችን ተጠግኗል ትሰጥ ታሕሣሥ ተሳታፊው ትኖር ተከትዬ ታይዋንና ተሳፍሮ ተከላም ትከተላለች ተቃውመን ትውስታዎች ትቀራለህ ተሸልመው ታግሶ ተቋቁመን ተክሌን ተተኳሾች ተአምራትን ተጋግሎ ተምረን ተቦርነ ተሠልፈው ተነግሮን ተቀባብለው ተሟልቷል ተቀባይነትም ትገልጽ ትኖራለህ ተቃውማ ተገርፈው ተደናግጦ ተሞክሮአል ተደፍረዋል ትሪቢውን ተማሪዋ ተገልፆልን ትራንስሚተር ተቃራኒውን ተወዳድረዋል ተርጓሚው ትችቱ ተፈፅሞባቸው ተደነቁ ተከዜን ተበይኖበታል ትንቢቱ ተቋሞችም ተጽኖ ታሪኬ ተናግረዋ ታፈኑ ተቆጣጣሪው ተንቤን ታንቱና ተፈልገው ታዬም ተቀርጿል ትንታኔዎች ተበልጠው ተሰበጣጥረው ተጠርጣሪዎችም ተቆራጭ ተቃውሞቸውን ታጭተው ተወስነዋል ተናደድኩ ታስገባ ታግዳ ተመልክቼ ተረቱ ተላልፎባቸው ተካትቶ ተከበሮ ተደመደመ ታራሚዎቹ ተብላችሁ ተመሥርተው ትታሰራላችሁ ተወስኖበት ትመለሳለች ተመልምሎ ቴክኖሎጂዎችና ትጠይቀናለች ተበራቱ ተወዳጅዋ ተርፋሳ ተስተጓጎለ ተንኮለኛው ተንዶ ተከታትያለሁ ተጠርቷል ተጠራርጎ ትንፋሻቸውን ተቃውሟችን ተስተጋቡ ታውቁታላችሁ ተጫዋቾቻቸውን ተሰልፋ ታስተዳድር ተንሳይ ተወረረ ተዘጋጅ ትዊተርን ተወን ትዕዛዞችን ተገደሉብኝ ተጭነን ተከበበ ታድሶ ተጫርተው ተረዱ ታይቶኝ ታአማኒነት ተፈሪና ታዛቢዎቻቸውን ተረጂው ቴክኖሎጂም ታ ተቀናቃኞቻቸው ትዝብቴን ትሪት ተጠቃሹ ቲያትርና ታጋይነት ትዕግሥትና ተጠምቀው ታሪኩንና ተወዶ ተገድለውብናል ተልኮውን ተመቱ ተጋፋ ተጋግዞ ተነካሁ ተረጋግተን ተነሥቼ ቴሌፎንና ተንበርካኪው ትሉኛላችሁ ተግባራችሁ ተጠቃሾቹ ታድመዋል ተመኑ ተንፈስ ተለይታለች ትላታለች ተናግረውታል ተመደቡ ተዋጊና ተምበርካኪ ታይብ ተገፈው ተከብራ ታይምስን ተደብድቧል ተወስዳ ተክልና ተኀዋስያንን ተኩላዎች ተወካዮን ታረቀኝና ተመልክተን ተቀንሷል ተማራማሪ ተዋሰኝ ተጓዝን ተትቶ ተሠራጭተው ትኩሳቱ ተመስክሯል ተለጣፊዎቹ ተወርሮ ተጨማሪውን ተለቅ ተሳክቷል ተለቆ ተጓዝኩ ተከል ትግሎችን ታዝሎ ትውልዱን ትቷል ትጠቀሳለች ተቀናቃኞቹን ተስፋዓለም ተጣምረው ተቀመጥን ተቃዋሚወች ቶልቻ ታስታውሳለች ትገንጠል ተወግዟል ተንፀባርቀዋል";
            amharicWords[12, 5] = "ተይዞላቸዋል ተጠቅቶ ተፈናቅሏል ተካትተዋል ተቀናጅተውና ተፈላጊና ተሸክመን ተገድዳለች ተገልጾላቸዋል ተስኖናል ተወዳዳሪነቱን ተሸፋፍነው ተጻራሪ ተሰምቶናል ተገንዝቤያለሁ ተባረክ ተበላ ቴር ትፈለጋለህ ተነግሮታል ተሸከርካሪ ተሸክሜ ተጠንቅቆ ተወዳዳሪው ተስማማች ተካረረ ትርኢቶች ታማሚዎች ትራንሶች ተከራክሮ ተገልጾአል ተገርፏል ተሳክቶላቸው ተጀምረዋል ታንቱ ተወግዷል ተነፍጎት ተምረዋል ታረቀ ተመልካችነት ትቀበል ተምች ታወሩ ታግተዋል ትክ ታጋዮችም ቶማሶች ተባርኮ ተከታተሉ ተወግደዋል ታክቲክና ታላላቆቹ ተሰራጩ ታፍነዋል ተሞላ ተርቧል ተክላ ተበላሸ ተውኩት ተጀመሩ ትንሹን ተንታኞችና ታስወጣ ተመልካችን ተማሪም ተሰወረ ተገኝቶባቸዋል ተወካይዋ ተነሺዎቹ ታራሚዎችን ተደባልቀው ተቃውሞዎችን ታምኗል ተቃዉሞዉን ተናጋሪውን ታሪኳን ተቺዎች ተነቧል ተመቻችቶ ተሿሚዎቹ ተጠቋሚ ትሠራ ተጠምደዋል ተናግረን ተሰደን ተጠርጣሪን ትርጉምም ተመድቦለት ተማሪን ትንሣዔ ቱሉን ተክለአብ ተመዝብሯል ትዕዛዝም ተበራክቷል ትመራ ተሳትፏል ተግባባን ተከልክለናል ተከበዋል ተከሳሿ ተይዞባት ተነገረኝ ተወካዩች ተደናግጣ ትርፍራፊ ተጣብቆ ተረድቶታል ተመላልሶ ትናንቱ ተመናምኖ ተፈትነው ተደረሰበት ተሰይመዋል ተፈፅሞብናል ተጋሩ ተማሪዋች ተንዳሆ ተሰባስበዋል ተያይዘዋል ተነስቻለሁ ተሸጡ ተባሮ ተከታዮችና ተሳስሮ ታሪካቸውንና ትተዋቸው ተናደው ተከላን ቶልታሌ ተሠማ ተቋማትንም ተዛወሩ ተነባቢ ተሸጧል ተንከራታች ታወጣለች ተገምቱዋል ተሳስቦ ቶሌራ ተፈራርመናል ትእዛዙ ተሞክሮውን ተዋዋይ ተገብቶ ተነፍጓቸው ተገዳለች ተመለስሁ ተረዳ ተወልደብርሃን ተቃዋሚነት ተረድታ ቶክቻው ተኮርና ተዘርግቷል ተ ተገልጋዮቹ ተመለሰች ተገልፆላቸዋል ተሿሚዎችን ተረስተው ተያየን ተተክቷል ተሰምቶታል ተጠቃሚነቱ ተፈናቀሉ ተተክለዋል ተጨባጭና ተጠይቆባቸው ትግራይም ትጀምራለች ትሪቢዩን ተዘጋጅታ ተመካክረን ተተኪዎችን ተብላለች ትከሳለች ትላንትም ትናንትናው ቲአትር ተገደድን ተዋውለው ታምሩን ተጋበዙ ተደፈረች ተቀበረ ቶርኔዶ ትራንስን ተጽፈው ተቀርጸው ታሪኬን ታስራለች ተማርረው ተበርክቷል ትክክለኛነትን ተሰጥቶባቸው ተነግሮአል ተነሳና ተኩሱን ተዓሚነት ተዓማኒና ትወዳለች ተኮምቢያ ተደራቢ ተደብቃ ታገሉ ተቀዳጅተዋል ትመስላለህ ተለያየ ተዋውሎ ትከሻዋ ቴሌቪዝን ትከሻው ተበድሎ ተመክተው ተከሣሹ ታሥሮ ተፈጥሮዬ ተናጋሪነት ተገልጋይን ታዛቢው ተለዋውጠዋል ተፋቅረው ተመሳሳይና ተሰዷል ተቀላቀለች ተደማጭነትና ተቃዉሞአቸዉን ተክለፃዲቅ ተረድተን ታምሜ ተከስሶ ታርዶ ታምረ ተልዕኮዎችን";
            amharicWords[12, 6] = "ትግላቸው ተራግፎ ተጋጣሚ ተደርጋ ቱዴይ ተፅኖ ተወዳዳሪዎችና ቴልአቪቭ ተሸኙ ትውልድና ተቆራርጦ ተከታትለዋል ትእይንት ትግበራና ተሰየሙ ተራራው ትጠይቃለች ተስፋን ተንታኞቹ ተመራማሪና ትእዛዛት ተዘረጋ ተወኝ ተቃጥለው ተማጽኗል ተወው ተያያዘው ተባባሪዎቹ ትችቶችን ተደምሮ ተቀብረው ተከራዮች ትታያለች ትታወቃለች ተጫዋቾቹን ታስሯል ተከፋፈሉ ተክሎችን ተሞክሯቸውን ትንታኔውን ትኩረትም ታስራ ታስሬ ተቆርሶ ተገልጾላቸው ተቀብለነዋል ተገልጾልናል ተደርጎላቸዋል ታሽጎ ተመድና ተቆጣጠረ ተቆጣጠሩ ታሽጓል ተከታታይና ተናግርዋል ተዋቅረው ትይዩ ተራውን ተስተካክሎ ተከልሎ ተሰይሟል ተጠቃሚዎችም ተንታኙ ታልፏል ተወዳዳሪዎቹን ተካቷል ተቀብሮ ተናግራ ተጧጡፏል ተተክተው ተምቤን ታዛቢዎቻችን ተፈትተዋል ተጽዕኖዎች ተርጓሚ ተገልጋዮችን ተካሂደው ተራዝሟል ተነጠቁ ተሽሮ ተቀራርባ ተሠማርቶ ተረጋግጠው ተደራጅተውና ትግሬው ተመካክሮ ተደራርበው ቴክኒዮሎጂ ተወካዮቻቸው ታንፀው ተብሎአል ተጠግኖ ተረቶች ተያይዞም ተሟጧል ተቃዋሚውን ተላኩ ተዋግተን ተገኝታ ትልካለች ተደርጎለታል ተጉዘን ተሰናድቶ ተፈልጎ ቴዲ ተሰናበቱ ተጋርቶ ተልዕኮና ተራራማና ተሽጧል ትንፍሽ ተዓቅቦ ተከላካዮችን ተደስተዋል ተደራድሮ ተናኘ ተከብሮላቸው ተሸጋሪ ቶክ ተቀየረ ታክለውበት ተወዳጅነትን ታማኝና ተራዝሞ ቶፕ ትታችሁ ተቸግረው ተመዘገበ ተድበስብሶ ተሰልቶ ተለያይቷል ቱርካና ታጉረዋል ተጣርተው ተብያለሁ ተከታዮቹ ትንበያና ትራኮማን ታዴዎስ ተሰለፉ ተቀይሶ ተከሳሾችና ተተክሎ ተደርሶባቸዋል ተጋሪ ታጋቾች ተረቆ ተብሎለታል ተጓዘ ታክሶችና ትርፍና ተሰልፏል ተቃዉሞዎች ተፈርጀው ተሞክረው ታቀርባለች ተከላክለው ትናገራለች ተንቀሳቀሱ ተነግሮለታል ተደራድረው ተረጂ ተባበሩ ትዕቢትና ተእለት ተሰብሳቢውን ትልቅና ተኩሰው ታንታለም ተጠቃሾች ተጠቃሚዎችና ተከታትለን ተወያይቶበታል ተከናውነው ተለቋል ታደርጋላችሁ ትዊተር ተባራሪ ትዕዛዛት ተሰጥቶአቸው ታላቋ ተፈፅመዋል ታቅፎ ተደፈረ ተመራጮችን ተንብየዋል ተመድን ተፈራና ተፈራን ተቋቁመዋል ትክክለኝነት ተገቢም ተደመሰሰ ተወደደም ትርዒቱን ተረትና ተራራውን ታላላቅና ትደግፋላችሁ ታውቀዋል ቴሌፎኑን ተቹ ተባለች ተደፍሮ ተናዷል ተኝተዋል ተለጣፊው ተወዳዳሪና ተበልጦ ትሪቡንን ተስፈንጣሪ ተጠሩ ቱጂ ተወሰነባቸው ተይዛ ተሰምሮበታል ትምህርቴን ተኳሽ ተሰብስበዋል ተዘርፏል ተጠሪና ተፈጥሯዊና ታኅሣስ ትግራዊያን ተጠጋ ትለዋለች ተመርጧል ተስፋውን ትንሽም ተሽጦ ተካቶ ታክሲው ተዳክመው ተማርኮ ትልቋ ተሰይመው ተፈጥረዋል";
            amharicWords[12, 7] = "ተሰደዋል ቴአትር ታዲዮስ ተፈናቅለዋል ተነስታ ተከባብሮ ቶም ተሳታፊነት ተራራማ ታከለ ታሕሣስ ተላልፈው ተቋረጠ ተመክሮ ተጠቃሎ ተቀጣሪ ተብሎም ትምሕርት ተቀንሶ ተከትሎም ተነሳስተው ተጋልጧል ተከልክለዋል ተዳዳሪ ተዉ ታናሽ ተቆርጦ ትምርት ተዳርጓል ተቃውሞን ተላቆ ታደለች ተበተነ ተዳዳሪነት ተከለከለ ተካፍለው ተጠቃለው ተደብቀው ተካሄዶ ተሳትፎው ትምህርታዊ ተብለን ቶፊቅ ታጋዮችን ተጓዥ ተዳርገው ተሹመው ተቃጥለዋል ተነግሮ ተቀጥሯል ተቋሞችን ተከፋፈለ ቱርክ ተከሶ ተዘግቷል ተደረገለት ተለዩ ተዘግተዋል ተንከባክቦ ትብብሩን ታውቃላችሁ ተቆጥረው ተከለከሉ ተምሮ ትግሎች ተደጋግፈው ተዋቅሮ ትንኝ ተክኤ ተሿሚዎች ተረድተናል ተበዳሪ ተሳታፊዎችም ታሥረው ተጠርጥሮ ተለውጧል ተፅፎ ተወሰደ ተቀላቀሉ ተውኔት ተፈቀደ ተጋብዘው ትሉኝ ትምኒት ተስኗቸው ቴሌቪዥንና ተንሰራፍቶ ታዟል ተጠንቀቅ ትምህርታቸው ተመሠረተ ቱጃር ታላቅነት ተቀስቅሶ ቴክኖሎጂው ተራዘመ ተስማምተናል ትራኮማ ታይተው ተገቢነት ትግሬዎች ተደራዳሪ ታዲያስ ትርዒትና ተሸንፏል ተመልሳ ተሰይሞ ተከፍለው ተናገር ትውውቅ ተጠቅመዋል ተወላጅነት ተኩሶ ተቀናቃኞች ተመርቶ ተከታዮቻቸው ተሸንፈው ተሣታፊ ተከፋፍሎ ተቆጥረዋል ተራው ትኩረትን ተገልጦ ተገልብጦ ተዛውረው ተተካ ተከራክረዋል ተሸፍኖ ታዘዙ ተዓምር ታጥቆ ተሸላሚዎች ተከትለን ተገልለው ትንቢት ታሪኽ ተከታዮችን ተስማምቷል ተቀርፆ ታንኮችና ተጥሶ ተነድፈው ተነሥቶ ቱሪስት ተቀብሎታል ተቋሞችና ተሸካሚ ተፋላሚዎች ተኩላ ተነግሯቸው ተሰርቷል ታደሠ ተገልጋይነት ተደብድቦ ተረጋግቶ ተወካዮቻቸውን ታሞ ተበዳሪዎች ተያዘው ተቃጠለ ተሸጋገረ ተጥለው ትቼ ተነስቼ ተሸጋግሮ ትሪቡን ቱሪዝምን ትምክህት ተኝቶ ተፈርዶበት ተወዳዳሪዎቹ ተሸናፊ ተቅማጥና ተፅዕኖዎች ተመልምለው ቶሮንቶ ትዕዛዝና ተባባሪዎች ተሰርዞ ትብብሩ ተከበው ታቸር ታክስና ተቃዋሚዎችና ተጉዘዋል ተካሂደዋል ተገድሎ ተበድሮ ተባዮችን ትናንትም ተበታትነው ተጨምሮ ተመተው ተቃዋሚዎችም ተላቃ ታቦ ተቀራራቢ ተፈርሞ ተሳትፏቸው ተጫዋቾቹ ተባብሷል ተሰርተው ተበትኖ ተከራይቶ ተዋግተው ትኩረቱ ተሰጠው ታዳሚዎች ተጎጂዎች ተቃውሞዎች ተዋግቶ ተሰጥኦ ተገልጋዩ ተከናወነ ተመስርተው ቶዮታ ተባሉ ተሳታፊነትና ታቦቱ ታውቆአል ተፋሰስን ተመራማሪው ተደግፎ ተገንዝበናል ታገሰ ትውልዶች ተባብረን ታላቁን ተነስ ተስፋቸውን ተሰነይ ቲም ተነሳስቶ ተጫውቷል ተገኝተን ትሩፋት ተረግጦ ትያትር ተጋልጦ ተዳክሞ ታሎው ተከባብረው ትል ታችኛው ተቀምተው ታሪካችን";
            amharicWords[12, 8] = "ተ ተናግረዋል ትምህርት ተብሎ ተገለፀ ተማሪዎች ታውቋል ተገለጸ ተግባራዊ ተግባር ትኩረት ተጠቃሚ ትናንት ተችሏል ተቋማት ተሳትፎ ተገልጿል ተግባራት ተቃዋሚ ተወካዮች ተጨማሪ ትግል ትዕዛዝ ተስፋ ተመሳሳይ ታሪክ ተቀባይነት ታህሳስ ትልቅ ተቃውሞ ትብብር ተብለው ተብሏል ታዛቢዎች ተገቢ ተወካይ ተሳታፊ ቶን ተከትሎ ተቋም ተቃዋሚዎች ትንሽ ተወላጆች ተመልክቷል ተጠናክሮ ተማሪዎችን ተስፋዬ ታደሰ ታላቅ ተከሳሾች ትውልድ ተግባራትን ታምራት ተጨባጭ ተደርጓል ትግራይ ተማሪ ተፅዕኖ ታሪካዊ ተልዕኮ ቴክኖሎጂ ታዬ ተጠይቀው ተማሪዎቹ ታጣቂዎች ትክክለኛ ተከታታይ ትላንት ተከሳሽ ትርጉም ተጀመረ ተወዳዳሪ ተገኝተው ተገቢውን ተያይዞ ተቀብሎ ተጠያቂ ተወላጅ ቴሌቪዥን ተሳታፊዎች ተጠቁሟል ትራንስፖርት ታክስ ተባለ ተፈራ ታወቀ ተኩስ ታዋቂ ቱሪዝም ተቋማትን ታዲያ ተሾመ ታስረው ተራ ትክክል ተነስቶ ትምህርታቸውን ተዋጊ ተደርጎ ትስስር ተይዘው ተጠቃሚነት ተደጋጋሚ ቴዎድሮስ ተጠየቀ ተጠናቀቀ ተሰማ ተሰማርተው ተገኘ ትርፍ ተሽከርካሪዎች ተመልሰው ተጠባባቂ ተሞክሮ ተጠሪ ተዘግቧል ተገለጠ ታስቦ ተደራጅተው ትግበራ ቶሎ ተጠናቆ ተፋሰስ ተገልጧል ታጋዮች ተጠቆመ ትግሉ ታህሣሥ ተፈጥሮ ተገናኝተው ተጀምሯል ተገኝተዋል ተጽዕኖ ተነስተው ተጠቃሚዎች ተካፋይ ተባባሪ ተወልደ ታኅሣሥ ተቀብለው ቱሪስቶች ታላላቅ ተገምቷል ተሰጠ ተይዞ ተደረገ ተቋሙ ተናግሯል ታማኝ ተከታዮች ተመስገን ተጠቅሷል ተመልሶ ተወዳዳሪዎች ትልቁ ተጠቅመው ታጋይ ትምህርትና ትግሉን ተኩል ተዘጋጅቶ ተሸላሚ ተከሳሾቹ ተቋማትና ተካሂዷል ተኮር ተረጋግጧል ተነግሯል ተጠናክረው ተቋቁሞ ተጠናቀው ተጫዋቾች ትእዛዝ ተዋህዶ ታዳጊ ተጠናቋል ተካሄደ ተቀምጠው ተለዋጭ ትጥቅ ተገኝቶ ተቋሞች ታይቶ ተቃዋሚዎችን ተማሪዎችና ተነሳሽነት ተወስኗል ተመድ ተቀናጅተው ታይም ትላልቅ ተቋማቱ ተንታኞች ተሰጥቷል ተናግረው ተከላ ተወካዩ ተክሌ ትችት ታቅዶ ተጠያቂነት ታሕሳስ ተጽእኖ ትሉ ተጠርጣሪዎች ተወካዮችና ተክለ ተናገሩ ተርታ ታይቷል ቴሌኮሙኒኬሽን ቴክኖሎጂዎችን ታሪኩ ተገኝቷል ተሰጥቷቸው ተሻለ ተፈሪ ተዋጊዎች ተሰጥቶ ተግባራዊነት ተጠርጥረው ተዘገበ ተሞክሮዎችን ተደርገዋል ትምህርትን ተመለሱ ተፈናቃዮች ተሰብስበው ተጠቅሞ ታይተዋል ታላቁ ተሟጋች ተከስቶ ተመራጮች ተጀምሮ ትርዒት ተቋርጦ ተካሂዶ ተለያዩ ተመስርቶ ተሽከርካሪ ታዛቢ ትራንስፎርሜሽን ተባብሮ ተከትለው ተቀምጦ ታጣቂ ተገቢው ትገኛለች ታስረዋል ተመጣጣኝ ተወሰነ ተቃውሞውን ተፈራረመ";
            amharicWords[12, 9] = "ቸ ችግር ችግሮች ችሎት ችግሩ ችግሮችን ችግሩን ችሏል ችግኞች ችሎቱ ችሎታ ቻይና ችለናል ችለዋል ችግርን ችግርና ቻርተር ችግኞችን ችላ ችግሮቹን ችግኝ ችግሮቻቸውን ችግሮችና ቸር ችግራቸውን ችሎ ቼክ ችለው ችሎቶች ቻሉ ችግሮቹ ችግርም ቸል ቸርነት ቻለ ችላለች ችግራችን ቻናል ችያለሁ ችግረኛ ችሎታቸው ችሎቱም ቻርጅ ችግራችንን ችሎቱን ቸኮል ችሎታቸውን ችሎታው ች ቸው ችግሮቻችን ችሎታና ቻይናውያን ችግረኞች ቻው ችግሮችንና ቸልተኝነት ቻርተሩ ችቦ ቻይናና ችግኞቹ ችግሮችም ቺፍ ችግሮቻቸው ችሎአል ችግራቸው ችሎታን ቻምበር ቸነፈር ችኩል ቼልሲ ቻሌንጅ ቺካጎ ቻድ ቻርተርን ችካል ችሮታ ችግኞቹን ችግሮቻችንን ችሎታውን ቻይናን ችሎትም ቻርልስ ቻንስለር ቸርችል ችጋር ቺርስ ቼኾቭ ቻይናዎች ቻርለስ ቻርድ ቸግር ችግሯ ችግረኞችን ችሎታችን ችግሯን ችሎታቸውና ችገሮች ችግሩም ችግሬን ችግኞችም ቼከር ችሎቶችን ችሎታዎን ቸሩ ቻንግ ቸገረኝ ችግሮችንም ችሎቶችና ቻልን ችርቻሮ ቸኮሌት ችልድረን ችሎታም ችሎትና ችሎታውና ቸኩለው ቸልተኝነትና ቸውን ችግሩንም ችግራችሁን ችለን ቼቢ ቹቹ ቻይናዊያን ቻርተርና ችሎታውም ቸገረን ችክ ቼስ ቼሆል ቺምንዚ ችኩልነት ቻርተሩን ቸብ ቻፕተር ችግሩና ቻይናም ቻርጁ ቾከር ችግሮቿ ቹ ቻርተርም ቻናሎችን ቾምስኪ ቼን ችና ቺሳኖ ቻነል ቻይናዎቹ ቼርኖር ቼልሲን ችኮላ ቻይናዊት ቻለች ችግኙን ቸርነትን ቼኮዝሎቫኪያ ቸርቻሪ ቻዎ ቻይባን ቸኩሎ ቼዝ ቼኮሌት ቸኮልና ቻይ ቼኮች ቼኩን ቻይናዊው ቻት ችዬ ቻቻ ቸ ቼ ቻይናውያኑ ቸኩለን ቸርቻሪዎች ቺፔታ ቻን ቺልድረን ችግረኞቹ ቻልኩ ቻግኒ ችሊማተ ቻድና ችሎች ቻርተርንና ቻይናውያንና ቻይናዊ ቸነፈሩ ችግኙ ችሎታህ ቸልተኛነት ቺሞምቦን ችግርህ ቸርች ቾኡርት ቸርቻሪዎችን ቺቺንያ ቸርፈፍ ቻርት ቸኩዬ ቸርነቱ ቾይስ ችግርች ችሎታዋ ቺሞምቦ ችሉቱ ቺሞስኪ ቻቺ ችግርስ ቸልተኝነትን ቻርተርነት ችካጎ ችግሬ ቻላችሁ ቼኮችን ቸልተኛ ችሁ ቺጌ ቻል ቾምቤ ቸንክረው ችሎታችንን ችግርሽ ቸርነትና ቺክ ቸዋል ቻካ ችሎቷ ቸግሮኝ ቻክ ቼኮዝላቫኪያ ቸኮልኩ ቻይነት ችኮ ቻሉኝ ችሎታህን ቻርተሮች ቼክና ችግራችንም ችሮታዎች ቻይናው ቺፕሶች ችግርንም ቸነከሩት ቻውቼስኮ ችፍ ችግሮቹንና ችሎታዋን ቺኮች ችሎታዬ ቸኩሏል ቻይናዎቹም ችሎታንና ችኩልነትና ቺፕስ ችሎታቸዉ ቻይናውያንን ችሮታቸውን ቻምፒየንስ ቸኮለ ቾሰር ችለነው ቻርተሮችን ቾምስኪን ችግራችሁ ቼንጅ ቻይኖች ችግቿ ቻማ ችምችም ቺቻሪቶ ችሎታዬን ቻርጁን ቸኩያለሁ ቻፕተሮች";
            
            amharicWords[13, 0] = "ባመለክት በገላጋይነት በካፒታሊስት በወንዱ ባከል በማረፋቸው በስምህስ ባለማለት በኬንያውያን በህልማቸው በሚባሉትና በሶቭየት ባቢ በሱፈቃድ በትውልድም በሠልፍ በኩታ በኢህአዴግም በተማሩ በቤታቸውና ቢያውጅም በአወንታዊ ቤተሰባቸውም በኢጣልያው በተሰኝ በሔዱ ባቱ በግብርም በነፍስወከፍ በአስተባባሪነቴ በሳሪስ በራስዋ በእርሱም ባደረጉልን ቤቱከ በማቀናበርና በሙሉአለም በተመደበበት በተቸገርንበት በአፍአበት በተናገረ በመነገሩ በሲዳማዎች በጣለ በሚጫወተው በመረጧቸው ቢከሱም በተመረጡና በኤዲቶሪያል በአጓጉል ቢያጡ በማዘንና በማወዛወዝ በገሌ በአስተማማኝነት በማንቀሳቀስና በማንጠፍ በሆላንድና ባኞ በመድረቁ ባዳበረው በተረፈው በእርሶ በእብራይስጥ ባወረዱት ቢሮጥ በሰል በብአዴንና በሪፎርም ባህሉና በሕዝባዊው ቢሊዮኑ በመጠገንና በዓረቦች በርኅራ በማስተያየት በሽርክ ቢገባንም ባዛሮች በሌተናል በካሽና በይዘትም በሰነዶች በሰማ በፋቲሚድ በእርቀ በገላጋይ በጋዳፊ በአምባገነኖቹና በሃፍረት በሰማይም በአንጃው በመፈንዳቱ በፈተናዎች በእስርቤቱ በቡንደስሊጋው በኃይማኖታችን ብዙህነት በአስተባባሪነት በተበላሹ በስብሰባዉ በታንዛንያ ብላድሚር በቪየና በየአስራ በምታስገባው ብክለቶች ባልጣረ በአርሲና በምችለው በየመጋዘኑ በቡራኬ በፈጸሙበት በገብረዋህድ በዜግነትና ባንኩንም ቤዝድ በአካፋ ቢሮዬን በከሠላ በብርሌ በገፀባህሪ ብዝኅ በለዎች በጽሑፌ በፍራፍሬና ቤሊ በእስርቤት በቤታችሁ ቤንሻንጉልን ቢከፈል ባይነገርም በዚህችም በቅማል ባይዙም በማዜሙ በተሰው በተላላኪዎቹ ቢንጫጫ በማጠናከሪያ በተቀመጠችበት በሥርዓትና በሸታን በመተረክ ቢያካሂድ በመጪዎች ባጤ ብሌናቸውን በባርነትና ባለመፈጸሙ ቡችላው በገዳማቱ በካምቦዲያ ባህልንና በጉራና ቤሮ በጀትንና በሕንጣሎ በአምባ በማጥራት ቢያስብበት በማጎር በማትያስ ባህታውያኑን ብስክሌተኛ በሰባ በኢግዚቢት በተስፋና በታዩ በተከበበ በተያየዘ ባለማቅረብ ባሮጌ በክብሮሙ በክተት በአንጻሩም በገት በጄኔራሎቹ በአንተና በታሸጉ ባልተከታተለብን በቻርት ቢደርሱ በኪያሜድ በአድርባይነት በኮሞሮስ በመኾኒ በማሰኘት በተሸለ በወሕኒ ቢከፈትም ቤቢ ቡድኖቹን በምሠራው ባለቤቴና በስልጣንና ቢነግራቸው በኤርፖርቱ ቢወርዱ በአምነስቲ በኩጃ በወንድም ባለመቻልዋ በታጅ በስፖንሰር ቤተሠቦቻቸው በይድረስ ባሕሪሹም በፀናባቸው ባያጋጥም በሾህ በመቸገር በኮንሠርቱ በተፈጸሙ ቡሽን በወንጀለኞች በሚከለለው በጋርዮሽ ቢጠቅስም ብለንና ቦታነት በባንዲራው በቅንጅታዊ በለላ ቡድኑና ባይቀበልም በመግፋቱ በሚባልላቸው በማቆሟ ብንጣለው በደንና በግላቸውና ባለመታከት በህመምና በመጧጧፍ ብታውጅም በኮሎኔሉ በጸሎትም በየተቋሙ በይኝ ብታቀርቡ በሚገልፀው ብንችልም በዬዱሩ በዲያስፓራ በኢስላምና በገጠሙት በማህበረሰብና ብረትን በማሠማራት በለማ በአስተሳሰባዊ ቤካ ቤተሰባቸውንና በሽታዎቹን ቢሏቸውም በሜድሮክ በአደባባዮችና በህዝቡም በኪር በማቆር በተከፈቱት በሰርግና በምክትልነት በመታገሉ ባነገቡ በሚያካሄድበት በማይገባቸው በኪስ በፖሊሲዎችና ቤታችንም በኢኮኖሚያና በአደረገበት በማዋከብና በጥያቄዎች በመገኘታቸውም በስፋቱና በመሽከርከር በታኮነት በወሰደዉ በጉዳዮ ባይሰጡም በማያገባው ባንጻሩም በማንጠፍጠፍ በመታየቱም በብልቃጥ ባነሮችና በኤቨርተን ቡቺሊትን በስምህ ባቁዋራጭ በገዐ በስካንዲኔቪያን ብሄራዊትም ባለመምጣታቸው በተወረሱ በመፈንቀል ብከላ በልጃገረዶች ብዬሻለሁ በማህበሩና በመደናቀፉ ቢነግሩት በዓይደር በመምጣቱም በመሾሙ ቢቀጥሉ በመቆየትዋ በምቦምቤላ በተደራጁና በአባልነቴ በሸክላ በእምነትና በገዢ በማሰባቸው በተባሉትና በገዥ በተናገረችው ቢነግራትም በተሰየሙ በገንቢና በሰብሳቢዎቹ ብታስታውቅም ብረ በገፉት ባንዳዎቹ በባህላችን ብራ በአማርኛም በመፎከር ቢፈታተነውም በትራክ በዲስትሪክት በሎሬት በመሄዷ በጨዋታቸው ባለማግኘቴ በሎስአንጀለስ በመሥራትና በከምቦልቻ በጀግና በጓደኞቼ በማዕከልም በትግረኛ በመሩበት በከፋበት በስምም በልደትህ በሙያውና በመግባቢያ ቢሰላ ባንዳዎች በተከታዮቻቸው በአለንበት በሚመሰረትበት በማጣታቸውና በማግኘትዋ ባዮጋዝ ባገባደድነው በተማከለ በመሰንበቱ በመጫወታቸው ቢሰሙ በማከናወኗ በመረጃዎች ባማበር በሞያው በቫላንታይን በዓሏ ባትሰማ ባሽር በአለምና በጨረራ በጣለችው በሠፈሩበት በማንሄ በእንዳባጉና በሚማሩ በካፒታልና በማፍለቅ በተስተካከለ በተነገረን ባለመስራታቸው በግሉና ቦኮቫን በመመልከቱ በሰማች ባለማወቄ በአርዱፍ በማይጠቅም በተገባላቸው በጨረሱ በመድፋት በወላይታው ብትጀምርም በመለጠቅ በሚለወጥበት ቤቶቻቸውም በሃሳባቸው በለኛ በመከታተላቸው በመብራቱ በፈፀሙበት በጥበቡ በትክክለኛና በትኬት በመቆራረጥ በየፌስቡኩና ባህርይም በጉራ በርደዴ በየግለሰቦች ባይደመጥ በሶብላ በአብዱላሂ በስብጥር በአስተዳደራቸው ቢያምን በመመልከቴ በመቆጣጠራቸው በማሾፍ በሾኬ በሚጠቀሙበት በሚገኝው በታንዛኒያና በገጸ በዩናይትድስቴትስ ብሌየርን በሚያስቀምጣቸው በጀመረችበት በገጿ በምንነጋገርበት ባወጣነው ቤቴልና በአምራቾች ቦረናዎች በመንከራተት ብሮድ በማዕበሉ በየኤምባሲው ባጠራቀመው ብርትኳን ቢደመር በዛላንበሳው በሰማን በመኾናቸው በደንዲ በጭቆና በሚያስተዳድርበት በቴሌቶን በመካለከያ በአስመጪነትና በትራንስፎርሜሽኑ ባቋረጡ ብሩክታዊት በስደተኞችና በተናገረው ብላኛለች በመታገስ በተፈቱት ብዥ በውርስም ብዩ ብረሃን ብዪ በአልበም ብልግናን በተጎዳ በየማስታወቂያ በልዟል ቢደርስብኝ በዲስፕሊን ባይወስዱም በጉልበቴ ቤተሰቤንና በገንዘባቸውና በለዛ በአመፅና ባለስጣናት ባይዘመርላችሁም ባንዲራው ቦህ በሳዳም ባይጠፋም ቢስነትና በማልበስ በደወሌ ቢበላም በቢሮዋቸው ቢወስኑ በዓላቱን በጀብደኛ በጉልበቷ ባይለየኝ በማስተጋባትና በጭብጨባና";
            amharicWords[13, 1] = "በጽሑፍና በሽፍቶች በወፍራሙ በተገደዱበት በሪሶ ባለመግለፁ በተቀነባበረና በአደን በኤምሬትስ ባለመፍቀዱና በነገታው በማዘዣ ቦክስን በወከባ በጀርመናውያን በስላቅ በመሣሪያው በልካቸው በመቅመስ በእሸቱ ባስተላለፈባቸው ባንገታቸው ባልቴቶች በተንፀባረቀበት በቁጥጥ በተሸከሙት በረኀብ በየሚኖሩበት በጀመሪያ በየአደባባዩም በማግኔት በሌላቸውና በምርጫዎቹ ባልቴቷ ባጣበት ቦሌና በመጓጓት በያዘቻቸው በደጋው በሚጽፉት በመጣችው በጾታና በማዳበሪያና በክርስትናው በተሸፈነ በማጎልበቱ በቲማቲም በአቅሙ በመተንፈሻ በባዕዳን ባደረገቻቸው በእባብ በታክስና በአመንዣጊ በመሰግሰግ በቅጥበት በተቅማጥና በአቅሜ በተዘፈቀበት ቢወርድም ብሶታችው በአንዳቸውም በመስትዋት በሚጠይቅበት በዘረኞቹ በስሚንቶና በስተቀረ ባዳና በአመለካከቱ በመሰናዶ በምርጫዎች በመዝራትና በአቅጣጫ በቦዲቲ ብሔራንና ቢዘጋ በተለየና በእውቀቱ በመድህን በመውረራቸው ቢኖሩንም በሃይቲ በቁጥጥርና ባልፈለገበት በመገለጹ በህገመንግሥት በበለጠና በመኮንን በብቸኛ በተጓደለ በዘረኞች ቢያጋጥመው በሏት በመቅሰምና በማሰባጠር በመዝጊያ ቧጠጠችኝ ብቸኛዉ ብንከፍልም በካህናቱና ብልስ በዘረፋና ቢጨርሱም በተግባረ በተመረኮዘው በማበዛትና በሚያስጠብቁ ባይገቡም በቡልጋሪያ በሞራልና በኤሊ በአፕሪል በየደረስኩበት በጨርቆስ በጀኔራል ቢያመቻቹ በኀይሉ ቢጠብቁ በህርቲሼክ በተፃራሪነት በተበከለ በተካሔደበት በመቀየራቸው በሚሊኔየሙ በማከታተልም በሰረገላ ባቀርብም በማዘረፍ በሕጻንነቴ በገቢያቸው በማይመስል በሚስጥራዊ በፈጸመ በሸፍጥ በምደባው ብትጠይቀኝ በዕሥራ ቢዘግቡም በኤፍቢአይ ባዋቂ በአድዋና በተሰለፉበት በጥራጥሬና በመንደርደሪያ በሸማ በጥልፍ በመደርመሱ በጂኦ በእሥረኞች በተገኘባቸው ባሕሪዎች በአውሎ በመንገዶችና በበኩላ በመሣርያ በተረከበው ባቀርቡት ባልቻሉበት በሕጉም በአውራምባ በየዘመድ በሥርዓታችን በሚቆዩበት ባዘዘ በአለማቀፉ ቦስት ቢያዩት በህበረተሰብ በማርና በማወያየትና ብስናት ቢሰማህ በቀለሙ በምሳ በዛበት ባቡርም በአልብኮ ባለሥልጣንናት ብልቱ በፎገራ በማመሳሰል በሡልጣን ብቃቷ በዙርያው በብዕራቸው በእንግሊዘኛው በትግረ ባያደርግ ቦረህ በጾታዊ በሜዲትራኒያን በኢትስዊች በደጋፊነት በሞከረ በማኅበራችን ብድሩም በጥረታቸው በወተርና በነገሌ ባልሆነም ብውልቀ በአበዳሪ በኦዲዮ ቤተሰቧን በጥገኛ በባለአደራ ብሰጠው በተወዳደሩባቸው በላዚዮ በተጣሉት በበዛ በተወረወረው በመሐላ በውጥረቱ በሦስትዮሽ በመጻፉ በፓኬጅ ብዝበዛን በአገሩና በዋይታና በረሐማነት በተመለከትናት በሚፈልግ ባለመደረሱ በጸዳ ቢሳካም በሰራዊቱና ብቃቴን ቢበጠስም በቁርጠኝነትና በፌዴራሊዝምና ብናሸንፍ ቦንድድ በማስገባቷ በባላቸው በተሰጧቸው በገንዘቡና በማይመች በርካታው በአፕል በቴክስት ባልተረዱት በማጉደፍ በውሰድ በምቹ በለመደው በዬትኛውም ባንኮችንና በለስን በመዝጊያው በጤናቸው በመላዕክት በብላቴን ባያምርም በሚያለማው ብትሄዱ በጫኑ ባገኘሁ በውሎ በምሄድበት በአውቆ በደከመ በይኖበታል በተቆራረጠ ባለመስራታቸውና ብትችልም በሚያስደጉ በምናውቀው በተሠማሩበት በየትኞቹ ባይገባ በምኑ በመሰብሳብ በወንጀልና በአፍንጮ በተመድም በበረኛ በኡኝሜኤ በሕወሓትም በሮክቪል ባለመቀመጡ ቢወተውቱም በሸኖ በግልባጭም በመንተራስና ብልው በሌተር በነባራዊ በማያገባህ ቢኖሯትም በቀበሌም በደብዳቤዋ በታዩበት በግንብ በአንድነታችን በምርጫም ቦክሰኞችን በአፍቅሮ በሌለችበት በማሸነፍም ባደረሰን በራሥ በየሮ ቢወራም ባደገበት ቢልሐርዚያ በመከልከላችን በመጠቃቀስ በፈላጭ ቢበቃ በዘመናዊነታቸው ባቀዱት በሔኖክ በአኅዝ በሸኮ በድሬ