            amharicWords[13, 2] = "በተቀበላቸው በኩረ ብትስማማም በሲቪሉ በፊታውራሪነት በዓየር ቢዮ በማዝመት በማኒፌስቶው በሪፖርታችን በጋራዥ በአጽዋማት በማኸሉ በአምስትና በወደቀው ቢሮዋ ብርት በመናፍቃን ባቆሙበት በአርአያ ቤርሉስኮኒ ባናደርግ በድንበሬ በብዙዎቻችን በትጥቁ በሱዱን ቦታታት በተጋለጡና በየዓመቱም በምሽትና በኛው ቢያዩ በልዩነቱ በደንቡና በተለጠፈ ብዛቱን በተሳታፊ በኮንፈረንሱም በተወገዱት ብትወስድ በአርብቶና በመድኀን ብርን በእናትዬው በመዘጋታቸው በዩኒቪርሲቲው በሳልና ባልኩት በነጮች በማንጓጠጥ በማሰራቸው በመፈራረቅ በተዘረፈ ብሠራ በተመሳሳዩ በሚዛን በፋይበር በአጋዥነት በግለሰብና በዬተራ በሚከበሩበት በመፈጠራቸው በጊዚያዊ በሚያልፉበት ባሻቸው በግዴታም ባማርኛ ብናተኩር በስሪያ በብሄራዊና በየፍርድቤቱ በማስቆጣቱ በተሰካ በማጣቴ ባዘጋጀበት በጣሙ ባክ በድለላ ብትሸነፍ በቴሌቪዥኑ በማረፉ ባልጠበቁት ቢሰበሰቡ በጥጋብ በመቁረጡ በአሁንም በተፈጥሮአዊ በሰም በስማቸውም በሶማሊላንድ ባለውቃቢዎች ባለሃብትና በመርሳት በሄደው በእርግዝና በጣር ባልሳሳት በአብዛናው ብንጓዝ በማስቆጣት ብርጋድየር በተከታታይና በአያታቸው በደሴቶቹ በግሉም በኮርፖሬሽኑና በዘገቡት ብርዱ በሚመነጭ ባለመውሰድ በአይረን ብያቸዋለሁ በማካበት ቢስነቱን በጣሉት በመኾኑም በሰኔና በሚያካሂዱበት ባለመስጠትና በረዋል በመሰብሰቡ ቢነጋገሩም በርናን በመላዉ በመረቡ በጳጉሜ በጫረው ብሔረሶቦችና በመላዋ በመመከትና ባጡ በመዋዋል በኤምባሲያቸው በስውርና በሚናገረው በትምህርቱም ቢቀርብላቸው በዲያስፖራው በወገኑ በማጉላላት በትምህርቷ በልብህ በባእድ በእውቀትም በታየ በሰብ በተኮሱት በደንበኛው ባከነ በመግንስት ባብል ባስገኙት ቦታዉን በሚመራበት በዩክሬን በማያገባቸው በተረጋጋና በጨቋኙ በአደጋውም ባልተገባ ቡሲነስስ በእግርና በመጎብኘታቸው በወጥመድ ቦረናና በኮንተብ በማቆሙ ቢወርድ በማግሥቱም በጄኔራሎች በአጠቃላይና በተከለሉ በአስችኳይ በአማፂያኑ በተቀራራቢ ብቃቷን በመግባቴ ቢሊየነሮች በየፊናው በአሲድ በሚያሳትፉ በጨበጡ በሰኞ በበይነመረብ በማስተር በባረንቱና በማስተርስና በመግፋቷ በማዳመጥና በሽኒሌ በመፈቃቀድና በተቆጠረባቸው በኪሱ በንዑሳን በአማካሪዎቻቸው በድምዕ በጥንካሬው በተፈጥሮም በተላከበት ቤይ በይው በላኪነት ቤዞች በተባራሪ በመሳደብ በአሮሬሣ በኤክስፐርትነት ቢፈጅም በተሰሚነት በአስማት ባለሥልጣናትንም ብዕረኛ በደፈናዉ በኦፓል ቢሉትም ባይታሰብም ቢሻውና በተቃረነ በምንኛ ባይገርማችሁ ቢሞትም ቤተክርስቲያንዋ በግራዝማች በዘውዱ ብሪ በታወቀ ቦርጭ በመጣሁበት በተጠናከረበት በፍትሕና በመኮልኮል በአእምሮው በደንብና በማስጎብኘት ባለማድረጉና በቆልት በመንዝማማምድር በቤተሰብዎ በዓሊ በኢንደስትሪ ባዮቴክኖሎጂ በአቋቋሙት በችሮታ በስራት በታዛዥነት በማይገመትበት በኪነ ብትወጣ ባህታዊው በታሪካዊና በማበላሸት በሾኔ በስርጭቱ በለን በአእምሮአቸው በገጠማቸዉ በርትተን በመስፋፋታቸውና ቢያወጣ በመጠቆሙ በቅርበትም በመንገዳቸው ብኡ በተጠቀሙ በሊቀመንበርነትና በወራቤ ባሏቸወ በሑመራ ቢያስታውቁም በሃማኖት በፍልስጤም በሚዘጋጅ በካናዱ በተሳተፈባቸው ቢተላለፍም በግርዛት በሰማርያ በመደረብ ቤተሰብእ በርክቷል በተጠቃው በሚጠሯቸው ባተረፈው በመጠናት በግንኙነቱ ብዬህ ብዙሐንና ቢነግሩን ቤንጋዚ ባለጌና ብርጌዶችን በዓላቱ በማንዴላና በመዘከርና በታኝና ብዙሐንን ብዮ በኖረው በዱራሜ በግንኙነት ቢያብር በማምለጥ በሴትፍኔት በዕውር ቢለዮን ቦላ ቦሎ በመጠመዳቸው በተራሮችና በሚችልባቸው በመከለልና በተፈራ በውጤታማ ቢወስን ቦማ በአትሌቶች በጋዜጦችና ባለመኖር በድም