            amharicWords[13, 3] = "በዳህላክ በሚያጋጥሙ በሐረሪዎች ባፋና በአሳቡ ቢንቀሳቀሱም በሁለተኛውና ብሌይር በታወጀው በመጠባበቂያ በአገራችሁ በመጀመሪያም ባለመሆኔ በመታዘብ በስልጣኑ በሲውድን በማልታ ባሕረ ባቡሩን በሂሊኮፕተር በረኸኞች በመከላከያው በማስመሰልና በምኒሊክ በመፈለጓ በመቆፈርና በስተርጅና በየሙያ በምሑራን ባራቲየሪ በአመራሮቹ በማድመጥ በአማራውና በውጊያውም በአለቆቻቸው በመዋደቅ በደደቢት በለጠፈው በብሔራዊና በወገኖቻችን በምንወዳት በማያውቁ በመቋቋሙ በመቀበሏ በአእምሮዬ በገብስ በመኸሩ በታቀደ በጠለፋ ባለታሪካችን ብቃቱም በመዳከሙ ቢጠይቁት ባይኔ ቢገነዘቡም ባለሙያውም ባለመስፋፋቱ በኑሮና በጎበኘበት በሕዝባቸው በአለው በመጥረግ ቢልኩም ቢለን በኃይለኛ በማሳየትና በጥሎ በመድበለ ባስተዋወቀበት ቢለኝ ብሽቅ በፃፍኩት በገለፀበት በእንግሊዙ በትና በመመገብና በሚፈፀመው ብሄረተኝነት በሔክታር ቤታዊ በእዉነት በሜኤሶ በምትርቀው በለዘብተኝነት በማስገባታቸው በሰብሳቢው በሐዋላ በርካታውን በድምጽም ባለመቀበልና ብሄረሰዎችና በዲናችን በጌጠኛ በየፖሊስ በዓቅም ቢታመንበትም በሚያጭበረብሩ በካርቱምና በሜዲትራንያን ባይመጣ በባሕታዊ በግብዓት በሀገራዊ በሪፍት በጀመርነው በተሳተፉ በተቀረ በመሰኖ በነጌሌ በቴሌኮም በብሎኬት በቀሰቀሱት ብስክሌቶች በተዘጋጀለት በስታዲዮም በመሾማቸው በቤታችን በረከተ ባለመደገፋቸው በየክልላቸው በውዴታም በሙስሊም በእርሣቸው በአዘጋጁ ብሰራ በጀቱም በግርጌ ብሩንዲና በመሥርያ በበለዋ በነገ በእርሳችን በየተመደቡበት በልማዳዊ በኦጋዴንና በቤጅንግ በቀሉ ቢመሠረትም በትረጊዮርጊስ በአርምሞ በየሰፈሩ በሚያስተዳድሩበት በሚሰበሰብ በአስገዳጅነት ብገባ በመቀመጣቸው በካንሳስ በዓላማቸው በኬር በሳምሶናይት በዋሉት በመተንኮስ ብታይ በአኳያው በመልቀቁ ቢገደብ በሕጻናት ብቃቱና ባጠቃቸው ባደባባይ በጊዜያዊው በመተላለፋቸው በኦቨር በማስከፈል ቢገለጥም በተመላበት በማዘጋጀቱ በሐምሌና በወደቀችበት በመጨፍጨፍ ባህርይና በመነቅነቅ ቢያሳዩ በተማሪነት በሰፈነባቸው በሮያል በቤትና ብልጥነት በመነገድ በትነው ባካል በአስመራው በሐበሻ በሰንበት ባገናዘበና በማይተናነስ በሚያስፈልገው በመድረግ በስደተኞቹ በተስማማነው በአላቸው በኢንጅነሪንግ በእንዴት በነኚህ በአመቻች ቢያነሱም በአይነት በተከፈተባቸው በሹመቱ በደመ በማገት በማንኛቸውም በዳኝነትና በፈለጉበት ቢጠሩት በመንደፍና በታከለበት በነጋዴዎቹ በመራመድ ባሳወቀው በማድረቅ ባለንብረትና በሚያርፍበት በምድራቸው በናይጄሪያና በትውልድና ቢላደን በሚመለከተ በመሄዱና በጥፍ በዳሉል ቦይና በመደበላቸው በተባባሩት በማከናወንና በባንኮቹ በቀብሪበያህ በሮመዳን በርሳቸውም በድጋሜ በነገሰበት በተቃራኒዉ ቢነግሩንም በተጨማሪውም በኮልፌ በሳባ ብሰጥ በመርካቶና በባለስልጣናት በማስተዳደርና ባግዳድ ባሰቡት በማብከት በጥረቱ በመክፈሉ በቅዳሴ በብሔረሰቡ በአካባቢዉ በዱብቲ በወል በክል በማይነካ በጥቅምቱ በተገናኘም በኃጢአት በችግሮቹ ባለመታየቱ ባድሜና በከሰም ባስረከበበት ቤተሰቦቿን በፖለቲካል በችግሮች ባህርይው በማስወገዱና በጎደለ በትምህርትም ባለቤትነቷን በመሪር በቅዱሳት በጆሐንስበርግ በዋጠው ቢያስቀምጥም በአብራሪነት በመነቃነቅ በተሰብሳቢዎች በኤኮኖሚ በአራተኝነት በደዌ በድብርት በመሠማራታቸው በተከለከሉ በዲፕሎማት በስዊስ በእግሮቿ በዐረቡ በሃርጌሳ ብንታገል በማመንና በሰጥቶ በዐረብ በሚኖር በላቡ ባሬስታ በአስተርጓሚነት በኢቲዮጵያ ብትፈልግ በስንቅና በላት በሰለጠኑባቸውና ቢዝነሱን በሊብያ በመላበስ በህንፃ በደጉ በሒደት በብሄሩ ብትጠይቅ በላን በመሠረቱት በመጠርጠራቸው በ