            amharicWords[13, 4] = "ቢባሉም በማምጣትና ባንዲራችን በንብረቱ በአብዮትና በተቻለው በማጋባት ባለማምጣቱ በካድሬ በዴሞክራሲው በካቶሊክ ብሎን ቤዙን በምልአተ ብራዘር በአልበሽር በቆዩ ቢውሉ በአካውንቱ በምልአት በተመረጡበት በእጃችሁ ቢያሳዩም በእድገትና በተመልካችነት በደህንነቶች በናይሮቢው በወላጆች በእነኚህ በፈንታቸው በዝግታ በሕዝቦቿ በስቲያና በፓትሪያርኩ በአዳዲሶቹ በላይኛዎቹ ቢመረጡ በመምሸቱ በእራሱ ብታደርግም በሚተዳደሩ በሰፈሩት በአካዳሚክ በደረጃም በማሽከርከር በባለቤቱ በአብዛኛውም በላኩልን ብዙና በቢቸና በማክዶናልድ በፕሮግራማቸው በመደማመጥ ቢራቱ በአንገታቸው ቡራዩ ቡሩንዲና በዕርቅ ቦምቦችን በዕቃዎች ባላሃብቶች በታተመ በደህንነትና በአሰልጣኝነት በማሰፋፋት ብርሃንም በማንሳታቸው በፈላ በንደዚህ በመስራታቸውና በሚነሳበት በማፍራትና በማይኖርበት በሺሕ ቢያልፉም በፌስቡክና በእመቤታችን በአዳሪነት በጭስ በውሣኔ ባዋጡት በጭቃ በሐሳብና ብልጽግናን በእራት ቤትሽን በመቃወሙ በተከላካይ በተቀረው በሚያስብል በዲያቆን ቢጀምሩም በሞርታር ብቻና በመሰወር በመርከቧ በእንትን በፍትሐዊ በተባ በስድስቱ በአስሩም በፀሎትና በኦዲተሮች በማሽላ ብሎአቸው በሄንግሎ በኖረበት በማይገባ በመመልከትና ባካተተው በመንካት ባለመረጋገጡ በደረት በሚወዳደሩበት በተባረሩት በጂፒኤስ በጽሁፌ በቀዳሚው በሚነጋገረው በፍራቻ በደጋፊዎቹ በወጪና በሰራተኛውና ብልሆች በባንዳ ባለማክበራቸው በማስረፅ በአለንጋ በድንጋጌው ባልዋለበት በመሃሉ በማብራሪያው ቦጋለች በቪአይፒ በፈጠረበት በውዳሴ ባለመቁጠር በመተውና በጠብ በጅብ በልማዱ በሚኖርባቸው በዘልማድ በዓላማው ብዬሃለሁ ባልገቡት በክብደት በባቲ ባሰፈሩት በአኝዋክና በማደል በሚነሱበት በሚገነባው በሸሪአ ባሰባሰበው በየፈርጁ በቶኪዮ በሲኖዶስ ብልፅግናን በልማቱና ቤርጎሊዮ በአገራቸውና በተራራቀ በመቃወምም በጌታችን በመታቀብ ባለመፈታቱ በመለየታቸው በስፔይን በጉልበትም ብጹእ በመደንገግ በፖለቲካውም በሚያገኛቸው ባይሆንማ በርክክብ በሽጉጥ ባሣለፍነው በወጣቶቹ ቢርማ በርስት በየመንገዱና በሌ በማጥለቅለቁ በየኮሌጆችና በወንጀለኛነት በአጽንዖት በዋንኛነት ባርነትና ባህሉንና በጣሊያኖች በመጡት በማለቱና በሥልጣንም ቢፈፀምም በተ በቱ በድርጅቱም በመቀመጡ በዘመናዊው በዘርፉም በዕኩልነት በቀናነት በውዝፍ በኖ ብዙኅን በረክት በዲማና በፕሮፖጋንዳ በታዋቂው በፈጠረሽ በክህነት በተነሱበት በሚታወቅ በዓመታት በቤቷ በእልህና በላቸዉ በሲዋዚላንድ በራስህ በያን በለውን በመጨው ቢሠሩ በጂኦግራፊያዊ በመቃብር በመውለድ በፈፀሟቸው በወንጀለኝነት ቡሌ ባ በውዝግብ በከር በቦክስ በሚያወጣቸው ባህሬን ቡሳ በሳውድ በሥልጣኑ በአቅርቦትና በተጣለ በደረጃው በማመልከቻቸው በሻሸመኔና ቡታ በእስራኤልና ቡት በጦርነቱም በባለድርሻ ቢጠናከር በማሻሻያው በመመደባቸው ቢዝነሶችን በሰርተፍኬት በህግም ቤትህን በጥርስ በተዛመደ በአጀንዳው በየደረጃቸው በሚከፈልበት በሸምጋይነት በአልጌና ቡዝ በምክርና በኛም በአዳሪ በመጋለጡ ቢደነግግም በሚሉበት በኪስማዩ በዩኒቲ በተዋቀረ በየሙያው በመጨረሻዎቹ በርናንድ በአዎንታዊም በሲዳማና ቤላሩስ በመሰጠቱና በማሰራጨቱ በቆረጣ ቢሱ በሚያሳብቅ በመወለድ በየቤተክርስቲያኑ በተፈጥሯዊ በተፎካካሪ በችግራቸው በማስቀረቱ በፐርሰንት በአስተባባሪ ብሎኬት በማመዛዘን በሽፍንፍን በወላይታና በህወሓትና በሚውሉ በምትገኘውና በሰብዓዊነት በሕገወጥነት በመደራጀታቸው በፍለጋ በትግራዩ በጥፋቱ በበገና በደብረታቦር በተመሣሣይም በሰለጠኑ ብነግረው በማስረገጥ በተነገረለት በጹሁፍ በስልጢ በማሰስ በቀነኒሳ በቃፍታ በተራራው ቢያዝ ባላሰቡት በወንዝ በዘመዶቻቸው ባለመሰራቱ ባህያ ብናስብ በፓናሉ በተላከለት በመቅረት በሓውዜን በሕብረተሰባችን በቃለምልልሳቸው በሠልፉ በኢተፖድኅ በአስክሬን በግብዣ በወንዶ ብርክ በትልልቆቹ በመድረሻ በነርሱ ቢሮክራቶች ባሥልጣን በአወጣው በመሰረታዊነት በሽፋን በመደብ በሰነዶቹ በዘረጋቸው በመላኩ ቡሽም በቅጣቱ በራሳቸዉ በርግደው ቡሽራ በጣሰ ቢሰበሰብ በዲጂታል በትምህርተ በዘነበው በቴክሳስ በሰማሁት በተጠበቀው በየአስር በምእራብ በፒትስበርጉ በኮንደሚኒየም ባስቆጠራቸው ቤተክርስቲያኒቷ በማላውቀው ብራችን በዞኖች በእርግጫ በመቅረባቸው በከፍተና በደላንታ በሚያካሄዱት በገዳማት ባለመሰጠቱ ብርድልብስ ብትሞክር በማሽቆልቆል በያዙበት በጥቃት ባልንጀራ ቤቶቹም በዳሬሰላም ባንዲራና ብሔራዊው በየአድባራቱ ቤኛ በኤርፖርት በቤተመንግሥቱ በተለወጠ በማስቻልና በመሥጠት ቢያብራሩልን ብጠይቀው በሐዘን በወራሪ በዕብሪት ብስራተ በሬዲዮው ቤተሰቦቻቸውንና በመቀባት በጥያቄና በዝናብና በማሻገር በዘራፊዎች በየጫካው ባዘዙት በግድቡ በታወቁ በሚከታተሉ በተከፈለው በከንባታ በተሳተፉባቸው በዕድሜና በሚከሰትበት በተጠቋሚ ባለማግኘቷ ብልጦች ብንጠቅስ በምሪት በኢትዮጵያችን በፍትሐ ቢከፈት ቢለያይም ቢናገሩ በወራሪዎች ባይሳካለትም በድርጅታችንና በቀድሞዎቹ ብን በየከተማው በስርጭት በማሰማቱ ቢጽፉ በወርልድ ባህርዩ በሚያካሂድበት ብርቅና በሴሚናሩ በችርቻሮ በከበደ ብጹአን በአለታ በአማኞች በተፈቀደለት ባለሞያው በሚመሩበት በጉጂና በበለስ በመጣልና ብጫ በአጥቢያ ቤንሃይም በካቢላ በፈነዳበት በመሰንዘሩ በሱማሌና በምዕራባዊው በአቪየሽን በልጅነቴ በኢንጂነር በጎዶሎ ባሳየበት በሱማሊያና በማፍረስና በሰነድነት ቢያመጣም በጎቼን በተደጋጋሚም በኢህአደግ በነባርና በርዕዮት በተስፋዬ በደርዘን ባለማግኘታቸውና ቡድናችንን ባለጌው በየቀኑም በመፈናቀል በአባቶች በፖሊሶቹ በተዋህዶ በአመራሮች በማይሞላ ቤታቸዉ በኒዮርክ በሐመር በአሁኗ በማያውቅ በመደረጉም በጉያ በታየባቸው በተመላላሽነት ቦድ ባይነ ባይችሉ በታችኞቹ በቀጠረው";
            amharicWords[13, 5] = "በይርጋጨፌ በሙዚቃው በላብራቶሪ ብሪታንያ በመፋለም በምልክት በግብጾች ባላቸውን ቦሰት ባለመሆናችን በመመገብ በማስመረቅ በሰራዊት በማዋላቸው በሕዝቡም ብንልም በተስማሙባቸው በመወሰዳቸው በሥጋ ባህሪያት በመኖ በአምስተኛው በጥቅማ በእውነትም ቢያርሱ በመበታተን በማስተዋል በኢሕአፓ በደጋማው በተገላቢጦሽ ባለድርሻው በየሩብ በመቀስቀስና በፓርኪንግ በተጻፈው በጀልዱ በምክንያት ብዕራቸው በካድሬዎቹ ባለጸጋ በውጤታማነት በኒው በመጠነኛ በደለኛ በዛብን በቱሪዝምና ቡክን በአዶላ በታሪካቸው በምትባለው በማረምና በወረኢሉ ባሳቡ በአዞ ባለሥልጣኑም በአይ በራቸው በፈነዳው በሚያቀርባቸው ቡናም በግርድፉ ባይሳካም ባለሥልጣኖቻቸው በሁለንተናዊ በጎሳዎች ቢላዋ በነበሩባቸው በአፉ በካዝና በደጀንነት በህገመንግስቱ በኬላዎች በግቢ በወንዶቹ ባቋቋመው በክልሎችም ባለስድስት በማንሳቱ በሆለታ በትነዋል በሚያከናውኑት በመዲናይቱ በገርጂ ባሕርይና በአስመራጭ በመገኘቱና በፉከራ በደጃች በኤድመንተኑ በተመሰረተበት ብሶታችንን በተጠናቀቀባቸው በጨው ባዮኢኮኖሚ በሪፈረንደም ባሸነፈበት በርሀብ በሥርዓተ በምሕረት ባለባት በስዬ ቢያስብም በተጣለው በግንባራቸው በኔት በመሠረታዊነት በግላጭ በስነተዋልዶ በአስተያየት በአንባቢ በጎማ በተጠመደ በቀጠለው በውግዘት በአህጉራችን በዘሩ በድምፅና በተዋቀረው በተባባሪነት በኒያላ በግዴለሽነት በእኔና በአገራችንና ባለሙያዎችንም በተሰጠባቸው በዘመቻና በመተማና በማደፍረስ በድክመት በብራዚል በእንስሳትና በስስት ባንዲራውን በመስፈር ባሌና በማራገብ ቢላቸው ባዲስ በረጋ ባንኩም በበርሚንግሃም በሚያከናውኗቸው ባልተዳረሰባቸው በአንትራክስ በሲድኒ በቡልዶዘር በሚቻል በምርቱ ባሕሪያቸው በዬቦታው በሚፈጥሩት በተመዘገበው ባግቦ በመምረጥም በሰውነት በእፎይታ በቆጠራ በዓድዋው በግርፋት በጥንቱ በሩጫው በአፍላ በየትኛዉም በሰፊዉ በመገደዱ በማካሔድ ባይከዳኝ በመጽሔት በሁላ በሻኪሶ ቤተሰባዊነት በተተኮሰባቸው በሰፈረበት በተሳትፎ በቅጠል በድግሪ በሚመለስበት በመዝጋታቸው በሕንፃ በንጉሱ በሥራችን ባለአክሲዮኖችን ብቸና በማፈላለግና በመዳፉ በፓኪስታን በምርመራው በመምረጡ በትዊተር በሃብት ባይሆኑ ባስተላለፈችው ብናይ በባሌና በአሠሪና በሚፈጠርበት ባባትህ በፋይናንስና ብሏቸዋል በበርበሬ በፖርቱጋል ባመጣው በመጨመሩና በማየታችን በሰነዘረችው ብሐረሰቦች ቤርቲኒ በሩዋንዳና በፌደሬሽን በሶማሊያም በአፍራሽ በችሎታው በሜዳቸው ብዙኃኑ በመራጮች በፈጸሙ በመብቃቱ በአዛዥነት በሚጠቁ በጎንቻ በመከናወናቸው በገደብ በሰጠኝ በሽምግልናው በየቀበሌዎች በሚቀርብላቸው በጀርባዋ በየእሥር በሰውነታቸው በባንዲራ በነገረ በማወቅና ባህርያት በመቀየርና በአንዋር በብዝሃ በሜሪላንድ በተላከው በላፍቶ በተሰጡት በዱቄት በክሊንተን በተደረገውም ባልተለየ ቢያውቁ በማስከተሉ በዘጋቢ ቢኖረኝ በሚያዘጋጀው ቢያገለግል በሰንዓፌ በሰርጉ በማስወጣትና በፊልሙ በፕሬስና ቢካሄድ ባገረሸው ብሄርን በማስታወቂያና በአበባው በአህጉር በናዝሬትና በሰበር በባጀት ብጹነታቸው በየስፍራው በዘመን ብቃትም በንብረታቸው በሞተ በዛቻ በቁጥጥሯ በምላሹ ባስልዮስ በውጣ በሽምቅ በሚጠጉ በየጣቢያው በማርቀቅ በቢራ በሚዘልቀው በመመደቡ ብሎጌ በጎሪጥ ባገራችን በጎጠኝነት በሚፈፀሙ በመስኮት በማሠር በማክበድ በአሜሪካውያን በደቡበ በማጠናቀቃቸው በቻምፒየንስ በሚሰጡበት ቢሸጥ በግጥም በኢራቅና ባልተገኙበት በተጠየቀ በመዝመት በእጣ በትዕግስትና በወንበዴዎች በሺር ብልጽግናና ባለስልጣንም ቢሰጣቸው በጠበቀና ባለመጠቀም በማምጣቱ በገቢና በተባሉበት በመታገዳቸው ቢያውቁም በዘበኛ በመኮንኖች ብጠይቃት ቢሸነፍ በስልጠናውም በስትራቴጂክ በሰፈነው በጠራ ብስክሌተኞች በኢፌድሪ በኢሃዴግ በአስታራቂነት በተቀበሩ በሠሩት በመምህሩ በመሰለው በአጎዋ በሳህል በዝተው በሓሳብ ቤተሰቤን በኢዲዩ በዛልአምበሳ በማክሰኞው በማስቀመጣቸው ቢሮዎቹ በብርሃኔ በተከናወነበት በመቀመርና በሴኔቱ በተመደቡበት በምሽጉ በከንቲባው በማስዋብ በሄጉ በበረኛው በማሠራጨት በማከታተል በተገልጋዩ በቢሮክራሲው በተላኩ በኢቲቪ በአባቱ በባሕሬን በሊቢያና ቢያልፍም በአምባሳደሮች በቦሳሶ በመበላሸቱ ቦቆሎ በመፍለስ በተመሠረተው በወያኔው በጨመረ በመብታቸው ቢፈታ በአካሉ በማመቻቸቱ በመርፌ በፍጥጫ በቀመሩ በብስክሌት በአያት በርግ በልገሳ በከርሰ ብለውት በላቦራቶሪ በጥሬው ቦንቡን በመአሕድ በመማፀን በተለዋጭ በማጠቃለልም በዘንደሮው በታላቅነት በኦፕሬሽን በጓዳ በአስፈላጊው በየስብሰባው በስደተኛ በሚዲያው በቅርብም በተወያየበት ብፈልግ በተዛባ በሚቋቋመው በንጽህና በመሐመድ በተደረሰባቸው በጎነት በአዲሳባ በሠፈራ በአቸናፊነት በዲፕሎማሲና በግሎባላይዜሽን በሐራጅ በባለሥልጣናቱ በመረቁበት በቲቢ በፊቴ በሕዋላ ቢጠየቁ በባራክ ብሔርን በዝምድና በማሳያነት በሚወጣበት በቀበሮ በሄድንበት ባሕሎች በየሚዲያው ቡዳ በኩላሊት በመዋጮ ቢላ በማለታቸውና በማጋነን ባለሥልጣናቱም በጥይትና ባልንጀራዬ በባለሥልጣናት በአክራሪነት ቤተሰብም በመጨመራቸው በእሁዱ በማንሳትና በክህደት ቤተመጻህፍት በሚወሰዱ ባለመሟላቱ በግጭቶች በእድሉ በመናሩ በማተት ብዙኃንና ብዙኃንን በውርደት በዓመታዊ በኢፌዲሪ በወጣለት በጁላይ በእውቅና በአጠቃላዩ በከበሩ በሳንባ በሰደፍ በሃረር ቢያጆ በማገናኘትና ባብ በተሰኙ በአጉል በረኃብ በገለፀው በቱኒዚያ በሰፈሩበት በተጠርጣሪነት ባለሥልጣናትንና በረርኩ በፋና በመመርያው በሚውለው ቢያስረዱም ባለመውሰዱ በርካታዎቹን በለኮሰው በተሞላው በሚያከናውነው በኦፕቲካል በሚያደርግላቸው በመፍታትና በተሰራጨ በተረከቡበት በነርቭ በግብፅም ባለመልኩ በመደረሱ ቤከር በማውጣታቸው በማህሌት";
            amharicWords[13, 6] = "በማጣቀስ በለኝ በጠቅላላውም በገጽ በሚልበት በፍቃዳቸው ባይሳ በማቀራረብ በማስከበርና በዕድገት በከንቲባ ብሔርተኛ በፖሊሲው ብፁዕነታቸው በቴሌኮሚኒኬሽን በሰባቱ በግብፅና በዚምባብዌ በምትገኝ በሥጋት በሰጧቸው በማውገዝና በመቅረጽ በመቀበልና ቤቴን በማስፈንና በእስያ ባትሪ በአሜሪካው በሞዴል ብክነትና ብሎኮች በደለል በጀርመንና ባንኪሙን በፎረሙ በቀኛዝማች በሂደትም በተስማሙበት ቢሰጡም በግልግል በታዛቢዎች በሙያና ብትል ቢያገኙም በኦሕዴድ በሚስጢር በእያንዳንዳቸው በወርሃ ብናውቅም በሃገሩ በመዘርጋትና በአቻ ባይገለጽም በመታየታቸው በመንገድና ባለመግባባት ቢወጣም በማወጅ በውስጧ በማቀላጠፍ ቢኖርበትም በአዲ በማቀፍ በአከባቢው በአሰራሩ በመረዳታቸው በቆይታቸውም በግር ባላንጣ በዜግነታቸው በዓልና በሚሄድበት በተሞላ በቀንና በማስፈራራትና ቢወጣ በታችኛው በግዢ በግዥ በእናቶች ባለሙያዎችንና በግዛቱ በደላቸውን በግዛቷ በእኛና በሚሳተፉበት በአመጽ በማሳተም በቃና በምዕመናን በክልሉም ብረታብረት በሀቅ በመሳሪያነት በትራንስፖርትና በክለቡ በደሴና በክለብ በመከራየት በመኖርያ በአስጊ በተከሰሱት በግለሰቦቹ ብሔርተኞች በልጅ በአምቦና ቢፈልግ በኃይልና በየዘመኑ በተፈጸመው በጥንቆላ በመሰረዝ በኦስትሪያ በውስጡም ብዙሐኑ በአላባ በላስቲክ በሪያድ ቢሳተፉ በኑሯቸው በለዋል በቀዝቃዛ በነባሩ ባለቤቶቹ በትሪፖሊ በሌለባቸው በደጋፊው በቋንቋና በሶማሌያ ባቋቋሙት ቤኔዲቶ በድሉ በአናቱም በማስታጠቅና በመተከል በተቋቋመበት በተነሣው በማንበብ በሞሮኮ በአለማያ በትልቅነቱ በነገር በፅሑፍ ብንለው በመቆጣጠሩ በአዲግራትና በሚመራ በተደረሰ በሚሊኒየሙ በመመለሱ በኢትዮጵያዊቷ በእሷ በፀሐይ በተካሔደው በማየሉ በየሦስት በመታመማቸው በመሆንም በሆቴሎች በመክተት በፍርሃትና በሽታም በዓይኔ በምርቃት በእዳ በአሠራር በኢትዮጵያዊነታችን ቢራና ቡችላ በመተላለፉ ባለመቻሏ በዩኔስኮ በሴክተር በኣንድ በተቋቋመ በዓሉም ባለብዙ በርሃ በማስረጽ ቢሮክራሲው በተገናኘ ባቡሮች ባለድል በእየሩሳሌም በሚያከናውናቸው በሚኖሩባቸው በሄዱ ቦትስዋና በምርምርና በግራና በምሥራቁ በቢዝነስ በመመኘት በመስጊድ በሐረርና በእለት በጆሮ በሽ ባርነትን ቢልዮን በሚሆኑት በፕላስቲክ ብለውን ባለሥልጣኖችም በሊጎቹ በስልት በተመረቁበት በአርአያነቱ በማውደም በጄ በእርሻው በፈረሙት በበተኑት ቢሞክር በመግባቱና በያዘ ቡቴ በማስገባትና በለሆሳስ በተላበሰ በአጥር በተሰራው በአውቶብስ በሽተኞችን በመኪናው ቢኾንም በዛምቢያ በመዘገቡ በመሠረተው ባቀረባቸው ቢቲ በመቶና በመመለሳቸው ብለንም በወሰዳቸው ባፋጣኝ ባልደረባችን በማይክሮ በማጣቷ በሚረዱ በትሕትና በንፅፅር በክፍያ ብጠይቅ በዘመናቸው በየምክንያቱ በገባ በአሉባልታ ቢደርስ በማረጋገጥና ባለሥልጣኖቹ በእቴጌ በኦስሎ በሚፈጠሩ ብያኔ በሚፈጠር በጣቢያው በከተሞችና ቤተሰብና በመናድ በሲዲኒ በጊዮርጊስ ቢደረጉም ቢናገር በማስነሳት በጉልበትና በተቀመጡበት በመቀየሩ በወራት በፕላዝማ ብየ ቢጠየቁም በአስደናቂ በተንታ በመጥላት ባሕሩ ባሕሪ በወደፊቱ በርዕዮተ በድርጅቱና በአስፈፃሚ ቦና በአመታዊ በሀረር በኢትዮጵያዊ በበዛበት በሚገቡበት በሃሰት ብዬው በሚሰጡ በማስደገፍ ቢገቡም በጅቡቲው በአርባምንጭ በላይም በትናንሽ በዓይናቸው በህዝቡና በመሠረተባቸው በነበራት በሚጎዳ በሬውን በመነሳሳት በሰቆጣ ባለንብረቶቹ በተያዘ በኒውዮርክና በጉብኝት በባለሃብቶች በማጉላት በሽሽት በአይጋ በስቶክሆልም በመብረቅ በማንገብ በተባረሩ በሚመለከቱ በግንዛቤ በሚደርሰው በደምና በተሰበሰበበት በጥረት በእረፍት በመማቀቅ በማስተላለፉ ባሕርና ቢሰ