            amharicWords[13, 7] = "ቢሮን በዩኒቨርሲቲዎች በወልዲያ በሀይማኖት በሕዝባዊ ባቲ በቋሚ በታኝ በማሰርና ባጫ በማስፈለጉ በማሻሻልና በቤተክርስቲያን በተፈጠረበት በትረ በትር ብቻዋን በሰማይ ብስለት በማስታወቅ በአንቀፅ በመኢአድ በተገኙ በድብደባ ባለጌ በአይነቱ በመጠየቃቸው በወሬ በርሜል በላዩ በቤቶች በዛብህም በመደረጉና በይቅርታ በማረጋገጡ በመስበር በረንዳ ብይኑን በማቅረብና ብርጋዲየር በማስቆም በፕሬዚዳንትነት በሰማያዊ በማስከተል በድንጋጤ በውጤት ቡድኖቹ በቤይሩት ብቃታቸውን በመፃፍ በረራው በወጣቱ በየእለቱ በከተሞችም በእርሻና በሶማሊያና በድንገተኛ ባከበሩበት በክፍል በመበተን በኩባንያው በሐሳብ ባይችልም ቡድኑም በመሄዳቸው በተቃዋሚነት ቤቶቻቸው ባንክም በቴሌኮሙኒኬሽን ባሳየው ባደረባቸው በዳግማዊ በነቀምት ብሆን በከተሞቹ በስራው በማሳየቱ በእንግድነት በአንደኝነት በጉጂ በመስራቱ በእነርሱ በነጭ በመቅረፅ በአገራዊ በሳቅ ቢያደርጉ በመቅጠር በማዋጣት በሰንደቅ በውድድር በሚገባው በመውጣታቸው ቢፈልጉም በመተዳደሪያ በተገኙት በግለሰቡ ቢያቀርብም በሶስቱ በቁጥጥራቸው ብርሀኑ በመጠለያ በማድነቅ በወረዳና በወዳጅነት በመከልከላቸው በማሳካት ባለመቀበሉ ብሌዝ በበርበራ በጭንቀት በሞስኮ በማስገንዘብ በመሰቃየት በሽራሮ በሀገራቸው በሀይል በሕዝቦች በወተት በአንፃሩም በዋልታ በኢትዮጵያዊነት በሲኖዶሱ በአጥጋቢ ቢገለፅም በሳይንስና ቢያ በቅድስት ባለስልጣናቱ በራሳቸውና በመታመኑ በወገን ባለሙያና በእነዚሁ ብጥብጥና በኩዌት ባለሥልጣንና ቢገኝ በምሥራቅና በማቆየት በሚሰጥ ብለውኛል በማቋቋምና በድርጅታቸው በማኅበረሰቡ ቤንጃሚን ባነሰ በስደተኞች በችግሩ በእምነት በብዛትና በማስቆጠር በሚንቀሳቀሱ በመጎብኘት በክርክር በሜዳው ባላባት ቤተሰቦቹ ባሳተፈ በሚጀመረው በመንግሥቱ በበርሊን በተሰጠበት በኩንታል በሚሹ በአፈ በይኗል በናይጄሪያ በሊባኖስ በኢህአዴግና በባለሙያ ቤተሰባቸውን በግንቦቱ በተጠናቀቀበት በመረጠው በአለፉት በዘመቻው በሐሰት ባለሃብቶችም በዩኒቨርሲቲ በፖለቲካና ቢገኝም በዕጥፍ ባንኮችና በሜጋ በአመለካከት በሚሰጥበት በኬሚካል በጉብኝታቸው በመቀላቀል በህመም በመግባባትና ብዛታቸው በቆቦ በከተማችን በፊልም በዘመኑ በፖሊሲ በየፊናቸው በማስተዳደር በሃያ በመጋበዝ ባይሆኑም በባህልና ቢሯቸው ባዛሩ በሽታና ባለመገኘታቸው በሣምንት ብለውም በመናገራቸው በተያያዙ በዞንና በተደነገገው በማንጣፈፍ ባህሉ በአረብኛ በአፅንዖት በጄኔቭ በመሸለም በገባበት በቀረበላቸው ቢያመለክቱም በትምህርቱ በመደገፍና በድርጊቱ በግርማዊ በፊታውራሪ በከፈሉት ቢሮአቸው በጉልበቱ በድምጽ በፈረንሣይ በማሰባሰብና በመሩት ባደረገላቸው በሦስቱ በከተማም በፊታቸው በባህላዊና በብሔረሰብ በአራተኛ በመጫን ባለማድረጉ በኢሮብ በትክክለኛው በቂላ ብልሃት በሚያዋስነው በመወርወር ባልተናነሰ ባለዕዳ ብያለሁ በማታ በልግ በማባዛት በኦዲት ባለቤቴ በተሽከርካሪ በእኩልነትና በቀረቡበት ባይገለፅም በትግሪኛ በሚሉና በዳግም በመረጃው በታሪክና ብልጥ በሕዝባችን በሀብት በሰበብ በመደበኛው በተፋሰሱ በቢሊዮን በመውሰዱ በረመዳን በጀትን በመረከብ በማደስ በማረም በተግባርም በእውነተኛ በውይይትና ቢሄድ በማራቶን በሆኑበት በመሪነት በቻርተሩ በእናቶችና ባርነት በመታከም በሐገሪቱ በገቡ በጥቃቱ በመከልከል በማንሣት በቤተክርስቲያኗ በመሰል በፕሬዝዳንቱ በኢቴቪ ባይቶ በማሰለፍ ባለማድረጋቸው በሚሆን በጅምር ብቃቱን በእስልምና ቡትሮስ በጥፊ ቤተሰባቸው በእስራትና በህዝብና በአጎራባች በሚያደርግበት በመሆኔ በሳይንስ በቃጠሎው በንፁህ በፍንዳታው በክፉ ባልደረቦቻቸው በገጠርም በፓርቲዎ