            amharicWords[13, 8] = "በፈቃደኝነት በግፍ በኢንቨስትመንት በመስቀል በተገኘው በጊዜ በበሽታው በዘገባው በሐዋሳ በጥናት በማቋቋም በተጠቀሰው ብጥብጥ ቢራ ቢሆኑ በመንገድ በከባድ በእኔ በውሳኔው በተመድ በዘንድሮ በተቻለ በደብዳቤ በጥልቀት በልማትና በተጀመረው በመመደብ ባህሪ በደረሰበት በተመጣጣኝ በወንጀል በንቃት በሰኔ በየቦታው በመተግበር በአባልነት ባሰሙት በውድድሩ ቦምብ በማደግ በግብርናው በህዝቡ በማንሳት ባለኃብቶች በመግዛት በማዋል በጉባዔው በዴሞክራሲያዊ ባይሆንም ቢል በደንብ በምርምር በበቂ በአካል በመረዳት በለንደን በመሳሰሉት በጣሊያን በጥንቃቄ በቴሌቪዥን በመጣስ በድሩ በቡና ባሳለፍነው በእርዳታ ባንክና በተወሰነ ባልደረባ በመጓዝ በነበሩ በኃላፊነት በሪፖርቱ በሽታውን በመኪና በማስተባበር በበኩሏ በወረራ በሙከራ በተቀናጀ በማሳየት በመምረጥ ባለሀብቶች በመሠረቱ በሕጋዊ በመረጃ በመምራት በሃገር በሀገር በሕወሓት በመከተል በማስረጃ በመሸጥ በማያያዝ በማን በማምጣት በመጠየቅ በፀረ በህገወጥ ባለሥልጣናትና በየወሩ በመቀናጀት በኢንተርኔት በሕክምና በወር በፕሬስ ቤቱም በመረብ በሚባለው በስነ ባለሙያዎቹ በማድረጋቸው በስምምነቱ በዘጠኝ በማሳተፍ በእርግጠኝነት ብለውታል በእንስሳት ቦታውን በትናትናው በማስተዋወቅ በሁለተኛው በሚጠራው በምሬት በሐረሪ ባዛር በህጋዊ በማህበሩ በጨረታ በመገኘቱ በአልጀርስ በእሥር በአጭሩ በፍትህ በመወያየት በተማሪዎች ባለሥልጣናትን ቦጋለ በምርት በማስፋት በፍፁም በእጥፍ በግምት በዓመቱ ቤላ በሃይማኖት ቢኖርም በክልሎች በማደራጀት ቤትን በሚሉ ባይሆን በናይሮቢ በኦነግ በመፍታት በመካከላቸው በሰባት በመቀነስ በተፈጠረ በሚቻልበት ቢዝነስ በሀገሪቱ በሚቆየው በኛ በግጭቱ በድምሩ በለጠ በአቅም በኤች ባገኘው በገቢ በሌለበት በችግር በደሴ በሚሊዮን በሀገራችን በጥቅምት በመሰብሰብ በማህበራዊ በውስጥ በመደበኛ በዓልን በባለቤትነት ባጀት በማናቸውም በዝናብ በመመለስ በአማካይ በመቶዎች በሌሉበት በመስከረም በማለታቸው በድርድር በሚኖሩ በማለቱ በማፍራት ባገኙት በአገልግሎት በስተጀርባ በእጅ በተቃዋሚዎች በጠቅላላ በመጠናቀቅ በሱማሌ ቢባልም በተመረጡ በነፍስ በሃይል በያዘው ባለሥልጣናቱ በበላይነት በዝቅተኛ በቤተሰብ በል በእለቱ በሆነችው በስምንት በማስተማር ባለስልጣኖች በእያንዳንዱ በተካሄደበት በሱማሊያ በመስኩ በመቶው ቤትም በመንግስትና በመደበው ብቸኛው በጽህፈት በቤት በደማቸው በሲቪል በግብፅ በሽታዎችን በደም በመክፈት በዕርዳታ በናዝሬት በመነጋገር በዋነኛነት በላኩት በጥቁር ቢኖሩም በሚገኙት በአሜሪካን ብላለች በወባ በሐረር ባንዲራ በተሰጣቸው በአርብቶ በግዳጅ በመጨመር በመሰማራት በሰላምና በወሰደው በመረጋገጡ በቃል በየዕለቱ ብርጌድ በቦሌ በአካባቢያቸው በመቀየር በተወሰኑ በተዘጋጀ በተለምዶ ቦንብ በኔ በነፃው በሳምንት በቦርዱ በዝምታ በጤናው በስም በመቻሉ በመሰረታዊ በተራ በተደረጉ በማጠናቀቅ በአርሶ በመዘርጋት በዕድሜ በንብረት በነዳጅ ባስተላለፉት በማድረግና በየመን በርከት በተያያዘም በጥናቱ ባላገር በምክትል በመጠባበቅ በቀድሞ በማለትም በተነሳው በእርሻ በጉጉት በአስተማማኝ በፃፉት በሚኒስቴር በእጃቸው በዘመቻ በወህኒ በነጻ በማድረስ በብሄራዊ በሚደረግ በሞቃዲሾ በቀጠሮ በኤርትራውያን በመክፈል በመገኘታቸው በመኖሩ ቢልም በጥራትና በመቆጣጠር በመደራጀት ቡድኑን በትሩ በሌለው በማገዝ በሠላም ብልሹ በቅኝ በባንክ በሐምሌ በፓርቲው ብዙውን በጎንደር በድንበሩ በድምፅ በእግር በየአካባቢው ብፁዕ በአዋጁ በሕገወጥ በምስጢር በአነስተኛና በማፋጠን በታላቅ በማግስቱ በዩናይትድ በምርመራ በኤድስ በመጠቆም በሰብዓዊ በማረሚያ በአልጀርሱ በማሰልጠን በአገራቸው በፓርላማው በትጥቅ በጉልበት በሥፍራው በተጓዳኝ በማመቻቸት ቤተመንግሥት በረቂቅ በሚባል በምትገኘው በቀስ ባልሆኑ በድህነት በማስመሰል በሚያስችሉ በተደራጀ በኢንዱስትሪ ብለውናል በፈጠረው ባለሃብቶችን በእስራኤል በርግጥ በህወሓት በመለስ በማመን ብቃትና በህክምና ባህታዊ በመጪዎቹ በሚገኙበት በጥርጣሬ በመፈፀም በአክሱም በመቅረብ በእኩልነት በገጠርና በኮንስትራክሽን በሚሰጠው በሚካሄዱ በተጠንቀቅ በአመራር ባለቤቱ በቆሎ በህይወት በእሳት ብሔሮች በየክልሉ በረሃ በማውገዝ በሊቢያ በሆነበት በአሁን በባህላዊ ብክነት በተሟላ በበጎ በገዢው በተመሣሣይ በተቃራኒው በጭራሽ በመንግሥትና ባይቻልም በመለወጥ በሃገራችን በኦጋዴን በግንባታ በእጁ በነሐሴ በማስቀረት ባላምባራስ በአምቦ በድብቅ በአሜሪካና በየአመቱ በላቀ በማስተላለፍ ባለባቸው በወንዶች በአውሮፕላን በስልጠናው በየቀበሌው ብርቱካን በየወቅቱ በፌዴራሉ በይበልጥ በሊዝ በፕሮግራሙ ቡልቻ በልማቱ በባንኩ በተከበረበት በህብረት በከፋ በጥር ባለመሆናቸው በመቆም በቀጥታም በአህጉሪቱ በአሸናፊነት በክረምት በዶላር በማገልገል በመታየት በመርህ በመገምገም በዞን በማሰማት በፃፈው በትውልድ በዴሞክራሲ በእውነት በፓሪስ ብሩህ በካርቱም በማቃለል በግብር በአስር በጊዜያዊ በድንጋይ በመካከለኛው በላቸው በመዘዋወር ባህርይ በመጣል በካናዳ በርሳቸው ቡናን በማሸነፍ በከንቱ ባህልን በብዙዎች በአብላጫ በዳርፉር በጠራው በግብርናና በንግድና በመማር ባደረጉበት ባልደረቦች በሩን በሺህ ቢታወቅም ባል በሳምንቱ ቤተሰቦቻቸውን በአለፈው በየካቲት በመፋጠን በሬዲዮ በአአድ በነገራችን በልደታ ብሔረሰቦችን በደረሰን በስብሰባ በትብብር በመቅረቱ ባለንብረቶች በጥቅም ባለቤታቸው በቃ በቀጣዮቹ በአመት በአፄ በሚደርስ በቅሎ በአውደ በቻይና በሠላማዊ በፍቅር በመፍራት ቤታቸውን በፈቃዱ ብሄረሰብ በመጀመርያ ባድመና በመጠኑ በሬ በሚገኝበት በረጅም በንባብ በራሪ በመስጠቱ በወቅታዊ በጋዜጣው በብር";
            amharicWords[13, 9] = "ኀ ኃይል ኃላፊ ኃይሎች ኃላፊነት ኃላፊው ኅብረት ኃይሌ ኃይሉ ኃላፊዎች ኅዳር ኋላ ኅብረተሰብ ኃይለ ኃይሎችን ኅብረቱ ኃይለማርያም ኃይልና ኃላፊነቱን ኃይለሥላሴ ኃይሉን ኃይልን ኅብረተሰቡ ኃላፊዎችና ኃላፊነታቸውን ኃብት ኃላፊነቱ ኃላፊዎቹ ኃይላችን ኃይላት ኃላፊዋ ኃብታዊ ኃይሎችና ኃላፊና ኀዳር ኃያል ኅብረትና ኋላቀር ኃላፊዎችን ኃይሏን ኃይለማሪያም ኃጢአት ኃይላቸውን ኃላፊነትና ኃሣብ ኅብረተሰቡን ኃይልም ኀብረት ኋላቀርነት ኃይሌን ኃይማኖት ኃላፊነትን ኃይለስላሴ ኃላፊነታቸው ኋላቀርነትን ኃይሎችም ኃዘን ኃይለኛ ኅብረትን ኃያላን ኃላፊዎችም ኅሩይ ኃላፊውን ኅብረቱን ኃያሉ ኃይማኖታዊ ኃሳብ ኃይሎቹ ኃይለሚካኤል ኋላም ኃላፊነቶች ኃብታዊና ኃይለማርያምን ኅብረትም ኃላፊነትም ኃይሌና ኀይለ ኅብረ ኅብረተሰብና ኃ ኃይላቸው ኅብረተሰቡም ኋይት ኃይሏ ኃላፊን ኅላፊ ኃይሉና ኀብረተሰብ ኃይለሥላሴን ኃይላትን ኅዘን ኀይሎች ኃይላችንን ኃይለመለኮት ኃይሎችንም ኅላፊዎች ኃላፊም ኅሊናን ኀልዮት ኀይሉ ኃይለኪሮስ ኃይሉም ኀብረተሰቡ ኃይሎም ኅዝብ ኅልውና ኅሊና ኃለፎም ኅትመት ኃሣቦች ኃብትነት ኅብረተሰቡና ኅብረተሰብም ኅብረቱና ኃይለማሪያምን ኃይማኖታቸውን ኅሊናዊ ኃየሎም ኅብረተሰብን ኃይላትና ኃላፊነታችንን ኃላ ኃያልነት ኃይቅ ኃይሎቻቸውን ኅይል ኃዘንን ኃይማኖቶች ኋላፊ ኃይለመስቀል ኃውልት ኃይሎችንና ኀዘን ኃብትና ኋላው ኀይል ኃብቷ ኃይሎቹን ኅብረተሰባችን ኃያላኑ ኃይለሥላሴና ኃይለማርያምም ኀሳብ ኃለፊው ኃጥያት ኋላቀርነትና ኅይሎች ኃላፊነቴን ኀጢአት ኃብትን ኀላፊ ኅበረተሰቡ ኃይቆች ኅሩይን ኃዘንና ኃይላን ኃላፊነቷን ኅብረተሰባዊ ኃይማኖታዊና ኃፍረት ኃውስ ኃላፊዎችንና ኀ ኃጢአቶች ኅሊናው ኋይል ኃይላይ ኋላቀርና ኃይድሮ ኃሣቡን ኅልፈት ኃብታቸውንና ኅሊናም ኃይለየሱስ ኃይሌም ኃዘኑ ኃላፊነታቸውና ኃይልዋን ኃላፊዋን ኅላፊው ኅብረቶች ኃሳባቸውን ኄር ኃይሎቻችን ኃይልንና ኅብር ኃዘናቸውን ኃያላንና ኃይሉንና ኃላፊዎችንም ኃይላቱ ኃይልነት ኋላማ ኅሊናዬ ኃይማኖትን ኃይለአብ ኃሣብን ኃብቶችን ኃያላኖች ኃይማኖቱን ኃላፊዎቹን ኃላፊእንት ኅዘንን ኅሊናችን ኃጢኣት ኅሳብ ኃይሏም ኃላፊነቶችን ኃሣቦችና ኅዳሴ ኃጢአቱ ኃላፊዎቻቸው ኀውልት ኃይለኞች ኃል ኅለተወርቅ ኅሊናውን ኅብረቱም ኃላፊነቱንና ኅቡዕ ኅገ ኃብተስላሴ ኃላፊነታችሁን ኅግ ኃብተ ኅበረት ኃላፊነቱም ኃርቃ ኋላቸው ኋላፊው ኃይለሥላሴም ኃላቀርነትን ኅዋስ ኅይሉ ኋላፊነቱን ኃይለጊዮርጊስ ኃጢያት ኃምሳ ኅቁር ኅብረተሰቦች ኅሊናችንን ኃጢአትና ኀዘንና ኃይማኖትና ኃይማኖታችንን ኃብቱን ኃፍረቱ ኃልዮት ኃብተጊዮርጊስ ኃጢአትን ኅሊናቸው ኃለማርያም ኃይለማርያምና ኃብተገብርኤል ኃላፊነትንና ኃይልች ኅበረተሰብ ኃያሉን ኃይለማሪያ ኃልፊ ኃይላችንም ኃጢአቱን ኀዘኑን ኃያልነትን ኀብረቱን ኃላፊዎቻቸውን ኃይ ኅልፈተ ኃለፊነት ኃይለኛው ኁልቆ ኅብረታችንን ኀሠሣ ኅጎች ኃያሏ ኃላፈነታቸው ኅሊናቸውን ኅያውና ኅሊናችሁ ኃይለማርየምን ኅሪት ኅልውናም ኀሳቦች ኀይሎችን ኃጢኣትን ኃጢአትንም ኃብቱ ኅሊናና ኅሩይንና ኃጢያን ኃይማኖትም ኋላና ኃይንላይን ኅብረተሰባዊነት ኅዝባዊ ኀዘናቸውን ኅብረተ ኃጢኣቶች ኃይልህ ኅዙናን ኃብታቸውን ኅብራዊ ኃላፊነቴ ኃይማኖቶችና ኅቡረ ኃጢአታችን ኃያሉና ኃይለስላሴን ኀላፊነት ኅብረቶችን ኃበ ኃጥእ ኅልውናችን ኃይለማሪያምም ኅዳርና ኀሳብን ኃይለማርም ኋይሎች ኅቁራን ኃይለማያም";
            
            amharicWords[14, 0] = "ነግሬው ንግግራችንን ነካክተው ንጆሮጄ ንብረትንም ነገሥታትም ኖሬአለሁ ነበርክና ናታ ነፃነታችንና ነጻነቶች ናምቢያዊው ንዴሌ ነቅለን ንጉሣቸው ነዋይን ነቀነቀና ነካዎ ኔትወርክን ኒኮል ናሲዮስ ነቃፊዎች ነክሰውበት ንህዝቢ ንብረታችሁን ኑሮዬ ኑሮሯቸውን ኒኪታ ንክሩማህ ናና ነፂነትንና ነበራቸዉ ነሽና ነጥሉን ኔራዚኒ ንባብን ኖቨምበር ኖርዲስክ ኔግሮስ ናርን ንቅናቄዉን ንጉሱንም ንኩርማህ ናፍቋቸው ናይልም ንጹሀንን ንፅህናቸው ነገሥታቱም ንቅናቄውም ነቆራ ነርስና ናትናዔል ነክሮ ነቅናቂ ኖርማል ነጸብራቆች ኖርወይ ንቢቱን ነባሩም ኑብያን ኔቨራፒን ናፋቂና ንግግሮቹ ኖራል ነፍሷ ኖም ንፅፅሩ ኒከላስ ነጠብ ኑፋቄው ናካዌ ንገሪን ነቅተህ ንቃቃት ኖታው ንጉሣውያኑ ንፅፅር ናይጀርያ ንኮሳዛና ንግሥናቸው ነገሶ ንግስና ነኝን ነቅንቅ ነንም ነዋሪዋች ኔም ነብይነት ነብርና ነፈዞች ነብስያ ንግሥቲቱ ንቅናቄዉ ኔፓል ነበሯት ንዴቴ ንግስቲና ነቅታችሁ ኔልስፕሪዩት ነፍጠኞችን ኖረዋልና ኒዉዴሊ ነጥፏል ኑሮንም ነቅሼ ናስኤር ነፈጋት ንዝህላልነት ንፋው ነበረውም ንጽሕናዋን ኔስካኒን ኖላዊ ኑብያ ነካክቶ ነሳቸው ኑራለች ንብረታችንና ንጉሤና ነፃነቷንና ነጥብን ነዓምን ናዳን ነሡ ነሆለል ነሩርከር ኖርዌ ነቆራው ነካካና ንትብ ንፁኀን ነሐሌ ንጉሱንና ንዝመር ነጠብጣብ ነጻነትንም ኑሮትም ነቅነቅ ንቅናቂያችን ኔን ናፖሊታኖ ኖሪስ ነጻብራቆች ነጠቃና ናፍቆናል ናታሻ ንጹሓንን ነቅታ ነጠቃመከፈቱን ንገሪው ናትኮ ነገሥታቱ ናይኪ ነውንዴ ኒዓም ንፁኃንን ነበልባልና ኒማኒያ ንቅፈ ናማጋ ነበራዊ ኔፓድን ንባቡ ነቅንቀዋል ንፍቅ ንጹህነት ናልባንዲያን ነበሩዋቸው ንግግሮቻቸውና ኒበል ነጠቅና ነስቷቸው ኑሮውም ኑረናል ኖረናልና ናርዶስም ኒዎ ኖርነው ንዶታል ንክሻን ነርቭ ነጠቅናት ነቀፌታዎች ናችሪ ንባባት ነሷቸው ነገሥታትን ንግሥናችን ንክች ንፁኀንና ኒብል ናድር ነስተን ነገስታቱን ናሁ ነበብ ነፃነታቸውንና ኔህሩ ነፍጓቸዋል ኗሪዎቹ ነበርበር ነፃነቱና ኑሮውስ ንብረቱም ንጹሑን ንግግርዎን ኖሮስ ንቁሪያ ንቄ ንባቡን ነፋሻማው ናዚን ኑሜሪን ነጻው ነፃነትየፍርድ ነካዎት ንሰሐና ናረ ንዋያቸዉን ነካኝ ነስቷል ናሲር ነጠቃዊ ናስ ነጻነቶችን ኑፋቄን ነጠቃው ነጥቤን ንፅህት ናዛዡ ነበረባችሁ ነገሥታቱን ነገረኝነቷን ኑሮዉ ናይጄሪያም ንጹሓን ነጣ ነውረኛነታቸውን ናፍቀናል ኖርዘርን ኖርዌጂያን ንጹሐ ንጣፎች ነገረቻቸው ኔማር ነሻጮቻችን ንብረቷ ነሳው ንጉሱም ኔቶም ነቃና ኔትወርካችን ነፍገሃቸዋል ንጉሥን ናጎያ ንጹሕና ነበርኩበት ንጽሕናን ነጠር ኒውክለር ንዴታቸውን ነከስ ናኖ ንባብና";
            amharicWords[14, 1] = "ነገረኛው ነቢት ናቸሁ ንስር ንባቤን ነሸ ናስርና ንቀታቸው ነፋሱ ነውሩ ነጠቃን ኑልኝ ንክሻ ነቀነቁ ናርዶስንም ናፒርን ነፋሻ ንቅለ ነገስታትና ነግራኛለች ነጥብህ ኑርልኝ ነጣቂ ኒና ንቅል ንግርቱ ነጠብጣቦች ኔትዎርክስ ነባሮቹም ንግርት ነጋዴነት ንቅዘት ናተይ ነጋም ነጥባቸውን ንግግሮችና ናጋሳኪ ናዋዝ ነጋሪው ናይጀሪያውናያን ነገርስ ንገረኝና ንገሩዋቸው ነዎትና ነሐሴን ኔቸር ኑሮዬን ንጥብ ነርሰሪ ነገረችው ንድፍና ኖሮማ ናቅሁሽ ናይዚ ነበረህ ኖሮባቸው ነግሮታል ኖሮም ነበረችና ንግሱ ናፍቆኛል ነአምን ንብርት ንፁህና ነገው ነፃነቴ ናፍታን ናቡከደነጾር ነቀዝ ንግግሩንም ንጉሡና ነፃነቷ ነክቷል ንቡረ ንብረታቸውም ንፉግነት ንዳው ኒውዚላንድ ኒጌሌሌ ኖራክስ ነገሮችንም ነቁጣ ነጋሲን ነጎዱ ነገርናቸው ነገሌና ንግድም ኒኮላይ ነህነ ነግሬያት ኖሯት ኒተል ንጉሥነቱን ነገሩንም ነውየውጭ ንትርኮች ነክቶታል ነግራት ነግ ናሻ ኑዛዜው ነጻንት ንቀን ንረትም ኔልስፕሩት ንፋሱ ንክሩማ ኖሪያለሁ ነበረዉ ነዳሳ ንግግርዋን ናይጄሪያዊ ነገዶችና ነጮ ነደው ነገረሽ ናቸውን ነጋሽና ኒተር ንክኪነት ነጠፋ ኑዋሪ ኔትወርክና ንዳበት";
            amharicWords[14, 2] = "ነጠቀ ንጡህ ነዷል ነጮችን ንግዳቸውንና ነቀፈ ንባባቸውን ንጽጽር ነግራኝ ነስሮ ናትናኤልና ንዴ ናቸዋ ነውጠኛው ነቅቻለሁ ናው ንድፎች ነፃት ኒቃን ንጂ ነጃሽ ነፍስህን ናይጀሪያ ንእማን ኔትወርኩን ንዱንዳ ነስተውታል ንጽሕት ነበረቻቸው ነፍሱ ንቅድሚት ንሥሐ ነፈሰበት ነክሼ ነቀምትና ነገሠ ነጋዴን ናዝሬትን ንግግራቸዉ ነፍሶ ነበሩኝ ንብረታቸውና ንቦችን ኑሯቸውም ነባራዊውን ነገሪ ንሰሃ ናኦድ ኖሬ ነጥቃ ነፍተው ንውህደትናን ነጠላና ነገሩንና ንጉሦቻችን ንፍገት ንጽሕ ነስቷታል ናፍቆቱን ንፅሕናውን ነውጠኞች ንመውት ነገርኳቸው ነደደኝ ንሥር ኑላንድ ኖርን ነፍጠኞችና ነዳጆችን ንጋቴ ነዋሪዎቸ ነብርን ነድፈን ንጋቷ ኖሯልና ንክሩማም ነቀፌታውን ንግሥና ነበረቻት ንፍጥ ንግግሮቻቸው ንቡረእድ ነደፉ ኑየርና ንስሀ ነፍጠኛና ኒሞኒያ ነፍሶች ነኝኮ ነጋዶ ነግሬ ንስሮቹ ኑሮም ናፍቆትን ንብረቷን ንግዷ ንረቱና ንጉሴና ኖኀ ነፋሻማ ንፋስና ኖኅ ነቀፌታና ነርቮሳ ኒውዮርክን ነስቷቸዋል ናሺናሊስት ነወር ንዓወት ኔሽንስ ነበሩም ኖማን ነፍሰገዳይ ኔታ ነደሳ ንጉሤን ነግራናለች ነፋሳት ነግደው ነጠቁኝ ንፋሳትና";
            amharicWords[14, 3] = "ነገሩማ ነጠሏት ኒኩሌር ናጫ ኔራ ንዴቱ ነፂነትና ነግሦ ነጃት ነፂነትን ነርሶችን ናፍቆትና ንስሃ ኖታ ንጉሶች ነግሬያቸው ናፎ ንስሮች ኑሮኣቸው ናትናኤልም ናፈቀኝ ነበራቸውና ንፅህናውን ናፒየር ነግራው ነፍቶ ንሕና ነ ኔትወርኮች ንክዋሜ ንዘላቂ ነክና ኖርዋል ነጥለን ነዋየ ናፒር ንላዕሊ ነባሮቹ ነጋዴውና ኔቭሰን ነገና ነፍሳቸው ንቡረዕድ ኒኒ ነፃነታችሁን ናትናያሁ ናሚቢያና ነበራ ንገር ኖሩም ነዝተዋል ነገሥታቶቻችን ንገሩልን ንጋቱና ናፍቆታቸውን ነገሮችና ንክኪዎች ንቃልሲ ነዳያንና ነግረውት ነቃጥበብ ነኛ ነገረኝነት ንግሡ ናህያን ንጉሱን ንግድንና ነዲድ ነብሮ ነብሲ ነጋሺ ነብስ ንሮ ነብያዊ ነጸብራቅ ኒውተን ንግሥትና ኖረውም ነኛው ኑኩሎ ነፃነቶችን ነሲብ ኑሮአችንን ነፍሳትን ነሱስ ኑርዋል ነንባዕልና ነበርሽ ነጂ ናችሁና ንዴቶች ንግዳቸውን ነውርን ነፃነቴን ናቄ ናቅፋም ናዲያ ነሔሴ ንግዳችን ንጹሃንን ናብራ ንብረቴ ነባራዊው ናይጄሪያውያኑ ነህምያ ነብያችን ኑረው ናቲ ኔሽንን ኔሩርካር ነባሮቹን ነፍጠኛው ነክተው ንሓደ ነደዱ ነቀርሣ ነባሪ ኗሪው ንግስቲ ነጻነቱ ነግረናቸዋል ናርዶስን ንጽጽሩ ኖረች ነቅተን";
            amharicWords[14, 4] = "ነብሳቸውን ነጋዴም ነገርየው ነገረን ነበሯቸው ናሆም ኖርዝ ነበርህ ንፍሮ ነቀነቀ ነፍሳቶች ነብርም ነቃፊ ነግሮች ናዚስቶች ነቢያትም ናታሊያ ንረትና ኖርዌይና ነፍሳት ኑሮት ንብረቶችንና ንገሩን ነንና ንፋስም ንግግሬንም ነቅሰው ናሁሰናይ ናቸዉና ነዋሪነቷ ነቶም ነገሥታትና ነጥረው ነገሬን ነግረውታል ነጣጥሎ ነብሰ ነግሮን ንፅህናው ነገርግን ነፍሰጡሮች ነፃነቶችና ኖረም ነግሮኝ ነዚ ንግግራችን ንቃ ነበራችሁ ነጻነትም ነጥቦቹ ነክቶት ናይጄሪያዎቹ ነቢየ ነቅፏል ነችና ንዝረት ናይትሮጂን ንቀትም ነካችሁ ንቅናቄውን ንክኪዎቻቸው ነጫጭ ኑረዋል ኒሳን ንፉግ ነትስ ነጻነታችን ነዳጅም ነቢያትን ነገሥትና ኖቶቹን ናፖሌዎን ናይጄሪያዎች ንበረት ነፋስም ነገረችን ነፍስህ ነግራን ንፅህናና ነገርኳት ናይሎ ኒዎርክ ንምዕዋት ኖሬያለሁ ንጹህና ነቃቅሎ ንፋሳት ነጭን ነጋንና ነስተው ነባሮችን ናቸወ ናፈቀችኝ ነቀርሳን ንብረቱንና ኖሮኝ ነሥቶ ነጋዴውም ኖረን ናፔር ነጋዶች ኑሯችንን ነገዎና ነጥቦቹን ንገራቸው ንቅናቄዎቹ ነገሰ ንቅናቄዎችን ናዲም ናዚዝም ናጊ ነገስ ነብያት ንቃታቸው ነገሮቻችን ንቅናቄም ነጥቦቼን ነጥቦችና ንብረቴን";
            amharicWords[14, 5] = "ኔትወርኪንግ ነግረዋቸው ነጋሪ ንግግሮችን ነጥብም ንም ነብሴ ናኖቴክኖሎጂ ኑዌር ናፋቂ ነጎደ ኒውስን ናታን ነገሩት ነዋሪዎቿን ነገድ ነጻአውጭ ኑራ ነጥባቸው ንጥቂያ ኖኤል ኑሮአችን ናታሊና ነዋሪዎችንና ናፋቂነት ነገሥትነቱ ኖሮን ንገርልኝ ንግሥቲ ንድ ኔርና ነገረችኝ ነጃሺ ነገሥታቶች ነፃነትንና ነገሡ ነጥቄ ኖቤል ነባቤ ነውጠኞችን ኑራቸውን ንቅናቄዎች ናይጄሪያውያን ነብይ ንዋዩን ናታል ናይጄሪያዊው ንሯል ነቅተው ናዚዎች ነዳጁን ነበርኮ ንግግሯን ነገርዬው ነዳጁ ንፁሃንን ናቅፋና ንዋይን ነዋሪዎችንም ነሐሴና ንኩሩማህ ነብሮች ኒዮ ነዉ ንጉሥነት ንሳ ነጩን ነገርኩት ነህን ነጎድጓድ ነውርና ናትናኤል ናዛዥ ንቅንቅ ንዳድ ነፍስና ኑሪ ነጊሾ ነፍስን ነይሩ ኑርሁሴን ነግሯቸዋል ነገራት ንና ነውኮ ነርሲንግ ንፁሀን ኔታንያሁ ነግረውን ነፍሷን ኒጀርን ንትርክና ነስሩ ነጠቅ ንባዕሎም ነበሩን ናዚ ናዲ ናቪጌሽን ናቸውም ነጻነትንና ነገራቸውን ኖር ንዴቱን ነክሰው ናይጄሪያውያንን ኒውዴሊህ ነደፈ ነጋድ ንብረታቸውንና ነግሮ ነክቶ ኒክሰን ንጽህናና ነድፏል ንጽህናን ነቀፌታን ኖ ኖኖ ንብን ነጌሌ ናጽነት ኑሮዋቸው ነጻነታቸው";
            amharicWords[14, 6] = "ኒቆዲሞስ ንረቱን ነገረኛ ነዳጅን ነግረው ናይዝጊ ነዎ ንጉሡን ንቆ ነይ ነጮቹ ነዶ ነቅዐ ንዋየ ንብረቶቻቸው ኔትወርኩ ነካው ነጭና ነግረውኝ ነክሶ ነገሥትነት ንጹሐን ነገሮችም ንዋያተ ንጹሀን ነዋሪም ንግግሯ ነበረችው ናዚፍ ኖቶቹ ኒዘርላንድ ንግግርን ንብረታችንን ነገርማ ነገን ነበርም ናሙናዎችን ነቅፈውታል ነበረባት ነግሮኛል ነወ ናፋቂዎች ነሲቡ ኒያላና ንብረትነታቸው ኖራለች ንፅህናን ነቀፉ ንፁኃን ንጉሳዊ ኒልሰን ናትናኤልን ንቦች ነገርነው ነዋሪውም ነገሬ ኖረናል ነጥበ ንጉሣውያን ነካቸው ነስቶ ንጽሕና ነግር ነካህ ነዋሪዎቿ ነገራቸው ነሀሴ ነገረኛነት ነገዶች ንገረው ነፃነትም ነርሱ ንብረቶችም ናንሲ ናርዶስ ኒያምቢ ነጋሦ ነብሩ ኖኪያ ኒዮርክ ነዋሪነታቸውን ነፃነታችን ነባሩን ኑክሌር ናሚቢያ ነቃዓጥበብ ንጹሃን ነበርኩኝ ነወይ ነፈሰ ንጽህናው ናፅነት ንገረን ኑሯል ነውረኛ ነጥሮ ነጋዴዎችንና ንኡሳን ናይሮቢና ንብረትነቷ ኑሮዋን ንብረቶችና ነርሶችና ነጋሶም ነመራና ኑግ ንቃትና ናፈቀን ነፍሴን ኖሮአቸው ኔቶ ነበረብህ ንዴትና ነጂብ ነድፋ ነበርሁ ነቄ ነገሥቱም ነብሱን ንፍቀ ናግሽ ነዋሪነቱ ናይጄርያ";
            amharicWords[14, 7] = "ነጋዴውን ነት ናፖሊዮን ኗሪዎች ንብረትም ናብ ነጥቀው ነጻነትና ነጥቆ ነግሮናል ኑሩ ኑሬ ንቅናቄያችን ንጉሣዊ ኖራ ነበሩበት ነኝና ኑሯችን ኔስል ናሙናዎች ንጥር ነቅአጥበብ ነቢዩ ነቀፌታ ኑሮው ነገሥቱን ንብረቶቹ ንግግርም ነግረውኛል ንግሥተ ናፍታ ነፍሱን ኒኮላስ ነፃነቱ ነገረው ኒያላን ነህና ነጠላ ነበሩት ነፃነታችንን ነጋዴዎችም ኖሩ ነበረብኝ ነገርና ናትና ነዉና ነቀምቴ ነገዎ ነገራችን ነጋን ነዋሪዎቹን ነቀርሳና ናደው ናዥ ነጥቡን ነገረ ነገስታት ንቃት ንስሐ ንብረታችን ንብረቶቹን ንቀትና ንብረቶቻቸውን ንግሥ ኑዛዜ ነጮች ነፍጥ ነጋሶን ንጉሡም ነፍጠኞች ነመራ ንቃተ ነግሶ ናይቲ ነፃነታቸው ናፍቆት ኑሮዋቸውን ነግረዋቸዋል ነዋሪነት ነዳጅና ንው ኑና ኒያላዎች ነፍሴ ኖረ ኔሩ ኑፕ ነበርክ ኑረዲን ነውጠኛ ናይጄሪያን ንግስ ነፍሳቸውን ንኩርማ ነጥለው ናይልን ነቅዓ ነጻነታችንን ንግዶች ነፃነትዋን ኒውስሌተር ነጻነቱን ነጻነቷን ነገሩም ነጥቡ ነቅለው ናይት ኑዌሮች ንግግሬን ነቃ ነካሽ ነበረና ነዎት ነጻነታቸውን ነካ ንገሩኝ ንቁና ንግዶችን ነጋሳ ነጩ ኖርማን ነባሩ ንቀው ነገሩኝ ነበሩና ኖህ ነጋዴና";
            amharicWords[14, 8] = "ነገደ ንግሥት ንጽህና ነፋስ ንባብ ነብር ኖሮት ነገም ኑሮውን ነፃውን ነበረኝ ኒው ንቅናቄን ነዋ ኑሯቸው ነውን ንክኪ ነበረብን ናስር ኑሮአቸውን ኑ ነጻና ንዋያቸውን ንፋስ ኖሯል ናሙና ንዑሳን ንግግሮች ነቅዐጥበብ ነፀብራቅ ነፃነቱን ንብ ነጋድራስ ንፅህና ኒታ ኔዘርላንድስ ንግዱ ነጥብና ነዋሪነታቸው ኖሮዋል ነፂ ነጥሎ ንገረኝ ነፂነት ናሽናል ንግግሩን ነውር ኒጀር ንድፈ ኔፓድ ንግዱን ንብረትን ነግረውናል ነፃነታቸውን ንጋት ንትርክ ነገረኝ ኒሻን ነሐስ ነዋሪውን ነጋሪት ነቅሎ ነድፈው ነቅዓጥበብ ነብዩ ነውጥ ኖረው ነዋያቸውን ንጉሱ ኖረዋል ነቲ ኔልሰን ነቀምት ናይጄሪያና ኗሪ ኑሮና ንድፍ ንጹሕ ነቢል ኖቶችን ንጉሤ ነርስ ነበረን ናዳ ነጻነትን ንጉሦች ነገርም ነቅቶ ኔትዎርክ ንኡስ ነፍሰጡር ኖርማላይዜሽን ነርሶች ንፁሐን ነፍጠኛ ንግግሩ ነውም ኒክ ንቅናቄና ኑሮን ነግሷል ነጠቃ ናፍጣ ንግግርና ኑሮአቸው ነውንጂ ነፃነቶች ናቸውና ንረቱ ነዋሪና ነገሌ ንዴት ነቅሶ ንጉሰ ነገስት ነጋሲ ነበራት ነቀፋ ንብረትነት ኖቬምበር ንፁሕ ነቅፈዋል ናቅፋን ኑፋቄ ነቢይ ነጋና ኖሮአል ናችው ንገሪኝ ነቢያት";
            amharicWords[14, 9] = "ነ ነው ነበር ናቸው ነገር ነጥብ ንግድ ነፃ ነሐሴ ነዋሪዎች ንብረት ነፃነት ንግግር ነበሩ ነዋሪ ነኝ ነገ ነጋዴዎች ናት ነን ኑሮ ነጋሶ ነገሮች ንቅናቄ ኖሮ ነጥቦች ነጋ ነጻ ነዳጅ ኒውስ ነች ንግድና ንጉሥ ነባር ነገሩ ነውና ንዑስ ነዋሪዎቹ ነበረ ነዋሪዎችን ናቅፋ ነበረበት ንብረቶች ነጋዴ ንጉሠ ነፃና ነህ ነጻነት ነገሮችን ናይሮቢ ነክ ነጭ ንብረታቸውን ነበረች ነገሩን ን ነድፎ ንብረታቸው ነጋሽ ነበልባል ና ንቁ ነፍስ ነገሥት ናችሁ ኒውዮርክ ንጉሴ ናዝሬት ነፃነትን ናቸዉ ንፁህ ንግድን ንዋይ ነበረው ንረት ናይ ንጉስ ኑር ናይጄሪያ ነዋሪው ነገሥቱ ነጋዴዎችን ኖቶች ነበራቸው ነዋሪዎችና ነፃው ነበርና ኔት ነፃነትና ንግግራቸው ነጋዴው ኔትወርክ ነጥቦችን ንጥረ ኑሯቸውን ንጣፍ ኖርዌይ ነጋዴዎቹ ኔሽን ንጉሡ ነጋዴዎችና ነባራዊ ኒያላ ነፍሰ ኖት ንግግራቸውን ንጋቱ ነበረባቸው ነቀል ንብረቶችን ንቀት ነቀርሳ ንጹህ ነገርን ናይል ንብረትነቱ ንብረትና ንግስት ነበርን ነሽ ንብረቱ ነሃሴ ኖሯቸው ነገሥታት ነባርና ነፃነቷን ኔዘርላንድ ነዋይ ነበርኩ ንፁሃን ነዋሪዎችም ንረትን ንብረቱን ንቅናቄው";
            
            amharicWords[15, 0] = "ኘ ኛው ኛውን ኛና ኘሬስ ኘሮግራም ኘሮጀክት ኘሬዚዳንት ኘሮጀክቶች ኘሮፌሰር ኘሬዝዳንት ኘሬዚዱንት ኛቲኦናል ኞኞ ኘሬዝዱንት ኙን ኛመደበኛ ኘሮግራሞች ኘሮግራሞችን ኛ ኛንጋቶም ኘላን ኘሮግራሙ ኘሮጀክቶችን ኛዋ ኘሬዘዳንት ኘሮፖጋንዳ ኛዋን ኘሮጀክቱ ኘሬዚዳንቱ ኝጌሎ ኘሮጀክቶቹ ኘሬዜዳንት ኛቲኦን ኘውስ ኛነት ኘሮፌሠር ኛዎቹ ኘሬዘዱንት ኘ ኝም ኘሮፖጋንዱ ኘርሰንት ኘትዎርክ ኛል ኘሮግራምን ኘሬስና ኛንግ ኛምባ";
            amharicWords[15, 1] = "እየቅል አትጣለኝ አስተዋእጾ አፈሯን አስገብቶዋል እያንቃረሩ አልተንፀባረቀባቸውም አጠናቅረዋል አጭቷል እየደወላችሁ እየተገዛን እያሳለፍነው አልሆንኩም አሠሪዎቿ አለመሠራቱ አሟምተው አካፋዮችና አጣፍጦ አበዳሪነት እየገሰገሱ አሠሪዬ አይቀለብሰውም አናግረው አላሳብም አውጀውልናል አሳምነውም አልሞከርኩም እያሴረ እየተነቃቃ አስገርመዋል አንገፍግፎአቸው አንደሚከተለው አስረሽ እየተነፈሱ አትቸኩሉ ኣናገኝም አልአፍያ አላሰኛቸውም አልተባልኩም አልቀይርም አድንኀለሁ አልብሰው አያስደነግጥም ኣውጥቶ እያስቆረጠ አቻና አብቅተውታል ኢፍዴሃግ አትረዳትም አትነግድ አጥብቃችሁ አስተውላለሁ እድላችሁ አራዳዊ አስቀምጬ ኡጅሉ አልመርጥዎትም አድነዋለሁ እያስደገፍሁ አይሸፈኑም እየተቀቡ ኢሶዴፓ አሃዞቹ እየተገለገለበት አለማየታችን እየተካሄዱበት እየተላቀሱ እየተሳሳቁ እያስደገፈ አድርጋለሁ እያስደገፉ አያከብራቸውም አልወጣሁም አሳጥተውታል አላማችው እያንደረደረ ኣስታራቂ አልጫ አሎር አጮሁት እየተዋረዱ እየቆረጥክ እየተዘጋባቸው አንዘርዝሮኝ አማከል ኣለመናበብ እየዳከረ አስተናግደነዋል እያቀደች ኢንተርኮንትኔንታል ኣያሰጋም አስመልቶ አያውቃትም አልሞሉም አመጣለት አቆራኝተን አመታታ አበላሽተሸ አዛዥነታቸው አቁሜያለሁ አዛውንቷን አሉባልታው አስነባኝ አሳሯንየሚያሳያት ኢራንም ኢምፓዬር እየተበረታታ እያቅራራ አቡናት እያሽከረከረ እዪ ኣንቀበልም አባቶችስ አስተያየታቸውንና እየገደላችሁ አቆይተን እያነጣጠረ አይታሰበኝም እየነሳን ኣሽከር አለማስተካከሉ አንሶና እያበረታቱ ኣውቃለሁ እግ ኢስላምና አሎት አልቆባቸው አነባለኹ እየተፈረደባቸው አድርቶ አጠናከሩ እየፈራረሰች ኦሪ አጠበቀ ኣይመስሉም አሸባሪን አጋልጦል አለመሰማቱ አኒህ ኦአርኤስ አታሣንስም አክቲቬስት አጮልቄ አኀዛዊ አጋርነቷን አሁኑም እየጎለበቱ ኢኮኖሚውና አያሳየንም አንቡላሶች አይገርማችኹም አያውቁትምና አብራሞቪቹ አትከልክሏቸው አልተባበር አየርን ኦቲ አቀርበዋለሁ አስረዳለሁ አኝከህ አሰሱን እያረጀ አሰናበተው አርዓያና አንስታለች አፋፍሰው ኦኒ ኣስፍታ አስረዷቸው አተገባበሩም አታየኝም እየተቀባበለች አገሮቸ እያረገ አርማውም እያባሉ ኦኩ እያስነበበን አቀፉንም እያባላ አቀዱት አራጋቢ አላመጣንም አልቤን አስታጥቄም አያሳዩ አይመጣ አይፈቅድልንም አፈላላጊው አባትነትና እየቀረደዱ አልመጣልኝም እየረዘመ እየጠየቃቸው አመዳይም አልተጠራንም አለነጻነት አፈጻጸሞችን አስረግጣ አልሆንለት አንሰላሳዊው ኢንዱስትራ አይሟላም አጥሩም አሳብያን እያስከፉ ኡሎንግ አላስፈራራም እያበረታታና አክሽንኤድ አልሳቃችሁም እያሳወቅን አናወራም አየህልኝ እየጻፍን አልመጣህም እንዲያስተባብሉ አምሳያ አለባብሰን እንዲዘነጋ እጹብ እንጋት እንዳይጫወቱ እነአባ እያማረረ አናየውም እንረባረብ እንደተቋረጠባቸው አላጋጠመኝም እፈታለሁ እንደፍራቻ አጠፋን አረመኔው አልቄዳ አላሰቡም እጣን እጅዎን ኢርፎን አደርገዋለሁ አስቸጋሪው እመኝላችኋለሁ እንደሚገነቡም እስከነጭራሹ አስነብቦ እንዳይደርቅ እስካልተመለሱ አስተዳድራለሁ አበጋዞችና አስመሳይነት አዚም አልነበረምና አሳድገዋል አደላ አመሳስለው አንብቤአለሁ አካፋይ እያስፋፉ እፈልጋለሁኝ እንዳይጫወት እራስመስ እንዲቀጥሉም አላቀርብም አደማ እንዲያስይዙ አገነባብ እናትየው አጥናፉና እያስገባች አስከትለውም እናሣስባለን አሳዝኖ አሪድ እግዚያብሔር አመዛዝኖ አሠራሩም አደስ አትቁረጡ እንደምታስወጣ አነጋግራለሁ አዘዘው እየፈሩ አላስገባ አይሰበርም አቆቁዋም አሰኛቸው እያሰቡበት አንጠልጥሎ እንዳልተቻለም እማወራዎችን እርሻም አሠርተው ኢኮኖሚዎች እያገዙ አልጠየኩም ኢልደሬት እንድ