            amharicWords[15, 2] = "አሳጥቶኛል አንባልም አስቢው እድሚያቸው አዝማምያ አለመገንባቱን አባነሻ እየሮጥኩ አትናገሪ እየቀናቸው አምባገናነዊነትና እየተሸከመ አለመቀነሱን እያዘጋጁና እየደገመ አላርፍ አይታክተን አልፈርድባችኹም አለመቅሰማቸው እየነዳሁ አስደምሟል አርሊንገተን አሳስታለች አለምላሚ አትስጡ አይቶም እየደጎመ አልከፈሉ ኢትዮቻናል አብዛኞችን አምባነንነት ኢዶሳ አልተሰበሰበም አርሦአደሮችና እየቀሰሩ አግሎና እየጻፍኩ ኣንድምታ አምላኪና አይደንቃችሁም አሽከርካሪዎቹ አለመኾኑ አጋጨን እየተስለመለመ አደመጥኩ እየያዘች አይሰጣቸው አሻሞ እየነገረችን አይሆንለትምና አልገረሞትም አሥርታት እየገደልን እየተጣራን አዝኜላቸው አይባልምና አሻሮ አትዘግቡም አልቻሉምና ኦርሞችንና አለችውና አቀራረባቸው አንጓች አያሳካዉም ኣንስተው አላሁአክባር አገልግሉ እየገበሩ እየከወነ አልነበረበት አላስፈለገውም አልተጠጋቸውም ኣለብህ አውዳመቱ አስረነው ኣወጣና አሳንሷል እየሸመኑ አምሳለም እየታየሁ አጧጡፈውታል አልጨረስኩም አሰላላፉን አበላሽቶት አውዳመት አበርታ እያያያዘ እገቡ እያነፈነፈ ኣላት እየተናቆሩ እያዋዙ እየረገመ እያዋዛ አልነበራቸውምና አሻቦ አያገኙትም እየያዘና አልተቻለንም ኣባሮ አፍሳሹ አሜሪካዊያንና አላወጣንምን ኢህአዴጋዊያን አድቅቆ አቀላቅለው አፍሳሽ አለመገረዝ አልቤርቶኒ አይታዘንምም አላቀረብኩትም አድኖታል አይናቸዉን አርጅተዋል አጋሩን እየተቀናጀ አንዲነሳበት አልታመመም አጽንቶ አስገርሟቸዋል ኣስፋልት አልናት አጋድለዋል አንዳይነበቡ አራክሰው አውድአመት አልደርስ አሳልፈህ አሰልጥነውኛል አውሮጵላን አብዪአዲ ኣስገቡ እየታረዘ አይሰተዋልም አዘግይቶታል አልመክራትምም አጣሁበት እየሸጥን አቡበከርም አቀላቅሎ እየተስፋፉና አስቁሟቸዋል አግራሞትና አርበኛን አራማጆችና አጣቅሳችሁ አድርጋን አሰባስበዋል አውልቅ አልታፈንም አኩሪው እድሜችሁ ኣባት እየታየም አሏቸዉ አራግፎአል አስመስክሩባቸው እየታገለም አልተነፈሰም አስተላለፈች አራጋቢዎችም አልበሙና ኢሊኖይ እገው አጋጣሚዎችንም አሻሻጮቹ አለማወቃቸውንም አካውንታንቶች አካሄድንም አለማወቋን እያወቅኩ እየበላቸው አብዛኛቹ አካሂደውታል አስገብቶት እየተቆረጡ እያስገኘለት እየተስፋፋም ኦሮሞነታቸውን እያነበብኩት አኗኗሯቸው እያቆራኙ አርሶደሮች አያሻኝም አሳንሰውና አፍኖናል አቅልጠውታል አሌንታ አጫጭርና አስደምጠናል እየታረዱ አልሰማህ አይጠበቅምና ኣያስችልም አውድማዎች አመሻሹን ኣላወቀም እያንፀባረቁ ኢራናዊው አስተዳድርሃለዉ አግሏል እየተሷሷሙ ኣይቀለበስም አጣርተናል እየሸጥክ አምጥቼያለሁ አይተናልም አፍላጦን አይለጥፈው እየረዳችን አንደበታችን እየተጋጨ እንዳልተቀበለች ኤጄንሲዎች አጋቾቹ አውነት እንዲያይላቸው አምስትን አስደመመኝ አናምናቸውም አይስክሬም አሬና አይከለከልም አልነግራችሁም እንደገፋችበት እየተመራን አብዱራሂማን አልተማርኩም አረአያ እሱዋን አሳትሞታል ኢንተርሃሞይ አትሌቶቹን እንሰማ አሰልፈን አፈራረሰ አገኘናት እንደተያዘና አራግፈው አሳዝኖታል እየተገለገሉባቸው እንደሚያስከፍለው እንደደረሱት እንዳለፋቸውና አልተደረገበትም እንደዚህም አዉሮፓ ኢማሞችም እንዲያስወግዱና አርሶአደሮችም ኢዴሃቅ አባቶቻቸውና አካውንቲንግ አንደገለፁት እንብርት ኢኒሼቲቩ ኦሊቨር እንዲሰምር አልጠራሁም አይመታም እንሂድና አቀብለኝ አድሃነ እየገደለና አሳዝኖኝ አባቶቹን አልችለውም አባቶቻቸውን አክባሪነት እያፈረስን አጀንዳን እንደሚገመግሙ አንድምታና አትጠራጠር አቅንቷል አፈራርሷል እንዲበላሽ አሳዘነው አይመቹም አትተባበሩ አዲሲ አስተናጋጆቹ አርመን እያስጠነቀቀ አጥርቶ አርሃ ኤጀንሲዎችና እንዲገመገም እቶን ኤሽያና አውራሪነት አንገረብ አሰቃይቶ አስርም አምባሳደርነታቸው ኢትግሬዎችን አስተዋፅኦም አገሮ ኦርቺድ አውጪነት እንደተረከቡ እንቅስቃሴዎቹን እንደመሆንህ አምራቾችንና አጠናቃ እየተወሳሰቡ እንደሚሞክር እንደማስታውሰው አልባትም አልወረደም አግደዋል ኦያያያ እንደሚያስመዘግብ ኢአግን እንቆጣጠራለን አረጋውያኑ እናቆማለን እንደባድመው አልተቀበልንም እንደሚፈጠሩ አይሆንብንም እንደሚያሳስቡ አንዷለምን አኖኡግህ እንደማይመለከቱት ኢትዮጵያውንን አህሎኝነት አልመልስም እነዚያም እንደዋንኛ እንቋይን እያመሰገንኩ አሳድጎ አንጋጦ እንደፈጠረባቸውም እየመነዘሩ አስቸገረ አይነጋም እልቂቶች አልአሙዲንን እንደላከ እየተገነዘበ አልባሳቱ እንደላኩ አይሮፕላኖችና እንደሚሞቱና አለመድረስ አሻቅቦ እንድጠራጠር እየሾለኩ አርቲ አልቤርቶ እንደገለጡለት እንፈታዋለን አይመኝም አልተቀበሏቸውም እንዳዘጋጅ ኢንቨስተሩ እንደሚያስፈልገውና አምባዛ እንዳትወጣ እንዳመለጡ አስተውለን አባሉን እንደማይሰጡም እንቅጩን እንጠቀምበት እንዲሠማራ አህያና ኢቨንት አህያን እየተገመገመ እስኪሞላ እንደተካው እንደሚመነጭ እንዳያደረስ እንዳስቆጣው እንደተማረኩ ኤሪያል አያንቱ አይወድቅም አርኮ አለመፍቀዳቸውን አረመኒያዊ አምላኪነት አቁዋርጦ አቅርቡልን አቋማቸውንና እየለቀመ እንዳልደረሰኝ እረዳት እንዲወረስ አገዛ እንዲቀጠፍ እንደሚተርፍ እንድንረዳ አሏችሁ እቆያለሁ እንድትቆም እንዳያዘናጋን እንዲመለከተውና አጭተው አድማቂ አገድ እንዲያረጋገጡ እንደሚከብድና እንጽፋለን እርግብ አከባቢውን አዛዦችም እንዲፈፀምና እጨምራለሁ አንጌቱ አንጻርም አቅሜን እነርሱማ አስርና እነደነበር እንድታነሳ አርያ እልካለሁ አስተናግደው አላአግባብ እዬታገሉ እንሥሳ አመሉ እያነጋገረች እንዲፈቅድላቸው አድብተው አዳሬ አባረረች አዳር አጉማ እንዳይታሰር እየተንገራገጨ አልዩም አስቸገረን አስተላልፋለሁ አልኮልና አያገባንም እያሳተሙ እንዲዋቀሩ ኤጋል አውቀውታል አቁስለው አናርኪስት አይችልምም እያፈናቀሉ አሰብሁ አስጨንቀው አላማዬ እንፍሉዌንዛ አያስፈልጉም እያንዳንዱም አመሸ እየተጠቃ አንስተኛ አንደምታ እንዳጋለጠው እንዲከሰሱ እርምጃዎችንም እንደሚወያይበት እናርማለን አሻሽሎታል አያነቡም እያማረጡ አሕዛብን እንዲሰራበት አቪያንና እንደሚቃለሉ ኣይገባም አምርረን አትመነው አውራጃው እየነቁ እንደተሸኙ እየነቃ አፈሩን እሠራ አርፋ እንዲገጥመው እንዳልተገኘለት አሠጣጡ አይረቡም አውጃለች እየተንቀሳቀ አላደረገውም እከተላለሁ እንዳንወስደው እንደሚያምንበት እያፈገፈገ ኢሳያሳውያን እንዳይስፋፉ አዳኙ ኢንስቲቱዩት እደገለፁት አእምሮዬ እስኪመስለን እንደሚባለዉ አድማን አዘንሁ አስመርጦ አንዱችም እንዝመት እንድትገቡ አስተላልፎበት እፋለመዋለሁ እንድቀጥል እስቴስ አላውቃትም አስረዋቸዋል ኢፍትሃዊነት እያስወጣው እንዳደረጋት እንዳያካሂድ አላማጣ እንዳይደራጁ እንደሚሆንላቸው አገልጋይና እንደማዕከል አባዱላ አልታወቀም ኢነርጂ ኢየሱስ እንዲቀርብ እናቶች እስቲ እርምጃዎችን አክራሪ እየተንቀሳቀሱ አግኝተዋል እየተመዘገበ አዘጋጆች አብያተ እንዳይሆን እንዲያቀርብ ኢንስቲትዩት እንዲሰጠው አለና አትቷል አራተኛ እሴት እንጠይቃለን አርበኞች አመራሩ እያሳየ አብዶ ኢህአዴግን አይመስልም አትክልትና አባላቱን አግባብነት እጁን አደሮችና እያደረገች አስተላልፈዋል አመፅ አያውቅም እንዲፈጠር አዋቂዎች አልሆነም አባላትም እየሰጡ እንደማንኛውም እቃዎች አበባው ኢንዱስትሪዎች አምባሳደሮች አጠናቆ አያይዘው አገልግሎቱ አላት እትሙ አካላትን አሰባሰብ እስረኛ እንደሚጀምር አውጥቶ አብረን አብዲ እየተስፋፋ እውነታ እንዲቀጡ አስታውሶ አሜሪካን እነዚህም አገሩ አሰራሮችን እናም እስ