            amharicWords[15, 3] = "አካሁዋን አልተጻፈም አመቻችተውለታል አሰልጣኙና አመክንዩ አልነበረባቸው እየገፉት አስተማማኝነቱ አይቸገርም አስቶንቪላን አፍርሶና አመናቸው ኣይታወቅም እገጭ አማሮችም እያሞቁ እየተነገረን አያቷ አምባፈነናዊ አንታረቅም አንደኝነትን አናነሳም ኢህኣዴጎች እየተንሰቀሰቁ አፈጣጠሩ እያስተባበረች አሳየሽኝና ኢትዮሚዲያ አይከራከርም አድሮች እየያዘው አትሌቱም አላስተዋልንም አይፈናቀልም እየተቸበቸቡ እያበከቱ ኡንድጉ አልተጠቀምኩም አልተነቃነቀም አነጋግሮአል አሐቲ አቅኚዎቹም አጋንንትን አላዋጣንም ኣንድነታችን አሚካላ አጥኚዎችን አንረሳም አትራቁ አለማመንና ኦውን አስገባሁት አሳልፈሽ አበባቸውን አንደጠላት አኩይ እየተንደላቀቀና ኣሜሪካ አያሳፍርም አሜሪካኑ አይታተሙም አላንገላታም አሜሪካዊና አልደግመውም አታፍሩም ኦሜርታ አጣኸው አልወሰደባትም አቀጣጠር እየተሻሙ አያላምጥም አያደርጓቸውም አቋሙና እየተሠራው አልጣለም እየበረገጉ አትሉልኝም አይተዋወቁም አያስፈራኝም አስተምሮአል አየኋት አኪል አለመላክ ኦሞት አገጣሚ አቢያተክርስቲያናት እየበሰበሰ አልከፈት አሳይተን አንድነቱንና እየተተራመሱ እያበሰልኩ አይወራ እያቀፈ አሽራቸው አገኘውና እያነስን አስበኸዋል አባዛኛዎቹ አረፍተነገሮች እየደከምኩ ኣስገደ እየተመታን እየነቀሰ ኣባረሩዋቸው አመጸኞችን አኮታኩተነዋል አንደሚኖራቸው እየኖረም ኦሮሚኛን አስመለሱ አናግሩኝ አልፈቅድም አማካኝት አይመጥኑም አልተገኘላቸውም አገዝን እየተሰቃየች እየጋየ አሐዝ አንጀታችው አካሄዴ አምሽቼ አለመዘርጋቱን ኣቤት አታነብብም እየተሻሻልን አላስደሰተም አንስተሀል አይለዩት አልተሾመም አስቆመው አልተሳሳቱም እየደገፍን አውጥታችሁ አልስማማ አሰማን አገልግት አርባኛው እየሻረ አብስሯል አድሮብናል አይሻልምን አካለወልድ ኣሳይቱዋል እየፈረደ አያነብም አወዳደቁም አልባጦርነት እየተመዘበረች አመካኝታችሁ አላስደሰታቸውም አሹሊያን አፍስሰን እየተጎዳን አኔና ኢንጅነሩ አልመርጥም አላዘንኩም አጥንትንና ኢሣቶች አድርጉልኝና ኦሮሞንና አለመዳናቸውን አዎንታዊም አታልለው ኢትየጵያውያን አልሞትንም አምጥተውም አታስብላት አዋህዳ አፅራረ አሸብራቂ እየነዳን አልቀየሩም አንነጋገር አሳድገውና እያንቀሳቀሱት አልላቀቅ አባብሰው አለመገናኘታቸውን አፈጠጠች አስማታዊ እየጠበቅኩ አሳድጋለሁ እየቀጠሉበት እየተደረገልን እፈልጋሁ አለመሆነቸውን አገጫቸውን አብሯችሁ አሽሙራዊ አከባበርም አልተነጠቀም እየተጨቃጨቁ አቃቤያነ አግኝተህም አይቸግረውም አገልግሎትዎን አሳልፋችሁ አብዮቶችን እየተጻፉ አትልክም አጫዋቾች አይስተካከልም አይቀርለትም አስቀጥለዋል አካሄድኩ ኣልባ እየደገፍኩ አውቅልሃለው እየተነዳ እንደሚያዩና እየጨለመ እንዲጨብጡና አትለውም አርከበም አድርገውለታል እያስቀመጠ አድማቸውን ኢሓዴግም እየታሰሩና አጠገብዋ አትበሉኝና አላነሳ አስተባብረዋል እንዳይጠይቀው አሳያቸው እንግዳውን አወሉ አዋጆችም እንደነገረችኝ አለመቀበሉንና እንደምታየኝ አማርጠው አለማግኘቷን እንድትካለል እንዳይሆንም አራቢካ እንደወጉት እየተፃፈ እንዳይደራጅ እንዳትጠፋ እንዲገጣጠም እያወገዝን አንደምታው እንደሰማሁ አፍቅራዋለች አፍኒንና አልቅሰዋል አይተርፍም እያሳጣን አሽንፏል እንኪያስ አረጋዊና እስኪሟጠጥ አምራቶች አስገንብተው አሜሪካንም እቃዎቻቸውን እንደሚወራው እንደደንቡ አንባቢውን ኤፍና አስተውሉ እያየህ አልይዝም እየተወጣን አደርገዋል እንቅስቃሴዎቹ እንዳያወራ እንዲቆጣጠሩና እየተዘዋወርን አደናቅፈዋል እንጂማ እጆችዋ እንደጠቆሙን አስተውል አያስጥልም አስልጣኝ እንቅስቃሴስ እኩልና እይደለም እህህህ አለማድረጓን አርዳይታ እንዲሸመግሉ አይጨነቅም 