            amharicWords[15, 4] = "አትሠሩም አልረፈደምና አስደማሚና እያተመ አስተምረውት እያሳጡን አለመማርና አንዲያፍነው አጸናዉ አኳሁዋን አሜከላ አግልላችሁ አልተገኘ አትናደድ ኦዲዮዎች ኢንተርሀምወሜ እያንዳንድሽ አስቤበትና አልተናገርንምን ኣይታዩም አስደስቶታል አውስታለች አይናፋር አቢንገር ኣባቱና ኢኮኖሚውንም አገልጋዩና አውቃችው አይዲዮሎጂዎች አሳዝነዋል አንድኛቸው አንሡ አይፈረድም አካሎ እግዜሩም አይፈጠሩም አልተሰጣችውም አልታደሉምና እየፈረዱና እየጎደለ አልቀጠሉም አጭተዋቸው እየተነጠፈ አውራነት አስቀመጡበት ኦርቶዶክሱን ኣንጨነቅም አሽኔ ኢዮቤልዩን እያብራሩ አያከብርም አወዳደቃቸው እያቋረጥን አገኘነውና አስታወስከኝና እየቀደሙ አስታወሱት ኢንጊነዕሪንግ እየታጠበች አይሆነም አምኃን አየርመንገድ አርግዘው አድሮባታል አወቅኩ አልገመትኩም አብረዋል አልገኝ አድርጎለታል አይዲዎሎጂ አቅርበዉ እየፈፀምክ አንተሁን አስተማማኝነቱም እያስመረረ አልዘርፍም አለመማራቸው አታውቅልኝም አንባ አስራሰባት አካፍሏል አለፋን አሊያስ አያዋጣህም አቅራቢዎቹን አትለማመጡዋቸው እያነሳነው አረጋግተው አያደርግልንም እየተወራረሰ አላላችሁም እጠፋለኹ አለማንበባቸውን አገኘኝ አባታችሁን አንጠባጥቧቸዋል እያቀነባበረ አድናቂዎችን እያስገደዱት ኣልቻልኩም አካተናል አልደነቀኝም እድለ አጨናንቀዋል አወጣሁና እጥፍና አወጋሁ እየደረደረች እየተርበደበደ አሮጊቶቹን አልተገደዱም አይቆርጥም አቁርደት አያደርጉትምና አልጠራንም እየተደረግ አሂምሳ አልሰማን እያደሉ አለመመጣጠንም አርበኞችም እያስተማርኩ እድም አላነበብኩትም አርሶደአሮች እየጋገሩ አክባሪው አድጎአል እየወሰዷት አስተያየቶቻችሁ አንብቡኝ ኡቅባይ አስደነገጠኝ እየተዘጋጃችሁ አትክልትን አባብሷል እየጋበዙ አብራሩልኝ አትለቲክስ አመጣና አኬሽያ አባክኛለሁ አላዩኝ ኢትዮጰያዊ አባረሩትና አትበሉን አባባና እየገደበ አልገዛ አይቲ አባባን አካባቢንና እየገደቡ አስተናግደናል አትሞቱም እየጠበሰና አልነበረብዎትም አንኳሩን እጠጣ አሠልጣኙም ኣሳድገው አጽንተን እየተንገዳገደች አላሳወቁም አተሩን ኣምስት አብርሃንም እያስኮመኮመ አለመታሰር ኢትዩጵያዊነት እየተረዳቸው አልሳካልኝ አትበጠስም አድናቆትንና አበላሽተው አምላካት አድካሚውን አመራረጥና ኣንድም አሳልፈዉ አሳይተሃል አካይ አሳስቶት እድሮችስ ኣልነበሩም አከራይቼ አልተሳካላቸዉም አቀጭጮታል አሠርተ አሳይተውበታል አልተውም አይተካም አልፎኝ አላንቀሳቀሳችሁም እያርከፈከፉ አገልግዬ ኣንሰጥም ኢሰፓኮ እየቀጠረ ኢረከቡ ኣለመሆናቸው አጋልጦአል አሾክሿኪውን እያመከናቸው አምባገኑ አአጋጣሚ አኑረው አናዶሉ እየተካሄዱም አድራችሁ አሰራጭተናል እንደሚጀምሩ እንዲያስረክቡ እየመራ አድርገውታል አረም አስተሳሰብና ኢትዮጵያውያኖች አጣዳፊ አርአያነት አብዱራሂም አይሁዶች አንቀፆች ኢትዮጵያዊቷ እንደሚገኝበት ኢንተርፕራይዝ እስዎ እንሂድ እየተሰራበት እንዳሳሰባቸው እንዲደገም አድሮ አፍኖ እያስከተለ አበይት አቋሟን አይፈልጉም ኣቅም አይባልም አባይነህ አበጀ አድጓል እንታገላለን አሟሟት እንደሚረዳቸው አካሂዶ እየተጠናቀቀ አይፈልግም እዚ እንደሚሰጠው አስረው እገሌ አሠራርን እንደወጣ እዚያም አጋልጠዋል አውራጃዎች እንዲያመጡ እህልና አምባሣደር እንዲሰረዝ አብቅቷል እናንተም አወጣጥ እናንተን እየገለፀ እንዲፈርስ እንደሚያበረክት እንድትችል አግሮ አልሆኑም እንደሚሠራ እያካሄደች እንዳብራራው አሜን እነኚህ እንዳገኙ እውነታው አመለካከቶች አስፈጻሚዎች እንዲያውቀው አንግበው አያ አቤቱታውን እንዳለባት እንደሌሎች ኢሮብ እንቃወማለን እንደሚደግፍ እርጥበት እንዳይሰጥ ኤፈርት እፎይታ እንዲቀር አረፉ እ