            amharicWords[15, 5] = "አሥረኛውን አበሣና አጥተዉ አካዳሚዎች አሉዋችሁ እየተዘሰጋጀ እያለቡ እየሻገተ አልኾንም አለመረጋገጡን አልተደረገላቸውም አካሔድና አንዲሳተፉበት እየተቀየረና አይችሉት አሻገሩ አገናኝነት እየጤሰ አሳፈራቸውም አንዲባረሩ ኣቁማዳው እፈርማለሁ አልባውን አመቻችተዋል አጫፋሪዋን አንጸር አስረክብህ አይገርምሽም አትያዝባቸው እየባዘንን አላደረግንምን አይፈረድባትም እየተጠበቀለት አገሬንና አዘር አልተሰነጠቀም እያራቁ አለመኖራቸውም አበቦችና አመዛዝናለው እያስዋበች አሻራው እየፆምን አሳለፍኩት አበረታቱ ኢዜአም አዝሎታል አቁመውት ኣቆጣጠር አዘውትራ አልፏታል አትፍረድባቸው አድርቷል አይሆንብህም አከባቢያችን አተያዮችን አታስጠጉ አለመፈቀዱ እየተመጠነና እየወደቅን አላስቻለንም አረግ አይደግም አራዶች አያስቀርም እየዳረጉን አንተውም ኢሕአዲጋውያንን አላልኮትም አዘብ አብቃዮች አልደረሰ ኢጣልያንን እየቆነጀች አቅራቢውን አንቸኩል አልጠየቀንም አጋዥም አይፈቅድልኝምና አስተርእዮ አባሪዎቹ ኢሕማልድ ኣለበለዚያ አፍስሳ አልዘፈኑለትም አፍቃሪነታቸው እያለኩ አባባልን አልተገነዘቡትም ኣላማጣ አክብሮቴን አትጠጣም አባቶቻችሁ እጋራለሁ እያስገለበጡ አገርክን እየጠቆሙን አፍላቂነት አቃጨለብኝ አስከተልኩኝ አይዘግቡትም እያለኹ አያከማችም አልተከተልንም አላግጠዋል አነሣሽነት አይመርጥልንም አልመኝላቸውም አይመለከታችሁም አልተጓዙም አይረንና አቅጣጫስ አላነበበውም አይረንን አላግባብና አፈራርሶና አይዲዩሎጂ አንዲያ ኣሰተዳደር አከብርላታለሁ አስመርሯቸው አጭበርባሪነትና አቢዎት አንወሻሽ አበቃቸው አይንስታይን አወጣህ አስመጥተን አቡክቶ አኀዞቹ አግዚአብሔር አልልህም አንዳችንን እየደለቡ አልቀናል አንደሚነግሩን ኣካባቢዎች እየነገራቸው አድርግልኝና አስለቅሶ አድርባዮች አደረገችልኝ አሜሪካዊያኑም አቃጥሉት አርታኢ ኢዝላሚስት እየጠቀስኩ እየከዳን ኣማርጭ ኢንቴግሪቲ አርማዎች አፍሪቃና አባቻና አበቅየለሽ አንዳላ አስራአንደኛው አሳፋሪንና አለመቻልህ አልገባኹም አቀርቅሬ አይሻንም አይፈቅደውም እያደርኩ አራምደውታል አይደርስባቸውም እያሠሩ አሰማኋቸው እያነሳቸው አንደበትም አካባቤ አይኑርህ አይነሳባቸውም አዙሬ አስተዳድሮ እየዘገነነንም አላሰራም እግዛብሔር አንድነታችሁ አሰረው አልተነገረንም አይወቀስም አይደርሱባትም አንስቶታል አምልጧቸዋል አስገቧቸው እየተፈፀመባቸዉ አትፈርስም አትራፊነቱ አለውም አእዋፍት አሳደዋል አበርክተናል እያረርን አንቅር እየተቀለደበት አቀራርባ አሳይመንት እየቆጠበ አልመጣባችሁም አዘዋዋሪዎችን አረከሰው አሃሃሃሀ እየተጠበሱ እየታየብን እየረዱት እየፈጸሙብን እግሌ አሳሽነትና አቤቱታንም አቁማለች እንደሚያስተላልፈውም አንትሮፖሎጂስት እንዲታይበት እንደጥፋተኛ ኢትዮጰያዊያንና አቋማችንም አላገኙትም እንዳመመኝ እየተንጸባረቁ እሮጣለሁ አታንሱብኝ እየተንከራተተ አለቀልህ እንደመተካካት እንዳስወጣች ኣያስፈልግም ኣመራር እንደሚያሳድገውና እስማማበታለሁ እያሸተቱ እየተጨፈጨፉ አግብታ እንዲሠለፉ እንዲቆርጥ እንዲሰጣቸውም አልከፋኝም እጃቸውም አስቀርፀናል አመረተ እንዲፈጅ እንዳይጀምር አይጠራጠርም እንደዘረፍን አስተናግዷል እንዲከመሩ እላዩ አሰገባ ኧርነስት እየተዘጋ እግዜአብሄር አሽቃሩ አልማዝን አቀረበላቸው አይቀጥልም እንግፋ እንደሚያከብሩትና እንደሰጠሙ ኦቾሎኒ እተዝናኑ አንቆርጥም አድሶ አንገብጋቢው እንድትገኙ አጥሯል አውሬዎቹ አጊጦ አጀብና አታሳይ አደርገውታል አጋሬ አድርገናቸው አቆፋፈር እስኪነቃ አጋሮ እንደሚነሡ አያክልም አማራውና እንደዚህና አፍረናል እንዲደግሙት አስከትሎበታል አግዙን እየተንቀሣቀሰ እንደሚሠሩና አስተዳዳራ