            amharicWords[15, 6] = "አላስቀምጠን አራትዓመታት አሰላስል አቅቶኛል እዩትማ ኢቲቪና እያበራከቱመሆኑን አቫያ አዉርዶ አቅማችንና አጨበጨበ አረፍኩ አጨበጨቡ እየተላቆጠ እግሪ እያስነካን እየተንሳፈፈች ኣባልነት አጠራራቸው አንጎሉን እያንዳንዳቸዉ አላመንኩም አባረናል ኢነቨስተርነት አጥንቶቻቸው አይኖረውምና አንቴናውን አልሸጥ ኢረክተስ እያመረሩ አለማደግና አዕምሯችንን አጥፍታለች አሿፊ አላስደነቀኝም እየተሠነዘረባቸው እየተሸበርን አማራዉ አለሞሆኑ አይሄድ አታውቀንም አክብደን አቃባይ አሰናብተዋለሁ እያስታወስኩ አሳሳቢነቱን አልገባኝ እየታዩበት እየተብሰለሰሉ እየገቡላቸው አመሳስሎ እየደባበሱ ኢትዮኦጵያዊ አያቸዋለሁ እየገቡና አግዞኛል አልተወውም አሰኝቶታል አለመነጋገሩ እጾማለሁ እያነከሱ አናሎግ እየነፈሰ እያዘዋወረስቃያቸውን አለመውደዱም አጀንዳውም አግዘዋል እጸልያለሁ እየነፈሱ ኦሞቦላ አጎደሉን አላጠፉም አሰፍራለሁ ኦሮቶዶክስና አስችሎ አልጠገብኩትም አልቀውበት አመልክትልኝ አላፈሩም እየተተመነ ኣብርሃም አረጋውያንም አጠባና አልተበረበረም አልሆንክም አስደገሙኝ እየወተወትኩ ኣመለካከታቸው አለመታደልና አመልቲያስ አባቡልጋ እየቀደደ እያሳሳቱ አፍሪቃዊያን አክስቴን አይሻክርም አጣሁት አመለካከቱም አዘጋጅታችሁ አሳምነዋል አጭቀው አስተናግደን እግርኳስን አጥለቀለቀው አሕራም አምፖሉ ኣሳስቡልን እየደኸየን አስታወስኩት እየፈለጉም አልልዎትም አስገራሚነቱ አሸበሸቡ አይገንባ አመስግናለኹ እየከተተ አልተሳሳትንም ኢምቦክስ አለላቸው አራሳቸውም አላሰለጥንም አገዛዛቸውን አልምተን አንቀጥቅጠው አብርሀን አንጠልጥላ አርቲስቲክ አዝማሚያና አልተከራከሩም አልፈጸሙም አስተዋፅሆ አላመኑትም አጋሮቹን እያለከማደናገሩ ኣልተነሳሁም አራሌ አዝማሚያን ኦሮሞውንና አትወስዱም እግጅ አንሽታይን እያራመደው እየታዘበን አጋሮቿን አወጡለት አከብርለታለሁ አንቀድማቸውም አማራጬ አስቀድመዉ አስመስሎት አልፈጀብኝም እየጠነዛ አያውጡ እየገቡበት አማራጯ አለመቀራረብና አለመሸበር አራሰ እየገለጥኩልህ አልተላቀቀም አገልጋይም አረገን እጠባበቃለሁ አለቅነትም አራሷ አካቷቸዋል አልመስል ኢትጽያውያን አለመውደድ አሠራሮችንም አይረሴ አመልክቶዋል እያሳደዱዋቸው አብዲዋሃብ አስገኚ ኢዮርብዓምና አመጣችሁት እየተሳደበ አፈራ አይወዛገቡም አንጀኝነትን እየተሳደቡ አጫርቶ አካባቢዉን አያደርስህም አልነበረባቸዉም አላወቅሽምና አልመሰለንም ኢትዮፕያዊ አልከተብም አቀፏ አርበኞችና አንፈታውም አላውቃችሁም አልዘገቡትም አረካቸው አከታትሎም ኣየነው አእምሮም አራቴ አንባቢና እያራመደብን አሽመድማጅ አሰሩኝ አልሞላም አታዩትም አመንጭቶ አብጠርጥረን አልሄደችም አንቦዝንም አዲሶችን እንዳገዳቸው አይገርምህም እየተራገበ አጭበርባሪው አይገጥማቸውም አስገንጥለው አርቲቡርቲ እንገንባ አስፈፃሚነትና እንቀሳቀስ አስገባን አለማለቱ አላሰማም ኡምቤርቶና እንዲደናቀፍና እየተተከለ አበሳና እንደበዛበት እንደሚታይም አይስተዋሉም እንደማይለቁ አገሬውን አለመከበሩን አለማለት አይገባቸው አበባውና አስተዋይነትን አመጣብኝ አዋርጄ አልከራከርም ኣዲስ እንደሚታደሙበት አህፈሮም እንዳልበቃው አድርገውባቸዋል አላነጋገረም አውደጥናቱ አረጋዉያን አሮጌን አድማጫችን እንዳበቁ እንዳይታሰብ እንግሊዛውያኑ እግራችንን አፍንጮ አነብላችኋለሁ አትፍረዱ አልተደረገልንም እንደተነሳው አቀራረቦች አስተናጋጅነትና አለመኖሩም አድናቆቴን እንደምታውቅ ኡኒትይ አዕምሯዊና እየዘረጉ እንዳመነ እንድንጀምር አሳሾች አልማዝዬ አትፍረድ አምራችም እናውጋው እንይበት እያበራከተ ኦፍፊቸር እየተበላሹ እንደዘገበልን አለማቅረባቸው እግዚዮ አትግባ እስኪሟሉ እን