            amharicWords[15, 7] = "አርቤጎና እጠይቃለሁም አዝለውና ኣዝማሪዎች አንባቢነቱ አሕለፎም እያንጎራጎሩ እያቦካ ኢሶህዴፓ አናስገባ አሳጥረን እየከጀላቸው አቆሙን እየተጠቀጠቀ አረገው አለፍን አፈራርሰው አስታውሳለኹ ኢትዮጲያውያንን እየተሽቀዳደሙ አወጣጡ አደረኩት አጉልና አዕዋፋትን እየደራረተ አንደሰትም እጎአ አልፈለግኩም አለመውደዳቸውን አያስገባም አበቃቅተው አልከስክሰው አረገዙ አብጧል እያማተሩ አድርገናቸዋል እየተኖረ አብዲሰላም ኢኒጂነር አይቀበለዉም አይፈፅምም አዞዎቹ አስቧቸው አልተመቸውም አጠገብህ አልጠወለገም አንወድም አዘውኝ አለመሆኑንን አዛም አይደለችማ አርጋን አክራሪነትንና እየጠበቀሽ አከራየሁት አትታይም አምኜበት አይመልስልን እያሳበቀበት አቃቂረኛ አራግፈን አሞካሽተን አለማስተዋወቅ እየወጉ አበሳውን እየተፈጸማባቸው አደረጃጀቱም አካሄዳችንን አይቮሪ አልተጠናም አስመስክሯልና አግብርተ እድገትንም አሜሪካዊያኑ አባላቶቼ አስረድቶናል እየቸበቸበ አለመደገፋቸውን አይፈይድም አይነግረንም አንጎላቸው አይጫወቱም አትርፋለች አላዳምጥም አልፈቀደልኝም አለፍርድ አጽማቸውን አክሄር አውደራፊ አየገሰገስን እያመለከተች አያገኝ አላዉቅም እየቀረበባት እየኖሩና አነቃኝ አልባዎቹ አኮራረጃቸው አንፈቅደም አመለካከታቸውም አሞክራለሁ እያነበቡት አስተውሎት አደረገበት አፈጀ አለመዘጋጀቱ አኃው አይታወቀውም አስገረሙን አብሳሪና አምርረህ እየደረሰባቸዉ አይዋከብም እያናገሩ አንጠፋፋ ኢይይይይ እየቀደሙን አይበረክትም አምባሩ አይቆዩም አጋርም አልቃጣም አጀባን ኣቀረበልን እያደረገዉ እየተሻሸች ኡምኻጁርን አይታየዎትም አስብሏቸዋል ኢትዮጵያነት አራፍ አብያተክርስትያናት እያናካሱና አናምርቱን አጣበዋል አውጣነት እየጠራን እያስማገደ አወያይቶ አሳዳሪዎች አጥርም አላገባትም አብዛኞቻችሁ አባካኝነት አንጠላለፍ አያሳስቡትም አጎራባቿ ኦፕሬተርና እየተማረረ አንጀሎ አሽናፊነትን እያቋቋሙ አንቼሎቲ እያረጋገጡና አስከብረናል ኢትጵያዊያን አስትዋጾ አያችሁን ኢርሊክ ኣንዴ ኣረብ አዛዊንት አእዋፍ አተረጓገም አብይት አልጄሪያውያን እያስተካከልኩ አሕዛብም እየተጫዎቱ አይቀመሴ አውነቱ ኣመለካከትም አገኝቼዋለሁ አጥቻለሁ እያረሰረሷት አብልጠው አልመችም አስከብሬ አድናችኋለሁ አዉሮጳ እየተወጠረና አይቃጣኝም አረጀንቲና አምልጦበየመን እያስደነገጠ እየተከታተልነው እየጣልክ እየሾሩ አውርቶበታል እየኮረጁ አርትራ አፍርታለች እያለቀስንና ኢኮኖሚዊ አንደመንግስት አላሳልፍም አካውንቶች አፌንና አልገባሽም አይቃረንም እያወቅነው አሠራሩና አወራርድ አንመስልም አላረመውም አንዳደረሱባቸው አልጮህ አበሳቸውን አያረጅም አዘንብዪ እየተዘራ ኦልጅራ አሽከሩም እየሞቀ እንደሰዉ እየተበተኑና እንደሚበልጡ አመጣጥም አንዳስወጣው አልወሰደኝም እርሻችንን እያደረጉን ኤንግልስ አውጥተነዋል እንመለከት ኢኒቬቲቭ እጭርጭ አለማመኑም እንዲዘገብ እንረከባለን አግር አስደንቆናል እመነቶች አልተለያቸውም አገባዶ እንደተሰማቸውና አይቋረጥም አመቺው አይያያዝ አውጪውን እየገለጸች እንደሚጠብቃት አስተዋውቋል አጣሞ አውጀናል እማጸናለሁ እስኪያረጋግጥ አሥሩን አትችሉምና አስደንግጦ አይሞክሩም አትግዛ እገሊትን እናተኩር እያዞረ እንደሚያስገነዝቡት እንደሚጠሩት አማጺ እያዞሩ አይደግ አገኘኸው አያልፉም አናሳዎቹ እንደማትካፈል እንደሚያፈላልጉ እየተሸራረፈ እንደነበራቸውም እንዳልተመለሰ አይግረምህ እንደሚያስከብር እያስጠጋች አትራፊና እምንት እንደማትደግፍ አቀፉዊ እየቀጣ እንደማዕከላዊ እንደተወሰኑ አምናለው አልላችሁም አስገብቶልኛል አድባር እንድታስታርቅ እንድንወስድ አጣሽ እንደሚታየኝ አስተዳዳሪዎችንም እንዳቀባበለ