 አድኖ አደረጃጀቱ እንረዳለን አስሯል እንደተሳተፉ አዋርድ እልም እንዳበቃ እየተበላሸ አሳውቀናል አካባቢዎችና አስወጥተው ኢታማዦር እንዳስከተለ እስከተያዘው እንደሚጠናቀቁ እንዲጓዝ አጣጥሎታል አካዳሚክ አለማወቅ እንደሚቀበሉ እንዲጠሩ እየተከተሉ እራሷን እውቀትን አመጋገብ አዘጋጆችን እየተወራ እንዳጠናቀቁ አቻችለው አከፋፈለ እየተማሩ እንዲያሰማ እንዲያሳውቅ እንዲፈፅሙ እንደሚገባውም እየፈለጉ አያስፈልገንም አይኖችዋ እንዳይሰራ እንደሚጠበቅና አስመልከቶ እንደሚመለስ ኤምባሲዋን እየውልህ እየገዙ እንደሚሹ አሳ እንደሚያሳስባቸው እየሸሹ እንዲኖርና እየሆነች አደባባዮች አማጺያን አበራና አደሩና አንዷለም አሰባሰቡ አብራሪዎችን አረጋግጫለሁ እውነቴን ኣሉ አለመቀበል እየተለመደ አሰተዳደር አጥፍተው እየተጣሰ አይኖርበትም እደላ አስኳል አሳውቀው አየን አልኩኝ ኤድ እንዲያመች ኢጋል አስጠባቂው አካበቢ እንዳይሳተፍ እንደሚመራ እንደማይታይ አስረኛ አሰግዴ እንዱሉ እየተመለከቱ አባብሶታል እንኖራለን አለመሆኑንም አሥሩ እንዲመደብ እንደሚተላለፍ እያስተማረ እንደነበረባቸው እንደሚሞቱ አለመደረጉን እየተካሄደበት አጀማመር እርምጃን እንደሚቃወሙ እዝች እንዲያስረክብ እንድንሆን እንዲጠቅሙ አልጠፋም አንቆ አንዲህ እንደምትደግፍ አንዱዓለም እቃዎችና አስከተለ እምነቱ እየከረረ እንደሚመለከት አውሏል እንደሚኖረውም እህልን እንደሚጠበቅባቸውም እፍጅ እንድታስወጣ እንዳሰፈረው እንደተቋቋመ እንደሚመቻች እንዳደረባቸው እንደገለፁ እልቂትን አለመሆኑና እንዳትገባ አስፈላጊነትና እንደሚፈታ አጥቂዎች አይጨምርም እንደሚገነባ እንዳይቀሰቀስ አመራሩና አንሆንም አበክረን አባባላቸው እንዲታረም አላማውን አልኮል ኢሕአፓን እየተጓዘ እራሳችንን አልባሳትን አዛውንቷ እየተጫወተች አይመለስም አፀፋውን አበዳሪዎች ኢዴኃቅ አብዛኛዎቹን አድማሴ እንዲዋቀር አኅዝ እየለቀቀ አዳኝ አልቃይዳ እንደምትልክ እሥረኛ አለማድረጉ አንዳንዶችም እንደሚያስገኙ አመላክቷል አላበቃም እንደሚፈጥርላቸው ኢሳያስም እንዲሰማ አድሎ አማላጅ እየታገዘ አካላቸውን አዋጆችና አባሎችና አይተን እሸት እንጂኔሪንግ እንድትፈታ አብረውን ኦሮሞና ኦሮሞን አልተሳካላቸውም እያልሁ እዬታዬ እልፍ እንቀጥል እየሞተ ኢምሬትስ አንገቷን ኣለበት አያልነህ እንደሚጥር አድምጦ እንደሚያደርጉና እስኪያልቅ እንዳይኖራቸው";
            amharicWords[15, 8] = "አገልጋዮቻቸው አገራቸዉ አንናደድ አይሰጥምና እያተራመሳቸው አንቀሰቅሳችሁም አረጋጋቸው አሳጥቶናል አማክራለኹ አርስዎና አላወጣችም አትጠራጠሪ አሰቃቂነቱ አካተን አይባል አይደልምን አሸክመው እየተመዘነ አሠሪዎችን ኣሳሳቢ አመላከተ አለማምጣት አልፈርድባችሁም አንጋዳ አስተምረውናል አታልፍም አንኮታኩተው አንጋዶ እየተፈረካከሰና አልታወቅ አንድምታን አስገቢልኝ አለመቀየሩንና አጥርተህ አድረጎታል አግኝቸዋለው አስታውሰን አማረልኝ አፈቀርኩ አስተላለፍን እያሳቀሉ አባቦራ አጋርን ኢንተርኔቱን አላነጋግርም አዟዙሩት አይለቀስም እየደከመች አቤልሄሬም አለምነው አስነጠሰኝ አቅሜስ እየቀላወጡ አርሳ አይበቃምና አለመታመን እየተቀሰቀሱ አይቻለዉም አቅርቤላቸው አይታረቁም አከራካሪነቱ አጠናክረናል አርሾ አወዳደቅህ አነጋግር እያነሳሳች አለመልቀቁ አፈታሪክና አናታችን አያስኮርፍም አስከብረውልናል አየሽው አለቦት አገሮቻቸውን አይታያችሁም አወራቸዋለሁ አርያነታቸውን ኣክብረዉ እየጨበጡኝ አሰናብቶት ኣሳይተዋል አምባሣደራችን አውራሪነትና አስተውለሃል አፍሪካውያኑን አስለቀቁ አዘኔታ አፍሬያለሁ አታውቅምን አበዳሪዎቹ ኢራፓና ኦሬንታል አዟዙሬ እየታደኑና አልተሰማኝም አከራካሪነት አሁኦ እየተመጣ አበበም አሞካሽተው እየረዱዋቸው አሳዝነው አራዊቱ እየጋለቡዋት አብሰልስሎት እየደወልን እፀገነቶች አጋርዎ አለቃዋ እያረረና አያንብ አከናዉኖመምጣቱን አታዳምጡም አሹሏል እጦቱ አያራምድም አልሀበሻ አላጠፋሁም አውሱለት አስተያየቱንና አተላዎች ኦብላና አግኝተዋቸው እያቀላቀሉ እያስጎዘጎዘ አስደንግጧቸዋል ኢጣሊያንን እየተጋበዝኩ አምባሲው አለመደራጀት አነዲት አሯሯጮቻችን አይሞክሩትም እየቃኘሁ አንስቶት አናቴንና አልቀረጽም አይደላችሁ ኢማሞቻችን አሳይታናለች አጭበርባሪና አዙሪቱ አጠፋዋለሁ አይጠቅስም ኢንዲስትሪው አሸብርቃና አውጥቶላቸዋል አዝላ አስተርጓሚነት ኢምክንያታዊና አለመጠቀማቸው አንድሬ አስቀምጣቸዋለሁ ኢንጂነሮችን አጋጠሙኝ አስቀጥፈው እየተናደድኩ እየፀደቁ እያራገበው እየወጣና አለመቻልን አሳልፍ እያራቆተ አመልካችና አሸበርሽ አትድከም አስነስተን አልፈሃል እየፎከረ እየተሰደደና አላሰባችሁም አልፈለጉ ኣንዳንዶቹ አፈለቁት አንባቢዎቹን አልሃበሽ አይነሳሳምና አሳፍሮናል ኢሰብኣዊነት አለመጠን አመሏ አካሒዷል እያናዘዘ አድርገውብናል አለዚያማ አስተባባሪያቸው አበበባ አህያው አፍሬም እየተቆራረጠ አይስቁ አይቅርብን አሳምነን አይበቃኝም አጀንዳዎቹን አትነካም አስረውታል አያነሳሳም አስቀምጣችሁ አስተያየትህን አንገሽግሾናል አይድያሎጂ አልኮልን እያስኬድን አይነቀንቁ አሽከራቸውን እየተወነጨፈ ኢኮኖሚውንና አለቅ እስከነአካቴው አለቆቹን እያሹ እንደምትሉት አይጠገቡም አረጋግጥላችኋለሁ እየገደሉና እየተረዳዱ አሞስ እየገባለት እየተከላከልን እንዲሰፍ እንዳትዘግብ እንደተቀበለች እንደሚያጠናክሩና አድርሰውናል እንዳይሸራረፉ አረዶም አምፁ እቀባና አያዳግተውም አርሎንድ እንዲከናወንና አደርባይ አስተሳሰቤ እግሮቼ አያውቃቸውም እንዲፈተኑ እንግዲያው እርሷንም እራሣቸውን አይበለውና አስቀይሟል አሽሟጣጭ እያመነታ እንደተከለከለ እሥራቱ አለቤ አስታራቂዎቹም እንገመግማለን እንደሚንቀሳቀስም እንደማትቀበላቸው እላለኹ እንደተጓዘች አሰቃዩት እንዲለመዱ እንደሚታገዝ አለማካተቱ አፋልጉኝ አልመኝም አሳፋ እንጦርጦስ አፈርድቤ አውኮ እየተኩ ኢህአዴግንም እንደሚያቀርቡት እየተራወጡ እየተካ እንሞክረው አውሮፕላኖቻችን አሣፋሪና እናመርታለን እንዳይመስለን አባትን አበረ እንገፋለን አብሉኝ እንደምትገኝበት እጸገነት እስክስታውን እያንሰላሰልኩ እንደተሰጠውም እየቆረሱ አቋርጫለሁ