            amharicWords[15, 9] = "አመስ አርድእት አምላክህ አይይዘው እየነሳ አለመሆናቸውም አንዞር አልተረከቡም ኦንላየን አይለያት አሸባሪነቱ አላማረሽም አለመግባባታቸውን አመክንዮችን ኣስተባባሪነት አንተወዋለን እየተያያዘና እየፈፀማችሁና አትሌቲክሱን እያዜመ አየረገጥን አስቸገረኝ አልጣሽ አዝኖላቸው አናሳው እየጠበቀና ኣቅማችን አጠናቅቄ አይሔዱም እጦጥ አያመሳስለውም እየተዘጋጀሁ እየነገራችሁን አልተሳካላትም ኣልታዩም ኢኤንፒፒአይን ኣያጠቃልልም አሳዳሪዋ እየተሸነገሉ አልጠቀምም አያገባቸውም አገልግሎቶቻቸውን እያማረባት እየቆጠርን አትጠብቁ ኦርኬስትራውን አጻጻፍና አልመስልህ አስተተያየት አቃፊ አቋምንና አይረሳውም አበራየሁት አውጥተንላቸዋል እየተከተልኩ አያታሉ አማራነታቸው አልቀረው አይነግሩንም እየተለያየ አወጋናት አብሪልን ኦርቶዶክስም አይነካውም አርቪን ኣላምንም እያከበደበት እየደገፈና አጠናቀቅኩ እየተንተራሰ አዕምሯችሁን አምፀው አላቅውም አይቀራቸውም አለማስተናገዳቸው አናስተናግድህም አጣጥሞና አውስትራሊያዊያንን ኣቋራጭ አፍቃሪዎችን እየተጨቆነ እየተዋዋሱ አቀብሏል አልተዘለሉም አዝዤ አለመጠየቃችን አካፍዬ አብጠርጥረው እየተርገበገበ አብዛሃኛው እየተናነቀ አለንና አንሞክር አጠገብዎ እየተራባ አልረሳንም እየተናነቁ አለባበሳችን ኦሪትና እየተወረወረ አልሃምዱሊላሂ ኦሪትን አንደሚመጣ አተቱ ኣሉታዊ አጅንዳ አያክስ አዚምን አይዲዮሎጂ አቋመ አካሌን አጥፍቻለሁ እየፈለግን እከሳለሁ አለመቻሉንም እንዲያስብበት እንዲቀመጥና አሳቀኝ እንዲካሄድበት አሻሽዬ እንዲኖራትና እያነጋገርን አጠናቅቄያለሁ አስጥሎ እንደምስክር አንደነበርም እንደሚቀርፈው እስፔስ እንደሚጫን አልጠየቅንም እያነሳን አላየሁባቸውም እንደመሰረታዊ እንዲያርሙ አጸያፊ አታውቃቸውም አይታደስም አሉታ እየተላተመ እንደሚጫወትና አትሰብሰቡ እንድንመለከት እንደእነሱ አያመነጭም አይሹም አላስካና አምራችነቷ አለማወቁን እንጠብቀዋለን አልዳበረም እያስለቀሱ እየዘረዘረ ኢንደስትሪው እንደሚነድፍ አላስረክብም ኢጋድም እየተነሳች ኢዚአ አስከትሎባቸው አድሬያለሁ እያካሔዱ አባወራው እያወኩ አይመራንም ኣሰፋ አልነሳ እናትነቷን አልተስማማም እምኩብራን እንደማይታወቅና እንደተጠራ አድርሠው ኣይደለሁም አናቱን ኣገሮች እንደሰማይ አይሁዳውያንም አዳራችን እዬሰሙ እንደገዙ እያሸነፈች አልነበረው ኢደአ አሰምሽን እነግራቸዋለሁ እንደገዛ እንደሚያከናውንና እንቅፋቶችና እንደሚያጋጥማት እችሎት አብርሀ አብርሃምና እየተጠየቅን እንሻገር አልፈጀም እንደሚያሳጣ አላነበቡትም እንዲሰቃዩና እየተጉላሉና እንደጨረስኩ አፍልቆ አላመነኝም እውነታውንም እንደተከታተልኩት እያበላሸ እየተጠራሩ እንደምሄድ እንዳልተቀበለ አእምሮአቸውን አውሬው እያበላሹ እውነተኛን እንደመታው አሸነፋቸው እንዲሰጠውና አቸንፎ እንዲነድፍ እየመቱና አብቧል እየደጋገመች አንጃነት እንደሚሰቃይና እኔጋ እየተፋጠ እንደሚገልጸውም አረጋግጦልናል አገባለሁ እንዳስገረመው እየተወደደ እንደአገር ኦሪጂናል አሥራተ እየተደረገና አይጠፋ እጠቁማለሁ እስከተሰጠበት እመክራለሁ እየታሰርን እንደተጠቀመበት እገዱው ኢህኣዴግን እንዲመለምሉ እንደሚያይ ኦፊሻል እንግጫዬ እያሞገሰ አይረባም አጥቶአል እያመዘነ አፈሹም እንረፍ አባታችንም አይደገፍም እንደማያመልጥ አስሮኛል ኢግዚቢሽንና እየሄድክ እንዲያደግላቸው አልሰጥህም አቅርበንላችኋል አስክያጆች እያስከፈሉ አዝማዱ እየተሰቃየሁ አልተሰማቸውም አኅጉራችን አዝርእት እያስለቀቁ እያወለቁ እንሽ እያሳመኑ እርባን አለመቀነስ እንደያቅማቸው አላስቆም እየተቀየሩ ኦሕዴድና አስተዋጽኦውን እንሥራው እንደሚያስገነዝበው እንሆነ አከራያቸው አቅዱ