            amharicWords[16, 0] = "እንደማይድን እርስት እንዳይሔዱ ኤክስቴንሺን እምነቶቻቸውን አብርቶ አፈላል እንካሰላንቲያ እንደወሰዱባቸው እየሔደ አባሳንጆ እንገናኝና እያስተናገድ አሳክተዋል አወያይተናል አደምም አኗኗራችን እያስቸገረ አካልስ አይሰማሽም አድባራቱ እንደእንስሣ አልቅሰው እንደነሱው እንደግፈዋለን አሶባ እንዲሰባሰቡና አንትሮፖሎጂስቶች እንደጉም እንዳሣሠባቸው አይመከርም እንዳውቅ አንገታችን እንደየወቅቱ እሳቤው እንዳይሔድ እንደመፈንቅለ እንዲደርግላቸው አየነውና እንዲያብቡና አዙሯል አልተከለከለም አውርተን እንቁጠር እንደራጅ እንደክርስቶስ እንደሚያበረክቱም እናባርራለን እያበዛ እንድናከናውንበት አለመዘጋጀቱን እንቀጣለን እየቀረበለት እንዷ አይገኝለትም አንሷቸው እንደተመረቁ እንዳይጽፍ ኦህዴዶች አለመጠቀሱን እንደሚጠቅሱት አምሮኝ አንገናኝም እንድታርቅ አገልግሎቶችንና እንደደረሰኝ አንቀስ አገናኝቷል አስረክባ እንደሚከሰሱ ኢንዱስትሪዎችም አስረድታናለች አንሰግድም አንጠፍጥፎ አተረፍን አብቅተነዋል እንድንሆንና እስከመልቀቅ እንደማያጣው እንጀራን እንቁልልጭ እንዲደረግልን እንድትወድቅ እንደማይሰጧቸው አይጋፎረም አነበቡ አይስቅም እንድቀርብ እንዳልተፈቱ አባትነታቸውን እንደሚያውቀውና እንደገባሁ እናቶችንና እያድበሰበሰ እንዲወያዩበትና እስካልተቀየረ እናሰምርበታለን እንደማልሆን አጥንትን እያበረከተች እየጨረሰ እንደሚያደናቅፍ አሥተዳዳሪ እንዲላክና አስተናባሪነት አይታችኋል አለመቻልዋን አልተለያዩም ኢኮዋስ አልዋሉም አጠናክረ እንደሚያነሳሳ አፍራሽነት እንዲጣራና አልአዛርን እየተያያዘ አቻዋን እየጫኑ አልጋቸው አስቆጭታለች አድርጎበታል አለማስቻሉ እስካለኝ አይወስዳቸውም አምጥታችሁ አሰጋጅ አስፍረነዋል አልተገታም እንደሚጠቁሙትም አደላድሎ እንዳይጓዝ ኣስተዳደርን አከናውነናል አንደውም እየጠየቁት አስያዥ እንደሠራ አካልት አመካኝተው እንደሚሠራና እንደምክንያትነት እየጎተጎቱ አተረፍኩ እንዲተገበርና እንደተገደሉና ኣይከብድም እንዲያድኑ እንዲበደሩ እንድናስታውስ አለመግባትና እንዳነሳሁት እያመራን አሸንፈሃል እየጠሉ ኦርቶዶክሱም አይገለጽ እየደረሳት ኣድሓኖም እንደማይታሰሩ አልተነኩም አላገኙ አለቻቸው አክሊልን እንዲተባበራቸው አላ አማካዩን አበራም አትተንፍሱ አለመጎልበት አለመውለድ አቀባብሎ አፈላልጌ እውቀቶች እንደእናት አቪየሽንና እየተደረገብኝ እንደሽንፈት እየተወጉ እንደሚከፍላቸው እምቢተኝነታቸውን አላሳወቀም አድርሰውበታል አደራጅነት ኦመዱ አስፈው ኤፖርቶች አስተጋብቷል እንዲጠጡ አሱ እየተቀያየረ እስራኤላዊያን አስ እንግልቱ እረኛና አስረድቶአል እውነተኛዋ አውሮፓው አሽ እየተፍጨረጨረች እንዳይነሳና አክተሮች እንዳይጠፋና ኤልሚ አልሰዒድ እንደቀበራቸው እንዳናቀርብ እንዳልችል አሽሽተው እንቅፋትም አቢያ እንተያያለን እተኛለሁ አጃቢዎቻቸው እሰጣቸዋለሁ አበ አልወጣችም አመባገነን እንዳከበሩ እንድናዘጋጅ አርምዴ እስከሚያገኙ እንደማይቃወም ኤልሳ አሠራራቸውና አስደንቆኛል ኦጋዱጉ አስግቷል አውሮጳውያን እንዲታገድላቸው እምነቶችና አፋችንን አወራህ አግኝቶና አግልያለሁ አሟልቶና እንዲሸማቀቁ እንመሰክራለን አስተዳር እንዳበቁት እየተቀረጸ እፈጥራለሁ እንደሚጠይቀው አለመሆናችን አስመዘገቡ አኔ አኖ አቆይተነው እንዳይዳረግ አሰጣት አበደች አባሏ አመዳደብና እየገረፉ አይገስጻቸውም እንግሊዘኛና አውርተው እንደተጸየፋቸው እንዳደረሱት አለቆቻችን እስከምናደርግ አራርሳ አፋምቦ እንዲንቀሳቀሱም እንደሚያስተዳድሩ እንደማይደፍሩ እየተናገረች አንደማይችሉ አከፋፈ እንጠብቃቸው አስብበታለሁ አላስወጣም አያስመኝም እንደሰጡም እንደሮይተር እያመኑበት እዬተቀበለ 