            amharicWords[16, 1] = "እንስጠው ኣባረው አይቀብረውም እንደአጠቃላይ እያዘነበለ እንዲደረግልኝ እንደለመድኩት ኢሶዴሊ ኡላ አልቻንም እንዲያሰሙልን አያዘውም እንዳልተሳካላቸውና እንደሚያበቃቸው እየተራገፉ አሳክቷል አስማሚነት አፍርቷል አሳትሟል አግብተዋል አፈሮች አኪያጅ አላየችም አፉንም አትሰማም እንዳስቻላት እንድንድን እርሶም አያያዤ እናተሓበና እንደሚቀረፍ አብሮም እውነትህን እንዳይዘናጋ አገኘሁህ አባላቶችን አለማሳወቁ አግኝቸዋለሁ አለመከፈል አብቅተናል እንዲገበያይ ኢመተማ እስከመስጠት እናድናለን እኩዮቻቸው አንመለስበትም እንደሚጠብቀን አቋርጧል እዬታዬው እንደሃይማኖት አያዳምጥም አክርማ እየሰበሰብን እንግዶቿን እናሳልፋለን እያዘዋወረ እያደረበት አለመቆም እንደሚዘገይ አውርዳ እስከመላክ አመለካት አክብራችሁ አላችው አውርድ አውቶሞቲቭ እንደሕዝብም እያዘዋወሩ እየተቀበሉት እንደተመዘገበባቸው ኢርኮ አዋጪነት እህላችነን እየተለቀቀ እንዲያግድ እንዲያበጅ አስፈፃሚዎችንና አስወረዳት አጋጅየለው እየተደነጎረ እንደሚገደሉ አረጋሽን እንደማታቀርብ አላየ እግድና አደረጋችሁ አጽብሐ እያራገቡ አጭሮብኛል አላይ አባና አመንሁ እንደማያስብ እንዲያየውና አስተላልፎበታል አዘዛቸው አይረዳም አግዳሚና እንደማይቻለው አይነግድ እንዱለች እቅዳችን አድራጊና እንዳይቆረጥ እንደሚመጣም እንደተኛሁ እንቆጠብ አሳፋሪው እንደሚያደርገውና አልተሸጠም ኢሁድ እንደሚያቀርባቸው አልዑማሪ እንደተጠየቀው እስኪያጅ እንደልማቱ አልፈጸምኩም አብሮነታችን አነፃፅረው እየተለማመጡ እንዳንቀር አዉቀዉ እንዲንከባከቡ እየተንሳፈፈ አድገን አክሽፏል አልሞከራችሁም አይኾንም እንድንማር እያተረፉ እንዱይሆን እንዳላስቻላቸው እንደዘረፉ እንዳደግን አላየሁበትም እየጎረፉ አይሳካም እንደምትቀበለው እየጠና እንዲከታተሉት እንዳይመሱ አቅጣጫዎቹ አበምኔትነት እንደተመለሱና አከራይተዋል አቅሙንና እቁባይን አለማንበብ አይታይምና ኡዚ አንቀሳቃሾችና አሳውቃ አለማቆሙ እንዳመለከትነው አስረድቼ እየደመቀ ኣሕባሽ እንድቀበለው አካሔዳቸው አዋጭነቱ እግዜርን እንደገለጥኩት አይሰማው እንደመጣለን አይጠቀስም እንዳይጠሩ ኣይሸጥም እንተም አቋማችሁን አርፋጅ እየተሸማቀቀ አርቴፊሻል አትቸገር ኣቅጣጫው እንደተደረገላት አልጄሪያዊው ኢሂ እየወተወተ እንደተብራራው እንደጧቱ እያስመጡ አልሚርጋኒ እንድንመራ አማርኛቸው ኢግኖር ኢሕ አክሳሪና አሳየቻት እንዲያውቀውና አጀማመራቸው ኢማ እንደሚባሉት እክት እየተዘመተበት አይበርድም አስደሰተ አዳክሞታል እንደተሰጠና ኢሣ እንግዶቹና አለንበት አካዳሚውን እያጣመረ አይከሰትም አልነገርሽኝም እንዲሠራው እንደሚያካሂዱም አጨናንቆ አሳደረ እከታተላለሁ አቅጣጫቸውን ኢንተርፕራይዝን አሠሪም እያነሣ አሉልኝ አዳምጣለሁ አንቀሳቃሾችን አሸንጌ አለመቀራረብ አውግተናል እንዳልቀሩና አሞዋቸው አላረፈም አብነቶችን እያንቀሳቀሱ ኡፕ አዋልዲጌሳዎች እየወሰደን ኦፕሬተሩ አርማቸው አለማቅረብ እንዲቀለበስ ኦሆዴድ አጋርተዋል እሥራኤልና እንደተወያዩበት አጅቧቸው እንደማደርገው እግዞኦ ኣርአያ እንዳታጣ አስቡት እናጣራለን አመልካቹ አስቆኛል ኦቲስቲክ ኣይለወጥም እንዲያደርግባት እንደማድረግ እንዳነሳቸው አሽሙሬ አንታገልም እየተነቀለ አስመርቀዋል እንዲጨርስ ኣበል አንለብስም አስተጋቡ እየተፈለገላቸው እንዳያስከብር እስኪፈጸም እንታገልለታለን አያካሂድም አስለቃሽ እንደመሆንዎ እንዳልፈጸሙ አስደናቂውን እንዲታሸጉ አልሆኑ እንዳልነበርና አልደፈረም እንድንጠራ እቀር አቀብል አይደረግላቸውም አያስችለውም እንድታገግም እጅብ እያነቁ እንዳልፈለገች አልተጠቀመበትም አከላለልና አሁንየስድስት አልቃኢዳ አድንሃለው