            amharicWords[16, 2] = "አይለውጠውም አስደምሞኛል ኢዝ እንደምንጮች አለመታየት አይችለውም አጠራቅሞ አትጠፋም ኦማንና እንደሚያስታውሰው አልገባህም እንደሰጡአቸው አስመለክቶ አመክቷል እንድትስብ አነር እንዲለካ አይሁዳዊት እንዲታይላት እንደሚቀርብለት አነሰ እንድወለድ አንተንና አዘንብሏል እንደሆ እንደሚመሠርት አሉባልታን ኢነርጂና ኢጃ እንደሚቆጣጠሩና እንደማያሳይ አሸን እሥራኤላውያን አግዳሚው እንዲሰይም ኢነርጂን አቀራራቢ እያነቡ እንደተቀሙ እንደዋለና አዳሪነትን አልነገረችውም አታጋንን እንዲጣራላቸው አዝምቶ አቧራማ እየነጋገረ እየተሰማራ እንደወለዱ አደራህን አሙዲዓሥ እንደሚሻለን አለማለቱን አቅቶናል አልፍዋል አነታራኪ እንዲገለጽልኝ ኢንፌክሽን እንደአቃቤ እንደማይሻ እየለወጥን እያሳኝ ኤርትራዊቷን አስደናቂነት አያይዘዉ አልፋና እየገነገነ አብዱልሐዲ እንደሚታሰበው እንቅስቃሴዎቻቸው አድርጎባቸው አሻራዎች እንደጀግንነት እስከሁንም አስተዳድርን አካባቢዎቸ እንደሚተላለፍም አዘጋጁም እየወረወሩ እየዘገቡት አምጥቻለሁ እንደሞተች እንዲያቀርበው እያሳካ ኦብቲዶን እንዲያከብሩት እያጋነኑ እንደተተካ አስፈቅዶ እንደሚተባበሩ አንጠልጣይ አልኖሩም አልታወቁም እንዲሠረዝ አይናገር እርሟን እንዲገፈፍ እንዲያሻሽልና እንዲያቀርቡላቸው አልሰማኝም እንደቆየችው እጃቸዉን እያረሙ አጥባቂዎች እደረታቸው እንደተለመደውና አወናባጅ እንደሚንቀሳቀሱም አተገባበርን አመራራችን እንደሚትሄድ እንዲያሳካ እርግዝናቸው እንደሚቀርብባቸው እየተገዘቱ አመችነት ኣነ እናጥናው እንዳይሆንባቸው አሻሽለው አያስጠይቀኝም አስነሱ አንጀኝነት እየጠረጉ እያጓጓዘ አስከባሪዎቹን እያሣደገ እስከሚያዝያ እንደባንኩ እያጓጓዙ አብዝተው አለንልህ እየሰመረ አስተናጋጁ እንደወረርሽኝ እያረረ ኤንጂኦ እንደሚሻሻል አሟልቷል እንዳስደሰተ እንደምፈልግ እኅትማማችነት እንደተራዘመ አመጋገብንና እስከመውሰድ ኦላንጎን አይሻል አጋይቶ አንዱንዶች እባቡን እንደያዘም ኣኽ እስኪቀረው እንደሚተዋወቁ አልበቃቸው ኣይደልም አርቲስቱን እንብሎ እንደምንፈልገው አለመስማቱን አሠሪና እያረሱ እስኪቀራቸው አያሰራም እንደምታስቢው እንደታገሉ እንደምትከፍል አትስማ እንደሚደግፉትና እንዲያመጡና አንባቢያንን አዎንታዊውን አደረግኸኝ አርተሪ እንዳደረሱን እደሪ አይዞአችሁ አሳምረህ እሕል አጫውታኛለች አይቋቋም አርተር አስጎብኝ እንደማይማሩ እቀራለሁ እየሰራበት አልአህሊ እንደመሳሪያ አንደኛውም እያሰገኙ ኣይ አሣር እርሻዎችና እንደማይቀንሰው አሮጊቶች እንግሊዝኛውን እንዲደፈርስ አኩኩሉ አለመንቀሳቀሳቸው አለቃዬን እያስፈረሙ እንደማችሉ አሎይሴ አናገረው እንደስኬት እንደመጀመሪያ አሣሽ እያሰሙና አንቀጾቹ አስተባብሎታል እያለያዩ አበርክታለች ኢንኳን አሹራ እያጠበቀ እያጋጠሙ ኤሚ አዲግራትንና እየተገናኘች እምቢተኞች አያየውም እንዲፈናቀል እንዳይሞቱ እንደየደረጃቸው አወጣጥም እንደማገኝ አልመሰለውም አስግቶታል አቤጋ አሙዲያስ አድርገነው እንዳንገኝ እንደገለጸላቸው እየተገነባች እንደሚጨርሱ አፋጠጠው አፍርሰውታል እስኪከሰት እንዲመረምሩና እያስራቡ አስተዋላት እንዲማርና እንዳያይ እንግዛችሁ አድርሶብናል አኩዋያ እንዲያስቀምጡና እንሸፍንበት እመርጥ እስከናካቴው አበቅቷል አእምሮዋን እንደሄዱም እንደጣለም እንደተወለደች እየቆምን አያይዝውም እዚች እንዲሰጡለት እስከዚህን እንፈጽም እስከቀበሌ እንዳይመሯት አገኛችኋለሁ እንዳልገጠማቸው አበጥረው አነድ አይግባችሁ እየተፈፀመብን አጽናፍ አየኝ አልቾ እንተዳደር አከናንቦ እንደሚናገሩም እግዚሄር ኢዴኅ ኤቢ እሽጎችን ኢሮፕ አያውቋቸውም አስክያጁ እንዲስተካከልና እንዳነበበች አለቆቻቸውን አካባ