            amharicWords[16, 3] = "አስቀድሱ እንደሚያረጋግጥም አራዳና እንዳትለኝ እየተሻላቸው እንዳይገጥሟቸው እንደጉድ አይቮሪኮስት አሠራጭቷል አሽመድምዶ እንዲያሸጋግሩ አያደርገኝም አሳለፍን ኦችቶበር እንድንችልና አልጨረስንም እንዳስጠነቀቀ እንደሚለዩ እየተሸማቀቅኩ አንዋርን እንደሚታሙ አበቦች እሾሁን አልተላቀቁም እያስመዘገብን አይለየን እየተጓዘበት አእምሮአችን እያገላበጡ እዬጠረገ እንዳልሞከሩ አራተኛዎቹ እዬጠረጉ እየከፋና እንዲከለከል እንደሚጠላ እየላላ እንግዶቻችን አስገዳጅነትና አዲሲቱ አልሰነፈም አመክሮ አሰልፋ አፍንጫቸውን እየፃፈ አፈቃቀድና አየየ እየፃፉ እየደረሰው አመዛኙ አነሳና አንብበናል አሳማኝነት አፀና ኦማን አሥርና አይለየኝ ኤዲ እስከመቅደላ እደውላለሁ እንዱመለከቱት አፓርትመንት እንታገላቸዋለን አወርዳለሁ አልፈጸመም እንደሚያወግዘው አይቻቸዋለሁ እየተነፈሰ እንደማይሳካ አስቅድሞ አለመሄዱ አልዩ አብነ አፈሙዙን እስትንፋሱን እንዲፈለግላቸው አልደረሰባቸውም እየፈረመ እንደሚበቁም እየተፈራረቀ አልሰጣችሁኝም አሳደጉ እረ አዝማቾቻችን አስፋፊዎች አስቀምጥ እዬዳበሱ አዛዦቻቸው አይችለም ኢሳያስንም አጎናፍር አቅማቸውንም እኅቶቼ እዉነትም አያገባህም አለመናገሩ እንደተወው አትገባም እንደምትጓዝ አሰፈላጊው እንዳትሰማ አባቶችም አከራካሪዎቹ እየተነጫነጨች እንዲሰራም አያቅተንም ኤፕ አሣድ እየታዘብኩ አጋሮቻቸውን አልሙኒየም እንዲሁምጨጨሆ አባሲያ አርጀንቲናዊ አሎሎ እስኪያዳግት እንደፈለገችው እንደታሪክ እንዲያደርጉበት አድርገውና አሰሳውን አበሳውንና አላኖር አልተማሩም አሎም እንክብካቤን እናውቅልሃለን አለመናገር እንደሚያሟላ እስራኤላዊው እንሻላለን እንዳይዘገብ እየሰበረ አሽከርካሪና አልወርድ አምሰት አዘጋጁት እየተገማመቱ እየሰበሩ አፀድ እንካፈላለን አሰሪዎችም እንዳይደለም አይተንፍሱ አለመስማታቸውን አብዚ አለቸው አሌክሳንደሪያ እስከመጠቀም እያረጋገጥን አምባዋን አስፍረውታል እናየው እንስቅስቃሴ አመልጋን እንዘክረው አትርሳው እንደሚሠራው እንደሚጠበቅባቸውና እየተዋከቡ እስዋና አብሯት እንዲመልስላቸው አገርቤት እንደሚደገም እወ አያጠቃልልም እንዲይዙት እንዲታነፅ አገራዊም አደረግህ አብዳ እየተከለከለ እናጤናለን እንደምታስጀምር አያመጣምም አልሰጠበትም እንደናፈቀኝ እንደሎጥ እየፀልይኩ አሣታሚና እንደሚባረር አልበገር እልልታውን እንደሚያምንም አውቶብስና እድምተኛ እነኝሁ ኢየሩሳሌምን አሟጠን አናግቶታል አያሸንፍም እንዳይወዳደሩ እመታለሁ እዥ አስፈላጊነታቸው እንደምንገባ አቅርብው አድማጩን እንደማይታዩ እገሌስ አለመመለሳቸው እንዳይቀርቡ አልተዘጋጀንም አርአያነታቸው አልባልም አደንዛአዥ ኢፍትሐዊና እንዲወስድባቸው አምባጓሮና አስቀምጠዋቸው እንዳጋጠሙት አስገዝተው ኢንዱስትሪነት እስከዛ አይለንም አይገነዘቡም ኦላ እየተበራከት አክላለች አድምቆት እንደሚፈልጋቸው አማረን አስተላልፋለሁኝ አጠናከረ እንግሊዛውያኑና ኤግዚኩቲቭ እንደምትዋጋ አንደዚህ አባሎቻችንም እንደሚመለመሉ አቅርባለሁ እንዳልተመዘገቡ አበባየሁ ኦሣ አላገደውም አትቀበለውም አያስተማምንም እየጠፋባት አጠናቅቄአለሁ አያፍሩም ኦራ አጠጥቶ እንዲገጥሙ አሥፍሯል አመጡን እንደምታውቀው እንደሰሙና አይርላንድ እንገር እናዳምጥ እንሠራ እንዳልተከፈተ እንደምትቀንስ እንደሰጣቸውና እርሻቸው አይሉንም እያየለና እየተሰጣቸውና አፓርትመንቶች እንድታድግ አለማሳየታቸውን እንደማይለዩ እንዲያሻሻል አስረን እንዲያቆምላቸው እንደሚበጅ አውሮፕላኖችንም እብድና እንዳልሽው አልተፈቀደልኝም አከራዬ አቅዳችኋል አናፍርም ኤርማኪ አገረሸበት ኤጀንት አይኖርምም እየጠላን አድርባይ ኢቲሳ አገልግልቶ እያንገላ