            amharicWords[16, 4] = "እየተጣሱና እየተከፈተ አጥፍተውታል አጋርነታቸው እንደሚበተኑ እንደተቀሩት እንደገለጡትም ኦኒስሞስ አሰማርቷቸው እርግጠኛነት አለፍኩት እንደሚጠቃለሉ አስለቅቋል እናስተዋውቃለን እንደተባረረ እንዲያጠኑ እንደሰጡና እስከመግባት እናበርክት እምነታቸውንና እያስመሰከሩ እንደሚያስጨብጡ እንደታማኝ አካፍላለሁ አላቆምም እናትም እንረከበዋለን እንደሚወስዱና እንደሚወሰድበት እየመገበ ኣማካሪ አዕምሮአቸው እንደፊተኛው እንደሰጡን እንዲበረታ አድላዊና እንደሚያጎላው እንዳላባቸው አጋምና አካውንቱ እንደተወሰዱባቸው አስረግጦ አከባቢዎችን እንደገለጹትም እየተፈጸመም እንድታሳይ አላልነውም አነስተኛውን አማካኝነትና አመሰገንኩ እየጨፈረ እንዲያሽቆለቁል አልጨበጥ ኦዴ እንደምታዩት እያስተዋለ እየቀመሰ ኢጋማን አብዳላሐ እስክትመጣ እንደሚያድግና እንደሚለያይ አወቅሁሽ እንዲሠራጭ እንዲስፋፉና አልተንፀባረቀም እየናቅን አያወሳም እንደተሰቀሉ አድምጫለሁ እየሸመተ እንደሚያዋጣቸው አትናገሩ እንጠቀምባቸው እውነትስ አደረገችው አልጋውን አይዞት አዲሱዓመት እንዲያለቅሱ እንደርሷ እየታጣ እንክፈል እንድንቀሳቀስ እንዳይቆም አዳግቷቸዋል እንዲፈቱላቸው አባትዋም አካባቢዎ እንዳለፉ እንደሚመስልም ኢይኅድግዎ አትናገር አጀማ አደራም አይጨቁንም እንደሚያስቆሙ አለመሰጠቱ እንደሚገባኝ እገሌና እንደሚፈጠረው አድምቀውታል እጮሀለሁ እሁሁ አልተመለከትኩም አላምናቸውም አሰናብቶ አለማሳደሩ እንደተመለከትኩት አማራጫችን እንዳሳደጉትና እየተስተካከለለት አካሄድህ አልተበገሩም እየተተቹ አለውክልና አሣልፈን እንደሌለዉ አምልጬ እንዲያጠቃልሉ አልተፈጸመም እንደፈጠሩት እንለፍ አርኣያነት አድርጌዋለሁ አመጣጡን አባይም አበላሽቶ አለመሟላቱን እየፈለፈለ አገዛዝም ኣድልዎ እንደገባኝ አንብቡ አዝማችን ኡራል አርገህ እንደተያዙና እንደነውር እየጋለ አሰጣጦች አጢኗል እንዲገባህ አድሮበታል ኢንቨስትመንታቸው ኢርምጃ እንዲያለቅስ አስገረመኝ አልፌዋለሁ ኤድሙንድ እርቃን እንደሚጠቁ እንደሰረዙ አሥሬ እየተሞላች አገርህም እነኩማ እርሣቸውም እራትና እስከሚሻሻል አሳስተዋል እየተደረገባት እየጋመ አልነበርንም እንደሚንፀባረቅ እንዳስገቡ ኤግዚኪዮቲቭ እንዲከራይ አጀቡ እየተንጠራወዘ አይቆጥሩትም እንደማይደረግና እንደተጻፈ እንደአካባቢው አውጥቶና እንደሚመሰረትም እንዳደረጉባቸው እንድንቆም እስትንፋሳችን ኡደት እንደሚያመቻቹላቸው ኤትራውያን እንዳስገባ አወጣበት አደረገብን አይሙት አብረኸት አስመዝግባ እየጨረስን እንደሆንም እስካልተለወጠ አኩሪና እንደሚያሰፈልግ አስቸግረው እየወሰዱበት እንደተዋጉ እንደተስፋፋ ኢቲጂ አላየም አወቅነው ኢዶች እየመለሰች እንድትለቅ እትብቴ እርሺ እንዱሉት እርሳሱን አውርዶታል እንደሚላቸው እንደሚወሰድም እያደጉና እንደሽፋን አሰፍስፎ እንደተቆጠረ እኛንና እንደምለው እንድታገባ አደረገልኝ እያጠናከሩት አይገባዉም እንደምታደርግና አሰተሳሰብ እንዲሰደዱና እንደየቅደም አፄዎች እንዳመጣችው እናስተውል አስመስክራለች እንዲያሰራጩ አያያዙን እስኪያበቃ አልወደዱም አጀንዳዎችና አሸናፊነቷን እቃቃ አድርጓ አድምቀው ኢሰማኮና አስፈጻሚዎችም አንባቢዎችን እንዲደጋገፉና እኛነታችንን አናፍርበትም እንዳስቀር አሰበች አያውቀኝም እንደባለሙያ አላጋጠመንም አዝዘን እንደሚኖሩትና እነግርሃለሁ ኤክስሬይ አይለዩም አንዳለበት አኩል እንደመብት አቀረበልን እክሳለሁ አስዋን እየመራች አለመኖርን አላደረሰንም አላወቁትም አደረጉለት አያምር እስኪሰጥበት እንዳይወሰን አውጀው አነዚህን እያሳዘነኝ እየተሰነጠቀ አውጣኝ እየቆሙ እንደሚያስጨብጥ እናትን እያሰራጩ እየተጭበረበረ አስቀርቷል አስገንዝባለ