            amharicWords[16, 5] = "እንዲተገብሩት አባቴንና እንዲታሰብ አስሯቸው እንዳወገዘ እያከናወንን አስተማሪዎችን አሮጌውንና እየመዘዙ እያስተካከሉ አሰበኝ እንደገቡላቸው አነጋጋሪው እንደማይቀመጡ አቅርቦላቸዋል እንዲፈረድባቸው አቀረበልኝ አብሻይ አስተየት እንድትረዱልን አናቢ አንመለከተውም አያሉ እሑድና እንድንቀርብ ኦኡር አክስዋርዚን እንዳይጨናነቅም አድርጋዋለች አልተጠራም እንደማይበልጥም አጨልሞ እናቆየው እንዲልላቸው አስቆጥቶ አይፈቀድልኝም እንዲያደርጉለት እከለከላለሁ እንግዶቻችንን አናቴ እንዲሠለጥን አንገስ እንዲከስም አባባላቸውም አታይውም እያገለለ አመራርነታቸው እንደገባችም እንደሳት አይቶና እያገለሉ እንዳጋጠመ እንዳቀረቡት አስወግደውና አይቶን እንደምተገኝ አንሰጠውም ኤልማን አሾልኮ አምባገነናዊና አሰብከው ኤልሲው እስካዛሬ እያዋጡ አማንያን አውጣው አውሏቸዋል አያፍንም አንፈልገውም እያዋጣ እዳለ እንዳይንቀሣቀሱ እየተጠቀመባቸው እየፃፍኩ አትብሉ እየተካነወነ እንደማን አድሮአል አለማንሳቱ አሥጊ አቃጠለኝ አምናችሁ እንሰለፍ አጀማመሩ እየተበሳጨ ኦዲንጋ እያነሷቸው እንዲሆናቸው አስመስክራችኋል እንዲያታልል አጠቃቀሙና እድላችን አካላችን አዉታሮች ኢሕአፓዎች አሠራጨ አይታችሁልኛል እንዘምታለን እንቆቅልሹ አምባገነንነቱን እንደተያዘም እርደ እንደሸሚዝ እንዲረጋገጥለት እቃህን አላወኩም እንስማማ እንድታዳብሩት አላሁአክበር አፍርሰን አሳውቁን አናብስቱና እንደሚዳሰሱ እንደሚያጠናክረውም አይሞቱም እምላዕሉ እየተመዘገበባቸው እንደማውራት አበላል አልሻባብና እንዳያገረሽ እወቅና እመም አሰፍስፈው አፈቀላጤዎች አጭረ አያቶችን አራምዳለሁ እንዲሰለፉና እንቅፋቱ እንዲጠቀምና አትፍራ እንድፅፍ አፍሪካዊቷ አይሰጥ አላማዎቻቸውንና አስገዝበዋል አመላላሽ እነመለስና እንዳለዉናእንደሚከተል እመር እጠይቀው እንዲያደራጅ ኣብዮታዊ እንደሚመታ አምቡላንሶችና እስማኤልና አደራዎ እንደተፈራረሙ አሪያስ እንዲዳረግ አዲቋላ አክሲዮኖችን እወድቃለሁ አለማወቅና አንከፋፈልም እንደተገዙ አስችለዋል አያዳግተንም እስማኤልን እንደተወጣ እንዳይጎድፍ እንዳስገኘላት አያኑ እንዲያገኙም አፕሊኬሽን አዉጥቷል እንደሚመነዘር እንድትቆጠብና እስከተቋረጠበት አሰላለፍም እየበጣጠሱ እንደሚነሱና እንቅስቃሴዎቻቸውን አጥባቂው አቃጥለዋታል አይጠይቁም እርምጃዎቹን ኦልብራይትን አንወያይም ኢዲኃሕ እንዲወዱ ኢትኖግራፊክ እንዳይፈስ ኤንዞ አትናገርም አይኤልኦ እንለምነው ኦሎምፒክን ኢፍትሐዊነት አስጊነት እንዳይመርጥ አስተዋፅዖና እንደገባው አለመጠየቁ እምነቷን ኣሳጣን እንደሚያጡና እዝን እንደምትመልስ ኢሜቴ እንዲያሰፍሩ እንነሳለን እንደምንሠራ እያመቻቸላቸው እየረገበ እየተርመሰመሱ አጠናክራለች እስከተደረገበት አግሪካልቸራል እንቆጳን እንንቃ አበላሸ አታስቡም እንዳያስቡ እንደተጎዱ አጭቶ እንዲያፀድቁት አወቅሁ እናጋልጣለን እንድነበር አፈንጋጮችን እንደተሳካለት እየተሳካላቸው እየዘለቁ አወቅህ ኢንስቲትዩትም እንደተተነበየው እያንከራተተው አለመጠየቅ እየተሻማ አናጢ አምበር አትስረቅ እየቀነሰና እየሰመጡ አልተካፈሉም እናካሂድ አጠፋለሁ እያኬሄደ እስኪለቀቁ እያደረጉበት እስቤት እያመላለስኩ እየመሸ አስተጓጉሏል አቀናብሮ አጋብተው አያሌዎች አደራጀ እኛጋ አናጺ እንዳየነዉ እስራታቸውን እንዳመቻቸ ኦቶሬ አላየው እንዲያጠራቅም እንበላቸው አውታሮቹ እየበላው እንደሚሻገሩ አሰማች አስቸግሯል አሶሳን አስፋዉ እየለጠፉ እንደሚሠማሩ እንዳላገኘው አላዳነም አይታማም አገላብጦ አይመሳሰልም አምሽቶ እያወጣሁ አራርቀው አስተዳደረን አይዋጥልኝም አቧራውን እንደቅኝ አበሳጭቷቸዋል እነርሱንም አገላብጨ አስከብሯል አወ