            amharicWords[16, 6] = "እንደሚያግዛቸውም አሰኝቷቸዋል አሳርፈውበታል አፈጉባዔም እርምጃዉ እያካፈለች አሣማኝ እርምጃዎቹ እንደተቃወመ እንዳባቱ አካይስት አከባቢዉን አስተያየትስ አስባችኋል እንዲደራጅና እየተቆጨ እናትነትን እንደሚከለከሉ አይመረጥም እንደተጋረጠባቸው አፍህን እንደሚሰጠውም ኢየሱስወርቅ አደገና አልሠራ አልተስተዋለም አወቅሽ እንዲያስተናግዱ እንደውነቱ አብልጣ እንዲያሳድግና እንዲቀርቡላቸው እያሳዘነው አረመናዊ እንደማዘን እንዲዘጋጅላቸው እየተጠቀምንበት እንደሚያደርገ እንድትወጣና እንደተናደድኩ ኢሕአዴግንም አላፈረም አያስቀምጡም ኢንስፔክተሮችን አይከብዳቸውም እስከተነሳበት አብልጬ አናትን እነግርዎታለሁ እየመቱ እንዲሰጣቸውና እንደተደመጡት አለመላው አናጺው አይወስንም እንደማይደራደሩ አለመዋሉ አዳማቂ እንደምትይዝ እንደሚተላለፍና አለምና አስጎዶም አካባባቢ እንዲቆፍሩ አኪን አቅርባላቸው አናታቸውን እየታጀቡ አይታለፍም እናገኝበታለን እያባከኑ አቋማቸውንም ኣገላለጽ አምጡልን አሽሊ እዩዋቸው እንዳስታውቁት እስኳድሮን እያስተባበሩ ኣድርገን እንዲታወቅልን እንክብካቤው አይጠቅምምና እየፈረጁ አለማቋረጡን እርዛት እንሰሳቱ አይሮፕላኖቹ አደነቅን አጥናክሮ አይበላ እየተጠቀምን እየከሰስን አጣዳሪ እየቆዬ እጠረት እንዳልተላለፈ እንዲቆፍር እንዲያድርባቸው እያስጨበጠ አስቀምጧቸው አባባልህ ኣሳሰበ እንዲት አቀራረብም አበዛችሁት አምጡልኝ እዚህችው ኢትዮቲዩብ አስገብራለሁ አጨብጭቦ ኤክስፖርትን አሠራርንና እየሰራሽ አጥተህ አኅጉሪቱን አንዳንችም አላዩም አለማድርግ እየተሰማው ኤጀንሲውና አልመክርህም እየገባችሁ እንዲደግሙ እጩዎቻቸውን አይዞአችን አስገብተን አቶምሳን አክባሪና እንዲተባበረን እየተጻፈ አባላትስ እውነቶችን እንደትና አይታደርም አነጣጥረው አይገቡኝም አትውጣ ኢዴሃህና አግጥጦ እናቶቹ አሜሪካው እንደሚሸፍንና እንደሚመኙ እንዲነደፍ አቃቤያን እየሰበከች እንዲያውቁትና እንከንና እንድትሰበስብ አቅርቦታቸውን እንደሚያደረሰው እየፈጠረና አሰቡት እንደተገለጹት አልጫወትም አመኔታም አይፈራ እጠቅሳለሁ አዋጭነታቸው እንደሚያጣራ አረሜናዊ አስጎብኚዎች አስታጥቁት እንደሚቀል አፃፍ አልሰራህም አያሰኘውም አልተመሰረተም ኢትዮጵጵያ እንዲመረቱ እየተፈጸመበት ኡጋዴን አካበቢዎች እንዳልፈፀመ አላሙዲንና እየታፈሰ አሰሪዎችን አይፈስ አደረሰው አስተያየቶችንና አስተዋለ እንደሚመክሩና አደገኛው አትከፍትም አስፈራቸው አስተዋሉ አዝለው አልቀረችም አስተሣሠብ እንደገደላቸው እየተነሱና እንደሚችሉበት እንዳልፈፀሙ አለመመገብ እንድትቀጥልና እስከተላለፈበት እየከፈለና እሥላማዊ አልሰጣችሁም እስከገደፉ እንዳይሰናከል እስከመወሰን አንም እንደማይበቃ አላስገቡም አባባልም እየጎበኘ እንደዕቃ አስናቀን እንደሚደርሰው እንደሚያሰማ አብቃይነቱ ኢትስ አዲቀይህና አካሏ አባባሽ አመርጋን እንደጀብዱ አንሰማችውም እንደመጨረሻ እንድንገኝ እየታየኝ አውግቶ እየተመገበ እንዲቋቋሙና አቻምየለሽ እየተነበበት አካም እንደማይዘጋ አልሸሹም እየመለሱ አልፈርድም አይፈጸምም እናጣጥማለን እንደሁለት አንሼ እያጣራን አትሉም አስፋፋ አዝማሚያም አልተደረጉም አሳክቶ አይገልፅም አሳጥቷቸዋል አንቃ እንዲሰጧት እንግለፅ አልተጠቀምንባቸውም እንደገፁት አይካለልም እያሰፋና እንዳልነበራት እንዲያስተናገድ ኢንዱስትሪም እረቂቅ አድርጌም አዘምቴ አምባራስ ኣንደኛው አልፈጽምም አላጋጭ እየተማርን አጥጋቢም አዛዥነትና አትቀርብም እንደሚደርሱና እንደምናስመዘግብ ኢሳክ አልባራዲ አይጥና አይተርፉም አዳምጡኝ አዛዥነትን እንዳይሰደዱ አፋኝነት እቀጣለሁ እንቆጥረዋለን አከሸፈ አወገዙት አወረዳቸው አውግዟቸዋል 