            amharicWords[16, 7] = "አረቢያንና አይጨነቁም እያደረግነው እንደሚረዱት አፍርሷል አሽከርዋ አቀፋዊነት እንዳልተዋጠላቸው እንደሞላቸው እንዲያነሳም እዚያና እንደጋሪ እንደሚገበ እንዲገድል አዴግን እንደጋዜጠኛ አትለፍ እንደሚመቻችም እንጀምረው አንደኛውንና አልከድር እድሏ ኢህአደግን እንስተዋለን እንዳይሰደድ አትሌቱን አቤቱታዎቹ እንዳይጎበኙ እንደማላቋርጥ አውቶቡስና አደረገውም እየመሰለኝ አስቀመጠው እንደሚቆጠብ እስከታመነበት እባክዎትን እንዲገላቱ እንዲቋረጥባቸው እያለህ እንጓዛለን አመለካከታቸውንና እምክብራን እንድትከተል አጋማሽና እቀርባለሁ እያዘዘ አስተዋዋቂ ኢንጅነሪንግና ኡርጌ አውራጎዳና አውቶቡስን እየተሰቃየን አይዘንጉ እንደተነበበው አሉባልታውን አዘንተኛ እሥራኤላዊያን ኢስተርን ኢታሊያ አላትና እያሽቆለቆለና እንዲፃፍላቸው አደረግናቸው እየጋበዘ እንዳልተካሄደ እንርሳው እንዲያውቃቸው አረር እንደሚጫወትም እንዳረካቸውና እንደመከኑ እንደተፈረመ አንመጣም አግባብተዋል አሣዝኖናል አልገዙ አገሪቷና አይተ አክወርዚ አልፎት አይሮፕላኗ አመካከት እንደነገሯቸውና አማርኛና አድርገውልኛል እንዲታለፍ እንደሚደነግገው አስመርቀን አስረከበች እንደሰበሰቡ አተኩራ እንዳይጎበኝ እንደነበርን እየመዘገቡ ኤፍኤኤ እየተዟዟረ አልቻልክም እሰማ አገልግልቶች እዬጠራረገ እንዳሽመደመደ እያሰገረመኝ ኦፒዮ እለምንዎታለሁ አልገባህ እያደሩ አያድርገዉና እየተንገላታን አንሺዎች እንዲዛባ አዝማሪው አትበሉኝ አላልቅ እድሪስን አስቆጠረ አገዛዝንና ኤርትራዊውን እንደሚያሰሩ እንቅልፉን እንዳይለቀቁ እንዲገኝም እያደሰ እንቨስትመንት እንዳይታለሉ አብሬያቸው እንዳጠራቀመ እነበቀለ እያደሱ አትደግፍም እንቅል እንዳትመታ አገለገሉ አይኗ አምበጣ እንዲገቡላቸው እያጠኑት አካዝ አሳባቂዎች እንዲበለፅጉ እንዲሆንልኝ እንድትጠነቀቅና እስካሁ እስክሪብቶ እንደመሣሪያ እጨነቃለሁ እንዳባረራቸው እስካልቻልን እየሰጠና አካፍለዋል እናቆየውና እውቅናቸው እንፃፍ አካያ እዝችጋ ኤልያስና እያደረሰባት ኤግዚቭሽን ኢሰያስ እንዲያቀኑ አትቀበልም እቅስቃሴ ኤርትራዊያ እንዲቀል እንድንፈታ እታገኝና አርቃቂነት እንዲወሰንላት እንደሚገዙና አስፈራርተውናል እንደሚሰጉ እንዲደጋገፉ እያስጠበቀ እስኪፈፅሙ አናግሮ እንኳንና እንዳይረቅ አስመስሏታል እንደዚያም እየተበዘበዘ ኤንቬሎፕ እንዘጋጅ አደርሁ አስደናቂው አስፍሮአል እናንተንና አኬል እንደሚትጠራ እናሳድግ እንደየአቅማቸው አይሻሻልም እያሳወቀ አይደነግጥም አዋቂዎችም ኣሳልፎ እስኪይዙ አትባባሽ አይስተዋልም እርቃኗን እንደፈረደባት እየቀጠሩ አፍረጥርጠን አቀባበልም አነጣጥሯል እንዲፈቱልን አንፈርድባቸውም አላላውስ እንዲያፋፍሙ አረካ እንደሚገነዘበው አስታማሚዎች እንደሚሆነው አንጾ እዬቀደሰ አፍንጫችን እንደወሰነባቸው ኤነርግይ ኤሪና እንዲጠናከርም ኤክስፖርተሮች እንቢተኝነት ኤሪን አንፆ እንደሆንን አመሠራረትና እስከሚቸግር አይይ እንደፈነዳ እንዳሰራቸው አያቀራርበንም አህጉራችንን አትክልቲ እምነቷ አላስደሰተውም እንደሚከፋፈልም እያየለባቸው አበጀህ አደርም እናበለ እቆጥረው አልነበርም አያከራክረንም እያስገበረ አይወራም አይክዱም አጠናለሁ አሰሳው አድራጊውን እየተፈታተኑ አከራይና አሳኢታ እንደሚያዋጡ እንደሚትሰራ እንደተጠቆመዉ ኢጣልያውያን አላመለጠችም እያጠኑና አካፋ እያወጣና አውጥቻለሁ አንዲትን እንዳቆመ እህሎችም እየተዘረጉ እንገምግም አረዛ አለማሳደሩን እንዳይጠብቅ እንደህብረተሰብ አደንና እንዳልተሰጠበት እንደተሰለፈ አሳልፌያለሁ አንክድም አለመቻላቸውንና እንደሚያዋጣ አበቦችን እንደገለጠ አያመለክቱም እንደተሰለፉ ኤግዝቢሽን እያዝናኑ አናምርቱም አ