            amharicWords[16, 8] = "ኢንዱስትሪስ ኢትዮጵያዊነትና እንዳደርግ አየሁና እንዳይቀበሩ እያሰማራ አመሰግናቸዋለሁ ኢሌክቶራል አገርአቀፍ እስከማጣት አልቀባም እንደፈለጋቸው እነግርሻለሁ አይታየውም አስፋፍተው እንዲሸፍነው አዳራሾቹ አስተላልፋ አስቀድሞና አይጥፋ አከባቢን አየሁኝ እያወቀና አድርጎአል እዬተደበደበ ኤጀንሲዎቻቸውን አለመድረሳቸው እንደቆመና እስካልቀረበ አንዱአለምና እንደሚተገበሩ እስኪለወጥ እንዲያንሰራራና እንደደረሳቸውም አስቀራቸው እዬሞላ እየሟሸሹ አምሳር እንዳይተማመኑ እንዳባረሩት አረጋግቷል ኢንሹራንስን አስቆሙት እንደሚነግሩን እንዳልሆንኩ እንዲተኳቸው አልወጣውም እንዳወገዙት እየተላጋ አውሮፕላኖቻቸውን አስቀድሰው አምነህ እያስታወቀ አባሪዎች አይቲኤፍ አቀንቃኝና እንዳላወቀ እንጭኒ አልደርስም አይማን አስኪያጁም እንደምክር እየተንቀሳቀሰና እንደሚቀርብላቸው እንደሚያምኑት አይዋሽም እየተሳሰብን እንዳይተማመኑና እንደሚጨምርና እጮኛው አይዘነጉም እንደሚጠላው አለመመደቡ እንደሆንክ አክስወርዚን አዘጋጆቹም አኖድ እንዳደረጉና እየተሽከረከሩ አድርገዋለች እያስታጠቀ እንደፀናባቸው አልቀረለትም ኤርፖርቶችን አቅጣጫችን እየሰገዱ እንደየዘመኑ እንደአሁኑ እሳትም እየተንቀሳቀስ አለመሥራቱን እንደምንጫችን እንዳዳነ እያስታጠቁ አርጋገጡ እንዳስታወቋቸው አጥጋቢና እዬተባልሁ አስገዶምና እንደሚጎድላቸው አብዛኖቹ እያንኳኳ ኦሞራቴ እየቀማቸው አለመነሳታቸው እነደሌሎቹ አለመመደብ አያሳዝንም አጨብጭበው እንዲታደል አስፈሪነት እንዲከበርም እንደሌለብን እናስተዳድራለን አላስተላለፈም እንዳያየው እንደማትፈቅድ እዬተከታተለ ኤምሬቶች አያውቁ አላነበብኩም አሞግሰውታል ኦፔራ እያሳለፈ ኢስታ እንላክ እንዲያብራራ አያታልሉ አጃኢብ እንደሚያስገድዷቸው እንደሥራው እንደማያየው እንዲስማማ አዳማዎች አንቱታን አዋጆቹ እቀትር እየተመደበ እንደማያስፈልግና እንዲማቅቁና አያሰጠውም አያጣውም አሳስተው እውነቶች አንድምታም እንደሚያደረግም እንደአነጋገሩ እንደሰማነውና እንዳስቀመጥነው አላሰሙም እያጣቀስኩ እያመቻቸች እየጠራረገ አንለያይም አልደፈሩም አይመለከታቸውም አልነበረብኝም እየተመሙ አውሮፕላኖቹም እየተባረረ አውዓሎምን አድርገሀል እንግልቶች እንድትጓዝ አውርደን አልተቀበለኝም አንዳሉ እያጭበረበሩ እየጠበኩ አኗኗራቸው እደላና እንደአለበት እንደተለያየን እንደማያከብር እድግት አዙል አጫውተውናል እንደሚደነግግ አሰላለፍን አስገቡኝ አርቅቆ እኩልነታቸው አካልነት አስመዝግበናል አመሰው አሻንጉሊቶችን እናበረታታለን እንዳይዘግቡ አገኙና እያመጣሁ ኤርትሪያን አድራሻና አረንጓዴና አደርኩ አስኪጁ አበጀና ኢዜአን እስካልተወገደ አዋጥተዋል እንችላለንና እንዲታደሙ እንድናየው እንደሚገኙት እየተከታተልኩ አቀርቅሮ እየበከሉ አመልጋ እያሠራ ኦርቶክስ አይመለከትህም አስራለች እንዳልተዘጋጀ አንዘነጋም እንዲስፍን አልቀነሰም አራምደዋል ኣይባልም እንዳይታተሙ አስቤአለሁ እንዲያጠፉ እየተነፈጉ እንደቀረና አለመሆኔን አልገጠመውም እንዲቀይሱ እንደሚያግዘው እንደሌለብኝ እራሱንና እንደተነጠቁ አይገድብም አስብበት አወድሰዋቸዋል አጣሁህ አስነስታችኋል እንደወሰነበት አለመታወቁንም እያገኘን አልዛውሃሪ አስቸግረዋል እየመነመነ እንደሚያከናወኑ እንቀላቀል እያሳሳቀ አስቦበት አንደነበረ አሰምቶናል አካሂዶት እንደሚሟላ እንደአሜሪካ እንደምትጫወት አለማሰብ አለቀላት አባባልዎ አስካሪ እንዳትደውሉ እህቶቹ አብጠልጥለውታል እስካረጅ አድቬንቸር እንዲፈትሽ አክሲዮንን እንደሚያግድ አስመጪዎችም አያናና እንደፃፈው አረብኛ እንደሚከታተልም እያወረዱ እንደመዥገር ኢትዮጵያዊያኖችን እንድትድን እንግባና እንደጠ