            amharicWords[16, 9] = "እርምጃቸውም አልዘነጉትም እንደሚጠይቁም እንዲጠይቃቸው አበረታትተዋል እንዳልኮራንበት እያመቻቸን አንጀትን እንዲያቋቋም እንድናጣ እንደሚከታተሉትና እየተንሸራሸሩ አስፈላጊዎች አለመስጠትና አልሰጡበትም እንዲንከባከባቸው እመጨረሻ እየተወያየበት እንዳልገናኝ አናካሂድም እየተቀራረበ እንደነገራት እንዳስቆጣና እንዲያልቁ እንዲተባበሩት አድራሻዋን አዎንታዊና አክሲዎስ አስተባባሪዎችም እንዲሰጤው እውቀቶችና አቅልለው አመካኝነት ኢስማዒል እንደሚያሸጋግር እንዲያስተሳስሩ አስቀምጦልኛል አምልክተዋል አደርጅ እንጭጭ እንደወሰደበት ኣስተማሪ አውስትራሊያዊ አላመነቱም እልቅና አስከባርዊ እንደሞከረ እንዲስተካከልለት እንደመሩት ኤሚግሬሽን እንዳሰብነው አይነሳ አንቀፆችን እየተገበረው እንደአያያዙም እንደሚመለሱና አገልግሎቶቹን አክበሩ አሳልፈናል አደርግ እጣቢ እንደሚያሰፍር እንዲባልና አይጠየቁ አልሆንሁ አበሰረ እያስቻሉ አበሰሩ አንችለውም አረጋዊያኑ እያነከሰ አፍሪቃው አናስፈትሽም እንግዳም እንዲመርጡና እንዳንገናኝ እሆን እንደሚተጉ አብነትም አያይዘናል እየተቁነጠነጠ አገዛዛቸው አላሸነፈም እያሰማን እባብና አድርገዋት እንዳወሳሰበው እባብን እንደመጫወት እበልጥ አሳስቷል እንዲጠይቅና እንደምትሳተፍ እንዲኖረዉ እየተስተጋባ እንዲቆጠቡና እናስጠብቃለን አቀኑ እሁንም አውታሩን አለማየሁና አልታሰረም አልፈጠረም አውሮፕላኖቻቸው ኢያሪኮን እንዳሥላሴ እንዳናመራ አልሸባብና እንዲሳካም አያደናቅፈውም እጣኑ አውቅልሀለሁ እንከኖች እንደፈጸመ እንደምትጠቀምበት እንደሚነግሯቸው እንደተረዱ አምነዉ አናፈርስም እንደፈጸሙ እንዲገባው አዳምስ አእምሮአቸውንና እንደሌሉና እየተገበሩ እገነባለሁ አለመውሰዳቸውን እንደማኖረው እያሉት እንፈራዋለን አጧጡፎታል እንደተረዳ እየጎሉ እልፍኝዋ አገልገሎትና እንድንበታተን እየፈላ እየተባበርን እንዳየኸው አክትሟል እናሞኛችሁ አስገኝቶለታል እንደተሳካላቸው አልተነሱም እየደባለቀ እንደማያውቁትና እነቅስቃሴ እነበረው አሠልጣኞቹም አጉልተዋል እያዞረች አምስትም አትቀሩም አቡጊዳ አድሃኖምና እንደሚፈፀሙ ኢንቬስትሜንት አስተውላለች እገላለሁ አይሞከር ኢትዮጵያኖቹ አለውን እንደተለወጡ አይጠሩም ኢትዮጵያውያቱ እየበደሉ እንደነበራችሁ እንዲያግዘው አንመልስም እቴጌን እንቀስቃሴዎችን አልተገለፀለትም እየተናነቃት እንዳስፈለገው አተዋፅኦ ኦፕን አጋጣሚዎችም እንደምትሆንና እንደገጠሟቸው እንዲረቀቅ ኣስፈለገ እንድንገነዘብ አበልን አልተዋጠላቸውም ኤቨርግሪን አነበበችው አመሰግናታለሁ አልተፈቀደለትም እየወረረች እንዴታ እንዲተላለፍባቸው አሉባት አጋሮቹና እግዳ አላበድርም እከክልኝ እያሉን አልፋራጅ እስኪሰጠን አቀዱ እንደሚያሸጋግራት እንደግዜር እየፈራ እንዳያስፈልገን አንትሮፖሎጂና አንደሚሉት ኢማሞች አንሺያቸውን አይደለሁምና አጋጠመ አሰልጣኞችም አይንዎን እንደሚሰፍን እዬተሰቀዬ እየበራ እንዳልተሳካና እንደመረጣቸው አቀባብለው እናደርሳለን እንድያውም አትርፈን እንዳንጠቀም እዘፍን አድርሶናል እንዲያስታውሱ እንዳቅማቸው እየተመሰከረላት አስጨንቆት አርእስተ ኢኖቬሺን እለምንሃለሁ እባካቹ እንዳንሳሳቸው እንደሰለቻቸው እየለቃቀሙ እያደርገ አቁሚ ኢንቨስትመት እየገዘፈ አሰፋች እንቀጥለው እንደተወካዩ አብሳር አሉኝና አቀናባሪዎች አገልግለናል ኢንቫይሮመንታል አጠናክራችሁ ኧረግ እንዲደርስለት ኦሣማ እያስገረመኝ እገዛለሁ አቅደውና እስክርቢቶ አለቃቸውን አይገድም አፍሪኮ አብዱልዋሲ እንደታየበት እያጠረ አፈሯ እናስገኛለን አለመፈፀም አተገባበሩን አጄንዳ እንደሚጠቅምም እንዲጋፈጣቸው አረዱት እወስደዋለሁ አስክንድር አለመርገቡን እየቀለለ አቅሌሲ