            amharicWords[17, 0] = "አለውያ እያጠቁ አኻዞች አውርዷል እንዲጠቃለሉ እንደረጋ አለማረጋገጡ እንደአካሄድ አይፈረድባቸውም እየተቃወምን እኋላ እድምተኞች እንደተመለከተችው እያስገባን አጀምአ ኡትማን እየገለጽኩ እንደሚፈተሽ እንደሚችለው እዬተጫወተ እምሩን እንዲላበሱ እየፈሰሱ እንጨትም አንሰራርቶ አፈሳው እንዲያሣውቁን አሠልጣኙን እነግርማይ እንደሚካሔዱ እንደሚያቃልለውም እውነትሽን አትበይኝ እንድሪያስን እንደተላከና እንዲበታተን አሳጣን እንደሚያምኑበት እንደመሸበር እየደራረቱ አበክሮና አርቲስቶችም እየታመነ ኤርና አሳድሮብናል አፋሮቹ አምላካቸው እንዳረጀ እንዲዳከሙና አታድርም አቋማችሁ አይከል አልሰሜን እያጠበ እንዲያፋጥኑ አይረታ አይስተውም እንድረዳ እንዲቀርቡለት እንድታሳውቁን አንታዲዮፕና እንደሚገኝበትና እንደተመለከቱት አይበላም እርሳቸውንም አለመስጠታቸውና አጠናክረውታል እስኪስት ኢዲህፓ አሰለፈች እስካልመጣ እንደሚውሉም እንዲያበረክትም አይመራም አገልግሎቷ አለመውጣታቸው ኣስሶቺአቲኦን እያፋጠነ እንድንመለስ አይሳካላቸው እንዳቀዱ እንዳትችል እንደሚስተዋለው እያታለሉ እንዲያቀርቡም አልስቶም አይሉኝም እደነግጣለሁ አባቱም እያመጣን አቀበለች አለመፈፀማቸውን አንሺና አንተባበርም እንደደቡብ አንቴን እንደማይጋለጡ እየተቹበት እንደዚያን አልተረዳውም አዕላፋት እንዳይገደል እንደስሙ አግባቡ እየወጋ አስተዋይነትንና ኢንዲፐንደነት እንደማይመስላቸው እየተሰጠባቸው እየፈካ አዱሱ እንደማይደፈሩ አደንቃቸዋለሁ እምየ እያዳረሰ እንከፍታለን አላቆሙም እስከመቆጣጠር እንዳይደፈር አልጠየቅም አድያም አደረገለት እንደውስጠ አግዝፈው አጠፋፍ እያስወጣ አቅዳለች አደናግጧል አትሌቲክ አስገብተዋቸው እንደሚልም እንዳለመታደል እየሰጡና አልተወም አሳጣው እንዳንዘነጋው ኤሪክስን እስኪፈቱ እንደተወጠረ እንዲሰማቸውና እየሰጡን እንዲያጅቡት እያንጓለለ ኢምፓወርመንት እንዲታደላቸው አራጣ አለመደማመጥ እንዲደርቁ አልሠሩም እንድትታገድ እያስገነዘብን እናወርዳለን አሰላስላለሁ እንደሚመክርና አልባዎች እንድንጫወት እንዳሳዘነውና አገርነቷ እንደተንቀሳቀሰ አውሳት አወያይቷቸዋል እስከመስጠትና እንደተካፈሉበት እንዳጀማመሩ እንድንመለከተው አይለቀቁም እርሾዎች አይፈቀድለትም እንዳከናወኑ እንደምታሰለጥን አልተጠቀምንበትም እያድረሰ እንደተሸረሸረ እንባዬን አጥተውት እንደሚተከሉና አጥንቴ እንደምንሆን እንደብረት አኙዋ አይይይ እንዲማሩበት እንድትሞት እንዳልተሰማሩ እንዳልተቀበላቸው እንደማስፈራሪያ እንዳይሸረሸሩ ኦርቶዶክሶች እንዳያሰማ እንግዳና እንዲያሰፍኑ እያስታወቀች እንዲያስተምራት እንደተገኙና አንባቢው አንድምታቸው እንዲፈሉ አክሽፎ አሰልፎት እየተደበቀ እየጨበጡ እንዳልነው እንዲፈላ እርባታው እንዲከተልና እስካልተያዙ አነቃንቆ አሳዝኖት ኤርትራዊነታቸው እየተጠቃለለ እናቆያቸው አገኘቻት አምባሻ ኦነጎች እየተጋነነ አላስተዋለም እናበረታታ እንደቁራ እያደራደሩ አጋንኖ አይዘጋውም አሰልጥናለች አንደኝነት እንደግብርናው እያወቁት አኩርፎ አምባገነናዊው አውርተዋል እያዳመጥኩ እንሣተፋለን እንዳይሰመር እያስከበሩ እንደሚያሰጋቸው እንደሚተዋወቁና አቃቂር አዳሪዎችና አቃተን አጣጥፈው አፈፍ እለተ እንዳንሄድ አንጺሖ እስከነጭራሹም እስከመሰረዝ አመላካከት እየጋለቡ እፈራዋለሁ አደራጅተዋል እንደሚያነጋግሯቸው አዳሪዎችን እያማተበ አዋለው እንደሚያጤኑት እጠብቅ አቤቱታዎችም አልሰይድ እራሣቸው እንደሚሰራጩም እስታር ኤምፓዬር እንዳሳለፍን አስተማማኝነቱን አምላኬን አድርጎዋቸው እንደሚረከብ እንደፋለን አይጠቁሙም አለመጋበዙን ኤክስፖዎች ኢትየጵያዊያን አውጃለሁ እየሠራበት አጋቾች አትሌቶቹና 