            amharicWords[17, 1] = "እንድከራከር እያረቀቀ እንዱላት እንዳስቀመጥኩት አባሎቻቸውና አካባቢዎችንም እንሰራ አመሏን አዘጋጆቹን ኢሣይያስም አሀዱ አስገንዝቦናል አስመዝጋቢ እንዲንገላቱ እንደጻፈ አያርፍምና አላምንበትም እየተሠራባቸው እውነትነቱን እንዲቀረቡ አያስቀረውም እበት እንደሚያስገድዳቸው እንዳላሳደጉ እስከመስከረም አለማምጣቱ እንዳልተለወጠ ኢሜሬትስ እንደሚጠበቅበትና አይጠፉምና እየጎዱት አለቆችን እንዲያስታውቁ እንዳይለጠፍ እንደተሟጠጠ እየዞርኩ እያዘቀጠ እንዳይሆንብን አበሳጭቶ እንደተከፋፈለ አጣራሁና እያጉረመረመ አስታውቂያለሁ አስተላላፊዎችና እንደጠየቁት እንዳልሳተፍ አቋሟንም እንደማያስጠብቅ አብዱልፋታህ አይብስም አንፈራጥጠው አዲሡ አልነበረውምና አያያቸውም አሁንና አስንቶ እንደተቀጠሩ እየተመዘኑ እስራእል አባላትነት እንደሚያዘነብሉ እንድገለጹት አይበቅልም አህመድም አትችይም ኤንዶውመንት አድርገውባቸው አለማነው አበባቸው አክሮባት ኤትህኒች እንዲሻሻልላቸው አምባና እንወሰን አተካክ እንደሚያጸድቅና እንደተከፋፈሉ እንደሚከፋፈልና አወቁትም እንደሚገቡም እንቅስቃሴአችን ኢያሪኮ አፈላላጊዎች እንዳስረዱ አደጋዉ አነጋግረውናል ኢልሚ ኢልማ እየማሉና ኢንጂነየር ኢትዮጵያውንና እየተደረ ኢኮኖሚያ አድርግና አይቻልምና እንዳስረዳ እንዳቀፈ እናሳይ አስጠርተዋቸው አርሙ ኢዴፓዎች እንዲረዳና አጣድፎ እንዳንሳተፍ አንደሚችሉ እንደቀየሩ እንዳንተባበር እንደማያደርጉ እንደተሠራ አሁንኮ አቡበክር አለባበስን እንዳለብህ አርሦ እንደሚያሳስባት አለቃን አሳድዶ አያጣፍጥም አገልጋዮቹን እንለማመደው እንደተፋጠጡ እንደማይኖሩ አውዳሚና እንዲህና አነጋግሩ እየተሟሉ አርስ አስተያየቴ አብነግ አነጋግራ እንዲወሰዱና አይገባዎትም አንደሚችል እየተሟላ እስከማውጣት እንዲጎለብትም አከሲዮን እንደቀነሱ አጨብጫቢና እንግሊዛውያንና እስከሚፈፀም እንደሰጣቸውም እንትጋ እርማቸውን አዋራጅ እልልል አካተው አሰሪና እንደተገኘም አማራጮቻቸውን አብረነው እንዳስፈለገም አነሡት አቡድል እየመነዘረ ኢንዲያ እንዳሰብኩት እንዳልታወቀና አድርጉልን አገኛት እስሩ እንዲረሽኑ እንገነጥላለን አደጋውም አለመክፈል እንዳያማህ አይሰጡትም እንዳገለገሉ እንደሚገመግም እንደሚያገለግልና አስታውቆአል እንደምትፈለግ አያጣላንም አፍሪካዎች እቆማለሁ እንዲተኮስ እንግሊዝኛና አትኮነኑም እንደሚፈርሙ እንድትጫወት አርፎበታል አከላከል አስበውም አላስገረመኝም አለመሳካቱንና አብዮታውያን እየተገነዘቡ ኢብሣ እንዳኮራቸው እንዲያነሣ አቅርበዋቸው እንድገረም እንዲሠራለት አሳጥተው ኣዳዲስ እስቅ እገዳውም እያነሱት አትሆኑም እያደረክ እንዲስት እስኪግል አመጽና አይሆኑ እንግዳየ እርግዝናና እርሙን አያነሱም እንደሚወጣላቸው ኦሮሞውም እንዳመለጠ አልተቃወሙም አስተሣሰብ እንደምንታዘበው እንክትክቱ አደረጉን አለመውሰዳቸው እንድትወሰድ እንደታጀበ እንደሚሉትም እንደሚጋጭ አድርሰን አደባባይም አይወዱትም እንደምታወቀው ኢቲሃድ አጣቅሰው አድማም እንዳይልኩ እንደተከሰተው አቀራረቡ አስገንቢዎቹ እንደገለጹለት አታስበውም ኢሕአዴግንና አያሳስበኝም አይቀመጡም አልተስተዋሉም እያኖሩ አድርሶን ኢንተግሬትድ አምባየ አይረሱም አንዣብቦ ኢሃዴግና እውነቷን አሰራሩም አትሆኝም አይጫንም እንጠቀም እንዳስቻ ኢሃዴግን እንደነበሩባቸው እስከተገኘ እያገኙና እንዳይልክ እንደማግኘት እንሙት እንዳይነሣ እንደማያደርጋት አልጠጋም እስኪላጥ እንዳይኖረውና እንዳይቋረጡ እንደሚያሳስብ እንድንል እረዳታ እየለቀሙ እንደሆነስ አዋሉት አያቅትም እንዲገልጹልን እንዲያስሩ አስራትም እንዲረግብና አለመቻልና እመነት አላቀረብኩም እንዲጤን አስታከው እንዳይታሰ