            amharicWords[17, 2] = "እግብር አሕጉር እንፈራረማለን አእምሮዋ እንዳመለጣቸው እንሰብካለን እንድትሰጠን እየተስማማ እንዳይሰራጩ አበቃለት እንይዛለን አፍሳሾች እውነታቸው እንደሚከናወንባቸው አስደነገጠ አያቅተውም ኤጲፋንዮስ አውቀህ እየተገለበጠ ኢንስቲቱት ኦፕሬሽኑ እንድናከብር አይነገርም አይሳኢታ አቋረጡ እስከገባን እንዲያብብና እንደሚቀርቡና አልጠጣም ኢንሹራንሱ እንድንቀበላቸው አያስደስትም እርሳቸዉና አርጌ እንሰሳትም እንዳይፈጥርና አልነገረንም እንዲስተናገድ እንደሠራሁ እንቀሰቃሴ እስካልወጣች እንደማይፈጥር እስኪሰማ ኢህአዴጎችን አርቲስቷንና አቅጣጫውም እስከወጡበት እየሳቡ እንዳስደነገጠው አልመረጥንም እያወሳሰበው አፍዎን እንድታስረዳ አለምገና አሰብህ እንስሳነት እያስመዘገበችና አይሰሙም ኤሌክትሪፊኬሽን አስተዋፅኦቸው አቅራቢና እየተሰጠበት አዲአቦ አጫሽነት እንዳስላሴና ኢትጵያዊ እንደመጽሐፉ አለመዳበር አስተለለፉ እየፈፀመች አወጥቶ አንቸገርም ኢትዮጵን እንደፈርን እንደዜጋ እየተንፈላሰሰ እንደመሰሉ እየተነዛ አብዮተኞችን ኦርትቶዶክስ እየሳተ አቅርቦትንና አመርቲነሽ እየከሰሰች አከፋፈልን አንጻርስ አንዲኖረው እንዲሻሻሉና እንዳያዩት እስከገባኝ አለባብሶ አጠጥተው አይሰለቸውም እንደሚገፉና አያያዝንና እንደሄድኩ እንቶኔ እየተደጋገመ አወያይተዋል አያልቁም እየተሠራለት አዝን ኤመርገንችይ አፋሩ እንዳይዘጋ አትጣላ እየጠበቀን ኢየሱሶች አስቸኳይነት እንዲያወርሱ አላላትም አዋልዴጌሳዎች አልፈልግህም እህላቸውን አከሱም አልጣረም ኦሊምፒኮች አላረጋገጡም ኣለመግባባት እንዳትሳተፍ እስኪቀርብ አስተማሪዎችም አውጥቶበታል አመቴ አስፍነዋልና አልመች አዘቦና አይቻል አላደረግኩም ኢራስተስ እግረኛው እንደሄድክ እስኪጠራቀሙ አዲግራትም አጋጭቶ እየተከበሩ እስኮር እንግታ እንደደረሱና እስከሚያልቅ አለቀሰች እንዲካሄዱና እንደሚያስከትልና እየተንጠባጠበ አስተዳደጋቸው እንደማይቀርቡ እንደሚፀድቁ እንደሚሠሩት እንደሰነበቱና እንደሚቃለል አብዲኑር እንደታሰረች አቃልልልን አልወሰንኩም አትበተንም አትወጡም እንድንነሳ እምነታዊ አግዚብሽን አትሻም እየተገታ አልቀረበላቸውም አማላጅነታቸውን አጓጓኝ እሣቱን አሻጋሪ እየተመነደገ እንደላካቸው እንደፈጠረላቸውም እለያለሁ እጆችን አይታወቁም አሮች አመን አለመቻላችንን አጣጥመን እየደመሰሰ እንደሮይተርስ እንዳይጮህ አስክሬንም እየተንጠባጠቡ ኢንሱሊንና እንጥቀስ አመሠግናለሁ አሽከርነቱን እየተጨፈለቁ እንደማይሆንም አስፈፃሚውና እንደመከላከያ እንዲሰጡዋቸው አምስታችን አሻሚነት አሰኝቶኛል እንደሚጨምሩ አዳዊ አስተማሪዎቹ እንዲያስቡት እናንብብ አልገታቸውም እንዲመጣለት ኦፎሰር እንድመለከት እያስቀመጡ አልመጣብንም እየተራበ እንደምትሰጥና አኃዛዊ አዶልፍ አስተባበሪው ኢሳትም አትሄዱም አርብለት እጣፈንታ እንደሚከስ እርግጠኛው እንደተለመደዉ እንዳያስተዋውቁ አበላሽተዋል እንድንሮጥ ኦባሳንጆና እየመረጥክ አልገባችም እሥረኞቹን እንዲባረሩና እንደተጠቀመ አይከራከሩም አስከሬንም አዋጭነትና አንበልጥም ኦብኮና አይከፈልም አንበሳውን አለመውጣቱን እንደሚፈርሱ እንደማያበረታታ እራስህ አልተለቀቀም አንቀጾችም እየታገተ ኣትችልም አገግሟል አብስሎ እየታገቱ እየገፋው አጫወትኳቸው ኢትጵያንና አንሾካሾከብኝ እየተማረች አምባዎች አስተናጋጆችም አወሱ አላሳየንም እያደረሳቸው አድርጎል አለመሙላቱ አያሳዝንምም አስቸኮይ አላህም አሲራለች አትደርስበትም አለፈላቸው አስተያየቶቻቸውን ኢትዩጵያ አምክነን አልቀረላቸውም እጩነት እየረሳ አርክቴክቱ አስገባህ አላዳመጣችሁንም አጎዋን እፍረትስ አፈንጋጮቹን አብሰውታል አስወግዳለች አለመፈታቱን አይመሰልም አል