            amharicWords[17, 3] = "ኢትዬጵያ አሸናፊዎችም አማሮቹን አንፈቅድለትም አጠገበ አነርሱም እያሻቀቡ አሰናጅ አይበገሬነትና አኪልዳማ አልሰራ እየተዋጋሁ አላባክንም አጋንንታዊ አቀባባይነት አብረውም አንገታቸዉን አስደርጎ አይለቀውም አለመሸነፍ እየተሳደደ እየቀለጡ አላዛርን አነጋገሩት አድራጊዎቿ እድርገን አንገድበውም አያጡትም አይለየውምና አቆጣጠሩን አግዟቸዋል አይጠበስም እያሳየሁ አሳተምሁ እየከበቡት አዞው አይኑረን አትመስለኝም ኣመራሁ አስችሎኛል አንዳዶቹን አሳስቦት አስበናልና አነደኖረን እፍረታቸውን አገልፋኖ አጥባቂነታቸው አትመኝም አትጥላው አይከዳም ኢነርሺያ አስተዛዝና አልተሳካ አውጥቶብን አጥቅተህ አልኩኝና አይገባምን አይተዉትም አፍጠን አልተለመለትም እየተላላሱ አባርረው አዝማዶቻችን አወጉ አፋጣጭ አስኮም አመለጠው አበሾች አዘንክ አልተሠሩም አተርፋለሁ አኗኗራችንን አስተላልፈውታል አርፋለሁ አምላካችንን ኢምባሲያችን እያቆመ ኢድሪስያን አብርተናል ኣስተዳዳሪዎቹ እየተጨፈጨፈ እያዘንን አግብተሸ አሀዞች አለመታየቱም ኦሪዞና እየተፈሩና ኦዲተርም አማናዊቷ አሳዘኑን አብስትራክት ኢናቦ አዝናችሁ አስባለች ኣህያዎች አስታውሼ አሳስበን ኦፊሴላዊው አይከተሉም አንጠፍጥፈው እገድላለሁ እየተከበበ እያወረደው አይቀመጥ አስመልጧል አርበኛውንና አበላችንን እያታለለና አሳድጎታል አይወስደኝም አጠቃን አለመቁረጥ አልተዋጠልኝም አፅናበት አሰረብኝ አትቅበሩ እየተወቀሱ አፍጠው አይተዋላ አያርፍ አይመስለኝ ኢፌዲሪ አብዲራህማን እየተቸራቸው ኢቴቪም እያስከተላቸው እየተገረምኩና አትክልተኛ አልታደለችም አስወጣናቸው አሳፍሮኝ አሚራ እያስተኙ እጓላ አቅጄ አፋቸዉን አናዋጣም አነሳነው አናመርትም አመኔታችንን አሸዋው አምኛለሁ አግዙኝ አድረገን አልዋሽም አያምናቸውም አንድነታችሁንና አመራሮቻችንን እየበዙና አነሷቸው አልተከፉም አትሰሙም አይቼህ አሳማሪ አላስደሰታቸውምና አላዩትም አስከሆኑ አመታቶች አናብስቱንና አርከበና አወራረድ አይገደንም እየተደላደለ አሰራጩ እየተመዘገ እየበለቱ እያልንኮ አነጋግራችኋል አፍሬ እያስረዳ ኢትዮያዉያን እየቧጠጠ አምዳችሁ አለመቀመጡ አሥርቶች እየራባቸው አዘጋጆችም ኣስጨንቋቸዋል አይሁዶችም አንታዘዝም አትንካኝ አድርገሃልና እየተጠማዘዘ አይታችሁታል አሞጭሙጮ እየተጠመቁ አጣፈጥሁ አያውቅምና እየጠለዘ አቀረብሁ እየተወጣው አምናው አዝዘናል እየተናነቀዉ አገልግሎታቸውም አስተዋይዋ አንዱንና እየተጎነጨን አንተዋወቅም አለባችኹ አጣደፋት አነዳድ ኣያመጡም እየተንጠራራሩ አፍርታ አፃፃፍና አስነስቶባቸው አሠራራቸውም አፅቄዎች እየተቀመጡ አለማድረግን ኢንስቲቲዩቱ አስመርጠዋል ኣውጫጭ እያሸበራቸውና አትሙቱ አፈርኩላቸው አነሣሴ አራግበው አርጎም አይቼሽ እየፈራን አሳፋሪነት እየተቀደመች አስተዋጨፅኦ አበስባሽ አገላለጼ አዕማደ አያዳምጡም አማክረን አርግጥ አይድዮሎጂ አልተረዱትም አቡሻኻር እየተቅለሰለሱ አድነዉ እያከራከረ አርከኖች አይቆጣጠርም አቅርባችሁ አድርጎና አይክደውም አይዙም አለባችው አጥማቂውን አስቀምጦት አርጀንቲናውያን አስተርአየ አዉጪ አይዳሂስ አልፈቀዱልንም አመራርነቴ አላውቅበትም አሰቦት አድጋ እየነገረ አንሰላሰሉ እየተነበበ አምገህ እየተዳረገች አረጋን አናጢውም አርበኛውን አጋጅ አይበልባቸውና አጋብታቸዋል አለቅን እየተናገሩና አፍዎ አትበይኝና አመለካከቴ ኣልመረጡም አልካቴል አልመለሷቸውም እየከበሩ አትወደውም አክስሮ አናፈረሳለን እየተንቀለቀለ አሳሽነት ኣያስፈልገንም አስባለው እየተወተወተ እያሰላሰሉ እያሰቃዩአቸው አዝማሪነትን አቡባከር አባሮሽ አማናዊው አይራቅ አድረን እያስተዳደርኩ አስተናግዳ አቀራሪዎቹም እየተባባሰና 