            amharicWords[17, 4] = "አሰተሳሰብና አልፈጀበትም አብልጣችሁ አትደነቅበት እግርህ እያስቀመጥን አይበሳጭም አስተምሮናል አቆይቼ አስተዳደግም አለመቋረጥ ኢቫንስና እየተጨቆኑም እየተምዘገዘጉ አሮጌዋ እያስጠበቅን አይካተቱም አገኛቸዋለሁ አባረሩት አስተሳሰቡና አሸልቦት ኢትዮጵያዊያ አልሠራችሁም አያዝም አንጀቱን አጠነከርነው እግርም አሳጥተዋል እየጠቃቀስን ኣለያም አላቀን አልተደሰቱም እየተሽጠ አጉርሰው አይሰጉም ኦሮሞዉ እየዘገብንበት እድሜልካቸውን አናታቸው እየተሽመለመለ እየጨፈለቀ አባዜና አፍኖት አላሰኘው አትተኛም አባዜን እየተመላለስን አልከታተልም ኣይሄድም አቅርባችኋል ኢፌክት አምሮኛል እየተወረረ ኦፕሬሽንን አንጀታችሁን እየወለደች አበርካች እየተንሸራተተ አላባውያን አልጽፍም እየተወረሩ እያወራህ አሰናክለዋል አበሳጭቶኝ እያዩን እያሰብንበት አያንሰንም ኢኮሎጂ ኣልጠየኩም እየቀዱ እየተደባለቁ ኢድሙባረክ እያዩኝ እየተነሳሁ እየገባና እየተንሸራተቱ አልተለወጡም እየረዳን አካላችንን አይመልሱም አይውጡ አይውጣ አውቃችኋል አደረባት አስበውትም አላሳጣትም እየተጣጣመ አልታረቅ አትሂድ አድዛዎሎ አክመዋል እየተባለላቸው አምላክነቱን አጥኚዎቹም አገናዝቦና አያዋጣንም ኢትሀድ እየገባኝ አድቫንቴጅ አሳይለም ኢሕአዴግስ አትቀመጥ አሰለፉንና አንቋሻሽ አፈስፈስ እየጠለፉ ኣማኒያን አግራ አውጪውና አንቀጾችና አልከፈሉም እየተነጋገርንበት አልበል አስተውዬ አመጣችው አኅጉሪቷ አትግዙ ኣርጉ አበረን አርኖልድ አትደንግጡ አንደወረደ አንዲሆን አልበሜ አይገዙም እየታጠፈ አለመጀመራቸው እየተቀበልኩ እያሰሰ አሳሳቢነቱ እያስኬደ አልሸጥኩም አላበረከቱም አበሳጭቶአቸዋል አጥፍተናታል አገናኝቶት አኗኗሪ አስብሏል አልሸፈነውም ኣነጋጋሪ አንቶንዮስ እየተገረፍን አልፈራ እያሳያቸው አግቦ አርሲን ኢንዲቆሙ አፅዋማትም አሳርገው አልመሰሉም አንዷና አሜባ አላምጦ እየተማጸነች አይከፋፈሉም አመሰገኑት እየጨለጡ አሳንሳችሁ እየተሰዳደቡ እየተጣመረ አይሸጋገርም አፍልቀው እየተንጨረጨረ እያሳደረባቸው ኣያገኝም እየተዋቀረ አነድነትን አሞናል ኢንዳ አይነካኝም አካላታችን አጀንዳውንና አይድዮሎጂውን እየቋመጥን አባቶችቻንና አያሌዉ አይናችሁ እየተገናኘህ አፍንጫህን አገናዝበን አልመልስ አለመጫረቱ አልፌያለሁ አልሰርቅም አጋግሎታል እየተሰነዘረው እየዘሩ አመለከታቸው እየጸለይን ኣማኑኤል አታለላቸው እያነገሠች እያስፈራሩኝ አገርሽቶበት አለመማራችንን አፍሮና አልተጣለም እያለልህ አንቺደህና አሳዉቀዋል እየገባው አጎፍሮ እያመፀ ኢኖቬቲቭ እየታከለበት ኦሮሞነትና እግዚብሔር አቋቁማለች አብዝታችሁ ኦኮሎ ኢትዮጲያውያን አራራውን እገናኛለሁ አይቋጥርም እየተለጠፈባቸው አጠጡት አመሰገኑ ኦሮሞነትን አቆይተውልናል አጀማመሩን አስቀጥረዋል አካባቢዋንም ኢህአዴግንንና ኡሁሩቶ አያሻግርም አንደበቴ አድርጌያት አሰለጠኑ አውጪን አወዳድራችሁ አታስቢ አነሰኝና አስቀርጬ አርያምን አዛኝና አስደረገ እየተነተንን አስነስተዋል አሳትፈን አልናፈቃችሁም ኣወራ አይዘነጋነም አሲዞ ኢስላማዊት አለቀሰላት አለመወያየቱ አድቆታል አንጥፌ አፈናውንም አጋግሎ አይናበቡም አባትዬው አስገመገሙ አጣቢና አግብቷል ኣያርግባቸውና አንጥስም አስመሰልናቸው አምሐ አድረሰዋት አሳብቃለሁ አብደሃል አይናችሁን እየተላላኩ አስተዳደደር አረጋግቶ አርካኑል አግጦ አስተምረዉ አልቆዩም እያቃጠለን እየተስገበገቡ እየተደፋባቸው አታቁም አላስፈላጊና አምሮቱን አለመሞከር አሳይቼ ኢስተሪኖ ኦክሲጅን ኢኮኖማያዊ አያፍርም አርኪዮሎጂ አይካድ አያቅታቸውም ኣልታገለም አልበኛ አላሰበችም ኢንጂነሮችንና እየደበራቸው እያኮላሻቸው አገራቸዉን አፍሣሽ አክርካሪው