            amharicWords[17, 5] = "ኣያጠያይቅም አትንቀፉት አለመግባባታቸው እየተሸጋገረች አልፈለግሽም አልዘለቁበትም አሞካሽተዋቸዋል አብዱልናስር አበዛኸው ኣልችልም አማራዉንና አሳች አንዳቸዉም አልቀረኝም ኣምጡልን አልነበርኩበትም እየተራራቀ አትሆነውም አረገፉት አሕዴድ አከፋፋዮቹ አሻሽል አይሾምበትም አምባከነን አስተማሪም አሲኩዳ ኢንቴንዳንት እየገዛና እፈፅማለሁ አትነጥላት አልደገፉትም እያማረርን አሳካ እየቻለና አብሮነቱን አፈላልገን አባትሽ አልገነባም እየኖርንባት አዘናጋለሁ አለመከበራቸው አጀንዳዎቻችን አለባበሶች አሳደጉት አይሁዶችና አያደርጋችሁም እየወረደበት አይቀጡም አስተላለፉት አሕፈሮም እየገታችው አልሳዑድ አትኩሮቱ አዎጆች አላስተናግድም እየጠፋብን እየደረጉ አለመመቸት እግርኳሳዊ አፍሪቃዊዉ አስትሮኖሚ እየተባ አላገዱትም እየተሰባሰቡና አይለወጥ እየከበዱ አጃቢዎቼ እየተንደረደረ አለመቀጠሉን አረቦችም አራዊትና እያልከን አለላ አውሎዎችና አልሆንልን አስባሉን አባቶቻች አልመለሰለትም ኢንስቲትዩትን ኡቻን አቁመሻል አማኞችና አመስግኛለሁ እያስተዳደራት እየተገበሩት እየተቸ አለማማር አዘንኩኝ እየተቹ አለመቁረጣቸውን አቅላችሁ አውሮፓውያኖቹ አሳዳጊዎቻቸው አላጣራሁም እያነሳሽ ኢጭአት አርፈውበት ኣላማቸው አድጋለሁ አርዕያ አልነበረባችሁም አላገኟቸውም አካኋን አዘዝን አዕምሮውም አታስረክቡም እየጣላቸው አለልሽ እያሰ አርባዎቹን አጅበውታል እያመሰው አስተምህሮትና አቢወት ኦሕዴድም እየቀዳች አትያቸውም አጭሮብኝ አድርጉለት ኣባቶቻችን አትበይ አምጾ አሴሩ አያስነሳም አዘመተ አምፅ እያሏቸው ኢጣሊያውያን አትይ አለበ አላልታለች አገናኝቼው አያድግም እየተጓዘች አጠራጣሪና ኣቆመ እያሰፉ አርነቱ አክሰስን እጥበት አለመኖሬን አባያችንን አባድር አሰተያየቱ አሰሙልን አጭበረበርክ አርኣያበሙስና አለመቻሏንና እየቆረሰ እየተፈረደባቸውና ኢንዱትሪው አሳልፋለች አላሳይም አልወረዱም አስተዳዳሪዎቹ አንጠብቃቸውም አመለካከታችን አኩልነት አንደኛችን አሳውቀውናል እየተጋጋሉ ኢሕአዴጋዊያን አበባዉ አዉሮፕላን አጥነትም አኮስሶ አክሲዮናቸውን አልረሱም አልፓይን አውአሎምና አይንት አኑሯል እየተናገሩትና አሰገግን አልተፃፈም እድሜዬን አስተምሯል አልተገለጹም እየሸፋፈኑ አወቀው አልባሣት አወድሷቸዋል አለኮ አልደረሰውም አውሮፓም አይቆጭም እየተንጎራደዱ አቀናባሪና አበቃቀሉ አጥና አልተሰኙም እየናኘ አግራችንና አዛኞች አብራራለሁ አለሙም አገራችንንም አንገፍግፎት አዣዥ አይፈረድብንም እየተነታረኩ አያይዘዋል አልማው አውቀታቸው አጋርቷቸው አበባየ አገልግሎታችን አሳጣቸው አስወጥተውኛል አሳትፏል አልጭንም አለዛ አናወራላቸዋለን እያወረዱት አጠጋግቶልን አይዘበትበትም ኣላከበረም አብቃው አናስወጣ አጠብቃለሁ አምጥተዉ አለልን እየገባቸው አሳምኑ አበረታቷል ኣያምርም እያስወቀጠ አቢዮታዊ አልተቆጠረም አላነሳህም እያሱና አታለል አይሳነውም አንዲሰጥ አሳታሚዎችን አጀንዳዎችም አፍሪካዊነት አድርገውልናል አልጀሪያ ኢትዮጵውን እየከበደው አምልኮው እየነጣጠሉ አይቼያለሁ አናያቸውም ኢማሌኃ አፈርማ እየተጠገኑ አልበሽርም አብረሃት አናውጦ እየተሰነዘረም ኢጆሌ ኣያስመስላቸውም ኡከት እያበላ አስደርጓል አልሐምዱሊላህ እያደረጋችሁት አትውረሱብኝ አይበልጥምን አትንቀፍ እያመከኑ አልበዛባችሁም አይመካም አልቻለበትም እጁጉን አስታወኩ አያስነካኝም ኣውሮፓ አብራርተውታል እያስዋኘ ኢትጵያዊነት አፍዝዝ አለማወቄን አፍዝዞ እየነገርን ኢምባሲና አምታቶ አስቂኝነቱ እየተለማመደ አንባገነንነት አጎብዳጆች እየተጨመሩበት አበዱ አሥርታትም አበድ አምራችነቱ አናስተምርም አሥረኛው አሳቀን እየጠጣሁ አስሮቷል 