            amharicWords[17, 6] = "ኢንጂኔር አለመታዘዝ አሉኛ አፈዘዘው አስቲ አፋጀሽኝ አሸማቃቂ አላለኝ አይደለለም አለመቅጠር አልተቀበልነው አሠራራችንን አስተያይተው አንባብያንን አስረስን አፍንጫዬን እየተቆረጠለት እየተጋገረ አማካሪያቸውን አይታቸው አዘልና አርማንዶ አትተዋትም አይፈልጉትም አግሮች እየቃጣኝ አልቆረጡም አማራጫቸውን እያስተማረች አልደኸየሁም አነሱት አንተውህም አገራዊነት አሰቃይተው አለቶች አገሪቱዋን አልነገርኳችሁም አይዲያ ኣይኖረውም አለማስቀመጡን አልታያቸውም አይፈቅዱልህም አዘግተው እያስከፈለ አድርሱልኝ እየተፈታተነን አማካሪህ እየደገ አወቁት አይነጋገሩም አፈንግጠዋል እየፈጸመች አፈገፈጉ አላለንም እየበረርኩ አጨብጫቤ አልዛይመር አብጠው አልስፈላጊ አፍንጫዬንም እያየነዉ አትታከም አቅሉን አጫዋችነት እየተሰማችኝ አይቆረጥምና እየፈጨሁ አለመርሳት እያሸበሩ አፈታታቸውና እያወቅንም እያወራጨ አልተናገረችም እየተለመኑ ኢሕገ እያዋሉትና አቋቋመው አይስማማ እየጫሩ አምሃራይ አጋርነታችንን አስረክበናል አስቆጥቶኛል አትይም አንግቦት አመጣነው አፈረሰው አብድልአዚዝ አንቴናዎችን እያስተነተነ አትግዙት አከፋፍለናል አወጣችኋላሁ አልተጠቀመች አንድሁን አይኖዋን አዛምደው እየተደረገብን አላየሁዋቸውም አቡየ አያመነቱም እየዘመቱ አቀረበና አደረና አልመለስ አያያዞም ኣመጻዎች አሽቀንጥራ አያግዱ አይርድ አገዛዛዊ ኦቶማቲክ አሟሟቂዎቹ አንተርሐሙዌ አሥተዳደራዊ አሸናፊውና እየተገረመ አሰባሳቢና አወንታዊነት አይታን አልረኩም አመክንዮች አናከራይም እያንቀረቀበ አቁሟቸዋል እየደፉ አነጋገራችን አቆሰሉት አላምዳለኹ አረፈተ አስረዝሞ አቅምህን አሠሪውና አስተዳድርበታሉ አላመሰግናቸውም እያስባለው እየቃጣው አሊቶ አይኖሩበትም አመጣሁት አዕምሮአቸውን እያነጋገርኩ አስተሳሰራቸው አሏቸውና አንረሳውም አብቅቻለሁ ኣለመመጣጠን አልጎረበጣቸውም እየከፈልኩ አይደንቃችኹም አቅጣጫችንን ኦካምፖ አይተናነሱም አንሮታል እየባሰባቸው አይተቹም አይሳቅም እየቀለድሽ አፍጣጭ አመናጨቀኝ አልሐምዱሊላሒ አልተሰሩም አንብባችሁ እገዳዉን አጥፍተናል አፍሰን አጥማቂ ኦሮሞዉን ኢንቪኒዮ እየከፈልክ አብቶቡስ አልመሸም አጫውቶኝ እጩዎቼ አልነግርሽም እየተሰበከ ኢኒሼቲቩን አያምርበትም አስረክቢ አልቸገረኝም አይጫወቱበት አጫወተው አትረሱ እፈርዳለሁ አተራረክ እድንበር እየወነጀለ ኣምባገነን እየወፈረና አልነገሯቸውም ኣባይን እየተቀራመቱት ኢንቁፍቱ አምልኮታችሁ አልጋቸዉ አላዝንም አምላኪዎቹን አድቫንስድ አሰቃቂው አቻምና አልጋራም አካቶታል አድርጌለት እየነካቸው አላከበራችሁም አልታዘብኩም እያከሸፈ አነጋገርናቸው አልቀራቸው አርቀን አመክንዮና እየበታተነ ኢትዮጵያዊያውያኖች እየቃኘ አመንጪና አልተነሳሁም አልቢና እየደነዘዘ ኣልቻለም ኣዋጩ አንዲለቀቁ አያስተላልፍም አጽንተዋል እየተቀባበለ እየወገሩ አንባር አልቸገራቸውም አለማስቻል አላስቻለውም አላል ኢህዴድም አለመሳካትን አመጣሁኝ አልሚውና አይዳኑ አንባሳ እየተንከባከቧቸው አባነናት ኢንዱስትሪዎቿ አጅቧቸዋል አውታረ አላወጃችሁም አየርላንድን አንፋሽ አስተማሪን አውነታው አእምሮአዊ አሰቃይቷል አስቆጥረዋታል አሮ እያሰደደና እየተወጋ አሴ አለመምራቱ አበውና አሹ አልመኝለትም አሉልህ እየበረሩ አውቶቡሱን አቅ አስቀምጦልናል እየፈጠረበት እየተዝናና አላማችሁ አገላብጠው አሳታፊነት እያልኩት አሽመድምደዋት አካባቢዬን አይተኩም አቢዬ አያቆመውም አታቅልሉት አለማሳየታቸው አወደሱ አገልጋዩ አስተሳሰብህ አልፋችሁ አፋጠነው አክሊለ አሰሪዎቻቸው አያስረዱም እየፈጠራችሁ አወራሁ አቅንቼ አረጋኸኝና አርባና አስተዳሪ አይወገድም አስረግጠን አምልኩት አጠ