            amharicWords[17, 7] = "ኢትዮጲያንና አወሊያም አስቀሩት ኢህአዴግስ አድርጎልኛል ኣሳቡ አድረናል አጉራህ አሳዘኝ ኡሁ አንሳልኝ ኦጋዴኖችን አውታታ አናባርር አሌክስን አዘውታሪ አልያንስና እየጠቡ እገዳደራለኹ አቅማቸዉን አላችኹ አይተማመኑም አትውሰዱት አላከናወነም አሳዛኙን አባክነውታል ኣምኖ ኢህዴግስ አለመላቀቁን አዘጋጀው አንስራ ኣልወድም አድገት አፏ አልፈለጉትም እየቆጠረው አልቸኩልም አልኖረው አምባገነኖችም አለነበረም አስነቅሎ አካፍለውናል እየከነከነኝ አሚሶምን አስወግዷል አወቃቀርም አሳስተውኝ አድናቆትንም አልፋል እድገትህ አስተማሪውን እያስዘፈነ አትኖሪም እያስተላልፉ አስተዳደጉ ኣይሆኑም አባን ኣስተናግዳ አልፈውናል አስረኛው አማካሪነትን አልበሞቹ እየተገኘን አስረድታ አልጠላነውም አስተዳደጌ እያወያዩ እየዘመረለት አባክ አያጣቸውም አልደበቀም አልባም አሰኘን ኣይታይባቸውም አጉራሽ አወድሷል አግኝተዉ አስተማሪነቱ ኢንስቲትዩቶች አይይዘውም አጥቼአለሁ አውላቂ አንዳለም እየተቋደሷት አድገኛ አይዲኦሎጂ አይተባበሩም ኣሳዛኝ አለሣልሰው ኣስተዳዳሪ አላሳልፈኝ አምሮታቸውን አሸክሞ አሳውቁ አካብተዋል አጽናኑ ኦዉሱ እየተባላችሁ እያናቆሩ አሳሳቢነትን አፈናዉን አይወደኝም አልገባዎትም አሳንሰር አልሠራኹም አስቁመውታል አጣብቆ አንቀልባ ኣበሮቹ አልጠቅስም እያስመለሳቸው አልጀዚራን አሰላለፋችን አይወደድም አሉልን አስደሰቱ አለበን ኢሮ ኢንትራሄልዝ አለመኖርም አጥፍቶን አጫሪነትም ኣይለኝም አስቻላቸው አንደወሬው አስተሳሰባቸውና አስከሬኗ አሰከፍቶት አንግቧል አጠናግሮ አልስገበገብም እየተነተኑ አቶገብረዋህድ አሰልቺና አወራን አላልናችሁም እየተከሰሱና አስለቃሹ አውርቷል አለፈልን አያደርጉትም አስቀምጣለሁ እፈልጋለው እየተመለከትክ እየጨፈርን አልቻላችሁም አታገኙትም እፈጽማለሁ እፈራላቸዋለሁ አልተቀየረም እያሳተ አጣፍታ አስመሰለው አንባሳደሮቹ አያሳፍረውም አልችልምም አሞካሽተውታል አፋሩን እየተቀላሉ አታውቀኝም አሌና አላሸና አሳውቀን አቀናች እየተጋሩ እየሸፈነ አወጣችና እየዛቁ አፈረሱት አለማቆየት አመክንዮው አይኗን አይረባንም ኢዳኦ አሸት አይተከልም አሳጥተውናል አስቀምጡት አስቡና አረጋለሁ አነሣ እየተዳፈረ አያየኝም አይሰፈሩም ኢዩ አካባቢዎችየመዝናኛ ኢዲ አዝዘዋል አእዋፋት አከማችቷል አፈኗት አይሆንበትም እየቆየን አይባረሩም አዝምታ አስተዋጽዎ አሥራቸው አሸንፍ አልብሶት አስረግጠዉ እየተመሠረተ እየተለመዱ ኣሳዘነኝ አላርም እገዛንም አጥነቱ አፎትን እየዋልን ኣስተማሪዎቹ አቀለጡት አይቴይ እያቀረቡት አስተምሯቸዋል አያጨቃጭቅም አስተናገዱ ኢንዳስትርያል ኦዲንጋን አውጥቶባቸዋል አሰልጣኙም እየተጣሩ አየሑ አቆራርጠው አካሎቼ አለመካተቱ እያሾፈ አመፃና አክሲዮኔን አጋሰስና እያስፈራራና አስገብቻለሁ አቀባብና አይድረስ እየተደጋገፉና እየወሰደበት አይወቀሱም እየጨፈርኩ አናግረን እየዳዳቸው አይጨርሱም አንዴውኑ አየሯ ኣና ኣላውቅም አፕሬቲቬን አንድነታቸንን አይቀናም ኣስተማሪዎች አይናቸዉ አልከፋ አልተነጋገርንም አልፈጠረውም አሳብቤ አምባላጌ አንደበታችንም አበቃላት አልያዝኩትም እያረሩ አሰናበተን ኣይረሳኝም አጫዋች አመንኩ እየደሰኮሩ አልሮ አሰሙን አስሉልኝ አደረስን አስተያየቶቹ አያስጨንቀንም እየደበቁ አውሮፓውያንም አልተጠናቀቁም አቀነባብረው አሣሣ እየተጉላላ እየሸፈነች አሰልቺው ኣዩ አልቀረልኝም አወድሷቸው እያነቀን አስመትተው እየተደረበ እየበለፀጉ አፍስሰዋል አንደነበረው አራማጅና ኢንዴክሶች አለመነሳታቸውን አልፈርድብህም እየታሸ እየጮኸም አኳሗን ኣስፈፃሚነት አስመልሶ አቅቶአቸው አየት እየታረሰ አልሞስ ኦረሞውን አፍሺህን ኦሮሞዎችም አ