            amharicWords[17, 8] = "እንደምገምተው አፍሪካውን አጸደቁ እንደወደመ እንደሀገርም እንኳንም እንዳልተከሰተ እያወገዙት እናልፋለን እየሻሩ አኔት አውሮኘላኑ አቡነወልድ አስፍራለች እያለቅን አበላት አለመካሄዱን እያስተማርን እንዲለቁና አስጠግቶ አንደርስም እዞም እየተደበደበ እንዳይታዩ እንዲወለዱ ኣልል ኦሮምኛና እወቁ አልማሕዲ እየተደበደቡ እዳቸው እንድትቀርብ እንዳልተሰጠ እንደሚያገኙት እንደምሰማው ኦሞድ እየታጀበ እንዲያማክሩ አንቅስቃሴ እየተገፈፈ አመጣህ አትምረጡ እየለመንኩ እየቆዩ አባልትም አልተከለከሉም አሽከርና እንደሚሞከር አልተጠቀመችበትም አይጠጣም አበባንም ኤግዚቢሽንም እንደናቱ አለመዘርጋት አላጣም አውቶቡሶችና አነስቶ እንዳይቀበሉ አጣቅሶ አሰጣጡም እንዳልኖር እስኪሰፍን አክስዋርዚ እንዲጠቅም እራሱም አለማየሁም አሳቢዎች ኢሳቅ አውቶቡሶችን እየተወያየን ኢራቅና አፈጉባዔያችን አውቄዋለሁ አዘውትረን እንዳጣጣለው እያደረገም አህጉራትን እየመነጠሩ እንደቡድን አምጣልኝ አመዝኖ እየተንሰራፋ አለቀና እንደሚጠና እየታየና አቅልን አይቼዋለሁ እከፍታለሁ አልዎት አንል አያስቡ እንደሚገኝበትም ኢንደስትሪዎችን አመጣሹ እንደመሆኑና አጎትዋን አንብቡት አላካሄደም እንደሚያስረዳን አዕምሮአችን አወጣሁት አውነትን ኦፒሲ እየተሰነዘረባቸው እየሠራው እንዳቀረቡና አልፈጠረበትም እንዳበሳጫቸው እንዲያሰፉ አምባገነንነቱ እየተመገቡ አካላዩን እንደተሰነዘረባቸው እየተመለከተች እንደሚቀጥሉና አታዩም እየዳረጋቸው እስኪለይለት አንጉሬ እያሟላ አጥቂውን እንደተቻለውም እናቃጥላለን እንዲጠበቁና እህትሽ አብዱላዬ አሸብርቀዋል እንዲያነሱና እንዲሰቃይ እንደሚቆጠቡ እንደሚያካድ እንደሚጋባ አይድንም እንዲከፋፈሉ እንደተፈጸመባቸው እንደጣለ እንዳይነበቡ እንደጣሉ አፍርሰዋል አንት እየተፍጨረጨሩ ኢሳው አንዳቸውን አማኞቹ እያሳየችው እንዲያጤኑት አማራንና እየተዳከሙ እንድትጠቀምበት እንዲደበቁ አይሮ አላለውም አገርሽቶበታል አነሳዋለሁ እያስታመሙ እንዳይጠይቅ እንዳይዋጉ እንዲመነዘር እንደግብዓት አይቀንሰውም እንዲሠሩና ኤክስፕረሰን እንዲታወቅልኝ እይውልሽ እንዲደበቅ እንዳይቀላቀሉ አያሟሉም እንዲወስንበት እያዘዙ እንዲጣሉ አኅጉራዊና እጋላ እንቅልፌን እንዳይፈቱ እንድንጠቀምበት እንደእኛ አትሌቷን አትዮጵያዊ አክባሪዎ እንዲታለፉ አግኝተነው እንደእርሳቸው አረረ ኢሳዎች እየቀጠሉ አስከፊውን እንዲበስል አውሮኘላኖችን አብሽር አይብ እንደተከበበች አላስወጣችም እንዲጋሩ እንዲያሰለጥን እንዲፀዳ ኤርባስ እንደፓርቲ አመትን እንዲያስተምር እቅዷ እክሎች አይሲሲ እየደጋገምክ እያለም አለማችን አስተዋሽ አክሊሉን አረቂ አስመራጮች አተኩሬ አካባቢውንና አቅራቢያው እየተጠቀምኩ አልቀርም እንዳስገኘለት ኢንቨስተመንት እንፀልይ እዬዋኘ እንደተደበደቡ ኤረትራዊያን አጠቃቀማቸው እንክት አረባ አፍቃሪና እህትና አያወጣም አልወደውም እንደጣሱ አይካ አይኬ አጋብቶናል እንደሚደረግላቸውም አሻራን አንግ አልተዘጋጁም ኢሰመጉም አጉዳይ አላመለጡም አለመሻሻሉ እንዲባልልን እናቷም እያሰፋው አልቃኢዳን አልገመተም አንርሳ እርሻውን አገሩንና አዋዋይ እንዲያደርግለት እንዲረጋገጡ ኤደንብራ እንደሚቀነስ አሰማርተው እንደገመቱት እንደሚፈራ አደርህ እንደሚፈጥርላቸውም አያበቃም አልረፈደም አመትዋ እየወሰዱት አመንጪዎች እንደማያቀርብ እንደሚጨመሩ አስጠነቀቃት እየተናገርን አስቤው አልነግርህም አልተፈቀደልንም እየተደናቀፈ እንደሚካተት እርዝማኔ አይሲቲ እንዳቋቋመ እንደየአቅሙ አዲስም እንጸልያለን እንክዋን አልለየም አይጠቅሙም አይዲ እየጣሰች አይዳ እስክንድርና አስታያየት አይድ ኢትዮጵያውያኖችም ኢንቲግሬሽን ኤር