            amharicWords[17, 9] = "ኸ ኹኔታ ኾነው ኸርማን ኾኖ ኹከት ኻርቱም ኾይኑ ኾኗል ኸርዝ ኻሊድ ኸርት ኾነ ኻያ ኸ ኹነቶች ኸረ ኺደት ኾይንካ ኽርዲ ኾይና ኸይር ኹሉ ኸርዝን ኾኑ ኻትሚያ ኹኔታው ኾኖም";
            
            amharicWords[18, 0] = "ከተቀጠሩት ከመናፍቅ ከልጅነቴ ከሚኖርባቸው ከመቀማት ከሞላበት ከልጅነቷ ከማፌዝ ከብዶናል ከመጓጓቴ ከማይፈቀደው ከመጓጓት ከስምምነቶቹም ከማስመሰል ከመጠርጠራቸው ከብረው ከሚሰበስበው ከተጋደምኩበት ከሐጅ ከባህረኞቹ ከሚንቀሳቀስ ከሚመስል ከባንዲራው ከመጣችው ከተውሁ ከርሳቸውም ከሬድዮ ከሚቻላችሁ ከትንሽነትና ከመሣሰሉት ከማግበስብስ ከሠርሁ ከሐድያነ ከሚተርፈው ከቢሾፍቱ ከሰላማችንና ከተዘረዘረው ከመከመርና ከመጀመርያዎቹ ከሚሠሩባቸው ከተሰቀለው ከሌላችሁ ከሊበራል ከሆነዎት ከተበዳይ ከተቃውሞው ከተረዳነው ከማስቀመጡም ከታገለላቸው ከሚቀመጡ ከባለሀብቶችና ከረጅምና ከታመሙበት ከሚያነክሰው ከሚያመጣቸው ከሚዋረድ ከተፈራረመ ከተግባርድ ከባለጌው ከምትታወቅበት ከተቃዉሞ ከተፈጥሮም ከመግጠም ከመሆናችን ከሚባልለት ከለየ ከትርፉ ከባለሀብት ከባንዳ ከሚነሡት ከባንድ ከማድባትና ከስምና ከመረጠው ከመታገልና ከሰነዘሩዋቸው ከተማርክ ከምናገረው ከሚያስታውሱት ከሳሙ ከማስፈራሪያ ከምናስባቸው ከሀ ከበቡን ከመጣልና ከሥርጉተ ከተፈጠረም ከሌለና ከመጻጉዎች ከምሥጢራተ ከሕገመንግሥታቸው ከመጠራራታቸው ከመላእክትም ከሩቅም ከማስገረምም ከበውቀቱ ከመጨናነቅ ከተጸፈበት ከምሰራበት ከተቀረፀ ከሚወቀሰው ከትላልቆቹ ከሳ ከሀብት ከተቀበሏቸው ከሰገባው ከተፅዕኖ ከሚያስከትላቸው ከሚጠሉት ከመለዋወጫ ከማይታወቁት ከራዕዩ ከሚዘጋጁ ከሕዝብም ከማውቃቸው ከማስመጣት ከብሔረሰቡ ከበታችነት ከማዘውተሪያ ከተቀበሏት ከማለቃቸው ከመዋእለ ከሳባ ከመማቀቅ ከላንድማርክ ከማስመጠጥ ከማሳመር ከመግባትህ ከመሆናቸውና ከተላቀቀች ከተደቀንኩ ከተሳታፊው ከርሞአል ከሀይማኖታችን ከሳቱ ከተደራጀው ከሰቀሉ ከተጠማው ከመጠምጠም ከተገዛበት ከሰየሙት ከተረከቡት ከተመለከትኳቸው ከመታሰሯ ከብዝበዛ ከማውቀው ከምርቻው ከህወሐት ከራስዎ ከመዝናናት ከትንሣኤው ከመነጫነጭ ከተያዝኩበት ከተመዝጋቢዎች ከምዝበራ ከተሰበሰቡበት ከረጢቶች ከሚደርሳቸው ከመልቲሞዳል ከምኔው ከሚሰብኩ ከሁዋላና ከመፍትሄው ከርስታቸው ከተጠራበት ከብዛት ከማሣቅ ከላይኞቹ ከመሠረተባቸው ከመመርያው ከመቀመጫችን ከምትናገር ከሰማችሁ ከብትም ከሚድሁበት ከተወለደችበት ከስሙኒ ከራቴ ከሰሞኑም ከሚንዱት ከበዛበት ከመንግሥቶቹ ከመምረጡ ከሊፋን ከማሰላሰል ከብጥብጥ ከተቀደደ ከበባውን ከተማንም ከብቶችህ ከተላላኪነት ከተፎካካሪው ከምቡጥርን ከመሆንዋም ከህልውናቸው ከመመታቱ ከማዳኑም ከቆረቆሩትና ከማጋባት ከሊሊ ከመመታት ከተከታዮች ከተሠሩ ከማታና ከተሸከሙት ከሚገልጹት ከተጓዳኝ ከባትሪው ከቢዝነሱ ከሄደም ከተመደብኩበት ከሚመነጭ ከሕይወታቸው ከተመላኪነት ከሰብአዊነትም ከማሳደድና ከቱርኮች ከሥራዎቹ ከሚያፍኑ ከረፈደም ከትቶታል ከሚሰብኩት ከማህጸን ከሣቴ ከማገኘው ከሕመሙ ከመሰከቱ ከመጅሊስ ከቤተክርስትያኒቱ ከማድረሱም ከተመዘገበ ከሚያሰሙት ከኃይለኛው ከሚያስተዳድሩት ከሚጠጣው ከተቀላቀሉበት ከሚያከፋፍሉ ከሠራቸው ከተናጋ ከማገዳቸው ከተጠርጣሪው ከሚሰራበት ከተሻለ ከመስደዱ ከመፀፀት ከተገዥነትና ከማሺ ከምትሏቸው ከመሶቦ ከሚቆጠር ከሚያካሂዱባቸው ከተሰበሰባችሁት ከተሣፈሩት ከሁዋላው ከተማዬ ከተረቀቁት ከተረፉ ከሀላፊዎቹ ከመረጡስ ከበረቱ ከተሠለፈው ከተዘረፉ ከተመጣጠነ ከተዋወቀበት ከታሠሩና ከምታየው ከማስፋቱም ከብዶኝ ከታዘዘላቸው ከታገልነው ከሸሪዓ ከተፈታተነ ከተዛባ ከተሻረ ከተጫነባቸው ከሠርጉ ከታናሽ ከሚያየው ከተገመገመ ከምዕመኑ ከሥልጠናና ከሠርግ ከተካሄዱም ከስልጣናቸዉ ከበረከተ ከመገደዳችን ከትላልቁ ከትቶት ከሚቸኩሉ ከሞዴል ከምዝገባው ከተከራከረው ከመካከላችሁ ከምታቀርባቸው ከማልና ከቡድናቸው ከበካዮች ከተመሠረተች ከስታሊንም ከተከሰስኩ ከተሰናባቹ ከማጣጣላቸውም ከመከበር ከበሉት ከኃይለማሪያም ከሚያመላክቱ ከሚኒሊክ ከተጫወቱ ከተፈጥሯዊው ከተደነገጉ ከቴክኒካዊ ከርሜያለሁ ከሲዖል ከስቅለተ ከሚወርሳቸው ከመሰብሰቡ ከሚሰማ ከመንገደኛ ከሁልጊዜ ከሰላቱ ከምንሠራበት ከሚያልቀው ከተሰራበት ከተጫኑት ከባህልም ከስሎ ከተጨማሪው ከማሣቹሴትስ ከመሞላቱ ከተተው ከማለፉ ከሳውዲው ከሞላባት ከመቀሌም ከተሳሾች ከሳሊኒ ከማላበሱ ከሚለቀቁት ከሥራቸውና ከሚሸጡ ከረመች ከቡድኖቹ ከታየም ከማሸነፍ ከስክሶ ከሚያስተሳስራቸው ከመለካት ከማሊዎቹ ከትውስታህ ከተንቀሳቀስን ከማጣ ከማወያየት ከተዘራው ከሚዝናኑበት";
            amharicWords[18, 1] = "ከምንመገበው ከቢልና ከምእምናኑ ከሲስተር ከታሪካቸው ከሚያመጣው ከተሳካም ከመሸራረፋቸውም ከምሬት ከመኖሪያና ከመገደል ከሲመተ ከሚችሉባቸው ከሥራዎቻቸው ከስታንዳርድ ከሚችልባቸው ከሕዝቦቿ ከተመልካቾች ከተነገረበት ከማጣቱ ከተቋቋመለት ከመቻቻላችን ከለከለን ከተበዳሪ ከቆጠሩ ከመጣችሁት ከመሸርሸር ከምላሳቸውም ከመሰናበት ከተራበ ከበርቴዎቹ ከተናገርሁት ከመቸገር ከተሞላ ከሥጋና ከመንጌ ከሚመደብ ከመለጠፍ ከህዝቤ ከማጠቃለያው ከመገጣጠም ከሌላት ከተደገሰለት ከታምሩ ከስህተቶች ከመፈቃቀድ ከተሰርኩ ከሚለይባቸው ከተመደበ ከሃያላኑ ከማቃለልና ከባይዶዋ ከተጋባን ከመፅሃፉ ከላኪዎች ከመናደድ ከቴሌና ከማስተርስ ከተሣተፉት ከሕልም ከሚሰበር ከሚሰማውና ከማሳቅ ከባለድርሻዎች ከተበዳዮች ከምረቃ ከኃያላኑ ከተሰቀለ ከማጋቢት ከምትሆን ከሙያዬ ከተንቤን ከባቫርያ ከተመሳሳዩ ከኃያላን ከተስፋጋብር ከህጎች ከሚተቹ ከተፈለገም ከሚያስጨንቅ ከተንሰራፋ ከማጓጓዝ ከሚበሉት ከሚከራከር ከሚያፀድቃቸው ከመስራታቸውም ከሰቀቀን ከሦሥት ከተተነበዩት ከሚያመርታቸው ከመግለጫውም ከተወዳዳሪ ከስድብም ከሚፈፀም ከሚያዘግም ከታገሉት ከልክላ ከተወዳዳሪዎች ከተሰሙ ከተገፋው ከበዋል ከሚያገኛት ከተደራጁና ከምርጫና ከሚበላው ከተቀመጥኩበት ከሞተው ከሰጡና ከመለገስ ከሀገራቸው ከተፋታች ከሚወረወሩ ከመስጋት ከተፎካካሪዎቹ ከላምበረት ከምባታነታቸውን ከሀዲና ከምንሠራቸው ከሃይስኩል ከመሰላቸው ከምትሸጥ ከተራዉ ከመሀመድ ከለላን ከቴም ከታቀደውም ከቱርክና ከምርመራው ከመግባታችሁ ከሐራሬ ከሚመለከቱት ከተጠናወተው ከተመሠረተው ከተካሄድ ከሴቶቻቸው ከማዋጣት ከማውራቴ ከሥራውና ከማማከራቸውም ከተወለደበትና ከሠሠ ከመታረምና ከተፃፈ ከሃይለስላሴ ከተባልን ከመናፈቅ ከሰነበቱት ከመልዕክቱ ከመምጣትህ ከማስታጠቅ ከመሸገ ከሚደገፉ ከሰንኮፉ ከባባድ ከሸማኔ ከተለቀቀው ከማጀብ ከተስማማና ከምኖርባት ከታደሙት ከህውሓት ከሶሻሊስት ከተባበረ ከተስተጓጎለበት ከተማዋንም ከመገደቡ ከተጎዱ ከተበሳጩት ከተዋወቁት ከተጎዳ ከሚፈጠር ከተቃውሞና ከኅሊና ከህብረተሰብአዊ ከተጫዋቾቻቸው ከተጠያቂነትም ከሚያሞቃቸው ከራፋኤል ከተሰደድኩ ከታቀፉ ከስሬያለሁ ከመከለል ከመከራከር ከበዳት ከሱቅ ከተጎዱት ከማይጨው ከሚያበድሩት ከተነፈጋቸው ከቆራጦቹ ከምዕራፉ ከሚያደርሱባቸው ከልጆቼ ከተጠናቀቀና ከመዝፈኔ ከማስወለድና ከመዝገበ ከኋላችው ከመጠላለፍ ከመፃፍ ከበስተኋላቸው ከበረበት ከሚሮጡት ከመከሰሳቸው ከመነሣቱ ከተሾምኩ ከመምረጥና ከማዘኑ ከሳፉም ከማይጠፉት ከተከታዮቻቸው ከተሰኙ ከተዋረዱት ከመኖሪያው ከመሆኑና ከመፀዳጃ ከባሕርይ ከሮምኒ ከመወቀስ ከምንዝር ከሚሰራዉ ከሚዋኝና ከስታሊን ከቴዲ ከተገደበ ከተናገራቸው ከመምጣትም ከሚወስዳት ከሄደችበት ከሚቀር ከማይከበርበት ከሙስናውም ከመወትወት ከመቀበሉ ከማቆማቸውም ከብዛታቸው ከማባከን ከሚያመነጨው ከሚያስከፍለው ከተዘፈቁት ከሴትነት ከሰማን ከሚሰማቸው ከተከሣሾቹ ከሚቀርቡለት ከተሰሙት ከሊቃነጳጳሳቱ ከበረኞች ከሞታቸው ከሥራችን ከመካ ከማጥበብ ከማስገባታቸው ከመውሰዳቸውም ከተገዛው ከረሱት ከሀዋሣ ከትርምስ ከተማረው ከመዝናኛ ከማይክሮ ከተቀላቀለ ከመጉዳቱም ከተሰማው ከስህተትና ከትተን ከመስጠቴ ከባለሞያዎቹ ከሊቢያም ከሰማኹ ከተጫራቾች ከመስጠቷ ከማፈር ከተላላኪ ከቤን ከባህላዊው ከቦርሣዋ ከሚሏት ከሚታይብን ከመገንባታችን ከተረጋገጠም ከመንቀስና ከተሳካለት ከተመስገን ከሀብታቸው ከመመዘኛው ከመምጣታችን ከማስተማራቸውም ከተንሸራተተ ከልጅነትና ከመመለሳችን ከመወደድ ከማኅፀንዋ ከማብቃት ከሚቀራረበ ከተሰበከ ከማሕፀን ከመቀመጫቸዉ ከማቆም ከሳሾቼ ከሚመራዉ ከማሕፀኗ ከሰብኣዊ ከማስገባቱም ከሚላክባቸው ከመኖርያና ከመክፈቷ ከምክንያቶቹ ከትርዒት ከተዘጋበት ከተጋሪ ከመምጣታችሁ ከረጢቱን ከሚገዛ ከሚሊታሪ ከለያቸው ከቅንፍ ከተፈናቀለ ከሚገነባበት ከተከፋፈለ ከማሃይምነትም ከመዳረጋችን ከሚያንገላታን";
            amharicWords[18, 2] = "ከሞከርን ከምሥራቁ ከበረዶ ከምችለው ከርማ ከታዘዘው ከርሜ ከተቦ ከሚከበሩት ከተተ ከሚያጠነጥኑባቸው ከህንዶች ከሀገረስብከቱ ከመመቸት ከሰሞኑን ከርስ ከርሷ ከተገማችነት ከሌላውጋ ከተጎናፀፉ ከመለያየታቸው ከተገለጸለት ከስደተኛ ከሚስተዋል ከሀብታሞቹ ከማጣታቸውም ከስዋንሲ ከተጣለብን ከኃጢኣት ከሮዝባንክ ከማጉላላት ከቤንጋዚው ከመለያየቱ ከመውለዳቸው ከማስጠበቅና ከተናገርን ከማወጅ ከለመድነው ከመቶዎቹ ከሴቲቱ ከማርገብ ከሀብታሞች ከተበደረ ከማደርገው ከሄይሮግሎፊክስ ከተመራ ከመቀለ ከቤትህ ከረንት ከመውጣቷ ከልክለናል ከተጠያቂነትና ከተዘፈቀበት ከበየነ ከመድኃኒታችን ከህዳሴው ከመደጋገም ከተለያየች ከተወ ከቤታችሁ ከመዘባረቃቸው ከመርፌ ከሀገርዎ ከሰረንጌቲ ከሚስተዋለው ከመስፋፋቱም ከመፅሐፍ ከባለአደራው ከባልና ከለላነት ከርስትና ከተመሠረተና ከስርቆት ከተገዥነታቸውም ከቴክኖሎጂና ከተባባሪነት ከስረናል ከሚደፍሩ ከሳቀች ከምታገኛቸው ከስያሜው ከመሆንም ከማኅበራችን ከተባለማ ከሚያላዝኑ ከመፅሀፉ ከስካንድኔቪያ ከሃያና ከህጻናት ከመጽሐፍት ከሚሰገሰጉባቸው ከባድም ከስያሜውና ከመፅሀፍ ከማሰማራት ከሚበላህ ከብዷት ከረብሻው ከተመሰረተባቸውና ከተጣበው ከሌተና ከህወሃቱ ከስብስቡ ከመሥራትና ከሱማሌም ከስግደት ከሚከፈል ከህዝባቸው ከስብስብ ከለየን ከተመቱ ከተመዘገቡበት ከቤኒንሻንጉል ከባለሀብቶች ከመጠጋታቸው ከመጣብን ከሃይ ከሐኪሙና ከተደበደበ ከሚውሉት ከተጓዦቹ ከሚጓዝ ከሚሆንበት ከማጥናትና ከመላዕክት ከሚታየውና ከምትጠቀመው ከለመደው ከመኖርያቸው ከምግዜዉም ከሚሰበሰቡት ከተነገረላቸው ከቆመና ከሁነቱ ከመነጋገራችን ከተመን ከምንታወቅባቸው ከሚዞረው ከተቱኝ ከስድሣ ከስድስተኛ ከሚሰልል ከሕፃን ከሰነበተባቸው ከበፊቱኑ ከሀብትም ከማስታውሰው ከታጋይነት ከተጎጂዎች ከተቃዋሚዎቹም ከሰባተኛ ከልጅነትህ ከሚከተሏቸው ከተጎናጸፉ ከትዕዛዝ ከሚያደርስባቸው ከማረፏ ከተነዙ ከለንበት ከቆረባችሁበት ከሚንከባከባቸው ከተገደሉና ከበዙ ከማመንጨት ከሰዋው ከመዘከር ከመለስተኛ ከተወለድኩ ከትናንቱ ከሸልቶው ከባለሙያዎችና ከሁነኛ ከማስደፈር ከሃዋርያት ከምወደው ከሁላችን ከህገመንግስት ከህሊናቸዉ ከተተበተበበት ከተወለድክ ከተናጥል ከሚጫወቱት ከመሳፈጥ ከሰዉነት ከመጽናቱ ከበግ ከተውታል ከሃይማኖትም ከመጀመሪያዉ ከመልካቸው ከምዙ ከተነገረን ከምልአተ ከሮክ ከሃገሬው ከሌቦችና ከሩሲያና ከማይምነትና ከቦታና ከሀይለ ከቢሸፍቱ ከተቻለና ከተፈናቃዮቹ ከማጠንከር ከሰራሁት ከሕንፃ ከተከራዩ ከበጣም ከሚዘከር ከሰርተፊኬት ከማወራው ከተከታተለ ከመንደሯ ከመንገራችን ከሜሪላንድ ከታገልን ከማብሰር ከስጦታ ከተለየዋቸው ከመሞከራቸው ከልምድና ከምእራባዉያን ከምንገምተው ከሚታሰበው ከባላችሁ ከመግባትና ከስረው ከመፈናቀላቸው ከተሸቀረቀረ ከተገኘችም ከተገዙበት ከሬስቶራንቱ ከባንግላዴሽ ከሀውልቱ ከባእዳን ከስተመር ከሀቀኝነት ከሚግሬይን ከታመሙ ከተረፋቸው ከሚመላለሱ ከሰላማዊው ከተባለች ከሮጡ ከተመክሮዬ ከሚያስጠላ ከብሔረተኞቹ ከመስደዳችን ከማጉረምረም ከተጫዋቹ ከመፈረም ከመጋባቱ ከምዋረድ ከባህርይ ከምድሪቱ ከታጣቂ ከሚገለጽባቸው ከሚወርድና ከሌላቸውና ከማቅረቤ ከበሮና ከሚያምርባቸው ከማርያም ከሚያገብሯቸው ከቲና ከሞላቸው ከርችሞ ከተመሠረተችበት ከመክፈቸው ከሀብታም ከተላለፈላቸው ከተጨማለቀ ከተፈተሹት ከሄኒከን ከልጅቷ ከሚያስተምርበት ከብዙኀን ከሃያኛው ከሚሉና ከምእራብ ከሚሉን ከመለኮት ከተንሸራሸሩት ከተለዋዋጩ ከመካድ ከተነጠፈ ከምናውቀው ከሚሉኝ ከምንጨርስ ከመለስካቸዉ ከሁዋላ ከሚሰጠን ከታዳሚው ከቢል ከመጎዳት ከሀድያና ከመዝሙራት ከሚነገረው ከመገፍተር ከመላዉ ከሚፈፅሙት ከተባሉበት ከመድረክጋ ከሊቀጳጳሱና ከተገለጸላቸው ከማስቆጠሩም ከትእዛዝ ከሠራተኞችና ከማሳሰብ ከስታሊናዊነት ከማገድና ከሳቁና ከረሚላ ከመካድና ከህልፈትዋ ከሚወጣ ከመጣችሁ ከታሎ ከተሜውም ከመጨፈር ከምለው ከተቀባይ ከማሳደጉ";
            amharicWords[18, 3] = "ከማፅደቁ ከአምባሳደሮች ከአሸባሪው ከአብራኩ ካላወገዙ ከሕፃናትና ከሚጠሩ ከሙቀቱ ከመዳረግ ከንስሳ ከመሶቡ ከተስማማባቸው ከግዛው ከፍፁም ከአሁንም ከእናቶችና ከሠሩት ክብረትም ክብደታቸውን ካናቱ ከሦሰት ኬመሮች ክራውድድ ካልተመዘገበ ከፋሽስቶች ከንግግር ካላመናችሁ ከኬንያውያን ከእርስበርስ ካስመረቃቸው ካፒታላቸውም ከማለዳ ከሚገኙባት ካቀረቡዋቸው ኪሳራውን ከሚጭኑ ኪታ ኩሎም ከድኅነት ከደስታቸው ከእግዜር ከፊትለፊት ከታራሚዎችና ከወገል ካልሰጠህ ከአክስቱ ከኋይት ካኒቴራ ካልሁ ከጅምሩም ከዋነኞቹ ከበረታ ከወሎው ካፍቴሪያዎች ከተወከሉ ከወደቅንበት ከፌዴራሊዝም ክርስቲያንንና ከተፈጸመው ከጉሊት ከአቀደው ከመሳተፋቸው ከመንግስታችን ካለሰው ከመብዛታቸው ከተቆጠረ ከጀመራቸው ከመጉዳቱ ከጥንታውያኑ ክርና ከኮንሶ ከተጓጓዙ ክብረነክ ክርን ከጃፓንና ካምፖችና ከሰራተኞቹ ክብረበዓሉን ከጠላ ከሚያራምዱ ከዋሽንግተንና ከደራርቱ ከሆንሽ ከአቅማችሁ ከማሰሩም ከቻድና ከአስተባባሪዎቹ ከመጉዳት ከተጋፈፈና ከጠቀሷቸው ክበቦችን ከቻርተሩ ከነማስረጃው ከጓደኞችህ ከበለፀጉ ከነልጆቿ ከአሸናፊው ካደሩ ከተደመደመ ከክለቦች ከዳበረ ካሰኝዎ ከመብትና ከውጨኛው ከአበዳሪና ከተገመገሙ ከወዲያኛው ከተጫነ ኮርተናል ካውንቲ ከአንድዬ ከባድመም ከትውፊታዊውም ከነጭራሹም ከአገልግሎቶቹ ከእዚያ ከስፍራ ካቲም ከአራዳ ከአላማጣ ከማስገረሙም ከጠበቀችው ከሰፋው ከሚከራየው ከመዋቢያ ከአቋም ኮንፊዴንሺያል ከእያንዳንዳችን ከሽሮ ክላሲክ ከምግባር ከመለወጡ ኮንቬንሽናል ካልተሳኩ ክስተቶችና ከትግራይም ከቦንድ ከዶሮ ከመጠቀማቸው ከምንለው ከሆነችበት ካሳየን ከማሰማቱም ኩነቶችም ከንፈሮቻቸው ከመፆም ከተተካ ከማልን ከመብከንከንና ካል ካሎ ኳሳችንን ከሚፈፀመው ከነፃና ኬብሉ ከሚያዘጋጃቸው ከሚጫኑት ክርክርንም ከተጎበኙት ከመካሄዱም ከተጫወተ ከህሊናዬ ከጉባኤ ከምትገኝ ከሚወሰዱ ኮንሰርቫቲቭ ከሌላችን ከማሳመን ካልተመራ ከጉዋደኞቹ ካለብዎት ከመሁኑም ከተናጋሪው ከመፍጠራቸው ከሚፈልግ ከመረዳት ከትዳር ከመቆርቆር ኬንያዊያንን ከሐርጌሳ ከአያታ ካልሆነች ካልኳት ከማስተማርና ከሣህራ ከፀደቀላቸው ከተመሰረተች ከጨው ከተመላሾቹ ከነጠለ ከስልጣኑ ካምፓላና ከርከሮ ካፈራቻቸው ኪቦርድ ካሳረፉ ከውስጣችን ኮማንዶው ከምርጫውም ከፊቷ ከኮንፈረንሱ ከመዋቅር ኬርስቲን ካነጣጠሩባቸው ከድርጅቶቻቸው ከተጠባባቂ ከመንግሥታዊው ከግራዚያኒ ከምስክሮቹ ከዮሐንስ ከምኑም ከአስራት ከተሸላሚ ከቫቲካን ከሰሜናዊው ከፈፀመች ከሚጠቀምባቸው ከታሰርኩ ከኮንትራክተሩ ከመሰብሰብ ካጣሁ ከእህቱ ከአቅራቢዎች ከጎዳና ክንውኖችና ክሶቹ ከየሚኖርበት ክለሳው ኮስትሩቶሪ ከስምንተኛ ከጣቢያ ከውጤቱ ከማወክ ኩመንን ከስሞ ከተሰቀለበት ኮምፎርት ከባልደረቦቹ ከእርሻና ከጤነኛ ካልፈቀደ ከሂትለር ከደረስሁ ካኑ ካነበብኳቸው ኬላዎችም ካኔ ከፈርኦን ከጎበኟቸው ከማለፍ ኮንቲኔንታል ከነብር ከሚያዋጡት ከቤተሰቡና ከመያዝና ከወገቤ ከእኩልነት ከወገብ ካነበበ ከፈለግክ ከስሮ ካነበቡ ከነሕይወቱ ከሃይማኖትና ካፒታሊስቶች ከታተመው ከደቡቡ ከከንፈሩ ካቶሊኩም ከእገታው ከወጣም ካተረፉ ከዚምባብዌ ከጉባዔ ኮሙኒስቶች ከባዕታ ከነተረቱ ከላዕላይ ከድሬድዋ ክምችትም ከመሩት ከዘመዶችዋ ከሰማያት ከማቀላጠፍ ካህሊል ከወደሙት ከወሰኑት ከፈለጉም ካዖ ከፋይናንስና ክፍፍሎች ኬቱሚሌ ከዘመዱ ከሞቡቱ ኮንትራንት ከዘረፋው ከዲፕሎማትነት ከእናንተም ከፈዴራል ከማከናወንና ከአካባቢዋ ከሰበር ከተቀዳጀት ከአሉታዊ ካዞረች ከዘለቀው ከወጣባቸው ካይ ከመገኘታቸው ከታወጀ ክብደቴ ካላገኘች ከማብራራት ካሰብነው ከጎልጉል ከአባሎቹ ከሙምባይ ከሆነባቸው ኮትስ ከማጡ ከሚመረጡት ከካቴድራሉ ከተፈራረሙበት ከተቃዋሚዮቻቸው ከማግባቱ ከረንሲ ከጉባየ ከደፉበት ክሥተት ከርክክቡ ከአረጋዊያን ከደረሰች ካውንስልም ከዘመቻው ከሲያትል ከልክሎኝ ከስፖርተኞች ከብጹዕ ከተጋረጠብን ከስደተኞቹና ከታጠረው ከርስቲያናት ከታህሪር ከተጣባቸው ከቢሮክራሲው";
            amharicWords[18, 4] = "ከጣት ከስታዲየሙ ከዳኛው ከጨረሰች ከልጄ ከዩኒቨርሰቲዎች ከመኢሶን ከዲኬቲ ኮረኮንች ከሚያጋልጡ ከልጇ ካርድም ከቆምንበት ኮማቴ ከፖለቲከኛ ከንፈሮችዋን ከሱዳኖቹም ከወለዱበትና ከኔና ከቤኒሻንጉልና ከጎልደን ከገዢዎች ኮፒና ከየካ ክሎሪን ከሚለካባቸው ካለዎት ከትምክህት ከስታንዳርዱ ከገጠሙት ኮንፈራንስ ከመድገም ከቆንጆ ከመሯሯጥ ከማባረሩም ካለሱ ከጻፈው ኮሎራዶ ከፈረመቻቸው ካለባቸውና ከየገዳማቱ ከሎሚ ከተመለሰም ከእንግሊዛውያኑ ካህኑም ካለማወቁ ከየመንግሥቶቻቸው ከአሠብ ከሩስያ ከስታዲየም ከፍሪካ ካህንና ከተገፈፈ ካህናቶቻቸውን ከሚያጋልጥ ካህንን ከኮንስትራክሽንና ከኪሣራ ካለቁ ከማዋሉም ካስተካከሉ ከአደፈው ከፍፃሜ ከኮንፌዴሬሽኑ ከተቆጠረበት ከጦርነትና ከመንዝ ከነውር ከአርሶአደሮች ከተሸኙ ከሸሸ ከሸሹ ኩባንዎች ከኢኮኖሚያዊ ከመኳንንቱ ከሄደበት ከጠላቶች ከእኚሁ ከጀመር ከፀጥታና ከችሉት ከባርያ ከመሰቀሌ ከቤተክርስቲያኑ ከእርግማን ከመብዛቱ ካለቻቸው ከምንፈልገው ክንፍና ከገመገሙት ከላይም ከቆሙለት ከጨፍጫፊው ከአሜሪካንና ከነዚያም ከቀረባቸው ከተላለፈባቸው ከተገዢነት ከመሸፈን ከጨበጠበት ከተደፈሩት ከሕይወቱ ከክሊኒክ ኮንቴይነሩ ከዜጋም ከዛማሌክ ከባትሪ ከአባቶቹ ከዴሞክራት ከመዳብ ክንዴን ከፋፍሎናል ከመሃሉ ከገዥዎቻችን ኪፕሩቶ ከሲውዲን ከፕሬዚደንት ከተለመደውና ከኢዴሊ ካመንን ከመዲናዋ ክህነታዊ ከፍቶት ክምቀካ ከልጓም ከታገደ ከበዳቸው ከአባላቱና ከጥምረቱ ከመፍጠርና ካላስወጣ ከሌብነት ከቱሪስቶቹ ከተዋቡት ኮንደምን ከዘራ ከጎረቤቱ ካለቀሱ ከሠራና ከማሸጋገር ከተካፈሉ ካልተደገፈ ከሰሉ ከሶቭየት ከመናኸሪያው ከሰቆጣ ክፍሉና ከመካሔዱ ከማስቀየር ከመሸከም ከአጋሮቹ ከመሬትና ከሽብርተኛ ከፍዬ ክላሰር ከረቂቅ ከኋለኛው ከጠራው ከመድሃኒቱ ከዋርዴር ከሚከፍላቸው ከጠየቀቻቸው ኮዶች ከመብል ኮርፖሬሽኑም ካለማየት ከቀዬ ከጉዋዳ ከዓላማቸው ከአለንበት ካላጋጠመ ከመሰሎቻቸው ካንስተይነር ከምክትላቸው ከመሔዱ ከሰም ከለከለኝ ከክብሩ ከተወዳዳሪዎቹ ከመሔዴ ከታቦ ከሹገሬ ከምትለው ከስደተኛው ከእዛ ከወያኔው ከእዝ ከፃፉት ከማውረድ ከአህያ ከመክሸፍ ኮተቤና ከቤቶቹ ከተግባር ከካርታ ከማያመልጡበት ከተረከበበት ከመሆንዋ ከሰጧቸው ካልተጣራ ኬዞች ክርስቲየን ካምፓውሬ ከመድሃኒት ከጠያቂ ኮላር ከስሜታዊነትና ከደምበኞች ከሐበሻ ከማዳበሩም ክፉውንም ኩራቱ ከዩሮ ኮምፒተር ከቅይጥ ኩራቴ ከተነጋገሩባቸው ከቱኒዝያው ከተገኙበት ከመቆጣጠርና ከሀዲዎች ከፍቶብናል ከተጠቃሚዎቹ ካለመሆናቸውም ከሚጠጉት ከምትሰጠው ከደስታው ኪሳንጋኒ ኮሚሽኔር ከወዳጁ ከቆዳው ኮሚቴንና ከአባቴ ከበሳዎች ከፈተው ከአባት ከእጄ ከመሆኑንም ከአገሬው ካለዉ ከእጇ ከግቢያቸው ከትላንትናው ከአባቷ ከሻብያ ካሜራውን ከኦስሎ ከማመልከት ከመጠቀምና ከግላቸው ካልተገኘላቸው ከሰነዘረች ከባላቸው ከትዉልድ ከተከሳሹ ከዛላንበሳና ከተረጋገጠና ከማንችስተር ከመድረሱና ከጄነራል ከፍቶላቸዋል ከአረንጓዴ ከአያያዝ ኩላሊታቸውና ከተበተኑ ከተሰባሰቡ ከያንዳንዱ ከፕሮቴስታንቶች ከአምባሣደር ኮሚሽነሩም ካታዊቻ ከማገድ ከአኢጋን ካልጠቀመ ከአሁኗ ከግምባር ኮንቪንሽን ከተመቻቸ ከዳውሮ ካልተናገሩ ከተስማማች ከሚጠቀሙባቸው ከኢንቨስትመንቱ ከቤተሰቤ ከተነበበላቸው ከሚጠጋው ከንቀት ኩነኔ ከቆሰሉ ከኢሕአዴግና ከዘኝ ከሦስትና ክወዲሁ ኮኦፕሬሽን ከለየለት ከመክሰስ ከአክራሪ ከብቸኛው ከየመንም ከከሸፈበት ካለማወቅና ክፍለሃገር ከገመትን ከለመዱት ካለመቻል ክፈቱልኝ ከሲዊድን ከዕድገት ከጋሞ ከገመድ ከሰሀራ ከጨቋኝ ካልሆኑና ኮንፍረስ ከቁመቱ ከአካላቱ ከሚጠቀሙበት ከማውራታችን ከል