            amharicWords[18, 5] = "ከኦክስፋም ከሚወዳደሩት ከተወሰደው ከተከፋፈለው ካሣር ከመቆየቱ ከጨረስን ከባዳ ከሁከት ከተሜውን ካራቆሬ ኩሽና ከሰዋቸዋል ኪዩባ ክብብ ካሳሰበ ክንፎች ከመቃጠል ከቀስተደመና ከነጻነት ከሽምቅ ከሚታከሙት ኩነቶች ከሽንት ከተሰደዱ ከዘረዘረ ከሽብርተኝነትና ከድልድዩ ከፍተኛዎቹ ኪራዩን ከጃዝ ኮንፈረንሶቹ ከሺሕ ከሚሰራው ከበበው ከማሳወቅ ከገዥዎች ከሚገዛው ኪንቺ ከወሰነች ክብርታት ከማቃለሉም ከመጀመር ከተማዎችን ከፈሳሽ ከርዕዮተ ከፀደቀበት ከመጀመሯ ከወረረች ከመሙላት ክህነቷ ከልደት ከስርዓት ካባትዋ ከሒልተን ካሌንደር ኮፕቲክ ኬኔት ከመነጋገር ከፊሉም ከእናንተው ከስዓት ከማከናወኑ ኮንትራቱ ከድምጽ ከመዞር ከኤርትራዊው ካሣን ከወለዱ ከተሠማራው ከቀነሰ ከማምራታቸው ከኖርንበት ከስፔን ኮስሞቲክሶችና ከህልም ከወፊ ካቃታቸው ከሥዕላይ ኮምቦልቻና ከብዙኃኑ ከፋብሪካው ክሶቹን ከሰሎሞን ከወጣቶችና ከቤቴ ካካሄዳቸው ከታጠቅ ከውህደት ከተጠቀሙ ከሚጠበቁ ከሕብረተሰቡና ከማስተባበር ከዛኛው ከፈረመች ከጨርቃ ከተቀላቀሉ ከግንባታው ከሀዋሳ ከአሸነፈ ከግጦሽ ከየትና ከቱኒዝያ ከሌለሁ ከለከሉ ከማዕዘን ከአምሳ ከተደጋጋሚ ከተወለድሁ ከአጀንዳ ከካቶሊክ ከመታሠራቸው ከጀብሐ ኮሚኒስታዊ ካልያዘ ክረሙልኝ ከሐኒሽ ከማውጣቱ ካለመሆኑ ከዝርፊያ ከያራ ከማረጋገጣቸውም ከለር ካልጠፋ ከመረጠን ኬኔዝ ከማድረጓ ከመሄዳችን ከተንቀሳቃሽ ከሀላፊነት ካታንጋ ከሰለጠኑ ኮንነው ከአድማጭ ከጀኔራል ከገለፀች ከአካባቢዎቹ ካልቸር ከገደሏቸው ከርካሳ ከህዝቡም ከመናፍቃን ከአትሌቶች ከግድቡ ከገቡም ከሳሾቹ ክሚቴ ከኢዴአፓና ከሚያካሄዱት ከሹፌሮቹ ከጋዜጣችን ከፋፍለን ኩዌትን ከተነፈገ ከጥንቃቄ ከመጓዙ ከፋይና ካልከፈልክ ከቶሮንቶ ከወታደር ከአለቆቻቸው ክላውስ ከወንዞች ከጀመረና ከሱፐር ከጉልበታቸው ከቻለች ከስዊዝ ከምትችለው ከተከለከሉ ክርስትናና ከልዑኩ ከተሰማቸው ከሰማዩ ከማውገዛቸውም ከምንከተለው ከትተው ካስቆጠረ ከሚኖሩባቸው ኪሎሜትሩን ከማረፊያ ከንፈሩ ኪንግስተን ኪሮሲን ከዘረፈ ከተመድና ካምፓሶቹ ኮረኮንቻማ ከወሰድነው ከሳውላ ከፕሪቶሪያ ከሐረርጌ ከባለቤቶቹ ከሲና ከፊተኛው ካሰባሰቡት ከቀበሌና ካሳለፉት ከገዙት ከመጽደቁ ከማጠናከሩ ከነተሳቢያቸው ክለባት ከዘርዋ ከአስቴር ካስራ ከአሮጌው ከቀላል ከአሳዳጊዎቻቸው ካስቆጠረው ከመነገሩም ከሐሰን ከተዋዋሉት ከሽራሮ ከሚቆጠሩት ከመገለጹ ከሲቪሉ ከጥፋቱ ከሰራተኛ ከሰለጠኑት ኬስለር ከደንበኛ ክልሎቹን ከተጋቡ ከተሠራጩት ኩኩዩዎች ከሽፈዋል ከጋምካ ከሃምሌ ክራይቴሪያ ከተገነቡ ከሚታተሙ ከልዕልት ከተገነባ ከተሰየመ ከተሰየሙ ከተስማማ ከአማፅያን ከአበበ ከመቅረብ ካፒቴኑ ከተበየነባቸው ከመፍረስ ከማለም ከነበረውና ክርስቶፎር ከሰርዶ ከታሰረች ከመጓዛቸው ከሳይንስ ከወልድ ካርሎ ክፉው ከሓላፊነታቸው ከጠበቀው ከፈታ ከፈት ኬላዎችንና ከመገደዳቸውም ከኢጣልያኖች ኮህን ከብክለትና ከቤተልሔም ከዳህላክ ኪዮንጋ ካሩቱሪ ኩርፋ ከደጋፊዎች ከመቁሰል ከደነዘዘ ከመውደቁ ከሚከናወነው ከእንግሊዝኛው ክብራቸዉ ከአመፅ ከተቃዋሚው ከሕጋዊነት ከተቀላቀሉት ከገለፁልን ከተሰማሩበት ከመቅረት ኳሱም ከህፃናት ከብሉይ ከማጭበርበር ከማስረዳት ከሆቴሎች ከምትባል ከመልከ ከጨለማው ከአወዛጋቢዎቹ ከፈንዱ ከሚያገኟቸው ከመውደቋ ከቦስተን ኩባንያዎቹን ኪዳናቸው ከተሰማበት ከኩናማ ከእኛው ከቆየሁ ክንዋኔዎችን ከኦባማ ካሰማራቸው ከጠላፊዎቹ ከታክሲ ካይዝን ከተገለጸ ካፕሱል ከማመልከታቸውም ከሚፈፅመው ከቁጥጥራቸው ከግድያ ከቢሯቸው ከራዕይ ከምዕራባዊ ካልተፈጸመ ኮሙኑኬሽን ከሚያቀርበው ከንቅልፉ ከሚያራምዱት ክኢሉ ከፍታው ከተስማማበ