 ከሚረዱት ከአሜሪካውያን ከመወያየቱ ከእኔና ከወንድሞቻቸው ከሚነጋገርባቸው ካልደረሰው ከፈልኩ ከተደበደቡ ከአጋሰስ ከተገዙ ከሌባ ከግብዓት ከፀደቁ ካራገር ከጅምላ ከመገልበጥ ከአገሮቹ ካርድታት ክዶ ካላሟላ ከፈተናው ከህገመንግስቱ ካባረረ ከደምቢዶሎ ካባረሩ ካደረጋት ከመጨነቅ ከባለራዕዩ ከአገሮች ከደገፈው ኮል ከሰማዕታት ኪልማን ከሮማ ካርቱምን ካቢኔያቸው ክህነትና ከድርግ ከፍሬዘር ከሚጠፋ ከዋይት ካልተመሠረተ ከመሸገበት ከተከፈለው ከተመለከትናቸው ከሕንዱ ከማሳወቅና ካልታገዘ ከሔደ ከተመኑ ኮሬ ከመጋበዝ ከስልኩ ካልሰጠን ኮማንዶዎችን ካዘዘ ከወደቀው ከቀረበበት ክፍተቶችና ከአስደንጋጭ ከነችግሮቹ ከስሰዋል ከጠያቂዎቹ ከመኸርና ከውድ ከማቃለላቸውም ከምቦ ከሊብያው ከመሰከሩት ከሐረሪና ካልደረሱ ከኋላና ኮሙኒኬሽ ከተቀመጥንበት ከምሰማው ክፋትና ክህሎቶች ከግትርነት ከካታንጋ ከግጭትና ከአፀደ ከብዶኛል ካብዮቱ ከተፈፀመላቸውና ከጠበቁ ከሺዎች ከሚስት ኮንትራታቸውን ከደበደበ ከገዢ ከአስቸኳይ ከታገሉ ከጠበቃ ካሳዩን ከደበደቡ ከዘጠነኛ ኪስና ከሚወክሉት ከመቱት ከሚሰጧቸው ከአሠሪዎቻቸው ከማልማት ከመቀነስና ከአልቃይዳና ከካምብሪጅ ኬይታ ከመምሰላቸው ከታሎው ካልነው ከበዋቸው ከኩባንያዎቹ ከቢሊዮን ከእውቅናዋ ከሲኦል ከዙፋናቸው ከየዩንቨርስቲው ከሚከሰቱ ከፍላጎቱ ካካባቢው ኮነ ከለውጡ ከሰቆቃ ኮራሁ ኮንሠርቱን ከመቀመጫዬ ከፈጸመ ካልሆንን ከነአገባቡ ከውጩ ከመጣና ከአቦይ ከጋቢና ከጥያቄው ከባሕርዳር ከድብደባ ከኬን ኮንትራክተሮችና ከተሰነዘረበት ከቤቱም ከእሁዱ ከቤትና ከአናት ካባቱ ኮርኒስ ከመጣስና ከጠቀሰው ከወደብና ካልቀጠለ ካባት ክፍለከተማን ካስቸገረ ከታሰሩና ከተዘጋጀና ከማስቀደም ከአምላክ ከፈፀምን ከታወጀበት ከሥርዓተ ከዋሺንግተን ካልሞከረ ከስጋና ከመቼዉም ከማልቀስ ከተጠቀመባት ከጠበቆቹ ከነቤተሰባቸው ከተጠረጠሩ ከደረት ከናቷ ከዓላማ ካሰፈሩ ከያዝን ከልጅህ ከበሬታን ከግንዱ ከሳሻችን ከዳረጉት ከቤተሰቦቼ ከሠዋል ከተወረሩት ኮዳ ከጠበቆቼ ኮምፓሬክስ ከሚጠይቁት ከአምላኳ ከገጸ ከተስፋፋባቸው ከተጻፈው ከመነኩሴው ከገዛው ክርክራችን ከሂልተን ካልተጠቀሙበት ከሸሹት ከነፃነቷ ከገጽ ከተከላካይነት ከነበሩና ከልምምድ ከቀስተ ከከተሞቹ ኮንፈረንሶችም ኪሳችን ከህሊናቸው ከየፓርቲዎቹ ክፍሎችንና ከልሉ ከኢትዮጰያ ከጥልቅ ከዘፈኑ ከኤቢ ከወረወረ ከሻዕቢያው ኪዳንም ከሚያቀርቡ ከገፋ ከተማሪዎችና ከሉሳካ ከተጋበዙ ኮንፈዴሬሽን ከአልጋ ከአጥቢያው ካነበቡት ከሰጠበት ከተበላሸ ከመኢአድና ኳስም ከነነፍሱ ከትምህርትና ከሚውሉ ካርድህን ከችግሮች ከአልከውሠር ከሩብሚሊየን ከአያቶቹ ከመታየታቸው ካኖሩ ከሚውል ኩባንያዎችንና ካርዶናና ከንቲባነታቸው ከመሳብ ከሻእቢያ ከህዝባችን ከተጠቆመ ከጉቦ ኮፕ ከሆርቲካልቸር ኪኒን ከውጥኑ ከሚያገኛቸው ከህብረተሰቡና ኮምሽነር ከአንጋፋዎቹ ኮንስትቲየንሲ ከሚኒስትሮቹ ከዕድሉ ከሞሉት ከሞሉ ከዩኔስኮ ከዛሬዎቹ ከተወያየን ክህሎቶችን ከወገናዊነት ከመስጊዱ ከዋሻው ከጥቅማቸው ኮንፍራንሱ ከደቀ ካመራ ካህንም ከሚኒስትሯ ከማሰናበት ከመንፈሳዊነት ኮንቬንሽንና ካረጁ ከምናፈቅረው ከመፍትሔ ከሚደረግባቸው ከጀመርኩት ካይሁራ ከተገኘች ከወረዳዋ ከሊብያ ከተፈጠረበት ከየኮሌጁና ከበባው ከናሞራ ከዓለማዊ ከሰነዘሩት ከተረፈው ከምልክትነት ክሊኒካል ከምርጫም ኮንዶሞች ከገዛቻቸው ከደቂቃዎች ኮሚቴያቸውን ከምንጊዜው ካላግባብ ከቱሪዝምና ካላለፈ ከወንበዴዎች ክንፍም ከተዋል ካገኟቸው ከማገልገላቸው ከዕረቡ ካላመጣህ ካልቻልክ ከጠበቅኩት ከወንዝ ከገቡትና ከመምታት ከተመለከቱት ከብሪታንያ ካልመረጣችሁ ክርስቲያኖቹ ኮነነ ከእንቅልፉ ኮነኑ ካሱን ከብበው ከተመዘገበበት ከጎረቤቶቿም ከበሽተኛ ከሄግ ከሚፈጠረው ከቀውስና ከስሕተታቸው ካልቻሉም ከተቃጣው ከሚሄዱ ከአጋቾቹ ካሉዋቸው ከኖቬምበር ከንጹህ ከነትጥቃችን ከተቋረጠበት ከኢሕአደግ ከወከሉት ካልተከናወነ ካወጁ ከባብታት ከህዘብ ክብርዋ ክቡርን ከቡርኪናፋሶው ካደረሰበት ካነጋገሯቸው ካናዳን ከሚያስፈልጉት ከተሳሳትሁ ካሰባሰባቸው ከቪላ ከገነተ ከማስረጃ ከማዘጋጀቱም ከመንጋው ከተወሰደች ክሆነ ካላልናቸው ካልተጠቀሰ ከተጫዋች ከተያያዙ ከገነት ኮይሻ ከሥልጠና ከሰአታት ከተመሰረቱ ከእርሰዎ ካሰብንበት ከአዝማሪ ከዛምቢያዋ ከገባሁበት ከተነፈሰ ክርስቶስም ከሚያሳየው ካሠራጨው ካራቭል ከምስሉ ከተገባደደ ከማፍረስ ከቋጥኝ ከመዋኘት ከመካተት ከተመለከትን ከሉዓላዊነት ከጠቆሙ ከማሰብና ከነፎቶግራፋቸው ከወያኔና ኮንፍረንሱም ከትናትና ከተከላካይ ከነጋሽ ካልወረደ ከወደቁም ከሆለታ ከአቻቸው ከጫና ካብራሩ ከጣራ ከእንቅስቃሴው ካልወረዱ ከመማገድ ከከፈሉት ካሴቷን ካስመጣቸው ከከባቢ ከጣሰ ከእኒህም ከሚገልጸው ከጠፋበት ከመሆንና ከተወጠረ ከማስቀጣት ከተቆፈሩት ከምዕራብና ካልተነሳ ከባለስልጣን ከትእምት ከፓጋን ካለበለዚያም ኮሌክቲቭ ከመለቀቃቸው ከሚሰጥባቸው ከባለቤቴ ከተሞክሯቸው ኮራጅ ከዓለማያ ከማንጠግቦሽ ክሰው ከጉንጭ ከበፊቶቹ ከማስወገዱም ከዋጋቸው ከተባለና ከመረጋገጡም ከካረቢያን ከአስተዳደራዊ ከኢየሩሣሌም ከነንብረታቸው ክሊንተንም ከቁጥጥሬ ካገኙም ከህጋዊና ከሚደነግገው ከተነጋገሩት ከካሳሁን ከማኅበራት ኮሜንታተር ከሰራተኞቻቸው ከአረሜኒያዊ ከሞኒተር ክንያት ኩሩዎች ከመገረምም ከእሥራት ኮምንኬሽን ከማሳደድ ከመቀጠሉ ከሚዘጋጀው ከሙዚቀኞች ከብከነት ከሩሲያው ከተሠራው ከድልዳሉ ከማዕከላዊው ካንተና ከላያችን ከተበዳሪው ከጭቃና ከሠተብርሃን ከነተሳቢው ከመረመርን ከመቶና ከመውጣታችን ከዲቁና ከተቆጣጠረቻቸው ከጥረት ከኮሌጅ ከተጠቀምንበት ከመታገድ ከባእድ ከፍቴ ከኮለኔል ከሚቃወሙና ከከበዱበት ከተዋቡ ከቴክኒካል ከደንበኞቻችን ከተወዳደሩት ከማካለል";
            amharicWords[18, 6] = "ከበጋ ከመቅጣት ከሥርዓት ከደሃ ከካቢላ ካርዴን ከምሞት ከነፍኩ ከችግሮቹ ከሽማግሌዎች ካዲሳባ ከዘፈን ከመመለሱም ካፀደቀ ከአድማስ ከቀረቡላቸው ከጄኔቭ ከሕዝቡና ክብሩም ከዝግጅቱ ካደረሱ ከፍታቸው ከእግሩ ከቡርኪናፋሶ ከሽፍቶች ካቴና ከዘርፉም ካርታን ካሮላይና ኮንፈረንሱን ከደረስን ካጥር ከባድመው ከጋዜጠኛ ከተቀበላቸው ከበዓል ከልቅ ከወሲባዊ ከመሾማቸው ከፃፈው ከግብሩ ከአዳዲሶቹ ከሚወዳቸው ከሣምንታት ከኢንጂነር ከረድኤት ከግድያው ከተሞላበት ከመጨመሩም ካለመኖሩ ካንሠር ከልቧ ከሚያስችል ከተነገራቸው ከማድረስ ከድሆች ካለመኖር ከልማትና ከአጀንዳው ከወገኖቻችን ከክስ ከቆየበት ከቲቢ ከተሠጣቸው ክርስትያኗ ክፍላችንም ኮሚሽነርነት ከተቃወመ ከፍላ ከንባብ ከተቀሰቀሰበት ከተጫወቱት ከጣለ ከጥፋታቸው ከማሳለፉ ካወጡ ከንባታ ከፒያሳ ከእንግሊዘኛ ከአቅርቦት ከትናትን ከባህላችን ከሠሃራ ከተጠቃሚው ኪሳራዎች ከታጣቂዎች ካላቸዉ ከዕጩዎች ከሞራላዊ ከቤተሰቦቻችን ካባውን ከሞምባሳ ካርዳቸው ከመፈፀሙም ከሠፈሩ ከምሽግ ከሚባልበት ከቱኒዚያ ከመላምት ክራቫት ኪዳንን ካልተከፈለ ክበቦች ከሐሳብ ከመቻሉ ከቅዠት ከገሃነም ከተከፈተበት ከአጥቢያ ካዝናን ከታገደው ካላስፈላጊ ከሚገነባው ከተደበቀበት ካድሪዎች ከሰባትና ከፈተች ከመቀነሱም ከልዑካኑ ከሚሸጡት ከማጣራቱ ከመመደብ ከገመተው ክራቫቱን ከታገዘ ከሚጠቅሷቸው ከትክክለኛ ከሚያከፋፍለው ከኦክቶበር ከአጠናቀቁ ከመገደሉ ክርስቲያንንም ከጀርመኑ ከፈተና ከጅማሬው ከፈረንጅ ከሚኒስቴሩ ከመረጣችሁ ከሊቀመንበሩ ከጂማ ከሪፓርተር ከኅብረት ከከፈተው ከሳይንስና ከፈተኛ ከድርጅታዊ ከመጋዘን ከጉዳይ ከተሸጡት ከሲዲኒ ከጊኒ ከተጠሩ ከአድልዎ ከእስያና ካዝናው ከተጠራ ከመወቃቀስ ካቀረበላቸው ካስመዘገቡ ከመወርወር ከነቤተሰቡ ከታሠሩበት ካለና ከሚያካሂዱት ከዩኒቨርስቲዎች ኮሚዩኒቲ ካሪሽ ከቢቸና ከሕዝባቸው ከሰረ ከተጠቁ ከአንቶኒ ከሰጠባቸው ከወረራቸው ከረሜላዬ ከተቋቋሙ ከቀዬው ካፈርኩ ከሟቹ ክህነቱን ካውንስልን ኮሜሣ ከነባራዊ ከተሰነዘሩት ከዛላምበሳ ከማመን ከመርዳቱም ከኦሞ ከሞትም ከእነስዬ ከሆናችሁ ከመንከባከብ ከመንበሩ ከሠራው ክርስቲያኒቷ ከማምራት ከተሰበረ ከአመለካከት ከብራዚል ከጨቋኙ ኮርማ ከረመ ከረሙ ከሚጓዙት ክኖው ከሴቶችና ከሕመማቸው ከተጠቆሙት ከተገለፀላቸው ከአይን ከፈረጃቸው ከተቀጠሩ ከቁብ ከመጽሐፉ ከባሌ ከቫት ከህወሓትና ከተሳታፊ ካብኔ ከያዙበት ከመግባቷ ከተደረደሩት ከአሰራር ኮንፌዴሬሽንና ከአምስተርዳም ከፍርሃቱ ኮኔክሽን ካርሎስ ክብርንና ከወሰነባቸው ክንፉን ከላይና ከኤምባሲ ከንቱና ከሚከፍሉት ከታወቀው ከአጀማመሩ ከወንጭፍ ከሆቴሉ ከተንኮል ካደረጓቸው ኮንቴነሮች ከትብብር ከመሰሉ ኮርቶ ከዝቅተኛው ከችሎታ ከተፈራረምን ከቴክኖሎጂው ካቻምና ከጓዳ ከምዕራባውያኑ ከሻምፒዮናው ከሠሩ ካርፔትስ ካበረከተው ከኢኳዶር ከዓላማው ክርክሮችና ከሲዳሞ ከሙጋቤ ከተመሰረተው ከኋላቀርነት ከሚካሄድባቸው ከድርጅታቸው ከዚህኛው ከሕወሃት ከመኖሩም ካዋላቸው ከሠላምታ ከማንሳት ከአሰልጣኙ ካሉን ከሚወለዱ ኮረብታማ ከንጉሡ ኩማና ከኮፊ ከካሜራ ኮርተህ ከማስፈር ኮሙኒኬሽንና ከተመረጠው ከሳለች ክፈል ከባለሃብቶችና ከተወሰደባቸው ከሶማልያ ከመለሰ ከሰፈሩበት ከኖሩ ኩሬዎቸ ከተፈጠሩ ከሰፊ ከሚያካሄደው ከአዲሳባ ከቂም ከሚወዷት ከአልጀዚራ ከዕይታ ከሴኔጋል ከመናገሩ ክብሯ ከመጮህ ከካድሬዎቹ ካልሰጡት ካሳዩ ከሞትኩ ኬብሎች ከባርሴሎና ከተማረኩ ከተማረኩት ከፍጻሜ ከህጻኑ ከሲኖዶስ ከፍኖተ ከኢምግሬሽን ከመቆየት ካሳንቺስ ኮርፖሬሺን ከማፈናቀል ኮትኩቶ ከሱባዔ ከወዲ ከሚደርሰው ከአትሌት ከዲ