            amharicWords[18, 7] = "ክልለ ከማስቻሉ ከማያውቁት ከተጋለጡት ከሃቅ ክርስቲያኒቱና ክፍሌን ከቀዳማዊ ከተኛ ከደረሰባት ኮሪያን ከአመታት ከማንነት ከሚያስፈልጋት ከመውጣት ከተጠለሉበት ከመሳተፍ ካልከፈላችሁ ከጠበቅነው ከመቀመጫው ከመመለሱ ከዕለቱ ከውጭው ከተወሰነው ከተመረጡበት ከዋሉበት ከተጠቀመበት ከአጠገቡ ክራፍት ከመቅፅበት ከኢህአዴግና ከአፍጋኒስታን ከመገኘታቸውም ከተከሰሱ ከደሞዛቸው ኬፕ ከቆዳ ከበሬ ከማስተጋባት ከአለፉት ካላችሁኝ ከባለስልጣናት ከመቅረፍ ከምኖር ከርታታ ከመመስረቱ ካሰቡ ከጃንዋሪ ከአልሻባብ ከማምረት ከሰፈሩ ከሚያመርቱት ከሰፈር ከተከሰተባቸው ክው ከሰለሞን ከሚላከው ካዩት ከተመረቁ ከምሬ ከተሳተፈ ኮንፊዴንሻል ከሶቪየት ከሪፖርቱ ካንቺ ኪዮብ ከነአካቴው ካቶሊካዊ ከዓባይ ከተፈጥሯዊ ካልተቻለም ክለብን ከእንሰሳት ከሚስቱ ከሚከታተሉ ካገኘች ኮቴ ከራሳቸውና ከበዛ ከፈጸሙ ከሕገመንግሥቱ ከለውጥ ከኢስላማዊ ከሚመደበው ከሜጀር ከሰራን ካልቀረበ ካገኘን ከተፈጠረላቸው ከተነበበ ክትባትን ከጠቀስኩት ክበባትን ከመዳረጉም ከሰፈነ ከተመረተ ካለችው ከዕፅዋት ካልሆንክ ከዘጠና ከአፍራሽ ከሚያደርጋቸው ከኢሚግሬሽን ከሌሎቹም ከቶውኑ ከኤርትራዊያን ከኦብነግ ከወንዙ ካልዋለ ከመሰለው ከሞቀ ከገባንበት ከሚሆነው ከማረጋጋት ከክልላቸው ከማድረሳቸው ከአምባገነኑ ካረፉ ኮድና ከባለሥልጣን ከተመደበላቸው ከተረከበ ካመነ ከምሁራኑ ካልመጡ ክርስቲያኖችን ካወጀች ከምሁራን ከቀሩ ከነአቶ ከልጅነታቸው ከግራና ከመፈክር ከሁለትሺ ኮሙዩኒኬሽንስ ከባዱን ከሀገሩ ከሚገነቡት ኪንግደም ከፍቼ ከዘመናት ከቀጥታና ከተራራ ከኦብኮ ከቴክኖሎጂ ከጉዲፈቻ ከመገመት ከስኳር ከዝቅተኛ ከሚወጡ ክሊኒክና ከብቶቻችን ካለማወቅ ከደብረዘይት ካህናቱም ከተካተቱ ካስወጡ ከጥቂቶቹ ከቆዳና ኬሚካሉ ክንውንና ኮምሽኑ ከኮንስትራክሽን ኮሽታ ከመሠረቱት ከሠራን ከህጉ ክሱት ከሰማኒያ ካልሆኑት ከቱሪስቶች ክብራቸውና ካሳለፈው ኮንሠርቶች ከቀርከሃ ክራይስስ ክፍሎም ካህሳዬ ኮተንን ከቻድ ካላስታወቀ ከአሥሩ ከሚያበረክቱት ከተገለፀው ከድንቁርና ካርድና ከውርስ ከሚኖራቸው ኩራዝ ከጸጋዬ ኮሜት ከዲላ ከመከረ ካርማን ከመከላከልና ከመከራ ከታሪካችን ከእርስዎ ከሶሪያ ከጭፍሮቹ ከመንግሥታቸው ከወሬ ከጨረር ከሚሌኒየም ከጅቡቲው ከተሸጋገረ ከስሜት ከትራንስፖርትና ካላደረጉ ከላከቻቸው ከደረሱን ከተመለሱት ከጭቃ ካንዲት ከምድቡ ከወሰኑ ከባሻዬ ክርስቲያናትና ከናይጀሪያ ከአሸባሪ ከመፍቀድ ከመከልከል ኮሌራ ከወንድሙ ከኖረ ክብሪት ኪዱነ ከተወለዱ ከወሰዳቸው ከመጥፋቱ ከማስቀመጥ ከአልበሽር ከቴክኒክ ከትራንዚት ከታሰረበት ከመዝገብ ከምክክር ከኢኮኖሚው ካልተወገዱ ከተሰኘ ከሚድሮክ ከየሥራ ከእኒህ ከወደቁ ከቀረበለት ከወንበሩ ካርኒቫል ኮምቴ ክትፎ ካነጋገሩ ከናካቴው ኮቺንያል ከተሾሙ ከርዕዮት ከማባረር ከአጠገባቸው ከአቅሟ ከብድሩ ከአወዛጋቢው ካምፓቸው ካልፈለገ ከተወካዩ ከንቲባዎች ከማከናወን ከመንግስትም ካስጀመራቸው ከጀብሃ ካየሁት ከተቀበሉት ካፀደቀው ከወለጋ ከመርከብ ከመንፈስ ከሰራተኛው ከመግለፁም ከነገሩን ከገዙበት ከሚታዩት ከሃይማኖቱ ከዳኝ ከፊውዳላዊ ከአንበሳ ከተጣለበት ከሚያራምደው ከመብላት ከመጠነኛ ከቆመበት ከምሥራቅና ከመልቀቅ ከእስካሁኑ ካስቀመጡት ክፉዎች ከማስፈራራት ክርስትናን ክሳችንን ከተሰጡ ከልጆቻችን ከመንግስታቸው ከሚደግፉ ከወረዳዎች ኮንሠርቱ ከያኒ ኮርተው ከአሸባሪዎቹ ከተሰየመው ኮንስታብል ከአል ካወጡት ካቆመ ከሚተዳደሩ ከአብላጫው ክርስቲያኖችም ከዐድዋ ከምባታ ከመገለፁም ከደቡብና ከወልዱ ከጋዜጣ ከካምፓላ ከፊሎቹም ከፈለገች ከአጭር ክትልል ኮሚቴዎቻችን ከ