 ከራት ክብራችን ኪነጥበባት ካሊቨር ክላሽ ካሌብ ከአብዮቱ ከጎኗ ካጋጠመ ከያኔው ከተቃዋሚዎቻቸው ኬኒያዊው ከሣሽ ከመግዛትና ኩክ ከእጃችን ከመምራት ከጥበቃ ከሚነግዱ ከሶማሊያውያን ከአጥናፍ ከዛፉ ከብራሰልስ ከእነአዜብ ከመውለድ ከደንብና ካድሬዎቻቸው ከአዲሶቹ ከመጠየቃቸውም ከናይጄሪያና ከአፈና ኪም ከብቶችም ኪር ከተሜነት ከማር ከሚከፍለው ከሚኖር ከተላላፊ ካድሬና ከመፈጸም ከስፖርቱ ከዓመታዊ ከበለጸጉት ኮረኔሉ ኮንትራክተር ከግዛታቸው ኮረኔል ከሚያስገባው ክልልሎች ከአለቃ ከአየርላንድ ከመረጡ ከይዞታቸው ከመከላከያና ከመዲናይቱ ከዘላቂ ከአሸናፊ ከሰላምና ከአስፈፃሚ ካልተሰጣቸው ኩንታሉን ኮርሶችን ክርስቲያናትም ከስዊዘርላንድ ከማስፋት ከተናገረው ከቀጠሮ ከተግባራቸው ከተገኘባቸው ኮርፕሬሽን ኮሚሽኑንም ካሸነፍን ከመተግበር ካሽ ከኦዲት ከድሕነት ከመገኘቱም ካርዳቸውን ከኢትዮጵያዊው ከጀርመንና ከወንበራቸው ከምኞት ካልሁት ከገቢና ከሊጉ ካመርት ከላላ ካፍቴሪያ ከአፍታ ከማጥቃት ኮትዲቯርን ከተገለሉት ከውጤት ከመደብደብ ከመንፈሳዊው ከአፓርታይድ ከእንግዲህም ካልክ ከሚሽን ከሀረር ከካምፑ ከኦነግና ከፊንላንድ ክሮስ ካጣራ ኮርፖሬሽንን ከሚያመርተው ከየክልሎቹ ከባለሃብቱ ከክሊንተን ክርክርን ኮርፓሬሺን ከኢትዮኒውስ ከሩዋንዳው ከባልሽ ከተደራጀ ከተፈለገው ኩብለላ ከማድረጓም ኮኸን ካላለቀ ከፍተት ከበረደ ከሕብረተሰብ ከኢንዱስትሪና ኪሣራው ከሚጎዳ ኮንኗቸዋል ኮንፈረንሰ ከሚሰበሰበው ከእንግዳ ከተገባ ኮሚሸን ከቀኖና ካጣች ከፕሬዝዳንትነት ክርስቲያኔን ከምሽጋቸው ከሚነገርላቸው ከመገባቱ ከአማራዉ ከመመርመር ኬት ከፈለው ከማሻሻሉም ካላገኘን ከግልገል ኬላውን ካስፈረማቸው ከተጣራ ከግምገማው ካልተቋቋመ ከመሻሻል ከሚያስገነባው ከተሸኙት ከፍትሐ ክለብም ከሚኖርበት ከያዘች ካዘጋጀው ከተሠማሩ ከቆየችው ከአምራቹ ከቤልጅየም ክብረንፅህናዋን ከንፁህ ከበፊት ካልተቀበለች ከቀጠለም ከተደረሰባቸው ኮሌጆችም ከአምራች ከሰላማዊና ከመቀባት ከብሪቲሽ ካሴቶችን ከመነሻውም ከገበሬዎች ከተው ክልሉም ከእርሻው ከተሸጠው ከሰልጣኞቹ ከተገኘም ከፋዮችና ከመሰላችሁ ካምፓኒውን ከሞራልና ከዋናዎቹ ከተሳፋሪዎች ከድርጊት ካምፕም ኪዳኔና ከካሬም ከሚሊኒየሙ ከተመራቂዎች ከተፋቱ ከመዘርጋት ክልተ ከማንበብ ከዕዝ ክርክራቸው ከእይታ ከማዳረስ ኬኩን ከሽንፈት ኮሚኒቲዎች ኮምፖስት ከተፋሰሱ ከተላለፈበት ከበቁ ክፍሏ ከሚሳተፉ ከሱዳንም ከጥቃቅን ከመመሥረታቸው ከዘካሪያስ ከነትጥቃቸው ከማጣታቸው ከከርሰ ከላከልን ከክፋት ካርታም ከጥራትና ከቤተመንግሥቱ ክሮፕ ከፍለናል ከኤስያ ካስገኘው ካልለቀቁ ከሌላኛው ካጋሚ ከጆሃንስበርግ ከተገዛ ካለውና ከኒዮ ከፍሏል ካሳዩት ካላቀረቡ ከመዘገብ ከተፈጠረና ኳሊቲ ኮሎ ከመወያየት ከሚጀመሩት ከሰነዶች ከረጅሙ ክሪስታል ከጥበበሥላሴ ከግብፃውያን ከሚታወቁ ኩመን ከካፍ ከወይዘሪት ከመምህሩ ከመንደፍራ ካገኙበት ከአውሬ ካደረገበት ከጓደኛዬ ኮሾ ከሕፃኑ ክለብና ከሠራተኛና ከተከታተለው ካሰባሰብናቸው ከእገታ ኮንደሚኒየም ክፋትን ከታገለ ከፈረንጆቹ ካከፋፈለው ከተወያዩበት ከተደረገና ከሳንባ ከተፈቀደ ከመቻላቸው ከተወገዱ ኮርቻለሁ ከአቃቂ ከፌድራል ከምኑ ኮርፖሬሽኑን ከሚያበረክተው ከቤተመንግሥት ካድሬዎችንና ክልሉና ከጸጥታ ከደኢህዴን ከመቀሌና ኮካ ካማርት ካልቀረቡ ከተመረመሩ ከተፈፀመበት ከጆሐንስበርግ ካሰሙት ከሚላቸው ካቀደችው ከሚታዩ ከደረቱ ከሚታይ ከአገርቤት ከአቃቤ";
            amharicWords[18, 8] = "ከተያዘ ከላይቤሪያ ከሚሆን ካልተመለሰ ካልተፈታ ክላስተር ከመቀመጫቸው ካምፓሶች ከመሀል ከፊሉን ከሚደረጉ ከጨዋታው ከተፈራረሙ ከካፒታል ከፕሬዚዳንቱ ከሚዲያ ከሆነበት ከቀድሞዎቹ ከኬሚካል ከተቋቋመው ከዋለው ከቦይንግ ከመርህ ከሚመጡ ከራሷ ከሕገወጥ ኩሩ ካልተሰጠ ኪሳራው ከፕሮጀክቱ ከተቀመጡበት ከወትሮ ከስራው ከተሰበሰቡት ከድጡ ከኪሳራ ከአማራና ካር ከወዲህ ከፀሐይ ካቲ ከፋኖስ ካፌ ከኮሪያ ከብሔረ ከወረርሽኙ ክሦች ከሰብለ ከሠላሳ ከምንጩ ክብራችንን ከሃዲ ከተከፈለ ካጋሜ ክትባቱ ከሒክማ ኮላ ክፍለከተሞች ክንዋኔ ከዑጋንዳ ከጌታቸው ከማህበራዊ ከኋላው ከመሰጠቱ ከማይችልበት ከልቡ ከናቅፋ ከስምንቱ ከክሱ ከተመሠረተበት ክለቡን ከታሰበው ከተረከቡ ከቀረ ከመዋሉ ከባለቤቱ ካለባት ከፍተኛነት ከጋዜጠኛው ኮይና ከማባባስ ከጫፍ ካንሰርን ከመቻሉም ከመፈፀም ካለኝ ከተዘጋጀው ከባህላዊ ከሸዋ ከኋላችን ከህገወጥ ከተጓዙት ከማዕከል ከመሰል ከማራመድ ከልባችን ከቤተክርስቲያኗ ከቀሩት ክለባቸው ከባሬንቱ ከሀገራችን ከተላለፈ ከወለድ ከሜክሲኮ ከኢንተርናሽናል ከማውጣት ከዲፕሎማቲክ ከሚጠይቀው ከጥቃቅንና ከመደረጉም ከኦሮሚያና ከከፈሉ ከአምቦ ከልጅነት ከዚያስ ከማኅበሩ ከፈቱ ከዛስ ከእዚህ ኪስማዩ ከመረጣቸው ከማለቁ ከትግሉ ኮሎኔሎች ከሚታወቀው ክፍላተ ካህሣይ ካቢኔው ከተማነት ከአማርኛ ከጋብቻ ከአፈ ከአፉ ካደረገች ከእንዲህ ከቆየች ከስራና ኮርፐስ ኮምዩኒኬሽንስ ኮንግ ከእርሻ ከሊቢያው ከድጃ ከተማይቱን ከገንዘብና ከተኙበት ከዓለማችን ከሚያከናውናቸው ኪነት ከፈፀሙ ከመቅጽበት ካቢላን ከቆመ ክንፈሚካኤል ከሚገባቸው ከውድቀት ከሕትመት ከሕግና ኮንፈረንስና ክፍያም ኮብልለው ከተፈቀደለት ከደንበኞቻቸው ኪዳኔን ከሻሸመኔ ከውኃ ከተወሰዱት ከማግኘቱ ከዚሁም ኪዳነማሪያም ከሥነ ከዴሞክራሲ ከሰማያዊ ከተጨማሪ ክብካቤና ከአንዴም ክርክራቸውን ከላኩት ኮስ ከሮይተርስ ከሄዱት ከመውጣታቸው ክላሽንኮቭ ከባህል ኬላዎችን ከአዲኳላ ከዘመዶቻቸው ከዓመቱ ከገባን ከፋይናንስ ከሚቀርቡት ከመቃወም ካሕሳይ ከሚኒስትሩ ከነበረችበት ከተሳካ ኮሚሽነርና ከረሃቡ ከሚችል ከመንግሥቱ ኮሌጆችን ከደን ካልመጣ ከዕርዳታ ከነጭራሹ ከመፅደቁ ከኒውዮርክ ከህብረት ከተማይቱ ከታላቁ ከጅቡቲና ከፈፀሙት ከተሰለፉት ከነርሱ ከሟች ኳራንቲን ከመያዛቸው ከተበተነ ከአቅማችን ከመንበረ ከአንዲት ከአባልነት ካብቲ ኮተቤ ክትባቱን ካሉም ከምድረ ከተሰሩ ከተሰራ ከጨረራ ከመስጠታቸው ከተቋሙ ከመጨረሻው ከቀድሞዋ ክንደያ ከክልልና ከገጠሩ ከአንድም ከመቀነስ ክንዋኔዎች ከወረረ ከተቋማቱ ከሚቀርበው ካልተፈቱ ካምናው ከዘረፋ ካልሰጠ ክርስቶስን ከአምና ከጠየቀ ከመስኩ ኩባኒያ ካማራት ካከናወናቸው ከርመው ከገደለ ከፓርቲዎቹ ከጀመረችበት ከያለበት ከምጽዋ ከቦ ከመዐሕድ ካሳለፈ ከተዘጋጁ ከብዶ ኮ ከድርድሩ ከተከሳሾቹ ኮኮብ ከሚያስፈልጋቸው ከቀሪው ክንዳቸው ከመፍጠሩ ከእስያ ከመከሰታቸው ከፕሮፓጋንዳ ከተጠየቀው ከአዋጅ ከተሞችንና ከጊዜው ኪነ ከዘመኑ ከአሰብና ከተፈረደባቸው ከማገዙም ከሚፈለገው ከመገንባት ከሮይተር ከተፈጸመ ከምትልካቸው ክርስቲያና ካፒታሉን ከአቡነ ከእንቅስቃሴ ካልኩ ከማህሌት ከተፈፀመው ከማቃለል ከውጭና ኮትቻ ከተወያየበት ከጀመሩት ኮንነውታል ከእስላማዊ ከርመዋል ከመኝታ ኬሮሲን ከንግዲህ ከፍትሕ ከስዎ ከላከችው ከወጣች ከሠላም ከመረጃው ከጥያቄ ከብቶችና ከመጣር ከሰብል ከባዕድ ከዚህች ከሥራው ኮንግረስና ከዩኒቨርሲቲ ከማለቱም ከዛምቢያ ከተፈቀደው ከጣልያን ክህነትን ካለመቻሉም ከልክለዋል ከፍትኛ ከገባች ኬላዎችና ኮንትራቱን ከናቱ ከሥርዓቱ ክልላችን ከባለሙያው ኬ