            amharicWords[18, 9] = "ከዘርፉ ክትባት ከክልል ከእፎይታ ከማንኛውም ከንቱ ከሰባት ኮሙኒኬሽን ካሳሁን ከቆዩ ከመሆን ኪዳን ከጥቅምት ከፖሊስ ካቢኔ ከልብ ከፍተኛውን ከሆነው ካናዳ ከሥፍራው ከደርግ ከስልጣን ከየካቲት ከተባለው ኪዳኔ ከህብረተሰቡ ከተማዋን ከማዕበል ክሱ ከቆየ ከህዝብ ከአሥመራ ከኢሕአዴግ ከተባበሩት ከገቡ ኪሮስ ከእኛ ከአገሪቱ ከቀጠለ ከአትኩሮት ክርስቲያናት ካደረጉ ከተገኘው ከወያኔ ከክብሪት ከማንም ኬሚካል ከኬንያ ከነማ ከአንዳንድ ከቀረቡት ከተሞችን ከስምንት ከሕዝቡ ክሱን ክብረ ከኦነግ ከባንክ ከተሞችና ከሰይፈ ከድር ከተገኘ ከሰጡት ከቀረጥ ክብርና ካምፓኒ ከመሆናቸውም ክብደት ኮሪያ ከቤተ ከነበሩ ከአቅም ካለበት ከአለም ኮንፍረንስ ከስብሰባው ከባድመ ከኦሮሚያ ክህሎት ከአየር ከመጀመሪያው ከህዝቡ ከጋዜጠኞች ከመጪው ካንሰር ከጀርመን ከሃገር ከወጣ ከመሬት ከሰሜን ከለላ ከኛ ከእናት ከሰይፈነበልባል ከኃላፊነታቸው ከታሪክ ከሰሞኑ ከመረብ ኪሾ ከሞረሽ ከተሰጣቸው ከሞላ ከሚያዝያ ከተቃዋሚዎች ከፍተኛው ከአሁኑ ከመጠን ከመከላከያ ከሁሉ ከቁጥጥር ከፍቶ ካድሬ ክርስቶስ ከአሰብ ኮማንደር ከህግ ከመጋቢት ከአስር ከዓመት ከያዛቸው ከመጀመሩ ከመጡ ከጥቅም ከሕዝባዊ ከውስጥ ኪሎሜትር ከኤች ክንፍ ካምፖች ኩራት ከቫይረሱ ከዳር ከነሐሴ ከህወሓት ክልሉን ከወትሮው ከእውነት ከፍንጅ ከማስቻሉም ከምን ከመላው ከጀመሩ ከከተማው ከወጣው ከሀገር ካይሮ ከሚኖሩ ኪሣራ ከያዘው ከሚለው ከሚባሉት ካላት ከተያዘው ከቤተሰቦቻቸው ካደረገ ከተሰጠው ከኔ ከፋዮች ከሌሊቱ ከሞት ከቢቢሲ ከአገሬ ከነበረበት ከፍተው ከየመን ከልማት ከራሱ ከድንበር ክልሎችና ከወጡ ከብሔራዊ ከከፍተኛ ከእንግሊዝ ኬላዎች ኮንፌዴሬሽን ከተፈለገ ከልዩ ከማድረጉም ከዳግም ካቢላ ከቡና ከቅንጅት ከቶውንም ከዘጠኝ ከምክር ከተማውን ኮሚቴና ከኃላፊነት ከግቡ ካሱ ክህደት ከፍታ ከገቡት ከኦሮሞ ካህናትና ከሚያደርገው ከተቋቋመ ከመሆናቸው ከጥቁር ከገባ ከዕረፍት ከቀድሞው ከቀትር ከግል ክልልን ከፋዩ ከተመደበው ከአጠቃላይ ክንድ ከተፈጠረ ክርክሩ ኮሚሽንና ከነፃነት ከቦታው ከመኖሪያ ከኢትዮጵያውያን ከንግድ ከመቀሌ ከፍርድ ከሃያ ከእነሱ ኮፒ ከሙስና ከዋሽንግተን ከማዕከላዊ ከአንዱ ከተመለሱ ካንድ ከአርባ ከሰጡ ከተጠናቀቀ ከጦር ከሆነም ከመደበኛ ከጣሊያን ክርስቲያኑ ከኢትዮጵያና ከዩኒቨርስቲው ኮንትሮባንድ ከባህር ከሳምንት ከህዳር ከተባሉት ከጠላት ከቀድሞ ከጧቱ ከቦታ ክበብ ክልልና ካደረጉት ከጦርነት ከባንኩ ከፍለው ከቀበሌ ከመይሣው ከከተማ ከግብፅ ከምግብ ከሥልጣናቸው ከደረሰ ከጤና ከመጣ ከነበሩበት ከምንም ከማን ከጎበኙ ከሌሎችም ከድሬዳዋ ከባድና ከተያዙት ከራሳቸው ከያዘ ከታህሳስ ከቱሪዝም ክርስቲያኗ ከማትሚኖ ከመለስ ከከተማዋ ከዕለት ከፓርቲው ከመዲና ከሚገባው ከወታደራዊ ከጉዳዩ ከጎረቤት ከአሥር ከተካሄደ ከአዲሱ ክለቡ ከአካባቢ ከዛ ከመንገድ ኮሚኒቲ ከወራት ከእኔ ከሥራቸው ከሩቅ ከሱ ክሊኒክ ከገዢው ከደረሰው ከኋላ ከቀን ኮማኖ ከጥቃት ከሚሰጠው ከሚያደርጉት ከተገኙት ከግብርና ከባለፈው ከመሰረቱ ከቻይና ከጉምሩክ ከሚቀጥለው ክብካቤ ከቶ ከዋና ከፋይ ከአማራ ኮድ ካልቻለ ከታቀደው ከዘጋቢ ከአንደኛ ካቴድራል ኩብ ከመግለፅ ከተመልካች ከናይሮቢ ከተከሰተ ከያዙት ካሉበት ክለሳ ከነሱ ከገለፁ ከተረጋገጠ ክልሎችን ከሕወሓት ከበርካታ ከጀመረበት ከትውልድ ከፊሉ ካብ ከትኩሳት ካሣሁን ከኤርትራው ከፌደራል ከወረዳ ከሌለ ክስተቶች ከፍተኛና ከኢኮኖሚ ከአደጋ ከግጭቱ ከመድረሱ ከጥፋት ከግቢው ከየትኛውም ካባ ከመነሻው ከሰጠ ከተሰማሩት ከገበያ ከተወሰነ ከተማሪዎች ከዋናው ከኤግዛ