            amharicWords[19, 0] = "ኮተን ከተጋጣሚው ከመከሩ ከሂደቱ ከተጠየቁት ከተቃውሞ ከምናየው ኮርት ከተዳረጉት ከክፍሉ ከምርኮኞቹ ከሚሊዮን ኳሷ ክፍተቱ ከሲዳማ ከግብፁ ከሆድ ከአካል ክሊራንስ ከሚከታተሉት ከጸሎት ክሶችና ከማጎልበት ኩማን ኩማኖ ካነሱ ከመሸጥ ከአሰሪዎች ከመኖራቸው ከጨረታ ከየወረዳው ከልለው ከምዕራባውያን ከቀደምት ከታቀደለት ኮርፖሬሽኖች ከሲኖዶሱ ካልተወገደ ከጤፍ ከሚገባ ከጠፉት ኪጋሊ ከዴንማርክ ኮርፖሬት ከሚደርስበት ካስገቡ ክርስቶፈር ካስገባ ከግልና ከመሞታቸው ከተሰሩት ከታዋቂው ኮርሶች ከመቆየቱም ከአቅሜ ከጭነት ከእንጨት ከሞሮኮ ከሐቅ ካልተባለ ከነገር ከተጣለባቸው ከተስማሙባቸው ከማስተዋወቅ ከተሰራጩት ከአክሰስ ከየመንና ካሊእ ከባለሃብቶች ከአንድሺ ከቱርክ ከቃለ ኮሚኒቲው ከቪኦኤ ኪንግ ከሳሾች ካልተመለሱ ከክልሎችና ከመወጣት ከዘውድ ካሳወቀ ከዜግነት ከሚመስሉ ከስደተኞቹ ከማስፈን ከገለልተኛ ከዚያማ ካቆሙ ከፆረና ከወልዲያ ከአስተባባሪው ከሚያወጣው ከናይል ካቴድራሉ ከእኩለ ከወቅታዊ ከኪንሻሳ ከመወሰኑ ከፋፍለው ከአውሮጳ ከየመንገዱ ከታወቁት ከባህታዊ ከተነሳው ከአቻ ከመ ከከፈቱ ከሚከተሉት ከአስመራና ከላኳቸው ከሆነማ ከቀበሌው ካዋለች ከኤርትራውያኑ ከከፋ ከፈጠሩ ከጥላቻ ኩራትና ከድሬደዋ ኩል ከሚያናግር ከውትድርና ከመቀስቀሱ ከውይይት ከነበሩባቸው ከታወቁ ከተሃድሶ ካልተረጋገጠ ኮንቴ ከአፌ ኮሙዩኒቲ ከቢዝነስ ከነባለቤታቸው ከማሊ ከከፍታ ከዓዲግራት ከራያ ከነበሩትና ከሚታይባቸው ከመታደግ ከማሳ ከሰላሣ ከገለጹ ከአፋቸው ኬለር ከዲሞክራሲያዊ ከእርስ ካስፈለገም ከቁጥጥራችን ካስቀመጣቸው ከሰነዘሩ ከፊሎቹን ከዳኞቹ ከናትዋ ከንግዴህ ከጠበቃቸው ከዳኞች ከቀብር ካልሽ ከትላልቅ ከማስከተሉም ካፌው ኮንፍረንሱ ከሚፈልጉ ከሚያዘው ኮሚሲዮን ክሕደት ከዋፋ ከማቅረቡም ከታሪካቸውና ካማሬት ከማሰማት ከሚታገሉ ከአርበኞች ኩፎር ከቆይታ ክስተቱን ካልታወቀ ክንውኖችን ከአህጉሪቱ ከመሪዎቹ ኩዩብ ከተገለፁት ኮፒዎች ክብደቱ ከተለወጠ ከፈለክ ከሆንክ ካሸነፉ ከምንጮች ከወገኑ ከቅድስት ክሮች ካፉ ከድንጋይ ካደገ ካደጉ ከመስጠታቸውም ከወረቀት ካልኦት ከማስገባት ከድርን ከደሞዝ ከእዚህም ከመቻላቸውም";
            amharicWords[19, 1] = "ካርታና ከረሃብ ኳስን ኬንያዊቷ ኮብልስቶን ከተደረገለት ከመሞከር ከአስተያየት ከሻለቃ ከቅጣት ከፕሮጀክቶቹ ከክፉ ከውስጥም ከሰባ ከበጀት ኮሜቴ ከላሊበላ ከዚምባቡዌ ክፍተቱን ከተሰማሩባቸው ከተናገሩ ከማሳየት ከተካሄደባቸው ከሀገሪቱ ከወጡት ከኢንተርኔት ኮሮጆ ከመያዙ ከመንግሥታቱ ከሊባኖስ ከፍለን ካሪኩለም ኬንያዊ ክርስቲያናችን ከአሸባሪዎች ከሕብረቱ ካይዳኪ ከጥቅሙ ኪዳኑ ከትግል ከተገለፀ ከማለቱ ካሜራዎች ከቁጥር ካለንበት ከሳዋ ከደብረ ከውሳኔ ከጠባብ ከበደን ከመነሳታቸው ክርስቲያኑን ከብትና ካምፓኒው ከተዘጋጁት ኮሌጆቹ ከታህሣሥ ከተወሰደ ከፈፀመ ካልተወሰደ ከማሳካት ከተነሱ ኩባንያና ከተማንና ከእቴጌ ከራይት ከመቃብር ከጠፋ ከከረን ከበር ከግብርናው ከድንበሩ ከሮም ካጠናቀቀ ከተጠቁት ከትጥቅ ከአርሲ ከደም ከተካሄዱት ክንፈን ከውጊያ ከገባው ከሚችሉ ከጉዳት ካናዳና ካወጣ ኮንግረሱ ከብቶቹን ከዱር ከተፈቀደላቸው ከታላቅ ኳሶች ካቀደው ከሚለማው ከሜዳው ከአምስቱ ከአገሯ ከተፈታ ከሆላንድ ክለላ ከወሎ ከደረጃቸው ከሁለትና ኮምፒውተሮች ከተሞቹ ከትንናት ከጋና ከወዴት ከዕለታት ክብሪ ከነባር ከተጠናቀቁ ካረጋገጡ ከነዋሪዎቹ ኮናሬ ከተማችን ከመሳሰሉት ከማስጠበቅ ክፉም ከመኖሪያቸው ከተቀበለ ኮህለር ከአይዲድ ከፕራይቬታይዜሽን ከታረሰው ከተስማሙ ከቶም ከጄኔራል ከረጢት ካነጋገራቸው ከመስራት ኩባንያዎችም ክልላዊና ከወረዱ ከመማር ከነፀብራቅ ከቀደሙት ከሚመጣው ከተከሳሾች ከፕሮግራሙ ከሚውለው ከአፍ ከተቀሩት ከጎናችን ከዕውነት ከኑሮ ካልተሳካ ከቅድመ ከተገመተው ከድርቁ ካልን ከተሜ ከኡጋንዳ ከሰሐራ ኬቤ ከተጠናቀቁት ክትትሉ ከምታገኘው ከሜይ ከተባለም ከማጥፋት ከአቴንስ ከተመታ ከኮሚቴው ከሕንድ ካልደረሰ ኮሚቴነት ክትባትና ክምችትና ከኢትዮጵያውያኑ ካልተፈጠረ ከከተሞች ከፕሬዝዳንቱ ከመስጠቱም ከደሴ ኮሌኔል ከጠዋት ካሏቸው ከብዙዎቹ ከወንድ ከወንጂ ከኩባንያው ከተከፈተ ከመጀመራቸው ከደንበኞች ከልጅ ከልዑካን ከተደረሰ ከሠራተኛው ከኢትዮታይም ክሬዲት ከፋፍለህ ኮሜሳ ከማምራቱ ከግንቦቱ ከጋራ ከነጋዴዎች ኮርቻ ክፍሎቹ ከችሎት ከሚደርሱ ኪሎና ከሚቀርቡ ካሊፎርኒያ ከፍለዋል ከወደቡ ክንውኑ ካሴቱ";
            amharicWords[19, 2] = "ከ ከፍተኛ ከተማ ክልል ከዚህ ኮሚቴ ከኢትዮጵያ ከሆነ ከአዲስ ክፍል ኮሚሽን ክስ ኪሎ ክልሎች ከሪፖርተር ክፍለ ኮሚሽኑ ከተሞች ኩንታል ክፍሎች ከኤርትራ ከአንድ ከተለያዩ ካለፈው ከዚህም ከዚያ ከሌሎች ኳስ ከባድ ከውጭ ከፍ ከሁለት ከትናንት ካሉ ካፒታል ኩባንያ ኮሚቴው ክፍያ ካለው ክልላዊ ኬንያ ክርስቲያን ካለ ከንቲባ ከጦማር ከመቶ ከመሆኑም ከዓለም ከወዲሁ ከአቶ ክቡር ከመንግሥት ካሳ ከጦቢያ ከአገር ከበደ ከዚያም ክብር ከዚሁ ኮሌጅ ከቅርብ ክትትል ኩባንያዎች ክፍላችን ከሁሉም ከላይ ከተማው ካሉት ከጊዜ ከኢትዮ ከምኒልክ ከመንግስት ኮሚሽነር ካድሬዎች ከአሜሪካ ካልሆነ ካላቸው ከሥራ ክርክር ከአካባቢው ከአፍሪካ ከነበረው ከሻዕቢያ ከእንግዲህ ክፍሌ ኮንፈረንስ ኮርፖሬሽን ከነበሩት ከሚገኙ ከእስር ከሱዳን ከአምስት ኮሎኔል ከአስኳል ካለፉት ከኔሽን ከእነዚህ ከድህነት ክፉኛ ክልሉ ካሠሽቃሸሳሽቃሸቋ ከኢትኦጵ ከቀኑ ከሆኑት ከአራት ካርድ ከክልሉ ከዛሬ ኮፊ ካምፕ ኮሚቴዎች ከኢህአዴግ ካርታ ከነዚህ ከንቲባው ከጥቂት ከግንቦት ክፍት ከስፍራው ከጠቅላይ ኮንግረስ ከሦስት ክፍሉ ከፊያሜታ ከትላንት ከአሁን ከ ከሶስት ክፉ ከሚገኘው ክለብ ከሚገኙት ክስተት ኩማ ኮርፖሬሽኑ ከሆኑ ክንፈ ከድርጅቱ ከግማሽ ከሰዓት ክምችት ከዘፕሬስ ከሶማሊያ ከትግራይ ከሕዝብ ከደቡብ ኮሚሽኑን ከማድረግ ከፖለቲካ ከመቼውም ከስድስት ካልሆኑ ካሣ ከዕለታዊ ከጅቡቲ ከሚመለከታቸው ከስራ ካህናት ኮሌጁ ከቤዛ ከነዚህም ኩባንያው ከተባለ ኮከብ ከመሆኑ ከሩሕ ከሁለቱ ክፍተት ከመስጠት ከሁለቱም ከመስከረም ከዘ ከምርጫ ካሬ ከሥልጣን ከተማን ክፍፍል ከሐምሌ ከሰኔ ክህነት ኮንስትራክሽን ካውንስል ክሊንተን ከፊል ከጀመረ ከመብረቅ ከምርጫው ከጠዋቱ ከጥር ከግብ ከአውሮፓ ኮሌጆች ከተጀመረ ክሶች ኪራይ ከየት ከአስመራ ከጎሕ ከብት ከተደረገ ከተማና ከተማዋ ከስምምነት ከምሽቱ ካርቱም ከቤት ከትምህርት ከውጪ ካሁን ከሌላው ከሚል ከተቃዋሚ ኪሳራ ከሕግ ከአምናው ከማለት ከነገ ከጦርነቱ ከግምት ከሰው ክረምት ከማል ከፌዴራል ከልሳነ ክንውን ኮሚሽነሩ ክለቦች ከሌላ ከእነዚህም ክትትልና ከብዙ ከገናናው ክፍሎችን ከሳተናው ከብቶች";
            amharicWords[19, 3] = "ወደሃምሳ ዋጡት ወደጃንሜዳ ውድቀቶች ወዳጆቻቸውንም ወገኖቼና ወደርሱ ወገንተኝነቱን ዉድቀት ወደቀጨኔ ወደጥልቁ ወደስኳር ወጪአቸውን ወጥቶአል ውደዱ ወዳድነቱ ዋሽንግቶን ወደሶርያ ወጠረ ወዳጃዊ ወያኔነታቸው ወፏም ወደእውቀት ወደየቤታችን ዉድነትና ወደሥራዬ ወንድማችንና ወጣትነትና ዋነኛውም ዋሽተዉ ወደማይፈለግ ወአንቅጥቅጤ ወንድምዎ ዉድነትን ወእለ ወይባ ወደተሠራው ዋርካው ወዳደረሱባቸውና ዋልደ ወንድሙንም ውዳሴዋን ወጣትነትን ወደራሷ ወያኔዎችንና ወደጤናማ ወገንተኛነትን ወንድምአገኘሁና ወደቀደመ ውሀና ወንበርን ወደሚያስቀድሱበት ዌብሳይቶችን ዉህደት ወገዛ ወደማይችል ወደመለያየት ወንዝንና ዉሸትና ወደተከፈተ ወጪዎችም ወዳጆቼም ዎርምን ወደእግዚአብሔር ውስልትና ውጤታማው ወደስራዋ ዋሀብ ወዳልታሰበ ዋቄፈታውም ወከባዎች ወንጀለኞችና ወደኛም ዋናዎቹና ወደዱላ ዉጤቱን ወፍራሙ ወደሚመስለው ወገንተኛና ወደማይወጣው ውሱንነትና ውሰዷት ዋለለኝ ወንድማማቾቹን ወፍራሟ ወደዉስጥ ውሀው ዋርካዎች ወዳለምነው ወደየኅሊናችን ወደሚያስገኝ ወደአማራው ውሎአችን ወደበሩ ወደእዚህ ወንጀለኛውና ወደዘጠና ወዜ ወኩሎሙ ወደቁም ወዩ ውዱብ ወያ ወያኔስ ወዳገሩ ዊንግ ዊ ወጦቹ ውድቀታቸው ውጤታቸውም ወጥመድም ዎ ውኃዬ ወደጋዜጣው ወይምበሌላኛዉ ወደቀም ዌብሣይት ወአሀዱ ዉሉ ወደሁለት ዉዉዉ ወጌ ዋሊያዎች ዋናዉና ወደምንፈልገው ዎርክሾፖች ወደጭስ ወዳለቀለት ወገናችንም ወያኔነት ወደሁከት ወገባችሁን ወንድሞቹና ወያኔውዎች ወይሰደድ ወንዟ ዋጋገው ወጦ ውሎአቸውን ወደማድረጉ ዎተርን ወደቦቹ ወደዚህኛው ወጀቦች ወዳድእናቷን ወንድሞቹን ዋሽግተኖች ወደዞን ወንደ ውጤታ ወጥቶባቸዋል ዊቲግ ውመን ወያኔያዊያን ወያኔያዊው ወገንነት ወደንም ወደማዕከል ወደማድረግ ዋላችሁ ወደቀባት ዋርነር ወደነበርንበት ወጥቶባት ዋጋቢስ ወንድሞ ወንድሞቻችንም ዎቹና ወገናችሁን ወደሚርቀው ወደተነሣሁበት ወደሚገኘውና ዉለታ ወዳጀችዎም ወደፈለገበት ውድቅዳቂ ዋናን ወጉት ወጣቶቿን ወድቀህ ወደትክክለኛ ወዳደረጉት ዋሀቢያ ወደአይኗ ወይታዋ ዋይን ወእስከ ወዳጁም ወዝውዞ ወደየክልሉ ወዴትም ወንጭ ወዲሕ ዉቅሮ ወደተሰማበት ዋሽንት ውላጆች ዋናዎቹስ ወደሚሉ ውጫዊና ወንድሞቿን ውሱንነትም ወደፒያሳ ወንዶቻችን ዋካሶ ወንደላጤና ወናፍ ወደለት ውዴታችንን ወኒእመል ወንበሬ ወደሽ ዌልቤክ ዎገኔ ወንዞቹን ወዳልሆነ ወንድምሽን ወገኖቻቸውና ወደእዛ ወያዎች ዉሎና ዋሊድ ውሰደን ወደኅሊና ወደሚሉት ወወክማ ወንድማማችንትን ወጥቶላቸዋል ወዳቋረጥኩት ወንድነቱንና ዋዜማዎች ወደተመደቡ ውዳጄ ወጣሁና ዉጡ ወጥሬ ወነጀላቸው ወካይነት ወካይና ወደምርመራ ወደማይችለው ዋልጌነት ወጥታችሁ ወደተሰኘችው ዊኒፔግ ወደተለየ ወደታችኛው ወንደር ወደነበሩት ወደዉጭ ወደተነገራቸው ወደዝርዝር ዊአን ዋምባይ ወከልኩት ወደውጤት ዎልማርት ወዳፈተተን ወደገበያው ወፎችም ዉስጣዊ ወደበላይነት ዋንኛውና ወደነጃሺ ወደክሊኒኩ ወደቦታቸው ወዳድቀው ውልደቱ ዋታራን ዋካና ወደነ ወጣላችሁ ወንጀለኝነቱ ወደማጠቃለያ ውደደው ወደራሳችሁ ወዳጇን ወየንቲ ዋሃቢስቶች ዎል ወደክፍያ ዉሳኔያቸው ወግዱ ዋይታውን ወደድክም ውሏቸውን ወጥረዋል ወደሚተነፈሱ ወደመውሰድ ወጌሻዎችና ወንጌላውያንም ዊኪ ዎቅት ዋይታቸው ወጡን ወደቃለመጠይቁ ወደጥቂት ወደመሃል ወድዶና ውድቀቱና ወንጀላቸውን ዉስጡ ወደማሻሻያ ወዳገራቸው ዉጪና ወንዳታ ወደሚቆጣጠሩት ወድቄያለሁ ወደስድሳ ውሃዬ ወደባሰበት ወደውስጥም ወደጨዋማው ዋናወቹን ወደሚመስሉህ ዋሾዎች ወደተግባራዊ ዋጋዎችን ወንድማቸዉ ወደራሳችን ወገኛው ወደሦስት ወገኖችህ ወደጣቢያ ውግያ ወደመጡባቸው ወንድምነትህን ወዳችሁ ወደማምለክ ወደኖሩበት ወደማሳደዱ ዊዝድራዋል ውዶቼ ወጣንበት ወደማጠቃለያው ወገኔን ወደላካቸው ወንጀለኛነታቸው ወደተቃራኒ ወደተነሳው ወደሚመራው ወንጀለኛውም ዉሳኔዎችን ወደተኛችበት ወደደ ወደተኛበት ወደተከሳሶቹ";
            amharicWords[19, 4] = "ወረራንና ወደአመፅ ወልዷል ወደሚችል ወደእነርሱ ወሰኗል ውጥረቶች ወደዞኑ ውርጃ ወገናዊነቱን ወደማንም ውስጣችን ውድአላት ወደያገራቸው ዋለን ውጥንቅጡ ውጊያቸውን ዋሸንግተን ወታድራዊ ወደጣቢያው ወደዬመጡበት ወዳጄም ዋናተኛ ወደመንግሥት ወእመኒ ወፈ ወታደሮቼን ውጥናቸውን ወያኔወች ወደጥቁር ዋሻችሁ ወደሚሰጥበት ወክለህ ዊትህ ውስጣቸው ወጊነት ዋሽታለች ወኔያቸው ዋይኮፍ ውለዱ ወደዩናይትድ ወደኩዌት ወንጌልም ወደቤቷ ወገኑንና ወጋችን ወገቧን ወኪሎቻችን ውረድን ወደነበርኩበት ዉስጥና ወልደያ ውኀደቱ ውጤታነማነት ወዳጆቹን ውህደቱም ወደቧን ወንጂና ወጣቶቻችን ወደጉዳዩ ወራቸውን ውይይታችንን ወስደውብኛል ወደኢሕአዴግ ዋሻና ወደጣልያን ውሜን ውረዶችና ወደምዕራቡ ወለሎች ወረራዎችን ወደአራት ወርሀዊ ወንድምኩን ወዳዷ ወርውረዋል ወረባቦ ውሎዬ ዉስጤን ወደሚረሽኑበት ወሰዳቸው ዋናኛ ወስፌ ወቅዱ ወደናይጄሪያ ውስንነትን ወንዞችንና ወዳዱን ዎችን ውደድሮች ወንደላጤ ወደአገራችሁ ወደሕዝቡ ወርቄም ውሸትነው ወጪዋን ወሬን ውርንጫ ወደተቋቋመው ውጡልኝ ወደሰው ውሾ ወደጣራው ወደተከሰተባቸው ውጪና ወንዛችንም ወስደነው ወራሪዋ ዋሽተዋል ወደሚሌኒየሙ ወሬኞች ወደማጡ ወጨንቆ ወደግለሰቡ ወግነዋል ወደሚቻልበት ወድያውም ውረዱን ወጋችንን ዋናዋ ወደፊቱ ወጣቶቿ ወጠጤ ውኃዎችን ውሎችም ወደአርጀንቲና ወደመፍጠር ወደግቡ ወንደሙ ወደአክሱም ወቅታዊም ወደቦችም ወረዋል ወጠምሻ ወንድምአገኝ ወልደፃዲቅ ዌበር ወላጆቼን ወደሚባል ውኃቸው ውይይታቸውም ዋጋሪ ወደማየቱ ዋሊያስ ወካዩ ወከፍና ወላጆቻችን ወደማለት ወንድምህ ወንድራድ ወደምርጫው ወሸኔ ወረደዎች ወደቧ ውርውር ውድነቱም ውይይታችን ውሸቶች ወደአስከፊ ወደተባሉ ወደየመኖሪያቸው ወተታቸውን ወንጀሎችም ውዳሴና ውፈር ወስዷቸዋል ወደምሥራቅ ወደድኩ ወደት ወረድን ወደመካከለኛ ወደሕግ ወደካምፑ ውስጥስ ዌዘረል ወረደባቸው ውሳኔዋ ወደላይኛው ወሕዴፓ ወራሽና ወደፈለግነው ወንድምን ወንበዴው ወዳረፉበት ወዳጆቿ ወዲያውስ ወደነፃ ወደሆኑት ወኔን ወገብዋ ወደየካቲት ወደጥፋት ዋቢሸበሌ ወደመስቀል ዊሳም ውሸቱ ውፍረትን ወጥነትና ዊለም ውይ ወምዕመናን ወቄት ዎዩን ዋይታና ዋስትናዎችን ውዷ ውስጡም ወደመድረኩ ወልደዋል ወለዱንም ወደድኹ ውልደት ወደን ዋረን ወገኖቿ ውስጥውስጡን ወደዐረብ ወደመጣችበት ዋናውም ወሰንኩኝ ወሰድኩ ውጤጥ ወታደሩና ወሰደች ወሀቢዝም ወጣቶ ወግድ ወዳጆና ውዝግብም ዊን ውድደሮች ወስዶት ውደነቱን ወላጆቿ ዌክስቴድ ወደጠቅላይ ወደደህንነት ወደመኖሪያቸው ዋኖሬ ወደሁመራ ዋሽንግተንን ወደጉባኤው ወርቆች ውሰዱልን ወጡና ወልደሠማያት ዉስብስብ ዎልፎርድ ወደሚችለው ወንጌሉን ውጉዝ ወረወሩ ወደሻሸመኔ ወራሴ ወደስድስት ውሰደው ወጣትእና ወደፊትና ወዳድነታቸው ዋልታን ወደዩኒቨርስቲ ወጣና ወደመጨረሻ ዋናውንና ወቀሳም ወደመጨረሻው ወላድ ወለላ ዋልታዎች ዎልፍሰን ውስንነቶች ዊዓ ዋሻዎችን ውሳኔያቸወን ወንጅሎ ወደወንዝ ወጣኝ ወዳጄን ዉጥረት ወረደና ወሰዱኝ ወደውት ወረቀቶችም ውላችንን ወሰደን ወርሽ ውሾን ወርዶባቸዋል ውግዝ ወጥኖ ወንጀለኞችም ወንድማገኘሁ ውጤቶቹም ውጥንን ወርቀ ውሳኔውንና ወያኔዊ ዋሶች ወሰንተኛ ወደንና ወረቀቶቹ ወደሥራው ዌሮችን ወድምፅ ወኔያቸውን ወያኔው ወደሕክምና ወሰደኝ ወጥመዶች ወልጄ ወደተፈላጊው ወደከፋና ወግተዋል ወደባድመ ወደዛ ዋትስና ዋቅጅራን ወርሷል ወርቂቱ ወንድን ዋልድባን ወላጅና ወደበዛብህ ወረዳዋን ወደተፈለገው ውሳኔያችንን ወታደሩም ውኃም ወደተከሰተበት ወላጅን ወደማታ ዋሌ ወሬያቸው ዎን ወራቤ ወደሚያገኝበት ዋጋቸውም ወረታውን ወገቡ ወቅትስ ወሣኙ ወሳኘኝና ወርሐዊ ወደገበያ ወደዱ ውሉደ ወደላሊበላ ውስኪውን ወሎም ውሳኔያችን ወደአማርኛ ወያኔንና ወቀሳቸውን ወለጋና ዋጋዋ ወሰንና ወደምትማርበት ዋሾነት ወደወንበር ወደነበረ ወደመዳረሻችን ዋሹ ውድቀቱም ወገብህ ወዳማራው ወደዘርፉ ወደእናት ዋሻችን ወደኃላ ዉልዶች ዋችም ውላጁ ወደደው ወዲያማ ውላጅ ውጪያዊው ወደተቀበላቸው ወደማርክሲዝም ወደእውነትና ወንጌላውያኑ ወደጤና ዉዝግቡ ወደተማከለ ወደጀመርኩት ወገኖቻችንና ወደኋላም ወደዚያኛው ዎንግ ወንወጀል ወጎንደር ዊስኪ ወደመቶ ዋክበር ወደየግል ዉዝግብ";
            amharicWords[19, 5] = "ወደሚችሉበት ወርራለች ዉድቅ ውቧ ውሣኔዎችን ዋሻው ወንዱም ወረው ወንጌሉ ወዳዶችና ወደዛምቢያ ወደሃገሩ ወንዞቿ ወጪያችንን ዋቅጀራ ወዴትስ ውጥናቸው ወደረኛ ዉድድር ውሰት ውድቀቱ ወደተሰነይ ወደዳችሁም ወደሚሄዱበት ወረፋዬን ወደሰንዳፋ ወራቶችን ወላጆቻቻውን ወዳባይ ውሳኔዎቹን ወንድማማቾቹ ውዳሴን ወሰድን ወንድምነት ዋይድ ውጤቶችንም ወደእነዚህ ወደጊዜያዊ ውግዘቶች ዉጤቱ ውለታቸውን ውልብ ወደሚደረግበት ውሳኔዎችም ወደምስራቅ ወንዶችም ወደችሎት ውላችሁ ዋንግ ወደአረብ ወርሃ ወነጀለ ወጭውም ወደስራ ወንድማቸውን ወልደአብ ውስጣቸውን ውግ ወታደሩንና ውንጀል ወደቀና ወፎቹ ወንድምህን ወየው ወደስብሰባ ወንድሞቻን ውሁዳን ወቅጋሪ ወላጆቼ ዊስኪና ወዳድነትና ውጨ ወራሪዋን ውጥረትም ወረቀቶቹን ውቅያኖስን ወገራ ወዳጅን ወዶና ወጥቶበት ዋደራ ውህደትን ውሸቴን ወጥተህ ዉስጤ ውድቀቱን ወጥቶባቸው ወልይ ወርሶ ወደጫካ ዋናፀሐፊ ወደየቤቱ ወገንና ወዲያዉኑ ወለላዋ ወለም ወደናይሮቢ ወረቀታቸውን ዋቅጅራና ውለታን ውስጣችንን ወደምትባል ወደሊዝ ወግድልኝ ወወልድ ወደሚሰጥባቸው ውህዱ ወናሁ ወደጣሊያን ወንበርታ ወርውራ ወዳለባቸው ወልዶና ወደየሃገራቸው ዋህቢያዎች ወቅቶችም ወደቀያቸው ወንጀልነት ወገቤ ወስዶባታል ወደደረሰበት ወደአማራ ወደድ ወደትግል ወልድን ወደናንተም ወረቀቷን ወደሠራዊቱ ወበቅ ዋለልኝን ወደመረጣቸው ወደማያውቁት ውጣና ወደስደት ዋርዴርና ወገባችንን ወደአለ ወደብነት ውጥኑ ውበትዋ ውግዘትና ውርደትም ወርዋሪዎቹ ወሬዬን ዋልክ ዋስትናነት ወደተነሳሁበት ወደማይቻልበት ወደማያንስ ወደቤተሰቦቹ ወደአዋሳ ወረደብኝ ወረርሽኞች ውሾችና ውህዳኑን ወገራንና ወዳጅነታቸው ውድነሽና ወድቀን ውህደትናን ወራጁን ወዳጅዎ ወሳኔዎቹ ዊዝአውት ወአጽብሃ ውጩን ወደሚፈልጉበት ወደውሳኔ ወደተለመደው ወጥተውና ዋርፋረ ዋሺንገተን ወደምኒልክ ወገኖቼን ወታደሮቻቸውም ወደቤተመንግሥት ወደተመደቡበት ወደእልቂት ወረዳቸውን ወዮለት ውይይቶችንና ወደሚሰቀሉበት ውኃውም ወደባሌ ወዳጅነታችን ወርኩ ዋአ ወርሃዊው ወደተለያየ ወዳጅነቱን ውጥረቶችን ዋኝተው ወደቦረና ወልዱን ወደእነዛ ወረራዎች ወሲብን ወደአልሆነ ወደየክልላችን ወሯ ወጋጎዳስ ወፍጮዎች ውጫዊም ወደቀይ ወሰነበት ወርኻ ወለኔ ወገናቸውንና ወደክፍሉ ወሬዋን ወህኒዎች ወልደን ውድድሮቻቸውን ዋሽተው ዋዣቂው ወደማረፊያ ወዳጅነትም ወደዳኝነት ውጤታማነቱን ወደሚፈልገው ወቅሷቸዋል ውንብድናዎች ወዮላችሁ ወደፊትስ ወደማያውቀው ወደክልሎች ወደተሻለና ዋልዶ ወስዶታል ወደየመጣበት ዉንጀላ ወያላውና ወንድማማቶች ውጤታችንን ወፎችን ወንድሞችን ዋዲ ዋዴ ወደህዝቡ ወቴ ወልዳይን ወደቢሮው ወደሃያ ወቸ ወንጀሉም ውዳበና ወደአዳራሽ ወጣቷም ወሰንየለሽ ወጥመድን ውሳኔዎቹ ዋናተኞች ወደመሀል ወታደሮ ወደማያባራ ወስናቸው ወደሩዋንዳ ወያን ወደየትውልድ ወራራት ወርቃዊ ወደአፍ ወደቀሪው ወጭውን ዌሮች ወሰላም ወደደጅ ወአፅብሃ ወደግዛቷ ወግቶኝ ወንድወሰንና ወደሞያሌ ወደፊንላንድ ወንድየ ውጊያዎችና ወርቃፈራሁ ዌም ወጣቶቹና ወንዞችም ወይምን ዋችን ወንዶቹም ዋንዛና ወፃእ ወጪያቸውንና ውድድሮቹ ወለፈንዲዎች ወደውጥረት ወደቤተክርስቲያኗ ውርወራና ወጎኖች ውስጠኛ ወደፈለጉበት ውሳኝ ወገባቸው ዋግሹም ውለኛ ዋኬኔ ወደክርስትና ወልደጊወርጊስ ወደቡሬ ውስብስቡን ወረሩ ዋፋ ወንደወሰን ወርኮች ውዥንብሮች ወረር ወደውህደት ውዝግቡም ወራሾቻቸው ወንጅሎታል ወደመካከለኛው ዋናወቹ ወደሚካሄድበት ወደቅዳሜ ዋስትናችን ውሽት ወደመንግሥቱ ወደዳር ውቤን ወርጀምሮ ወደፌደራል ወጪውንም ወንጅለዋታል ውሸታቸውን ወደሚታወቀው ወጣበት ወንጌልና ወርቃማው ወደቻይና ወደቀደመው ወረራችሁ ወደፖለቲካ ወደኢንዱስትሪ ወደምድር ወጥቷልና ውድድሮችም ዋገን ውርንጭላ ወረፋም ውቃቢ ወደማይችልበት ውሻና ወደንግድ ወደሚሆንበት ወረቀቴን ውጣቶች ወደመርበድበድ ዋጠችው ወድጄና ወደኮልፌ ወደአየር ወገንተኝነትና ዋናዉን ወደማይታወቅ ወዳጂህን ወዳማርኛ ወጪት ወንጀለኝነትን ወረቀታቸው ወደስዋ ወጥቶለታል ወደዕለት ወያኔዎችስ ውጋጋን ወታደሮቹንም ውስብስብነትና ወፍጮዎችን ወደእኛ ውጠቱ ውሥጥ ወደሕትመት ወደዚምባቡዌ ዉይይቶች ወጢ ዋስትናዋን ወርውረው ዋተር";
            amharicWords[19, 6] = "ወደድሁ ወጭው ዋጅራት ወጌን ወገናችንን ውደድ ውለታዋን ውሽማ ወቃሽ ወደባህሬን ዋልያ ወደአዳራሹ ወደቻድ ወስዳችሁ ወርረው ወስኜ ወተቱን ወሎን ዋልጌ ውድድሩም ወሊድና ወልደማርያምን ወደህዝብ ወና ዋንኞቹ ዋከና ወጥቱዋል ወርድ ወደቦቿን ወረሞ ወደሚፈለገው ወርጂ ወዲያውኑም ወርጄ ወርቅዬ ወደትግበራ ወደፖሊስ ወንዝም ወደሚኖሩበት ወዶገብ ውቃቢያቸውን ወዝ ወዮ ወረዳም ውሎና ወደሚያስችል ወድ ወስብሐት ውዳበ ወላይታና ወሊድ ወደርየለሽ ዉድነት ወገንህ ወንድማዊ ውሎአል ዊንተር ውድቡ ወራሪና ዋስትናም ወደኦነግ ውስብሰብ ወደትጥቅ ወታደሮቻቸው ዋናዎቹም ውጤቶችንና ውጤቶቻቸውን ወደቤተ ወዳጅነቱ ወፏ ወደመደበኛ ውጤቷ ወደሳዋ ወድያውኑ ወደቤቴ ውረድና ውሻው ውጤታማነትን ወደመሬት ወጥመዳቸው ውእቱ ወገናዊነታቸውን ወድድር ዉበት ወሮታ ውሣኔና ዋንጫዎች ወፓትርያርክ ውይይ ወኪልነት ወገቤን ወደራ ወይዛዝር ወጣህ ወረቀቶችና ወንጅለዋቸዋል ወጤታማ ውልም ወረቅት ውብነህ ወሳኙን ወንዞቹ ወደሌላኛው ወረረች ወደውጊያው ወግን ወግኖ ዉስጡን ውስንነቶችን ውክልናን ወደግቢ ወያኔያዊ ወደኤምባሲው ውዲህ ወደወረዳ ዊል ወጣቶቻችንን ወንጀሎቹን ወጣቷን ዎርክ ወገቡን ዉጊያ ወንበራቸውን ወደሗላ ዋጅራትና ወጥሽ ውው ዊትኒ ወጭም ዋጋውም ወደጫካው ወደአመስተርዳም ዋንጫው ውርደቱ ውብሸትም ወደያዘው ውጤቶቹን ወደአሰብ ወደድንበሩ ውህዳኑ ውሳኔዎችንና ወስላታ ውበትን ወደባችን ወደመድረክ ውሰጥና ውፍይነትን ወደቀኝ ዊንፍሬ ወደሞት ወጥቶለት ወደልፍኛቸው ወርራ ወንድሜን ዋልዋን ወረፉ ወደሌለው ወጋጎዱ ወቅሰው ወርሰው ወታደሮቻችንን ዋግን ወጣችሁ ወደለንደን ውድመትንና ወስፋት ወጌሻ ውሎችንና ወትሮው ውኃማ ወዳጂና ወደትግሉ ወደድኩት ወንዳወንድ ወራቱን ወደልጅ ዊህለር ወገቧ ወደጉባኤ ወራቱ ወንድሜም ወደሚፈልጉት ውንጀላን ወርቄን ዎልፍንሰን ወደውና ዋነኛውና ወረፋው ውደድር ዋላኳ ውስጧን ውልድ ወላጆቹን ወደተባሉት ወደሚጠራው ወሽመጥ ውግዘትን ውክልናው ወዳላቸው ወደማተሚያ ውሾችን ዉሸት ውጤታማነትም ወሮታውን ወኪልና ወንጀለኛና ወእመሰ ወደኦሮሚያ ወደተካረረ ውሑድ ዋህደ ወለተ ውስትና ወደተባለበት ውሣኔም ወደአውሮፓ ወጪዎችና ውክልናቸውን ወደመኖሪያ ወንድምሽ ወርቁና ዊክሊ ወዳጆችም ወደኢየሩሳሌም ውሂብ ወስጃለሁ ወያኔንም ወልደጊዮርጊስን ወንድነት ዋስትናዎች ወሳኔ ወልደትንሣይ ወጋቸውን ውጤታማነቷን ወደራሱ ወፈፌ ወደየትም ወደራስ ወደየጦር ወላይታዎች ወንበርና ውዝግቡና ወደየመጡባቸው ወደአፍሪካ ወረርሽኑ ወደክፍል ወዘተን ወደየአገሮቻቸው ዌታንጉላ ወደምትጠራው ውቅያኖሶች ወደአካባቢያቸው ወደየትኛው ዊልሼር ወከባም ዋዳ ወንድሞቻቸውና ወቅሳለች ውሎቹን ዋቄፈታ ውሽንፍር ወርልደ ውበቴ ወደመከላከያ ወደእሥር ወሬዉን ወደመሐል ዋቀዩ ወሣኝነት ዋንጋሪ ወደጠላት ወጠጤው ወይኒ ወደራሳቸው ወራሪዎቹ ወደድኩኝ ወይዘሮዋን ውርስና ወደቃሊቲ ውሳነ ወራጁ ወንጀሎቹ ዋሕድ ወገኖቻቸውም ወክ ዌብሳይቶች ወዳጅነቷን ወደፊታውራሪ ዋሻውን ወይብላ ወገንተኛነት ውዳቂ ወደየክልላቸው ወረረ ወሳኝነትን ወንዲፍራ ወሬያቸውን ወደካናዳ ወንዛችንን ወደአንቺ ወላጆቻቸውና ወንድሞቻቸውን ወሰናቸውን ወለንጪቲ ወደተዘጋጀው ወያላውም ወልደትንሳኤ ወደዱም ወቀሰች ዌቭ ወገኖችንና ወዬ ውንበድና ውሎን ወደከርቸሌ ውሻን ወረታው ወደገደል ወልደው ወደቤይሩት ውራድ ዎፎች ወጉ ወደሱማሊያ ውባንቺ ወጫቸውን ወጋ ወንጀለኛውን ዉሎ ዌን ወደማረሚያ ወልደሰማያትና ዋነኛዉ ወስዶበታል ውራጅ ዋርዲት ውሸታሞች ውጪያዊ ወደሚኖርበት ወፅዩ ወደየአካባቢያቸው ውጤታማነትና ወኔያችን ወደነርሱ ውድደር ዋልያዎች ወደቦቿ ወተው ዋጠውን ውሳኔዎችንም ወንድሞቿ ወላዲተ ወርቃለማሁ ወዘት ወገኖቹና ወልደየስና ወልደኪዳን ዋሽቶ ወግናለች ወንድሟን ዋዩና ውግዘቱ ውኀደት ወደነዚህ ወገንተኝነትን ወታደሮችንም ውሃንና ወዮልህ ውጤቱስ ወርቅም ወደል ወቅትዊ ውድቅት ውሣኔን ወድዶ ዋርድ ውሳኔውና ወይጦ ወስደውና ወደቤተሰቦቻቸው ወጥኣት ወቀሣ ዋልተር ወላቡ ውጠው ውሻውን ወንዶችንና ወንድማማቾችና ወዳጆቻችንን ወርቅነህና ወደሰውነት ወስደህ ወደገጠር ወንበሩ ወጥተዉ ወደሷ ወርክሾፖች ወደአጠቃላይ ወረበሎች";
            amharicWords[19, 7] = "ወስነን ወጋህታ ወንዴ ወድያው ወታደሮቻችን ወደመሆን ወጥቻለሁ ውጤታማነታቸው ወዳዱ ወገኞች ውረዶችን ውንብድናውን ውር ወግቶ ወልቂጤ ወርዶፋ ዋስትናቸው ዋስትናው ውሽጢ ወደዋናው ውላቸው ወዳጆቼ ወጣትን ወንድየው ወንዶቹ ወደሚቀጥለው ወዳጆን ውጫሌ ውሸትን ወኔው ዋልዋና ወንደሰን ወገባቸውን ወልዶ ወደማሰልጠኛ ውሰድ ወንበራቸው ውህድ ወራቸው ወልደአማኑኤል ወንድማማችነትና ወርውሮ ወገብ ወዳጅነታቸውን ዋረ ወዳጁን ወደሚመለከተው ወራሽነት ወደተጠቀሰው ወደዛላንበሳ ዋሾ ወታደሮቿ ወደእስራኤል ወልጃማ ወይይት ውድነትና ወንዱን ዋጋዎች ወንጀለኛን ወንጂዎች ወዳጆቼን ወርካ ወጪያቸው ውጊያውም ዎፍ ወደሚያገኙበት ወደምርጫ ወድቄ ወጥቶላቸው ውሳኔውንም ወት ውስተ ወደሥራቸው ዊኪሊክስ ዋጥ ወርዳ ውቅሮ ዋናዎቹን ውለን ውልቀሰባት ወጤት ወዳ ውሎውን ወልደተንሣይ ወጣቶቹም ወሰንየለህ ወላሞ ወረት ውሃም ውርጭ ወጳውሎስ ወቀሳው ውኃውን ወኪሎቹን ወደምዕራብ ወልደሰንበት ውክልናና ዋሊያ ውብሸትን ወታደርነት ውጋት ውልቀ ወደተባለ ወንድማማቾችን ወደቀች ዊንስተን ወሰዱት ወገናዊነትን ወያኔዎችና ውዬ ወጥነትን ወደልፍኝዋ ውሳኔዋን ውሸትና ወንጌላዊያን ውልን ውሾቹ ዋልታና ወጣቱና ወደውስጥ ውርደትን ወደጋምቤላ ወልደጊዮርጊስና ወቅታዊው ውዥንብርና ወዳጆችና ወዳለችበት ወዘተረፈ ወጭና ወጭን ዊልሰን ወንጀለኞቹን ወደሰማይ ወልዴና ወቀሳውን ወልደስላሴ ወዳለ ወገኑን ዋጋዬ ወኪልን ዋራንት ውስጥን ወሮ ወንጌላውያን ወስና ዋሻዎች ወረዳዎችንና ወንበሮችን ዉርደት ወድቅ ወደሃገራችን ወንጀላቸው ወቶ ወኪሉን ውጣውረድ ውላለች ውቢት ወይና ወደስራቸው ዊልል ውይይቶቹ ወሰድኳት ወገግ ወለፈንዲ ወንድምአገኘሁ ወደለየለት ወንጀለኛነት ወደሁለቱ ወደደም ዊልክስ ወሎዬ ዋነኛዋ ወንጀሎችና ወደየቤተሰቦቻቸው ውዝግቦችን ወቅታዊነት ዋይታ ወደሚገኙበት ወዲያና ወንጂን ዋልጃማ ወደጃፓን ወደምትገኘው ወታደራዊውን ወዱጅ ወዳንተ ውጡልን ወገብን ወልዲያና ወስደውታል ወጉን ውድነቱን ውስጤ ዋንጫዎችን ወሰኔ ውጤታማነቱ ወስናለች ወላፈን ወያኔዎቹ ዋንዛ ወትሮ ወረዳውን ዋነኛዎቹ ወይዛዝርት ውሏቸው ወሮበሎች ወደዛው ወደናዝሬት ውዱ ውበታችን ውጥኖች ወጣቶችንም ውሕደት ወሰድ ወደድንም ወራትና ወደሌሎችም ወከባው ወታደሮችንና ወለሉ ወልዩ ወደአዳማ ውለታውን ውሁድ ወደሰላማዊ ወደአልጀርስ ውንጀላዎችን ወንፊት ወርቅን ውሸቱን ወደየት ዋር ወደግጭት ዋልን ወደሳዑዲ ወክለን ወደታሰረበት ወኪሎቻቸውን ወረዳበደቡብ ወንጀሌ ዋስይሁን ወደባህር ወሰንኩ ውድነሽን ወጥቶበታል ወዲያኛው ወደብም ወሰዷቸው ወንጅለው ውጭና ወልዱና ወረ ወተር ወሰኖችን ወዳጆቻቸውና ወጭዎችን ዋው ውክልናቸው ወዛደር ዋዩ ወኪሎችም ወሌን ዋሽቷል ወያላችን ወጦችን ወደጦርነቱ ውበቷ ወልቃይት ውጊያን ወራዳ ወራጅ ወደተከታዩ ወጣትም ወልደዮሐንስ ወዳጃችን ወደዚህች ወደየቀያቸው ወዳጅህ ወታደርን ወሬም ወቀሳን ወስደውት ዊንጌት ወደቀጣዩ ውዝግባቸውን ወንድአለ ወሳኞች ውረዶች ውዝዋዜ ዋለታ ወሳጅ ወደህትመት ወረቀትም ወደእኔ ወጪንና ዎርም ውጠት ውላቸውን ዋሊያዎቹን ወጪዎቻቸውን ውኃዎች ወደግራ ውጥንቅጥ ወድቀናል ወንድሞቼና ወደዚች ወደኒውዮርክ ወደማራቶን ውላ ዋዜማና ዎችና ወደመ ወንዞቻችን ውድብና ውይይቶችም ዋንጫን ወዳጇ ውሉም ወድጄ ወሬኛ ወደጦሩ ወግኗል ወፈር ወደዋሽንግተን ወኔውም ውጤቶቹ ወደብንና ወደሙሉ ወዕጨጌ ወጣም ወልዳለች ወደህወሓት ወገኖችንም ወደድን ውና ዋግህምራ ውጤቷን ውልቅ ወካይ ወገኖቻችንም ወገናዊነትና ወንበሩን ዋጋሽ ውርወራው ወረድ ዌብሳይት ወደነሱ ወቀሳዎች ወንድይፍራው ወታደሮችዋን ወመንፈስ ወገኖቸ ወደአገራችን ወደጎረቤት ወያኔዎችን ወሮበላ ዎያኔ ወሕኒ ወረድኩ ወታደሩን ወለደች ውጦ ውረዱ ወደባሬንቱ ዊክ ወደቤንሻንጉል ወዳጃቸውን ወደውጊያ ወንጀልንና ወጤቶች ወደዚያም ወደእንግሊዝ ወደነበረችበት ወልዳ ዊዝ ውዴታ ወደስምምነት ዋስተና ዋላ ወደየ ወደጀርመን ወደዓለም ወደተሳሳተ ወደሮም ወዳልተፈለገ ዎክ ወይንሸት ወዳጆችን ውንጀላና ወለጋን ውጭውን ዉጤቶች ዋነኛውን ዊትሆኡት ዋልኩ ወዳንድ ውድድሮችና ውሾቻቸው ወጪውም ወዳሉ ወኔውን ወደሊቢያ ወኅኒ ወይፈን ወደዝዋይ ወዳጆቼና ወል";
            amharicWords[19, 8] = " ወስደን ወደሃገራቸው ወኃ ወስጄ ወደቀድሞው ውድመትና ውድመትን ወደሚል ወገኖቻቸውን ወያኔዎች ወገንተኛ ወኪሎቹ ወንድይራድ ወረዳዋ ወደየቤታቸው ውትወታ ወዳድነት ዎርልድ ወጪም ዋግ ወደባሰ ወጣቶቹን ወንድሞቼ ወደሆነው ዋንጫና ወደውጪ ወደጦር ውቤ ወንድማችን ወደሃገር ወደቀን ውብና ውርወራ ውጭም ወጋሕታ ወገናቸውን ዋሴ ውይይታቸውን ወጪዎችን ወንጅለዋል ወያላውን ወደሁዋላ ውድቀትና ወጊ ወደከተማ ወደሚለው ወደሆነችው ወደየመጡበት ዋንኛው ወደማዕከላዊ ወረቀቱ ወደልማት ወገኖቼ ወደኛ ወፎች ወንጅሏል ወጥቼ ዋጋና ወልደሥላሴ ወርደዋል ውኃን ወቅታዊውን ወሎና ወደሰሜን ዌር ዋጋድጉ ወዲህና ወጥተናል ውዝግቦች ወደሱ ወስዳለች ዋሸራ ወዬው ወራሹ ወስኛለሁ ወንጀለኛው ወደኢትዮጵያና ወደግቢው ውርስ ዋጋየ ወተትና ወልደማርያምና ወራ ወሰኑን ወድቃ ወደሸዋ ዊንዲ ወታደርና ውንጀላዎች ውጪም ዋሊያዎቹ ዉል ውሃዎች ወደትውልድ ወድመዋል ዉድ ወንዶችን ወንድምና ዋጠው ወደአስመራ ውጊያም ወላጆቹ ወንዙን ውጤቱንም ወስደዋቸዋል ውንጀላውን ወገኑ ውሎችና ወች ውጊያና ወንድሙን ወጣትነት ወልድያ ው ወጦች ወረዳዎቹ ወታደርም ውድና ውፍረት ወልደየስን ወዳጁ ውስንነት ወቀሱ ዋናዉ ወራሾች ወልደተንሳይ ወደተግባር ዉጪ ወባንና ወነጀሉ ወኪሎቻቸው ወርም ዋጋቸውን ዋልታኢንፎርሜሽን ወዳጅነትን ወጋጎዳ ወትሮውንም ውሰዱ ወደከፋ ወሰንን ወሩን ውይይታቸው ወርኃዊ ወሰነች ወርቁን ዋዛ ወዳጆቻቸውን ወደመቀሌ ወደስብሰባው ዋናዋና ወደወህኒ ወዳጃቸው ወደከተማዋ ወደደቡብ ወንዶ ወንበዴዎቹ ወሮች ወደብና ወዳሉበት ወደየመን ወራሪዎችን ወባና ወዳጆቹ ውደ ወልደአረጋይ ወረኢሉ ዉስጥም ወንዶገነት ወደሚገኙ ወርና ወጥረው ወሃ ውይም ዊልያም ወደአንድ ዋናውና ወይኔ ወጋየሁ ወደሥልጣን ውሳኔያቸው ወቅትን ወዘተርፈ ወዳጅም ዋይት ውም ወግነው ወደሙ ወክንድ ወደመጣበት ወደግብ ውልና ወሰዱን ወደአልታወቀ ወሰኖች ወሬዎችን ውድነቱ ወደግንባር ዋሲሁን ወንጌላዊ ወድሞ ወንዞችና ዋእ ዋካ ውስጤን ውለታው ወዳዲስ ወርደን ውይይቱም ወፃኢ ወትሮም ውኃው ውሎቹ ውክልናውን ዋልያዎቹን ውድድሯን ውድቀትን ዋለች ወራሪን ወደጥገኛ ወንድሞቹ ወጣቱም ዊሊያም ውሸታም ወደቤት ወደሰላም ወላጆችን ወሬና ወረርሺኝ ውሣኔዎች ወጥሮ ወንዝና ወደሆኑ ዋሽንግተንና ወስደናል ወደሳቸው ወረፋ ወለዱን ውርደትና ወደው ዋታራ ወርክሾፕ ወሊሶ ወደካርቱም ወልዴን ወዲያም ወደሞቃዲሾ ወይራ ወኪሎችን ውጤታቸውን ወንጌላዊው ወንድማገኝ ውሱንነት ወረራም ወንድሞችና ወስኖበታል ወንድሞቻችንና ዉይይት ወዳጆቻችን ውበቱ ወደፍርድ ወርቅየ ወቀሳና ወደስልጣን ወለደ ወለዱ ዋናዋናዎቹ ወድቃለች ወስዳ ወደአገሩ ዊክስቴድ ውድብ ወረታ ውሳኔዎችና ወገኖቹን ወደሆስፒታል ወደሚገኙት ወደከፍተኛ ወደቦችን ወደሚገኝበት ወእጨጌ ወላጆችም ወክዬ ወደአሥመራ ወንጀልም ወቀት ወለድና ወደችሎቱ ወታደራዊው ወንጀለኞቹ ዌስት ውጥ ውህደትና ወስኖባቸዋል ወጀብ ውርርድ ወደሚባለው ወንድሜነህ ዋል ዋሺንግተን ዎዩ ወጎች ዋህድ ወሊ ወደሚገኝ ወሰደው ወጭዎች ወደክልሉ ዋነኛና ወክላ ወንድሞቻችንን ወገናቸው ወዳሉት ውንብድናው ወኪላችን ውጤቶችም ውንጀላው";
            amharicWords[19, 9] = "ወያኔ ወንዝ ውል ውስጥና ዋነኛ ውድቅ ውሳኔውን ወቅታዊ ዋናው ወዘተ ወሎ ወረቀት ውሳኔው ወይስ ወሬ ወይንም ውጥረት ወታደር ውስጥም ውኃ ወጭ ዉስጥ ወኪል ወጣቶችን ውሣኔ ወርቅ ዋንጫ ወቅትም ወህኒ ወደፊትም ወጥቶ ውጤቶችን ወዲያው ወጣቱ ዋሽንግተን ወዲያ ዋስትናን ወዳጅ ወደኋላ ውጤቱ ውይይቱ ዋቢ ወጣቶችና ውሎ ወስኗል ውድቀት ወጥተው ወስደው ወጣ ወልደ ወሰን ውድድሮች ውክልና ወዲያውኑ ውይይቶች ወታደሮችን ወንድ ወዳጅነት ውድድሩን ውህደት ወረርሽኝ ወከፍ ወንበር ወደኢትዮጵያ ወክለው ዋነኛው ወርቁ ወገኖችን ወልደየስ ውሳኔዎች ውስብስብ ወዳድ ወጣቶቹ ወንዶች ወንድም ወለድ ውጊያው ወራሪ ዋስ ወዳጆች ወላጅ ወልደጊዮርጊስ ወንድሙ ወንጀለኛ ውድ ወልዴ ውድመት ውንጀላ ውድድሩ ወላጆች ወኪሎች ወያላው ወይዘሪት ወንጀሎች ወቀሳ ውጤቱን ወደቦች ውሃና ወዴት ውስጣዊ ወስዶ ውለው ወንዞች ውጣ ወጥተዋል ውሳኔዎችን ወጡ ውዝግቡ ውሎች ውሸት ወደዚህ ወጥቷል ውይይቱን ወደውጭ ውጤታማነት ውንብድና ውድነት ወንጌል ወሰነ ውሃን ውለታ ዋዜማ ውይይትና ዋልዋ ውበት ወቅቱን ወቅቱ ወደአዲስ ዋንኛ ወረዳው ወገኖቻችን ውሏል ውትድርና ወደዚያ ዋስትናቸውን ውስጠ ወረዳዎችና ዋት ወደሌላ ወንበዴዎች ወንጭፍ ውድነሽ ወንጀለኞች ወልዱ ውሻ ዋጋው ወለጋ ወልደማርያም ዎች ወራሪው ውብ ወርዶ ወዲ ውረድ ወግ ውዝግቡን ወታደሮቹ ውለዋል ውዝፍ ውዥንብር ወድቆ ውስጡን ውርደት ወከባ ወጣቱን ዋለ ወደሚገኘው ወርልድ ወዳጄ ውብሸት ወሩ ወስዷል ዋሉ ወባ ወላጆቻቸውን ወተት ዋናዎቹ ወደአገራቸው ወርቅነህ ወንጀሉን ወኔ ወረራውን ወስደዋል ወይን ወረደ ወርክ ወደብን ዋጋን ውስን ወሳኝነት ወታደሮቿን ወያኔን ውሰጥ ወደዚያው ወደኤርትራ ውጊያዎች ወገኖችም ወንጂ ዋስትናና ወንጀሎችን ወርደው ወሰዱ ዎቹ ወንጀሉ ወድቀው ወይንስ ወረቀቶች ወደተለያዩ ውይይቶችን ወራቶች ውቅያኖስ ውጤትም ወድቋል ወለል ዋች ወራሪውን ውጊያውን ወሳኙ ወክሎ ወደአሜሪካ ዋቅጅራ ወቅታዊና ወንጀልን ዉጭ ወደጊዜ ወስነዋል ውሳኔን ወደታች ወደነበረበት ወረዳዎችን ወርቅነሽ ውጥረቱ ውሀ ወዳጆቻቸው ወራትን ውሎችን ውቅር ወቅሰዋል ውንብድናን ወደር ወልደሰማያት ውሣኔውን ወንድወሰን ውሱን ወንዶችና ወጣቶችም ወስኖ ወጥነት ወረርሽን ወታደሮቹን ወንዱ ውግዘት ወዲያውም ወያኔና ወረዳና ውሾች ዋናውን ወርሃዊ ወጪና ወርቄ ወሌ ወቅቶች ውስት ወደቡ ወደኔ ውሉን ወታደሮችና ወደግል ውሎው ውሉ ወደተሻለ ወንድማቸው ወንዞችን ወዳጆ ወረራና ወፍጮ ወደኬንያ ዋነኞቹ ወጪን ወንድሜ ወባን ወቅዱስ ዉጤት ወረራው ወንዝን ወጥመድ ወደላይ ወጪውን ውሳኔና ወጥታ ውሳኔም ወደላቀ ወጪዎች ወደአካባቢው ዋልያዎቹ ወረራን ውጤትና ወንጌላዊት ወንበሮች ወንድና ወታደራዊና ወረርሽኙ ወደሱዳን ወደጦርነት ወዶ ወልዲያ ወስነው ዋጋውን ወታደሩ ውጥረቱን ውስኪ ወልዳይ ወደቀ ወደቡን ውህደቱ ወገናዊነት ወገኖችና ዌብ ውጤቶችና ወደነበሩበት ወላጆችና ወላይታ ውዝግብና ውይይትም ወረዳን ወንድማማቾች ወጥታለች ውህደቱን ወገናዊ ውኃና ውጫዊ ወቅትና ወደአገር ወስጥ ወጪው ወድሟል ወጋገን ወልድ ወደቤታቸው ወደሌሎች ወዳለው ውጤትን ወሰደ ውጤታማና ውጡ ወዲህም ወንጀለኞችን ወንጌልን ወንበዴ ውጤቱም ወባማ ወፍ ውን ወረርሽኝን ወኪሉ ወልደሚካኤል ዋሻ ወገኖቻችንን ወገናችን ወራሪዎች ዋጋቸው ዋ ወራትም ወንድሞቻችን ወከባና ወሬው ወጣትና ውጥን ውድድሮችን ወልደማሪያም ወረዳዎችም ወልደመስቀል ውዳሴ ወደነበረው ውድነህ ወርቃማ ወሰኑ ወጣቷ ዋንጫውን ወርሮ ውድድራቸውን ወርቅና ወደመጡበት ወፍራም ወታደሮችም ወስነናል ውበትና ወራሽ ወቅሷል 