            amharicWords[20, 0] = "ወያላ ወሬዎች ወያኔም ወዳዶች ወረደወልድ ወ ወንድሟ ወረቀቶችን ወደቁ ውዝግብን ውርጅብኝ ወጥና ዋሚ ዋቄ ወደዚሁ ወደሶማሊያ ወደቦታው ወረቀትና ዉሃ ወጥተን ወጣቶችንና ወንበዴዎችን ወልደሩፋኤል ውድድርን ወገኖቻቸው ወደሆነ ውስብስብነት ዋስትናውን ውስጣዊና ወገንተኝነት ወታደሮቻቸውን ወንዳፍራሽ ወንድሞቻቸው ወዳድና ወርዷል ዋናና ወንዳለህ ወጣሁ ውድድርና ወደተባለው ወግና ውጤታቸው ወኔና ወደጎን ወደሥፍራው ወደስፍራው ወለምታ ወሣኝ ወገኔ ወሬውን ዋልድባ ወደጅቡቲ ወግደረስ ወደሥራ ወደትግራይ ወደቤቱ ወገንም ወጪያቸውን ውሳኔያቸውን ወሲብ ወደቀድሞ ወግተው ውጥረትን ውድድርም ወገኖቹ ውዴ ወንጀለኝነት ወረርሽኙን ወራሪነት ዋቆ ውስብስብና ዋርዴር ዋለልኝ ወዳልታወቀ ዋይ ወደእስር ወደትምህርት ወንድማማችነት ወሲባዊ ውቅት ወሰንሰገድ ወድያ ወንጀልና ወቀሰ ውይይትን ውሳኔውም ወልደገብርኤል ወዳለበት ወዳጅና ወጣን ወንጨቆ ወይዘሮዋ ዋቤ ወኪሎችና ውድነትን ዋን ወደዩኒቨርስቲው";
            amharicWords[20, 1] = "ወ ውስጥ ወደ ወቅት ዋና ዋልታ ዋኢማ ውሳኔ ውጤት ወር ወይም ውይይት ወገኖች ውጭ ወራት ወጣቶች ወታደራዊ ወጪ ዋጋ ወዲህ ወረዳ ወንጀል ውድድር ወታደሮች ወረዳዎች ውጪ ውሃ ወገን ወጣት ወይዘሮ ውጤታማ ዋስትና ዋርካ ወደብ ውጊያ ወጥ ወሳኝ ወደፊት ውዝግብ ወረራ ወይ ውጤቶች";
            amharicWords[20, 2] = "ዐውቀን ዐይናችንን ዓመፅና ዕድሜህን ዐሊማችንን ዓለማችንን ዓረቢያንና ዓመታችሁ ዕድላችሁን ዓውርደው ዑንቋይ ዐምባ ዓለምንም ዑለማዎ ዓመትዋ ዐይቶት ዓብዪዓዲ ዕድሎችም ዕዳውንም";
            amharicWords[20, 3] = "ዕሴቶቻቸውን ዐቃብያነ ዓይንን ዕህልን ዓላማዉ ዕድሜውም ዐመድ ዕገዛዎችን ዓይነቷ ዐደባባይ ዓሳዎቹ ዕልልታ ዕርምጃዎችም ዓብ ዓምት ዒላማቸው ዐሊም ዐርፈው ዕድገታችንን ዓለምህ ዒሣ ዓብደላህ ዓሳም ዕድሎችንና ዓበይትና ዓየሩ ዕድሜያችሁ ዐርጋለች ዓለሙም ዓይነቱንም ዓለምንና ዐወቀች ዐሥርት ዐውጀው ዓወደ ዓቅማችን ዓላማዬና ዓመትየኖረና ዕድለቢስነቴም ዑስታዦቻችን ዓላማየ ዐማኑኤል ዓሥርት ዐይተናል ዓመፀኞች ዓላማቸዉ ዓይተናል ዐመዳችን ዓምድና ዓይነታቸውን ዕጩዎቿንም ዓብዱራሕማን ዓመጽ ዕድገታቸውም ዐለም ዐላዋቂነት ዐላማ ዐይኑ ዐመፅ ዐይኖቹን ዓምታት ዕድሳትን ዓረባዊት ዓመተት ዓለማየሁም ዓይነምድር ዕፀዋትን ዓረብያ ዓባይንና ዓመቱንም ዓለማቸው ዓረቢያውያን ዓለመች ዕድለኛም ዕድሜውንና ዓዌስ ዓላማቸውና ዕድሎቹን ዐረገች ዑስማናውያን ዓላውያን ዓይንት ዐማሮችን ዑደቱን ዕድርና ዓምዱ ዐምድ ዓርነት ዐውቆት ዓመቶችን ዐጪር ዕድለቢሶች ዐመፅን ዓሥራትም ዓይንም ዐሠርቱ";
            amharicWords[20, 4] = "ዕንባቸውን ዐባይን ዕጸ ዓላማቸውንና ዓይተን ዓላማችንና ዕከላዊ ዕድሜህ ዓለማዊው ዐይኖች ዕጹብ ዕትሞቹ ዕዳዎችን ዕቃዎችንም ዓመፀኛ ዕምብርት ዕርቁ ዓይናችሁ ዓለማም ዓይኖቼ ዓቅሜ ዕብሪተኛ ዑደት ዕድሎችና ዕቁብ ዐውቃለሁ ዐይናቸውን ዕውነትና ዕልቂትን ዕዳችንን ዐመት ዓምደኛችን ዓለማዎች ዕክት ዐይኔን ዕንባቆም ዓለሙን ዐቅድ ዕጣቸው ዐማራውን ዕጭዎች ዕቅዷን ዐረር ዓይናችንን ዕጩነት ዕጩዎቻችን ዕድለ ዐማራዎችን ዓዋዲው ዕድሌ ዓመታትስ ዓይኖን ዓርማችን ዓይናችሁን ዓረቢያው ዐል ዕፅና ዓወተ ዕቃዎቻችንን ዓወትናን ዕሁፍ ዐምዶች ዕቃም ዕውቀቱና ዕይታዎች ዓረብና ዕውቀቴ ዕድር ዕሪና ዕራሳቸውን ዕኑ ዓመታቱን ዑጋንዳና ዓምደ ዓመታችንን ዓረብኛ ዕርዱታ ዕቃችን ዕቁባይም ዓምዳችን ዕቃችንን ዕድገትንና ዓመታቶች ዕንቁጣጣሽ ዕውቀታቸውና ዐርባና ዐምባገነናዊ ዓመፅን ዐይነቱ ዕድሜዬን ዓላት ዓላማውስ ዐይንና ዕስር ዓመታዊውን ዐረፉ ዐደይ ዐይነት ዕዉቅና ዕሴት ዓወትን ዕደ ዐቃቢ ዕዝና ዓመር ዓቱን";
            amharicWords[20, 5] = "ዓለሞች ዕፅዋቶችን ዐለት ዕዳም ዕድገቶችን ዐ ዕዳቸውን ዕግድ ዓወትና ዓርማው ዕቀባ ዓይነቱና ዐይነቱን ዓቃቤያነ ዑመድ ዑራኤል ዓስርተ ዕጾች ዓፋር ዕፆችን ዓመትት ዐባይና ዕውቅናው ዕጩዎቻችንን ዕፀ ዓምባዎች ዕቅዳቸው ዓምስት ዕንቁላል ዕንቅልፍ ዕቁበሚካኤል ዐዋዲ ዓሊሚራህ ዓመቱና ዓዋዲ ዓረናን ዕድላቸውን ዓዲጉዶም ዕውነተኛው ዕጣም ዓውዳዊ ዓሊተና ዓብዱ ዕገዳውን ዓይኖቻቸው ዕብሪተኛው ዒላማዎችን ዐሥር ዕውቅናውን ዐረየ ዓቅድ ዒላማን ዓረቢያን ዓባል ዐሳብ ዓይንህ ዓቅምና ዕውነታው ዐሣ ዕርዳታዎችን ዕምሩ ዕጾችን ዓረቡ ዕርዳታን ዕርቁን ዕርምጃና ዕምነትና ዕርቃነ ዐዐዐ ዕድሚያቸው ዕቅዴን ዓይነትስ ዕቃዎቻቸውን ዓለት ዓለምሸት ዕፅዋትን ዓረቦቹ ዐረፈ ዓረፉ ዕፁብ ዐውድ ዓይኖቿን ዓይነቶችም ዕጥረቱ ዓርብና ዕቁባይና ዒላማው ዕሁፎች ዓመታቱ ዕድሌን ዐፈር ዓይጋ ዓይኗን ዓሳዎች ዓይነታቸው ዕሑፍ ዓይናፋር ዕዳቸው ዓት ዓይናችን ዕጽዋቶች ዓላማዎቹ ዓላማችሁ ዓመታቸዉ ዐማሮች ዓብዱላህ ዓይኖችን";
            amharicWords[20, 6] = "ዐፅም ዕዳዋን ዕጅ ዓላማዋ ዕውነታውን ዓባይም ዕውቀትም ዓቀፍና ዕጢ ዓመቱም ዕገዳው ዕጩዎችም ዐይነተኛ ዓለምፀሃይ ዓለምፀሐይ ዓለምእሸት ዓቅሚ ዕቁበ ዕልቂትና ዓሣዎች ዓይኖቿ ዓላማዬን ዕሴቶችን ዐልጋ ዓርማና ዓርባ ዕድገታቸው ዕትማችን ዕዳና ዐዋቂና ዕርዳታዎች ዕመርታ ዓለማሽ ዓለቃ ዓለምጸሃይ ዕጽዋትን ዕርምጃዎች ዐልፎ ዓፄ ዕንግዶች ዑጋንዳን ዕውቀቶችን ዐይኑን ዕውቀቶች ዕፅዋትና ዕዙ ዕብድና ዓላማዋን ዕርምጃውን ዓለምነህ ዓለማየሁና ዕብደት ዐይንን ዓቃቢያነ ዐሳብን ዕለታዊው ዓዘቦ ዕቅዱም ዐውቆ ዕውቅናን ዔሊም ዓረባዊ ዕድሜዋ ዕድገቱም ዓረቢያም ዐይጥ ዓላማቸውም ዓይኖቼን ዕዳችን ዕጦትና ዓጋሜዎች ዓሣን ዐቅም ዓይቶ ዓይነተኛው ዓላማዬ ዕቃዎቻቸው ዕውነትን ዓዜብ ዕቃዎችም ዒላማውን ዓለሜ ዐርባ ዓላም ዓዋዲዉ ዓይኖቹን ዓይኗ ዕውነቱ ዐፄ ዕድሏ ዕላማና ዕፀዋት ዔሊ ዓለምአቀፉን ዕውቀቱ ዓላማውና ዕለትና ዓሊና ዓመቶች ዓደዋ ዐማራን ዓምደኛ ዕጥረትና ዕድሜያችን ዕዳዋ ዓመል ዕይታና";
            amharicWords[20, 7] = "ዓመታትና ዐጼ ዓይኔ ዕድሜዬ ዕድሜያቸውን ዓሊን ዓውደጥናት ዕጦት ዕድገታችን ዕቅድም ዕጣው ዕርቀ ዐዋዲው ዐድዋ ዓቅሙን ዒላማቸውን ዕቃነት ዓፈና ዕቃቸው ዕሑድ ዕሴቶች ዕርባታ ዓቅማቸው ዕርቅና ዓረቦች ዕውቅናና ዕምነታቸውን ዕውቀታቸው ዓለምም ዕቃቸውን ዕጩዎችና ዓድዋ ዐረፍተ ዓላማዎችና ዐባይ ዓይነቱም ዕውነተኛ ዕጣን ዓቀፉን ዕቃዎቹን ዕድገቷን ዕንቋይ ዕውቁ ዓመታቸውን ዓባይና ዕድለኞች ዓቅሙ ዓይኖች ዓመታ ዓመቴ ዕፅዋቶች ዕብድ ዕዝራ ዓረቢያና ዕርዳታም ዓይንህን ዕርምጃም ዓቀፋዊ ዕድሜን ዕውቀታቸውንና ዕድሮችና ዕቅዶችና ዕድገቷ ዕደላ ዕብሪት ዕኩልነትና ዕንቁ ዓቃቢ ዓውድ ዕርገት ዓረቦችን ዐይናችን ዓቱ ዐሥራት ዕፁ ዓፈናን ዓይኖቻቸውን ዕፁን ዕንጨት ዕቃን ዕድሉም ዕድላችን ዕቅዳቸውን ዓለሙና ዕጣንና ዕዳዎች ዕድገታቸውን ዐሥራ ዓይነቶችና ዕኩል ዕሳቤ ዕዳን ዓላማውንና ዕብ ዓረፍተ ዕኩይ ዕዮት ዕውቀቱን ዕቃዎችንና ዕቅዳችን ዓይነቶቹን ዓሳን ዓርዓያ ዓመታዊው ዓይናለም";
            amharicWords[20, 8] = "ዕዳውን ዕርዳታው ዕቃዎቹ ዓለማቀፋዊ ዕድገቱን ዑስማን ዕኩልነት ዓይነቶችን ዓመቷን ዕውቀታቸውን ዕንባ ዓዲ ዕድልና ዐሊ ዑምራ ዓለማቀፉ ዕቃው ዕቅዶችን ዕሮብ ዕዳው ዕርምጃዎችን ዓለማ ዓወት ዕርዳታውን ዕጥረትን ዕምቅ ዕለተ ዓሥራትን ዐቀፍ ዓይነ ዕፅዋት ዓረና ዓለምአቀፋዊ ዓላማችንን ዕድላቸው ዕርምጃው ዓለምአቀፉ ዕንቅፋት ዕውነት ዓብደላ ዕውቀትን ዓይነቶቹ ዓባይነህ ዐዋጅ ዓይነትም ዕላማ ዕውነታ ዓይኖቹ ዐዋቂ ዕድሜአቸው ዕድሳት ዒላማዎች ዓይናቸውን ዓባይን ዕድሜውን ዐብይ ዓይኑ ዓመትን ዕጽዋት ዕድሜና ዕፆች ዓዲግራት ዕድገትም ዕድሮች ዐርብ ዕድገቶች ዐዋቂዎች ዕርቅን ዕውር ዓይንና ዓለማችን ዐዐ ዓለማት ዐማራው ዕቃውን ዕቃዎችና ዐረቢያ ዐፅመ ዐመታት ዕርስ ዓቢዩ ዕደገት ዕቅድን ዕድልም ዕጩዎቻቸውን ዓመፅ ዓይኔን ዕጥፍ ዓላማዎችን ዓባላት ዕድለኛ ዕርከን ዕድ ዓለማዊ ዕዳጋ ዕርካታ ዐይን ዓለምና ዓቅምን ዕጩዎቹ ዕረቡ ዐረብ ዕጩዎቹን ዓቅማቸውን ዐበይት ዓየር ዓምና ዕቃና";
            amharicWords[20, 9] = "ዐ ዓመት ዓለም ዓመታት ዓይነት ዕለት ዓላማ ዕድገት ዕድል ዕቅድ ዓመቱ ዕርዳታ ዓቀፍ ዓርብ ዕድሜ ዕዳ ዕቃዎች ዓቃቤ ዓመታዊ ዓሊ ዐቃቤ ዕቃ ዓይነቱ ዓመትም ዕውቀት ዕውቅና ዓይን ዕጣ ዓለሙ ዕጩ ዓመቱን ዑመር ዕጩዎች ዓይነቶች ዕድሜያቸው ዓሥራት ዕጥረት ዓለማየሁ ዓላማው ዓቅም ዓቀፉ ዓላማዎች ዓላማና ዕርቅ ዕቃዎችን ዓውደ ዕምነት ዕድገትና ዕድገትን ዓለምን ዓረቢያ ዐማራ ዕውን ዕፅ ዕረፍት ዓላማም ዒላማ ዓላማችን ዓይነቱን ዓላማውን ዕገዛ ዕዝ ዕይታ ዕድሉ ዓመተ ዓመታትን ዕለታዊ ዕለትም ዓይነተኛ ዓባይ ዓመታቸው ዓለምአቀፍ ዕቅዱን ዓላማን ዕቅዶች ዕድገቱ ዕሁድ ዕውቀትና ዓላማቸው ዕድሉን ዓ ዐቢይ ዓሳ ዕጩዎችን ዓመታትም ዓመቷ ዓላማቸውን ዓለምሰገድ ዕህል ዕቁባይ ዕለቱ ዕቅዱ ዕልቂት ዓም ዓለማቀፍ ዕውቅ ዓቢይ ዓሣ ዕድሜው ዕቅድና ዓምድ ዕገዳ ዕለቱን ዕልባት ዓመትና ዓይነትና ዕትሙ ዓረብ ዓብይ ዕትም ዓርማ ዕጽ ዕድሎችን ዕድልን ዓይኑን ዑጋንዳ ዓላማውም ዓይናቸው ዕርምጃ ዕርዳታና ዕድሎች ዓበይት ዐውደ";
            
            amharicWords[21, 0] = "ዘንቢሎች ዘርተውበታል ዘናውን ዝተለጠጠ ዝምም ዝቅም ዘሬም ዘባራቂ ዜማዎቻቸው ዘልዓለማዊ ዘንግተውታል ዝርዝርን ዘርግቻለሁ ዙሪ ዘርፎችንም ዝረፍ ዘልቀናል ዘኢትዮጵያን ዞረዋል ዛርፌር ዝርግፍ ዘዋልድባ ዘመናዊቷ ዘጎጃም ዘርዓይና ዘለፋቸውን ዘግተን ዘያቸው ዘለቅሁ ዝማሬያችን ዝርፊያው ዘዋሪነት ዘፈንና";
            amharicWords[21, 1] = "ዘለቄታዊው ዝርዝሮቹን ዙፋኑን ዘሎታል ዘልፎ ዘርዐ ዘላበዱ ዜጋሽ ዘፈንም ዘፈኖችህ ዘለቅ ዘመድኩንን ዚሄ ዙማን ዘላቂው ዛምቢያዎች ዛማሊክ ዘግይታችኋል ዘርፋቸውን ዘምስለ ዘንድሮና ዘመኔን ዘመዶቹም ዘገባቸዉ ዘርዬ ዘለቀም ዝርዝሩም ዝንጅብልም ዝምቡን ዘምራለች ዘርትሁንና ዘንቢል ዘለፋዎች ዝበት ዘርግቶት ዘገየው ዘፈኖቿ ዝፈንልኝ ዛማኔል ዘቡልን ዘበርጋ ዘላለማዊቷን ዘልቃለች ዘፍነው ዝቅዝቅ ዘለልነው ዘረመሎቹ ዘረኛውና ዘመቻዎቻቸውን ዘንግተዋል ዘረመሉ ዘርግተናል ዚና ዘፋኞችን ዘቡል ዛፍም ዘፈኖችም ዙሪያዎትን ዘርዓፅዮን ዚንክና ዘመተባቸው ዘሮችም ዝምድናን ዘጊዎች ዘመናችንም ዘኁ ዘፈኔ ዘለፋው ዘፈኗ ዘላቂነትና ዜማዎችም ዘራፊነት ዘነገደ ዘመናዊነትና ዝንጉ ዛማዜክ ዘገቦ ዘኖች ዛሬዋ ዝቅጠትንና ዘመኑና ዛቻን ዘርመጪት ዘርህን ዘዬን ዝግጅቶችንም ዘገባዎቻቸው ዘበኞቹ ዘፈናቸውን ዘፈናቸው ዘርዝራ ዝምታም ዘይሰየም ዝግጅትስ ዘናጭ ዘየዐቢ ዘቫዲያ ዘውዱን ዘጉባዔ ዘመዶቹን ዚጋ ዝርዝራቸውም ዜጎቻቸዉን ዘለበት ዘንድስ ዝቅተኛም ዘለአለማዊ ዘፀዓት ዜግነታችንን ዘንግተህ ዛቻዎችና ዘርአብሩክም ዘርተው ዘመዶቼና ዛሪ ዛቻዎችን ዘመቻዉን ዘውዳዊውን ዘለቄታው ዙሪያከሚመለከታቸው";
            amharicWords[21, 2] = "ዘመናትም ዝንፈቶች ዘይቤውን ዘናጩ ዘንቦብሽ ዞሯል ዝመፃና ዝክር ዘፍኖ ዘውዱና ዘጋስጫ ዝናውም ዝግጁነቱም ዛሬዉኑ ዝግጅቶቹና ዘሊባኖስ ዙምባብዌ ዝንደዳ ዚምባቡዌን ዘወትርም ዝተፈላለዩ ዝንጣፊ ዘምቻ ዝናው ዘርሽ ዘመናቸዉ ዜናነህ ዘዳግም ዘርፋቸው ዝምብሎ ዘመድም ዘግታ ዘሮቹ ዘርአይ ዘገምተኝነት ዝተፈላለያ ዝሃለወ ዝግጅቴን ዜጎችሽን ዘጉ ዘውትር ዘጊ ዘልፈውኛል ዛላንበሳም ዙሩን ዘሙይ ዘቅጧል ዘይቱና ዝማይ ዘለቅን ዙርያና ዝደልዩ ዘጭ ዝተው ዙረት ዞረህ ዝናቸውን ዘግይተዋል ዘንባብና ዘግተውታል ዘገድድ ዛማሌኮች ዛተ ዛቱ ዘለቀች ዛፍን ዘርግተህ ዙርያውን ዝርጋታውን ዝማሬው ዘካርያ ዘመዶቿ ዜጋችን ዘይዕግበት ዝመቱ ዝመታ ዘገባዎችም ዘፈንን ዝምታቸውና ዘመኗን ዘመነኞቹ ዚአብሔር ዝሆንና ዘፈኖቿን ዙሮችን ዘልዝለው ዘየቤው ዘፈኑም ዘላቂነቱ ዘበኞችን ዘላለማዊት ዘመዷ ዝተታም ዘለሉ ዘሐዋርያት ዘዴዎችም ዘበንጉስ ዘግታለች ዘረኛነትን ዘርነቱ ዘማርያም ዝናምና ዘፋኞችም ዘዴኛነትን ዘሩባቤል ዝናምን ዘራፊነታቸውን ዝንጣፊን ዘፍኛለሁ ዜጋማ ዘገባዎቹንም ዝነኛዋን ዘረገፉለት ዞአችሁ ዘግነው ዘልዑል ዘበኛን ዙረው ዘማሪው ዘፋኝና ዘመቻዎችንም ዘንጋዳ ዞሮዞሮ ዘገየብን";
            amharicWords[21, 3] = "ዘጠኝና ዘመዶችህ ዝንፈት ዝተረኸበ ዞማ ዝንባሌው ዞሞ ዘረፋም ዛርዳሪ ዝቅጠቱ ዘውዳዊ ዘግብር ዝርዝራቸውና ዞሬ ዛማሌክን ዝማሜ ዘዮሐንስ ዘጠኙም ዝናሙ ዝግጅታቸው ዘርፏል ዘምቷል ዝምባብዌ ዘንድሮስ ዝምድናው ዘጋቢም ዘገባዎቻችን ዘረኞችና ዝርፊያዎችና ዝቃጩን ዘንግቶት ዘርፉንም ዛላንበሣን ዝናር ዚምባብዌና ዘምረዋል ዝርክርክነትና ዘይቤያቸውን ዘመናችን ዘረጉ ዝናቸው ዘመዳሞች ዘንግታችሁት ዘልቀዋል ዝምታቸው ዝፍፀም ዘለቄታዊነት ዝግጁነትን ዘመነኝነት ዘዴይሊ ዞንከ ዘሚን ዝሆኖችና ዘገባውንም ዘመሩ ዝርጋታዎችን ዝርያቸውን ዝሆኖቹ ዘረፎች ዝምታና ዘረኛዉን ዘመቶች ዘረ ዘሬ ዘገበው ዘገር ዛናና ዘግይተን ዘፈኖቹም ዘፈንሽ ዜናነት ዜጎችዋን ዘዴዎችና ዝርጋት ዙሪያችንን ዜማና ዜጋቸው ዘጉት ዜማን ዘመድን ዘማርያን ዘበኛው ዘሮችንና ዘግናኙ ዘቦ ዘሰን ዘቢትልስ ዝግጅቶቹ ዙረህ ዝምድናና ዝበልፆ ዘተ ዝንድ ዛዬር ዞርኩ ዝግጁና ዘጋሁት ዘግይታ ዘረኛነት ዝግጅቶችና ዝማሬና ዞናች ዚዳን ዝማሬን ዝዕዘብን ዘመተ ዘማቾቹ ዘን ዙቤይዳ ዘጸአት ዘርግተን ዘቢባ ዘቢብ ዜጋውን ዘርፋ ዘርግታለች ዘርፌ ዝመፁ ዘጎች ዘኪ ዘለፋውን ዘየዱ ዛፎቹ ዝንባሌዎች ዜማዋ ዜግነታዊ ዘርም ዛምቢያን";
            amharicWords[21, 4] = "ዘይቤዎች ዝውውርም ዘመዶቻቸውም ዝርአ ዘይኑ ዜናዎቻችን ዘይን ዘረፈ ዝንብን ዘረኛውን ዘድንግልን ዘርቷል ዝርዘር ዜዎጄ ዘገባቸውን ዝግጀቶች ዞግ ዝነበርና ዘውድነሽ ዘፋኞቹ ዘውገኛ ዝንጅብል ዘርፎችንና ዘግይቼ ዛምቢያና ዘርፉና ዜማቸው ዜማው ዝርእን ዞምቢዎቹ ዝግጁነቱ ዘማሪያን ዘንቦ ዝቋላ ዘርዓያዕቆብ ዙርም ዝነኛና ዝናዋ ዛሚ ዝንጀሮና ዚንሁዋ ዝተወፈየት ዝርፊያውን ዜናዎችም ዝምታችን ዘመዶችና ዘግቼ ዘጋቢዎችን ዝምድናውን ዘጌ ዘመናቸውና ዘመቻዋን ዘፈኖቹን ዝምታውን ዘይቱን ዙሩ ዘዴም ዘዓብ ዝገብር ዜግነታችን ዙሮ ዘይቤዎችን ዘረኛው ዜግነትዎን ዝርፊያም ዛላንበሣ ዙሪያዎች ዛፍና ዘለላዎች ዘግበናል ዘተዋሕዶ ዘይቤያቸው ዘፍ ዝዋንዶር ዘርግታ ዘፈኖችን ዝግጅታችንን ዜማዎችና ዝምበል ዘለሎች ዛሬውን ዜናውም ዛኤ ዘግኛኝ ዘመደ ዘግባው ዘማርያንን ዘንዶውን ዞናቸው ዛክ ዜናችን ዘጋቢዎችም ዘፋኝነት ዝቅጠትና ዘገዩ ዘጋቢውን ዝዉዉር ዘገዬ ዘመነኞች ዜጎችንና ዘንግቷል ዘመቻችንን ዘለቀና ዘግቧለ ዘለህ ዝርፍያ ዛዝላ ዘለለ ዜግነቴን ዘመነመንግሥት ዝንባሌም ዘባተሎ ዘርአ ዘርኡ ዘግይታም ዜማም ዘማቹ ዘግናኝነት ዛዲያ ዝጉ ዘነጋሁት ዘራሽ ዘመትኩ ዙሪያዋን ዝንቱ ዝኣተወ ዞምቢ";
            amharicWords[21, 5] = "ዜናዎችና ዝርፊያዎች ዘራቸውን ዛፎችና ዘንጉ ዘርዑ ዜጎቻችን ዘመናይ ዘርፎቹ ዝናሽ ዘፕሬስ ዘኢየሩሳሌም ዘግቶታል ዘመም ዘግበው ዝናብን ዘይትም ዘረፋውን ዘናዊ ዛቻዎች ዝናውን ዘንባባ ዝምታችንን ዘምዘም ዞኖችም ዘይቶች ዘለና ዘራችን ዚክ ዘይቤና ዘይቤን ዘዴውም ዘወርወር ዝናብም ዝግጅ ዞኑም ዝመፀ ዜጎችንም ዘረኝነትና ዘረኝነቱ ዘመኗ ዛል ዝኽእል ዝምታው ዝግጅቶቹን ዛረ ዘላቂነቱን ዜማውን ዘምባባዎች ዘበሰማያት ዛብ ዘርዝረን ዝርጋታም ዘልዬ ዘገባዎቹን ዜዱንግ ዜጎቼ ዘይቤው ዘፈኖችና ዝዋይና ዘርፉም ዘማቾችም ዘውዲቱና ዘብሔረ ዙሪያቸውን ዘመዱ ዛኪ ዘአብአስገዶም ዞኖቹ ዘርአፅዮን ዘሮቹን ዛሬማ ዘረኞቹ ዝበሃል ዘአካላትን ዘለላሽወይን ዘታይምስ ዘገየን ዘለላ ዘጋባ ዘግቶት ዘፈንህ ዝቅታ ዜናዎቹ ዝንጀሮዎች ዘመነኛ ዘክረው ዘለም ዙሪያን ዝቅተኛና ዜጎችሽ ዛላንበሳንና ዘግቦት ዙቤር ዘፍኗል ዙርያው ዘንዶው ዘምህረት ዛቻም ዘርዕ ዘረኞችን ዘፈኖችንም ዚህ ዘመዱን ዘላይ ዘአብና ዝንባሌያቸው ዘመናዊውን ዘንድና ዝብርቅርቁን ዙራምባ ዘዴውን ዘመናችንን ዞረና ዘገባቸው ዘዴዎቻቸው ዘመቻቸው ዘውዳቸውን ዘሞ ዘራፊው ዘማቾችን ዙኙዋ ዘጋው ዙ ዘኢኮኖሚስት ዘረመላቸው ዘርጋ";
            amharicWords[21, 6] = "ዘረኞች ዘገባዋ ዜጋም ዘግይቶም ዘርግቷል ዘረፋው ዞኖችን ዘረጋ ዝርጋታን ዞረን ዙሪያዋ ዘርኣይ ዘረፉ ዘረመል ዘመናዊነትን ዜጋው ዘገባዎችና ዘገባን ዘዬ ዘግየት ዛር ዝግጀት ዝርዝርና ዘመንን ዘመላክ ዘውድነህ ዝበሉ ዝቃጭ ዘፋኙ ዝነኛዋ ዘለፉ ዘመናቸውም ዙፋኑ ዘልፈዋል ዝነበሩ ዞረ ዛየር ዘርዓ ዝሪያዎችን ዛልአምበሳ ዘሚካኤል ዘጋቢዎቻችን ዘይቱ ዘልቃ ዝባዝንኬ ዘራ ዝርዝርም ዘሪቱ ዙሪያው ዘመቻውም ዚያድባሬ ዘምባባ ዝርያዎችና ዙምባቡዌ ዝክረ ዘርዝሬ ዝግጅታችን ዝምተኛ ዜጎቿን ዘግቦአል ዘረኛዉ ዘረፋን ዘጸ ዘጠኙን ዘንደሮ ዝቅተኛነት ዘኔሽን ዘግተዋል ዘላን ዝመስል ዘግበውታል ዘራቸው ዘራፊዎቹን ዘረፋዎች ዝርያው ዘአክሱም ዘቢደር ዝብርቅርቅ ዘጋብያችን ዝርክርክ ዝባድ ዘፍጥረት ዘክሮ ዘፈኖቹ ዘግናኝና ዘመዶችዋ ዘረፍ ዘንግቶ ዘመዳቸው ዘጠን ዝርዝሮች ዘንዶውም ዙፋናዊ ዘእምነገደ ዘመዶቹና ዘመቱበት ዝር ዘግባ ዝተፈላለየ ዘፈኑን ዘየ ዝርያዎቹን ዝርያና ዘመቻዎችን ዛቻው ዝንፍ ዘምተውበት ዘገባዋን ዝይን ዝንቦች ዞንም ዘልቀን ዛንዚባርን ዘውዲቱን ዘመናውያን ዘግቷል ዜጎቻችንን ዝርዝሮችን ዘለቀን ዘመዳቸውን ዘገባዉ ዘይትን ዘለለው ዝግታ ዝግጅነት";
            amharicWords[21, 7] = "ዘቦች ዝንብ ዛሬስ ዘለፋና ዘዴና ዛማሌክ ዛሬና ዞረው ዝናና ዘርፎችም ዘመኔ ዛላ ዝውውርና ዝግጅትን ዛላምበሳ ዘንድሮው ዘነበች ዘገባም ዘልሎ ዝቅተኛውን ዘካሪያ ዘንበል ዘልቋል ዘርጋው ዝሪያዎች ዜጎቹን ዝውውሩ ዘና ዘካርያስ ዘረሰናይ ዘመዶቹ ዘመኑም ዛቲ ዜማዎችን ዚምባብዌ ዝነኛው ዞባ ዘሙ ዘዴው ዘውገ ዘመንበረ ዜግነቱ ዘርዝረው ዘፈኑ ዝናን ዘጋ ዜናዊት ዝርያቸው ዘራፊ ዘግይቷል ዛይድ ዝንተ ዝተዋል ዘመዶቻችን ዘጋንግ ዝርዝራቸውን ዞንን ዝርጋታዎች ዝግጁዎች ዘመቻቸውን ዘምቶ ዘገባና ዜጎቻቸው ዘሔግ ዘመቻችን ዛቦ ዝርጋታው ዝበለ ዜድቲኢ ዝናቡን ዘንግተው ዛላምበሳን ዘጋች ዘንዳ ዝሪያ ዘቅዝቀው ዝማሬ ዘለዓለማዊ ዘጋቢአችን ዝንባሌና ዘረኛና ዛፉን ዛሬው ዝላይ ዘለዎ ዘግቦታል ዘረኝነትን ዘብጥያ ዘው ዘላኖች ዛላአንበሳ ዝውውሩን ዝግጅቶችም ዘመዶቻቸውና ዘመናዊው ዝመት ዘለዓለም ዞኑን ዝኾኑ ዝምብ ዝጊ ዝብል ዜማዎቹ ዘገሊላ ዘጋቢዋ ዘጋርዲያን ዘላ ዜናዊንና ዚ ዛሬን ዘውግ ዜናን ዘርይሁን ዘምተዋል ዜጎቻቸውን ዜድ ዘፋኞች ዘይድ ዝሙት ዘገባችን ዘቅዝቆ ዘመዶቼ ዘርቶ ዝርክርክነት ዘመዴ ዝቷል ዜግነትና ዘለሌ ዘመናትን ዘፋኝ";
            amharicWords[21, 8] = "ዘለቄታዊ ዘግቶ ዘግባል ዘመኖች ዘሄግ ዝነኛ ዘመንም ዘጋቢዎች ዘአብ ዘመቻውን ዘረኛ ዘሃበሻ ዘርፎ ዝርዝሩ ዘርዝረዋል ዘርን ዘግይተው ዛፉ ዝርፊያን ዛላንበሳን ዘራፊዎቹ ዘኢትዮጵያ ዘይቤ ዝሆኖች ዘብ ዘርፍን ዜማ ዜናዊም ዙሪያም ዝናም ዘዴን ዘማቾች ዘረኝነት ዘማች ዜግነታቸውን ዘመናቸውን ዘርፎችና ዘበኞች ዞንና ዘምተው ዙማ ዝግጅቷን ዜግነቱን ዜጎቹ ዘበኛ ዜግነታቸው ዘግባለች ዘበት ዜሮ ዝግጅትም ዜጋና ዘነቡ ዝርዝራቸው ዘግቦ ዜጎቿ ዘገቦች ዘመዴነህ ዝግጁነታቸውን ዘመቻዎች ዝርያዎቹ ዘለቄታ ዘገቧል ዘመቻም ዘርዝሮ ዛምቢያ ዛፎችን ዚያድ ዘውዴና ዜጎችና ዝቅተኛው ዝኒ ዙፋን ዜማዎች ዙርያ ዘውዴን ዘካሪያስ ዘርፈዋል ዘመንና ዘርፍና ዘመናዊነት ዙሪያውን ዘንግ ዝርፊያና ዝርጋታና ዘመድኩን ዜናና ዙሪክ ዜጎችም ዛሬውኑ ዘመዶቻቸውን ዘይትና ዘርግተው ዘመቻና ዛላንበሳና ዘራፍ ዘላለማዊ ዘርዓይ ዝናብና ዛንዚባር ዘመቻን ዘፈኖች ዝንጀሮ ዘመድና ዘሩን ዝርያን ዘርዘር ዝኾነ ዙሪያና ዝነበረ ዘንዶ ዞናል ዘገምተኛ ዘመቱ ዘማሪ ዘድንግል ዘለግ ዝቅጠት ዝግመት ዜናዎችን ዝሆን ዝግጁነትና ዝግጅቱም ዘጠነኛው ዘሩ ዝግጁነቱን ዘገቡ ዘለው ዘረፋና";
            amharicWords[21, 9] = "ዘ ዘግቧል ዜና ዛሬ ዘመን ዝግጅት ዘገባ ዞን ዜናዊ ዘንድ ዘርፍ ዙሪያ ዘርፎች ዘመቻ ዝርዝር ዜጎች ዘመናዊ ዘገባው ዘጠኝ ዘላቂ ዙር ዝናብ ዜጋ ዘንድሮ ዝግጁ ዘር ዝም ዛሬም ዘጋቢ ዞኖች ዘዴ ዘገባዎች ዜግነት ዜናው ዝቅ ዝግጅቶች ዘገበ ዝቅተኛ ዘውዴ ዝግጁነት ዘይት ዘግይቶ ዜጎችን ዘመኑ ዝግጅቱን ዘመድ ዝግጅቱ ዛፍ ዝርያ ዝርያዎችን ዘርፉን ዝግ ዝርያዎች ዜናዊና ዝውውር ዘልቆ ዘላቂነት ዘወትር ዜናዊን ዞሮ ዝርጋታ ዘርፉ ዘመነ ዝርፊያ ዘርፈ ዞኖችና ዘመቻው ዘመናት ዜናም ዛላንበሳ ዘለቀ ዝግጅትና ዘመናቸው ዘረፋ ዘሪሁን ዘዴዎች ዘ ዘሮች ዜናዎች ዘላለም ዘገባውን ዘራፊዎች ዞኑ ዘልቀው ዛቻ ዘወር ዘንድሮም ዘገየ ዘግበዋል ዘመዶቻቸው ዘፈን ዘርና ዝምድና ዘውዱ ዘግናኝ ዘነበ ዝምታን ዘጠና ዘርግቶ ዘርፎችን ዞር ዘሮችን ዘመናዊና ዝንባሌ ዜናውን ዝና ዘውዲቱ ዝምታ ዚምባቡዌ ዝግጅቶችን ዘጠነኛ ዘሎ ዘመዶች ዝዋይ ዝናቡ ዜጋን ዘንድም ዝግጅታቸውን ዘራፊዎችን ዘርፍም ዛፎች ዘላቂና ዘጋቢው ዝርዝሩን ዘዴዎችን ዙሮች ዘጋቢያችን ዘለፋ ዘግተው ዝውውርን ዘለል ዘውድ ዘርዝሯል ዘገባዎቹ ዛቻና ዜግነትን ዘርፈው ዘጠኙ ዘመኑን ዘገባዎችን";
            
            amharicWords[22, 0] = "ዠ ዥንዋን ዥንዋ ዦካር ዠመር ዣን ዣክ ዠምሮ ዠመሩ ዥዋዥዌ ዠግና ዠ ዢያዎ ዥያን ዢአን ዦን ዥው ዥኔ ዠርመ ዣቪየር ዥብ ዥሮአቸውን";
            amharicWords[22, 1] = "የሚኖሮት የሙሌት የሚያየውና የመዲናዋን የሚያማምሩ የምርታቸውን የሞያና የማቋረጫ የመሪዎቿን የሚንዱ የማይችላቸውን የሚመሰረቱበት የሞኒተሪ የሚቆዩትን የምትፈልጓት የሚጋበዝ ይገባላችኋል ይጠቀሙባታል የሚጋጠሙ የማያዘጋጁ የሚሳተፍበትን የሚነግሩንና የማጀቱን የሚነጋው የልበ የሚያስደነግጥም የመረመረውን የምንኖርባትን የምትሰማው የሚገደብ የምናድር የሉምና የሚያፀዱት የማይጨምሩ የሚያዩዋት የሌለባቸውና የሀገርነና የምድርም የማችሉ የማይካድና ይኳትናሉ የሚደጋገሙ የማናውቀውንም የማይክዱ የሚያደንቁት የማይጠረቃ የሀዲዱ የምትሞላው የምጀምረው የመቀመጣቸው የምንቃወምበትና ይፈሩ የምንደፋው የምናሳውቅዎት የምታፈቅረው የሚያስታውሳቸው የሚገዛበትንና የሚቃጠል የማምንበትን ይጠይቁት የሚቆጥረን የሚዘባርቀው የሚያዳክምና የሚተረጎሙ የመመልመያ የሰራኋቸውን የሚሄዱትም የሚያጎናጽፈውን የመገጣጠምና የሚስተዋልበት የምንጠይቀውን ይወደናል የሚቀጠር የመካከኛ የምንካፈል የምገኘውን የሚታዩትንም ይፈራናል የሚተረጎም ይደናቀፋሉ የምንሠራውም የመሸወድና ይወጣለታል የማቆየትና የሚጠበብ የሚደራጅ የሚጡት የማደግና የምታከራየው የሚቀለብስ የማናደንቅላቸው ይጨብጨብለት የሚንጸባረቁ የሚደነስበት የለደት የሚጸናበት የመሰከሩለት የሚፀየፍና የሚጋልቡ የሚበቅሉት የማይነሱ የልጄ የማክዶናልድ የሚመላክት የምንጠርግላቸው ይዞአት የለበጣም የምከር የሚተማመንና የሜካኒካል የሚመሠረት የመዝፈን የሚስተዋለውም የምናበረክትለት የማስቸገር የማዲንጎ ይገስፃሉ ይፋረደዋል ይፖለቲካ ይወቅሰናል የመድረግ የሚነቀፍና ይጠብቅና የማኅፀኗ የሚቸግረው የሚያስቀና የማይናቅና የሚከራከሩኝ የሞትንም ይፈሳትል የሚንረው የሚግሬይን ይጠናሉ የሃምሣ የሚጠብቅብንን ይካደም የሚጠራበትን የሚሰጠዉ የማይቀጥሉ የሚወቅስ የምናውቃቸውን የምለካው የሚከለከልበት የሚያምኑበትንና የሚባለዉን የሚያስችለውንና የሚፈሩና የሚያስወጡ ይጭበረበራል የምንሰራ የሚቀበሉትን የምንሰበስብበት የምንወቅሰውና የማይፈልዟችውን የሚገባዉን የሞከረም ይዛት የምትጠራ ይዳርጉታል የሞዬስ የሚታደልባት ይደውልለታል የሚመሯቸውን የመምርያና ይጎዱናል የምንተነፍሰው የሚጽፈዉ የማያልፍለት የለገጣፎ የሚሰበሰብለት የምጠቅሰው የምፈልገውም የሚንቀሣቀሰው የመበልጸግ የማያነብ ይውሰደው ይገነዘበው የሚቆረጠው የሚያግዙት የለብን የመባሉን የሚመዘብሩ የሃየሎም የሚጽፋቸው የሚያፈገፍገው የማበስበሻ የማይገናኙትን የመግጽ የምስኪን የሚታየውም የሚወስዱበትን የማይጠቅመን የሚወስዳት የሚወድቁት የሊብራል የማይክዱት የላቦራቶር የማይሳካበት የላኩዋቸው የሚይዛቸው የመሆንዋ የ የኢትዮጵያ ይህ ያለው የኤርትራ የሚል የልማት የፖለቲካ የተለያዩ የውጭ ያለውን ያሉት የአፍሪካ ይህን የሚገኙ የነበረው የስራ የሰላም የሚያስችል ያህል የአዲስ ያላቸው የዓለም የሥራ የትምህርት ያለ የክልሉ የድንበር የለም ያሉ ይህም የንግድ የሆነ የሆኑት የጦር የአሜሪካ ይህንን የምግብ የጤና ይሆናል የሆኑ የጋራ የነበሩ የምርጫ የሻዕቢያ የመንግሥት የኢትዮጵያን የካቲት የነበሩት ይፋ የነበረውን ይገባል የኢኮኖሚ ይኸው የግል የአየር የሆነው ይችላል የተባበሩት ያላቸውን የገንዘብ የትግራይ የሚለው የሕዝብ ይታወሳል የሰው የተሻለ የመንግስት የኦሮሞ የህዝብ ይሁን ይገኛል ዩኒቨርስቲ የዜና የመከላከያ የሚገኘው የተባለው ይልቅ የኢህአዴግ ይበልጥ የኢንቨስትመንት ይታወቃል የሚያስችሉ የፌዴራል የገለጹት የሚሆኑ የደቡብ የነበረ የግብርና የበለጠ የገለፁት የተነሳ የሶማሊያ ይህንኑ የውሃ የሚኖሩ ዩኒቨርሲቲ የድርጅቱ የመጀመሪያ ይወያዩ ይናገራሉ የሚሉ ይዞ የሱዳን ይገኛ