በት የተጠረጠሩ ያገለገሉ ያደረጋቸው ያስከትላል የኢዴአፓ ያሳለፈውን የዴሞክራሲና የተነሳውን የተጣለበትን የሚያቀርበው የካቢኔ የምዕተ የፈፀመው የሚገባቸውን የዘንድሮ የሕሊና የፍቅር ያረጋገጠ የሚንቀሳቀሰው የውይይቱ ዮናስ የምጣኔ የኬሚካል የጠየቀው ያምናል የተገነባ የሥጋ የቀረበባቸው የአፈርና የምኒልክ የሚጠይቀውን የሚያሳዩ የቀን የሚሆንበት ያለችውን የሆነውና የገባ የተመዘገቡት የተናጠል የማስከበር ያቀረባቸው የታየበት የሆኑትና ይጠቅማል የይቅርታ የሚጠቁም ይሳተፋሉ የክርስትና የቀረቡትን የሱማሌ የታቀደው የበዓሉ የመድሃኒት የቦምብ የኢትዮጵያዊያን የሕገ የኦብኮ የዳቦ የተፈረመው የደሞዝ የዩኒቨርሲቲ የባለሥልጣኑ የዓለማችን የሚታዩትን የገለጠው ያደረገችው የምንችለው የመሣሪያ የሚሰማው የሚያሳዝን የተመለከቱ የሕፃናት የመጀመርያ የከፈቱት የታየ የግብ የፈረሙት ያገኛሉ የሚሉና የፋይናንስና የሚያውቅ የምትገኝ የተመለከተ የፋብሪካው ይለኛል የተጣለባቸውን ይኼን የመዝናኛ የሚያግዙ የተቋሙ የማራቶን የተወሰዱ የነቃ የኦሎምፒክ ይሰራል ያሰለጠናቸውን የተሰራው የተንቀሳቃሽ የለ ይታዩ የሻዕቢያው የአሸባሪዎች ያጣ የማስታወቂያና ይሄዳል የጣለው የፕሮጀክት የመግባቢያ የሞቱ የሚነገረው የፊታውራሪ የፓሪስ የወዳጅነት ይዘውት የሀይማኖት የሚከናወን የዋልታ የሚያገናኝ የተፈለገውን የምዝገባ የሚተዳደሩ የሚፈፀሙ የሚፈልገውን የሚዘነጋ የሀብት ያወሱት ያስቸግራል ይሁንታ ያነጣጠረ የነበረች ይዞት የአዋሽ የአምቦ የኢጣልያ የዜጎች የመደበኛ የኢትዮጵያዊነት የቪዲዮ የማጣሪያ የሚማሩ የሰላሙ የሕብረተሰቡ የማስፈፀም የኢሳት የቀረጥ የመጠበቅ ይቅርና የወተት የምፈልገው የአክሲዮን ይልማ የማን የመከላከልና ያልተጠበቀ የሰበካ የአትክልት ያውም የቁጠባ የሚከበረውን ይናገራል ይጨምራል የማሳደግ የአባላት የመወያያ የገዛ የተመሠረተው የደረጃ የሚያስከትለውን የተገኙትን የቁሳቁስ የድርጊት የደረሳቸው ያወጣ ያብራራል የምትገኘው ያሳሰበው የሕዝባዊ የኮሌጁ የኤምባሲው ያገኘችው የግልግል ይወስዳል የተላኩ የተማሪዎችን የኮምፒውተር የሚወጣ የሕብረት የሚድሮክ የሚከሰተውን የሚያስከትል የጅቡቲን ያሳየው የተደረሰው የሚጠይቀው የሚያስከትለው የግንኙነት ያየህ የሚያስፈልጋቸው የሆነበት የመጀመሪያዎቹ የአባይን የሕዝብና የምትለው የግልገል የመገንጠል የምርጥ የማውጣት የማምረቻ የምክርና የጤናና ይካሄድ የመክፈቻ የፊርማ የልደታ የግጦሽ የሃገሪቱን ይሰራሉ የኢንፎርሜሽንና የፓርቲዎች የሆነችውን የዋንጫ የምለው";
            amharicWords[22, 2] = "የአስተዳደርና ያዘ የአንዳንድ የማይታሰብ የማይባል የባሻዬ የራሷን ያሏቸው የለበሱ የማኔጅመንት የአነስተኛና የህገ የዓመቱ የሚደረግበት የአጤ የደብረ የጅምላ የሽያጭ የስጋ የሚመጡት የማጠናከር የወላይታ ያልጠበቀ የተከናወነው የሚቃወሙ የኮምቦልቻ የሰውነት የትምህርትን የሚሰበሰበው የሚያደርሰውን የክትባት የፈለገውን የተማሪ የወገን የሚያበቃ የሰፈራ የቆዳና የጅጅጋ የመለየት የየራሳቸውን የሃሳብ ያስታወሰው ይገኝ የጥላቻ የአይን የሰራተኛ የተካሄዱ የመቀበል የፈጀ የተሻሉ የተመቻቸ የብዙዎች ይኸን የመመለስ የብዙሃን የሚነካ ይባስ የሚገልፀው የጀመረ የምታገኘው የጣሰ የጉራጌ የእንሰሳት የቴሌኮም የሕወሐት የውሃና የወሰዱ ይሁኑ የተሳተፉት የሰራዊቱ የማያውቅ የወረዳና የኬንያው ይጠይቃሉ የዘንድሮውን የዚምባቡዌ የቀረ የቀሩ ያሉባቸውን የቀኝ የሚፈልገው የመሳሪያ የድምጽ የሆነና የምንፈልገው የትኩረት የተገደሉት ይባል የሚቃረን የኡጋንዳ የኋላ የሚችሉበትን ያሳዩት ያካተተው ያሳየ የሚቀጥለው ያምናሉ የመሰረት የሠራዊት የፕሪሚየር የሚከናወነው የኢንሹራንስ የሚያካሂደው የህጻናት የግሉን ያስተላለፈውን የማስተካከያ ያዘጋጁት የዓቃቤ የማልማት የሆስፒታሉ የተውጣጣ የጨርቃ ይሄዳሉ ይቀራል ይህችን የመጀመሪያዋ የሚፈልጉት የብድርና የተወሰነውን የፖሊት የቤቶች የቴሌ የመክፈል ይጠቀሳሉ የረድኤት ያለብን የመግለጽ የላከውን የአአድን የአልጋ የሚያሳስብ ያለች ያልተቆጠበ የጋዜጠኝነት የሚሰራው የገበሬዎች የኢሳይያስ የከበሩ የአስር የኅብረት የሚገኝበት የሚጠበቅበትን የቱርክ የሚመጣውን የሚያቀርቡ የሚመክር የአባላቱን ያመጣል የጣት የጦማር የወጣቱን ይችሉ ያስፈልገዋል የፍሳሽ የታሰበው የሚሠራ ይኖር የፋክስ የሰራተኞች የመግዛት የምናውቀው የሁለቱንም የሞከሩ የሕንድ የቢዝነስ የኖሩ የማዕድንና የተጠቀሰውን ያመላክታል የመታወቂያ የተገለጸ ያስችላቸዋል የውሸት የወር የሚሆኑትን ያስቆጠረ የሌላቸውን የሚኖራቸው የጣና የተፈራረሙት የሞትና የተወሰነባቸው የእኛን የአገርን የዚያን የረዥም የሰነበተው የተላኩት ያስተላለፉት የማስተማር የማኅበራዊ የመሰብሰብ የአሁኑን የተላለፈውን የመሥራት ያልቻሉ የዘመቻ የእንግሊዘኛ የመካከለኛው ያሸነፈው ያወጡት የዕለቱ የጠላትን የጤፍ የሳይንስና የአጣሪ የመፍጠር የአንበሳ የውህደት የሚያካትት የንጉሥ የፖሊስና የአብዮታዊ የተሞላ የተቀበለው ያቀረበችውን ያለና የጎደለው የተመጣጠነ የኩባንያው የብሮድካስት የአቡነ የተጠናቀቀው ያውቃሉ የበሽታው የንብ የወሲብ የወሰዱትን የሚፈልጉትን የሚጥስ የሞቃዲሾ የአማርኛው የእስላማዊ የሚወስድ የማይናቅ የችግኝ ያሰራጨው የአርባ የሀገሪቱን የታላቁ የሚታተመው የባለ የጨፌ የቅበላ የሚወሰነው የወሰን የተሰማራው የተጋነነ የነበረና የሰውና የሚፈፀመው የገቢና የፕሬዝዳንት የተጣለባቸው የወያኔን የዘላቂ ያለመሆኑን የሚገኙና ይመለሳል ያደረሰው የጠራ የመታሰቢያ የመስተዳድር የፈረንሣይ የተከሰሱት የፕሮፖጋንዳ ያደርጉ ያደርግ የሚያሰኝ የሟች የተቻለ የታየውን የሚያስችላትን የተስፋ የሚያሳዝነው የታወቁ የምታገኘውን የቦሌ የጥራትና የግለሰብ የአሰብን የአሜሪካንን የትውልድ የተፈፀመውን የዘርፍ የበቀል ያለዉን ያውቀዋል የቀረበላቸው የፍራፍሬ የታሪፍ የሚታወቁ የኮሪያ የሚይዝ የበላይነቱን የእድሜ የሚፈፀም የአገራቸውን ዩጋንዳ የሚታይበት የውድድሩ የሚያስፈልግ የበግ የተናገረው የሪፖርተር የመግለፅ የሚሉም የመፍታት የተመደቡ የመድረክ የፀዳ የሚወስደው የጠራው የማረጋጋት የድርጅታችን የተቀመጠውን የመኝታ የወረራ የሚፈታ የግምገማ የከረረ የሚከታተል የማረጋገጥ የመግደል የሃገራችን ይገኙባቸዋል የአደረጃጀት ይነሳል የባድመን ይጠበቅ የግራ የጦርነቱን የአባ የምን የዳበረ የጠነከረ የችርቻሮ የገጠርና የሚያደርጋቸው ይኼንን የፓርቲውን የፓሪሱ የተመደበ ይፈቱ የገበሬ የወታደር የተሳናቸው ይገባ የሳተላይት የጠየቅናቸው የናዝሬት የአዋሳ የሚያንፀባርቅ የሚሰጥበት የሚሆኑበትን የተመራ ይበሉ የሚጎዳ የተቃወሙ የቋንቋ የተቀመጡት የተከሰተ የቅስቀሳ የሚተላለፍ የወደቀ የፈለገው የማዕረግ የሚሰሩት የተጀመሩት የጣለ የተጎዱ የኖርማላይዜሽን ያሳሰባቸው የሊጉ የሚጠበቀውን ያሉና የመጡትን የመካከለኛ የተፈረደባቸው የጥቅም የአገሪቷን የፈፀሙ የመገንባት የሚፈጠሩ የሌለውና የብሔረ የተጠራው የሚከበር ያሰሙት የሚመስለው የአቤቱታ ይገልጣሉ የፊፋ ይሰጣቸዋል የኮንትራት ይበቃል የሚሌኒየም የሚጠይቁ የመተካካት የኢሕአፓ የዋለ የቴሌኮሙኒኬሽን ይጠቀሳል የፖለቲካው የይግባኝ የሚላቸውን የጊዮርጊስ የሚውለው የሌሎችን ይቁም የነጻ የሰዎችን የካሣ የፀደቀው የድንበሩን የመከራ የተመለከተውን የላከው የመሪነት የአገሪቷ የእርምት የሚበጅ የክለቡ የተሰማውን የጠየቀ የተከበረ የቆዩትን ያመጣው የኖረው የተመረጠው የተቻለው ይሻል የጥሪ የመሠረታዊ የኔዘርላንድ የሚደግፉ የመግባት የታሰበ የተመደቡት ያለኝ የመምረጥ የብሔረሰብ የኢሕአዴግን የጫት የባሕል የመነጋገሪያ የተጠቁ የሽቦ ዮናታን የሚመራውን የማያውቁ የኖረ የእገዳ የሚመለከታቸውን የፈለጉትን የራሷ የባጀት የሚያመጣው የምሁራን ይከናወናል የኢሓዴግ የማር የማንነት የሚላከው የሚያደርስ የሳንባ የአንድን የተመሰረተባቸው የደረሱበትን ያላነሰ የሚያረጋግጡ የፊልም ያጋጠመውን የመንግስታቱ የተሠራ የተቀበሉት የሚንቀሳቀሱት የተወሰደውን ይድረስ የጂቡቲ የናይጄሪያ የሚቻልበት የሚጥሉ የነበረበትን የሚደርስባቸውን የቀዶ የመስሪያ የሄደው የማስፋት የማሰልጠኛ የፕራይቬታይዜሽን የአራዳ የሰጣቸውን የማጭበርበር የሚሆኑበት የሚያጋጥሙ የሚሸፍን የሰማዕታት ያደረሱት የነሐስ የሁሴን የነበረባቸው የኤክስቴንሽን የመግቢያ የህዝባዊ የማያንሱ ያተኮረው የፌስቡክ የሚቀርቡት የዲዛይን ያለመ የስደት የጠረፍ የፀና የተከሳሽ የማሰባሰብ የሚገቡት የእያንዳንዱ ያላገናዘበ የሙያና ያስፈልጋቸዋል የማየት የዘለቀው የሊቢያው ያልተለመደ የተሰበሰበ ያንኑ የተጣለበት የተከለከለ የዕውቀት የሚያገኙበት የአማራው ይቀጥላሉ የተደረሰበት የቲቢ የባለሙያ የጀመረችው የእስራት ያጠናክራል ይወጣሉ የተደረሰውን የማደራጀት የነበራትን የመድፍ የሰባዊ የማህበራዊና የማስማሚያ የሊቢያ የዶክትሬት የተቋቋሙት የመቻቻል ይከበር የሚያተኩር የእራት የሚገነባው የተደረገባቸው የኦነግን የሚነገር ይቀንሳል ይመለከታል የተነገረ የተከሰቱ ያለባትን የሱዳንና የታጠቀ የአገልግሎቱ የተሃድሶ የአእምሮ የሚያኮራ የፈጠረውን የሚፈለገው የመናገር የጉዳዩ ዮሃንስ የደርግን የማባረር የሚያስገኝ የተበላሸ የተመዘገበ የዓሣ የሐዋሳ የመንቀሳቀስ የኅብረተሰቡን ያካሂዳል የኦሮሚያን ይበጃል የሚያመለክተው የሙስሊም የጥፋተኝነት የመረብ የተናገሩትን ያነሱት ይሰጠን የመስመር የቆይታ የማስተላለፍ የመርከብ የዚያ የባንኩን የሚገባበት የመንገደኞች የፊት የሚመስል ያለማቋረጥ የታሠሩ የሚወሰን ያስቻለ የነበራት የቦንብ የሚያካሂዱት የጄኔራል ይኽን የከተሞች ያለውም የቪኦኤ ይስማሙበታል የያዛቸውን የክልሎች የአነስተኛ የተቻለውን የማስተዳደር የሚከለክል የሥርዓቱ የሚቀርበውን ይኽንኑ የአፈና የሳይንስ የዲሞክራሲያዊ ያገኛቸውን የጉባዔው የኮሚቴ የተበተነው የጋዜጣ የተፃፈ ያካሄደውን የፌዴራልና የሚፈጸም የዳግማዊ ያማማቶ የቃላት የተለቀቁ ይሄንኑ የእቅድ የተሰማው የተባለለት ያስከተለውን የሰፈነበት የበሽታውን የ