            amharicWords[22, 3] = "የሚቀር የሄጉ የቀለም የተራቆቱ ያገር የሰፋ የትናንቱ የፓትርያርክ የዓመት የተቅማጥ የቅድስት የወደፊቱን የፈለጉት ይሰበሰባል ዩኒቨርሲቲዎችና የሚቀበለው የይዞታ የሚላቸው ዩኒፎርም የፈነዳው የአፈጻጸም የሐይማኖት የጊዜያዊ የላይኛው የአውራምባ ይከፈታል የቀረውን ያጣው ይጠፋል የጄኔቫ የባሌ የምረጡኝ የአሥር የህክምናና የወረዳውን የጠየቀውን የመጀመርያውን የአንበጣ የሚያከናውነው የድጋፍና ይዞታዎች ይቋቋም የሚኖርበት የሚጠይቁት የተከፈለው የሚጠበቅበት ያልሆኑት የሻማ የኦፌዴን የተሠሩ የኦሮሚያና የአርበኞች የምትችለው የማክሮ ያነሱ የዕጩ የደህንነትና የሰራሽ የተቃጣ የተደገፉ የሃዘን የአውሮፓና የባንኮች የኡጋንዳው የሚሏቸውን የከፈተ የሚለካው የሻዕቢያና የትግሉ የባህላዊ የትግሬ የምትሰጠውን የወሰደችው የአንጋፋው የአዲግራት ያላገኘ የከፈሉትን የኮንዶሚኒየም ይደመጣል የሻሸመኔ የታሰበውን የሚፈጥረው የሚወክል የሚቋቋም ያልኩት የዲቪ የስደተኛ ይለወጣል የሙቀት ዩኒቨርስቲና የየካቲት ይሞታል የምዕራቡ ይፀድቃል የገጠሩ የሌላቸውና የወደቁ የሰሙ የዐረብ የማፈናቀል የተረከቡት የመለወጥ የጥምር የተስማሙበት የፈጀው የታቀደውን ያመለከተ የወጣችው የሚጀመር የማስተካከል የኡርጂ የወንጀሉ የፖሊስን የቅርጫት የሚመነጭ የሬውተር የመሰሉ የሚሄዱት የሚያስደስት ይዘቱ የሚያነሳሳ የፋብሪካውን የተላከውን የሚካሄድበት የመዐህድ የዘወትር የጀርመኑ የቡሩንዲ የማፍረስ የኮልፌ የስርጭት የሚያጋጥማቸውን የማይሰጥ የአስተዳደሩን የሰበሰበው የሰላምን የተሰጠን ይከብዳል የእንግዳ የሞከረ ዩኒቨርሲቲና የሚኖሩባት ያቀረባቸውን የብሮድካስቲንግ ያጋጠማቸው የካፍ የሬዲዮው የእኔን የተተከሉ የኮሜሳ ያያል የህዝቦች ያደርጉታል የመሆኑ የሚበላ የቀነሰ የሚዳርግ የተጣለውን ይይዛሉ የሚሊሺያ የገባበት የማብራሪያ የማጥራት የስልጤ የተገለጠ የወባና የሚያቀርቡትን የራስምታት የተጫወቱት የመጓጓዣ የአቃቂ የየብስ ይቀበላል የተጭበረበረ የትራንዚት የጉለሌ ይነሳሉ ይከናወናሉ የሲኖዶሱ የባድመና ይሠራሉ የውንብድና የሚያጠናክሩ የኮርፖሬት የዝሆን የሰዓት የመዝጊያ የሕዝቦችን ያነለት የሚውለውን የህንፃ የልብስ የወሊድ ያልታየ የምናገረው የተምች የማዘጋጀት የቆየች ያሸንፋል ያስቆጠሩት የዳያስፖራ የመድን የሹመት የህዝቦችን የመድረኩ የኦሞ የሸዋ የማስፈን የቆዩና የሚገቡበት የጥቃቱ የቁንጅና የተፈረመውን የእውቀት የህግና የዲፕሎማሲያዊ የወደቀውን የሚያደርግና የኦስትሪያ ይስጥልኝ የሚያስገርም የተጠያቂነት የሰራተኛው የቴሌኮሚኒኬሽን የፅዳት የዴንማርክ የሚኖራቸውን የተቀደሰ የአደጋውን የአንደኛና የተንዛዛ ይመልከቱ የተረጋገጠው ያለችበት ያለችበትን ይባላሉ የተንቀሳቀሱ የሚታገሉ የሃገራችንን የወንዶች የሃብት የመራጭነት የፆታ የሚፈጸሙ የሚከሰተው የሚገርም የመንግሥታት የሆነውንና ያስታውሳሉ ይፈጠር ያልፋል የሚሌኒየሙን የአባላቱ የተጠቀሙበት የምትፈልገውን የሚያስረዳው የሚያሰችል የኮሎኔል የሚመስሉ የገዙት የዩኒቨርሲቲውን የትርጉም የጥበብ የንግግር የኢሃዴግ የባላገር የብርና የመጀመሪያቸው የሮይተር ይዘዋቸው ያሰበው የሰላ የተለየና የሚያክል የያዛቸው የመረጃና የየራሳቸው የሚጀምር የህወሃት የሚፈጥሩት የማታ የሰሙት የመንን የፌደራሉ የምክትል ያየሁት የሪፖርተራችን የኩዌት የአይ የተሐድሶ የመንግሥታቸው የመላክ የተቀረው የሚያስችላት የአልጄሪያ የህዳሴ የኮንጎ የማድረጉ ይመርጣል የሚጋብዝ የተባለችውን የነፃውን የተከዜ የመንደር ዩኒየኖቹ የሚያስገባ የመከላከሉ የሚይዘው የኢትዮጵያውያኑ የሚያስተምሩ የተጋድሎ ያካሄዱትን የተጠሩት ያሟላ የሚፈጠረውን የአምባሳደሮች የተራዘመ የተለመደው የተቀበለ የኖረውን የስርዓተ የሚደረጉት የቁርጥ ይሉናል የተፈፀመባቸው የተከታተሉት የበግና የኤክስፐርቶች ይረዳሉ የሚኒስትር የስንብት የአንዱን የጥምረቱ የተቀሰቀሰውን የኢሚግሬሽንና የግሪክ የተቀጣጠለው የመቃብር ይሰማ የነበረውንና የሆናቸው የተገናኙት የወረቀት ያለንበት የአንዲት የሚፈታተን የሚያተኩረው የሚያካሄደውን የሚሰማቸው ያየ የሚኖሩበትን የፈለገ የድሬደዋ የእንጦጦ የተከፋፈለ የክተት የሕጻናት የተፈረደበት የገደለው የሚወስን የልማቱ የአርጎባ የጠቆሙ የሚለየው የተፈጥሮና የሚስተዋሉ የተወጣጣ የሆስፒታል የመስራች የኢሚግሬሽን የገጠመውን የማስወጣት ይቀራሉ ያዛል የተያያዘችውን የድብደባ የአርሲ የሚያሳድረው ያደረገና የታየባቸው ይልና ያሳለፉት የመንና ያጋጠማቸውን የሳውዲ የብዝሃ የመሸጥ የኢኮኖሚክስ ይሸጣል ዮሐንስና የለህም የምትከተለው የትምህርቱን የአየርና የተወሰደባቸው የተጣጣመ የመከፋፈል የተጠቆመ የተጠቀሱ የሚተው የመጋለጥ የሚያስቸግር የሥነምግባር የሚለዉ የተመድን የሚነሳው የማስረጃ የንጉሡ የሚያስተናግድ የእሳቸውን የሚታወቀውን የኮንፈረንሱ የመተባበር የጋዜጠኛ ይቋቋማል የሆነባቸው የሚያደናቅፍ የቅጥር የመመረጥ የተባረሩትን የድርጅቶቹ የቤዛ ይኽንን ያሉን የተከሳሾቹ ይፈታ የሚያልፍ የምትፈልገው ያቀፈው የሚያጠፋ የሚመጡትን የወሰኑ የመንቀሳቀሻ የአጭርና የተሰነዘረውን የሰነዘረው የሚያወጣውን የተሠራው የተመታው የመቀየር የከፈተውን ይወሰዳል የምንሰጠው ያሉትንም የተገኘባቸው ይፈቅዳል የማስፈራሪያ የሚያስቀጣ የሙያው ይደግፋል የሚሸፍነው ያሏትን ያደረጓቸው የማይታይ የሚጫወቱት የማረፊያ የተለወጠ የታወቁት ያሉትና የሚደርስበት የራሴ የፕሮቶኮል የተመሠረተባቸው የሚወስዱት የተረቀቀው የሚናገር ይዘትና ያነጋገረው ይናገሩ የላችሁም የሚያጎለብት የማጠናከርና ያስችላሉ የሚያበረታቱ የሚሆንበትን የማይባሉ ይገልጣል የሚወስዱ የሚያገናኙ የገለጡ የመደገፍ የበኩላችንን የየክልሉ የሄጉን ዩኒቨርስቲውን የያዝነው የሚጠቀሙት የሚቀረው የመረጣቸው ያስፈለገበት የአንቀፀ የትናንት የሚሰራጨው የዳሰሳ የማድረስ የታገቱት የአፍሪቃ የሚያዩት የኔትወርክ የገጠማቸው ይሸለማሉ የካበተ ይድነቃቸው የሁከት የመአህድ የተከበራችሁ የቀጠሮ የናቅፋ የአሸባሪነት የወንዝ የሚያግድ የሚበጀውን የዘይት የቧንቧ የመብራትና የቀበሌና የአልባሳት የሚጓዙ የሽግግሩ የማዕበል የወጣበት ያስገኘው የሻለቃ የወንጌል የድራፍት የዘረፋ የተጠየቁ የሚደነግገው የአሥራ የመከላከያና የካቴድራሉ የሚያፋጥኑ ይሉኝታ ያደርጋቸዋል የጎበኙ የአቅርቦት የተዋቀረው የተፈናቀሉት የሚከተል የሚጠቅሱት የኔሰው የዋናው ይጥላል የሚጫወተው የመታወክ የተመለሰ የሚፈጽሙ ያለምክንያት የምንጠብቀው የአልኢትሃድ የአባልነት የመሄድ የዋልድባ የተጠና የሚንቀሳቀሱትን የታዩትን ይገባው የሞከሩት ይሰጠው ያሳዩትን የምትከተለውን የሚገመግም የአመጋገብ የቡድኑን የተጀመሩትን የታላላቅ የወይን የቻይናው የተነጋገሩት ይውል የታንዛኒያ የደፈጣ የተነሱትን የራሳቸውንና የዩኒየኑ የተከተለው ዩዌሪ የድርጅታችንን የሚመረጡ የሚጫወቱ የሱማሊያን የሚፈፅሙ ያቀዱት የእርስዎ ያስፈልጋታል የቀስተ የኢኮኖሚው የሚያጋጥሟቸውን የሰሌዳ የብዙዎችን የመጫን ያሸነፉት ያስታውቃል የምፅዋ የእንጨት ይህንም የለብኝም የመምረጥና ይዞታነት የአንጃ ይወድቃል የምንዛሪ የተካፈሉበት ያሳየችው የአሥመራው የሰፈሩት የታዛቢ የእርከን የመዋጋት የስዊዝ የተገኙበት ያደርጋታል የኒውዮርክ የሚመጥን ያህልም የዲሲፕሊን ይለዋል የሚሸፈን የሟቾቹ የሟቾች የትና የወሰዳቸው የዝግጅቱ ያስገቡ የማኅበረሰብ የሚያደርሱ የተሰሩት የማምረቻና የሃጂና የለቀቁ የ