ያየነው ያለመቀበል የዘለቀውን የጤንነታቸው የተመሰረተውን የጫካ ያልተገለፀ ዩኔስኮ ይተላለፋል የተለዬ የስደተኝነት የመንግሥቱን የሚሰራጭ የተጋበዙት የመወዳደሪያ ይታሰባል የቀረበውና የሌሎቹ የኦሮሚያው ይጠራ የስዋይን የግለሰቡ የሐዘን የጀብሐ የምታቀርበው ያቀኑት የደንበኞችን የሚሰበሰብ ያዩት ይፈራል የተወሰነበት የአስመራው የሚለዉን የተሰራጨ የደብዳቤው የቤቱን ያደረሰ የቅኝት የድኅረ የመምህራንና የዲኘሎማቲክ የአባቶች የሰራተኛውን የምትለውን የሚያበረክቱት የአሰሪና የጨለማ ይልቁንስ የሚገኙባቸው የመሸከም የይለፍ የርዕሰ የአብዮት ይቺ የማስጠበቅ የዱቤ የአለማችን የመሰረተው የሚቋቋሙ የሚከፍለው ያጠናክረዋል የማጣራቱ የሚያራምደው የቀድሞዎቹ የአሸናፊዎች የእውነት የሶሻል የአይሁድ የማይገኝለት የተሳሳቱ የተሰማቸው የሰማነው ዩኒቨርስቲን ያፀደቀውን የነበር የደረሰባት የብሄረሰቦች የግጭቱን የተባለን የእንግሊዘኛው የኳታር የቱን የሚይዙ የሚመደበው ያድጋል የእምነቱ የሚፈለጉ የመረጡት ያልደረሱ ያበቃቸው የሰፈነባት የማይረሳ ያለመሆን የማይፈልግ ያለኝን ይወገድ ይልቁኑ የዘፈን የሌለዉ ይነጋገራሉ የድርጊቱ ይደርስባቸው ይኽው የልጆች የውክልና ይመለከቱታል የተደራጁት የተደረገለት የሚመረጡት ያመለከቱ የክልሎችን የጋዜጠኞችን የባቢሌ የሚቆጠሩት የቅመማ ይቀርብ የሚተርፍ የመልቀቅ ያደረጉና የወንድ የሸቀጦች የወንጂ የህወሐት የሚጠሩት የእነአቶ የሚለውም የቤንዚን የተሰለፉት ይኑረው ያጣል ያካተቱ የሚያስረዱት ያሳድራል ይዘህ የሚመራና የማካለሉ የማህበረሰቡ የደንና ይረዳቸዋል የጨዋ ያውቁ የሚጠብቁት የፍትሐብሔር ያሸነፈ የብሔረሰቡ የቀሪዎቹ የፊልሙ የእስረኞች የውሳኔውን የመበታተን የላቦራቶሪ የፀደቀ የማፅዳት የተቀነሱ የሚላክ የግለሰቡን የማንሳት የከሰላ የቀጣዩ ያልሆኑና የተመረቁት የጽሁፍ የገዛቸውን የሚያካሂዱ የማይቀበለው የማይበጅ የመሻሻል የተጫኑ የፕሮቴስታንት የስታር የተቀጠሩ የነበረዉ የሰብለ ያስመዘገባቸውን ያለሁት ያየው የቤኒሻንጉል የሚሰሩበት የተባበረ የመተካት የበለፀገች የተደረጉትን የተላለፉ የአፋርና ይጠየቃል የፈረንጆቹ የእረፍት የሩብ ይህቺ የስጋት የምስጋና ይዘጋል የሩዝ ያለነገር የሆቴሎች የውትድርና የሚወስዳቸው የቆየውና ያነሱትን ያዥ የተዋቀረ የግጭቶች የማሰር የታቀዱ የመሰለውን የተበደሩትን የሚያዙ ይዘረዝራል የሚያናጋ ይምጡ የቁጣ ይምጣ የመቀነስ የክፍል የዩኒሴፍ የተገነባውን የሚፈጅ የሚያረካ ይመስገን የባድሜ የደብረዘይት የሚተዳደሩት ይገባታል የአራቱ የተፈጸመ የድረገጽ የማሰልጠን የዘመድ የሚያቀርባቸው ያልነበሩ የዓሹራ ይለያል የበርሊን ያዳግታል ይወዳደራሉ የሴፍቲኔት የአካዳሚ ያብራሩት የሰርከስ የሚገነቡት የገለጸ የሚመረተው ያስባል የተካሄደበት የስልክና የእነርሱ ያሰማሉ የተወለደው የጊኒ የተጠየቁትን የነዋሪዎች የሚፈጸመው የተሰጡትን የኮብል የሰማ የለበሰ የናንተ የመለኪያ የቢሮክራሲ የሚጣጣም የነፂነት ይጓዙ የሚያስተዳድረው የአክፓክ የምድብ የተፈቀደው የታሸጉ የመሪዎቹ የተናገረውን የፈጣን የሳቅ የተቀላቀሉት የማይበልጥ የሚያመች የውሳኔው የተሞላው ይወዳሉ ያለመረጋጋት የመመገቢያ የኤምባሲ የኢህአዴግና የሚፈይደው የራሺያ የደቡባዊ የኮንስትራክሽንና የሚያደርሱትን የመገበያያ የሚላከውን ይጮሃሉ የሚደረግባቸው የነባር የሰጧቸው የቤተክርስቲያኑ የማይጣጣም የፋይናስ የሚያሟሉ ያልተቻለ ያልፈለጉት የሀገሬ የውህደቱ የእነዚህን የመጣል የሚሰለጥኑ የፑንት ዩኒቨርስቲዎችና የተቀራረበ የንጉስ የውይይቱን የገመድ የበቃችው የመስከረም የሚገዛ የተጠየቀ የአክሰስ የተፈፀመበት የአግሮ የሁኔታውን የከንቲባ ያደርሳል ያለገደብ የኦፕሬሽን የሚገኙበትን የ