            amharicWords[22, 4] = "የኦሊምፒክ የሚገኘውም የዘገየው ይኽም የዋሻ የእስራትና የአብዛኛው ይጎበኛሉ የገዛው የስሜት የፓትርያሪክ የሚባረሩ የተንሰራፋውን የአሠራርና የሆድ የመጡና የፍልስጤም ይጠቀማሉ የተካተቱበት የተዘረፈው የምትልከው የሚያግደው የተሰራውን የባዕድ የዘረኝነት የተጀመረውና የመቃወም የተገደሉትን የሚሄደው የትንኮሳ የስንቅና ያስቀመጠውን የሚጨምር የኤርትራውያንን ያላካተተ የለቀቀ የሚሰጥና ይዞታውን የዳረገው የተረፉ የዝቅተኛ የመንደሩ የሊግ የሚገዙ የሚያስቀር የተቀሩትን የኢንቨሰትመንት የሰብልና የሚለውና የአካባቢያቸውን የአደረጃጀትና የሚያበረታታና የያዘች የፖለቲካውን የምጽዋ የሚባልበት ይፈለጋል የማደስ የተለመደና የሚፈጸመውን የምንገባበት ያላቸውንና የተገመተው የውስጥና የፎረሙ ያስገኙት የሰፈነው የጻፉት የሌጦ የየካ የኢምግሬሽን የሚይዙት የፍፁም ዮሱፍ ያስቻለው የተወያየ የመፈለግ የሚያደርሱት የሰይጣን የተፈቀደ የማደርገው የሚጓዘው የሚያካሂድ የጤናውን የአፕል ያባት ይመለከቱ የግሪሳ ያልተመለሰ የንቅናቄ የእርቅና ያነሳ የሼክ የሚሻል ይዞታን የፃፈው የሚደረግለት ይሂዱ የሰብዓዊና የአንሚን የሊቃውንት የፈቀደውን የየትኛው የገነተ ያለማስጠንቀቂያ ያቋቋመው የቡርኪናፋሶ የቴሌቪዥንና ያደረጉበት የአረብኛ የቀርቀሃ ያዘጋጀ የሚመሰገን የሚያንፀባርቁ ይሰነዝራሉ የሚጓዙት የፓርኩ የገናናው ይኸንን የሚያመርቱ የኬር የሚያስረዱ ይመሰክራል የማላውቀው የተሰራጨውን የሚደርስበትን የተሰናበቱ ይማረውና የኢትዮጰያ የኢሠማኮ ይህው የሰራተኞችን የቦይንግ የምትልካቸውን የኮር የተሻለች የሚጥር የሚካሄዱትን የማስፈጸሚያ የተደላደለ የኢትዮጵያውያኑን የመሆኑን ያስቀመጡትን የሆነውም የሠላሙን የዓባይን የጣለባቸውን የተቋቋመበትን የአልሻባብ የእርቀ የስድብ የሰንድ ያንቺ የኦዲትና የማካሄድ የግብአት የአማራና የተቸገሩ የሂሣብ የተመታ የሰየመው የሚያሳድግ የፌደሬሽን የታተመ የአማራውን ይወስድ የሆነዉ ያደረጉላቸው የተማሪውን የተንኮል ይቀበለዋል የሎጂስቲክ የሀሳብ የሀይል ያመልክታል የማገናኘት ያነጋገሯቸው የተሸነፈው ያስረዱ የፈንጅ ይደረግላቸዋል የመጣበት የሰመራ ይገዛል የሙት የሚገዛው የመንገዱን የሚያስቡ የሚገኘውንና የሴኔጋል የሚተዳደር የማይታመን የሚሞክር ያልቃል የጋዝ የተረዳው ይቺን የቆዩትና የማሳ የተሰለፈው የተፃፈውን ያተረፉ የማበረታታት የስዊስ የቤልጂየም የመምህራኑን የዛላንበሳን የጣሱ ያልተገኘለት የታሸገ የሀገርን ያሳውቃል የተነደፈ የሜጋ ይሏል የማይበልጡ የሀዘን የውዝግቡ የገበሬው የቡናው የሆኑትንና የአፈ የሕወሃት ይጠቀሙበት የተሞክሮ የፕሮጀክቶች የጀግናው የስዋን የህንጻ ያለፈባቸው የሚያዋጣ የእርሱን ያደርጉት የዝናቡ ያበቃለት የየወረዳዎቹ የበርበራ የሚያከናውናቸውን የጠፉት የሚገድቡ የሽብርተኞች የተረዱ የተቀረፁ የሚጓዝ የሚያልቅ ያዋለው የሰማው የጹሑፍ የሚያከናውኑት የጥያቄና የኢየሱስ የተቋረጠ የሚያዋርድ ያልተሳካ የአባላትን የሚልኩት የዘመናችን የዶላር የሚያመጣውን የፌዴሬሽኑን የመርዳት የሚበላው የአልበሽር የበለጸጉ የግዕዝ የረቂቅ የኢትዮጲያ የአብዛኛውን ያሳልፋል ያለቀ የሚካሄድበትን የኢንዱስትሪና የሚሠጠው የሚለዋወጡበት የስርአቱን የጠፋውን የአለምን የተነደፈው ያጠናቀቀ ይመለከታቸዋል የዕድር የማለፍ ይቀመጣሉ የወንጀልና የሚያወጡት የሚሄድበት የተሰራጩት የቆሙት የፈረሙ የታችኛው የኮሙዩኒኬሽን ይመቻቻል የሁላችን የተቀላቀለበት ይፈፀም የጨረሰ የተጫነ የሚያበቃቸውን የዋርዴር የተንዛዙ የጨርቃጨርቅ የቦስተን የሚያቀርቧቸው የጸደቀው የማስተላለፊያ የኔት የተሰማሩትን የሆቴልና የኔሽን የዘገየ የፈፀመ የም