            amharicWords[22, 5] = "የሚደመጠው የሦስትዮሽ ይጠጣል የተደረሰበትን የማኀበሩ የተሰባሰበው የእልቂት ዩኒቪርሲቲ ያዘዘ የጎበኙት የሞሪታኒያ ያንፀባርቃል የምንጭ ያደረገበት የተማረሩ የሚያበቃው የማያባራ የመደብ የሚገኝባቸው የሚያገለግለውን የመሩ የማስትሬት ይኑራቸው የመግለጽና የሚያቋርጡ ያንለት የሚወክለው የፍቅርና የማይታወቀውን ያስቀራል ያስቀመጡ የአቃቢ የመጡበት የተሰዉ የነሃስ የአብዛኛዎቹ የተኛ የሮያሊቲ ያደሩ ያበረክታሉ የነጥብ የኮሚኒኬሽን የውርስ የሰመረ ይጎዳል የፕሮፌሰርነት የሚያስችሉና የተፈናቀሉትን ዩሴፍ የፖለቲካል የተናገረ የክረምቱን የተቃዋሚዎቹ የተባለበት ያስደነገጠ ይለማል የኳስ የመቆጠብ የሠሩት የወደሙ ያልተስተካከለ የጋምቤላን የሚያወግዝ የሚጣልባቸው የንቀት የተገነዘቡት የጋማ የመኪናውን ያከናውናሉ ይገታል የነጋዴዎች የተውጣጡና የወሰዷቸው የሚሠሩትን ያቀርብ የፐብሊክ የመዝናኛና የሚናገረውን የስጦታ የተዘረዘሩ ያሰማው የሄግ የታጠረ የሚጠቀም የተገኙና የአይሮፕላን ያለመሆኑ የተራቆተ የተፈታ ያልተረጋገጡ የተነጣጠረ የተጣሉት የኢኮኖሚያዊ የጉልበትና የትግላችን የእፎይታ የቻሉበት የፔትሮሊየም የራዳር ያልተፈቀደ የባሕልና የህጉ የተመሠረተውን የሺሐረግ ያስገነዝባሉ የሚያመሩ የሚያድሱበት የመልካሳ ይገጥማል የተረጋጋና የሚፈቱበትን የየመንን የሱፊ የተበታተኑ የተገኘችው የሰልፍ የቀራቸው የኢትዮጵያዊያንን የሰጡበት የጣሊያንን የወንጀሉን የተባባሰ የማጠናከሪያ የፕሬዚዳንቱን የመፃፍ የሜጫ የሳር የአስተያየት የተዘረዘሩትን የሚደርሱትን የሚቀሰቅሱ የሚቀሰቅስ የተደራጁና የሚደግፈው የውሀ የወሊሶ ያዘነበለ የሚወደው የሚወስኑት ዩናይትድን ይጠቅማሉ የተተበተበ የሆነበትን ያሳለፋቸውን የሚለማ የሙያውን ያጠፉ የሚጣልበት የሚዘጋ የወረደው የዋሉትን የመጣውና የምስራች የሚፈቅደውን ያስደመጡት የነፍጠኛ የሴክተር የወንዶ የዛምቢያዋ ዩኒየኖችን የማያደርግ የተመሰረተና ያተተው የፋርማሲ የሉሜ የሌሊት የሚመጣጠን ዮዲት የአባቶቹን የተበሳጩ የወጡና የሚያመጡ የሚደረግበትን የርሳቸው የዘለዓለም የተመዘገቡትን የታቀፉት የሚቀመስ የመጣሁ የአጨራረስ የተቋቋመና የሠራ የጦጣ የመሬትን የማይፈታ የሚያልፈው የቢል የአምናው የሚያገኝበት የተመረቀው የመሰረተባቸው የሚሰጥባቸው የተፈጸመባቸው የኤስ የአካባቢን የመጣች የሚያስተባብሩ የማይመለስ ያዋላቸው ያነሳቸው የቲያትር የአጠቃቀም የሚገባንን የምፅዋን የተደበቁ የሚያጠና ይፈረማል የተቀበሏቸው ይዘዉ የተወገዘ የበለጸገ የማሕበሩ ይመከራል የተበተኑ ያስገነባውን የኔትዎርክ የአይረን የግቢውን የተፈረሙ ያነጋገሩ ያበረከቱትን የተነገረን የፍሩድ የሚያሳየውን የተበላሹ የሥርጭት የሊባኖስ የዚያድ የሚያሳድረውን የሚጓጓዙ የኮሚኒቲው የሚጠጣ የሸጡ ይመሰረታል የወጣና ያስቡ ያመነጩት ይዘጋጃል የፎከስ ይሄውላችሁ የሚሰሩበትን የሚወስዱትን የሰነዘሩ የተከሰሱበትን ይቀመጡ ይደረግባቸዋል የትርምስ የሚከፍሉ የዳረገ የሚኖርባት የአረጋውያን ያለበለዚያ የማያዋጣ የሚያውክ የችሎቱን የአጎዋ የጉባዔውን የተቀላቀለ ይዘቱን ያልሰጡ የመኝታና ያበደረው የሚያውቁትን ያካሄዳል የጋዜጠኞቹ ይያዛል የምንሆን ይጥላሉ የተገደለ የልዑል የድርጅታዊ የቀየሰውን የሚከፍቱ የሚፈጽመው የሚታሰሩ ይህንኑን የሚያመነጩ ይሰጠናል የሚደነግገውን የሶቪየት የፕሮሞሽን የሚያሻሽሉ የጥርብ የወጣውና የሚፈፅሙትን የተበረከተላቸው የፕሬሱን ያስቆጣ የማርሽ የዘገበ የሚያነሳው የመስህብ የመግለፅና የአምባገነኑን የሄዱበት የማሰቃየት ያልተመለሱ የገቡና የምንሰማው የህፃናትና የተጓደሉ የሚያሳድር የሰፈረበት የሚወርድ የተሰየመውን የሚያትተው የኪስ የተ