            amharicWords[22, 6] = "የሚኖርበትን ይሆንብኛል ይታገላል የገባነው የኅዋ የብራዚል ያባባሰው የኤርትራዊነት ያስገርማል የሚወድቅ የስርአቱ የደረቀ የትግራይንና ይመልሳሉ የፈንዱ የሚጠየቁት የተመረቱ የረሃቡ የመሸናነፍ የደረት የሚያሳዩትን የጉድ ያለንበትን ይከተል የሚነኩ የመንጋጋ የምሁራኑ የሚሰጠውም የቢቸና ያረጋገጠበት የአገራት የአኢጋን የእርዳታውን የቴሌቶን ይበልጥም ያስቀምጣሉ የኢትዮጽያ ይበቃሉ የኢንተርኔትና የድርሻችንን የሚነዙት የኀብረተሰብ የአርሶአደሮች የተረቀቀ የሚሞክሩት የጋሽ የኬሚስትሪ የሚሄድና የቆቃ የሚኖራትን የሰባ የቁጠባና ያልደረሰ የተበላሸውን የቆቦ የመስኩን ያንዱን የማናጃይትስ የደንበኞቹን የቲቪ ይጠብቃሉ ያመጣሉ ዩኒቨርሰቲ የወገንን የሽብርና የተገልጋዩን የተጋጋለ ይሳተፉ የአህባሽ ያገሩ የኦክስፋም የሚያስታውሱት የዜግነትና የተጋረጠውን ይብሉ የሱማሌን ይታይበት የሰሜኑን የእሁዱ የተከተሉት የሱኒ የተረጋጋች የፈጀበት የሌለን የሕልውና የስእለት የቅዳሴ የፕላዝማ የመትከል ያዘጋጀችው የተሰባሰቡበት የመጣልና የልጃቸውን የማንቂያ ያልኩበት የተባረሩትም የሚከፋፈለው የደኢህልማ የመዲና የማይካድ የሕክምናና የሚያከራክር የምንረዳው የዲፕሎማቲክና የምንመለከተው የሆኖ የኢሪን የማረስ የዉስጥ የሰጠበት ያሰራጩት ያፀደቃቸው የሚፈፀምባቸውን የተፈራረመ ያለቁት የተፈራረሙ ያደረግሁት የታሰሩበትን የኮንደሚኒየም የሀገርና ይስባል የሞላበት የአሸባሪው ይጠቅመናል የኮሚቴውን የውዴታ የማከም የምነግራችሁ ያሳየች የሚያድን የሚወክሉት የምታደርጉት የደለል የማይሄድ የአዞ የእሳቸውም የሟቾቹን የጠየቅን የሚያበቁ የቦታና የተነሡ የፈሰሰ የጀሚል የሚመረቱት የምትነሳው የተገደሉበትን የማዕከሉን የያዝኩት የውሉ ይሰቃያሉ የቻለና ይፈጥርላቸዋል የሚጠየቁ ያስችለናል የሚያንቀሳቅሱ ይነስም ያልተዋጠላቸው የተሠሩትን የተጣጣሙ ያትታሉ የሚያካሄድ የቤተመንግሥት ይቀርቡ የሚለይበት የአመቻች የተላከላቸው የቅርሶችን የማያሻማ የምታራምደው የሚያጨልም የመለዋወጥ ይልቃል የምስልና የውጥረት የሪፎርም የወሰነበት የማይቋረጥ ያጠፋው የማያደርጉ የተዳረገው የዲፕሎማሲው የሰጠሁት ያቆሙት ያገኘኋቸው የቆመለትን የተጠቆመው ይፈጠራሉ የሙስሊሞች ይገርማችኋል የምኖረው የሌለበትን ይሸበራል ይረዳናል የቡሽ የእናቶች የሞባይልና ያሰራጨውን የተከላካይ የለንደኑ የሐማሴን የትግሉን የኢትዮጵያዉያን የአድማ የአልሚ ያለልዩነት የጵጵስና ይጥራሉ የወጡበት የህዝባችን የሊሙ የኢምግሬሽንና ያስመረቀ የሚያስተናግዱ የዩኒቨርሲቲዎች የታመመ የሚያስገባው የመታደግ የኖርነው የሴኔት የነዚህን የታጋይ የመካለከያ የሚስተዋሉትን የአሸናፊነት የጂቡቲን የሚቆጥሩ ዩኒቨርሲቲም የሚጫወቱትን የአዋጭነት የጎልፍ የአተገባበር ይጠቀሙ የእሥልምና የወጣትነት የነስዬ የላም የሚሉን የተንሰራፋው የደገፉ የቻለውን የማይደግፉ የሚያበረከተው የትራንስፎርሜሽኑ የወላጅ የምታስገባውን የአንጎላ የናሙና የቢጫ የገለፀልን የሚባክነው የተቻለበት የማሻሻልና የመሣሠሉት የሚባክነውን ይነካል የፈለግነውን የዑማ ይወክላል የኃላፊው የፈረሙበት ያለብንን የጦሩን የእግዚአብሄር ይቋረጣል ይወጣና ያለም የሚያቃልል የሸማ ያለሽ የቤተሰቦቻቸውን የማይሰሩ ያንዣበበውን የተመቸው ይፈርሳል የነብር የማጠናቀቂያ የመሰረቱ የማይበላ የሸበሌ የማደናገር የአምባሳደሮቹ የጥላቻና ያለኢትዮጵያ የአሉምኒ የሲፒጄ የጨረታውን ይደር የተጠቁት የምንናገረው ያሰራው የሚንሊክ የማስለቀቅ የሚሆናቸው ያመርታል የተገመቱ የኤክሳይዝ ይለቃል የዘገቡት የተዘራው የሚቋቋሙና የነገሩ የባለስልጣናቱ ያለመግባት የፈጠራቸው የነገሰበት የኤርፖርቶች ይ