 ያቀረብንላቸው የጂጂ የነርሶች ያብቃን የተባለዉን የጎሰኝነት የምታገኝበት የረዳት የቃጠሎ የጥቃቅን የበሰለው የጠገበ የኬኒያን ይካፈላሉ የተጠረጠረው የአቅጣጫ ያመዝናል የፓርክ የኢትይጵያ የወረዳዎች የአግአዚ የሚሻው የተጠረጠሩትን የጠለፋ የሰደዱ ይዟት የጉዳቱን የማዘጋጀትና ያለእድሜ የስደተኞቹን የቱኒዚያ የሚጀምርበት ይደረግልን የሚያድርበት የምናብ የአቢዬ የማያጠራጥር የአይጥ ያሰጋሉ የሚገልጡት የኦብኮን የሚገድብና የጃዝ ያልተሳካለት የሚልክ የተቃራኒ የሁገአዘ ይሄዉ የጋዳፊ የታራሚዎች የዚምባቡዌን የተሰራጩ የመረጃዎች የግራና የለመደው የግለሰቦችና ያሰባሰቡትን የአልሸባብ የተከሰተበት ይህማ የፈለግኩት የወረዳዋን የሚፈለግበትን የተባሉበት የሚድያ የደኢሕዴን የሞቀው የመመከት የሚለቀቁ የነ ያድራሉ የሚለቀቅ ያወቁት ይውደም የዕፅዋት የአባተ የአባት ያይላል የሚያካሂዳቸው ይቀነስ ይዋጋል የተጠበቀና የኔዓለም የኦሪት የተንጣለለ ይዋሉ ያቋረጡት የተቀላቀለው የምትለዋ የተዋሕዶ የዙር የማይሰማቸው የሚቆጥሩት የካናዳና የለገሰው የቀበሌውን ይፈለግ የተካሄደና የሚጀመርበትን ይከታተል የማዛወር የኣሁኑ የአስፈፃሚውን የተነሳበትን የማቴሪያልና የሰበሰቡትን ይፈፅማሉ የተጠቃሚዎች የሚያስቸሉ የለሽነት ይለቀቃሉ ያልታሰረ የሚነግረን የተገመተውን የደፈሩ የችሮታ የዘርፈ የሚሰጡበትን የተወረረ የተሰረዘው ያገለገሉና የግላቸው የምናውቀውን ያደረግ የተወረሰ የሰጠና የቆረጠው የሚመሰረት ያላ የአባሎቻቸውን የማቆያ ይጫወት የምንችላቸው የተሳታፊ የደሞክራሲ ያላደረጉት የተሸጡት የደሃ የምልክት የሚፈፀምበት የላሊበላን የኢንዱስትሪዎች የቆመለት የምንሄድበት ይሰጡት የሔጉ የጥንታዊ የደስ የተሳትፎና የሰማዕታትን የቀረበላትን ዮሴፍን የበዛብህን የታወቁና የተሠኘው ይመረታል የአስፋልትና የማይችልበት የጨለመ የአሸንዳ የሚነግድ የኮካ የእምነቱን የሀበሻ የመሆኗን የሚያጣራው የተከዜና የሚፈስ የመዋጮ ያሳሰባት የስርዓተጾታ የምትችሉት የድሆች ይሳሳታል የሚያረጋግጡት የምትመስል የማሰራጫ የሚወድመውን የሚታገዝ የብፁዕ የሸሪአ የፋሲል የተጨመረው ያደባባይ የተሰበሰቡትን ይጽፋል የሚገኝባት የመንከባከብና ይዘትም የመቻል ይርጋጨፌ የተገለለው የሚጠራጠር የካርጎ ያዳመጠው የጠበቁት ያለፈና ይገናኛል የታሰሩትም የተጠቃው የአርነት የሕዝቧ የሚወለደው የባሬንቱን የሚፈጥረውን የሱሉላ የራያ የማይመጣጠን የመድሐኒት የሚሳይል የተመሩ የመክሸፍ ይሞቃል የተሾሙትን የማዳበሪያና የአበርገሌ የዘለቁት ያነሳሉ የቆሙለትን የመከባበር የዛን ይጥሩ የቀረች የፓልም የለገሱት የአጋንንት የተጠረጠረ ይድናሉ የተሰለፈ የመደበውን የብሄረሰቡ ይሞቱ ያስነሳ ይበላችሁ የምታስገባቸው ይለን ይረከባሉ የመረጣቸውን ያክላሉ የመታየት የዓድዋው የአይጦች የማይገናኝ የልዕለ የዜማ የዲላ የመብሩክ የሚባለዉ የተሸለሙት የሚያሰራጩት ይላችኋል የፌዴራሊዝም የከረን ያመርት የብሄርና የሚያደፈርሱ የተቆጡ የፊውዳል የመረጠውን የእርሳቸውን የኀዘን ያሰባሰቡት የገብሬ የርሻ ይቀንሰዋል የእንሰሳትና ያልተነካ ይስማ ይለፍ ያዘኑ ይወስዱ የበዓላት የምንፈልግ የገዘፈ የሞተውን የተቀበረው የደንበኝነት ይገለጽ የፊዚካል የማግኛ የመፍቀድ የሲዳማን የሚዘረጋው የታየበትን የተቃወመው የታደለ ይዤው የተነከረ የሰባተኛ የሞቱና የዩንቨርስቲው የታለሙ ይቀንሳሉ የዱሮውን ይታይባቸው የአስፈጻሚ የሠራሁት የነበረችን ያሳለፈ የሚቀይር ያቀረበለትን የባልና የጋዜጠኝነትና የተሰማኝ የቅርንጫፉ የደንበኛ የተወነጀሉት";
            amharicWords[22, 7] = "የመቀመጫ ይለውጣሉ የሮማ ያጋባል የተንቆጠቆጠ የአርበኝነት ያስገረማቸው ያስተማራቸውን የመቀየርና የተረጂዎችን የመሣሠሉ የቪክቶሪያ የመናዊ የመቱ የብአዴኑ የትግልና የእርሻው ይወዳደራል የኒያላው የትምርህት የኋልዮሽ የገዱሙ የቋንቋው የተሰነዘረባቸውን የአብዮታችን የቆሰለው የማይፈጽም የፈታሽ የውብሸት የዞረ የምወደው የታዘብኩት የመሥራትና የሚያውቀውን የውሸትና የመቃወሚያ ያስረዱል የማሽን የአለማቀፉ የዲግል የቴኒስ የተጠናወተው የመራው ያራል የተንሰራፋ የሚገኙባት የማንኛውንም የሚያፋልስ የጃንሆይን ያቁም የማሌሊት ያለመታደል ይቀየራል የገለጿቸው የተሠማራው የሚፈለግበት የድካም የአልጄዚራ የሚተላለፉበት የሚነዙ የመጨነቅ የጠና የተገባለት ይካተታሉ የሚያወግዙ የሻዓቢያ የሁለተኛና የጠራውን የምዝገባው ያያይዙታል ይለያይ የተበደሩት የግመል ይለመዳል የዮርዳኖስ ያስደመጠው ይፈነዳል የድረ የሚያጋጥም የኢየሩሳሌም የጫነች የዩኒቲ የኮብልስቶን የተከበቡ የዓየር የሀዋሳ የአአዩ የምትጠቀስ የሚዳፈር የተገደደችው የቀረጥና የአርሶአደሮችን ያጋለጡት የተነጠቀውን የሚያመርቱት የመረመረው ይነግሩናል ያገናኘን የፍሬ የሚሠሩና የመጀመሪያዉ ያጸደቀ የአርሚ የውጭም የሰራሁት ይሳካል የሚወለዱት የሚታዘዘው ያለመተማመን ይበተናል የመከታተልና የፍቺ ያቋቋሟቸው ይመስለኝ የማናውቀው የሚስተዋለው የሚያባብሱ ያለመጠለያ የሚፈሰውን የመመለሱን ያማሞቶ የድረሱልን ያልተሳተፉበት የሚጀምሩ የኢሕዴግ የቁርአን ይበሉኝ የማይስማማ የተፈጠረበትን ያልገባ የቀደሙ የአርብ የቆዬ የተነሳለትን ያደረገን የሱስ የመረጃው የሃሰተኛ የተጋባው ይኼኔ የፈላጭ የከተማችንን የተስፋፊነት የተናገርኩት የነሐሴ የሚያሣይ የንጽህና የሚሄድበትን የኦዲዮና ያጋደለ የአኅጉሪቱን ያሁን የህንጻው የሚሰብር የተላኩትን ይብስ የዲፕሎማሲና የተወጡ የነደፈችውን የሌለኝ የአሩሲን የገቢውን የመርሳ ያስማማል የረቡዕ የተሸረበ የፓርቲያችን የማይ የፖርቲ ያረጋገጡበት የማይዘነጋ የትምርት የጅንአድ የክንፈ ያስደነገጣቸው የአትሌቶቹ የኖረን የላካቸው የማይኖረው የሚያጋጥሙትን የባርነት የሲም የትያትር የሲዲኒ ይቆርጣል የሱማሌው ይብዛ የተገኙትና የአገልጋይነት የጭፍጨፋ የሸማቹን የሚጠባበቁ ያነጋግራል የባቡሩ የግለሰቦቹ የወራሪውን የዐዋጅ የሚደርሱበትን የሚበዛበት የለማው የሚሞት የመለካት የሚንስትሮች የሚያወሳው የመውረስ ያለማወላወል ይረጋገጥ የአለማያ የራሣቸውን የምትጠብቀው የፅሑፍ ያሳውቃሉ የማነው የተቆራረጠ ያስደነግጣል የኢዴኃኅ የተቀናጁ የቅየሳ የተነደፉ ይርቃል የጎሕ የአፍጋኒስታን የተለኮሰው የተሳለ የከተማነት የተደናገጡ የአየሩ ይበቃኛል የመጡበትን የጠበቃ የሚጋሩት የብዙሃኑን ይሥሩ የሥላሴ የሚሰብክ የሚጨምረው የተሣሣተ የሚያስጨንቁ የተመቱት የምናያቸው የሚያስመሰግነው የማይችሉትን የህልውናችን ይከው ይፈልግ የአጋሜ የቱኒዝያ የማጠራቀሚያ ይደገም የሚሆነዉ ያስገደደው የማከማቸት የሚያገባው ያጠኑ የተነሳባቸው የተነሱበትን የሰንዳፋ ይሰጡታል የናቴን የቦታው የኮሌጁን የባህሩ የሚቀንሱ ይጠናከር ይሰበራል ያለብህ የሚጠሩበት የሚመክረው የመክፈት የአዲሳባ የሰውዬው የጀጎል የሚተካው የፆረና ይጣላል የቶሬ የመቀሌውን የሚደገፍና ይታሰራል የጤናው የመሰላቸውን የተገለጹት የወሰደና የቀረውም ይሰብራል የማስለቀቂያ የእቴጌን የተጓተተ ይገነዘባሉ ይሰማው የቡራዩ የዕርምት የሚገለፅበት የተቋም የተገለፀለት ያሰሩት የወደቡን የተቀዳጀችው የዕርዳታና የጤፍና የተዳፈነ የኦሮሞም ዮፍታሔ የተከላ የዋይት የውዝፍ የጉምሩክን የፕሬዝዳንትነቱን የበዙ የፈረንሣይኛ ያማል የአንድና የሚያስደነግ