            amharicWords[22, 8] = "የዘላለም የአህጉራዊ የማምረትና የዶቼቬሌ የምሽቱ ያፀደቁ የፈረመችውን የሚቻላትን የከምባታ የጉብኝታቸው የተወለደበትን የገባንበት የሚጠብቁትን የዘነጋ የተበደረውን የሚያበላሽ የኩራት የሆሊውድ የአካባቢያቸው የፍረት ያልተሰጠበት የተረዳ የለምን የተስፋፋው የማጥናት የሚመሩበት የአሁኗ የማትፈልግ የመጣህ ያሳያቸው የሰለቅሁትን ይወቅልኝ ያሰባሰብናቸው የሚቆምበትን የተካፈለው የፓርቲዎቹን የተሞላበትና የታመሙ የካቢላ የሚባረሩትን የማህበር የደብተራ የተሞላበትን የኢንቨስተሮች የሚያስጠነቅቅ የመሻር የፓቶጂኒክ የመጥፋት የዘረዘርናቸው ይደርሱ የሰማይ ይታሰሩ የቁልቁለት የታሰረበት የማትቀበለው የመስዋዕትነት ያስጠነቅቃል የተጎዳውን የሚያስመስል የሚያስቡት የተዛመደ የፕሮፓጋንዱ የቀሰቀሱት የማጣጣም የብዙኃን የሚባረሩት የተቸራቸው የሚያሰፉ የምናያቸውን የመምጣት የወጣቶችንና የወንዶችን የታጀቡ የጽኑ የትናንትናው የቻልኩት ያባብሳል ይጨነቃል የአብያታ የምትሰራ የተፋቱ የተመለሱትን የማተም ያቃጥላል የተጓደሉትን ይጠቀም ያሸንፈዋል የመኢሶን የሚካድ የሚጫኑ ይገልጽ ያሰማችው ያሸንፋሉ የሚነካና ይዘንጋው የድርጊቱን ያከናወነ የተዋጊነት የሚተማመኑ የሚውሉበትን የታሸገውን የተኩሱ የሚካፈሉት የቀኖና የፈጸሟቸው የጠየቀኝ የሰጧቸውን የሚያሳልፉት የአድዋውን የአንጎል የፓርላማዎች የተደነገጉትን የጉዳይ የጂቡቲው ያነሳነው የኮሌራ የጎንዮሽ የተበዳይ የባለቤታቸው የተወሰነበትን የባሰውን የተወሰዱበት የተጠናከረው ያሳብ የአዶላ የህዝቧ ያልከውን የማውደም የራሱም ይሆነኛል ይሰፍራል የሥራውን የማያውቃቸው የተተኮሰው የምንላቸውን የሶማሌና ይኖሩበታል የመጀመርያዋ የሚያሳስቡ የልኬት ይቋቋማሉ የችግሮቹን የላከቻቸው የሚከራከሩት የገለፁለት የማይጠይቁ የምጠብቀው የመመረቂያ የተወራው የፈጠራት የነጃሺን የተወገደ የሚያቃልሉ የፓራዲዞ የተጠራቀመው የሕዝቡንም የሌለንን የሰሙትን የሚያራምዱና ዩንቨርስቲዎች ያልወገኑ ይጀምር የሚነቅፍ የሚፈረጅ የበጎፈቃደኝነት የወሰዱና የስደቱ የሃገራቸው የኑፋቄ የቂሊንጦ የተያዙበትን የተዘረፉት የስለት የተመረጡና ያለሕግ ይፈርሳሉ የገልፍ የታዛቢነት የማስመሰል ይተውት የሚታገለው የሚናፍቁ ያበቁ ይዳረጉ ይበልጡኑ የዳሰነችና ያልናቸውን የፀባይ የወራሽነት የሚነጋገርበት የነብስ የገለጹልን የዚያው የፈሰሰበት የተንሸዋረረ የመምህሩ የቤቴ የከፋፍለህ የመጫወት የሚደነቅና ያሸበረቁ የሚያሰሙበት የእስራኤሉ የሚያሳስበን የአላህን ይዘገያል የጋራድ የጓዳ የተረቀቀውን የትምክህተኞች የሚያንቀሳቅሱት የአቀንጭራ የአርባምንጭ የሚያስተላልፉ የኦን የአበል የየዕለት የሚደረግላቸውን ይዘውን ያላሳየ የመምረጫ የውሃውን የሚያሳስበኝ ያገለገሉትን ያፋጥነዋል የሞርታር ያበጠ የወቅታዊ የማይበቃ የጥገኛ የግርዛት የተደመጠ የተደመጡ የፀቡ የዑጋንዳ የንቅናቄውን የኑክሌር የተረጋገጠና የሰሜናዊ የስዊዲን የረገበ ያስቀጣል የሚደራጁ የኅትመትና ይሞግታሉ ያረጋገጡና የሚያዙት የሚወጡበትን የመንግስታቸው ያልታሰበና የተመደቡበትን ይወሰዱ የተጠቆሙት የሩስያ የማይኖር የኮሚሽን የክርስቶስ የጨበጠ ይሔዳሉ ይጠየቅልኝ የጨበጣ የዳረጉ የሚሮጠው የቴሌው የስዎን የቀላቀለ የተራራ የኮምፒዮተር የሚከራከር የደከሙበትን የኣሜሪካ የሃብዴድ ያዝልኝ የፈንጂዎች የአገዳና የሃዋሳ የወታደሩ የተጠቀለለ የአርብቶአደሮች የተወጡት የተሰነዘረበትን የታደለው ይሸጋገራሉ ያልደረሰበት የከሸፈውን ይመስላችኋል የሚመጡና የተራቡ የፖፕ የሚያውለው የማይፈቅድ ያቀደችው ይቅርታን የሚደርሳቸው የታጠቁትን የጃንሜዳ ያስታወሱ ይግባባሉ የተጠቀሙባቸው የእስሩ የፈጠረባቸው የከልሉ የጃክሮስ ያልጠቀሰው የቦኖ የታፈሱ የተማረውን የተቀነሰ የጠየቁኝ የሆዴን የከፋውን የሌላቸውንና የችግሮች የሚተዳደርበት የእስራኤልና የመረጥኩት የኳታርን የመቆራረጥ የአካባቢያችን ይገጥመናል የተራራቁ የመንግሥትንና የአራዊት የተባለበትን የሚረዱት የሚያደንቁ ይኽንንም የሚሉትንና የከሸፈበት የገመገመ የምርመራውን የኤክስፐርቶቹ የኒው የአመክሮ የማዘዋወር የሚስተካከለው የጀት የእስላሚክ የእንክብካቤ የመገንባትና የማያከብር የሚኖሩም የምታገኝ ያላከበረ የጣሰው የሚያስፈልገውና የፀናው ያልተረዱ የቀዱማዊ የሎጂስቲክስ የአዲርቃይ የረሃብና ያዛባል ያሳርፋሉ የሴቶቹን የጎሳና የመጠቀሙ የታፈነ ያገረሸውን የታፈኑ ዮኒቨርስቲ ይነፈጋል ያረጀና የሚሰራጩ የኢትዮጵያውያንና የሚታሰብበት ያልበላ የኩሬ የሞከረች ያስታውሰኛል የሚያመነጭ የዜጎቹን ይዳስሳል የሚቆሙ የሚነቀፍ የከፉ ይቆማል ዮኡር የገማቾችን የሠጡትን የተነተኑት የናቴ ይጠብቀናል የደጋው የውግዘት ያለመቻል የሚበልጡትን ያገራቸውን ይገረሙ የነጠቀው ያለቀውን የተቃረበውን ያሰፈረችው የመግባታቸው ያፈራው የሚያወራ የራሱንና የባለቤቱ የራህማ የሥዕል የሽግግሩን ይወስደናል ያዘጋጃቸው ይኖርባችኋል የግላችን ያጣነው የተጓጓዘ ያባይ የጭስ የውጊያውን የተጠበሰ የምንኩስና ይደመጥ ይቀበሉ የባሕሪ የአልበም ያልተገደለ ያጋጥማቸዋል የልዑክ የተከሰሱትና የሚያሲዝ የዘገነ የሚረሸኑ የሕገወጥ የሚሰራጨውን የሚመርጥበት የከፈልነው የመጠጥውሃ የተገለፀልን የዕዝ የብቸኝነት የሚያመርቱትን የሻጭና ያስገረመና ይሰፍን የቦስተኑ የሸቀጣሸቀጥ የአበዳሪ የሚያጠቃው የካፒታልና የማሊው የቀረበትን የሚገዛውን የሜቲዎሮሎጂ የማከማቻ ያረጋግጡ የተጣበቀ የፕሮፓጋንዳው የሚመራባቸው የተቀጠረ የሚዳርገው የኔታ ይረዳኛል የመኢአድና ያልዋለው ያቀረቡትና ይጠባበቃል ያደረገልን የምታውቅ የሚያጠፋው ይወራ የታገለው የማያገኝ ይጠቅመዋል የህዝብንና የሉበትም ያሳዝናሉ የሚታገሉትን የኤሌክትሪክና ይተካ ይታረም ያሰማራው የሚንገላቱ የአሚሶም የማይገኙ የወንዶገነት የቄሳርን የአስመራና የተጠርጣሪዎችን የሚመታ የሚበቃቸውን የማነቃቃት የሙስናን ያልቅ የሽሬ የይውረዱልን የተረጂዎቹ ይቆጨዋል የያዛት ይሮጡ የተሣሠረ የተበሳጨው የጠራና የዲያስፖራ የተገፉ ይፈቀዳል ያልታቀፉ የቆምነው የኤድስና የተካረረ ይተርፋል የቴክስታይል የሚገልፅበት የአንበሳው ይግባኙን የእናቱ የቪዲዮና የካቢኔውን የገነነ ይዳረጋል የተጠናቀሩ የአሥመራውን የሕጉን የወጣበትን የሕውኃት የተወረወሩት ይወገዳሉ የኮሙዩኒኬሽንና የፓኬጁ የሚከለክለን የሚመለከቱበት የሚታይበትን የኢተፖድኅ ይወዱ የምንጎዳው የመድሃኒቱ የሚማቅቁ ይገፋሉ ይነጋል የሚያስችሏቸውን ያቀረቡበት ያበረከተላቸው የምናውቃቸው ያልበሰለ ያልተፈታ የማስታውቂያ የረታው የሚገባውም የከለከለ የሚማቅቁት የምትሠራ የምፈልግ የካርቦን የሚያስቆጭ የጀግኖቹ ያጋጥማቸው የሚካፈል ያልቻሉበት የሚናገርለት የኤስኦኤስ የታክስና የምሁራንን ይተገብራል የንግሥ የፈረሰባቸው የዛልአምበሳ የካኑ የመተጋገዝ የተከሰሰበት የግብሩ የሾመ የረሱ የተቀመጠች የተለመዱት የሩጫው የምሽታቸውን ያጋጠመኝን የምላችሁ ያስችላቸው ይጠጡ ይሰሙ ይደበቃል ያመነባቸውን የተቆጠበ የሚሸጡበት የሚነግር የማካካሻ ይሏታል የይዘት የአዋቂ ያሰጋቸው ይጋለጣል ያስፈልጉናል የግብፃውያንን የለጠፉ ይግለፁ የዲያስፖራውን ይፈራሉ የሚቀጥልበትን የሚያቅተው የብአዴንና የተገደደ የተሰማራችሁ የተሸጡ የቅጅና የተገነባችው የጣለችውን የረቀቀው ያለፋቸው ይመረጥ ያለመቻላቸውን የደደቢት የሚመለከቱና የተገደለውን የገዳሙን ይጨቁኑ የማስመሰያ የሆነቸው ያላችሁትን የካሪቢያን የሚጋጭና የሌላውም ይራዘም የ