ተቿቸዋል የተመኙት ያወቅነው የሠብአዊ ያልታደለ ያክላል የሚያቀርቡበትን የእውቀትና የመምታት የጋምቤላውን የቻነል የሚሳተፉበትን የኤርትራውያኑን የጥላሁንን ይፈጸም ያልተበደለ የሚጠጋውን ያረካ ይሰሩበት ያከናወኗቸው የታዘቡ የሚያሰችሉ የአፍሮ ይለው ያፈራውን የሱዱኑ የነፃነታችን ያሰብነው የሞቱም የሚመዘነው ያሸነፈችው የኮሎኔሉ የመንግሰት ያያቸው የገላ የዘረጋቸውን ይከታተላሉ ይመሰረትባቸዋል የመቀልበስ ይላካሉ ያልተዘጋጀ የሞቃዲሾው የድንጋዩ የተዘጋጀለት የእኩልነትና የቅዱስነታቸው የድረስልኝ የገብረ የመሪው የፀጋዬ የናፍታ የሻምፒዮንነት የሚሊዮን የዘመነ የምትፈልጉት ይውጠን ይኸኔ የወባን የምንመራው የስእል ይስሩ የወሰኑትን የሸምበቆ ይገለጣል የክብርና የሜጀር የመመለሻ ያላስደሰታቸው የቤቶቹን የመቅደሱን ያሻቀበ የአገልግሎትና የማስገንዘብ የተቃወሙትን የናቅፋን የጡንቻ የመውለድ ይዘታቸውን የሠሯቸው ይሄንም የሚገናኙ የሚታደርገውን የተሸኘው የሚጠሉት የከተተው የሃገርና የተገለጸበት ያጡትን የባላቸውን ይሞከራል የማቅረብና የመምረጥም የድንጋጤ የሂደቱን የመረጠበት የህዝቡና የአባቱን የአውሬነት የየክልሎች የኖቬል የማስገባቱ የሰሩበት የሰጣችሁ የሠነድ የአሶሴሽኑ የንጉሣውያን የምታሳየው የፈጸመ ያለሴቶች የሚጠይቃቸውን የኢትዮጵያውን የምትወደውን የባለሞያ የምዝገባና ያጣችው የያንዳንዱ ያልታጠቁ የምሽታቸው የማይረሳና የተገለገሉ የሚጥሉት ይዛመታል የቄራ የሴካፋን የመጠጥና ይስጡ ያሰባሰብነው የዘገበችው የድምፅና የተመረጠችው ይደረጉ የቀሩና የተራ የተሰባሰበ ይመለከታሉ የማነብርሃን የደረሰውና ዩኤስኤአይዲ የቀረችው ያደረሰባቸው የተማረኩትን የተከፈለባቸው የአክሊሉ የማሳለጥ የማህበራትን የድብብቆሽ የተከሰስኩት የሚተዳደሩና የሚመሳሰለው ይሰለፋል የሚካሄዱበት ያወጡታል የተነሣውን ያወጣሁት የሾርባ የምልልስ የካህናቱን ያሁኑን የማሟላትና የሶሻሊዝም የቴዎድሮስን የሚጠረጠሩት የፓርቲያቸው የተራገፈው ያልተጠና ያሕል የጉዲፈቻን ይጣራል ይከተሉ ያልተፈቀደላቸው የክህነት ዩኤስኤ ያስያዙት የሚመላለሱት የጥፋትና የጎንቻ ያልታወቀውን ይልቀቅ የተሳሳተና የመጋራት የተሰለፉትን የተኙት የጾረና የተያያዝነው የኢሣይያስ የማፈን የመንገዶችን የሚቀበላቸውን የታሠረ የሚረባ ያወቅኩት የክትባቱ የሚገኙባቸውን የፈጠረችው የመሰረቱትን የሚነዛ ይጽፉ የማዕቀብ የቶሽካ የማይታለፍ የቅንጦት የማያይ የማጠንፈፍ የዉሃ ያሰብኩት የተስማማነው የወንበዴዎችን የወጋ ይላኩ የማካለሉን የነገውን የወረርሽኝ የየክልል ያገራችን የሚንቀሳቀሰውና የጥንካሬው የሠፈሩት የተነጠቁ የደረጉ የማይረሳው የሶማሌያን የሚያደርገውና የአገሪትዋ የአባላቱና የሚወጣበትን የተቀመጡና የወገኖቻችን የተመረዘ የጌታቸው ይሆነናል የብርድ ያወድማል ያድጋሉ ይተዋወቃሉ የምንማረው ይከፍሉ የሚያነጋግረን ይዘፍናሉ የወሳኝነት የሚያርፉበት ይጠይቋቸው የታለመው የቀደመው የተቃጠሉት ያቀደችውን የሚጠባበቁት ያስቻሉ የቀበሌዎቹ የሚያስተካክል የማንበብ የማይገባን ይታወሰኛል የአሰሪዎች የሚዲያዎች የምንጀምረው የዛሬማ የፀሎተ ይክዳል ያስቀመጥነው የአለባበስ ያንሳቸዋል የምርጫና የእድሉ ያደመጠው ያስተማሩት የአይፌክስ ያስታውቃሉ ያለፈበትን የሚያስተዛዝብ የምትወደው የመለስተኛ ያነሳኸው የመናፈሻ የወለኔ ያልተካሄደበት የሚሰቀጥጥ ይላታል የሚያስጨንቁት የዉጭ የቀለለ የንዌር የሚኬደው ያልተደረገባቸው የህብረተሰቡና የሥቃይ የምንወስነው የቀደመ የተዋህዶ ያሁሉ የቤተመንግስት የማንቀሳቀስ የሻዕቢያንም የቀረበን የተሰማኝን የባለሥልጣናቱ የኢስላም የአንትራክስ የተመላሽ የሚትባል የሚያሰረክብበት የሻከረው ያራዘመው የተጫወተ ያስፈፅማል የቀናት ያደረገኝ የሜትሮሎጂ የከለላ ያስከስሳል የኦባማን ያፋጥናል የተከሰተውና የተጠየቀበት ዩኒቨርሲቲውና ያገቡ ያገባ የዶኒ ያስተዋልኩት ያከብሩታል የማንገላታት ያለስራ ያደርግለታል የታመነበትን የዲማውን የሚቻልባቸው የዝምታ የከፈለውን የማይመሳሰል የማታለል የሚቀርብበትን የማኦ የዳያስፖራው የአገሮቹን የባለመስመር ይወድቃሉ የሚሻሻል የሚፈልጋቸው ይመደባሉ ዩኤንዲፒ የሚያስወሩት የተጣሉና የሚደመጡት ይጠበስ ይሰበሰብ ያቆየን የመኖሩን የማይገባቸውን የሚጠብቀን የተሰብሳቢው የመለወጡ የሚፍጨረጨሩትን የድንኳን ይከፈላቸው የሚያድስ የዕብድ የፖርት የሚያበስር ያለደረሰኝ የጡመራ ይከበራሉ ይፈነጥቃል የሚሉበት የግሌ የመርከቦች የቀራት የተሾመ የጸዱ የዛላንበሳና ያስነበበን የመግዛትና የሚስቡ የማጣራትና የመጥራት የተፈጸመበት የማቋቋሙ የሚጨርሰው የተደረደሩት ያለመረዳት የጣሩ ይልቁኑም የትዊተር የሚያስገነዝቡ የወገኑ የኤጀንሲዎቹ የሚያስለቅስ የየመንና የማረም የግቢ ያወጣውና የተለምዶ የድርጅትን የዋካ ያለቀላቸው የጌጣጌጥና ያስደነገጠው የጎንደርና ይቀርብበታል የአጸደ የከፍታ ይቻለን የአካዴሚው የዘገየበትን የታጩ ይባርከው የምናነሳው የኒሻን የዋዛ ያመች የማረጋገጥና የቀረነው የፀሃይ የሚታማው የቤተክርስቲያናችን የተማርኩት የሚቀፍ የተሞላች የግብጽን የተባለውንም የተሰደዱትን ይቁጠረው የክላስተር የዳልጋ የሚደርስብን የአብ ይመረምራል የቀለጠ የሞሮኮ የነሳው የማስመዝገብ የጥበብና ያመረቱት የታመነና የኦክስጅን የሚገነቡበት የማይችሉና የሚሞግቱ የገጠመኝን የአመልካቾች ያከትማል የምሣ የተማሩና ይኖርበት የፍልሰት የአንዋር የላየንስ የሚጥሩትን የማስቀረት የቱኒዚያው የሃድያ ያደረጓቸውን የሥልጠናና ይሥራ የወጣቷን የማልችል ያማርራል የህፃን ይኾን የተመላላሽ የሚያስጠሩ የኢሮብን የአስተሳሰብና ያስመዘገበችውን የሚጠሩትን የኤርትራዊያንን የሚያካሂዱበት የአዲ ያስችላልም የሚያዩበት ያሳዘነና የተባባሩት የጓደኝነት የሁለተኛነት የመውጣቱ የኛዎቹ ይገደላሉ የመታዘብ የምልጃ የቅርስና የእንግሊዝን ይበዛበታል የተቀናበረ የመግፋት ያወጁ የተጎዳው ይትመተር ይነገራቸዋል ያለውስ ያወርዳል የምንወደው የታነፀና የቤተመንግሥቱ የኢንፍሎዌንዛ የዶክተሩ የጎጂ ይመለከተኛል የጽንስ የሚዘልቁ ይተዋል የመሰለፍ የደረስን ያሰፋል የጋዜጠኞችና የሚተኮሰው የሚጎዳቸው የሚያካሄዱ ያሳየበት ይፍረስ የብልሹ የላይኛውን የሚደበቅ የታጠቁት የተጠቀሙ የታያቸው የምንዋጋው የገመተው የተጠቆሙ ይወጡና የሚያስተዳድራቸውን ያዋቀረው ያሰረ የተቀዳጀ የሚታወቅና የዘረኝነትን የሚያሰራጩ የመላቀቅ ያገኛትን የምርታማነት ይጣላሉ ያልተበረዘ የሚሠራባቸው የመጭው ያስቸገራቸው የደደቢቶች የኃይለማርያም የሚያንቀሳቅስ የሚወገዝ የዘረዘረ ያሰቡ የተረሳ የሚለቅ የሚዘገንን ያደርገኛል የፍላጉታችንን የጉሊት የሁዋሊት የተነካ የምኒስትሮች የአስክሬን የሚወገዱ የአውራጃው ይያዙ ዩኒየኖችና የወንዱ ይጠገናል የግእዝ የተደለደሉት የሚታይና የቀጠና የደገመ የአጋዚ የታማኝነት የሚያበሩት የማይሻር የሚያድጉ የመከራከርያ የኮንክሪት የዳሽን የወረደውን የግጦሽና ያስወጣው የሚቆጠሩና የሙስሊሞቹ የሰጣችሁን የሚያሻቸው ያረቀቀው ያልተወሰነ ያስፈራል የቆጡን ያልተሰደደ የበይ ያስታውሱት ይታሰብበት የሚወከሉበት የሚተጉ የፕሮፌሠር የህወሃትን የሚቀርብላቸውን የስስ የሚያዝያውን ያረገዘ ያልተባለ የአይኤምኤፍ የሴፍቲ የአመት የማላውቀውን የሰፈረበትን የማያስቡ የሚገጥም የተወለደችው የሐበሻ የስብ";
            amharicWords[22, 9] = "የሻኪሶ ይቀርፋል የሐያት የቶጫ ይገለገሉበት የማጥቃትና ያወግዛሉ የደበደበው ያልነበረና የአዳማው የጸደቀ የቀርቡ የምንጓዘው ያገኛችሁትን ያተኮረና የመታወቂያው የካፒታሊዝም ይመልስ የማያምኑ የበለጠና የወረደበት ይጋራሉ የምንችልበትን የምናስተላልፈው የሚያሸንፈው የመጭውን የሚመዘን የአዝዕርት ይደረግና የሚኖርን የደገኛ የአስተራረስ የማህሌት የካህናትን የገቡትም የፔፕሲ የሞቱበትን የሚጥሩት ያገለለው ያዳምጡ የስፔይን የደብረብርሃን ይነበባሉ ያጌጠ የፍላጎት ይንን የምትጠራው የተከታታይ የጠቀስኳቸውን የመሰነጣጠቅ የቆማችሁ የሃይማኖቶች ያስገባሉ የአይዲድን የአሰሳ የታጣቂዎች የሚሰራጩት የዴሞክራሲው ያባቱን ይተዳደራሉ የአአድና የወጭና የተፈናቃዮችን የሚገልጹበት የታመቀ የኢጣሊያንን የተነሳሁ የመዘጋጃ የሚያስገባቸውን የጥፋቱን የማንቸስተር የሚያምኑበት የቆሰሉትን የሚገኙትንም የበታችነት የሚያስከፍል የሚያዘጋጁት የአክራሪነት የወሮታ ያስታውሰናል የተደመሰሰው የብርጋዴር የተቋረጡ የምትሆንበት የተማከለ የኳራንቲን የከሸፈ የኢሮቦች የተዳረጉበት የሚቆጥር የሸሸውን ይሰውረን የሽማግሌው ያሳለፋቸው የተገነዘበ የተጫዋቾቹን የተከሳሽነት የምትችልባቸው የቢን የሠጠው የኮንግረሱ የተሰረቀውን የፈለግሁት የአቶም የቀረበብኝ የምዕራቡን የዋሆች የመድረስ የሕፃናትና የማይሆነውን የሚዋጉት ይሀንን የሚኒስቴሩን የተረፉትም የሚቃኝ ይቻላሉ የሚጠሉ የሠጠ የቀረቡበት የተወዳደረው የመረዳት የፖሊሲውና የመለየቱ የሚስማሙት የገለፁትን የመጋዘንና የሕይወትን የቋንቋዎች የማህበራቱን የማይቀረው የሚጠየቀውን የኮሎምቢያ የትራንስሚሽን የሚያስችለንን የእጩነት የደገፈው የሚተማመነው የጥያቄው የኢጋድን የባል የመጠለያው የጣለበት የዘሩት የሚችለውና የጸጥታና የሚያመርተውን ይቀይሳል ያማክሩ የኮንፈረንስ የተዋጡ የሚቀመጡበት የማስቀየር የውጥር የሚያውሉትን ይጋለጡ የመጋባት የደህነንት የሚያሳውቀው የሚገፉበት የሚወጡና የምንባለው የማይደረግለት ያለመፈለግ ይቆዩና የተቀመጠበት የሚያልፈውን የማዘዣ ይሰፍራሉ የሕዝብንና ያፈሩት ያምን የሻዕቢያንና የማስቀየስ ያልተገኘላቸው የክልላችንን የሰጠኝን የደረሰኝ የባቱ የባቲ የካሴት ይፈጥርለታል የተዋጣላቸው የሲቪሊቲ የምንጠቀመው የፕሬዚዳንትነት ዩኤንኤችሲአር የመተሳሰብና ይመከራሉ የያዘና የወጠነው የጋናው የያዘን ይሰደዳል ይከኣል የሲድኒ የፍራፍሬና ይዘጋ የተፎካካሪ ይካሄድባቸዋል ይመስረት የታየውና የሚገፉ የክብሪት የሚገደሉ የማይጠይቅ ያቆማል ይተኩሳል የሚሸጡበትን የፕሮፌሰሩን የባህርዳርና የምትችልበትን የምንመለስበት የፌስቡክን የተከለለው የገፈርሳ የሚጠና የደርባ ያልወገነ የባህርዳርን የተዳከሙ የመረጥነው የተሰቀሉት የለቀቃቸው የሠላሙ የሹመቱ የተገለሉትን የምትወስደው ያመጣብን የተፈጸሙት የምትኖሩ ይመሠርታሉ የሚሰማራው የዩኒቨርስቲዎች የተገፈፈው የሚያመቻቹ የተከተላቸው የሶስቱን የኦፔራ የእስያና የአሰፋ የፈጠራና ይመሠርታል የሌና ያበሩ የሚሸጋገር ያስቆጥራል የለቀቀና የኡሁሩ ያስገርመኛል የይርጋለም የሚጎበኙ የአቅማቸውን የቢቢሲን የነበርን የጫጉላ የአገሮችን የማልፈልገው ይወረሳል የጃትሮፋ የፓስፖርት የድንጋጌው የመረዳዳትና ይታወቁ ያስገኘለት የኖርሽው የአልቃኢዳ የሙሰኞች የመፍጠርና የአለምና የተፈጠረን ያመለከታል የተበየነው የፀፀት የመገዛት የትላንት የተዘዋወሩት የሰራተኞቹ የትዕቢትና የተመለከትን የስንፍና የነበሩባቸውን የቀዳሚነት ይዘናት የአባቴን የአቤቱታው የተቀዳጀውን ይደነግጋሉ የፍስክ የሚፈታበት የማስፈታት ያነጋገርን የማስተላልፈው የመረረው የአመራርነት የእኛንም የማንፈልግ የሚዳኙበ