ገደዱበት የሚጠጣውን የባዮግራፊ ይቆጥራሉ ያለመረጃ የተከሰስነው የኢትዮጵያዊነትን የታሰበለትን ይስፋፋል የተፈራረምነው የሃይሞኖት የሚያጠፉት የሚሰደደው ይወቀው ይታወቃልና የተነጠቀችውን የመያዛቸው የሚያመለክትና የታዘዙትን ያለዕረፍት የአፍጋን የኢንዲያን የተሻገሩት የበተኑት የመገልገል ይዘረዝራሉ የተከፋፈሉ የውጪው የአናሳ ያበረከተውን ያለአንዱች የሰለቸው የታዘብነው የሚመስለውን የሚያደርግላቸው ያስፈልጓታል የሬሣ የበይነመረብ የማያስደፍር የተገለጹትን ይጥል ይለውጠዋል የሚዘረጋ የተሳለጠ የሚያደረገው የተሻላ ይዘክራል የማይጨበጥ የተከሳሹን ይሆነው የምትታወቅበትን የተደበላለቁ የረሂማ የጀብደኝነት የዛኑ የሚጥለውን የመጽሐፉ የካሮት የማይፈቀድ የሚያግዝና የአርኪዮሎጂ የአምራች የራፕ ያለፍቃድ ያሳለፈችው ያልከፈለ የሆነም የመንግሥትነት ይተርካሉ ያልተመለከተ ይበላ የፐሮፌሰር የተዘረፉትን ይሰጋል ይተቹታል የሞናኮ የትላንትናው የሚመጡትንም የተራዘመው የዋጋው የቁማር የክለሳ የተቸገረ ያስነሱ የሰጡና ያካሂድ የተመረጡበት ያዳመጡ የተባልው የሰላሳ የቀረኝ የአሸኛኘት የአስመራውን የሚመጣዉ የጨመረውን የሃረማያ የመተማ ይጀምርና የሕወሓቱ የሚያስገኘውን የሰርጉ የወረሩት የማይለቅበትን የተቻለንን ያልታደሉ ዮኡ የደቡቡ የተተከለውን ያስተምሩ የምዝበራ ያስመረቃቸው ይፈጸሙ የኢትዮያን ይምጡና የተስፋዬ የኢህአዴጉ ያለመታወቁ ያላቋረጠ ያእልው የጠያቂዎቹ የተጀመረዉ የህገመንግሥት ያሰኘዋል የሚያካልል የትዕቢት የእጩዎችና የፕሪሚዬር ያለነውም የኢሳቅ ይለይ የተረገመች የተነገረለትን ያልተሟሉ ያወቅሁት የመመዝገብና የተሾሙበት ያጣሁበት ይቀይረዋል የሚያሳጣና ያለርህራሄ የበኩሌን የናይሮቢው የክልሎቹን የዘመተ የምታገኝበትን የጠላው የኤልያስ የአከባቢ የሎሳንጀለስ ያለዋስትና የፀደቀበትን ይብዛም ያማረረ ያደረስኩት የመደቡት የአደን የተዥጎረጎረ የጣሉትን የቅራኔ የተወለደች የተነሱበት ያልጣማቸው የሚያፍን የጋዜጣዊ የሴፍቲኔትና ያሰናበታቸው ያንፀባረቀው ያለብዎት ያለመደረጉን የማስቀጣት የተላከላቸውን ይሠራበታል የሁቱ የሆነኝ የሚያራምዱትን ይጠመቅ የተመሰረቱና የሚያሻሻል የስልጤን ያሻቅባል የኢህዴን የሚሰነዘርበትን የሚያጣው ይረዱታል የአጻጻፍ ይጥፋ የኮስታሪካ ይስቅ ያቀረበውና የፈጠነ ይኸዉ የአዳዲሶቹ የእንደራሴዎች የወደብና የሲዳማና የተቀነባበሩ የሃዲያ የኛም የሳፋሪ የሚሰፍር የምርኮ የተገለፁ ይሉኝ የቆምንበት የሚያስችሉት የሚያርፈው የማዋቀር ይጠይቀናል የማይገኝላቸው የቃና የቀኑን የአለማቀፉን የአማፂያኑ የሚያራግቡ ያልቻለውን የብፁዕነታቸው የሚለቁት የቤተሰብና የተሰኘችው የተጠቀመችው የሁዳ የፈጠርኩት ይፈላል ይወጉኛል የብሉይ ይዞታችን የተስማሙባቸው የስሚንቶና የማደርገውን የሚናገራቸው የሚመጡበትን የሚላኩትን ይመቻችልን የግዜር የማኅበረ የተሰማን የአፍዴር የማያደርገው የመንግሥትንም ያደረጋችሁትን የሞኖፖል የመደቡ የኡጋዴን የሚያገናኘን ያልተቀናጀ ያመጡና የሚያሰጋው የተጨናገፈው የምትፈጽመው የዳኞቹን የማይገባትን የሚሰጣት የሚረከቡት የሚጣሉት ይገድባሉ የቴክኖሎጂውን የጨረሱት የዩኒስኮ ይታፈሳሉ የማሳሰቢያ የአሉላ የሚቀናን የቲኬት የመራ የአውሬው ያልሰጠበት የተስፋፋ የጋዜጠኝነትን የመረጥናቸው የተንጠለጠለ የሚቀበለውን የሚያስተባብሩበት ያዙት ይበራሉ የጎለበተ የአብዲ ያዘጋጇቸውን ይኖረኛል የባንኮቹን የዝና የብስጭት የአድልዎ የአስመጪነት የቄስ የዘገቡትን የአወሊያን የበቁትን የንፁሐን";
            
            amharicWords[23, 0] = "ያልተራበ የተጀመረውንና የምናገኘውን የተገነጠሉ የሚያጠፉበት ያኖሩት የሚያጋጭ የመጠምዘዝ የሚያቋርጥ ያልቻለበት የወረዱትን የሚነገርው የሚከፈልበት የጤነኛ ያሰፈሩ የድሮውን የተጫወቱና ያልተፃፈ የሚያጣጥሉ የያዙበት የማፀደቅ የፍራንክፈርት የማይጠቅሙ የሚያኮርፍ የተወሠደው የወጋህታ የሚሰቃየው ያጠነጠኑ የሚያሰችላቸውን የሚዘክር የወደሙትን የገለፀላቸው የቤቴን የዕብራይስጥ ያደረጋችሁት የተዘዋወሩ የተሣናቸው ይሰጣት የቆላማው የድራማ የሚያጠናው የምርመር ያልተደበደበ የነገሥታት ያቀኑ ያቀና የሆናቸውና የካህናቱ የምናነበው የፍጻሜ የአብላጫ የማወክ ያኮራ የወሩ ያስተዋሉ ይማርካል የሚያውቀውና የተደበደበው የጣሉባቸው የሜትሮዎሎጂ የገፉበት የሚሆኑትና የካህናቱና የሮማን የመኪናዋ የብሄረሰቦቹ የሚያቀራርባቸው የፈቀደላቸውን ይሆናቸዋል የመዋቅሩ የጠላ ያደክማል የተነሳችው ይገጥመዋል የታሰሩትና ይካሔዳል የሚገምቱት ይፋለማሉ ያቀዱ የሙሴ የቃጣው የደረሰውንና የታገለ የጋበዘ ይጎዳሉ የሚቀርፍ ይፈቀድላቸው የሰየሙት የሚገባኝን የሌብነት የስበት የሆኑባቸው ያነባሉ ያቁሙ የበደሌ የሚያስቅ የሚንቀሳቀስና የሚደርስብንን የሮማው ያዕቆብን ያለመሳተፍ የሚሰየመው የቀጠናውን የኦህዴዱ ይባላልና የጠቡ ይፈፅሙ ያስተባበረው የአምባገነኖችን የሚያስከፋ የሸማኔዎች የሚማሩት የርቀቱ የብርን የዐረብኛ የተነሳሁት ያሰማል የተወለዱትና የላካቸውን የተጻፉትን የተካፈለበት የማይታወቅና ያስመጡት የማዕቀቡ ያናጋው የማይሰጡት የቅቤ ይፈቅድ የማይወጣ የሚጨብጠውን ያስፈለገበትን የሚወገድበትን የቃኘው የሌለባት ይሔንንም የተወረወረች የኢዴአፓን ያሰማሩ የጨርቅ ያስመሰከረ የከሰሱት የወግ የመሰለኝን የዉል የተፈጠረባቸው ይጠቅማቸዋል የዓመታት የሚሰበስበውን የኳታሩ ያልተዘጋ የተደነገጉ ያሳልፉታል የሚፈፀምበትን የምታበረክተው ይንፀባረቃል የማይወሰን የክርክሩን የባለሀብቱ የወጥ ይታውቃል ይሻለናል የሚሰራበትና የተመለከትኩትን የማሰማት የምንጊዜም የመራጭ የሚያስበውን ይቃወሙ የኮተኑ ይሟገቱ የተለየች የሚፈቱበት የተመዘበረ የሚሰራበትን የተከፈለበትን የፈለሱት የታገቱ የተወሳ ይወነጅላሉ የሚገጥማቸው የግብፅንና የማያሳይ የሃሣብ የጥቃቱን የሰሉ የደፋር የጥሩነሽ የሚጽፉትን የክሊንተንን የተመለሱትም የሰጣት ይሆንለታል የሚቆጣጠርበት የድርሻችን የሚፈጀውን የግሌን የጠላቶቻችን የቆሎ የሚባለውንም የስፔኑ የታቦር የሰራነው የዘመናችንን የሹመቱን የጠፉ የሚያካሂዳቸውን የመታሰር የማይገባቸው የሟሟያ ያልተደረጉ የሚያስተዋውቅና የተጠለፈ የተራቀቀ የሚያስገድደው ይዘፍናል የተጠለፉ ይስተናገዱ የየትምህርት የምትደግፍ የምፈልገዉ የተባሉትንና የኢጣልያው የተሸጋገሩት የፋሺሽት ያቀረቡአቸውን የጎብኝዎችን የክሽፈት የታጠረና የታለመውን የአምባሳደሩን የሚገደደው የእልህ የማቅረቢያ የቀረበት የሌለህ የፈረመው የአሸዋ የሕገመንግሥቱን የሺሃረግ የላቸውን የአገራችንና የውዳሴ የፍቼ የሰምሰንግ ያልቃሉ ያካተታቸው የፕሮሞሽንና የሲአን የየአገራቱ የትራንስፖርቱ የሚያደረጉትን የማይገባኝ የመከበርና የአገራዊ ይዘውታል የለበት የጋዛ የተፈታው የቀሪው የሚሠማሩት የማይሳተፍ የዳበረች ያስቆጠረና ይበሉና ያደረገች ይመታሉ የእንግሊዟ ያደርጋቸው የማይስማሙ ያለወደብ ይመታል ያላሰበው የስደተኛው የማይለየው የሚጓዘውን የእነዚያ የዶሎ የጥንካሬ የሚጠቀምባቸውን የኮሚሽነሩን የምትሉ የፈረሰው ይሁነኝ የሚያስችሏትን የአዋሳኝ የታገቱትን ይወዱት ይጣጣማል ያልወሰዱት ይደርሣል የሚያግዳት የዶር የወሰድን ይሳተፍ ያስጀመሩት የልቀት የማይረሱ የሚፀድቀው ይጠረጠራሉ ያልቀረበላቸው የቁፋሮ የመለካት