            amharicWords[23, 1] = "የተጠቀምኩበት የሚጠበቅብኝን የዓለምገና የገዛሁት የሚቀሰቀስ የተመሰረተችው ያሰፈረች የመካኒካል የሚያሳልፋቸው የኋላቀርነት የጥቂቶችን ያተኮር ይደራጃሉ የትራንሱ ይልሻል የበቀልና የከሰረ ያለዎትን የድበር የራዲዮሎጂ የስኬት የላቸውምና የሰውነትዎ የተፈረጀ ያንድነት ያልተመረጡት ይደራጃል የተማርኩበት የመሣተፍ የህዳሴው የተጠመቀ ይስሐቅን የተወረሱት የሂደቱ የሚጋሩ ይገታ ያልተጠቀሰው የሚጋራ ያስቀምጡታል የሚያመላክተው የልኳንዳ የጎሳን የብይኑ የመመሥረቻ የብይን የሚቆጣጠርና የሚያስተናግዱት የሚደርሰን የፈፀሙና የቻሉትም የማይመጣ የሚጮህ የተወገዱትን ያብራራ የታወጀ የገለጸች የማድበስበስ የተካነ የናሳ የተካኑ የሩፋኤልን ይሻላቸዋል የእምቢተኝነት የፍራቻ የከፈሉበትን የሲጃራ የመዋጋትና የማገዝና የመጠቆም ይሽራል ይዞዋቸው ይላቸው ያገናኘዋል ይዘገይ የኤክሳይዝና የሚመሯቸው ይጨምር የፍሪያስ የሚሸለሙ የሸኾች የሚሆናቸውን የምትመደብ የዘራው የአቅሜን የራሳቸውንም የምትሄደው ይርአ የመብራቶች ይቆማሉ የሚገነቡበትን የፓርላሜንታሪና የማትመለስ ያበቃላቸው የተነዛው የተከፋፈለውን የአመቱን የምስር የመሾም የመልክዓ የፍቼው የፈረደ ያገታቸው ይበጃሉ የማምጠቅ የፈለግኩትን የሚያተኩርባቸው የድምበር የአህጉራዊና የምትጠይቀውን ያሰብነውን ያስደስት የሰራነውን የተመዝጋቢው የህትማማችነት ይቀጥላ የመቀያየር የአቡኑ የሚሞቱትም የሻዕቢያም የያሶ ያሳጣቸው የሚዲያው የምትነግረኝ የእመቤታችንን ይደግሙበት የኖርዝ የማገድና የማምታታት የፀደይ የማንቋሸሽ ያልተሻለ የሚያውጣ የካምብሪጅ የሚቆጠርና ያውቁታልና ይቸገራሉ የማድሪድ የሚደረግላት የመሣሠሉትን ያልበቁ ያላገናዘቡ የሚፈርስበት የክሬዲት የአንድነትን ያስመሰግነዋል የአስጎብኚ ይቸገራል ይርዳ የምንቃወመው የተሰሩበትን የማይበጁ የአዳምን የታገሉትና የመባረራቸው ያስተላለፋል የምትጠብቁት የትክክለኛ የተጓጓዙ ይደመጡ የናዚ የሚዘግቡት የሚጣልበትን የተፈጠረባቸውን የአቡጊዳ የሚመታበት የአምባሳደርነት ያስተላለፈበት የዛላምበሳን ይካአሎ ይገቡኛል የባሕሩ የወንድወሰን የመንደፈራ የነፃና የተዳከመው ይደመድማሉ የሚያደረስ ይጓጓዝ የአዲስና የሚከለክላቸው የተጓደለ የሚያምኑበትን የሙገርና የደረስኩት የተካሄደባቸውን የነርስ የሉሙምባ የእርቅን የሙግት የተቃኙ የሚገልፅና ያክሉበታል የማድመጥ የሚፈጸምን የሚያስይዙ የሚያባርር የተጎናፀፈው የምትመደበው ይካሔድ የበሽታና ይዳን የሥፍራውን ይዛቸው የተንቀሳቀሰበት የሚደግፉትን የተለያዮ የጠራራ የሚጥሉበት ያውካል የሠለጠነው የሚናገሩትና የጭፍራ የጥቅል የምናበስርበት የለወጠው የሚገታው የሚያወግዝና ይዘንብ የሚታረደው የተቀሰቀሰውና የኢንዱስትሪዎችን የፌዴራልም የተገነው ይሉኝታና የሽብርተኝነትንና የቱርክና የማይገጣጠሙ የመረጠችው የፍጥነት የተሰጠና የኮረምንና ያሳምማል የተደራረቡ ያመጸባቸውን ይመላለሳሉ የተባባሰው የአብላጫው የዶግማ የማሰሪያ የውንጀላ ያሰሯቸው ያልሽው ያስመጡ ይሠራዋል የረዥምና የሰለጠኑና የሚዘልቀውን የተጠሪ ያደርሰኛል ይሰብኩ የተቆረቆሩ ይካሄድበታል የመውሰዱ ያለከልካይ የሳምንቱን ያቀናበረው የማይተገበር የተላያዩ የኤምሬትስ የክርስቲያኑ የሼኽ የግበርና ያጋጠማትን የአይሻ የኦርቶዶክ ያግባባናል ያገኘናቸውን ያለፉበት የተነጋገረበት የከፈተለት ያወጀችው ያየሁ የመከለስ የሚጽፉት ያሰርነው የጎተራን የማይባሉትም የምግባረ ይራባል የዋስተና የታንታለም ያነብ የካድሬዎችን የተከታተሉትንና የአከራይ የሚጠባበቀው የሚጮኹ የሚያደገው የአምላኩን ይኖሩናል የመኢአድን የፉትቦል የምግባር የምዘፍነው ያደፈጡ የመቁረጥና ያቀረበበትን የአሜሪካውያን የሚመሩበትን የተለወሰ የማይታለም የታገሉለት የአረጋውያንና ያስተባበሩትና የሰደቃ ያየር ይሃሉ የሂዎት የሚታመንባቸው የተደጋገመ ይዞር የሚሻር የሚሻውን የተገመቱት ያለፈውንና የቤተሙከራ የተሠጡ የከረምነው ያልቻሉትና ያጣቅሳሉ የሚታከሙ ያስተጋባል የታመመውን የማክሸፍ ይመርመር ይህኛውን የእስራኤላዊያን ያቀብላሉ ይሙላ የእውቁ የውጥረቱን የኦጋዱጉው የመውደቅ ያልቻለችው የጨቋኝ የወያነ የተሸጠች ይጠይቁናል የሚገኝው ያደርጉበት ይተላለፉ የኔው የበሰለና የሚካሄደዉን የሚመረትበትን የሰራር የማረከው የእንግዴ የቀረበባት የሚዘነጉት የሸምጋይ ይሮጥ የሀገሪቷ የሚሠማሩ ያዘጋጀነውን የታሳሪዎቹን የአመልካቾችን ዩናይትድስቴትስ የአረብና የጠየቅሁት የጭፍን የሄይቲው ይመረት ይስጠውና የተደከመበትን ያፈረሰው የቅጥረኝነት የተሳታፊዎቹ የፈቀዱ የፃፈ የአድማጭን የዘምባባ የመሄዱ ያከናወንዋቸው የሚወረስ ያመጧቸው የማያቋርጥና የሚገልጹና የአይነ የጂን የመኾኒ የተረገጠ ያጠበበው የሚሸጡትን የምኞት ያረጁና የተመደቡበት የሕፃኑ የመጠቀሙን ይሙቱ የተፃፈና የትላልቅ የአህመድ የምትወስዳቸው የአዘቦት የማስደገፍ ይገመገማሉ የሚታወቀዉ የተፈለገውም የሚያበድረው ያክብሩ የሚሻሻልበትን የይግባኙን የሚያርስ ያላሟላ የግልፅነትና የሚለቁትን የፈነጠቀ የማይሆነው የክርስቲያኑም የተሰጣቸውና የሰጠኋቸው ያልኩትን ይጠና የከተማዋና የክርስቲያኖች የኤፍኤኤ የሄድንበት የባቢሎን ያዘጋጅ የትልልቅ ይነሣሉ የርስዎን የመተካቱ የግለሰቧ ያስተዋለው የመፍጨት ያነጋግሩን የሚታመነው ያለመኖራቸውን የመቅረጽ የምንታገልለት የመቆየቱ ይጠብቀኝ የሚስተዋልባቸው የሚያኙበት ያየነውን የንባ የሚሰነጠቅ የማያከራክር የማሪታይምና የባዛሩ ይፈቅዳሉ ይተረጉመዋል የቦነስ የሚቆጣጠረውን የለመደውን የአይዋ የተሠራላቸው የሚታየውና የመቅረፅ የምሥጋና የኃይላቸው የሚካፈሉ የማደሱን የኤግዚቢሽኑ ያልታወቁና ያባትና የሰፈነባትና የሚሻለኝ የሚቀራቸው የሚያደርጉትም የሚያስቀምጠውን የቀበረ የአገራትን ያቀነባበሩት የሚያስከትልና የወንድሙን የማናጋት ያበቃናቸው ይባክን የተሠራበት የጅቡቲንና የማይበርድ የቢጂአይ የፈርጉሰንን የሁኔታዎች የተሞከሩት ያገተው የከተማን የተገለጠውን የተጨነቁ ይበይናል የሚከለክለኝ የወረዳዎቹ የሲዖል ይሄማ የርግብ የካዱት የዘጉት የሚዛይል የመተሐራ የጥንዶች የኤግዚቢሽን የሚጓጓዙት የምናስበው የተሸለመው የሚያካክስ የቅይጥ የነፍስወከፍ የግራር የረሳ የነገይቱን ይደገፋል የተጭበረበረውን ያልፉ ያዘገየው ያጣጥሉታል ያልቀረበለት የቪላ የሊስትሮ የተስማሚነት ያነሳሳል የዋጠው የመጨቆኛ የተዘፈቀው የትልቁ የአሜሪካንና ይቆሙ የኤግዛማይነር የትልቅ የሚሰማሩበት የአፍሮሜት ይራዘምልን ያንጸባረቀ ይግለጽ የተከለከለበት የአንቺን ይጠፋ ያሳምናል የናቶችና የተንቀሳቀሽ የካደ የተሾሙበትን የዲንና የሚመለከታችሁ ያቀዳቸው የሚወርደውን የወሲባዊ የሚበተኑት የመጽሃፍ የማትችል የሚባለውስ የሬድዮና የጎንደሩ የሚድኑ ይድን የገጠሙትን ይዘረጋል ይደረግላቸው የሚዳኘው የፉከራ የግንዛቤና የባንዱ የመታገያና የማዋለጃ የሚልን የጥቆማ ይቃጠላል የመኮንነት ያወኩት የምትታወቅበት የጠሉት የጠፉትን የማጉላላትና ያፈሰሰውን የታረሰ የሚተቸው የሚወሰድበት የኦብኮና የቀሰቀሰ የተመለሱና የተጋቡት የቀሰቀሱ የራሣቸው የምትመራበት ይችላልን የኪዳነ ይጎበኙታል የብሥራተ ይዘግባል ያልደረሰባቸውን የገዛውና የሚሰፍሩበትን ይፍታ የምንኖርበትን የሚያስተላልፋቸው የገለጹትን ያመላከቱት የወረዳን ይገባና ይገባን የደኢሕዴኅ የባርካ የሚሰጡትም ይፈጸማሉ ይሟገታሉ የችግሮችን የሚከለክልበት የኮንዲሚኒየም ይጻረራል የተፈጠረውንና የሚያስለውጥ የዘሩ የ