በዳይን ያሳለፍኩት የባከነው የቀነ ያልተደረገው ያልፍልናል የሚነግራቸውን ይልዎታል የተመራጮች የተፈበረከ ያላሉት የፍላጎትና የማነጋገር ያማ የሸማቾችን የበፊት የማስገንጠል የሆንኩትን የተፃፉት የመፍተሄ የወያኔዉ የመረከብ የቢትወደድ የመሰከሩ ያረጋገጥን የባለፈው የሶርያ የላሊበላና የኮርቴክ የሚከፋፈልበትን የሚከፋፍልና የመነሳታቸው የታሳሪዎች ይዋጉ የማራገፍ ይዋጋ የህዝቡንና የሚላክበት የደል የተላከለትን ያስብላል ያኔውኑ ያንቺን የሚያስ የፀዳች የወሰደባቸው የተረፈውንም የከሸፈው የማይሸት የውሁዳን የሶላር የጎደሉ የመሰከሩት የእንዱስትሪ የታፈኑት የውሳኔዎች የሚበሉ የማይደረግ የሚመክርና የሔግ የተከፈተበትን የማስተካከያና ያሽቆለቆለ የሰራዊታችንን የሶማልያው የደበዘዘ የሚዘጋው ያነበብኩት የመገመት የመጋዝን የቀረፃቸውን ይጓተታል ያኢ የሰበሰቡት የተሸነፉበት የዓብይ የእግረኛው የቀነሱ የድርጅቴን የወንጌላውያን የሚያስረክብ የደሞወዝ የሚቀመጥበት የባከነውን የሚያካሄዳቸውን የተስፋፋበት ያውላሉ የተፈናቃዩ ያዉ የቆፈሩት ይንገሩኝ ያልታሰቡ ያዕ ያዝኳቸው የማስታውሰው የባሕላዊ ይለቁታል የዳንስ ያተረፈች ያደርግልኛል ያተረፈችው የሚያረግብ ያዬ የሚበሩ ያልተገኙበት የሚበራ ይሰጡኝ የጎበኘው የአሊያንሱ የኤክስፐርት የሚፈሱ ይሥሓቅ የሚታገዙ የኢንቨስመንት ይለይለት የነመለስ የምስራቃዊ የሚኮንን ያሸልማል የምናወጣው ያልከኝ ያጣብባል የተስተካከሉ የፈራው የሆኑበትን የሚሞክረው የሚያስተባብረው ያጤ የሚያናፍሰው የብሄረሰቦችን ይፈጠሩ ይግዛን የሚወያዩት የተጋባ ይጽፋሉ የመገናኘትና የሚበጃት የሚውጣጡ የነገራል የተደለደለው ይታደላል የሚሠነዘረውን የጸሎተ የመከተልና የሚያጋጥሟቸው የመተላለፊያ ያልሰጡት የማስተዋወቁ የሚያደርገዉን የውለታ የሚፈጥርባቸው የማይፈቅድበት የበከተ የተንፀባረቀ ያሰቃያል የሳነቴ ያገርህ ያወርደው የቀረህ የተለየውን የኢሰማኮ ያልተነሱ የብዙኀን የረመዳንን ያጠቃልላሉ ያሰኘኝ የማዞር የሚያርፉ ያልተነሳ የጴንጤዎች ይሳብ ይቀምስ ያላደረጉና የተጋለጠና ያለመስዋዕትነት የሚተባበር ይገመግሙታል የአጎዋን የአማርኛን የሚታደግ ይደግማል የሚስመርቃቸው ያጠናከረ ያጋልጣቸዋል የተከራዮች የፍትሐዊነት የሚቀንሰው ያጠናከሩ ያዘጋጃቸውን የመሸበት የሚያቀርቡና የሚደረሱ የጠራቸው ያስገቧቸው የሚስተናገድበት የሞተውም የተካሔደውን የሚታደገው ይሸፍናሉ የማልታ የግበአት የሚደረስ ይጠቃለላል የተፈፀመዉ የሰየመውን ይራዘማል የሳቢሳ የሚዘገበው ይሀ የሚያከብረውን የመጎብኘት የመሞት የተናጥል ይወደዋል የሰላማዊው ይሓ የሚልቀው የነርሱን የአሪካ ይውሉ ይሕ የኮፒ ይሳካ የሚመጣና ያለማሉ ያመረተውን የሊብያ የሞተን የጃማይካ ያስመዘገበች የሚታለል የቅደም የወጣትና የተነፈገ የተናገሩትንና ይቆጥራል የአብርሃም የገነባውን የተገደደበት የምናስቀምጠው የምትጫወተውን የከፊል የተላበሰው የማዋሃድ የመከላከላና ይሳባል የሻዕብያን የተቀረፁት የፈርቲላይዘር የዚምባቡዌው የምንሻ የሚያደራጅ የኢትዩጵያ የሸለመው የተገጣጠሙ የማጥላላትና የጠራነው የተባበረው የማበደር የንበረት የደቡቡን የተወከሉና የአውሳ የሚወጋ ያጣነውን ይቆጣጠር ያለፈዉ ይለማ የምትፈልጋቸውን የምትሻበት የአቋቋሙት የሚያናጉ ያረፉበት የሚደነቀው የጦቢያን የጣምራ የፒያሳ ያለቁትን የኢጣሊያና ይጥሉ የሚዘረጉ የከረሩ የአዘዞ የመውደቅና የተማረውንና የሚወርድበት የተጣላ የሚሰፍሩት የጋህአዴን የታስክ ያረረ የመቃወምና የአጎበር የሚተዳደሩበት ይደበደባሉ የሚጎርፈው ይዜ የተያዘባቸውን የእሩምታ ይዘትን ያስከትል የሠራቸውን የፍሎራይድ ያውቁኛል የሊቢያውን የተነሱትና የድምፂ የነበራችሁ ይሰናበታሉ ያቀንዋቸውን የመንግሥቱንና የተ