            amharicWords[23, 2] = "ያጠናሁት የዳር የተገጣጠሙት የኢሠፓና ያዳመጡት ይዘቶች የድሬይኔጅ የደመሰሱት የዳስ የሚከልል የእስከዛሬው የተጓዘችው የዲፕሎማትነት የአይኤስኦ የሚሸጠውን የባህሪይ የሚገለጠው የሚካሄደውም የተቀበልን የተፈጥሮን የሚያስታውሰን ይከራከራል የሃኪሞች ያልኳችሁ ይሁንባችሁ የሚገቡንን የማያስኬድ የመኸርና የተሰናዳውን ይዞታንና የእስልምናን የሀሳቡ ይለያሉ የመግጠም የሸፍጥ የሚነሣ የመስራቱ የባላገርን የመቂ የወሰኑበት የሰውነታችን ይጠፋዋል የመቅደሱ ያልፈቀዱት የራህንወይን ያበዛል የኪስማዩ የሚዳሊያ ያልተቆረጠ ዩክሬይን የዑጋንዳው የሚያቆይ የማስተባበርና የሚኒሥቴር የምንገባው የብሔርብሔረሰቦች የጓንታናሞ የጋሽና የግሽበቱ የጣልያንና የሱርማ የሚፈልጉም የሞሉት ይስማማ የባህላችን የምንቀጥልበት የስርአተ የኡጋዱጉው ያቃልለዋል የተቆናጠጡት የተጫዋቾችን ያደገችው የአሠብ የአሽሙር የተገነጠለ የሚከራከረው የኢንተርፕርነሮች ያፈሰሰ የመት ይኖሩኛል የተሜ የቀጠረው የስርአት የጥበቡ የሚያሰናክል የተገነጠለው የተወቀጠ የመሪዎቻችንን የመርታት የምንቆጠር የቀሩን ያስታውሰዋል የሚጽፍ የስብሃት የመሰንዘር የሚውሉበት የሚሆነዉን ያቋቁማል የሚወሰነውን የተማረኩትና የሚያስመጡት የተደራደሩት ያወጀውን ያጠነጠነ የምሆነው ይሰባሰባል ያናወጠው የሚያምር የተራቆቱና የደረቡ የተሳሰሩትን የሚያዳምጥበት የሙባረክ የስዊድኑ የንግግሩ የሚያሳጣው ያቃልላሉ የግብሩን የተከፈተበት የአረቡን ያባርሯቸዋል የመላዕክት የማዘናጊያ የማያደርሱ የሮክ የሚያሳድፍ የሚከተሉና ይከተዋል የዕቃዎቹ የቅኔው የተካሄደበትን የእንደርታ ይረሱታል የሚታገዘው ያስቀረ የነገራቸው የተሻሉና የተቹ የሕብረተሰብን የብሔርና የዝጊ የሳሞራ የየአገሩ ይዋቀራሉ የተሰዋ የመሠለ የሚያደርሰን የፋኦ የምገምተው የሚሳካ የተጠናቀቁትን ይንገላታሉ ይደርሳቸው የየራሱ የሚመነጨውን ያደረሰችው ያስደሰተው ይዋቀራል የገፋፉት የብረታብረት የተጎሳቆለ ይመሰርታሉ የተቃኘው የሚቀናው የሚሰነዝረውን የተኙ ይኖራችኋል የዳኛውን የማሳልፈው ያካሄደችውን የማመልከት ያጠፈውን የተገኙትም የተለገሳቸው ያስረዱሉ ይፋፋም የሚያስር የሚያሰጋቸው የማስቀደም የኢየሱስም ያሠራው የሶማሊያውን የተቀበልኩት ያረጋግጥልናል የመቁሰልና የሚቀርብለት የሜኤሶ የሚያከፋፍለው የተጎናጸፈ የዋልያ የሚረሱ የይቅር የሚፈልጓቸው የተናገረችው የቬንገር የተጠራጠሩ ይጣራሉ ይላላ የበረከትን ይቀናናል የፈረጁት የምናዳምጠው ያለመክፈል የሚያውልበት ይከራያል የሻቬዝ የዳፍ ያልገለፀ የተጠቀመችበት የማረከቻቸውን ይመኙሻል ያልገለፁ የተነቃነቀው ያወገዙት የፓወር የተስማሙትን የብአዴኖች የላካት የዘነጉት የሁከትና የአልጀሩስን የማይናቁ የየዕለቱን ያተረፉና የዘመተውን የሚመሯት ያንገሸገሸው የምታደርጋቸውን የታገል የኢተፖድህን የቁሳዊ የድግግሞሽ የሀብታም የወጣቶቹ የሚያሸጋገሩ ያስተምራል የለባቸው ይሸታል የአረቦችን የተሳተፈውን የስታዲየሙን የተባለላት የበደል ያድርጉልኝ ይደረግለት ያቆመችው ይበዙበታል ይበለው የገለጸውን የዚንክ ያካሔዱትን ያደቴ የማላቀቅ የትራንስፖርቱን ያህላል የሚያነቡትን ይፈፅም ያፈራ የመሰረቱትና የተማረና የመክዳት የቆጠራው የምትወልደው የሚያስችሉን የሚተከሉት የማይታለፉ የአሸናፊው ያሳያችሁ የፋፋ የሚፈለግብንን የጨረታና የሚወድና የቱር የሚካተቱት የሣዑዲ ያስታርቃል የኒኩሊየር ያደለው ይባባላሉ የመንግሥታትን የምንፈልጋቸው ያስገባቸው የተለጠፈው የሚመሩና የሚሉንን የሚለውጠው የሚሸሸውን ያለሁበት የኦሆዴድ የማስፈራራቱ ያልፈነዱ የመበከል ይጽፍ የምናየውን ያዝለታል የድርጅቶችን የተቀየረው የሰየማቸው የተሰደደው 