 የሳበውን የሰበኩ የተዛመተ የሚያነቡ የፖለቲከኞች ያሰኙ የሚሊኔየም የኃጢአት የመስማትና የሚያንፀባርቁበት የማናቸውም ያለፍላጎታቸው ያደረሱባቸው ይኽውም የማፍራትና የጉሊና የጥዋ ይፈጥሩ ያሰንብተን የማያጠያይቅ የኋለኛውን ያጋልጠናል የሪያል የሰረቀውን የአልቢትር የመርሳት ያነገበ ይከብደዋል ይዳኛል የጎሰኛነት የተሰማወን የአብራኳ የጤፍን ይይዘዋል የብቃትና የበዛው የሚያስቸግሩ የተከራዩ የተዘጋጀውንና የእብሪተኛው ያተተዉ የጠነከሩ የሚሰበስቡትን ያስታራቂ ይቀረፋል የመግንሥት የተረታ ያህለ የቤተክርስቲያኒቱን የተረት የማይመስላቸው ያስደስተናል የተከሏቸው የዲፕሎማቶችን ይወረወራሉ የክርስቲያኑን የፈጣሪን የወርካ የተረፈን የደራው ያተርፋሉ ይሠጠኝ የሚቆጠርበት የሚቆጣጠርበትን የቀሰሙበት የሚያደማ የዞኑና የጓደኛዋን የኢንቨስትመነት የተለዩዩ የተገነጠለችው ይቀዳል የአሻራ የማይፈሩ የሙርሲ የስዊድንና የሚተነፍሰው የምንሄድ የማይፈራ የሚያሸጋግሩ ይጮሁ የቅዱሳንን የታተመውን የአንበሳውን የፈቀደች ይጮህ የተሰረዘሲቪክ የረገጡት ያመረቷቸውን የምንተዋወቅ ያስቃኘናል የሚሰፍርበትን የተሰደዱና የመንፈስን የሚለካ የተስተናገደው የአለቀት የጠናበት የአገርህ የምሰራው የማክበጃ የተስማማበትን የማንችለው የተወሰደበትን የኢትዮጵን የኦርቶዶክስን ይሆንን ያልሞላው ያስጨንቃቸው ያስገዙ የታሪካዊና የሚሰማንን የቶጎ የሞትን የኤድመንተኑን የጻፉ የኮማንድ የመውረድ የማያውቅና የፒስ የበደሉትን ይቀርፋሉ የልብን የሚያረጋግጥልን የምንይዝበት የምጽፈው ያጸደቃቸው የሚከፋው የከንቱ ያልተወሰደበት የማስመለሱ የሪፖርተሩ የገብርኤል የምዕመናንን የማስብ የመሳሳት የጣለብንን የሰለጠነና የተበሳጨ የታየና የአቡኑን የኑሜሪ የተወጠሩ የተገልጋዮች የአሜሪካኖች የቼኮዝላቫኪያ የሚያሳዝንም የንቃተ የነቢያትን የተመዘገቡትና የሳቸውም የህውሐት የማንፈልገውን የታየኝ የተጠቀሰባቸው የጠቀሱትን ይሻለኝ ያፍራል ይጨመርበት የማይገለፅ የሚጠሯት የሚበላሽ የዓላማው የሚሰማራውን የከፈቱትና ያደግኩት የካሜራ የጠሩትን የሚወያዩባቸው የቶፕ የጥርኝን የተሳፈሩት የየከተማው የሉዊ የለመድኩት የነቀዘ የሚተረክ የተበጠበጠ የየእምነቱ የዘረኛ የድሮዋ የፈጸምዋቸውን የሚለዩ የዳዉሮ የወለዳቸው የሚፈረጀው የሚገባበትና የመሳሰሉና የተቀረፁትን የማውቃቸውን የበቀለውን ይመሰል የበሰበሰ የቋሂን የመወያየትና የኩባንያዎች የተስማማው የማርሻል የሚመገብ የተደመጠውን የስኑፕ የሚያስፋፋና የተቀማ የስዋ የሕዝባውያን ያዘዙት ያህሎቹ የባከነ ያልሰፈረ ይወቅልን የጉርድ የሚመጥነው የሚዳረጉት የመነኩሴውን የሥነሥርዓት የወደመበት የሚቆምበትና የቀንዱ የሚናገሩትም የባእዳን ያሳረፈውን ያንጸባርቃሉ የእርግዝና የሄድን የተረጂ የተጻፈውን ያቃተን የአጫጭር የመሯት የአስተሣሠብ የሚረከቡ የታጀበው ያስቻለውን የሊሴ የሚያጠቃቸውን የረዘመ የፈረደበት የተቆረጡ የሶል የከፈተብን የሚያስፈራሩ ያጣላ የእቴጌዪቱ ያዘለው የአፍራሽ የተገለጸውን የተጠቁትን ያቀነባበረውና ያሳስበዋል የቀጠፈ የቀጠፉ የእኛስ የከተማውና ያንጸባርቃል የሚያጋባው የመንግስቱን ይተቻል የሚደመጡ የኢንሱሊን የልማትም የለኮሰው የፈፀማቸው ያልተስማሙ የኮክቴል የገብረክርስቶስ የምትጥል የድንገቴ የቀረበችው የቆላው የመካከለኛውን ያላበው የአካውንቲንግ የሚመለከትበት ያልወሰደ የባቢሌና ያሳሰበች የሚያሳስር የሕዝባቸውን የዘንድሮዎቹ የመፍራት የሚከወን የማጥራትና ያማቸዋል ያለቁበት ይረብሻቸዋል ያዳበረውን የኾኑት ይቃለላል የፈጠርነውን የነበረባት ያልቆሙ የማያምኑበትን";
            amharicWords[23, 3] = "የተጀመረበትን የተበዳሪዎቹን የአልኢትሃድን የጠናባቸው የቸሩ የሚያገባ ይኮንናሉ የተቀራረቡ ይቆጣል የማይፈጸም የፍትሃብሄር የአጣየ የመቀማት የጓደኛዬ ያቀረብከው የኤል የተዛመዱ ያቆምኩት የማያስችላቸው የተፈጠረላቸው የመሰባሰብ የሚመነጩት ያግኙ የቀረበልን ይሰብረናል የተያዘባት የመግባትና ያታልላሉ የፈረደባቸው የውሰጥ የማመንጨትና የሚረግጡ ያስቀመጥናቸው የደሴንና የሚያልሙት የሚጠበቅባችሁን የሙታን የተሸከመውን የተሟሉላቸው የፈቀዱትን የተመዘገበች የኖርሁት የጭነቱ ያጣን የኖብል የሚመለከተውም ያሳሰበን ይጨነቃሉ የነንቶኔን ያንፀባረቁት የሚያሰራቸው የመመንጠር የሚጮኸው ይነግራቸዋል የወቀሱት ያደረገባቸው የዓሥራትን የማረምና የሚፈፅምባቸው የአድአ ይሆንባታል የሠፈነበት የተስማማንበት ይይዙ የሚገድሉት የሚቀበሩ የካህን የታጣቂ የጀግንነትና የተማሪና ይይዝ ያሳሰበኝ የተመለሰች የመንደሯ የሚወዳቸው የተማፀነው የጤንነቱ ያለችኝ ዩርዳኖስ የሚመዘዝ የጠቀስነውን የመዳረሻ የሚደረስበትን የመለመላቸው የሚበላና የሚወያዩበትን የመስከረሙ የእህታቸው የጀመረውም የጤንነቷ የመድረሱ ያለመሰልቸት የዲፓርትመንቱ የሙስጠፋ ይጠብቃችኋል የሚመራን ይገምግም የተከፈተውና የዉሸት የማይታወቅበት የሚከሰትና ይቃዣል የመስጊዱ የአዉሮፓ የማሪን ይቸግረኛል የአዘጋጁ የፈጠረላቸውን የተነጠቀው የሚሠሯቸው የተላለፈላቸው የመስጊድ የመከሰት የፓምፕ የምትልበት የጀቡቲ የመልሱ የገለፁትና ይዘሽ የበየነ የተሰራብነን ያጠለቀ ይደነግጣል ያጠለቁ የተነተነው የተከለከ የአብራሪዎቹ የተስማማንባቸው የጋዜጦቹ የማይፈርስ የደገፈ ይገኝለት የታዘበውን የሚያነጋ የካቢኒ የመስጠቱን የተሻገረለትን የእርዱታ ያረጋገጠላቸው የፖሊሲውን የኖኪያ የታማኝን የሚያመጧቸው የተዋጉ የተያያዘና የተማጽኖ የመሸገበትን የሚከፍልበት የማንበብና የተዋጋ ይታወቀኛል የኡጉጉሙ የገመታቸውን የኢጋድና የሲቪሉ ይደክማሉ የሚያስቀድም የምታቀርብ የመነጠቅ የጉራፈርዳ የሚናገሩና የሚባሉትም የሚከለክሉ የምፅዋና የተቆላና የተመቸች የተደሰተ የቤጂንግ የለመዱትን የቆሰሉበት የማዳፈን የሚሰበከው የሌላን የዲፓርትመንት የኢነርጅ የፈጣሪነት ይሰጧቸዋል የኃዘን የባሩ የጋናና የጋናን የምወደውን የባሮ ያለርኅራ የእሳቱ የስውር የእፅዋት ያመኑትን የኦሮሞው የሞራልም የቆንሲላ የመዘገበው የበርከታ የፓራሹት የገፋፋው የታነፁና ያረቀቁት የሚያስችለኝ የማውቅ የሚወልደው የሩምታ የተፈጠረችው የደረሰና የእነብሴ የሰርቢያ የመጣላቸው ያስቀናል የሚበጃትን የተጫረው የሳታላይት የመቆፈርና የተሰበሰበበት የፊላንድ የመልቲ ያደርሳሉ ይሁዲዎችን የታጋቾቹን የሊቀመንበሩ የኖሩበትን የወረዳውና የሚገለገልባቸው ያደናግር ይደረግባቸው ያብባል የኤውሮጳ የምናከብር የመከላከያን ያካተቱት ያቋረጠ የተንገላቱት የታወሳል የሚንስትሩ የኤኮኖሚና የተከለው የማይሞሉ የምንሰጥበት የሚያመሩት የምርታቸው ይነግረኝ የተወደደ የምንደግፈው የዳኛው የምታደርጋቸው የትምህር ይቀላቀላል የተወደዱ የመሰለንን የታዋቂውን የማይከለክል የአንዳንዶቹን የአይጋን የሚለጠፉ ይክፈል የስሪያ የፍትሐዊ የጳጉሜና ይጠይቀዋል ይርዳን የሸኙን የመታውን የተፃረረ የተወለድኩት የብርበራና የወታደርና የሊበን የዘገየበት የሊቀመንበር የመዝናናት የወጣቸው የዕምነትና የፍሪደም የሚሉትንም ያመጣዋል የክሊኒክ የተነሡት የምትበቃ የሚፈናቀሉት የምታፈራውን የወንድማማቾች የፔንታጎን የወሰዷት የተጠሩበት የበጋው የማይታወቁና የባልንጀሮቿን የማስፈራሪያና የካንሠር የሚገፍ ይሄውልህ የሌለባትን የኢትጵያ የአሰልጣኝነት ያስገባች የተገደድኩበት የውሽት ይኖርብሃል ያስወጣቸው ይስ