            amharicWords[23, 4] = "የኢግዚቢሽኑ የራስወርቅ የካብኔ የሔደችው የማሽነሪ የመስተዋት ይኼውላችሁ የኖክያ የሚጠራት የፓሊስ ያነቡ የምታውቁ የመሳሪያው ያየለ ያውለዋል የገባቻቸውን ያስጠነቀቀቻት የሚያዳምጡት የፕሮጀክትና የሊቃውንቱ የአንዱአለም የመከላከያውን የእስርና ይገበዋል የተጠቂ የሚፈልገዉን ይንቀጠቀጡ የምትጠቀሰው የድምጽና የሚዘፈንበት የሥልጣነ የሥላሴን የኔቫዳ የሚመኘው ይዞም የተሸረሸረ የሚመዘዘው የራይን የአረም የምለብሰው የሚበታትን ይከላከል ይዞላቸው የማኖር የተቀበሉና የተረሸነበት ያልፈቀዱ ያዙታል የድርሻዬን የአገርንና የስንቱን ያስቀመጣት የሚያዛቡት ይንቀጠቀጥ የተጓጓዘው የአስፈጻሚውን የቆሰለውን የማይናገሩ ይታረሙ የተጎናፀፉ ያልታወቁት የብዙኃኑን የላይቤሪያን የብሔረሰብና ያልወለደ የምርመራን ይሳነናል ያላገኙና የትርጓሜ የተረከባቸውን የጉጂና የብልጣብልጥ የቅዳሴውን የምትከተሉት የሚያነቡት የእንደሊ የሚፈስበት የሥልጣኔና የያዘቻቸው የብሔረሰብን ያድርግልህ የቀረበላት ያልተበጀለት የኢዴኅፓ የነፕሮፌሰር የኤሚንና የተሠራውና የማሳደር ይጠቅማቸው የአይቲ የአረጋውያንን የሚኖሩትና የምናገር የሚትቀራረብ የሸኛቸው ያፀድቃሉ ይፈጸምባታል የተተረጎሙ ይቀናታል የሚስተካከሉበትን የዕድሜውን የጃፓንኛ የሚያዝያው የሚለብሱት ያልደገፉት የመናፍቃንን የሽሻ የሎርድ ያሳተመው ያወደመው የውይይታቸው ዮዎች ያስቀድማል የማርያምን የሚመጣልን ያየች የሚጭነው የሚንቀሳቀሱትና የተቋቋሙና የተወሰደውና የተጠለቀው የሀፍረት የአገሪቱና የሞከረውን ያገለገሉበት የተገፋ የሚያመነጨውን የመዳንን የመናኸሪያው የምንወጣበት የሰረቀው የውጫሌው የኖርሁትን የዋናውን የመኖራቸው ያልመለሱ የየራሳችን ያኮረፈ የየዘመኑን የሚያስለቅሰውን የቤተሰቧ የማስትሬትና የምንረዳበት የተጋረጡትን የገነነውና የሚሸመግሉት የመረጡበት ያየን የሊፋን የሙሽራ ያመጣቸውን የሚቃጣውን የሙሉጌታ ይዞን ያለሃጥያታቸው የወጋሕታ ይሻላቸው ይተጉ የግፈኞች የዙሪያ የሚጠቀሰውን የአድቮኬሲ የመከላካያ የሚዘረዝረው ያሳወቃቸው የሚሰጥባቸውን ይቀማል የተወያየበት የህዝቦቻችንን ያጣጣለው ይጎድላቸዋል ይከፈቱ የጂኦ የሚያሰማራቸው የሚሽከረከር የቆየሁት የሚያገላብጡት የሚያድርጉትን ያልሰሙት ይታይዎታል የሚሰፍርበት የፍቅራቸውን የሚያስደነግጥና የመሄጃ ያለመረጋጋትን የቆዩባቸው ያልን የተሳተፉበትና የተያዙትንና ያለትን የሽግሽግ የሚገርምና የጣሉባቸውን የተግባራዊ የሕዝብም የምትሠሩት የክሪስታል የሚነሳበትን ያላችውን ይኸኛውም ያሣስባሉ ይሰለፍ ያክብር ያለመው የሚቀየርበት የአፖሎ የኢዲሃህ የሚያሳዝናቸው የአኗኗርና የተመሠረት ያቀረቡላቸው ይገልፀዋል የሚያሰማበት ያመጣሁት የጓጓው የማፈግፈግ የምናገኘውም የሸኟቸው ያቀረቡለት የሚያስረው ያየዘ የተዘጋጀችው የሚወስዱበት የተሠኘውን የተጠሪው የሚፅፉት የቀበለ ይወጣበታል ይወድ የተማረኩና ይነክሳል የፖሊሲዎች የሚያውቋቸውን የሚመዘገብበት የቀወት የሚጮሁት ይገባለ የሚደገፈውን የካቢኔው የሚፈልሰው ያየነውና የሚሰጡዋቸው የመደምሰስ የመረመሩ ይሆናቸው የተቀበረባቸው ይታደጋል የአድማጮችን የተርም የዘረዘርኳቸው ይሰራበታል ያጠላው ይከፍሉት የሚያሰኛቸው የቤተክህነቱ የተጨዋቾቻቸውን ያደርጓቸዋል የተሻልክ ያወሩት ያሰፋላቸዋል የራያዓዘቦ ያለባቸውንና የተገመተውንና የብልጽግናና የሚፈጽማቸው የኦስሎ የሚሰደድበት የተሠራለት የተሰለፍን የማሳረጊያ የንጉሡንና ያልተመሰረተባቸው የአመራሮቹ የዛላንበሣን የአገራትና የከለከሉ ያዳላል ያለበትንና ይፍታህ የሚጠልዝ የኮንፌዴሬሽኑን የመሮጪያ የታተሙት ይተገብራሉ የእገዳውን የሚሸጡና ይገባሀል የግጭትና ይደንቀኛል የተጠቀሙ