            amharicWords[23, 5] = "የሚከፍልበትን የሚለያቸው የመረጠበትን የማንሳትና ያልዎትን የኢንዳውመንት የሚገዛበትን የፖሪሱ ይዘከራል የእንካ የወሰንኩት የጉስቁልና የማይመጣጠኑ የሴክሬታሪያቱ የሚታውስ የባቡርና የሚቀርቡዋቸው ያንሳ ያስተጓጎሉት የተጣራው ያለፈን የሚያስቀርና ያንስ የተፈረደባት የኢሲኤ የሚለማበት የባቡርን የሌለውንና ያስቆጫል የብልግናው የማከብረውንና የምታስመጣው የምንተወው ያሳደሩ የተቀጠሩና የሚያይና የመሞቱ የአብዮቱ የሚከፈቱት ይስተናገዱበታል የደረሣቸው የእውቀታቸው ይዘገንነኛል ይደውላሉ የዛሚ የደጅ የታወጀውን የእንግዳው የተመረጠውም የሚለጠፈው የደጉ ያጸደቁበት ይሆነን የምትሸጥ የአሜሪካኖችን የግርማ የደግ ይም የክፍያና የማይለዩ የተፈፀመላቸው የተመላ ይደውላል ይስፋፋሉ የሚያከፋፍሉት የመምሪያውን የማስረሳት ይስተናገዳል የማፅደቅና ይሆነኝ የሚያደራጁ የሻሽመኔ ይሉሀል የዓድዋን የባለቤታቸውን የሚያቅፉ የተሸጋገሩትን ያደረግሁትን የሰንጋ ያጨናነቀው የተሰየሙትም ይሠራቸው የፊተኛው የቆረጣ የለሁም የተነፈጉ የሚያስፈልጋቸውና የስፍራው ያቀብሉ የሚከበሩ የሚሰኙት የተለቀሙ የመነሳሳት የተመራውን የንቅናቄዉን የተገጣጠመ የሚነግራቸው የተሰኘና ያለፍኩት ይሄዱል የእስላሙ የአባላዘር የተሰኘን የቆምን የፋብሪካና ያልተቀበረ የባዴን ይቆጣጠሩ የተሰመረበት የማስመረቅ የሚያውቁዋቸው የተቆጣጠረበትን የያዩን ይች ያማቸው ያንኳኳችው የሚዳረስ የተተከለብን የተጠኑና የሚያዋስኑ ያባርራቸዋል የእነኮሎኔል የደፉ የተሰማሙ የሚያስብለው የምትገኝና የባስኬቶ የሚያሳድዱ የተንተራሰ የሚያርሱት የምትወክለው ያመንበት ያውቅና የተደረጉበት የጠሯቸው የመገንጠሉ የደረሳት የጦቢያና የድንዛዜ ይዋከባሉ ይሞላ የከተማንና የዛቱ ይልሳሉ የሴክሬታሪያት የድርጅቱንም የሽጉጥ የታሰበውና የከሐዲ የተበተኑት የሆነኝን የቅናት የሚያሸንፉ የበቀሉት የወቀሱ የማያንሰው የሚያወዛግበው ያልወሰደው የጻፍኩበት የታቀፈ ይደነቅ የነገዱበት የወቀሳ የቃዲሪያ የዲስፒሊን የሚያፈቅራት የተገፋን ያዉቀዋል ያካባቢው ያየችው የተገደሉም ያገኘውም ይነድፋል የሰራችው የአምራቹ የመጣንበት ይታዘዝ ያፈቀራት ያለስማቸው ያወራው ይዩ የሰሜንዕዝ ያለጥቅም የምንሰራዉ የሚወዱትና የምትጠራውን የቶሮንቶ ያሰባቸው የመሄዱን የድምፀ የሲዲኒው የሚያስከስሳቸው የሚያበቃን ዩኒቨርስቲዎቻችን የሙጃህዲን የኦስማን የሚያገባቸው የሚበቅለውን የሚለያዩበት የሚመረምርና የመንቀል የሚያሰጋን የአዳራሹ የሚገባቸዉ የሚያመነጨው የኮበለለው የህገመንግስታዊ የምንጠራቸው የአሥተዳደሩ የማምለጫ ያስወጡት ይተርካል ያገጠጠ የቆየበትን የሚበቁበትን የተስተዋለውን የኑሮን የምታየውን የሰራችሁት ይሻገራሉ ያልተሠራበት የላሊበላው የሚፈተንበት የምንሰራበት የተጎራባቾቹ የሩፋኤል የአንጋፋውን የመበታተኑን የሚያናፍሱትን ይከፋል የልጅቱን ዩሴፍና ያሟሉት የመጣችውን ያረብ የተልእኮ ይዤላችሁ የሚበዙ ይጠቅሙናል የስታርባክስ የተጣሱ የመስኮት ያገረሻል የማብሰያ ይፉ የሚበዛ ያልሞላ የደኅነት የሄደና የሚወተውተው ያዘለውን ያስተጋባው የትዬለሌ የፑሽኪን ይመደብ የንግስት የምርም የፈረስን የተለጠፉባቸው ይመልሱታል ይቻለዋል ይሞት የዘጋው የአምባሳደሯን ይገዙና ያሲንና የአውቶሜትድ የማስታወሻ የሚያረገውን የሚወቅሱት የምናልፈው የሚሾሙ የእንቅልፍ የታወቀችው ያመነበትንና ያስጨነቃቸው ያወጣበት ይጨምረዋል የበኩሉ የሚነጠቅ የሚገምቱም የቀጣናው የሚያሰጋኝ የሚያሳፍርና የለጋሾችን የሚያጡ የቀልድና የትምህርተ የርሳቸዉን የሚያጣ የአሳኢታ የግብፅንም የኢንግላንድ ይወስኑ የወለድና የኩዳዴን የሚደገፉት የሕዝቦቿ ያጣራው የህንፃውን የታሰረና የአተረጓጎም የመጠበቂያ የነርቭና የሚፈጥርበትን የሚግባቡ የመጻሕፍተ ይበጥሳል ይመቻችሁ የተመራበት የኮትዴቩዋር ያለጠባቂ የምተኩሰው የተነገረለትና የሚዘፈነው ይጎዳዋል የሕልም የታለመላቸውን ያስተምር የሚፈጁ የሚሰራውም የወታደሮቹን ይሰጣችሁ ይፈጀዋል ይታደላችኋል የማያስደስት ይስቅበታል የፌድሬሽን የማህበረሰባችን የሪሶርስ ይኑርበት ይፍጀው የመዝለቅ የሚሰቀሉ የማይጨሃ የዶሮዋን የሚነጥፍ የተጋጨ የአናን የጨበጡትና የተጋጩ የምቾት የሚተላለፍባቸው የያኔውን የታገለውን ያላማከለ የሚለቀቁበትን የሚመሰክሩላቸው የደብረዘይቱ የሚሸኙት የፕሬምየር የግድግዳ የመፈረጅ የኦሮማይ የጨበጡትን የምትሉኝ የተዋጋው ይደረስ የሚጎበኘው የሚዘዋወረው ያደቀቃቸውና የሚሹትን የተላቀቁ የሸንጎውን የተመኘ የተወጣው የፒያኖ የወሊድን የተሰቀለውን የማይጮህ የቪኦኤን የርዕደ የታክቲክ የተገኘች የተሠማው የተሟላላቸው የተወዳጁ የሚገዛም የቀረዉ ያበቃና የሚከላከልበትን የከተተን የግንኙነታቸው የአለት የሚያቃጥለው ይነጠቃሉ የሬድ የመጀመሪያውም የምንገናኝበት የተሰራላቸው የአድርባይ የሚማረው የወረራቸውን የሽያጩን የሚሞካሹት የማጥራቱ የመቆጣጠሩን ያረደ የስልጠናውን የዛሬዎቹን ያረዱ ያበቃኝ ያልተቻለባቸው ይነጠቃል ይከብዳቸዋል የተረከባቸው የፈረደበትን ያገላሉ የተንቀሣቀሱ የሚፈፅማቸው የታለፈበት የብሄርን ያካፈሉ የተንጸባረቀበት የቀጠፈውን የታሪካችን የሰበረው የምንለብሰው የከነገ የሚለየኝ የአሥራት የተጨፈጨፉበት የሚያድጉበት የፍትሃ የእርሳቸውና ይከፈላሉ የተመዘገቡበትን የማይማር የሕፃናቱ የግጥምና ይኬዳል የመረዳጃና የጠገበው ይህናል የህብርተሰብ የወንዱን የማይገቡበት የማይቀርብበት የመለሰልኝ የጠየኩት የተቆጣ የአቅርቦትና የሪሰርች የነፀብራቅ የፈጸሙትም ያሰብሁት ያደረብኝን የእርጎ የገብሩ የሚትፈልገው የስነጽሁፍ የለሰለሰ ያልተገራ የዛቻና የምታደረገውን የሠራቸው የዕድሳት የተናገሩበት ያሰማናል ያጋጥሙናል ይታዘበናል የሚስተካከልበትን የገደቡ የመረጠን የፀጋይ የሚረጩት ይቀመጥና የካፒታሊዝምን የድህነታችን የሚያበቃለት ይህውም የዲታ የሚፈራረቅበትን የገደብ ይፈቀድለታል የምንለዉ የጎደፈ የምትወድ ያስታውሷቸዋል ይመስልሻል የተጫወተውን የሚታጠፍ የማነሳቸው የአውሬና ያሳትፋል ያረጋገጡልን የአካሉ የሚያማክሩ የሚያግዟቸው የጀመርከው ይገለጥ የጁልፋር ይጥላቸው የሚያስተምሩበትን የወሰኑትና የኮፕቲክ የመጣልኝን የሚወጡባቸው የቮይስ የመናቅ ያስፈራሯቸው ያነሳኝ ይታየዋል የሚወያየውን ያፈረሰውን ያላጠፉ የጨመረበት የምእራባዊያን የሚያሰኛት የፈጠረና የሚሰማኝን የሚዘጋጁት የተሰላ የመጫንና የግንባታዎቹ የእንሰሳትን ያለመታገል የሚያስተዳድሩትን የከበሩት የተጠጉት የተሰማት የራስምታቱ ያሳደገ የስፔኑን የማስመረት ያስከብርልኛል የሚመክረውን የእግዚአብሔርንም የማይጠበቅና ይሠነዝራሉ የተደመጠበት የመጀመሪው የመቼም የሚጠብቅበት የጀመርን ይጥፉ የተዘጋና የተፈታተነ የማይጠበቁ የዳላስ ይደነቃል ያለመንግስት ያደመጥኩት የተሠራጩት የታሜርላን የተሰሙ ያልሆነላቸው የሸገር የሚያባክኑ የውርደትን የሚየስፈልጋቸው የአለፈውን ያወገዙ ዩንቨርስትታትን የማያስተምር የተጠሪነት የኤልሲ ይመስላቼል የፈጠረኝ ይቋረጥብናል የተገለጹ ይጻፉ የንጹሐን ይከብዳልና ይፈፀምበታል የሚያልፉትን ይለወጣሉ ያደረግን የምታስወጣ የመስራትልምድ የሚሰፍነው የሻዕብያው ያለእድሜያቸው የምከተለው ያላቀረበው የሚፈስሰው የምናደርሰው የማዋቀሩ የታባትህ የምሰጣችሁ የአለው ያስተባበሉ ያዕቆብም የግርጌ የፕሮቪደንት የሳዋን ይረዳታል የታዘዘላቸውን ይሏችኋል የአህጉሮቹን የሃዲድ የጂቡቲውን የሚተላለፍበትን የበላዮች የተልባ የሚውሉትን የዋልታን የዲዚ ይላችሁ የሚገጥማትን የታናሽ የፅድቀት የኛስ ያስመሰክራል የሚጠቅስ የአስተዳዳሪው የዜድ የተክላይ የሚፋለሱ የማሰልጠኑ የተገረሙት የዓረቦች የሚቆጣጠራቸው የመብል የሐዲድ የክምችቱ የኢንስፔክተሮች የጉርሱም የሚሰጡአቸው ይሰማታል ያቆመዋል ይገለጻሉ የሚያቀብለው የተዋረዱ የማይርቅ የወባው የምትመራበትን የተጠቀሱትንና የዘረዘርናቸውን የተውኔት የቀየረበት የፈተናዎች የቀቢጸ የተጠቀሰዉ የነበርኩት የተጠናከር ያቆሰለውን ዩንቨርሲቲ ያመሹት የተዋረድ የጃቸውን የሞቱን የሚፈልገውም የተሞላባቸውን የጋዜጦችና የማይቀርና ያልሰማችሁ ያስደነቀኝ ያበድራል የሚያሳልፈው የዝነኛው የምኖር ያቆያቸውን የሚፈልቀው የቋንቋን የተገጠመለት የሕንፃዎች የሚያስተሳስራቸው የሚያራግብ የገዥዎችን የቀቢፀ ያሣያሉ የአደይ የኢጣሊያው የፊፋና የተጫነበትን የመሰከረበት የተረፈችውን የዓርብ የጀልባው የተባረክሽ ያልታጠረ ያካበተ ይሰጥዎታል የምናስወግደው የሚያስመሰክር የተጨመረበት የሚዘልቀው ያስቻላቸውን የሞናኮው የምታወራው የባዮፊውል ይኖሯቸዋል ይደርሱበታል የምታደርጉ ያሰለጥናል የአገረ የድብደባው የጄሲካ የተከሰተዉ የሚያደበዝዝ የአይበገሬነት የምናረጋግጠው የሚሰለጥኑበት የመጠበቁ የመለያያ የተያዝኩት የቦርከና የሚያስገርመኝ የላባቸውን የወረረውን የምትወጣ ይኸውልዎት ያጨቃጨቀ የምትገባበት የተማረበትን ይገልጡልናል የአምላክን የሚሰጉበት የትንተና የተመረጥነው የአስችኳይ ይፈልቃል የመገደብ ይሞላዋል ያገኘውና የታህሪር የመራሱ የትርጉምና የፋይል ያደረሰን የደጋፊዎችን የቅዱሴ የሚፈጸሙትን ያደረጋቸውና የአድማጮች የተጓዙትን የሻከረውን የዋልኩት የማስረጃዎች የሶማሊላንዱ የተወደደው የሪጅናል ያከበረችው የተበረከቱላቸው የተገኙባቸው የሰላይ የዘመዱ ይደንቃል የሚያወርሰው የመቀመጥ ያላከናወነ የሚያደርሱባቸውን ያቃጠለው የተገደሉትም የተንሰራፋበት የቀነሰበት የሚቀይስ የወርቁን የአደጉ የማይፈልጓቸውን ያለነሱ የነበሩዋቸው የሚቆጨው የቦለቄ ይታገሱ የሃዳር የመንፈሳዊው ያስቀደመ የአስፈፃሚዎች የተናፈሰውን ያደርግና የጉራ ያሁኑም የመመረጥም የአሰልጣኙን የአብዱላሂ የፍራንክፈርቱ የአማካሪዎች የካሣው ያጋባሉ የንግድም የመራቅ የአብዬታዊ የሚጨርሱ የመኪናና የተመለከቱትና የገጽ የአይሱዙ የኋላው የተላኩትም ያለመቁረጠቸው ያቀረበለት የኒቨርስቲ የሰማቸው የኢንስቲቲዩቱ የቀድሞዋን ያድርና የገፅ ዩኒሴፍአስታወቀ ያልተነገራቸው የሚያስመርቀው የሚሸጥባቸው የሚጨርስ የተሸከሙት ይበሳጩና የወደቀበትን የፈለግናቸውን የሚመልሳቸው ያበዛሉ የሚወነጅለው የማጽደቅ የሚያሰናክሉ የስያሜ የሌባና የሚያክሟቸው የድለላ የሞኒታሪ የምታስቀምጠው የሚወረወረውን ያለሙስና የሴኔጋልን ያቀረበበት ያገኘቻቸው ይመስላታል የጫኑብን የማሳወቁ የካተሪን የተንጠለጠሉ የናቱን የምንሟገትለት የተጠመደው የሚያስቆጭና ይኹኑ የጉቦ የአፍሪካውያኑን የመቋጫው የተገኘሁበት ይበዛዋል የሙዚቃውን የመቀጠር የባሰና የምናውቅበት የፋራ የሚጋለጡት የምናቆመው የሚደርጉትን ያላረፈበት የሚሆንበትንና የምታመርተው ያለቀለትን የዘረዘሩት የራቃት ያዙና የአንደኛውን ያልተደገፉ የዳነ የተገደዱበት የተወሰኑባቸው የተለኮሰውን የተሰበሰብነው የኤፌዴሪ ያደረገቸው የማያውቁና የኒቨርሲቲ የተከላካይነት የመንደራችን ያፈሰሱ ይሰረቃል የጨረራና የዩኒቨርስቲና የሄዱና የሚያበሳጫቸው የምቃወመው የተከራየው የአሁኒቷ የሚያማዝዝ የፍትሐብሄር የጊዜያዊው የምንመስል የመቁጠር የስነጥበብ የሚሮጠውን የሚያበረክቱበት ይደፋል የሚኒስቴርና የሚገልጽና የሚፋጠንበትን የአሁኑንና የእንዲህ ይቋጭ የበላይነቷን የመንጋው የሚጫወትበት ያሳረረው ይከፋፈል የመረማመጃ ያሰፈረ ያቋቁማሉ የምናከፋፍለው የሚችላቸውን ይሰባሰባሉ የአምባገነኖቹ ይወስድባቸዋል የጄኔቫው የነሱት ያውጣሽ ይነገርላቸው የሚታረሙበት የመኒ የጥቅምቱ የሠፊው የሚንከባከቧቸው የሚያሰኘን የማጥቃቱን የአንድነቱን የተሽከርካሪዎቻቸው የማይቀበለውንም የሚፈልጉበት የሚሰናበተው የተሰካ የመታፈን የልሳኑ የለቀቁበት ያስኬዳል ያስተካክለዋል የሚያስጨንቀኝ ይሠሩና የክብካቤ የሚዘክሩ የቋመጡባትን የሚያጣጥል ያለነውና የአራጣ የፈንድ ይጠበቅባቸው የአስፈጻሚነት የተቆራኘው የተባለባቸው የመናድ ያልተመጣጠነን የሺዋስ የትኛዉ ያስጠበቁ ያወጧቸው ያገኝበታል የሚያምሱ የሚያረጋግጡና ዮሐን የትኛዋ የባለሙያው የአቢሲንያ የተባሉባቸውን ያንብቡ የምጠቀሰው የዘራነውን የዘመቱት የማይታመንና የስቃይና የትነሳ ይፈጥራልና ያለዕጣ የመከሩበት የጥያቄዎቹ የሚሠሩም የተዳከመውን የወገኖቹን የገባችበትን የባለኃብቶቹ የደመቀና የሜሪላንድ የአስመላሽ ያለጥናት የተኙበት የምላት የፓርቲዉ ያከሉት የውክልናን የማካሄድና የገዥና የቆመችበት የተሰበሰበውም የሚናደድ የጉዞውን የመሰደድ የሚዘፈን የተለቀቀውን የተገበረውን የምላቸው ያልፈጠረ የሚቀጥልና ያስተዋለ የጉንዳን ይነግረኛል የሞሎኪዩላር የማያደርስ የበኩልዋን የተጓዙበት ይዘውባቸው የቅሬተ የተስማሙበትና ያደረገቻቸው የነገረኝን የባላደራ የማሳደጊያና የአቴንሱ የጀርመኑን የሁለንተናዊ ያደርጉለታል ያስታወቀውን የምፈልግበት የሚያጤሱ የዳጋ ያለመኖሩንና ያስቀይማሉ የተቀበልንና የማሰቢያ የጠነሰሱት ያንብቡት የቅዳሜና የእኛነታችን የማስለቀቅና የክለቦቹ የወረደብን የኬንያውያን የመዳ የዞሩ የእንቁላል የማይተዋወቁ የተሰበሰው የተጎሳቆሉ የፕሮግራሞች ያጋሩት ዩኒቨርሲቲዎችም የአዲስአለም የሚገድለውን የተፈቀደላት ያደሉ የዩሮሎጂ የሚቀርጹ የተበየነላቸው የጠበንጃ የተሰገሰጉትን የአውቶቢስ የተኩ ይብጠለጠል የካትት የልጄን የቡርኪና ይዞታዋን የምንገዛበትን የመከራችን የሚበረከትላቸው የሚያደምቁ የተወሰደብኝን ያሰተዋለው የገባባቸው ይበለኝ ይተኳቸዋል ይያያዝ የእኩሎች የሚያመረቃ የማጉላላት የመደገፉ የምንጫወተው የፋብሪካዎች የተቀዳጁትን ያልወጣለት ይነሰነሳል የኮነነው የግብይቱን ይጥሳሉ ያደሣ ያስተዋለችው የሚቃወሙበት ይለምናሉ የሚያስተባብራቸው የተዳቀለ የተቋረጠበትን የጨነቀኝ የመዛወር የኤለክትሪክ የማትሰጥ የዳኝነትና የፌዴሬሽንና የሚያቁሩ የአዘጋጆቹ የጠቁሙት የማይካፈለው የሚታወሥ የምትገልጸው የፍሰት ይለምናል የሚከሰቱት ያለጥንቃቄ የሚያሠራጨው የመጪ ያልጠበቀውን የሚናፍቁት ይወስዳቸዋል የኢህዴግ የገፋበት የሚያሳስባችሁ የሚያነቃቃና የባግቦ የሰባአዊ ያጋባና የሚያፋልሱ ያበስራል ያንቀሳቅሳል ያስተምራሉ የተድፈነፈነ የገዥዉ የሙሳ የሆኑን የማንኛው ይሠጉ የመንከባከቡ የጠሩ የተግባረ ያውጣን ይፋለማል የሚዳረግ የሚያስከትላቸውን የሚልክበት ይደብረኛል የማይመስለውን የብዛት የአዘጋጆች የጋበዙ የመረጡም የተነዛውን የመለመለቻትም ያበርታህ የማፈናቀሉን የሰፈረና የወኔ ያቬዝ የተወከለበትን የተገየበት የፓርቲዬ ያስገድላሉ የመስከርም ያሸሻል የማይሳኩ የሚታወሱ ይሸምታል ያጥሩን ዪንቨርስቲዎች ይሳነዋል የአእምሮም የበደሉ ያጋባኛል የሰራሃቸው የሚሳዩ ይነቅፋሉ የመንገዶችና የያዝናቸውን የግፉአን ያገኘኸውን የምንጥረው የማይመልስ የማያወጣ የኮሎኔሉን የጫነችው ያሰፍራል የሱዳንም ያባባሰውና ያልተካተተው የኮበለሉትና ይቀየራሉ ያደርሰው ያዳበሩ ይላቸውና ዩኒቨርሰቲዎች የቱሉ ይነቅፋል የነበሩትንም ያለትምህርት ያለወትሮው የፌሮ ያስገድላል ያላየነው የእቴዋ የተከላከሉ የሰላምአስከባሪ ይፆማል የግለኝነት የሚያጓጉዘው ይጓጓዛሉ የሰማነውን የገለፁም የሚሠነዘረው የሚያፈሱ የንዋያተ የማያምርና የሚያስፈፅመው የመ