            amharicWords[23, 6] = "የደወልኩት ያላየው የትከሻ ይከፍል ይተያዩ የአልጄሪያዊው የምናስቆምበት የቅርሳ ይራመዳል የሚያበረታታቸው የሚቀያየር የእርሳቸዉ የነሲብ የሥልጣኔዎች የስፖንሰርሽፕ የንስሐ የወሮበላ የአድባራትና ያሻናል የማይጣጣምና ያደረግሽው የድሬደዋን ይድረስለት ያጠብባል የጠባቦች የተተበተበው ይገልፁና የማራባት የመሣሪያው ይድረሳችሁ የሄዱትም የተጨናነቀው የምትሆንበትን የልብስና የአማፅያኑ የቱጋ የተራቀቁ የተመዘገበውና ያደገበት የቀቤና የመተካካቱ የማጋለጥና የከሰሳቸው ያለጡረታ የሚነፉ የተመሰከረ ያቀረቡአቸው የመደባቸው የፖለትካ ያወርዱ የተበደርነውን የመወያያና የተናገራቸው የቦርደዴ የአሠልጣኝ የንዋይ ያወርድ የተቀማው ይህችኑ የሚችለዉን የሌሉትን የማቀጣጠያ የዘሐበሻ ያመለክት የሚቀማ ያግዳቸዋል የሆኑትንም የተወሳሰበና የፖለቲካችን የለፉበት ይመዝናል የሚያንገበግብ የማይደረግበት የሚመለከተን ያቀረብኩትን የማይገባና ያሰፈራቸው የተዘፈነው የሚያጠግብ ያቃጠሉት የሚታለፉ የአማፅያን ያሳየዋል የሚያቀርብልን የኢትጵያን ያልተነሳበት የመሣሰሉትን የየድርሻውን የተቸገረን የመሸለም የሳኒተሪና የተከበረና የሚያድርግ የተጋባና የተወጣጡና የሰባተኛው የጋን ያስተማሩትን የማላልፈው የተቃዋሚዎችና ይሆናላ ያልሠሩ የመኾናቸው የተተኮሰባቸው የሚቀርበት የሚያሻን የሚያፈስሱ ያልሠራ ይምጣና ያባረረውን የንፀህ የጎደላቸውና የሚሞላው ያደርሳቸዋል ዩራኒየም ይመጣልና ይመስለን የስርጭቱን የታዘቡትን ያሰፈልጋል የመድፈርና ያጣላል ይበሉት ያለፈበትና ይከውናል ይገለላሉ የማያስተናግድ የምትጫውተውን የተወለድኩበትን የውጭዎቹ የርስት የምርጫን ያክልም ያስጠብቃሉ የአሥመራና የተካሄደውም የሚሠራባቸውን የሲቪሎች የሞከራት የተፈራ ይፈራልም የሰንበትን የተከፈተላቸው የተዘገበላቸው የምትመላለሰው የህልውናቸው የተቀበለውና ያደረጉዋቸው የሰኞ የሚዘምተው የሆስኒ የሚሽረው ይገኙበት የአርትኦት ይይዝና የወንጭፍ የአበበች የተቀጨው የላሸቀ የሚከፍላቸው የየአገሮቹ የተደቀኑ ያስገደደ ይነሡ ያስመዘግባሉ የመሸሻ ያልታጠበና የብላታ የቀሩበት የሚያስጠብቀው የቬስተል የመሸሽ የፃፈላትን የመጠቁ የኦሮም የምንወድ የትናንሽ ያሰፈልጉናል የደረጃውን የአስተዳዳሪ የዚያኛውን ይቦርሹ የግትርነት የሚሻሻለው የነፈጉትን የደራሲያን የሚተገብሩ ይነስ ያልተገነቡ የሚቀላቀሉት የያዟቸው ያለመቆጠር የደረሰበትና የነበረከት የብርሃነ የሐመሮ የኮሚሽነሯ የብርሃኑ የወገንና የአቅሟን የቀጠሩት የበቁበትን ያፈርሰዋል ያልተሟላበት የሚያቀርበውም ያልተገነባ የሚረብሹ የቅጥርና የመንም ይኼማ የሚገርመዉ የፌደሬሽኑን ይግደለን ያመንኩት የትህትና የገለጠለት ያላትም ያልሆነበት የአዋሳን የአዲሲቱ የሚተገብር የሌተና የሚዘግብ ይተኛሉ ይመስሎታል ይወክለኛል ያስተባበለው የታመመች የወደቦች የወራት የሚረብሽ የሚያረጋግጠውን የተወችለትን ያነግሣል ይሁነን የባለሙያውን የተዋጠለት የሚያውቁም የተሳሳተው ያሟላው የአሜሪካኑን ይተኛል ይከፋፈሉታል ያስመዘግባል የሦስተኝነትን የታጠሩ የዐድዋን የሚቀርቧቸውን የአካዴሚውን የሚፈነጥቅና የዓመታዊ የሚለበስ የባእድ የአልባሳትና ይጠራሃል ይኼስ የሌኒንን የዕራት ይሰየፋል ያስረዱን የደመወዝና የአዲሲቷ ያስተዋውቃቸዋል የሚደንሱ ይግደለኝ የሚደክሙ የውልንጭቲ የመዋሃድ ያወርሳል ይቅርብህ የልባሽ የአዲግራትና ያረጋጋዋል የዕድሜና የሚወዳደሩበት የሚዳስሰው ያቀርበዋል ያወቅነውን የማሌ የምታውቋቸው የሚቀጣው የተቀዳሚ የተሰማኝና ያላለውን ይባረራል የሰሙም የማስወሰድ ይከፍት የሚያከብሩትን ያላካተተው የሚመክት የላኩልህ ይህንማ ይመክሩ ያዋረዱ ይበሉዋቸው የገንዘብም የጠ