            amharicWords[23, 7] = "ይፈታተናል ይጨፍራሉ ያለባለቤቱ የኢሳ የማይደሰት የረዲኤት የአምላካችንን ያልተማረ የሚራራ የሚልከው የተጓተቱ የቀረቡና ያልተማሩ የሚገቡትም ያወጁትን የሚያስገኝላቸው የሚዋደዱ የተሳፈሩ ያሰኝ የፈረንሣይን የቻሉበትም የነባሩ የአብራኬ የመርጨት የተደረገበትም የተለጠፈበት የመጅሊሱን የወጡም የተናገሩትንም የኛንም ያልመለሱት ይጭን የሚዋጉበትን የዳበሩና ያሰርኳችሁ ያገኟትን የሚያብራሩት የውጡ የአዳማና የሚከታተሉበት የተለሰነ የውጣ የባንዳነት የውጣው ይከስሳል የተጠረቡ የውጨ የሚደሰቱበት የውጩ የተሃድሶና ይከታል ያደረጉን የበላይነቱ የተከመረው የሰደደውን የተወረሰብን ያባውን ይገርምሃል የተቀነባበረውን የሚያደርሳቸው የድፍረትና የትናት ያፍሪካ ይንተከተካል የሚያጋባኝ የሚስጥር የሞይ ያስነሳውን ያነሳላቸው ያሰጨነቃቸው ይነግዳል ይሻራል የማገገሚያ የታሳሪዎችን የየዞኖቹ የማውንቴን የሸርሙጣ የተፈጠረውም የአገራችሁን የአካላዊ የምናጣው የጎጠኛው የዛምቢያው የሚመሰክሩት የጣልያኖች የሁለታችን ያቀረብኳቸው ይዋቀር የሚልኳቸው የመውሊድ የከለከለውን የአንዳቸው የሚዋሰነው የመገኘታቸው ያሳደግናቸው የሚጠረንፉ የሶማሊያውያን የተከለውን የክሳቸው የፈለከውን የመታጠቢያና የተመቸውን ይታጣል ያላገኘችው ዩኤንኤፍፒኤ የምሮጠው የማሟላቱ የጭቁኖች የሲዳምኛ የብሔርተኝነት የተሰራጩትን የሚመልሱ የማያውቋቸው ይለመልማል የለምም ያጠፉትን የሃገሩን የሚያስወቅስ የአንበሣ የእስራቱ የአዕምሯዊ የብራሰልስ የሚሰቃየውን ያሻንን የሚያያዝበት ያጠራቀሙት ይገርምሀል የሚንገላቱት የለገሰችው የእነተወልደ የሚቋቋምበትን የማያስፈልጋቸው ይሰተዋላል ይረከቡታል የፓትሪያርክ ያላስገኘላት ይታወቅልን የሃውልቱ ያለመከተል የምትጠቀሙበት የመከረበት የተገጠመላቸው የዝቅተኝነት የጭፍንነት የማስወገዱ የሞከርኩት የሚያያዘው የሚጠበቁበትን የእምቧይ ያሉበትና የኢኮ ይገለፃሉ የሚያጋጥምበት የተሸፈነና የሚመቸው የሚያስከትሏቸው የሚከፍሉበትን የሚያሻሽልበት የሃይማኖቱንም ያስቆጠሩትን ይዘልፋሉ ያገኘንውን የኤርትራውያንና ያልተነካካ ያማራ የዩኒቨርሲቲዎቹ የማከብራቸው የመንፈስና የአሁኖቹን ይህንኛው ያዛወረ የእርኩስ የሚያስችሏቸው የምታጠፉት ይናገሩት ያስይዛል ይረዱናል የፀሐዬ የስር የመፍጠሩ የሚዘጋጅና የታጀበና የባንኮችና የኢየሩሣሌም የተሻገረችለትን የከበደው የሚነሳና የብክነት የሚያወራውና የቀንና የሚያስጠላኝ ያሳዩና ይታጀብ ይችልበታል የመቆየትና ያለመመለሳቸውን የሚዳኝበት ያሳዩን የሰፋችው የተጋረጠ የአሜሪካኖቹ የአልጄሪያን የሚያቀላጥፍና የተጋረጡ የተሠማሩና የሚጠቅማቸው የሚገጥሙ ይሠረዛል የለህምና የሐጂና የሚያጎላ የማይገናኘውን የሮተሪ የሚገደዱት የሚፈልግም የኖረችውን የድክመቱ የተጎበኙት የሐውዜን የሚታዘዙት ይቀጠራሉ ይታወቅልኝ የምፈራ የመዘርጋትና የሚልሱት የነገስታቱ ያደረገችበት ያልታዬ የሚያወራውን ያነሣቸው የመሰረተችው የምናደርጋቸው ያመሰግናል የሚያቀነቅነው የስልጣናቸው የኬሚካልና የሚገፋፋና የጠማው የምንደራደርበት የምትገኘዋ የኾነውን የማያሳምን የጎድን የኤረትራ የሚካሔድ ይሸረሽራል ይፍረድ የሟቿ የሚገፋፋን የሚስማማበት የኤታማዦር የህፃናቱን የዕልቂት የተዋደቁ የተወረሰውን ይመጣልናል ይፈጸምሎታል የዋስትናው ያስቀጥላል የደከሙትን የመንግስታትን የሰማች የከፈለበትን የቻልንበት የተገናኙበት የኢትዮፐያ ይሻለን የፍህት ያፀደቀውንና የሚበላሹ የፋርማሲዩቲካል የባሰባቸው የሰደተኞች የግዚሄር ያልኩሽን የከበቡት የኬሚካሉ ያፍራሉ የተቃወማቸውን ያስጠሩ የስባዊ የማህበራቸውን ይከዳል የኦክላሆማ የተጠየቀችው የህብረተሰብና የወሰነላቸው ይመጣና የሚያ