ጽና የሴትነት ያልደረሰባቸው ያምኑ የተነቃነቁ የፀረሙስና የህይወታቸው የተመቸና ያልተደረገላቸው ይፈሳሉ ይሰጠዋልን የተባዛ ያሳተሟቸውን የደርግና የቦኖፓርቲያዊነት የኖርዌዩ ይበጀው የሚደርስባቸዉን የኢትዮጵየ የሚታወሰው የሚቀነስ ይፈሳል የአሳታሚዎች ይዞለት የተተካው የመመለስና የምናየዉ የማይሞላ የአስተዳድር የተረበሸ የተዘገቡ ይክፈሉ ይሸመጥጣል ይሆኑኛል የሚካሄድባት የተረበሹ የግራዝያኒን የማልወደው ይወረወር የማይገናኝና የአማፅያኑን የማወናበድ ያለጠበቃ የሚያደርጓት የእኒህን የማደሱ የሚሳበው የምትወስደውን ያለመፈተሽ ያጠናው የሚሠራና ያነሳሁት የክሊኒኩ የሚያቀርቡልን የተንከራተተው የተደረገን ያነገገረ የቤተዘመድ የሚገኙበትና የፔን ያከናወነችው የሠርክ የሲንጋፖር የሚያጠናክሩት የመጠለፍ ይሰደዳሉ የማቻቻል የኢትዮጵይ ይነገረው የአፕልና የዱብቲ የላይ የታገልነው የነውር የፍስሐ የመንጠቅ የሚመካከሩበት የመንገዶቹን የምንገምተው የሚያደራጁት ይሰምጣል የሚያምንባቸውና የሚነካው የታሸገበት የማትፈልገውን ያስገባት የተቆፈረውን የፈጸመበት የታገዘና የሰጠባቸው የኮንትሮ የህብረሰብ የተፈጸመበትን የሚያጸና የሚንቁ የመበርበሪያ የተቆጠሩት የፍሬዘር የማይጠየቅበት የኢቲቪው ይችለዋል የተመዘገበና የተመጣጠነና የሕሊናና የዝምድና የስኳርና የመቅደላን ያውራ የለብትም የዘለፋና የተገደሉባት የረቂቁ የሚያዳምጡ የዐፄ የኢተዮጵያ የፈሰሰውን የጠፋባቸው የተመሰረተዉ የሚያቆመው የሚታሰበውን ይተኩሳሉ ያለሁ የተቀደመው ያቆማሉ ይሰረዛል የአማጽያኑ የክስታኔ የሴቲቱ የመልካ የሚያሳትም የሚታዩባት የተነጋገረው የሲነጋፖር የመልክ ያስወገዳቸው የተስማማበት የመጽሔት የሚመረቱበት የማድረስና የማገናኘትና የተቸገሩትን ያተኮረባቸው ያድርገን የትዮጵያ የመጽሔቷ የሚተነፍስበት የሠራችውን ያዘችው ያንገበገባቸው የሰነዓ የሚገቡትና የሚያሰባስቡ የተመልካችን የዴሞክራሲያ የምንጠብቅ የሚሳደቡት የተራመደው ያመቻችልን የተጠለሉት የልህቀት የምንሠራበት የሉተራን የሚያደርገቸውን ያሉበትንና ያስተፋል ያበጃል የታዲያስ የበርካቶች ያለባችው የማወናበጃ የደንበኞቻቸው ይደበድባል የውብሸትን የወገኑን የሂሩት የሚነቅፉ የመውጣቱን ይጠሩና የመጠቅለል የሚለምኑት ያንድን የፋርስ ይፈርማል ይጀምሩ የቴክኒዎሎጂ የሻገተ ያለማቅማማት የተላለፉትን ያሳስራል ይመጥናል ያነጋገር ያምጡ የሚያዋጣውን ያላስደሰተው የውያኔ የማያስጠይቅ የዘመትከው የሚታይላቸው የባዶ የሚመኙትን ያሰለቸ የተዘሩ የማይመጥኑ የሚያከፋፍል የዘቀጡ የሚያሳቅቀው ያፀደቃቸውን የእህቴ የማመዛዘን የተዘራ የሮማዊያን ያጠራጠረ ያጥረኛል የማይቃረን ያሁኖቹ የሚከፈትበት ይጨፈጭፉታል የሽፍቶች የሁላችሁንም ያጭበረብራል የሚጣሉበት የሚሰጡንን ይወደሳል የድልድል የጠቀሙ የሚከፈልባቸው የፈቱበት የተሰባሰበውን ያሳጣ የሕዘብ ይዞብን የሚያሳስቱ የእንቅስቃሴያቸው የጂሲኤስ የምናውቃት ያጥር የተላቀቀች የማራቅ የዕምነቱ የሸሸ የምንመለከት የአብዱልቃሲም የመጨረሻውም የተከሰተባቸውን የብድሩን ይዘውም የሰከረ ይለውና የቤተሰቦቼን ያለመመጣጠኑን የሚዘነጋው ዩሱፍና የተሰማሩባቸው የእነአባይ የመስተናገድ የምትገፋፋው የሚያለቅሱበት የተሰበሩ የሰጠውና ይከታተሉና የትርፍና የሌት የእውነትና የሲፒጄው የተኮለኮሉት የተዘነጋ የሃፍረት የትኞቹም የሚሸጋገሩ የጎደለበት የእቅዳቸውን የሚከብደው የፍርደኞቹ የባጥ ያመለከትነው የሚተዋውቁበት የሚወለድ የሚያነበው የሚገለገልበትን የገለጽኩትን የሃይለ የጀግኖችን የሚያስገኙት የተመለሰበት የፎርብስ የምትላቀቅበትን ያምረኛል የሚመረምሩ የሶጅያ የኤክስፖ የሠፈራው የመቅረቡን ያደመጡ የሃይሌ ያለየለት ይልቅም የማያንቀላፉ የንጉሳውያን ያነሳሱት ያሰራጫሉ የነበራትና የማደን የተበደረችውን የሚቀጠረው ያበራ ያበር የታጀቡት የተሰየመችው የመንደሪቱ ይደርሱብናል የየድርሻቸውን የሐይል የተናገሩትም የሚያሳካው የጠዋቱ የመስረቅ የዳያስፖራውን ያሰራጫል የሚመለክታቸው የሚሠራዉ ያድሳሉ ያሰባቸውን ይሰነዘሩ የህወህት የሚወርዱበት የራሻይዳ ያልደገፈው ያለኔ የህልም የማከፋፈሉ ያስረዳናል ያደረጉትንና ይተኮሳል የጎደለዉ የማወጋችሁ ያፋሰሰ የማያንቀላፋ ያጠናክረዋልፊልም ያደረሳት ያለኛ የእከሌ የታገልን የምትሠራው ይሰነዘር ያደነቁራልና የተሰዋው የሆናችሁ የነፍሱ የበቁበት የሚናፍቅ ያዳናት የሚቀስሙበት ይወቁለት የሌጋት የሚሞክሩትን የአማልጋሜትድ የሚመዘገበው ያሳደገው ይጠበቅላቸዋል ያወያዩ የውሃው የብልግና ያስቀምጧቸዋል ይዘርፋሉ የተካሔደ የዠግንነት ይሔን የካርቱሙ የሚፈልግና የማያስፈልገው የምወዳት የሡዱኑ ያልፍልኛል የዶሮና ይመንደግ የትምህት የዶሮን የሰበኩት የዕኩልነት የኦሃዮ የህንደኬው የግለሰዎች የመላላክ ያሳስባታል የምናከናውነው የመነቃቃት ያዞርነው የሸኮ የተተከሉትን የከበዳቸው የተማረሩት የዱብዳ ይሄውልሽ የሚመርጠውን ያለዎ ያልሰማ ይሔንን የሚያጥላሉ ዩሃንስ ያቃጠሉ የሸኸ ያሻሻለውን የእምነቶች የሚሠየመው የሚሳተፉትን የማቆየቱ የዶጋሊ ይደርቃል የሜርኩሪውን የአዛውንቶች የሸኽ የተፈጠረና ያልዳበረ የኢየሩሳሌምን የኢንደስትሪው ያልደረሰበትን የሰቀሉ የሃይቁ የገዙበት የሰረዘ የግንኙነቱን የተለከፉት የቆየውንና የረሳሁትን የሃሜት የተመቻቸው የመከነና ይጥላቸዋል የእረኛ ያላስታወቀ ያውጣ የሐይቁ የምታይበት ይተግበር የሕይወታቸውን የሚያወቀው ይመልከቱት የተላቀቀና የኦቦ የእኝህን የካኩማ ያፈሰሱበት ይዘራሉ የቆዩን የርጭት የወረወረ የሥልጤ የሊቀመንበሩን የማያድን የኩዌትን የቆመዉ የተመሠረቱና የዳረጉት የሚከጅሉ የሚያስተውል ይዛችሁት ያሳደረውን የሚወጣበትንና የፌዴራሉና የዝንብ የእኅት የታሪኩን የምንወያይበት የጓጉ የማይደፈር የምትገኘውንና የተቀመረ የስቴፈን ያመነና ያልታረሰ የተመራቂ ይፈልጋሉና የዘውዲቱ የሚለብሰውን የሚጠብቁና የማያመች የተቀረፀውም የፅንሰ ይመልሱልኝ የትንታኔ የምነግርህ ያመለክቱት የነገረችኝ ይቆሙና የቱምሳ የሚያለማ የኢኮኖሚያችን የየመስሪያ ያረግበዋል ያላስተዋልኩት የተሰማንን የደንጊያ ይቀድሞ የሰከኑ ይፋጠናል የጎጃሙ ያልተቋጨ የተቀመጠበትን የየዕለቱ የአጥቂ ይቅርልን የሚያስፋፋው ያልሆኑበትን የአሠልጣኝነት የወለዱዋቸው የሐረሩ ይሁንልኝ የፍላሚሽ የዝግመታዊ የምሥጢር ያዘንና የሚከራከርበት የተረዳችው የቅዝቃዜ ያቅፋል የሰነበት የምስረታና የጠጠርና የአሽከርካሪ የተሰለፈውና የሚወስድብን ይዘውና ያበዙ ያከበሩ የማይመቹ ያልመጡ የሸጠ የማይሞት የተለከፈ የመዓህድ የእናንተም ያባታቸውን የተሻሻሉት ያነጋገርነው የማጓጓዙን የህክምናው የልቧን የሚለያዩ የኤሌክትሪካልና የበረራና ያልተቻለበት የሚረከብበትን የተደረገዉ የጉልበታችሁን የወጡበትን ይተነፍሳሉ የሚያስፈልገኝ የጣላቸው የዕድል የሚያሳርፈው የተገነዘበና የፋኖስ ያገደበትን የተሟላለት የማይለውጣቸው የቅርባቸው የተጠቀሰውም ይነቅላል የአዳፍኔ ያስታወሰኝ የተሰገሰጉበት ያደርግለት ይነግሯቸዋል ይልቅና የሚያስቀምጥበት ያልሰማነው የሚፈቀድለት የስታርባክ የፌዴረሽኑ የምትወለደው የመጉዳት የሚቀበሉና የተራበን ይቁሙ የጠፋች የሚያስረሳ የማደግ ያልጠረጠረ የላኪዎች የሸፈተ የማደጎ ይለውጥ ያንዳንዱ ያምራሉ ያጠቃት ይጣፍጣል የማሳሰሉት የሚኬድባቸው የብሩ የሚስተናገድ ያላወቀው የእናቱን";
            amharicWords[23, 8] = "የሣተ የሽሬእንዳስላሴ ያንዳንድ ያመጣችው የተጫፈሩ የመሙላት ይበዛባቸዋል የድግሪ ያገናኛል የነታምራት የሚጠፉ የማዞሪያ የአገሪቱንና የመገዳደል የመነገድ ይመስልሀል ይፈራ ይዳብራል የካምፓላው የማፍያ የአዎንታ ይዘጋጃሉ የዉርደት የሚሰራባቸው ይዛችኋል የአንድነቱ የድርሻቸው ያቀፈና ያመረተ የሚቆጠበው የተገኘለት የኢንፍሎይንዛ ይወልዱ የተመደቡትን ይመርምር የተናቁ የተወካዮችና የሚሠራውና የባሕርና የማይሻማና የተወከለችው የሻምፒዮናው የተተቸ የተጓጓዘውን የፊሊፒንስ ይተነትናሉ የተመረጠበትን የኖረውና ይምርሃነ የመጠቃቀም የተንቀሳቀሰውን የሞያው የኀብረቱ የሚያበርደው ይሰለጥናሉ የዓሳን የተገበሩ የሚያሠሩ የተቆጣጠረችው የተጠላው የሚቀጠሩ ያወጣዉን ያነጋገረቻቸው የትኛውስ ያሳተፈና ይታይሃል የካዳስተር የኀብረት የጀመሪያ የሁኔታ ያደናቅፋሉ የበኩሌንና የነውጥ ይሕን የተዘፈቁበትን የሚወጡበትና የኦፕሬሽናል የሚያካሄዱበት የተዘረፈባቸው የሚያሰለች የተቀማውን የማይመኝ የሚፈለግባትን የትግራይም ይርጋው ያሣለፉ ይሰለጥናል የካምፑ የኑስና የአያን የተሳከረ የአተያይ ያልታተመ የሚተገብሩት የተፈፀሙበት የአብርሃ የለውን የላከችልኝ የብቸኛ ያልታተሙ የያዙትንና ይሰጥባቸዋል የሕብረ የላይዘን የፍሬዴሪክ የአኝዋኮች የባልትና ያለፈውንም የሚጠፉት የግብፃውያኑን የሰጡዋቸው ያዘመታቸው የሚጠብቁበት የሚሻሻለውን ያለመግባቱ ይደሰታሉ የሣዋ ይወራባቸዋል የፍላጎቱን የኮሎራዶ የተጠቃለለው የሰሩትና የሳንዲያጎ የሚኖረንን የተዳመጠ ያሰባሰቧቸው የተጨፈጨፉት የሚገልጠው የተለሳለሰና የማያሰኝ የቅጽል የሚሰፍረውን የሚለያይባቸው ይደናቀፋል የእንግሊዝንና ያከበሩት የወጣዉ የፋሲካው የአጎት የመሆንና የእግዚያብሄርን የዘራውን የሚቀርቡባቸው የየአካባቢያቸውን የሚያጭሩ ያልጀመረው የምትጠላ የመግዣ ያለምህረት ያሰራጩ ያልፈለገውን ይገዘታል የሚያውቋት የአነጋገር የዚህኛውን የሕፃኑንና የተቀመጡበት የተጣላው የአሣሣል የዘለሉ የአቪዮሽን የዩሮ የአብዮታዊው የማውቃት ያላስቻለ የሠላምን ይጨነቁ የሞቱባቸው የተሸበበ የምንሰማውና የሚያስገኝላት የሞከረውም የኮሚኒዝም ያልተቋረጡ የሐዋላ የጣልቃ የራበው የተመዘዘ የተሸከሙ የህግም የሆነብን የኤፍሬም ይመዘግባል የዳኑት የተናገሯቸው የአሌክስ የሊበራል ዩኑየኑ የኒህን የመሟላት የሚቀረውን የተደረገውንና የተዛመተው የማስተባበሪያ የሚያስመጣ የፍሪካ የዘልቋል የየበኩሉን የሚጓዝበትን ያስጨነቀው ያሰለጠነ የሚጠቁመን የነዚሁ የመሰረዝ የወንድም የግጭቶችን የፕራይቬይታይዜሽን ይግባው የህጻኗ ያቆቢኖች የወንድሟ ይካሄዱበታል የቀአዴድ ይጭናሉ የሚስተናገደው የማስመሩ የተመዘገበባቸው ይወነጀላሉ ያሠሩ የኔአለም የትራንስፎርመር የታወቅ ይወሩናል የሚገባቸውና የሚሰራዉ የሰቀሉት የሚያውቁትንና ይገለገሉባቸው ያልተደረሰው የኢጋማ ያየህን የሚጠብቋቸው ይገድላቸዋል የማስመር የሚቋረጠው የጉልት የቻዱ የተረሸነና የተቸረው የነደፈ የነበሩባቸው ያለመገዛት የዓይኑ የርዕሳነ ይረግጣሉ የማይፈልገውን ይነግሩታል የሮጠው የሚቃወሙትም የማይቻለው የጉልቻ ያሸጋግራሉ የተተከለበት የሚደነግጉ የዓረቡ የጸረሙስና ያላደረገና ያሰፈርኩት የአፋሮችን የሆነችና የመመለሳቸው የሚስቡት ይኖሩባታል የሚገኝበትና የነገረችው የሚኖሩባቸውን የዳረጉትን የማያውቀውና የተቀረውም የተለጠጠ የሆነችን የሚዛወር የነፍጥ የደስደስ ያዋክባሉ የእንግሊዟን ይደነቃቸው የሚሰነዘርባትን ይቻለናል የቦራ የሮቡስታ የተሽመደመደው የተገናኘው የሐሴት የምንገዛው የሁለትዮሽና የጦማሪያን የእኩለ የተባሩት የሚያሳልፍ የፈታነው የሚታው የጁቡቲ የሚጽፈው የሚበጁና የተዳረጉና የኅብ