            amharicWords[23, 9] = "የምናቀርባቸው የሚሄደውና የምትመሳሰል የማይቅም ይገነፍላል ይጠፋኛል የማይገልጹ የምናውቀውንም የሚወጣልን የሚያመዛዝን ይጎድለናል ይደረመሳል የምንከተላቸው የማያስጠራ ይጠነቀቃሉ የሚተርፍና የሚተማመንባቸው የምታከፋፍሉት የማይገልጽ የማይተመኑ የማካፈል የሚጠይቅበት የማውረስ የሚገባዉ የሚለምን የሚታሰሩበትን ይጠነቀቃል የመጎብኘትና የምሰጥበት የሚለየዉ የማትፈልጋቸውን የሚመድቡበት የሚያህሉ የመተካካትን ይገባልን የማይተመን የመመዝበር ይኸደስበታል የሚፈጽሙዋቸው ይዳዳዋል የሚከፈተውም የሚጨናነቀው የመውለጃ የሚመለከታት ይጨናገፍብናል የመበላለጫ የሚሳካው የምናሳይበትና የሞቱለት የመሰብሰቢያው የሕዝባችንም የሞኖፖሊ የምንሰበስበው የማይተላለፉባቸውንና የሚወክለውን የምትመለከቱ የማይፈቀድለት የሚገጣጥሙትን የሚተከልበት የማልናገረው የምታሳድገው ይጥሉታል የማዕርገ የማይጨካከኑባቸውን የሚነጉደው የሚታደስበት የሚነቅፍበት የህዝቧን የሚፈላባት ይፈጸምባቸዋል የሚጋባው የሚመጣባት የሃርድ የላከችዉ የሚያሠራጫቸውን የማመሰግነው የሃማሴን የሚጎድለውን የሚሰበስቡት የሚያስቸለው የሚጾሙ የሔድኩት ይፀልዩ የሚቀበለውና የሙሰኛና የማጣራው የመዘናጋት የሚዘግብና የሚጠሉና ይጥላታል የሚወገዱት የመሸጋገር የሚነሡ የምእራባውያንን የሚዘልፈው የማያካትታቸው የሚረግጥና የሚገኘዉን የሚጸልዩት የሚገዛት የሚያገናዝብ የሚሰበስቧቸው የሚናገርላቸው የሃቨል የመመስከር የሚፈነጥቀው የሚመሯችሁ የመላእክትን የሚድኑትን የሚያመለከት የሚያሰሙም የማኒፌስቷቸው የሕግም የማይመሳሰሉና የሚቃወመውም የመቅደስ የምጠየቀው የማይሆንላቸው የሆዳምነት የሚበቅሉ የሚመዘግብ የምረግምበት ይደበላልቃል የላፍቶ የሚንደው የሚያጎናጽፋቸውን የማይቆፍሩ የማብራት የሚኖረኝም የሚፈናቀለው የሚያፈራው የሚታማበትን ይፈታው የመሠረቱበት የሚስታቸው የመቆጣትና የሚሳብበው የማይሠሩት የሚገጣጥማቸው የማይፈፀም የሚያስተገብራቸው የምትሻለው የመጠቀምን የማይሹቱ የሙስሊምና የሚከልሱ የሚያግዘንን የማግኘታቸው የሚገዳደሩ የሚጠቅምን የሚያጠያይቀን የሚለያዩት ይወረዉራሉ የኅዳር የሚያስወግዱና የማያንሳቸው የሠረዘ የለቀኩት ይወርፋቸዋል የማይፈጽሙ ይጨመርልን የሚኬድባት ይገድለዋል የኅዳሴ የሚላኩበት የሚገዛን የሚደርስላቸው የመሰረቱም የሚያምስ የሚመዘግበው የመሞከሻሸት የማታልቅ የሚልብት የሰበአዊ የሚገድለውና የመነቋቆር ይጮሀል ይጽና የማንቋሸሽና የሚቀፍል የመጠየቂያ የምንጸየፋትን የሚስፈልገው የሕንጻውን የሆኑቱ የሚዘወተርባቸው የላቸውማ የሀረሪ የሚኬድበት የማሰለፍ የማንቸስተርን የምታመነጭ የማሽኑ የሚቀርጽ ይጠቅሱና የማይመጥናቸውን ይፀልያሉ የሚሠለጥኑበት የመልእክቱን የማግኘትን የሚጋልበው የመቃቃር የመውጊያውን የሙር የሀገሬን የሚወራለት የሚመስሉም ይውጠናል የሓዋና የሌብነቱ የሚሆንን የሚታገሉለትን የመሰሎቻቸውን የሚሰሙበትን ይገንቡ ይጎላል የሠራናቸው ይገንባ የመስጊዱን የሚሞላት የምትጠይቀኝ የሚጎርፉ የማይደረስበት የማራቶኑን ይወርድና የምንለያየው ይጥረበኝ የሚያጎናጽፉ የሚጠቀመውን የሚቸግራቸው የሚድረግ የሚፈልጋትን የምትጠቀሙ የማየትን የሚቀርባችሁ ይጨልማል የማያደርጉትን የሚያየን የሚሰረዙ የምትሰሩትን የሚያፈስ የሚጠየቁና የሚሯሯጠውን የምንከፍተው የምናየውና የምድሪቱ የሚረቱ የሜዲትራንያን የማይፈልጉዋቸውን የህብር የሚመሩን የምንገለገልበት የምንቆራመደው ይዘረዝሩ የሠራውም የማይጋሩት የሚከበሩትና የሚታዩብንን የሚያጠነጥኑት የሚጨብጡት የምልከው የሚተረጉመው የማስረዳትና የሚበተንበት የሄድንበትን ይዘባነናል ይገረዛሉ የለብሽም የሐዋሳው የምንወጣውን የምሞክረው የማይኖራቸው የማያ