            amharicWords[24, 0] = "ደክመናል ደሞዟ ዲፕሎም ደብቅ ደረሰኽ ደርሸበታለሁ ድብዳባ ደፍተዉ ደበዳቤ ደሚትን ደውሎላት ድሬክተር ደላሎቻቸው ዴቨሎፐርስ ደማማቅ ደፈሩ ዳጬ ደግመዉ ዳሌዋ ድፍረቱም ድክመቶችንና ደኅንነቶቹ ደቅነው ዲይሳፖአራው ደብዳቤአቸውን ደግማችሁ ደፍተዋል ደቃቃውና ደንጋጌ ደብረገነት ድጋፋችን ደፍቷል ድረጊት ዲያቆኑ ደልደል ዴኤታውን ዳግላ ድላማኒ ደረጃዎችንና ድሜጥሮስም ዲኤስቲቪ ደቅድቆ ደፍሮኝ ዳንኪራና ድንጋጤውን ድርሰታዊ ደንቁሮ ደረሰላቸዉ ድጋፍችንን ደርቡሽ ድመዳሜም ዲአርአርዳብልዩ ድክመቶችና ድቤዎች ደንበኛውም ደብዛቸውን ደስታየ ደምሮ ድሬና ደበረኝ ድሪአ ዱላቸውን ደንጋጣ ድምፆችም ደማስቆ ድሮግባን ደማቁ ድምጻውያንን ዳርድንበርና ደቅኖብን ደልቃቃ ዳይቨርሲቲ ድምጻቸዉ ዳዳው ድስኮራ ዳፋው ደላላዎቻቸው ደምቀ ድባቤ ደርገዋል ዲግሪዎችን ድርቀቱ ድምቀቱ ዳኝው ደልቶህ ደብዳቤያችን ድክመቶቻችንን ደብድብ ደምስሰው ድርክቶች ዳንቴን ድረው ደላላውን ዶክመንተሪው ዳያስፖራውም ዳድቶታል ደንበኛም ደርቡሽን ዲስፕሮክሲል ደጋፊዎችንና ደኅንነታችንን ድረስልኝ ዲፌንስ ደባው ዳምጤና ድርሻዎችን ደርግነትን ደንበኞቼን ዳሮች ዲዛይንን ደኅንነታችንንየሚገልፅ ደብዳቤዋ ደገመ ዶሴዎቹን ዶለው ዶርትሙንድን ድህረገጾች ድርጊታችሁን ደራሲዎቻችን ደገሞ ዶላቸው ዶሴዎች ደብዳቤዎ ደነዝ ደግመህ ዳኒኤሊ ዲዛይኖችም ደርሰውና ደብዳቢዎቹ ደርሰዉ ደግመውታል ደስታዬን ደጋግመሽ ዳኡድ ድርሻህን ደረሰህ ደራስያኑ ዴህንነትና ደዘዎች ደራሼ ድንብራቸውን ዲያራ ደህንነቱም ድንገቴ ደንቦችም ዲክቴተርን ዴሞክራሲያዊነትና ደጋፊዎቻቸውም ደንድኖ ዱካውን ዱሬቲ ድንቃዊ ደምድሞታል ዳርገውት ድንዛዜን ድርሳናቸው ዳኢዎቻችን ድምፃቸውም ዲኤምሲ ደሤቶች ደፈነች";
            amharicWords[24, 1] = "ዳቦውን ደርቢያችን ድለላዬን ዲቫይን ደበደብኩ ደንዝዞ ደብተሬን ደርሶም ዴሞክሪያሲያዊም ዲሣ ዲዮፕ ደሞወዝ ደፋሮቹ ዳያስፖራም ደጋፊወች ደሴየት ዴንሲቲ ድረገጻችንን ደዉዬ ደባልቆ ድምዳሜውን ደመናና ድግሶችን ድሮችን ደዋዩ ድህነቷ ድስትና ደረትና ደልዳላው ድምፃን ድንቃይ ዶየር ደሞዜን ደራሲዎችም ደነፉ ደካማነትና ድሪብሎችን ዲኑና ዳቢንቺን ደህንነቱንም ድርድሩና ድንግልናዋን ደውሉልን ድባብና ደራሲውም ደጃዝማችና ደጃዝማቹ ደረረጃ ድንጋጌውን ድገመው ደርሷልና ድክመቶቹ ድለቃ ደገሙልን ድምፃውያት ዲያሬክተር ዲኔ ድምፃቻን ዲሞከራሲ ዳያስፖራውና ደገሙኝ ድፍረታቸው ዳራዎች ዴሲሳ ድግስና ዳታን ድረገጻችን ዶሪሆች ደሞዝተኞች ደፍቶና ዲጄዎች ደቀመዝሙራን ዳውኒ ዲያቢሎስን ዳምኖ ዳውን ደብዳቤዎት ድራማም ደራስያንን ዶግማና ደስይልም ዲሞክራሴያዊ ዶክትሬታቸውን ዴንማርካዊው ደነስን ዱቄትን ደራሽነት ዳውሎን ደጋፊውንም ደረጃንና ደነቆሩ ደብዳቤውም ድሎታቸው ደለላማ ደስታዉን ድሯን ድንቄ ደንነት ዲኮደር ደብዳቤዎቹ ደርሶብን ዱራሜ ዳታውን ደግፈውት ድርቅም ደሳለኝንም ዳይኖሰር ድርሃማቸውን ዶነሮች ደውላለት ዳኮታ ዶሮው ዴካርተስ ድራፍቱን ዲያሊስስ ዲቪዚዮንን ደግነታቸው ድረአምባዎችን ዲስያፖራውን ደርጉን ዴሞክራሲውም ድንጊያ ደራጅ ድርሰቱ ደኅንነቴነን ደኅንነትንም ዲኤንኤ ዳም ድፍርት ዳረጋት ዳርታ ድንግልናቸውን ድርሳነ ደመወዛችን ደግመነዋል ዳሬ ድምጡ ዳሰሳም ድምጸት ደብዳቤዎችንና ድሪንክ ደካማነቱን ድምፆችንም ድረሰብኝ ዶሎማይት ድህነታቸውም ደረሳ ድርሳናትም ደንግዞና ደረጀን ዲፕሎማትም ድንብርብር ዲዲዬር ደረጃዎችም ደብዝዟል ድራሻቸውን ደገመው ደህይተናል ደንቆኛል ድንገቴዎች ዴሞክራሲያዊነትን ደመወዙም ዲፕሎማሲዊ ዴሞክራሲያዊን ድርሻዬ ድብርቴ ደንበራችንን ድኩም ደቡብም ደርሶባቸዉ ድሮውንስ ዳሲልቫ ድኩላዎችን ደጋፊነቱን ደህ ደንዞ ደራሲዎችስ ደስተኛም ደግመኛ ዶክመንቱ ደወሎች ደሳለኝስ ደፈሩት ደክማለች ዶክትሬቱን ድምዳሜም ደረገጾች ደላላና ደረሰኙ ደንብሮ ዴንታል ድቁና ዲስኩሩ ደሳለኝከዚህ ደሲሳ ዳይናስቲ ድንክ ደጓሚ ድረሱ ዲሞክራሲያችን ዴሞክረሲ ደጋግመህ ዶሮውን ደረደሩ ድምፃቸውንም ደጋፊን ዲቯር ደንበኞችና ደገኞቹ ዴርቶጋዳ ደቆ ዲዲየር ዳይሬክቶሬትና ደባራ ድርደር ደንባራ ዳያስፖራዉ ዲዛይኖቹ ደፋቀና ዱርና ድብትርና ዶለር ድኻውን ደበላለቀው ዱለት ደከመኝና ዲሞክራስዊ ደሜንም ደኅንነቱን ድንቆች ድጋፍንም ዳሂሎን ዳያስፖራዎቻቸው ደፊዎችን ደርሷችኋል ዴሞክራሲያዊው ደምቡም";
            amharicWords[24, 2] = "ዳንኪራ ድህነቱን ዲቃሎች ዲዋር ዳዴ ዳንሳሞ ድግሪና ዶክተርና ዲንነት ደርሳችኋል ድንጋጌዎችና ደቼ ደረስኩበት ደርሰውኛል ድርጅቶቹም ደንከልያ ደብቃ ድግር ደብቄ ድሉም ደህናውን ድንብና ዳገቱን ደቂቃዎችን ድክመትም ድምጻውያን ዳብረው ድርጅቶት ድምፆችን ደላሎችም ደነገጥኩኝ ዳይካ ዲሣሣ ደደር ድንግልና ደምበአርቃይ ድርጅቶቻችን ዲኤታው ዲፓርትመንትና ደንበር ዲሲው ደደፎን ደሃን ደህንንነት ዲነካ ዲፕሎማሲን ደንበሯ ደሙም ደከማቸውና ደውሎልኝ ድህነትንም ድሪቶ ዳብሯል ዳያስፐራ ዲሞክሪያሲያዊ ዳፍ ደግና ደቀቀ ደንከሎች ደዋ ደው ዳስሰዋል ደቀመዝሙር ደግሞታል ዴቭሎፕመንት ድራማን ደማም ዴዥሜ ደብዳቤዎን ደዴሳ ደንግጨ ደኅንነቶች ደበላን ድንቅና ዴንተንና ደንዝዘዋል ደምስሻለሁ ደሴን ደብድበውና ደይ ዳርገውታል ደንግጬ ዲስኩራቸውን ድህረምረቃ ዳግሞ ደንበኞቻችንን ድሮች ድራጊስቶች ድምፁም ዲምቱ ድምፃዊው ደክሟል ደወሉን ደጋፊዎቹንና ደጋፊዎቹና ደረስሁ ዴሞክራቶቹ ደነገጠች ደርሶአቸዋል ዴቢሳ ደርጋውያን ዶተር ደክሞዋት ደጋፊውም ድረገጾችና ደጎ ደሰላኝ ዲሞክራሲንና ደርድረዋል ደስታዬ ደብረሲና ዲፖሎማቶች ድርጅቱንና ደራሽና ደምቃለች ድሮና ደውልልኝ ድሮን ደነገጡና ድረገጾችን ዶማውን ደከመ ዱሩ ደርቷል ዳይድ ደግፈናል ደብርና ዱሮ ደመወዝን ዲያቆናቱ ደንገጡራቸውን ድርቶችና ድራፍትና ዶርአን ዱቄትም ደለሉን ድንዝዝ ደበበን ድርጅታቸዉ ድክመቶቻቸውን ዲክሽነሪ ዱጉማ ደፍ ዳርቻው ድንገታዊ ዱሮም ዶርዜ ድርድርንና ደግሰው ዲያሌክቲካዊ ዱቦ ደብዛውን ዲዛይኖቹን ዲኬቲ ድቀትን ደንገጥ ዴድ ደገጊቾ ዶላርስ ዳርጓቸዋል ደምቶ ድሃዉ ድንጋይን ድሌ ዳግመና ድጎማም ደጋግ ድሪያ ዶክተርስ ዱባይና ዲግሪዋን ድሜ ደብቀውና ዲቪዥዮን ደነቀኝ ድጅቶች ደመወዝም ደመወዜን ደንግገዋል ዳኒኤል ደሳለ ደሞዛችን ደንበኞቻቸውም ደብተርና ድሮውም ድሪ ደንብንና ደረጃስ ደርሰ ዱላም ዴዔታው ደዌዎች ድርጅትህ ዲዲቲና ድረገጽን ደርቤና ደጀንና ዶክተርነት ዲንሣ ድንቹን ዳንስና ደንበኛዬን ደርሻ ዲፕሬሳንት ደረጃዎቹ ድርሳናቶቻችን ድቡብንም ዶሮም ዳውሎ ድንጋዮችና ዴስኩ ደጀኔና ደረታቸውን ድሪባና ዴንቨር ድክመቶቹን ደንበኛችን ድንኳንና ደምረን ደርዘን ደባርቅ ደሳለኝንና ድምጹም ደብተራዎች ዲኤፍአይዲ ድምራቸው ዳያስፖራዎቻቸውን ደገነጥኩ ደካማይቱን ደራሲውን ዴይን ደራሲት ደነግጋል ዶልፊን ዲርክ ደራሽነቱን ድሃውንና ደርብ ዳይሜንሽናል ደበሽ ድውያን ድንቅዬ ደቂያ ደብሮታል ድረዓምባ ዲያቆናትም ደብቃለች";
            amharicWords[24, 3] = "ዲሳ ደጀኑን ዳረገ ደምበደም ዲቴር ድግሶች ድሕነት ዳዲት ድርጅቴ ዱብዱብ ደመሰሰ ደሀነት ደጃችማቸ ዴሬሣ ደፍታባት ዳምጠውና ደያሳ ደንበኛቸውን ደያስ ድርጅቴን ዴዞም ዲሞክራሲያዊም ዱፌራ ደሀና ደወለ ደበብ ደወሉ ደረትን ዳይሬክቶሪት ዲስክ ደወሌ ደማቸውና ድርጅች ደፍሯል ዳሬክተሩ ደብዛዛ ደገኛ ድምጻዊና ደንደን ድርጊቶችም ድፍረትም ደጎች ድድ ደንበኞቼ ድጋፊ ድጋፌ ድራማዎችና ዶሪን ዴሞክሪያሲያዊ ደሀነትን ደግፎታል ዱባና ዳታዎች ዳርም ደፋሩ ዳውሮን ዲሜጥሮስ ዳሬክተሯ ድጓ ዱሮው ደንግጫለሁ ደምህን ዴሞክራሲያዋ ደምጎ ዲያክ ደደቢትን ድጡ ድኗል ዶዶላ ደስኩረው ዳብሮና ደርሞት ድምብላል ዳባዲ ዳንኤልም ዲክ ድሩን ደህንነታቸውንና ደወልኩላት ደሞም ዳርጌም ደረጃዎቻቸው ድንጋጌዎችም ድክመቶቻችን ድፋባቸው ደረጃችውን ዴሞክራሲያ ድንብር ደከመን ዳኛነት ዲሪር ዴሞክራዊ ደብዘዝ ድጋፋን ደፈረሰ ድሪምላይነሮች ድውይ ደረትዋን ዴሞክርሲያዊ ድንቢጥ ዲሚክራሲ ዲፖዎችን ዴሞክራሲም ድምፁንም ዲያመንድ ዶዘሮች ዲያ ደርቋል ዳሎል ድርሻቸውም ደናን ዲሞክራስያዊና ዳበሳ ድንቄም ዳይናሚክ ዶቼ ድነናል ድቁስ ድርጅቶቹና ደቂቃና ዲግሪያቸውንም ዶሮዋ ዲያቆኑን ደክሞኝ ደህነነት ድንገትም ዲሞራሲያዊ ደደቢትም ድምዳሜያቸው ዲግር ደራጃ ዲፖርትመንት ደብዳቤዎቼ ዳማ ዳሞ ደንበኛዬ ደኤታዋ ደምቢያ ደክማ ደግፏል ዲፕሎማቶቻቸው ደክሜ ደበሎውን ድላችን ድሀው ደርጊ ዴሬክተሩ ድምጥ ዳያሮ ድንቡሎን ዳሽ ዲዛይነሮች ዲጅት ድርድሮችና ዲምሓኩኤ ዳያስ ዱ ደፊዎች ደምቀው ድነዋል ዴሬክተር ዳንሱ ዴሞክራሲዎች ደምግባት ዳንሳ ድንበሬ ዲዛይናቸው ዴልታ ድርጅቶቻቸውን ድምጺ ዳርን ዲያቆንነት ዶዶታ ድንጋጤዋ ደረጃውም ደጋሚ ዶርላ ዳነኤል ደብተራቸውን ደፍተን ደወሉልኝ ዳዕዋ ደንጋዮች ደሞዛቸውም ዱኝነት ደሳልኝ ደብተሩን ደግሚ ደረሱበት ዴሞክራሲያዊነቱን ዴላኖ ድጋፍንና ደምለውን ድካሜ ዶግ ዶክትሪን ድሮምኮ ደደቦች ደመደመ ዳርፉርን ድብብቆሽ ዴምሐኤ ደርሠው ደውለህ ዳርገዋል ደብዳቤን ደክመን ደጋሽ ድጋፎችም ድርጅ ዳኢ ደረጃዋ ድካማችን ደባዎችን ዴሞክረሲያዊ ድንቡሎም ደብል ዳራው ደማቅና ደገሃቡርና ዳይብ ዲሞክራሲዊ ዳስን ድክመትን ደር ድረሰ ደነገገ ዳኞቻችን ደሕዴህ ዱሩን ደረቷ ደቪድ ድምጽዋ ደፋሪው ድካማቸው ድክመታቸው ደብተራቸው ድጉማ ደስተና ድሃኒት ዳሌና ድርደራ ድቅን ድልነሳው ድጋሜ ድጋም ደመወዙ ዴምባ ደረጃቸውም ደርሶዋል ደመወዜ ድግሙ ደቦ ደሕዴሕ ዴሞራሲያዊ";
            amharicWords[24, 4] = "ደህንነታችን ድክመታችን ዶሮና ድህነትም ደፍሬ ዳይመንድ ዶሴ ደልቶት ዴዝሆም ደሀው ዶቃ ዳረጎት ዳከታ ደረታቸው ድንጋያማ ደረጃቸውና ደረሶን ዲዚ ዶክመንቶችን ደጋፊዎቻቸዉ ዶቢ ደርሶባታል ደልድለው ድርቆሹን ድንጋዩ ደግፋችኋል ደምቋል ዲዳ ዶቸ ደኖችና ደንቢያ ድንኩዋን ዳበስ ዳሳሽ ደብረፂዮን ደብሮም ዳሌ ደቂቃውን ድልዳል ዳገቱ ዳያስፖራዎችን ድርጅታችው ድጎማና ዲግሪው ድሎት ደኤታው ደፍርሶ ዲሪባ ዲግሪዎች ደርሷት ዳሱ ድብልብል ዲያጆ ደጋፊያቸው ደርቀው ዱብዳ ደምመላሽ ዶ ዶክሜንቴሽን ዶዝ ደረቀ ደረቁ ዶክተሮችን ዳንሻ ዳይሪክተር ዴሞክራሲአዊ ዲሲፒሊን ድምበሩ ዶማች ዲፕሎማቶችንና ድምዳሜዎች ዶርም ድምጾችን ድርሳኖች ድቡልቡል ድርቡሽ ደመደሙ ድበደባ ዳገትና ድፍት ደገፍ ደብዳቤዬን ድፍረቱ ዳኮ ድንኳኑን ዲዋል ዲያስፖራውን ዱሮውንስ ዳሕላክ ድሮማ ደቀመሃሪ ደርሶኝ ድብደባዎች ደረጃውንና ድንግላይ ደብቆታል ድራማውን ድንጋዮቹ ዶክሜንቶች ዲዛይኖች ዴልቦካ ዶላሮችን ደጋግማችሁ ደግነትና ደብተራው ዲኖችና ደኃ ድማሚት ደግነትን ድንገተኛና ድልህ ድግሱ ድንበሩንና ዱግመኛ ደቡቡ ድርጅታቸውም ድስትሪክት ድረገፆች ድርሻዎች ደሃና ዳርጎ ዱሜራ ደግፋለች ዳመነ ደኻ ደምህ ደውሉ ደምሌ ድራማና ዲግሪም ደህነንት ድምጻችሁ ዶከመንተሪ ደራሲም ድራክንስበርግ ደንበኛን ደብረዘይትና ድላሚኒ ድንበሬን ዳንግላሳ ደጀ ደርግም ዴኑ ድምጥማጡን ዱማ ደግፎት ዲያቆናትን ዶላራቸውን ድርሰቶች ደመደምኩ ድባቡ ድርሳናት ዴክ ድሃን ደከሙ ዳረቻዎች ደብረጺዮን ድህነታቸውን ደጋፊነታቸው ዱሻ ደረስንበት ደመወዝተኛ ደረሶም ዲፕሎማቲ ዳይስሞርፊክ ድርጅትንም ደህንነቷን ዴሞክራቲክና ድብታ ዴቪስ ድርጊቶቻቸው ድንበርዋን ዲፓርትመንቶችና ዳርጎታል ዱጨት ደኅንነታቸውን ደብዳቤዎችም ድጋፉም ዳምጤን ዴሌቦ ድርጊታቸውም ዲያሎ ድርቁና ዲፓርትሜንት ደራራ ድብን ደብረማርቆስና ዱና ድግምት ደቀመሐሪ ዳይረክተር ደጀንነት ዳርዊን ዱኪ ዶዘር ዲናሪ ድርጊቷ ድርሻችን ዲናሬ ድብቅነት ድምጽስ ደራስያን ዳውላ ደብዳቤዎቹን ደብደባ ደሟን ድቤ ዳግስታን ድርጂቶች ዳዊትና ደራሲውና ድነው ዳይሬክትሬት ደሳሳ ደፍታችሁ ዶክተሯ ደሀዎች ደስታችንና ድፍረትን ደብረጽዮንና ድክመቶችም ድራር ደፋርነት ድርጅታችንም ድክመታችንን ዲሎ ዲሌታ ዳልጌዳ ድብርትን ደርሰውም ደረቷን ደሕዴን ደበቅ ደምቡን ደጆች ደግፉን ዳኒኖ ደቤሳ ዲያስፓራ ድራሽ ደርጎች ደምቃና ድሬይኔጅ ደወለችልኝ ደቻሳና ዱካቸው ደንም ደጋፊም ድምፄን ደብዝዞ";
            amharicWords[24, 5] = "ደምሴን ዲስከቨሪ ዲቪደንድ ዲኖች ድሃውን ደንቦባ ደጋና ዲፓርትመንቱ ደረጃነት ዲዮኔ ደኅንነቱ ድህረገጽ ደባዎች ዲዛይነር ዲሞክራሲያው ዳንዲ ድምቀትና ዶቼቬሌ ዳቪድ ድንችና ደምበ ዳይረክተሩ ድምጽም ድሜጥሮስ ድንጋይና ዱጋሳ ድልድሉን ደብዛ ድምፆች ደራሹ ድረጅቶች ዲናር ዶጋሊ ድምፃቸዉን ዲሞክራሲያ ደኀንነት ደርባን ደክሞኛል ድራም ደጀኑ ዲስኬቶች ደርቢ ድሬቲዩብ ደስታችንን ደጋማው ዲፕሎማና ዴኤታነት ዲያቢሎስ ደጄኔ ደፋሮች ደካማው ዲበኩሉ ድሎችና ድሆችና ድንበሮቻቸውን ደብተሬ ዱብቲ ደፍረዋል ዳርዳር ደሀውን ድርጊቶቹ ደክሞት ድርባ ድርቤ ዲዳት ዳረጋቸው ዴሞክራዊያዊ ዲልቦና ደርግና ዲኒ ዲምቢልቢ ደጋፊነትና ዲቁና ድህነታችንን ዳዋን ደንቢ ደሞዙን ዶስ ደቃቃ ድምፃችሁን ደብዳቤዎችና ድንበሮችም ድሬኔጅ ድምጿን ድርና ደደብነት ድንቁ ዳጎስ ዱላው ዳኞችንና ዶች ደረሰኞችን ደርሰውበታል ደጋፊዎቿ ዶኖቾ ዴሪክ ድንብ ዳይሬክተርን ድህነታችን ደሞዝተኛ ደብድባለች ዴኤታዎች ድርቆሽ ዱቄቱን ድኩላ ደቅና ደግአረገ ዳቢ ድምጿ ዳኛም ድንጋጌው ደረሱና ደንበልና ድብልቅልቁ ድቪዝዮን ዳኞቹም ደዌና ደግማ ድንጋጌዎቹ ዳርፉርና ዲፕሎማሲው ዱቢሶ ደባል ዱዓእ ዲያብሎስን ዶክተሬት ደብረብርሃንና ደረቱ ደላሎችን ደጃዝማቾች ድፍረቱን ዳህላክ ደኢህዴህ ዳዊትም ደሣለኝን ዲፕሎማቲካዊ ዱብዕዳ ዱለቻ ዴሚንግ ደነቀ ደመቅሳና ዴኢታ ደማችን ደሞዜ ዳግ ደንግጎ ደመቅሳን ድብዳቤ ዲግሪያቸው ድክመታቸውን ደስታዋ ደጉን ደፈረ ዴር ደፈራ ዴሊህ ደጋን ድንግልን ደላንታ ዳፋ ደውላ ደንግጣ ዳተኛ ደግኖ ደናቁርት ደንቦቹ ዴኤታና ድረአምባዎች ደቀመዛሙርቱ ዶከተር ዲያብሎስ ደጋፊዎቻችንን ዳፕና ደንደስ ዲግሪዬን ዲዋን ዶላርም ደምቃ ድልብ ድምጻቸው ድርቀት ደኢሕዴግ ዲሞክራሲያዎ ድግን ደምወዝ ደፉ ደግነህ ድምጻችንን ዳላስ ዴልታሜትሪን ድራጋዶስ ደመራው ደምቦ ዲሳሳ ዲቢሣ ደረቁን ድርጅታዊና ድሃው ዱጋሽ ዱአ ዲቦራ ዲንቄሳ ደመቀን ደኢሕዴን ደብተርን ደጋግመዉ ድህንነት ድንዛዜና ዳኝነትን ድምፅዋን ዶኩመንተሪ ድንጋይም ደጋፍዎች ድንጋጤን ደካሞችን ደራርቱን ደንዳና ድረስና ድብደባዎችን ዲያሎግ ደናግላን ድራሹ ድለላ ደርሶአቸው ደርቶ ዶኩመንታሪ ዶሏል ደምበኞችን ዲፕሎማትና ደንበኝነት ደርበን ድምፃዊት ድርጊቶቹን ደነቀው ዶክተሩን ድምፃዊቷ ደምበኛ ድንኳኖችን ደብዳቤዬ ደንስ ደርግንም ዶሮቲ ዲፖርት ደሆች ድንጋጌም ደናግል ደራርቦ ደብቁኝ ደንግጠን ድላችንን ዲያስፖራዎች ዲንና ደፍሞ ዲምክራሲያዊ ዴልሂ ድግፍ ድንበሮቹን";
            amharicWords[24, 6] = "ዳጋሽ ደጋው ዲማን ደረጄ ዴሞክራሲው ዴንሳ ድንዛዜ ድርቅንና ድልና ዴሞከራሲያዊ ደብሊን ደንቡና ዲኘሎማቶች ደበሬ ደጀና ደርባ ዱላውን ድኅነት ድኤታ ድክ ድርጅቱንም ዶክሜንት ዲዛይነሮችና ዴንተን ድክመቱ ዳይሬክተርነት ዲፕሎማሲያዊና ደጋግሜ ዱላና ዲስፕሊን ደህንነታቸውን ድጋፋችንን ዲሊዛ ድንበሮቻቸው ደቡባዊና ደብዳቤዎችን ደንበኛቸው ደባዜን ደፍታ ደሚት ደረስኩ ደ ደጉም ዶሮዎች ድልድይና ድርጅታችሁ ድምፄ ድንገተኛው ድንግጥ ደረሰና ደላላ ደመ ደገፋ ዴኢህዴን ደርድረው ደሉቲኦ ዳውደን ዳይ ደምበል ድግሞ ዳግማዊት ዳሬሰላም ዲዛይኖችን ደብተሮች ዳካር ድርድርን ድርሻም ደፈር ዴሲ ድራሹን ዳሞት ዲያሰፖራው ዳጉሳ ደኢህአዴኅ ድመቶች ዴሞክራሲዊ ደሃው ዱዊት ደቀመዛሙርት ዴዳ ዴይሊኔሽን ደቡብን ዲቢሳ ዲቃላ ዱዓ ዴፖዎች ድንጋጌና ድፍረትና ድንጋጌን ደርቤ ዳይሬክተሩን ዲያብ ደሞዝና ድምፃዊያን ድህነቱ ዲስ ዱዋሌ ደክሞዋቸው ዳርድንበር ድምፀት ደብተሩ ደንደና ድርሻችንን ደፈጣ ደረጃቸውንና ዴምሐኩኤ ደንባቸው ድምጾች ዱከም ደመቅ ዶላርን ድንግርግር ደኅንነታቸው ድፎ ደረቱን ድረሱልኝ ደሞስ ደኑን ደርዝ ደሞዛችንን ደምሳሽ ደኅንነታችን ዲዶ ድምጽና ደመናው ድምጽን ደጋፊዎቼ ዶኒ ደቦጭና ደርጅቱ ደካማውን ድግሪውን ዳራ ደረሰች ድ ድልድልን ድምጸ ደንቦችንና ዳለቾ ድካሙ ደንበኛውን ዳኝነቱን ደገፈ ደራ ደርሶን ድርጅትንና ዶፍ ዲሲና ደርሶታል ደኢህልማ ደንቡም ዲክታተሮች ድምጻዊው ደቤ ደግነው ድርሰቱን ድጋፋችሁን ደሞዙ ዳጋ ዲቨሎፕመንት ዳኛና ዲፕሎማቶቹን ዳይሬክቶሬቱ ዶክመንተሪውን ደጋፊዎቻቸውና ዳቦው ደህንነቱን ድሕነትን ደበደቡ ድንበርም ዳኛዋ ደስታችን ደከም ደበበና ደኢሕዴኅ ዶክትር ዱሬሳ ደፍረን ደሃውን ዱባሌ ዱን ድልድዩን ደብሩን ደለሎ ደበሎ ደስታም ዶግማ ድግግሞሽ ዶላል ዲተር ድኖ ደግፋ ድርሰትና ደብረጽዮንን ደንጊያን ደግፈን ድፍርስ ደረጃዎችና ደውዬ ደምሴም ድኩማን ዲያና ድግግሞሽን ደረቴን ድኩላዎች ደረሰብን ዴቬሎፕመንት ደረሶች ደረሰባት ድራማዎችን ደርሰውበት ደገመና ድብደባም ደምረው ድረሱልን ዳይሬክት ዶሳ ዳተኝነት ዶክተሩም ዲክታተር ዳያስፖራውን ዲሮማ ድራማዎች ዴሞክራሲያዎ ዳልጋ ደላሎቹ ደመወዙን ዴኒስ ድርሻዋ ዳርጓታል ድሪምላይነር ድምጼን ዱርዬዎች ደጀሰላም ዲዛይኑን ዶክተሮችና ድንቼ ደሕንነት ድርቀትን ዶጁ ዳነ ደረሰን ዳኒ ዲስፒሊን ደላሎችና ዶጊሶ ደቂቃው ደላላዎች ድረሻ ደቂ ደምስሷል ደባልቀው ዶኩመንቴሽን ዲሞክራሲው ደግፈውታል ዴአታ ዶናል";
            amharicWords[24, 7] = "ድርጊቱንም ደምብ ደቂቃም ዲዲቲን ድንበሮችን ዴፖ ደማቸው ዲንሾ ዲዛይኑ ድሮግባ ደርሷቸዋል ደግፍ ዲሲፕሊን ደፋርና ድርጀቱ ደራሲያን ድርጊታቸውን ዶርትሙንድ ደኖችን ደብረጽዮን ደብዳቤና ዲሞክራቶች ዳቦና ዶክመንቶች ድርጅቶቻቸው ዴል ደክመዋል ደክመው ዳሰሳ ድሕሪ ድንቁርና ዲሞክራሲያዊና ዱቤ ደሞዛቸው ድንጋዮችን ደጋፊነት ድርስ ደፍረው ዲሽ ደሞዛቸውን ደሳለኝና ደርሰህ ዶሎ ዲኖ ዶማ ድልድሉ ዴንግ ዶን ድንጋዩን ደመኛ ድርጊትና ዳና ደርጅቶች ዳዋ ዳሰነች ደንጊያ ድርጊትም ዳርቻና ደኑ ዲግሪውን ደበደበ ድንበራቸው ደብዳቤያቸው ድሃና ደፊ ድምፃችንን ዴይ ደረሳቸው ደርሳ ዲንሳ ዳግላስ ድንጋጤና ደካሞችና ዳዊትን ዳይሬክተሮች ድኃ ዳሸን ዳንኤልን ድርጅቶ ድብደባውን ደረሰብኝ ዴሞክራሲያው ዳኞችም ድፍድፍ ደርጅት ደክሞ ዳስ ድርሳን ዲጂታል ድንቅነሽ ደብድበዋል ደግሜ ዳን ደንበል ደብሩ ዲፕሎማቶችም ድሮስ ድንኳኖች ዳርቻዎችና ደካማነት ደጋፊው ደምቆ ደግፈዋል ድረጅት ዱግም ደምቢዶሎ ዲሞክራስያዊ ደህዴን ድልድዮችና ዲቪዥን ድርሻን ድኤታው ደንበኛው ደሴቶችን ደንባችን ዲታ ዶሃ ደብሊው ዱቄትና ድርድሩም ድርጊቶችንና ድብልቅ ደረቃማ ድምጹ ደርሼበታለሁ ድምፁ ደነገጥኩ ድርጅቱና ደረጃዋን ደንቆሮ ደቦጭ ደብዳቤም ድሪቢ ደረሰው ደውል ዲፕሬሽን ዴኤታን ደባና ደምሱ ድርድርም ደመወዝና ዳኛውም ዱባ ድሬ ዳርጓል ዱካ ደርሶአል ደግፌና ድርሻቸው ዶናንድ ድምፅና ድምፅን ደርሳለች ደባልቄ ዴሞክራቶችና ዶላሮች ዲስትሪክቱ ዶር ዴሞክራሲንና ዶሮዎችን ዳኛውን ደብሊዩ ደርሶባት ደንን ደኅንነትና ደኅንነትን ድልድልና ድንበሯ ድልደላ ድብርት ደጋፊዎቻችን ደሙ ድርግም ድብድብ ድምፅም ደነገጠ ደነገጡ ዶክመንቴሽን ዴሞክራሲያዊት ደብሮች ድንበራቸውን ዲያስፖራ ድርጅቶችንም ደንበኞቻችን ድንቁርናን ደሴና ዳኝነቱ ዲቪዝዮን ደረቅና ደብሪቱ ደንጋሞ ዴሞክራሲያውያን ደንበኞቹን ደጋፊዎችም ደንበኞችም ደረሰኞች ድርቁን ደደቢቶች ደብድቧል ደኤታ ደምን ደርሼ ዳኝነትና ድክመቱን ድኅነትን ደርሰውናል ዳንግላ ድርሽ ድልድዮችን ዲፕሎማትን ድሆችን ዲሞክራሲያዊት ዳግመኛም ደሳለኝን ድርሻዋን ዶሮን ድርብርብ ደሞክራሲያዊ ዶክመንታሪ ዲኤችኤል ደርሻለሁ ደመቅሣ ዲላሞ ደርጉ ዳሩን ዴንጋሞ ዳ ድርጅታችንና ድርጅትዎ ዳንስ ድርድሮችን ድልድይን ድቅድቅ ድርጊትን ደሟ ድብልቅልቅ ድረገፅ ደደቢት ዳዳብ ደንድር ድምጻዊ ድግሥ ደች ደማችንን ደጋፊውን ዱለኒ ድልም ደበሳይ ዲፖዎች ደራሲዎች ድብቅና ደንበኞቻቸውን";
            amharicWords[24, 8] = "ድንግል ደርሶባቸው ድባቅ ዶክተሮች ድምፃዊ ዳምጤ ድክመቶች ደስታን ድሮም ድርጊታቸው ዲሞክራሲና ድርሻውን ዱባይ ዲፕሎማቶቹ ዱብ ደግሞስ ደበላ ዳታ ደግመው ዴኤታዋ ዶክመንተሪ ድሆች ደፍተው ደዌ ዴሞክራሲያዊነት ዱባለ ዳያስፖራ ዲላ ዲና ዲ ደኢህዴግ ደሞ ደምድሟል ደርሶበት ድምፃችን ዳሂር ደፍቶ ዲፕሎማ ዲዲቲ ድምጻቸውን ድምጻችን ደኅና ድንበሯን ድመት ደጋ ደብዱቤ ድርጅቶችንና ደብዳቤያቸውን ድንበራችንን ደወል ደረጃዎችን ዲኑ ዲስትሪክት ደጋማ ድረገጽ ደመወዛቸው ደብረፅዮን ድርሰት ድምጹን ደንቃራ ደካማና ደሙን ዳይሬክተሯ ደቦል ደግፎ ደፍሮ ድንቡሎ ዳኛቸው ድንጋዮች ድጋፍም ዱሪ ዲፕሎማቱ ደብድቦ ደንቦችና ደጃች ደጋግመን ዳያስፖራው ድርጅቱም ድርጅትነት ዲስኦርደር ደውለው ደምለው ደሀ ዳኜ ደብረማርቆስ ደካሞች ደህንነቱ ደንቦችን ዳብሮ ደምድመዋል ደንበኞቹ ዲግሪና ደደፎ ዳይሬክተርና ደንና ደብቀው ደገፉ ደረሰበት ዳዲ ድርድርና ዲሴምበር ደቂቀ ዲባባና ደኖች ደህንነቶች ድጋፍን ደብረብርሃን ዲኤታ ደቡብና ድርጅታቸውን ድኻ ድጋፏን ደንግጠው ደቂቅ ዲዛይንና ድር ደምና ዳኞቹ ዲሞክራት ድርሻው ደግፈው ደረስ ዳዊ ድምፃውያን ደንግጓል ደብድበው ዳምጠው ድርድሮች ዶክመንት ዲስኩር ደገኞች ዳፕ ድቃይ ድባብ ደስተኞች ደስታቸው ዲያቆናት ደብዛው ደማቸውን ደምስሶ ድሮውንም ዲያስፖራው ድካምና ድረገጾች ደንግጦ ደጉ ደለል ዲቪ ድራፍት ዳሬክተር ደግነቱ ዳኘው ደመላሽ ደንብም ደግመን ደጋፊና ደብቆ ዲፕሎማሲና ደንበኞቻቸው ዴንማርክ ዳኞችና ድክመቶችን ደጋፊዎቹን ድሮው ድረጃ ዲሬክተር ደምሰው ዲፓርትመንቶች ደጋፍ ድኅረ ደህንነታቸው ድርጀቶች ዶሪ ደከመኝ ደርሰንበታል ደርሶናል ዳመና ዲፕሬሲቭ ድራማው ድምፃቸው ደምበኞች ደራሲና ደብረወርቅ ደብረታቦር ዶት ዳገት ደርጃ ድምፂ ደግም ደንጋይ ደምሴና ዳሽን ደሣለኝ ድንፋታ ደውሎ ደምስ ድርጊቶችና ደብዛቸው ድሬደዋ ዳያስፖራዎች ድማ ዲንቃ ድርሻና ድልድዩ ድርጊቱም ዴቨሎፕመንት ደጋግማ ደመራ ድምዕ ደርሷቸው ድርጀት ደረስን ደሚቱ ደራሲዋ ደርሶብኛል ዴ ደርሶት ዳርና ድምበር ደሜ ድክመትና ደቀ ደርሶኛል ድንበርና ዴሞክራት ዲያሊሲስ ደላላው ድጋፋቸው ድሬዳዋና ደቻሳ ደርሶብናል ዲጂት ደርቆ ዳውሮ ደርቦ ዲቪዚዮን ዳንኤልና ዶላሩ ዲሞክራሲያዊነት ደገሃቡር ዶላርና ደግነት ድስት ደሳለኝም ደህነት ደራሲው ዶላሩን ዲፖ ደረሰባቸው ደረት ደስታው ዳርጌ ደወልኩ ደርሰን ድሬዳዋን ደመወዛቸውን ደጋፊዎቻቸውን ዴሞክራቶች";
            amharicWords[24, 9] = "ደ ደግሞ ደረጃ ድርጅት ድረስ ድርጅቶች ድጋፍ ዶላር ዶክተር ዴሞክራሲያዊ ድንበር ድርጅቱ ደብዳቤ ድምፅ ድርሻ ድል ዳይሬክተር ደንብ ደቂቃ ድርጊት ዲሞክራሲያዊ ደም ደቡብ ድርድር ደህንነት ዳር ዴሞክራሲ ድህነትን ደስ ድምጽ ድሬዳዋ ድርጅቶችና ደስታ ዳይሬክተሩ ድርጅቶችን ድብደባ ደጋፊዎች ዳግም ዳዊት ድንጋይ ዲፕሎማቶች ዳኞች ድህነት ደሴ ድርጅታዊ ዴኤታ ዲግሪ ድርቅ ዳኛ ዳንኤል ዲሞክራሲ ደመወዝ ደህና ደጋፊ ደካማ ደርሷል ድርጅቶቹ ድርጊቱን ድርጊቶች ደርሶ ደርግ ድጋፍና ድርጅቱን ድርጅትና ደምሴ ዲፕሎማሲያዊ ዲሲ ድርጊቱ ድንገት ደሳለኝ ደረጀ ዴኤታው ድንገተኛ ደንበኞች ዲፕሎማት ደን ድርጅትን ድልድይ ደረጃዎች ደረጃውን ደረሰ ደመቅሳ ዱላ ድክመት ዳኛው ድሎች ድርጅታቸው ደንቡ ደርሰዋል ደንብና ዳኝነት ድረ ድርጊቶችን ደርሰው ደረጃቸውን ድርድሩ ድጋፉን ዳርቻ ደሞዝ ድሮ ዱቄት ድርጅቶችም ድንቅ ዲፕሎማቲክ ድንጋጌ ደብር ዳግመኛ ደራሽ ደረቅ ደህንነትና ደብዳቤው ድጋፎች ዳባ ዳቦ ደቡባዊ ድንበሩ ድሃ ዲን ድጋፎችን ደበበ ድካም ደብረ ደረጃም ደመቀ ድጋፋቸውን ድምቀት ዳሩ ዲማ ድጎማ ደግፌ ዴቪድ ደቂቃዎች ደመና ዳይሬክቶሬት ድንበሮች ድምፃቸውን ድርጅታችን ዲሞክራቲክ ድንበሩን ደንቦች ዲፓርትመንት ደራርቱ ደህንነትን ደባ ደሴቶች ድንጋጌዎች ደግ ደረጃና ደጋግመው ዴሞክራሲን ደረጃን ድብቅ ዴሞክራሲያዊና ደማቅ ዳግማዊ ደኅንነት ደብዳቤዎች ድሎችን ደረሱ ዳውድ ዴሞክራሲና ዴሞክራቲክ ድምር ድህነትና ደጃዝማች ደስተኛ ድረስም ደጅ ደፋ ዶክተሩ ደጋግሞ ደረሰኝ ዲዛይን ድርቅና ድርብ ደላሎች ድምፁን ዶሮ ድልድል ድርቅን ዱር ደብተር ድፍረት ዳርፉር ደንታ ድጋሚ ደርሶባቸዋል ደንቡን ድሪር ድጋፉ ደረጃቸው ድህረ ድርጅትም ደበሌ ደጀኔ ድብደባው ዲባባ ደራሲ ደንበኛ ደርግን ድራማ ድርሻቸውን ደፋር ደርበው ዲያቆን ድግሪ ደጀን ዲንጋሞ ድንጋጤ ደሬሳ ደንብን ደብተራ ድምፀ ደንበኞችን ድልን ድብደባና ድግስ ዶናልድ ደሴት ዲፕሎማቶችን ደርሰናል ደረጃው ዳርቻዎች ዲሞክራሲን ድምዳሜ ድንጋጌዎችን ደስታቸውን ዶክትሬት ዴስክ ደጋፊዎቹ ዲልቦ ድፍን ደኢህዴን ደስታውን ደስታና ድንበርን ድቀት ዲፕሎማቶችና ድንኳን ድልድዮች ዴይሊ ደደብ ደጃፍ ደሃ ድርቁ ደጋፊዎችና ድሉ ደብዳቤውን ድሪባ ደብረዘይት ዲፕሎማሲ ድርጅታችንን ዲግሪያቸውን ዳኞችን ደግሞም ድሉን ዴሬሳ ድንች ደጋፊዎችን ደርሶበታል ድሀ ደውለን ድርድሩን ድርጅቶቹን ድህነትንና ደጋፊዎቻቸው ድንበራችን";
            
            amharicWords[25, 0] = "ጀብሮ ጂአርሲ ጆርጂያና ጁምዓ ጁሃርን ጀኔራልነት ጃግሬዎቹም ጃንደረባው ጆሮዎቻቸው ጀነት ጃፓናዊ ጀብዱዎች ጄሉ ጂግሣ ጅዝብ ጆሀን ጂፒኤስ ጂፋሯ ጀመረና ጀልባይቱ ጅማሬውም ጆንኤፍ ጅው ጀግንነታቸውን ጀምበርን ጂሐዳዊ ጀበልም ጅማሮን ጃዋድ ጄርሜን ጀርባችንን ጁነዲንና ጂኒን ጁምአን ጀረሚን ጄኔራሎቹን ጁነይዲንም ጆሮዎቿ ጃሚዕ ጂና ጂሀዲስቶች ጆሮዋ ጀግናዎች ጅምሩክ ጄረሚ ጀግናዉ";
            amharicWords[25, 1] = "ጆል ጀኔቫ ጅንስ ጀግናዋ ጅምናስቲክ ጀልባዎቹ ጃዕፈር ጀነራልነት ጀሚልን ጀሶ ጂሲሲም ጀመሩትን ጄኔራልተፈራ ጅማትን ጆሃር ጁዶ ጅቡም ጆሲ ጀግናን ጀብሀንና ጃሃዳዊ ጂአይዜድ ጀርመንዋ ጁዲና ጅኦግራፊያዊ ጆከር ጁነዲንም ጃዋሃርላል ጅምናዚየም ጃዝና ጆሰፍ ጃማይካዎችም ጀምዓት ጅግጅጋ ጅንራል ጆንግሌይ ጂነዲ ጃልሜዳ ጄኔራልም ጅላጅል ጄነራልነት ጀመራችሁ ጆሯቸው ጀርባችሁ ጀብደኖቹ ጆቤ ጆሊባን ጆቤን ጁንየር ጀምሁሪን ጀሌዎቻቸውን ጃህ ጄኒፈር ጆሮቸው ጀምረሻል ጅምራችንን ጀረጃ ጀማነሽና ጂዮቫኒ ጃፋር";
            amharicWords[25, 2] = "ጆኢንት ጀዲካ ጅቦቹ ጂኒት ጀምሮና ጃሬ ጅቡቲንም ጆሮዋቸውን ጀሌዎቻቸው ጀሚላ ጃስ ጀርመናዊቷ ጄሪካን ጅማሮው ጂኒየስ ጄምፕሩድ ጆብሬ ጀኔሬተሮች ጁልይ ጄዳ ጀግንነቱም ጃቢር ጂፒአሬስ ጀመአዎች ጅሎችና ጃንጥላዎች ጀግናችን ጆብስ ጀንበሬ ጂኦፖለቲካዊ ጁባላንድ ጄሪ ጂፕ ጆሮዬን ጅብራ ጀሌዎችን ጀመረኝ ጀመረዋል ጆንጋራንግ ጆሮዎች ጅጅጋን ጀምሬያለሁ ጆሴፈስ ጆንሴ ጃንክሎስ ጀመርኩላችሁ ጂሀዲ ጆዚ ጅማት ጀሌዎቹም ጅራቱ ጀዲ ጆርናሎች ጁዲት ጅጊ ጃኬታቸውን ጅልነትና ጂንዲ ጆሌ ጅቢቲ";
            amharicWords[25, 3] = "ጅፋርና ጆሃንስ ጂንጃ ጅግና ጀግንነታችሁን ጆር ጁማ ጃኦ ጅቡን ጅቡቲያውያንን ጀሃዳዊ ጀሪካኖች ጄ ጅራታቸው ጀግንነቱ ጃፈሮስን ጀምረህ ጄኔ ጆኡርናሊስም ጀንኪንስ ጀሀዳዊ ጀብደኛነት ጅግራ ጆቫን ጃፓናዊያን ጀርቫዚ ጃዊ ጂዲ ጃተኒ ጁንግ ጀነሬተሮችን ጄኔሬተሮችን ጆሯችንን ጀርሲ ጀምሮታል ጁነዱን ጅማሬዎች ጀብሃም ጂኖሳይድ ጃንክስ ጃኒት ጀዚራ ጀምፕሩድ ጀልባውም ጆቴ ጂኦሎጂካል ጀማሪው ጀግኖቻችንን ጀብሐና ጅሃዲስቶቹ ጅራቱን ጅቡቲያዊው ጀምራችሁ ጀማነሽን ጆኻን ጃሌና ጀምረውታል ጀቡቲ ጀመራቸው";
            amharicWords[25, 4] = "ጃርቬዚ ጄነራሉ ጀርባዬ ጄይሰን ጅምሮችና ጁፒተር ጆሮና ጆሮን ጆዜፊን ጀረሚ ጀን ጃግሬ ጂቡቲና ጀስተስ ጀግኖቻቸውን ጀማሪና ጆናስ ጃንሱማ ጁስቲቸ ጀፈርሰን ጂኦሎጂስቶች ጀሽዋ ጄማ ጅማሬና ጂቡቲም ጃንሆይን ጅማሮዎች ጅምናዚዬም ጀነራሎች ጀምራችኋል ጀግንነታቸው ጄነራሎቹ ጅጅጋና ጄቶችንና ጀግናውን ጅማቱ ጆሀንስበርግ ጀርባዬን ጂብሪል ጃትሮቫ ጀብደኞች ጆሮአችን ጅሩ ጅር ጀማ ጅራታ ጅቢቱ ጀምበሯ ጀማልና ጃዚራ ጀጁ ጆሃንሰን ጃኑአርይ ጀሮ ጁንታ ጁሊ ጂብራን ጁላ ጀልባው ጀምሁሪ ጀልባውን";
            amharicWords[25, 5] = "ጃም ጀመርኩት ጀርባቸው ጀሪካን ጀበል ጀስቲስ ጅቦች ጃካያ ጅማሬው ጃሚንግ ጆርናሊዝም ጅብና ጃንዳይ ጆርጅያ ጅብም ጂሲኤስ ጃፓናዊው ጀምረውት ጂፒ ጃገማ ጁሃር ጅሎ ጄነራሎችን ጀልዱ ጆሽዋ ጀሌዎቹ ጀግንነቱን ጆንያዎች ጂኤች ጄኔራልና ጀርመንም ጀብደኛ ጆማኔክስ ጀቶቹን ጆሮው ጂኦ ጅንካ ጀማሪዎች ጃኖ ጀስቲን ጃስትራም ጄኔራሉም ጀመርክ ጆኸን ጅቡቲንና ጀነሬተሮች ጀግኖቸን ጀኔሬተር ጂሎ ጀንዴ ጀምር ጆሮአችንን ጆቢር ጂብሰም ጂሀዳዊ ጀምረዉ ጅሎች ጀማው ጆርጋ ጃማይካዊ ጀርሞች ጀርመናውያን";
            amharicWords[25, 6] = "ጂጆ ጃል ጀመርሁ ጀርመንን ጅረት ጀንዳይ ጅልነት ጄቶቹ ጁነይዲ ጆኡርናሊስትስ ጃፓንን ጅዶ ጀሌ ጀርባው ጆሊ ጃንሆይም ጆሞ ጀግናና ጂሃዳዊ ጀመሩት ጅቡ ጀርባም ጅቦ ጂኤምኦን ጅረቶች ጂኦግራፊ ጂሃድ ጀኒፈር ጁቡቲ ጆሮዎቹን ጆሯቸውን ጄንኪንስ ጆሮም ጁኒየር ጀመረው ጂቡቲን ጃራ ጆርጂያ ጅምሮ ጀመሮ ጅብን ጃኔት ጃካራንዳ ጂኒ ጂፕሰም ጄኔራሎቹ ጅራ ጆርዳን ጀቶችና ጄቶችና ጃና ጁዲ ጀብድ ጄኔራሎችም ጄንስ ጆሮዋን ጂዛን ጆስ ጀርም ጀርሞ ጅማን ጄኔቲክ ጀሀድ ጄነሬተር ጃስማየን ጂም ጅሀዳዊ ጆርኒ ጀርባዋን";
            amharicWords[25, 7] = "ጃፈሮስ ጂሲሲ ጃለታ ጃንዋሪ ጂኦግራፊያዊ ጃኮብ ጀሞ ጃንጥላ ጃጋማ ጂ ጀግንነትና ጁሊያ ጀቶቹ ጄኔሬተር ጆሮአቸው ጀርመኖች ጀግኖቹ ጆንስ ጆሮአቸውን ጀልባዋ ጀኔራሉ ጆሮዬ ጀርመናዊያን ጀባ ጄኔራሎችን ጀማነህ ጀግንነትን ጀልባዎችን ጆሯችን ጁኔይዲ ጁነይዲን ጆንግ ጄኔራሉን ጀኔራሎች ጂኤምኦ ጁነዲንን ጅራት ጃፓናውያን ጁምአ ጂጂጋ ጆ ጃክ ጄኔራሎችና ጀብሃን ጆቫኒ ጀቤሳ ጆሊባ ጀርባቸውን ጁነ ጀምሬአለሁ ጀምበሬ ጆሐንስበርግ ጁልፋር ጃፓናዊቷ ጁንዲ ጃግሬዎች ጀግኖችና ጀማነሽ ጁስ ጀብሓ ጂኦሎጂስት ጀግኖቻችን";
            amharicWords[25, 8] = "ጀብሐ ጀምሮአል ጅማሬ ጅዳ ጀማሪ ጅሃዳዊ ጁባ ጅምሮችን ጀርመናዊ ጀንበር ጄን ጄሲካ ጀምረን ጃኬት ጄኔራልነት ጀርባውን ጃትሮፋ ጅቡቲም ጃፓንና ጄኔሬተሮች ጂሀድ ጆሮውን ጀምራ ጂንካ ጃዝ ጃሌ ጆርናል ጆይ ጄቶችን ጅንአድ ጀምሩ ጀምሬ ጂዳ ጁዋር ጁላይ ጃፓኖች ጄኔቫ ጆናታን ጅብሪል ጃዋር ጂማ ጅን ጂምናዚየም ጂቲዜድ ጆንሰን ጅምሩን ጅራፍ ጄሲ ጆሃን ጀቶችን ጃክሮስ ጀግኖችን ጆንያ ጅምሩ ጆኒ ጅሃዲስቶች ጀመርኩኝ ጄምስ ጅል ጀሌዎች ጆሴ ጅማና ጅቡቲያውያን ጀነራሉ ጀብደኝነት ጆቲ ጁነዲ ጃንሜዳ ጀበና";
            amharicWords[25, 9] = "ጀ ጀምሮ ጅቡቲ ጄኔራል ጀመረ ጀርመን ጀመሩ ጀመር ጀምረዋል ጀምሯል ጅምር ጃፓን ጅጅጋ ጅማ ጆሮ ጀግና ጀግኖች ጀርባ ጀማል ጆሴፍ ጀምረው ጀግናው ጄቶች ጄት ጆን ጁነዲን ጂቡቲ ጄኔራሎች ጀኔራል ጃርሶ ጀነራል ጄኔራሉ ጅቡቲን ጄነራል ጀግንነት ጀቶች ጆርጅ ጅብ ጅቡቲና ጀመረች ጀልባ ጅምሮች ጀት ጁን ጃንሆይ ጀብዱ ጃክሰን ጀመርን ጅምላ ጀብሃ ጀልባዎች ጃን ጀምሮም ጅፋር ጅማሮ ጀሚል ጀርመናዊው ጀምረናል ጀምስ ጀምራለች ጄኔቭ ጀምበር ጀመርኩ ጂጂ ጀርመንና ጄነራሎች ጃማይካ ጆሃንስበርግ ጂሚ ጃማ ጅሃድ ጂን";
            
            amharicWords[26, 0] = "ግጥሟ ጉባኤያትን ግንዘብ ጎራዴውን ግንኙነትስ ጎድሎበት ጎረቤትህን ጎርጓሪ ገጥመውኛል ጎተራዎችና ገላችን ገባለት ጉግሳና ጎጃሚያ ጉግሳን ገዶን ገለጻቸው ገርልፍሬንዱ ጎርጎራ ገቨርነር ገብጋቦች ጉዳየ ግኑኝነቶች ጉዳዪ ጉራንጉሩ ግዕዙ ገፅታዋን ጋሕዴን ገበያተኛ ገለበጣት ገጣሚዋ ጉርሳቸው ጉረኖ ጉልበቴን ጉልበቱም ጉጉታችንን ጊፍት ገልጦልናል ጉብኝትን ገድቧል ጉብል ጎበዙ ጉብዝናውን ጊትማርክ ጓደኛህ ጉደይ ጎጠኛና ገጠሬ ጎብኚዎችና ጓጉንቸር ገብረኢየሱስ ጊዮርጊሶቹ ገማኝ ገመቱ ጉዳይች ጉዞዉን ገጠሙኝ ጉልበቱንም ገጠሪቱ ግትርነትና ገልፆልኛል ገጥሞኛል ገላዉ ግንባሩም ገነትም ግብፆችን ጎበዛዝትና ገፈፈው ጓደኛም ጉዞህ ገፋፍቶ ገብረዋል ጉልበተኛውን ጊንቢ ጎበኘን ጎንደርንም ገለልተኝኛ ጎርጎሪዮስ ገላዉን ገልጽሀል ጎጇቸውን ጉርስና ጉያንግ ጎበናና ጉድለትም ገላዩን ገብረዋድ ጉሮሮዬን ገደብም ገንጥለን ጎቤቦ ጎራስ ጓድን ጎራቸውን ግዜውም ጉዞውም ጎዳት ገደለኝ ገማይነር ገላልሼ ገዳማቱን ጎጠኛው ገብም ግድየለሽ ገባርነትን ጉዲፈቻውን ገዝተንም ጉድፎች ጋሃድ ጎግል ጎጦች ጉርምስናውን ገብተውልኛል ጎጃሜዎች ገሃዳዊ ግንባታዋ ጉልታዊ ጎበዜም ገበያዎችና ገብረልኡል ግብፃውያንና ገባችንን ገንድሰው ጎርጎርዮስን ግንባሯ ጉዋንግ ጉቬራ ግዴታቸውም ገለውኝ ገጣምያኑ ገጽታችን ግዥበቱ ገዳዮችም ግዥበት ገጣምያን ጉንዳንም ግዜያቸው ገብች ጉባኤዉን ገራፊ ገዢዎቻችንን ገዝፈው ገበሬዋ ገርቦሌ ጉዳታቸውን ገልጠን ገባቸውና ገልጾለት ጓደኝነታችሁ ገብና ገዛሁና ገብን ግዴታውንም ገለጹለት ገለፃዎችን ጉድጓዳቸውን ገንብተውበታል ጉድጓዳቸው ገናናውን ጉዳተኝነቷ ጓደኝነታቸው ጓዶቹም ጉቦም ግፈኛዉ ገረዓልታ ገንቡ ጉዞየ ገልፆለት ግዴታውንና ገጹንና ግዙፏ ገናናዎች ጉንጮቹን ጎራዴው ጎዶሎነት ገረሰሱት ገዳማውያን ገብቷት ግንብም ገስጬ ጉድጉዋድ ጓጉቶ ገንብተውና ግድግዳን ጎኑዋ ገነፈለ ገደማና ገበታቸውን ጎረድ ገጥሞዋቸዋል ጓጉንቸሩን ጎንደሬዎች ገዛን ግዛታቸውም ገዙአቸው ጊዜት ገሶ ግብፃውያንንም ጎርበጥባጣ ግዲ ግንባታውንም ገንዘቦችና ጉንጬን ገድሌ ጉርዳፈርዳን ገደላቸውና ጉራጌውን ጉምቤ ጉባኤዉ ግዛቶቻችንን ገዳይና ጊዜየንም ግብጾችም ገዳይን ጉበሬ ገሠሰ ገንብታ ጉምቱ ግዴታህ ጉቦን ገብነቱን ግዛትዋ ጓዶቻቸውም ጎበዜን ገምግመናል ግዥበትንም ጓዳን ጎሹም ገፆችም ጎንጓኝነት ጓደኝነታቸውን ግንባሯን ጉድለታችንን ግድግዳዎችና ግንኙነቶችም ጋሕነን ጊዜዎቹን ገለጻቸውን ገልጸውት ጉዟአችንን ጊዜዉ ገጾችም ጉዞህን ገራፊዎቹ ጎዱን ጉበት ገብረመድህንና ጉዞዬም ጉዳተኝነትን ግድያቸውን ገድላት ገይ ገመቺሣ ግዳጅም ገዳሜያችንን ጓዳዋ ገጥሟ ገሚሶቻችን ጉልማንም ጎረቤቱን ገፆቻቸው ገርስሰው ገልምቷል ጉበኛ ጉጄሌዎች ገብሬም ገመቺስ ጉዳችንን ገጭ ጉር ገዝተውላቸው ገብረመድን ገብረእግዚአብሔርና ገብረእግዚ ጓዛችንን ጎርፍና ጎዝጉዘው ግንኙነቷ ጉዛችን ገበዝነት ጎረቤቶቻችንም ግድግዳዋ ግብጽንም ገሚሱም ጎታቸውና ገልጹአል ጉንጩን ግትን ገጸች ገንጣዩ ግዛቶቻቸውን ግንበ ገናሽ ገጸበረከት ገጠመኞችና ገብረኪዳንን ገሃነምን ጉጉሌቱ ጉራፋይዳ ገነሜ ገደሎና ገለበጠኝ ገጠመኞችን ገፋፊዎች ገሪቱ ግዑዙ ግዕዝን ገዢውንም ግንባራችን ገጽታዋም ገጽታቸውን ገድለንም ገዥነትና ገላጣው ገዝፎና ጉጃለ ገፈፋን ገፉበት ገመናችንን ጊዜአት ገተት ጉዝ ገንቢዎቹ ጎብኘት ገፋፍቷቸዋል ገምዝ ገደላችሁት ግድባችንን ገፋው ግድግዳችሁ ጉሙዝማ ግደሉት ጊሎ";
            amharicWords[26, 1] = "ጋይቷል ጎርጎሬዎስ ጉብኝታቸውም ግዚ ገጠመን ገንዘባቸውም ገድላቸውን ጋናዊ ግሉኮስ ግዴ ጓደኞቻቸውና ገድሎታል ጊነስ ጋሪውን ገዛኢ ጋራዥና ጎረቤታሞች ጉንጩ ግብራቸውን ገፅታቸው ጎረምሶቹ ገምግሞና ጎተራዎች ግዛቶችና ጉዋደኞች ገንዘቦቹ ግሸን ገመዶች ገሞራዊ ጋጠወጦች ግዝቱን ገታ ገርልስ ገት ጋዜጣዋን ግስት ገዢም ጌታቸውም ገበሬውንም ገለፃው ግንዛቤዎችን ጉዝጉዜ ጎናችንን ገቡልኝ ገዢውም ገፀባህሪ ግሩፕም ጉዳዮቹን ገዕታ ገን ጉምጉምታው ጊዜኮ ግንዘባቤ ግብፆችም ገርል ገዢዎችም ገምቻለሁ ጓደኝነ ግንዳቸውን ጋይል ገፍፌ ጎታ ገፍፎ ግጥማቸውን ጉባዔዎችም ገሃነምነት ጊቪንግ ጋሻሞ ግጠው ገነንነት ጊሎስ ጉደለቶችን ገቢያችንን ገባሪ ጓደኛዬም ገዜ ገድባ ጎጠኝነቱ ጓንጉል ጎሳዎችም ጓጉተው ገድላቸው ገብረአብዝጊ ጎጠኛነት ገብነትም ገራፊዎች ገዳምም ገባሽ ጎናቸውን ጉንጮቹ ገልቱ ገዳማቱ ጋላይድ ጊቢውን ግዴታዎቻቸውን ገጽታችንን ጉድዩ ግጥሙም ገጻችን ጉድይ ግንበኛና ግሥጋሴ ጊዜየን ገብርኤላ ግርሃም ጋዜጠኛዋን ጉሜ ጉትጎታው ገላህን ግኡዝ ጉዳይዋን ጎዝጉዜ ግድያም ገምቱ ጎመንና ግጥማቸው ጓዶቹን ግስጋሴን ጎትዘ ገዝቷል ጉብሎች ጉብኘት ገበያንና ገፄ ገብረእግዝአብሔር ጉባአቸውን ጎበዞች ጎርፍን ጋዜጦቻችን ገላጋይና ገብረው ገዢን ግብኣተ ገልብጠን ግፊታቸውን ጉባዔስ ገልጤዋል ግጥሜን ገዥዋ ጋራና ገፋፊውን ግራፊቲ ግንባርነት ጎሹን ጎሰኝነትን ጎንደሬ ጋይቶ ግንብና ግዥዎች ገሐነም ግለቱን ጉች ጓደኞቻቸውንና ጎማዎች ግንዛበ ገልጸዉ ጉድለቶቹ ገሐድ ጉጅሌዎቹ ጎፍ ግብዝነት ጉኛ ገጠሮችና ጉዳቸውን ግመሎቹ ገላልጦ ገለልተኝነቱ ገላጋዮች ግልፍተኛነት ገብረዓብ ግንኙነትንም ግምትን ጋይተው ገዢዋ ገዛህኝ ግዴለዎትም ጉልህና ገለፀው ገልገሎ ጎዳናን ግምታችን ጋጋታና ግዝፈትና ገለጸልን ገጥሞአቸዋል ገልፀንላቸዋል ጎሠኛነትን ጉዙ ጎዳናዎችና ጉልበቷ ገብረስላሴን ግብረኃይሎች ገጥመውናል ግራፊን ግርፋቱ ገጽታቸው ገሰሰና ገለታን ጉምዝም ጉዴ ገፀባህሪያቱ ገርማሜ ግሬደር ገንዝበ ጓዳችን ገአስ ገምድሎች ገሥግሠው ግብዣና ግምግማ ግሩኘ ጎርሳ ግዜያቸውን ግንባራት ጎርሶ ግዛን ገዳማችንን ጋርሲያ ገዳያቸው ጎሪላ ገብረዋህድን ግንኮ ግንኙነትንና ገለፀልን ገንጥለውና ጉጉና ጊሜ ጎጠኝነትና ገልፃል ገሰጸው ጉደር ጉድለትህን ገቢራዊነት ገልጸውለት ጓደኞችዋ ግንቦትና ግንቦትን ገዝተናል ጉጉቱን ጉዲሳን ጊዮርጊስንና ጉንዳንና ገናናነት ጉፋ ግድቦችንና ገብረክርስቶስን ጊዜያዊነቱን ገብቶሃል ጎንደሪያ ግዛዉ ጎብኝተን ገዳመ ገንብቶና ጎዳናዋ ግንኙነቶቻችንን ገንጸብ ጉድለቱንም ግንኑነታቸውን ጓደኞቼም ገበታዋርያ ግድግዳውን ገማል ግደታችን ገጠመኙን ገለልተኝነታቸውን ገመናችን ገቢዎቹ ገዦች ጉጦች ግዙፉና ገኗል ጉራፈርዳም ገፋፍተን ገበያዬ ጎጆዎቹ ጎትጓችነት ጊዜዉም ጉጉትም ጋሊሊዮ";
            amharicWords[26, 2] = "ጉስቁል ጊዜሽወርቅ ጉሮሮዬ ገሰገሰ ጌጥነት ግባትን ጉግሣ ገብተውም ግሪካውያን ግድፈትና ግዛቶቹ ጓደኞችህ ግላዊነት ጊብሪ ጌትዬ ጊኒዎች ገርፎ ገዝሙ ግድግዳዎች ጌቶችም ጉግስ ግምቢ ጉደኛ ጎማዎችን ጉስማ ጌጡና ጉባዔተኛ ጊዜአዊ ጎድቶናል ገብረሐና ጋቤጣዎቻችንን ግብሩም ጉዱዮችን ግለኝነትና ጌታችንና ገጀራ ገጸባህሪያት ግጨት ጉዱዬች ግሪስ ጌታችንን ግዜዎች ጉዳያ ግለኝነትን ግብዝነትና ግጥምም ግዢን ጎትተን ገመዶችና ገለጽኩለት ጉልቻው ገለልተኛው ገጠሬውን ጋርዶት ገብርዔል ጉረኛ ጋብዛ ጎደለው ጌምስ ጋራዦች ጉራዕ ገጥሟል ጋንና ጉሕዴግ ግለሂስም ጋለሞታ ገልጠናል ገርሃርድ ገፍትሮ ጉርሜሳ ጌጤነሽ ገበየው ገለልተኝነትን ገላማጭ ግጥሞቹን ጉደተኞች ጎዶሎው ገንቢዎችም ጌራወርቅ ጓንቶችን ገዣኸን ጎባጣ ጋድሌ ጓንዴ ግራፎች ጎናችን ገላጮች ግዙፋን ገዛኽኝ ግትርነትን ጉዊዶ ግምባታና ግብረሰዶማዊነት ገንዳው ገባውና ግዴለህም ግሪጎሪ ጋዞ ገለጡት ገቨርናንስ ገዱማቱ ገዳዩን ግማሾቹን ገምጋሚው ጎሳዎችን ግድያዎችና ግባልኝ ገለፁት ጋርሂ ገዥነቱን ግጥሚያዋን ግዙፍነትና ጎበናን ጉዳታችው ገለው ጋዞችን ጉዳቱም ገብረመድሕን ግድያዎችን ግነቱ ግነት ግጭቱና ጋጠ ጎንደርንና ገፋፍተው ጋጥ ጉብታ ገደሏቸው ጌረ ገብታቸው ጓደኛሽ ግዜው ገብነቶች ግንባታንም ጋንግ ገበሬን ገብቷቸው ጋርስ ጋዜጦችንም ጉዳይህን ገራፊዎችም ግቢውም ጋዱፊ ጉዱቱ ግብጽንና ጌት ጌታሁንን ገዳዮቹን ግብጻዊ ጌቶችና ግዝፈት ጎሮና ገባችሁ ጉልበትንና ጉዱዮን ጋራውን ገበሬዎችንም ገብረመስቀልን ግደሉ ጉባዔያቸውን ገበታችን ግልገሎቻቸው ግንቦች ጉልላቴ ጌን ገዱሙ ገትራ ጉባኤያቸው ግሪኮች ጉዳይዋ ጉባዔዎቹ ጋልኛ ግድፈቶችና ገለጹልን ገዳማትም ጎጆው ግቡም ገዥዎቻችንን ጌልዶፍን ገመቹና ግንፍሌ ግጥምና ገብነቱ ጋርቬይ ገላችንን ግጥምን ጌዲዮ ግድብን ጎይቴ ገዛሁ ገደልኩት ገታራነት ጉዳዬንም ጋዜጣውም ገጽታዎችን ግራናይት ግደለኝ ገለፆ ግረህ ጉድያቸው ግንዛቤውም ግራስ ገነታዊ ጉርጓድ ገብቸ ጓጉቷል ግብጻዊያን ገላዋን ጉዱትን ጌዴዎን ገፍተን ገድበው ግኝኑነት ገብረሥላሴና ጎብኝቷል ጓዳውን ግንኙነታችንም ግሞ ጎርነን ገዢዎቻቸው ግማቱ ግድያዎችንና ጉዞዉ ጉዞዋ ገርገፍ ግስ ግፌን ጉድላክ ጋዜጠኞቹና ጊምቢ ግምባርን ጉሬዛ ግለቱ ገልፆታል ገብታችኋል ጊዜማ ጉያና ጋዳፊም ጉልማ ገልፃዋል ጎረቤቱ ገረፍ ገፋፍቷል ጉደታና ግብዓቶችንና ጎኑን ጎረቤቴ ገብርኤልና ገነትነት ገንጥላ ገልጸውልኛል ግዝቱ ጉዋዙ ጎረቤቷ ጎርፍም ገበታን ግዙፋ ጎርባቾቭ ግምባሮች ጉዳቶችና ጓንታናሞ ጋምቢያና ገንዘባዊ ጉሮሮአቸውን ጊርት ግለኛ ጎረምሳው ግብረር ጉዋዳ ግንኙንት ጉንደ ጉባዔያችን ግዛውም ገጥመዋል ገረዳቸው ግርዘት ጋዓስ ገብረተንሳይና ግርምትና ጋርድ ገንብተናል ግርማይስ ጋበዘ ጉልትዎ ጋበዙ ጉድለቶቹን";
            amharicWords[26, 3] = "ግንድና ጊልበርት ጌዜ ግኑኙነት ገብረፃዲቅ ግብረአበሮቹ ገደፋ ጎረቤቶቿ ግንባትና ገጽና ጉዳተኞቹ ጊዜያችሁን ጉልበታም ጋዜጣኛ ገሌና ጌጡ ገብርኤልም ገትቶ ግሮ ጉዳተኝነት ጓደኞቿም ግምገማዊ ጊታር ግሩፖች ጉብኝታችንን ግጥሚያዎችን ጓደኛውን ገፅታዎች ግንዛቤውን ጋቦዴ ገረዳቸውን ገበያተኛው ግደታቸውን ገሰሱን ጓደኛና ጉዳጓዶች ጉሬይ ገለጹት ግሬግዋ ጉዞዬ ገንቦ ጉሮሮውን ግብጻውያን ጉምሩክን ገንጣዮች ጉንደትና ጋልጋሎ ጉሮሮአቸው ገድሎች ጓዶቻችን ግሎባይላይዜሽን ጉባኤእ ግንዛቤዎች ገልፆላቸዋል ገንብቷል ገልጥው ጉራጌን ጓጉቼ ግብረሰዶማዊያን ገደብን ገረዶች ገትርና ገዛች ገለ ገንኖ ግዜውን ጉልቤ ግምገማውም ጋኖችን ጉርሱ ገልፀዋ ገልፀውላቸው ጉዳዬች ግዴለኝም ገዢዎቹን ገገማ ግዳጁ ጉዳይወይም ጋማል ጉልትዎን ገልጻችኋል ግልገሎችን ጓደኛዉ ጓደኛቸውን ጉንተር ጎረምሶች ግብም ግንጠላ ገብረዮሃንስ ጋርደን ግብፃዊያን ግንኙነታችንን ጎልደን ግብርንና ገልሳ ጎድጓዳ ግረው ገላጋይነት ጋለሪ ግፊታቸው ግለሰቧን ግትርና ግልገሎች ገንደ ጌቶቻችን ጎቦ ገጠመኞች ግዚዕ ጉዳችን ጋሎን ገፁን ጋትዊች ግዑዛን ጎት ጋይማርድ ጊዜውና ጋይም ገምግመን ጎሉን ገጽታውን ጓዶቻቸውን ጎና ገልጸን ግራጫ ግንኑነት ጎንቻ ጓዳዊ ግለሠቦችና ጓደኛህን ገነባች ግሬስ ጋዘጠኞች ግለፅ ጊዜዬ ጉዳዩችን ገብቶም ጋዜጠኛን ግብት ጉብኝታችን ጉባዔዎችን ጎዜ ግብግቡ ገለጻና ግብዓትና ግልባጩን ጉሌድን ገምት ጉዟችን ገምቶ ግብዓትን ገሃነማዊ ጉልበታችን ገፍቶበት ግላውኮማ ግፍን ጎረቤቶቻቸው ገምድልነት ጉብ ጉባዬ ጉሄኖ ግዢዎችን ጉቶ ጋሎጅ ጊዮርጊሶችን ገስግሰው ገለጿል ጉብኝቶችን ገደቦችና ጊዜህን ጎይትኦም ግዴለሽም ገለጠው ግብፅንም ግርድና ግብርናዋን ግንበኛ ጋዜጠኖች ግዛተ ጎቨርናንቸ ገደሉን ገድዬ ገባራት ግንባሮችም ገነቴና ጋራዎች ገለታና ጎጠኞቹ ጉጃም ገሰሰን ገደቡም ገንቢዎች ጎልብተው ጊዚያቸውን ገንዘቧን ጉዳይህ ጉጉ ግኝቱን ግዥም ጊላ ጎሳና ግሽበትና ጉዶች ጋግረው ጎልታ ገድለዋቸዋል ጎድቶ ግዴታዎቹን ገጸባህሪ ገነባ ግልገሏን ግዳጃችሁን ጌዴኦ ግልግሉ ግብአትና ግድግዳውም ጉራራ ጎጠኝነትን ገድሏቸዋል ጎፈሬ ጎፈር ገለጻዎች ጋዋናስ ገዳዮችን ገለፃውን ግሬይ ገልጾዋል ገዳዩም ግልገሉ ገብቶላቸው ገልፄው ገበዙ ገፀባህሪያት ገልጹ ገጥሞናል ግላይድ ገድልና ገብሩም ጎልማሳውን ጊዳይ ገልፀ ግንኙነታችሁ ግፉበት ጎበናም ጊዜያችን ግርማጽዮን ገደላት ጋቢሳ ገፍተውበት ገለጹላቸው ገልፄዋል ጉዞዋቸውን ጋሬሳ ገመናቸውን ጉብኝቱም ገንዘቡንና ጓደኞቿን ጉድገድ ግደሉኝ ግብአተ ገድለን ጉንዳኖች ግዴታችሁን ጉድጓዱን ግርማም ገብረጻድቅ ጉስቋም ጋዛል ገብቶናልና ገብቶን ግዛቶቻችን ገዛገብረስላሴ ጉሮኖ ግለሰዎችን ጉዳይስ ገለታው ግንዱን ግዙፉን ገጾቻቸው ገዝታችሁ ጎኖቹ ገልጻዋለች ጊሮንዲኖች ገሊፁ";
            amharicWords[26, 4] = "ግኙነት ግመሎችና ግርድፍ ጎማውን ጌሾ ገቢዋን ገራገር ጋይዶች ገድበን ገናሌና ገስት ጉጉትና ገብር ገዛኸኝና ግደል ጎናቸው ጋፋት ግሽበትም ገጽታዋን ጊዜንና ገጽታዋ ገፍታ ጓዜን ጉርምስና ጎኔን ግብራቸው ግዴታዬን ጌርሃርድ ገልጽዋል ጉዕሽ ገሠሠን ገንጣይና ገለፁልኝ ጉልበተኞች ገቢታ ገዥዎችና ጉዱይም ገጠመኜን ገብረተንሣይ ገብረሥላሴን ግርማዬ ገላውዴዎስ ጉዳታቸው ግልፀት ጊዜአቸው ገበየሁና ጉንፋንን ግልጽም ግመታ ጋናን ግጭቶችም ገብረዮሐንስ ግኡሽ ጋሪው ግለሠብ ጓዶቹ ጓዶቼ ገብተዉ ግዙ ጉዳተኞችና ገሪ ግራውን ጉልቴ ገድለ ገጠሬው ጉርሱም ጓንቶች ጉዳዮችንም ገብረሊባኖስ ጉልቻ ጋላሪ ጎንም ጉዋደኞቼ ጉድጓድና ጎሕ ጎሬ ጓዱ ጉቦኛ ጋሎች ግልገሎቹ ገባህ ገኖ ጎጃምን ጌራና ጉራጌው ገባሮች ገጠሩን ጉዞአችንን ጎኔ ገመዱን ጋኤል ጊዜያቸውንና ገዴ ገዱማትና ግንባሩና ጉተታ ገብረጊዮርጊስ ጉሙ ገስግሶ ጉልበትም ግንኙነቱም ገልጽውል ጋዳፊን ጌጠኛ ግብፃዊው ገሪሶ ጎበኝተው ግሌን ገደላማ ገፎ ጎብኚዎቹ ግጥሞችና ጎድሎ ግራቀኝ ጉታ ግሬት ጉብኝቶችና ግድግዳው ጉማሬዎች ግሪክና ግንቡ ግንባታችን ገብርዬ ገደቦችን ገባቸው ጋራንግን ግዑዝ ገብረአምላክና ገጥሞን ጉርሱን ገብቷቸዋል ገምተው ገጻቸው ጎልያድ ገለጻውን ግፊቱን ገምግመዋል ጋቤጣ ገቦችና ጉባዔተኞቹ ግጥሞቹ ገብተሃል ግዛኝ ጉድጓዶችንና ገፅና ግንባሮችን ገንዘቤ ገፆችን ገብረማርያምና ገዳዮችና ገበርኩ ጊዜውንም ጓደኞችዎ ገለፀልኝ ጉዳዮቻቸውን ግኝታቸው ግልምጫ ገለጸላቸው ጌሕዴድ ጉሮሮው ገርባን ግርግርን ገዳሜ ጉዞዬን ጋዜጠኞችንም ገዳምና ገጠሩንና ግሬግ ጋርቪን ጋሻውም ጎተቱኝ ገብረማሪያምና ጊሌህ ገ ግእዝ ግፎችን ገጠርንና ግለፁልን ገደላ ግመልም ጉባኤውና ግልብ ጓንቲ ጉራቻ ጋዜጤኛ ግለስብ ጎጂና ጎንደርን ገመትኩ ገዢዎቹም ጉግሳ ግቦቹ ጉራና ጊዳ ጊዜያዊው ገዳቢ ገንብተን ግበረ ግዥዎችን ጉዳያችሁ ግምቴ ግዴታዋ ጋማ ገበሬዎቹን ገብስማ ጋረ ግባተ ጋሹ ጋሽ ግብጽም ገበዙን ጋብዘን ጋዜጣቸው ገጣሚው ግዴታውም ጉድጎዶች ገዳማችን ጋዜጠኞቻቸው ገለቱ ጋብቻዎች ገላውዲዮስ ጎድቶታል ጋት ገጥመውታል ገጠሩ ጉዞዎችን ጉምዝና ጉንጫቸውን ጎጂነት ጉንጭን ጉዳዮቻቸው ገላው ገዳዎ ገለልቻ ጎደለ ጎጃሜ ግብታዊና ግብረሰዶማዉያን ጋዜጠኛውም ጌቶቹ ጋናዊው ጋየ ጋላክሲ ጉባአው ጋያ ጉድሩን ገፅታን ጉቦኝነት ገብሩን ጉዳያችሁን ግርማቸው ጋብዘው ጌሌ ጎብኝዎችን ጉድዮች ገጽም ገቢያችን ገፍቷል ገፋፊነት ግዙን ግኝትና ግመሎችን ጎመራ ጎይተኦም ግመልና ግደታውን ገንፎውን ገብረእግዚያብሔር ግሌንይስ ግብረሰዶማዉያንን ጉርምርምታ ጉባዔውና ገጣሚዎች ገመዱ ጊኒና ጎረቤቶቻችን ጋርባሃሬ ገብረመሲህ ግናይ ጉዱን ገቢሣ ጎጆዋ ጋጠወጥ ግመሉ ግምቶችን ግንፍል ገጽታዎችና ጉርጉዋድ ገጥሟት";
            amharicWords[26, 5] = "ግትልትል ግንባሮቹ ገንነው ጎረቤቶች ጋንሂል ጌጋታት ጊዳዳና ገነናዊ ገዢዎቹ ጎራው ገዥዎችን ግደይና ጉጅሌ ጓሳ ግዜያዊ ገልጠውታል ገፍታበታለች ገመዶችንና ገፍተው ገላ ገል ገበያቸው ጋብሬላ ገቢዎችን ጋሮማ ጉለንታው ገዳሙን ገልብጦ ጉቦና ጉዳያቸውም ጋደም ጎሽ ጉሊት ጉዕዞ ግፉ ጉድጓዶቹ ጎብኚ ጎብኝ ጊዮርጊሱ ጉባዔያቸው ገናናው ጉርብትናና ጎረቤታችን ጉርብትናን ጉልቶቻቸው ጓዳው ጊዜያትና ግንኙነቶችና ጉሮ ገጸ ጉባኤተኛ ግብን ገዢና ጉባ ጉባዔውም ገንብተዋል ጉርድ ግዚያት ጉትጎታ ጋሻና ገዢዉ ጉልበቴ ግብፅም ገበና ጊሌ ግብይትና ጋራድ ጎልያድን ግሩፕና ገዥዎችም ግፊያ ግምገማቸውን ጋይተዋል ግዱጅ ጎሰኛ ግርማይና ጋዜጣችሁ ገዳምን ጋላታሳራይ ጓዶቻቸው ገልጻልናለች ግባቸውን ገራም ግንባታዋን ገብቶአል ግንዛቤያቸው ጎዳናውን ግብረአበሮቻቸው ገለጸው ጋቢና ጋብቻውን ገሮች ገበሬዎችም ገድላለች ጉባዔዋ ጊፍቲ ጋቢ ገለቴ ጓደኛዋን ገበሬውም ግልዕ ገመናሽን ጌታቸውን ጎላም ግብዓትነት ጋብሪኤል ጎንለጎን ገብቶዋቸው ግፋው ግዜና ጉባኤያችን ጎንበስ ጎትተው ገደላቸው ጋሻውን ገጽታና ጌሩ ጋብቻቸው ገልጥዋል ገበሬና ግብዓቶችና ገልጸናል ገላጣ ግዜያት ጌታና ጌታን ገንብተው ግሪድ ግርግዳ ግለሰብና ጎምሩክ ጎቨርንመንት ጉዞዋን ገቢር ገደለው ግብፃውያንን ገርስሶ ግቧን ገደፉ ገጣጥሞ ጉባኤዎችና ግንባታዎችም ጋዜጠኞቹም ግም ግዛታዊ ጌጣ ጌታዋን ግደታ ገነትና ግንባታዎችና ገረወይና ጋምቢያ ገበየሁን ጎበዛዝት ግፉን ግራንድ ጉድጓዱ ገብያ ጋሊያኖ ገዝተህ ገጠመኜ ጉዋደኞቹ ገዝታለች ግማደ ጌጦች ጉድና ግፍም ገመናሽ ጋይንት ጌጣጌጦች ጉዳዮችንና ጎትቶ ጉዳዬን ጌታውን ገርሁ ገፈርሳ ጓደኞችና ገዥዎቹ ጋዜጠኛይቱ ጊዜዋ ገብረትንሣኤ ግሮወርስ ጉንዳን ገድ ግርዛትና ገዥን ጉማ ገልጸውለታል ገጻታ ጋውና ጉርዓ ግልፍተኛ ጉናና ግጥሞችን ገደሉት ጉራፈርዳ ገዙሜ ገባና ግልቢያ ገሊኡ ግንኙነታቸውም ገብረስላሴና ግቢያቸውን ግብዝ ጉድለታቸውን ግብዞች ገርሞት ገንዘብህን ጉዳ ጉበኛና ግዜዉም ጉማሬ ገዳማትን ጎሳን ጉራማይሌ ግድቦቹ ግሩፕን ግላዊና ጉዟችንን ግልጥልጥ ገልጨ ጎምቱ ገምግመው ገቢሳና ጉዕዞና ጌዲዮን ግምቡን ገርባና ግባችንን ጎንፋ ግማሾቻችን ጌትነትን ግልፍተኝነት ጋዜጣዎች ግለኝነት ግኝቶችን ግብአቱ ገጽታም ጉዳታችን ግንዛቤም ጎሳዬ ገብሬና ጎርባጣ ገብሬን ገበሬዎቹም ጎሎችን ግጥሙ ገለሣ ግዥን ግፎች ጎኖቹን ጌታዬን ጎልድ ገብረሃና ገሚሱን ግብረሠናይ ጋዞች ጋሙ ገንዘብንና ጋምቤላን ግዴላችሁም ግርታ ገሃነም ጊዜዬን ጎብልስ ግዥው ገመዶችን ገላን ገማች ገጠመ ጎርጎሪዮሳዊው ግባና ጌቶቻቸው ገብቱዋል ጉማጅ ገብቶታል ገመታ ጎብኚዎችን ጌጣጌጦችና ገረብ ገብቻለሁ ጎደሎ ግምገማን ግርማዊነታቸው ገደልና ገብሩና ገደልን ጌሊ ግሮሰሪ ጉልበታችንን";
            amharicWords[26, 6] = "ግድያን ገልብጠው ገደም ጋባዥነት ጎሪላዎች ጉባኤያቸውን ጉዞዎች ገልጸውታል ገደቡን ግትርነት ገመና ጊዜዎች ገዱማት ግርዶሽ ገንፍሎ ግለሰባዊ ጌዲኦ ጉዞአቸው ገትሮ ግለሰቦችንም ግብርናውን ግራር ጊዳዳን ግለሰቦችንና ገልፀውለታል ጓደኛሞች ግብታዊ ግምቱን ገነትን ገልፅዋል ገንጥሎ ገንዘባችን ግርምትን ጉዲሳ ግብርናው ጉንጭ ገምቷል ገንዘቦችን ጎበዜና ገብሬል ጎዞ ግንበታ ጉባዕ ገለልተኛነት ገብረመድህንን ግንኝነት ግዞት ጋኔን ጋብቻና ገብረትንሳኤ ጉልቶችዎ ገንቢና ጋሻዬ ገንዘቡንም ግፊትም ጉዲናን ገብሱን ገልስጸዋል ጊደሮች ጉዳዮቻችን ገርበብ ጓደኞቹን ጌሊህ ጉዳዬ ግዕዝ ጋሼ ገላና ገለፃቸው ገጠሙ ግጦሽን ጉናዎች ገብረጻዲቅ ጋዜጠኛም ገብረወልድ ግፈኛ ገብረፃድቅ ጓደኛዬን ጎርፉ ጌም ግሮሰሪያችን ግርማን ገንዳዎች ገደልኩ ግሽበቱን ጊቢው ጌቴ ግቢያቸው ጉልበተኛው ገዱም ጋቦን ገፅታው ግብፅንና ግድብና ግለሰዎች ገልፆአል ግዙፍና ግብጽን ገንባታ ግሉ ገላቸውን ገንዘባችንን ጉድሩ ግዙፉ ገለፃና ጓደኞቼን ጉልበተኛ ጋሻውጠና ግዳይ ግዢዎች ጋርዚያቶ ጉባኤዋ ገበ ገልጠውለታል ጓዝ ጓደኞቻቸውን ገብረተንሳይ ጓያ ጎዴና ግንኙት ገርሞኛል ገድቦ ጋፖመ ጋዜጠኛና ጉሌ ጉባዔም ገበረ ጋብቻቸውን ጉናን ጉድለትን ጋዝን ጉደለት ገዥነት ጊዜአቸውን ጎምፔርትዝ ጉዞአችን ጊላይን ገጥሞኝ ግምባሩ ገጣሚያን ገዳማዊ ገብቶት ገልጬ ገድያለሁ ጓደኝነት ግንዱ ግጭቱም ግጭታቸውን ግድቡን ገልፆልናል ገበሬም ግዢውን ጎስቋላ ጋሌ ጎርጎር ገፈፋ ገብተህ ጋዜጤኞች ገላኔ ጓዶችን ገረሱ ጉሌህ ጎረምሳ ጊልዶፍ ግድየለም ጉድለቱን ግጭቶቹ ገቡና ገርፈው ግለሰቡም ግስጋሴውን ገለፃም ጌታቸዉ ጋብዘዋል ግዥውን ገልጦታል ግጥሚያቸውን ገልጠውልናል ግርጌ ጎርጎርዮስ ጊዱዱ ግዴታዋን ጉድጓዶችና ጎመን ግጭቶቹን ጊዜውንና ገድለናል ጊዜዋን ጊዜስ ጎራዴ ጋናና ጉዳቶችን ግራኝ ጉርሙ ጋዜጣዋ ገርጋሪ ጋሽዬ ገር ገድሊ ገጠሮች ግልጽነትንና ግብረሰዶም ጎባ ግድየለሽነት ግምገማም ጋዜጠኞቻችን ገብቶበት ገዥና ጉድያ ገምቢ ጊዜያችንን ገምቼ ጎጅ ገንፎ ጎሰኝነትና ግራውንድ ገንጣይ ገልጾላቸዋል ግብረሃይል ጉጅሌዎች ጉድፍ ገልመጥ ግርግሩ ጋርዲያን ግራዚያኒን ጉዳዩንም ግጥሚያው ግዛቶቿን ገሪማና ገነቴ ጎሰኝነት ግብአትን ግጭቶችንና ጎልብቶ ገጾችና ግብይቶች ጋዜጠኛዉ ገልፁ ገርሞኝ ግንባራቸው ገለፃዎች ገንዘባችሁን ጉዳና ግቦችና ገነኖች ጎጆዎች ግንዘቤ ገመገመ ገብቶናል ጋሞ ግፈኞች ግዛታችን ጎዶሎ ግድብም ግብርናንና ግጦሽና ጊዳዳም ጋርመንት ግዴታዬ ጌታቸውና ገዝታ ጌታም ገዝቼ ጉሙዝና ግዘፍ ጊዜያትም ገዳይነት ገባውን ጉልበቱንና ጋዲ ገላዬ ገብነትን ጉዋደኝነት ጎልማሶችን ግልጥ ግፊትን ጎኖፋ ጌታመሳይ ግነኙነት ገብሮ ጓደኛማቾች ግንባታንና ጊኒን ግሎብ ጋዜጦችንና ገዛገረስላሴ ጋንዲን ገብስና";
            amharicWords[26, 7] = "ጉባኤም ጉዱዮች ግለሠቦች ገልጾአል ጎሾች ገጽታው ገልፀውላቸዋል ጎኖችን ጉዱዩ ግንደወይን ገዝተዋል ገምጋሚ ጎላ ጋብዘናል ገዝ ገዱ ጎራዎች ጋብቻን ገለጸች ገቦችን ገብረአምላክ ግብአቶች ግዴታዎችን ጋሪዎች ግዛቱን ጓደኛችን ግሪን ጊዮን ግብረኃይል ጋሪዎችን ግንዛቤና ገድሉ ገጠመኝ ጓዳ ጉባኤተኞች ግፋ ጎልተው ገጾች ገጥሞ ጉድለትና ጓዛቸውን ግዛቱ ጉዟቸው ግዴታና ጉባዔን ጉዟቸውን ገዢዎችና ጌል ጋንዲ ግዴታችንን ገጭቶ ግለሰብን ጌልዶፍ ጉዲፈቻን ገዝፎ ጌጥ ግቤ ጉባኤውም ጉብኝትም ጓዴ ገባሁ ግንባታዎቹ ጋትሉዋክ ግብፆች ገትረው ጉም ገንዘባቸውንና ግምትና ገመዳና ጉጂ ግሽበትን ገናን ገነተ ግርማይን ገጠርና ገጠርን ግምባታ ግዜም ግዴታው ጋዜጦቹ ገዥውን ገበሬዎችና ጎልጉል ገዢዎችን ገዛኸን ገዳዩ ጎበዛይ ገልፀናል ግብዣውን ጉዞን ጎልጎታ ጌዶ ግልጽነትን ገጥመው ግንኙነቷን ገልባጭ ግዛትን ግምትም ግዛታቸው ጓደኛዋ ግዛቶችን ገበታው ጉራጌዎች ገለጠች ግብይቱ ግንኙነቶችን ግባችን ገብረየስ ገልጣ ግራጌታ ገሞራ ጋዜጠኞችንና ጉዳዮ ገብነትና ጋዜም ገብረመድኅን ጉባኤዎችን ጉሜዝ ገንዘቤን ጋዜታ ገምድል ጉዳያችንን ጉርሻ ገለልተኛና ጉተማ ግምገማውን ግልፅነትን ጉዳትም ጌጣጌጥ ጓደኛቸው ግዴታም ግልበጣ ገልጾልናል ግንዛቤው ግድቦችን ገንዝብ ጉዳትን ገሪማን ጊዚያት ገነነ ጉዲናና ጋምቤላና ግቢዎች ገብታችሁ ግሽበቱ ገዳሪፍ ገቡላቸው ግብይቱን ግኝቱ ጉዱዩን ገረድ ግብጽና ግርምት ግርፋትና ጋኖች ገለጸዋል ጋአስ ግዛታችንን ገበያም ግንባት ጊልማን ግዛ ገላውን ጋዜጦችም ጎጃምና ገረመኝ ገምጋሚዎች ጉዳዮቹ ግምታዊ ጊዜያዊና ጌትስ ጉልበቱ ግዛቴ ግድቦችና ግዮን ገመዳን ገዝተን ገፅን ግባቸው ጋይድ ገርጂ ጋብዟል ጎተራ ግጥሙን ጋሪ ጋብዞ ገዳዮቹ ገጠም ግዢው ገፆች ጓደኞቿ ጎብኝተው ጉስቁልና ጎሎች ገጽታን ገዢዎቻችን ገላጭ ግንባታቸውን ገለጥ ገልጸውላቸዋል ገንዘቡም ገልፀን ግብርም ገብርኤልን ጉዋደኛው ግንባራቸውን ጉድለቱ ገደብና ግንባታውም ግርፊያ ገቢዋ ጉርስ ጉልት ገዢነት ግቦቹን ጎጠኝነት ጌሌህ ገፋ ግብና ጎሣዎች ጋዝና ጉዞአቸውን ግቢና ግዛትነት ጎጠኞች ገፍተውበታል ግሮስማን ግርግርና ገጾችን ጓደኞቻችን ጉልበታቸውንና ገብቶኝ ጎንደርና ግምብ ግለሰቦቹን ግብፃዊ ጊዮርጊስም ጋንታ ግለሒስ ገለባ ጎዳል ገንዳዎችን ገልፀውልኛል ገዣኸኝ ገቢውም ጉዋደኛ ገፅታና ጉዞም ግርማና ገልጫለሁ ገብቶኛል ገልጠውልኛል ገበያዎችን ገፍቶበታል ጌጋ ግርማዊት ጓዙን ግለት ጎጠኛ ግዝት ጉምሩክና ጓሮ ጉባኤያት ጉባኤተኛው ጉብኝቱን ገዋኔ ገጠራማ ጎህ ጉምጉምታ ጉዲት ገንዳ ጓደኛየ ገዙ ግብፃውያን ግልብጥ ጉርጉሱም ጊዜያትን ገናሌ ገፊ ጎጥ ጉቱ ግፊቶች ጉባዔተኛው ጊል ግዛቴን ግሬድ ገበዝ ገነን ገሚሶቹ ገልፍ ገጣሚና ግ ግርም ጉግል ጋሩማ ጎታች ግዴለሽነት";
            amharicWords[26, 8] = "ጋዜጠኝነት ጉንፋን ግድያና ግብፅን ጎደል ገብረማርያም ጌቶች ገሰሰ ግንብ ግለሰቦችም ግብዓቶችን ግባ ገፈት ጋና ጉብኝቱ ገመድ ጋምካ ገልፃ ጎሳ ግለሰቡን ጊላይ ግብሩን ጉዞውን ጉብኝታቸውን ግትር ጉርብትና ገዢውን ገብስ ገብታ ጉድጓዶችን ገንዘብን ግለሂስ ገደቡ ጉባኤና ጓደኛዬ ገዳዮች ጉራጌ ግዳጃቸውን ገብቼ ጌታዬ ገብተን ግምገማው ገጠመው ግርዛትን ጉዳዩች ጉዳዮን ጎልማሶች ጓደኞቼ ግፊትና ገብረሚካኤል ጋዜጠኞችም ግብረሰናይ ጎብኝተዋል ግንኙነትም ገድለው ግድፈት ገቢም ግላዊ ግማሾቹ ግልፅነትና ጎሳዎች ገቢያቸው ግንኙነታቸው ጉርጂት ገጥሞታል ጉዳዮችና ጎብኝዎች ግንባርን ግመል ጊዜውም ግቡ ገሞራው ገዛ ጉዳዮችም ገርባ ጎብኚዎች ገላሳ ጓንት ጋላ ገበያዎች ገድሎ ገለፀች ገብረሕይወት ግለሰብም ግልግል ገንዘብም ጎዳናዎች ግድያው ጊዮርጊሶች ጓደኞች ጌራ ጋራንግ ጋዜጣን ገብረክርስቶስ ግማሹን ግዴታዎች ገዳሙ ግድፈቶች ጌታችን ገምተዋል ግምገማና ግምታቸው ግልጽነትና ጋራዥ ግጥሞች ጎኖች ገብረዋህድ ጊዚያዊ ገበሬዎችን ግንዛቤን ገድል ግራዝማች ገላጋይ ገጹ ጊኒ ጉልላት ጌጤ ገበሬውን ግምሩክ ጉንጉን ጉዳተኛ ገልጻለች ጋን ግጦሽ ገሃድ ገብረኪዳን ጋሬጣ ጉልበታቸውን ጉዛይ ጉዳዩም ጎሣ ገብታለች ገዳማት ገጽታዎች ግብዓቶች ገበያና ገባን ጉያ ጋዜጠኛዋ ጎበና ጉልበትና ጌቱ ጉዞና ግና ጌይል ገበሬዎቹ ጎዴ ገበታ ጉዳትና ጋረደው ገለታ ጎበዝ ገቢራዊ ገብረህይወት ገልፀውታል ገቢሳ ግርማዊ ግድግዳ ግንኙነታችን ጓደኛው ገብራይ ግስጋሴ ገባች ጊዜያቶች ገብረማሪያም ጉሮሮ ጉለሌ ጋጋታ ግብሮችን ግዛትና ጎማ ጎሹ ጎኑ ገጠማቸው ጋዜጣውን ገልጻ ግለሰቧ ጋዜጠኛውን ጉባዔዎች ገልጸውልናል ግር ጎርደን ገለፀዋል ግሎባል ጎጆ ግጥሚያውን ገልጣለች ግዛቷ ገዳማትና ጊቢ ጉባዔና ገድለዋል ገምግሟል ገሸሽ ጉልበትን ግምቶች ገፍቶ ጌዲ ግዳጁን ግዛታቸውን ግብፃውያኑ ገፁ ገጥሞት ገድሏል ገብረእግዚአብሄር ገናና ገላሣ ገደሉ ግብዣው ግዥና ግዢና ጉብኝቶች ጋዲሳ ግንዛቤያቸውን ገልጾታል ጉባኤን ግድያዎች ገንዘባቸው ግንባሩን ጉራ ገረመው ግንባርም ጎልማሳ ግርፋት ገነቱ ግጭቶችና ገጣሚ ገደቦች ገጹን ግሪክ ጌታው ገጽን ግለ ጉዳቶች ገንዘቦች ጋዜጣችን ጉልበቱን ጎሜዝ ገሀድ ገባኝ ጎይቶም ግሎባላይዜሽን ጋብቻው ጉደታ ገደለ ግድቡ ገብተናል ጊልክስ ጋዜጠኝነትን ጎጀም ገዥዎቻችን ግኑኝነት ጉዳቱን ጉባኤተኞቹ ገሊላ ጉድለቶችን ገባር ግዛቷን ጉዳያችን ግራፍ ገፀ ግፊቱ ግመሎች ግዴታቸው ግብይትን ግብጾች ጉልቶች ጎዳናው ገለል ጊዘ ጎበኙ ጋሊ ገጥሟቸው ገብረየሱስ ግብርናን ግዴታችን ግጭትም ግድፈቶችን ጋርና ጋዜጠኞቹን ግድያውን ገንብቶ ግምገማዎች ገልቹ ገሚሱ ግኝቶች ገባው ጉልበታቸው ገለልተኝነት ግብአቶችን ግዴታን ገጥሟቸዋል ጉብኝትና ጋዜጣም";
            amharicWords[26, 9] = "ገ ጋር ጊዜ ግን ጉዳይ ገልፀዋል ግንኙነት ገልጸዋል ግንባታ ገንዘብ ገልጿል ገቢ ጉዳዮች ግንቦት ግንባር ጋዜጣ ግጭት ጉባኤ ገበያ ጉዳት ጋዜጠኞች ግለሰቦች ጉባዔ ገለፁ ገልጸው ጉዳዩ ገልፀው ገና ግዛት ግብር ግርማ ግንዛቤ ግምት ጉዳዩን ገለፀ ገጠር ገለጹ ገልጠዋል ገለፃ ግለሰብ ጋዜጠኛ ግብ ገለጸ ጉብኝት ጊዜያዊ ጋዜጣዊ ጎን ጊዮርጊስ ጉዞ ግልፅ ጊዜያት ግምገማ ገልጧል ጉባኤው ጌታቸው ግፊት ግልጽ ግቢ ግብርና ገደብ ገብተው ግዴታ ገብቶ ግብፅ ጋዜጦች ግራ ግማሽ ገልጾ ግብርናና ጋዜጣው ገለጻ ገጽታ ጊዜም ገብረ ግጭቱ ግድያ ገብተዋል ጊዜው ገለልተኛ ጉባዔው ጊዳዳ ገበሬዎች ገልፆ ግንባታና ገበሬ ገብሩ ግጭቶች ግብረ ግዛቶች ግንባታው ግለሰቡ ገነት ጉምሩክ ጋዜጠኞችን ገዢው ጉዳያቸው ጉዲና ግፍ ገቡ ገዢ ግብይት ጉዳዮችን ገልጠው ጉልህ ጉድለት ገባ ግብዣ ገደማ ግለሰቦችን ገመዳ ገንዘቡ ጎዳና ግዢ ገዥ ግንባሩ ገብነት ገጽ ገልጦ ገልፀውልናል ግሩፕ ጎጂ ግዜ ጋዜጠኛው ገንዘቡን ጉዱ ግንባሮች ጉድ ጋ ጎንደር ጉዳተኞች ገቢው ግዙፍ ግል ገፅታ ግቦች ጊዜና ግጥሚያ ገብቷል ግድ ግንኙነትና ጋብቻ ገቢዎች ጓድ ግንባታዎች ገለጡ ጉልበት ጌታ ገፅ ጉዱይ ገንቢ ገንዘብና ገበየሁ ጋራ ጋዝ ግርማይ ገለጠ ግድብ ገብርኤል ግራም ግንባታን ጎጃም ግዴታቸውን ጋርም ገበያን ግርግር ግንባታቸው ጌታሁን ገበያው ገዥው ጉባኤውን ጉድጓዶች ገበታቸው ጊዜያቸውን ግዛቸው ገበሬው ግዥ ግለሰቦችና ግጭቱን ጊዜውን ጉድጓድ ግጭቶችን ጉዳይና ጉና ገዳም ገዳይ ገልፃለች ጉባዔውን ጊቤ ጎረቤት ግዳጅ ጋዳፊ ግምባር ግዛው ገዛኸኝ ግፍና ግለሰቦቹ ጉሌድ ጋብ ገብሬ ገቢውን ጎልቶ ገደል ግብጽ ጋዜጠኞቹ ገዥዎች ግንኙነቶች ገዢዎች ግጭትና ገንዘባቸውን ጉዳያቸውን ገዝቶ ጋምቤላ ጊዜያቸው ጋሻ ጉቦ ግቦችን ጋዜጠኞችና ገብረመድህን ገበያውን ግቡን ግንኙነታቸውን ጋዜጣና ግንባታውን ግንኙነቱ ጋሻው ጉዳይም ግልጽነት ግብሩ ግባት ገለጣ ጎፋ ገብረአብ ገቢዎችና ግብዓት ግሩም ጌትነት ጉጉት ግዴለም ግርዛት ግልፅነት ገሠሠ ጎራ ጎበዜ ግድቦች ግጥም ጓዶች ጉዳቱ ግምጃ ግቢውን ገብረስላሴ ግንኙነትን ግራዚያኒ ገብረመስቀል ግቢው ግምቱ ግኝት ገዳ ገሪማ ገቢና ገቢን ጉዲፈቻ ግብግብ ጉብኝታቸው ግምታቸውን ግሽበት ግማሹ ጉሙዝ ገዝተው ገቢያቸውን ግብፅና ግልጽና ጉዞው ጉዳተኞችን ግዴታውን ጓደኛ ጉባኤዎች ገመቹ ግልባጭ ገልጦአል ጉዱት ጉምዝ ጓደኞቻቸው ገትር ግራና ግጭትን ግልፅና ጊዜን ግብአት ገብረሥላሴ ግደይ ገቦች ግጥሚያዎች ጊዮርጊስን ጋዜጦችን ግንባርና ግንድ ግልጋሎት ግንኙነቱን ጉድለቶች ጌታየ ጎል ግብርን ጎልማሳው ጋዜጦችና ጉዳይን ግንባታዎችን ግንባታም ጌታነህ ገብረእግዚአብሔር ጎርፍ ገብ ገምግሞ ግድም ግልገል ጊዮርጊስና ጓደኞቹ ግብሮች";
            
            amharicWords[27, 0] = "ጢሞቴዎስን ጠይቄያት ጠርናፊዎችን ጤቆ ጠቅጥቆ ጡጦዋን ጥቅስና ጠፉብኝና ጡጦ ጠረጴዛና ጥበቃዎቹ ጥፍጥፍ ጠባቂያችን ጥፋቱንና ጠርዙን ጠበቃዎችንና ጣልቃም ጠዋሪ ጠቀሜታነቱ ጠርቀምቀም ጣዕምና ጥቅመኛው ጠሚራችን ጠይቆባቸው ጠቀስኩት ጥምጥሙ ጠሉ ጠላህም ጥርሴ ጦማሪያን ጥመኛ ጠይሟ ጠበልነት ጥርሷ ጠልተው ጠገኔን ጠብቃለች ጠመንጃን ጥማቱን ጥሎባቸው ጥይያቄ ጥቁሮችም ጠቢብና ጡንቻማ ጥራጊ ጥንቃቄዎችስ ጣራዎችና ጠቆምኩት ጡጦውን ጥፋታቸዉ ጣልነው ጥንቱኑ ጥበቃዬን ጥፍራቸውን ጠፍተናል ጥልቅት ጠቅልለን ጥላቶቻችን ጠፍተን ጠርሙሱ ጧፍና ጥሪቷን ጠርናፊያቸው ጡንቻው ጠማኝ ጥሮነ ጠረቤዛ ጥፋታችንና ጠረቀመባቸው ጦሪቃዎ ጥ ጠሉት ጣልጋ ጤንነትንና ጠቃሚነትና ጠርናፊዎች ጥርሶቻቸው ጥምዘዛ ጥቅምንና ጠቢ ጥምረትም ጥርብ ጥቁርን ጠቀሱና ጥቁረት ጥሩዋ ጦማሬ ጠለምት ጠፍቶብኝ ጥብሱ ጠላትነትና ጥረቶቹ ጠቅሟል ጥፋቷ ጥንታዊዎቹን ጠቆረ ጥሮባቸዋል ጣርኩ ጢያራዋ ጥሪየን ጥቆማቸውን ጠባቃ ጠቀስኳት ጠላታቺሁን ጥርጣሬዎቹ ጥበቦችን ጥሩነህን ጥሊያን ጥሬነታቸው ጥያዌ ጠላትነታቸውን ጥላኝ ጥብጣብ ጣፍጦ ጥጆቹ ጣሊያኖችን ጣልቃገብነትና ጠፍቶብኛል ጠሐይ ጠባያት ጥንውት ጣሏት ጠላቸው ጣርዋና ጠንቅቀህ ጣጣዋ ጠላቱም ጥማቱ ጠያቂነትም ጥለውባቸው ጠንክሬ ጥለውለት ጠባቂዎቿ ጠበቁዋቸው ጥገናም ጠርቶታል ጣሃ ጠይቃው ጣሉ ጥጋበኛ ጣጥሎ ጠቅላዩ ጥማታችንን ጠላቶቻችሁ ጠቅናይ ጠርተዋታል ጥፋቱም ጥያቄዎ ጠቁሙኝ ጦማሪው ጠላቷን ጠይቀናቸዋል ጡረታቸውን ጥሎሹ ጠብቀዉ ጥራዞችን ጦረነት ጣዕረ ጤነኞች ጦጢት ጠፍቶን ጠፍጥፋችሁ ጠቅሞታል ጡንቻውና ጥያቄስ ጥፋቷን ጥያቸውን ጥቅምህን ጠይቃችኋል ጤናዋን ጥቅማችንንና ጤናማው ጥማተኛ ጣዖቱ ጦርነታቸውን ጥረቶቻችን ጠፍቼ ጤነኝነታቸው ጠልቃለች ጠርናፊዎቹና ጥንጣን ጠሩት ጥሩዎቹን ጠቅላይሚኒስትር ጢብጢብ ጠርናፊት ጥፋተኛን ጤንነትም ጣራውም ጥብቀት ጠላትማ ጠንቋዩም ጠቢዎች ጥንካሬስ ጠንክረዉ ጠፍቷችሁ ጠርቼአለሁ ጤናዋ ጥቅመኝነት ጠንካሮቹ ጠበላ ጤናዎ ጤፉን ጠለው ጥቅጥቃትና ጠብንና ጥለነው ጠባይን";
            amharicWords[27, 1] = "ጥርጣሬዎች ጥያቂያቸውን ጥፋቶችና ጥያቄዎቼን ጠይቄአቸው ጠጉርዋ ጥድፊያና ጠየቋት ጠምጥሞ ጣሙ ጤፉ ጣም ጦርነትንና ጥላዬን ጠላሁ ጥምድ ጣረ ጣሩ ጠዋትም ጠባቂዎችን ጠበቃውን ጠልቶ ጣሰ ጥገኝነትና ጠየቀን ጣሳ ጣቢያዎቻቸው ጥበቃቸውን ጣዕር ጥበባችን ጥርጊያውን ጠያቄ ጠፋሁ ጠላፊዎቹን ጣለባት ጠበቃነት ጣላቸው ጡንቻውን ጠንቁ ጥለሽ ጥላችሁ ጤፍም ጠቅልዬ ጠጭ ጠላቱንም ጡሯ ጥሯል ጥኑ ጥሳችኋል ጠቃቅሶ ጠቃሚዎች ጠንከራ ጠለምትንና ጣቶቻቸውን ጠቀመው ጠብቃችሁ ጣቴ ጣልያንና ጣሰች ጣረሞት ጥቂቶቻችን ጥጃውን ጥምቀተ ጥርሶቾን ጣልያንን ጠብቀሽ ጠየከኝ ጥያቄያዊ ጦስም ጥሎናል ጦርንም ጦሯቸዉ ጠርናፊዎቹን ጡታቸው ጠፈጠፍ ጥሩውንና ጥቃታቸውን ጠገዴና ጥፍርዎ ጠይቆናል ጥቅሞቹም ጥንካሪያቸው ጥንብም ጠያቂዎችም ጥቅማጥቅምን ጥፉን ጣደፍ ጠቀመበት ጣላል ጠረጴዛዎችን ጠርጣራ ጠይቀኸኝ ጥቅምህ ጥማቴን ጠበቃት ጥዱ ጠንቅነት ጠቁሜያለሁ ጥጦች ጠበሱ ጠፍቶበታል ጥቃቅኑ ጠይቁት ጠቅላያችን ጠረጠርኩ ጥቅመኞችን ጥሶና ጠቋሚና ጦማርና ጠኛኝ ጠያቂውም ጠልቷል ጥረናል ጣዕሙን ጡረታህን ጠርቀም ጠጥታችሁ ጠንቆችም ጠነከርንባቸው ጥጡ ጥንቁቅ ጠላቷ ጥበበኞችን ጡታቸውን ጠጥተን ጠርጥሬ ጠፋበት ጦቢያችን ጠረኑ ጥቃቅኖች ጠይቀሽ ጠማቂ ጥሪውንም ጠረቀሙ ጠምደው ጥንስሱን ጡረታችን ጠበንጃቸውን ጥለውልን ጥሯት ጣልያኖችም ጠራጊዎች ጤንነቱን ጠሪነትና ጠፍቶባቸው ጠይቆል ጠሊቅና ጠላቶችሽም ጠብቂ ጠጪው ጡንቻዎችን ጠላቶችም ጠርተዋቸዋል ጥላቻየን ጠላታቸዉን";
            amharicWords[27, 2] = "ጠቢባን ጢሙ ጠፋና ጠየቀኝና ጥላቸው ጥለዉ ጥሮግራም ጥምብ ጣምራነት ጤንነታቸውንና ጣውላዎችን ጥቃቅኑን ጥርስና ጣፋጭም ጥሩንባ ጠቁመውናል ጥሰቶችንም ጡዋፍ ጥያት ጥበባቸው ጢንዚዛ ጠማማውን ጡሩምባና ጠፍቶአል ጥርሱም ጠበቃውም ጥረቶቹን ጥለዋት ጠቅሰውታል ጥፋተኝነትና ጥጣቄ ጠበኛ ጣቶቹን ጠሩ ጥያቄያዎች ጠምዶ ጠንከርና ጥያቄህን ጥላታለች ጠይቀውኛል ጥቅማቸውና ጦሩና ጡሩንባ ጡቷን ጥፋተኝነቱ ጥራዞች ጥንቱን ጠንሳሽና ጥያቄዉን ጥምና ጡንቻዎቻቸው ጠቅ ጥምን ጦዘ ጠቅሰናል ጠብቋቸዋል ጠንቀኛ ጠይቀውን ጥረታችንም ጥያቄቸውን ጠበቃቸውና ጣ ጠይቃችሁ ጥንታዊቷና ጡንቸኛ ጠየቅኋት ጥንካሬያቸው ጠፋችብን ጥያቆዎች ጠቅልላ ጥቁርና ጠባቂዎቻቸውንና ጣጣና ጠያቂውን ጠጉሯ ጠጋኝ ጠየቅኳት ጥርጣሬንና ጥያቄውና ጡቶች ጥንታዊቷን ጥረን ጡቶቿ ጣዮችን ጠባቂዎቻቸውና ጠንክራችሁ ጠፍጣፋ ጥንታዊትና ጠግበው ጠላቶቹን ጠቀመን ጠይቀውኝ ጥላቻውን ጥንቅሮችን ጥበበኞች ጥንዶቹ ጥንቆላ ጠንካር ጡንቻዎች ጠየቅኳቸው ጥዑመ ጥቂትም ጥራንስፓረንችይ ጠኝነት ጥማትን ጠኚ ጥዑም ጠላትነትን ጥበብንና ጦጣዎችና ጠቀሜት ጥማቸው ጥረቴን ጥብቆ ጥሩነቱ ጦራችሁን ጠልቄ ጠብተው ጠባቂዎቹ ጣራውን ጥንካሬም ጠንሳሽ ጥፋተኞቹ ጠላቶችና ጠላሁት ጠየቅነው ጠረገና ጥናቶችም ጥሬውን ጠየኩ ጠበብቶቹ ጣቶችዎን ጠራኝ ጥፋተኛነታቸው ጥሰህ ጥንታውያኑ ጠምዝዞ ጥመኝነት ጠየቅሁ ጠረጋው ጠቁመናል ጠየቅናት ጣቢያወች ጥንቃቄም ጥራ ጡመራ ጥያቄንም ጠየቅከኝ ጠንክር ጣቁሳ ጠቀሜታውን";
            amharicWords[27, 3] = "ጠይብ ጠበቆቻችን ጤናጣቢያዎች ጠየቅን ጠኔ ጥመኞች ጥበቡን ጠልቃ ጥሩየ ጥሉ ጠያቂና ጠላቶቼን ጥያቄያችንም ጠቀሱ ጥርና ጠባሳዎች ጣቶቹ ጥሙ ጥፋተኞችን ጥቅምትና ጠንክራ ጥየቃ ጠያቂዎቿን ጥይቱን ጥንካሬው ጠራርገው ጠበንጃ ጥለዋቸዋል ጥረው ጥርሶቹ ጥናቶችንና ጥናቴ ጥቅሶች ጣሌ ጥሻ ጥያቄዋ ጠንቅቃ ጠንቅቄ ጥጋት ጣሊያንም ጠንካራም ጥገናዎች ጣርያ ጥቅሞችንና ጥሎሽ ጥሎባቸዋል ጥምረቱን ጠይቀህ ጥፊና ጠፋህ ጠብቁት ጠጡ ጠንካራው ጠፍቶኝ ጤንነቷ ጡትዎን ጠፍንጎ ጥላዎች ጠጪ ጥንግ ጠንካራነት ጣሊያኖቹ ጥራለች ጥና ጥገኞቻቸው ጥያቄያቸውንም ጠየቀዋል ጠንሳሽነት ጣሒር ጥላቻም ጥርሶችን ጥሎዋቸው ጣትን ጠባቸው ጢሰኛ ጥምቀቱ ጠባቂዎቹን ጠፍቶበት ጠያቂዎቹን ጥራቱም ጥፍሩ ጠፈርተኛ ጠላቂ ጥሩም ጠረፉን ጠላፊዎች ጠገነ ጠገዴን ጠሪው ጡቷ ጠንሳሾችና ጣብያ ጠቁማል ጣልያንኛ ጣለኝ ጠበብቱ ጠንቶ ጠርታችሁ ጥሩር ጠማማው ጥሩነሽና ጡንቻቸውን ጣራው ጥንስሶች ጥላቻቸው ጠይቆን ጠላቶቼ ጥፍሮች ጠይቀውም ጥንታዊውን ጥረህ ጥንካሬዬ ጥቅሜ ጥቅሱን ጥሎን ጥያቄያችንና ጥያቄዎቻቸውም ጣልና ጥሪቱን ጠርተውኝ ጥቅማዊ ጥያቂያቸው ጡንቻን ጠብቄሃለሁ ጠየቅናቸው ጥሰቶችና ጠላቶቻቸውን ጥቅሱ ጥመኞችና ጣእም ጥንካሬዋን ጠየቀችው ጠላቶቹም ጥበቃንና ጥቅማቸውንና ጣቢያነት ጠረኔ ጦሱ ጦሳ ጣህር ጥቂቶቹም ጡትዋን ጥያቂ ጠይቃት ጣሊባን ጥራትም ጠፍቷቸው ጠቡን ጠቅሰዉ ጥፍት ጠየም ጠግበን ጠገብኩ ጦሙን ጤናዓለም ጣይቱና ጠቁሮአል ጠይቁን ጥሪዉን ጥበቦች ጥማታቸውን";
            amharicWords[27, 4] = "ጠንቃቃ ጠፍሮ ጣፍጥ ጠቅሞናል ጠየቋቸው ጥሩነት ጥንካሬያቸውን ጢሞቲዎስን ጠርተን ጣጣው ጠፍጥፎ ጥሮ ጣሉት ጠቃሚም ጥቆማው ጠቅሞ ጦረኝነትን ጥላሁንና ጣሐ ጠባቂዎችና ጥርሶቿ ጠበቆቼ ጠጁ ጠጠርና ጥያቄያችሁ ጥቆማዎችን ጣሪያና ጠባቂያቸው ጠፍታ ጠቅሞኛል ጥልፍ ጠጣ ጥያቄዎቻችንን ጣራና ጦርዋን ጠጥቼ ጠይቆት ጦሮችን ጣዖት ጥቅማችንና ጠቅለው ጠቀስኩ ጠበቀው ጥገኛነት ጦሬን ጠያቂም ጢሙን ጥቃቱም ጠየቅሁት ጠባይና ጣቢያዎቹን ጡብ ጠብደል ጠያቂዋ ጠመንጃዎችና ጠርጥሬያቸዋለሁ ጣልያኖችን ጦርነታቸው ጠረባ ጥለት ጥንካሬያችን ጥንካሬን ጠራርገን ጥገናዎችና ጥቅሙንና ጥቅሞችም ጣውላ ጠቃቀስን ጠበቀ ጥሎኝ ጠላታቸውን ጥላቻንና ጠቆመኝ ጦረኛና ጥቅማጥቅሞችን ጥበብም ጥሎብኝ ጥሰን ጠገናው ጥቅመኛ ጠቃሚውን ጥፋተኛነቱ ጦሯ ጠጉሩን ጠንቋዮች ጥሎበታል ጠየኳቸው ጥፉ ጥረቱም ጥፋ ጧትና ጠርቼ ጣድቃን ጥለውታል ጥራዙ ጠበቃን ጥላለች ጠብቄ ጠብቀዋል ጣኦት ጠየቀቻቸው ጢሞቴዎስ ጠያቂዎቿ ጥቂቶችም ጥቁሩን ጠይቄው ጠላችሁም ጠጣና ጥቃቶቹ ጥያቄውንም ጥጥና ጠውልጎ ጥቃቶችንና ጥጥን ጠራቸው ጥቂትና ጠይቀዋቸዋል ጥፍራቸው ጥንብ ጠለል ጦና ጦኔ ጠበቅን ጥርጣሪዬ ጣዝማ ጠሐ ጤናም ጥሪዋን ጥርሳችንን ጠሪ ጠር ጠቁሜ ጥንካሬያችንን ጣጣችን ጠብቋት ጤኖ ጠጪዎች ጥጃው ጣታቸው ጠቋሚው ጦርነቱንም ጥንካሬዎች ጥጋብን ጠባሣ ጥላት ጠብን ጠበቆቼን ጣልያናዊ ጤናዎን ጠርሙሶች ጠበቃቸውን ጥበባቸውን ጥይቶቻቸው ጠሪቃ ጥፋቴ ጥብስ ጥበቃችን ጠንቶባቸው";
            amharicWords[27, 5] = "ጠንቅቀዉ ጠሊፋ ጣልቃገብነት ጠቅስው ጥሪታቸውን ጢሞቲዎስ ጠይቀውት ጦራችን ጥማቸውን ጥቅልል ጥያቄዎችንም ጥሙን ጣለው ጥቅምም ጥያቁ ጥቅሻ ጠርታ ጠላና ጠብቅ ጥርነፋ ጥያቄአችን ጥድፍ ጣሴን ጥልፍልፍ ጥራታቸውንና ጡጫ ጧሪና ጥምርታ ጥቅሜን ጠርተዋል ጠንቅቀን ጥረዋል ጠየቁኝ ጠባቂነትና ጥበበኛው ጥቅመኞች ጠብና ጠበቃዎች ጣጣዎች ጥሙጋ ጠመዝማዛ ጥፋተኝነታቸው ጥያቄአችንን ጠይባ ጠብቀህ ጥንዶች ጦፏል ጠፍር ጦቢያን ጥሏቸው ጣቱን ጠረፎች ጥቅሙና ጠቅሎ ጥለህ ጣዮች ጥይቶችና ጥያቄዉ ጥፋቶችን ጥቆማዎችና ጥንታውያን ጠላትህ ጥቁሮችን ጠቅሷ ጠጠርን ጠረንጴዛ ጥላቻቸውን ጠራው ጠላም ጥምርታን ጥቋቁር ጠይቆባቸዋል ጥፋተኝነታቸውን ጠባቂውን ጥንትም ጠነከረ ጥልቀትና ጥላቻው ጥኡመ ጠላትህን ጥገኝነቱን ጠረጴዛው ጥበቃዎችን ጠየቅኋቸው ጥሪያችን ጥረታቸውም ጠመንጃው ጥቅሞቻቸው ጠብቁን ጥገናውን ጥምርታውን ጣፋጭና ጠቅላይግዛት ጥዶ ጠባያቸው ጥንታዊቷ ጦርነቱና ጥራጥሬዎች ጤናማነት ጣቢዎች ጠባብነትን ጠይቆኝ ጥሰትም ጥማድ ጡሮች ጠንካራውን ጥፋተኝነቱን ጠፋብኝ ጥጉን ጠሉም ጥበቃውም ጠንሳሾች ጠቦት ጠጁን ጠቀሜታዎችን ጠቅሠው ጥርስዋን ጠገዴ ጠርናፊ ጥርያችንን ጠይቆአል ጠየቁን ጠል ጥቅሎች ጠባቦች ጠቁማ ጥቅሞቹን ጦርነቶችን ጦረኝነት ጥጃዋ ጥርኝን ጥገኞች ጥላውን ጥርሷን ጤናዳም ጠይቄያለሁ ጠይቋቸዋል ጠፈር ጥርጣሬዎችን ጠየቀችን ጠቦ ጠጅና ጦማሩ ጠቆም ጠልቀው ጥሪያቸው ጣሊያናውያን ጠንቁዋይ ጥያቄዎን ጣቷን ጥገኞችን ጠበቀኝ ጥልቀቱ";
            amharicWords[27, 6] = "ጥርጣሬያቸውን ጥራኝ ጦሩም ጥበባዊ ጠላቴ ጥበቃም ጠግኖ ጥያቀ ጠበበ ጥያቄአቸውን ጠፋኝ ጠረጋና ጥርሱ ጠለፋና ጥሏቸዋል ጠበቆችና ጥሳለች ጥፋተኛው ጣቢያቸው ጠፍቶት ጠባቂዎቻቸው ጠቀስ ጥቅማጥቅሞች ጠርቷል ጥለዋል ጡትን ጥራቱንና ጥሰትን ጠቅሰን ጥምረትና ጤናውን ጥይቱ ጥሰቱ ጥዬ ጥድ ጥረቶችም ጠላቶቿ ጥጉ ጥያቄውም ጠርጥር ጥቅስ ጠርጥሮ ጥቃትም ጥራው ጥንቃቄዎች ጥይትም ጥቃቶችና ጥንቅሹ ጥያቄዬን ጥምቀትን ጥቆማና ጥቅት ጥበቃዎች ጥንቱ ጠላቶቻችንን ጡሩምባ ጠባችን ጥያቄያቸውም ጥገናን ጥረቷ ጥፋታቸው ጠይቅ ጠረጴዛውን ጠበቆቻቸውን ጠጉሩ ጥንቸል ጥሩው ጤዛ ጣቢያዎችንና ጠይቀነው ጠቋሚዎች ጥሪዎችን ጥበባትና ጥራሕ ጠልቆ ጠላትና ጥጆች ጠየቅኩ ጥገናዊ ጥቅማጥቅም ጥያቄአቸው ጣር ጥሪም ጥናታቸው ጥቁሩ ጠየቃቸው ጠቀሜታም ጠረጴዛዎች ጥምረትን ጠፍ ጦማሮችን ጠባብና ጥርጣሬም ጥያለሁ ጠግቦ ጥልቁ ጥሬው ጠቅሳለች ጠራጊ ጠልፈው ጠፊዎች ጠባዩ ጣሪያው ጤንነታቸውን ጣልኩ ጠያቂዎቹ ጤፍን ጥራዝ ጥሰቶች ጥሩምባ ጥቅሞቹ ጠራራ ጦማሪዎች ጥርስን ጠሃ ጣላት ጦርነቶችና ጡዘት ጠቅሶአል ጥለዋቸው ጠላው ጠናን ጠበቃም ጦማሮች ጥፋተኝነት ጥፋተኛውን ጠበቆችን ጦማሪ ጠንቆችን ጠዋቱ ጠቆር ጥርሳቸው ጠላቶቻቸው ጠላቶችን ጥያቄያችሁን ጣልያኖች ጠርጎ ጣናን ጥቂቶችን ጥሮንክ ጥለውን ጠጉራቸው ጥቅማችን ጠፍቶዋቸው ጣዕሙ ጥርሴን ጠቃሚው ጠያቂዎችን ጠላንም ጥሰትና ጠጥታ ጥቂቱ ጠብቀውና ጠቋሚነት ጣቱ ጥሩውን ጠንቀቅ ጤናቸውን ጠንካሮች";
            amharicWords[27, 7] = "ጦሪቃ ጠያቂው ጠብቁ ጣይቱን ጥንስስ ጠብታ ጠላቱን ጠቀሜታቸው ጠይቃ ጠይቄ ጠጉር ጣይቱም ጥበባት ጠይቋቸው ጦጣ ጠንቆች ጥቅጥቅ ጥቅሞቻቸውን ጠፉ ጥፋታቸውን ጠበቆችም ጠረን ጠቀሜታና ጣፋ ጤንነትን ጥለውት ጠጥቶ ጥምቀት ጥለን ጥያቄያችንን ጠበቃና ጥረቷን ጥርጣሬውን ጥቆማውን ጠንባሮ ጠላታቸው ጥርቅም ጥሩሰው ጠቅላላውን ጦጣዎች ጥያቄዎቹን ጠየኳት ጥቅማችንን ጤናው ጥርሳቸውን ጠይቀዋቸው ጠባብነትና ጥሪን ጥራትንና ጠመንጃዎች ጠቁማለች ጠየኩት ጤንነትና ጥያቄዎቻችን ጥራጥሬና ጥናታቸውን ጠይቁ ጠዋትና ጥያቄዋን ጠየቀችኝ ጥልቅና ጥበቃውን ጥርሶች ጥላሁንን ጣሊያናዊ ጥናቶቹ ጥቁሮች ጥርጣሬው ጠማማ ጡንቻ ጥሪና ጥረታችንን ጠቀሜታን ጥንታዊና ጦራችንን ጥያቄዎችንና ጠቀም ጠማው ጠብቂኝ ጥሔ ጥጋብ ጥበትና ጠራርጎ ጥያቄዎቻቸው ጠፊ ጠላትም ጥፋትም ጥንታዊት ጥቂቱን ጥቅሟ ጥበበኛ ጥንቃቄን ጣሊያንና ጣሊያንን ጠየቅኩት ጠየቃት ጢሞ ጠይም ጥሩወርቅ ጥረቶችና ጠልፎ ጥበቅ ጠቡ ጥናቱም ጥቂቶቹን ጣብያዎች ጠቁሞአል ጣቶች ጣቢያም ጥገናው ጥንድ ጣሴ ጠቅመው ጥገኝነትን ጥይቄ ጥርጊያ ጠቢቡ ጣለች ጥያቄዬ ጦቢያዎች ጠጣር ጣቢያዎችም ጠላቶቹ ጥሰዋል ጥንካሬውን ጥንታዊው ጠቀሜታዎች ጠንቋይ ጥድፊያ ጧፍ ጠየቁት ጠቃሚነቱ ጥፊ ጠበብ ጢም ጠለላ ጠረፋማ ጥምጥም ጠብቀን ጥቅሞችና ጡረተኛ ጠጉሯን ጠብቀኝ ጠያቂነት ጦረኞች ጥጋቡ ጥላው ጠብቆና ጠርቶት ጥሪዬን ጥርኞች ጠገብ ጠቢብ ጣታቸውን ጣሊያናዊው ጥይትና ጥፍር";
            amharicWords[27, 8] = "ጥፋቶች ጥራታቸውን ጥቅሞችን ጥቅምን ጥሪያችንን ጥቆማዎች ጠበቅ ጠይቀናቸው ጠየቀች ጥዋት ጥፋተኞች ጣፋጭ ጠንቅቀው ጥያቄያችን ጥላቻን ጥረታቸውን ጣምራ ጠባቂነት ጥግ ጥቃቶችን ጥቅማቸውን ጦርና ጣሰው ጥንት ጣራ ጠየቀኝ ጥበብና ጠየቀው ጥበቃው ጥሪው ጥገናና ጦማር ጠላቶቻችን ጣሪያ ጥቃትና ጠይቀናል ጦርነትም ጠባ ጠባሳ ጠበብቶች ጠበቆቹ ጣዕም ጥይቶች ጥምረቱ ጥፋትና ጤንነታቸው ጠጋ ጣልያን ጠላትነት ጥረታቸው ጥናትን ጡር ጥቅሙ ጥበቃን ጠበቆቻቸው ጥሩአይነት ጣቢያና ጥል ጥቅሙን ጣሂር ጣል ጣት ጥሎት ጥንካሬና ጥሪት ጢስ ጥፋቱ ጥም ጣና ጥሩነህ ጦስ ጠቃሚነት ጠረጋ ጠባቂው ጥቃትን ጥራቱ ጠቅልለው ጦርም ጠባቂና ጦሮች ጥላቻና ጥናትም ጥሪዎች ጠባብነት ጥንቃቄና ጠብቃ ጥርጣሬን ጤናማና ጠቋሚዎቹ ጠቅለል ጥብቅና ጠቅላላው ጣቢያውን ጥሰቶችን ጠርሙስ ጠቆመ ጠቧል ጠራ ጠቅልሎ ጥረታችን ጦርነቱም ጣዕመ ጥናቶችና ጦም ጥረትን ጠ ጠርዝ ጦረኛ ጦራቸው ጥያቄዎችም ጠይቃለች ጥሎታል ጥንቅር ጥሏል ጠጥተው ጥሳ ጠቅሳ ጠፍተው ጠፍተዋል ጥያቄዎቻቸውን ጠላቱ ጤፍና ጥያቄዎቹ ጥፋቱን ጥበበ ጧሪ ጥርኝ ጤናቸው ጤንነቱ ጥጃ ጠያቂዎች ጠበቃቸው ጥንተ ጠጅቱ ጠብመንጃ ጦርን ጤናን ጠመንጃውን ጠበል ጡረተኞች ጥላሸት ጥቅሟን ጣይ ጠመንጃና ጥርጣሬና ጠቃሚና ጣቢያን ጠምባሮ ጥርት ጥይቶችን ጠቅሼ ጥበብን ጥላዬ ጥራታቸው ጥርሱን ጠንክረን ጠለፋ ጥሩና ጥሷል ጥፋትን ጣለ ጠመንጃቸውን ጠላታችን ጣሊያኖች ጠላፊዎቹ";
            amharicWords[27, 9] = "ጠ ጥረት ጥያቄ ጦርነት ጠቅላይ ጠቁመው ጦር ጥሪ ጥቅምት ጥናት ጥር ጥቅም ጠቁመዋል ጠቅሶ ጥበቃ ጥቃት ጤና ጠቅሰው ጥሩ ጠንካራ ጣቢያ ጥያቄዎች ጥራት ጥቂት ጠይቀዋል ጦርነቱ ጠቀሜታ ጣቢያዎች ጠቅላላ ጣልቃ ጠቃሚ ጠቁሟል ጠቅሰዋል ጥፋት ጠይቋል ጥናቱ ጥንቃቄ ጠላት ጥገኝነት ጥገና ጥላሁን ጥራትን ጠቅሷል ጦርነቱን ጥቃቅን ጥረቶች ጥርጣሬ ጥያቄው ጥይት ጠቁሞ ጥቁር ጥፋተኛ ጠባቂ ጥናታዊ ጠየቁ ጠዋት ጣይቱ ጠብቆ ጠበቃ ጥቆማ ጤናማ ጥልቅ ጥያቄውን ጠበቆች ጥናትና ጥብቅ ጥለው ጥያቄዎችን ጥበቃና ጠይቀው ጥበብ ጥናቶች ጣሊያን ጥላቻ ጠየቀ ጣቢያው ጥራትና ጥላ ጥያቄም ጠይቆ ጦቢያ ጥሪውን ጥምረት ጥራቱን ጠብ ጠባብ ጥሬ ጥቅሞች ጥረቱ ጥሎ ጠላቶች ጧት ጥንካሬ ጥያቄና ጠብቀው ጠቀሜታው ጠንክሮ ጥምር ጦርነትን ጠመንጃ ጥቃቱን ጤፍ ጤንነት ጠፋ ጥያቄያቸውን ጥቅምና ጥንታዊ ጠንከር ጥናቱን ጥረትና ጠንካራና ጥገኛ ጥያቄን ጥረትም ጠረፍ ጦርነቶች ጥቃቅንና ጥሶ ጦሩ ጠቆሙ ጥቃቶች ጠፍቶ ጥያቄያቸው ጠንክረው ጣቢያዎችን ጦሩን ጥቂቶች ጥሰው ጥርስ ጥቅማ ጦርነትና ጠንቅ ጠጅ ጠርተው ጥቅል ጣጣ ጦሯን ጠርቶ ጠቋሚ ጠባቂዎች ጥርጥር ጥቃቱ ጥቂቶቹ ጥረቱን ጥረቶችን ጠና ጥሰት ጠባይ ጥቅማቸው ጥሩነሽ ጠላ ጠረጴዛ ጠላትን ጠይቀን ጣቢያዎችና ጦራቸውን ጡረታ ጥበቡ ጤናና ጥሪያቸውን ጠያቂ ጥናቶችን ጥልቀት ጥበት ጠበብት ጥግነህ ጥጥ ጠፍቷል ጥራጥሬ ጠንቅቆ ጤነኛ ጥያቄዎችና ጠጠር ጠለቅ ጠበቃው ጣቢያዎቹ ጡት ጥማት";
            
            amharicWords[28, 0] = "ጨምድደው ጨዋማ ጭንቀታቸውና ጨምረዉ ጨርስ ጨርሷቸዋል ጭልም ጭቁኑን ጨዋማነት ጨረስን ጫጫታዎች";
            amharicWords[28, 1] = "ጫወታቸው ጮማውን ጨውነት ጭነውበት ጫኔን ጨፍነን ጨማምረን ጫወታው ጨረሰች ጨለፍ ጨርሰዉ ጨርቃቸውን ጨፍና ጫማውም ጨዋነቱንና ጨጓራችን ጩኸትዋን ጫንልኝ ጩሀት ጨረፍታዊ ጭካኔዋን ጭፍንነታቸው ጨርሶውን ጨምረንበት ጨፍኜ ጭማቂው ጭፍንና ጫማቸው ጨፍጭፈዋል ጨረስሁት ጭውውቱ ጭቅጭቆች ጭብጨባውን ጨቋኞችና ጬኸት ጨኖዎች ጨለማም ጨቅላነታቸውን ጨምሬያለሁ ጨቁነው ጭካኔያቸውን ጨምሩ ጨፈገገ ጭሆት ጭንቅንቁ ጨንቻ ጨቆነኝ ጮኹም ጨረርን ጮኩኝ ጨልጦ ጨዋታዎቹን";
            amharicWords[28, 2] = "ጫቱን ጭራሹ ጭንቅላትን ጨዉ ጭንብል ጭስና ጭስን ጨክና ጨዋነታችንን ጨምሪልን ጭነዋቸዋል ጫካዎችን ጨምረናል ጭብጦቹ ጩኹ ጩኸቶችን ጫማዎቻችንን ጨርሰዋቸዋል ጨረሱብን ጭንጋፎች ጫታ ጨፍጫፊነት ጭካኔው ጨውም ጭነዋል ጩኸትን ጨቅላዎች ጨኸቱ ጮሁ ጨዎታቸው ጭውውታችን ጨዋታህ ጨርቅም ጭብጦችና ጨፍረዋል ጫ ጭሮብኛል ጭስስ ጨርቆስና ጨረስኩ ጩኸትም ጭቃው ጭልፊቶች ጨላልሞ ጭብጡ ጭሰኞቹ ጮኸበት ጫንቃሎ ጫማዋን ጨፈጨፈን ጨብጧል ጯሂ ጨረቅ ጭጋግ ጮኾና";
            amharicWords[28, 3] = "ጨፍኑ ጨምሮአል ጨዋታውና ጨለለቅቱ ጭነቱን ጭፍራዎች ጨልሞባቸው ጨርሶውንም ጭልፊትም ጨንቆኝ ጫፉን ጭንቀቱን ጨቋኟ ጩኸታችን ጨዋት ጮሌና ጨንተር ጭናክሰን ጨነቀኝ ጭቁኖች ጮንስቲቱአንችይ ጭነን ጪስ ጭኜ ጭርሱኑ ጨለምተኝነት ጮንቸፕት ጨበጠኝና ጨካኝነት ጭንቅላቷን ጨርሰውታል ጨኖ ጨዋነትና ጩቤውን ጨዋታዬ ጫሪ ጫራ ጨምረህ ጭረው ጨካኙ ጭንቀቱ ጨውታ ጭንቅላትና ጨመረች ጭንቅንቅ ጭውውቶችን ጭፍጨፋን ጭቆናንና ጭዋ ጨለመ ጭንቅላቶች ጭዋታ ጨጓራችንን ጨዋታዋን";
            amharicWords[28, 4] = "ጭማሬ ጭራቆች ጭንቅላታችንን ጭራሮ ጭቆናውን ጨለማውን ጨዋታውም ጫማዬን ጨረታውም ጨርቁን ጭሰኝነት ጭቃውን ጨፈርኩ ጮኽ ጮኸብኝ ጬኸታችንን ጨረቃዋ ጫልቱና ጨክኖ ጨዋታቸው ጮኡንቺል ጫንያለው ጨዋታዎችም ጨረታና ጫናቸውን ጨሌ ጭሯል ጫዊቻ ጭርቆና ጨመሮ ጨምርበት ጫካለጫካ ጨንግፎ ጨቆርሳ ጭሱ ጨርፎ ጨጓራ ጨርቃጨርቅን ጨጓር ጫጩት ጭጭኣኣ ጫናዎችና ጨምበላላ ጨለምተኞች ጫናም ጨልሟል ጨረቃም ጨበጠ ጭምርም ጭማሪውም ጮኸት ጨለማው ጭካኔያቸው ጭብጡን ጩራ ጭብጨባውም ጫሚሶና ጭነህ";
            amharicWords[28, 5] = "ጨመዳ ጩኸቶች ጨፍጭፏል ጭፈራዎችን ጫካው ጨርሻለሁ ጨዋና ጨርሶም ጨክነው ጫወታዎች ጫማን ጫጫታው ጩከት ጫፎች ጩኮ ጭማሪዎች ጫጫታና ጮኸው ጨቡዴ ጨረታን ጨሎ ጩኸቴን ጮሆ ጭፍሮቹ ጭምብል ጭካኔና ጮንፊደንቸ ጨረታም ጮሌነት ጭካኔን ጨሶ ጨፍነው ጫካውን ጨዋው ጫማችንን ጭንቅላታችን ጨርሶውኑ ጨፍጫፊዎች ጮኸች ጨርሻለኹ ጭብጨባው ጭብጥና ጫሚሶን ጨፍኖ ጨቋኙ ጭራቸውን ጩቤና ጭላንጭሎች ጨልሞ ጭነትን ጨዋነቱን ጭንቅላቴን ጫማዎችና ጭብጥም ጨፍር ጭውውት ጨፍልቆ ጭፈራና ጫልቺሳ ጨዋታችንን ጭርሱን ጭንቅንቁን ጫር ጨለምተኛ";
            amharicWords[28, 6] = "ጨርሳ ጭንቀቴ ጫማና ጭቆናዎች ጨምቆ ጭራሽኑ ጩኸቱ ጮኾ ጭል ጨርቆችን ጫፍና ጨቡድ ጫፉ ጨዋታዎችና ጭራው ጨ ጨረሱ ጭብጦችን ጩኸታቸው ጨማምሮ ጨዋዊ ጭብጦ ጨቋኞች ጫማውን ጭላዳ ጭሰኛ ጨዋታዎቹ ጭንቅላታቸው ጨካኞችና ጭንቅላቴ ጭነታቸውን ጨረራን ጫሞ ጨምሬ ጨምር ጭራውን ጭልጋ ጮክ ጨምረዋል ጮኹ ጩኸቱን ጭዳ ጭውውቶች ጨረሰ ጭምጭምታዎች ጨቁኖ ጭፍሮች ጫኑ ጨረታዎችን ጫካና ጭማሪም ጭፈራዎች ጫማው ጭራሹንም ጭቅጭቅና ጨምድዶ ጭነትና ጭፈራው ጭማቂና ጭምት ጭፍጨፋዎች ጨረሰው";
            amharicWords[28, 7] = "ጩኸታቸውን ጭድ ጭብም ጨረር ጮማ ጨቅላ ጨርሷል ጩቤ ጫንቃ ጭንቀታቸውን ጨውን ጫፎ ጫናውን ጭነቶች ጭለማ ጫናዎችን ጭጭ ጫትን ጭና ጭጵጅ ጭንቀትን ጨዋነትን ጨካኞች ጭራቅ ጫሪነት ጨርሳለች ጭነቱ ጨርሳችሁ ጨዋታና ጭቅጭቁ ጭንቅላቱን ጨርቆስ ጨቋኙን ጭቆናው ጫማዎችን ጩኽት ጭልፊት ጫካዎች ጨፍጭፈው ጭላ ጨርቄን ጨምረን ጨርቅን ጭምሮ ጭነቶችን ጭሮ ጨፍጫፊ ጮምሚትተአ ጨምሮም ጩኸታችንን ጨዋታን ጨቦ ጭፍጨፋው ጮቤ ጭን ጭብጨባና ጨራሽ ጭፍጨፋውን";
            amharicWords[28, 8] = "ጨረራ ጨለማን ጨፌ ጨዋታቸውን ጭፈራ ጨርቃጨርቅና ጫጫታ ጭቁኑ ጭንቀትና ጭቆናና ጨረታዎች ጭማሪውን ጭር ጭፍራ ጨምረውም ጨብጠው ጨዋታዎችን ጫወታ ጫልቱ ጨርሼ ጨዋ ጨብጦ ጭልጥ ጭማሪና ጭንቅ ጨምራ ጫናው ጨፌው ጮኸ ጭራ ጮሌ ጫኔ ጨካኝና ጨዋታችን ጨውና ጭቆናን ጭው ጫቦ ጭብጦች ጭንጋፍ ጭምጭምታ ጭንቅላቱ ጨርሰን ጭራሹኑ ጭማቂ ጫማዎች ጩኸትና ጫናን ጭፍጨፋና ጨርሰናል ጫኝ ጫትና ጨዋታም ጨርሰዋል ጫጩቶች ጭማሪን ጭንቅላታቸውን ጨቋኝና";
            amharicWords[28, 9] = "ጨ ጨምሮ ጭምር ጫና ጨዋታ ጨምረው ጭማሪ ጨረታ ጨርሶ ጨርቅ ጭፍጨፋ ጨዋታዎች ጫካ ጭነት ጫት ጫማ ጭንቀት ጩኸት ጨዋታው ጨው ጫፍ ጨዋታውን ጭቆና ጨርቃ ጭብጥ ጨርሰው ጭራሽ ጨለማ ጨርቃጨርቅ ጭማሪው ጭካኔ ጨምሯል ጨረታውን ጭቅጭቅ ጭኖ ጭነው ጭፍን ጨካኝ ጫሚሶ ጨረቃ ጫናና ጨረታው ጭቃ ጨቋኝ ጭብጨባ ጫናዎች ጨርቅና ጨመረ ጨዋነት ጫላ ጭስ ጭላንጭል ጮራ ጨርቆች ጭራሹን ጫን ጭቁን ጭንቅላት";
            
            amharicWords[29, 0] = "ጳጳሱትንም ጳጳሳትንና ጳጳስዋን ጵጵስናው ጵጵስናውም ጴጥሮሳዊነትን ጳኩሚስ ጵጵስናቸውን";
            amharicWords[29, 1] = "ጴንጤ ጳግሜ ጶሊቲቻል ጳጳሳቱና ጳጳሶቹ ጴጥ ጳውሊን ጳውሎስንም";
            amharicWords[29, 2] = "ጳጳስም ጴጥሮስንና ጶቨርትይ ጳጳሳትም ጳጳሳ ጳጳሱና ጵሮግራም";
