            amharicWords[29, 6] = "ጳጳሳቱ ጳጳስነት ጳውሎስም ጳዉሎስ ጴጥሮሳዊነት";
            amharicWords[29, 7] = "ጳጳሱ ጴጥሮስን ጳውሎስና ጵጵስና ጳጳሳትን";
            amharicWords[29, 8] = "ጳጉሜ ጳጳሳት ጳጳስ ጳውሎስን ጴጥሮስና";
            amharicWords[29, 9] = "ጰ ጳውሎስ ጴጥሮስ ጳጉሜን";
            
            amharicWords[30, 0] = "ጸፍቶ ጽሁፎቻቸውን ጸሓፊ ጽንፈኛና ጸጥታው ጽህፍ ጸዴቅ ጸ ጽህፈት ጽሕፈት ጽሑፍ ጽኑ ጹሑፍ ጸሐፊ ጸጋዬ ጽሁፍ ጸጥታ ጸረ ጸጋይ ጽዮን ጽሁፎች ጸሎት ጽጌ ጽሑፎች ጸሐፊው ጸጥ ጹሑፎች ጽሑፉ ጽንሰ ጾም ጾረና ጽዳት ጸጋ ጾታ ጸሀፊ ጸሐፊዎች ጽላት ጽፏል ጽፈዋል ጽፈው ጽሕፈትቤት ጽሑፎችን ጽሁፌ ጽሁፎችን ጽናት ጸሎተ ጽፎ ጸንቶ ጸሐይ ጽንፍ ጽንፈኛ ጸድቆ ጽሑፌ ጾመ ጽዳትና ጽንፈኝነት ጸጥታን ጻድቃን ጽሁፉን ጽዱና ጸያፍ ጽሁፉ ጸሐፊና ጽሑፍም ጸር ጹሁፍ ጽሑፌን ጽሑፎቹ ጻፉ ጸሃፊ ጽዋ ጸብ";
            amharicWords[30, 1] = "ጹሑፉ ጽጌረዳ ጽላቱ ጸሀይ ጸድቋል ጸሐፍት ጾታን ጸሐፊውን ጸባዖት ጾታዎች ጽጵልኣ ጽሑፋቸው ጸጥታና ጸሐፊዎችን ጸ ጸጋየ ጸበል ጻድቁ ጽንስ ጻድቅ ጽናትና ጸሃዬ ጽናትንና ጽኡ ጽሑፎችና ጽሩዕ ጼዴቅ ጹሑፎችን ጽድቅ ጸሐፌ ጸግዬ ጽላቱን ጸሎታችን ጽሁፋቸው ጸልዩ ጽሁፍም ጽዱ ጸሀፊው ጽፈውታል ጸባይ ጸሐፊያን ጾሙ ጽህፈቱ ጽታተ ጽሐፈት ጽድቅነት ጾረናን ጸሐፊም ጽፈን ጸሎታቸውን ጽሑፎቹን ጸሐፊያቸው ጽዮንን ጸግሽ ጸአዳ ጽ ጹሑፉን ጽድቅና ጸሊም ጽድቅን";
            amharicWords[30, 2] = "ጸሃፊዎች ጽሑፋቸውን ጽልመት ጽሑፎችም ጸጸት ጽናትን ጽሑፍና ጽሑፍን ጽቱዲአስ ጽሁፎቼ ጽሑፎችንና ጸሃፊው ጽንፈኞች ጽዋን ጸደቀ ጻፈ ጽፈህ ጽሑፉን ጻፍ ጸንተው ጹሁፎች ጸጋና ጽፋለች ጸሐዬና ጸሃፊውን ጸርና ጽገሬዳ ጽንፎች ጸደይ ጸና ጽሁፍና ጽንሱ ጸባዩ ጽፎልናል ጽሕፍት ጸሀዬ ጽሑፏ ጽናጽል ጽርሐ ጽባሕ ጻፎችና ጽህፈትም ጽፎላቸዋል ጾረናና ጸሐይነሽ ጸሐፊነት ጽፎአል ጽሁፎችና ጽታቱስ ጹሑፍና ጸባኦቱ ጽሐፍ ጽሕፈትቤቱ ጽምብላ ጻድቅን ጹሑፎቻቸው";
            amharicWords[30, 3] = "ጽፋ ጽፌ ጾታዊ ጾምን ጸባኦት ጽዑ ጸጋን ጻፍሁ ጸዳሉ ጽፈናል ጸኃፊ ጹሑፎቹ ጻፈላቸው ጸዐዳ ጸሎትም ጽኑና ጸዳል ጸሎቱ ጽንፈኝነትን ጸሐየ ጸጋዬን ጽብ ጸጉሩ ጸንተዋል ጸሃፊን ጾታና ጸሐዬ ጽርርጭ ጸጉር ጽህፈትቤት ጸሎትና ጽድ ጸናጽል ጸሃዬን ጻድዋ ጽህፍት ጻፋችሁ ጹሑፎችና ጻፍኩ ጸአ ጸንተን ጽፈት ጸሐፊዋ ጸሃይ ጸሎታቸው ጸሃይዬ ጻፈው ጸሀፊዎች ጽንሱን ጿሚ ጸዋሚ ጽሁፍችን ጸሐፊነትና ጸጋንና ጽሑፋችንን ጾዳቤ ጸጥታውን ጽፋችሁ ጽሕፈትና";
            amharicWords[30, 4] = "ጸሐፊዎችና ጸለየ ጸጋው ጽጌረዳዋ ጽናቱን ጽጌረዳዋን ጽጌረዳና ጸረሙስና ጾምና ጸባችን ጸሎታችንም ጽጌን ጸንታ ጻፉልን ጽርየት ጽነሰ ጽዋውን ጸጉሩን ጻድቃኔ ጸኀፊ ጽሑፍያካተተዉ ጽኁፍ ጸሐፍትና ጸሎቴ ጽጌያት ጸሎቷን ጽፌዋለሁ ጹ ጸሎታችሁን ጽሑፍዎን ጻድቁን ጾማቸውን ጽሁፋቸውን ጽጌም ጹሑፌ ጽናትም ጸኑ ጾሙን ጸሎትን ጽልመቱ ጸሎታችንን ጹፌን ጸሎቴን ጸልዩልኝ ጻዲቅ ጽፌአለሁ ጻፎች ጽሁፎቼን ጽሁፌን ጽድቁ ጸበኛነት ጸብና";
            amharicWords[30, 5] = "ፀ ፀረ ፀሐፊ ፀጥታ ፅኑ ፀጋዬ ፅህፈት ፀሐፊው ፀሐይ ፀሐዬ ፅሁፍ ፀሎት ፀብ ፃድቃን ፆታ ፅሑፍ ፀጥታና ፀጋ ፅሁፎች ፀባይ ፅጌ ፅንሰ ፀደቀ ፀሐፊና ፀድቆ ፀሃፊ ፀድቋል ፀጋይ ፀጥ ፀር ፆታዊ ፀሐፊነት ፀጥታን ፅናት ፆረና ፀሃዬ ፀሎተ ፀጥታው ፀንቶ ፀጉር ፀሐፊዎች ፀበል ፀያፍ ፆም ፀሐፊዋ ፀሃይ ፅሕፈት ፅንፈኛ ፅላት ፅዳት ፀጋየ ፅፈው ፅሁፎችን ፅዮን";
            amharicWords[30, 6] = "ፅፈዋል ፀንተው ፆታን ፅሑፎች ፀሀፊ ፀሐፊዬ ፅንስ ፀደኒያ ፀዳለ ፅዋ ፅፌ ፅፎ ፀኃፊ ፀሃፊው ፀሀይ ፆረናን ፃፉ ፀፀት ፀባኦት ፅኑዕ ፀጉረ ፆታና ፀባዖት ፀሐፊውን ፃፈ ፀዳለች ፀጋዬና ፀሐዬን ፅናትና ፅሁፉን ፅሁፉ ፀሐዬና ፀአዱ ፀንቷል ፀሎትና ፀላእቲ ፆታዎች ፀሐፊያቸው ፀጉራቸውን ፀሐፍ ፀንቶባቸው ፅፏል ፀጥታውን ፀቡን ፅሁፋቸው ፀጉራቸው";
            amharicWords[30, 7] = "ፅሁፍና ፀደይ ፃራ ፃድቃንና ፀብና ፅሁፋቸውን ፅገሃና ፀቡ ፀ ፀጋው ፀሐፊን ፀንታ ፀጋዬን ፀጋዘአብ ፂላ ፀሓይ ፀሐፊውና ፁሑፍ ፀንተን ፀባዩ ፅናትን ፅሑፉ ፅሁፉና ፀሀዬ ፆረናና ፀጋዎች ፀፀቱ ፅሆፎች ፅሑፎችን ፅሁፎችና ፀሐይን ፀጋና ፀና ፀጉሩ ፀሐዩ ፅንስን ፀሐፊዎቹ ፀባይን ፆመ ፀገዴ ፅላቱ ፃድቅ ፅባህ ፀሃየ ፀጉሯን ፀሐፊም ፀድቀው ፃፍ ፅናቱን ፅፋ";
            amharicWords[30, 8] = "ፅሑፉን ፀሐይነሽ ፀሐፍት ፄዴቅ ፅሐፊ ፅሑፋቸው ፀሎታችን ፀጥታዋን ፀሐይና ፀሐፊነትና ፅፈናል ፅልመታዊ ፀድተው ፅኑና ፀዳል ፀጋዬንና ፀሓዬ ፀጉሬ ፅጌረዳ ፂም ፀባይና ፆሟን ፀገም ፆሙን ፅሁፌን ፅንሱ ፀሃፊዎች ፀጥታዋ ፀባያቸው ፀሐይዋ ፅናታቸው ፅንሷ ፅረ ፅድቁ ፀሃዩ ፀሓፊ ፅድቅ ፀሐፊያን";
            amharicWords[30, 9] = "ፅዳትና ፀሐፌ ፀሮች ፀሀፊዎች ፀሐፊነታቸው ፅዋን ፀጋዬም ፀጉራችንን ፀሐዬም ፅልመታዊው ፀላኢ ፀሐያማ ፅሁፌ ፀጉሩን ፀሃፍት ፅጌሬዳ ፆታውን ፅጌን ፅዱና ፀጉርህን ፅንሰሃሳብ ፃፉት ፅሁፍም ፁሑፎች ፀዓዳ ፀረዴሞክራሲያዊ ፀሎቱ ፀሎተምህላ ፃፍን ፀያፍና ፀሀፊው ፀልዮ ፀዲቅ ፀሎቴን ፅልመት ፅላተ ፅንፍ ፀባዬ ፅፈውታል ፀአዱን ፅሁፎቻቸው ፅሑፌ ፀጉራም ፀጉሯንም ፅሑፎቹ ፅፎአል ፅዮንም ፅንፈኞች ፃእረ ፅፍ ፀደንያ ፀለየ ፀባያቸውን ፀብም ፂዮን ፀላእትና ፀደቁ ፅንሐ ፅፈን ፀድቶ ፀጋን ፅዱ";
            
            amharicWords[31, 0] = "ፍቁድ ፍሎረነስ ፍላጎቴን ፎክረናል ፋንታችን ፊደልና ፋንድያን ፋብሪካዎቻቸው ፍሬውንና ፍርሐቱን ፎላ ፉከራዎችን ፋይሏ ፈርደውባታል ፍካት ፍትሑም ፍንዳታም ፈ ፍርድ ፈቃድ ፍላጎት ፊት ፌዴሬሽን ፈጣን ፊታውራሪ ፋብሪካ ፍቅር ፈቃደኛ ፍቃድ ፍለጋ ፍትህ ፊርማ ፋይዳ ፍፁም ፍትሃዊ ፈንድ ፋብሪካዎች ፍራፍሬ ፈተና ፎረም ፍጥነት ፈንጂ ፌዴሬሽኑ ፈንታ ፍትሐዊ ፍሬ ፊያሜታ ፌዴራላዊ ፊልም ፋብሪካው ፍተሻ ፌዴራል ፋይናንስ ፋና ፍቃደኛ ፍራንስ ፈፅሞ ፊፋ ፈጥሯል ፍጹም ፍትሕ ፎቅ ፍሰት ፍጥጫ ፈጽሞ ፌስቲቫል ፍጆታ ፈጣሪ ፈጥኖ ፈጥረው ፈንጂዎች ፈጣንና ፍልሚያ ፍንዳታ ፈጥሮ ፉክክር ፍፃሜ ፈቃደኝነት ፍራቻ ፍርሃት ፎር ፍንጭ ፈረንሳይ ፋንታ ፋውንዴሽን ፍላጎትና ፈላጊ ፈፅመዋል ፍሳሽ ፈቃዱ ፈረስ ፈታኝ ፍስሃ ፋይል ፈቃዳቸው ፈለቀ ፊቱን ፈገግ ፍየል ፍቅርና ፈጠራ ፋሲል ፍቃዱ ፋራህ ፌስቡክ ፊታቸውን ፈጽመዋል ፎርም ፍስሐ";
            amharicWords[31, 1] = "ፌ ፍሬንዲሊ ፉኩቻ ፍልፈል ፍትዊና ፎቶግራፋቸው ፊሸርስ ፈርመውታል ፈልጌው ፍራንሴዝ ፌም ፍሬምወርክ ፈላስፋን ፍርድዎን ፋቲማን ፈልጉለት ፍጻሜውም ፍጻሜ ፍትሃዊና ፎቶ ፊደል ፎቶግራፍ ፍጡር ፋኩልቲ ፈር ፌደሬሽን ፈላጊዎች ፈቃደ ፊቱ ፈጥነው ፍሉ ፍልሰት ፈላስፋ ፈቃደኞች ፋይበር ፋታ ፈንጂዎችን ፍላጎትን ፈቃድና ፈረንጆች ፈፃሚ ፈልገው ፍልስፍና ፈርሶ ፍሰሃ ፍቅሬ ፎረሙ ፍርዱን ፊታቸው ፈገግታ ፍትሐዊና ፊርማቸውን ፈቃዳቸውን ፈልጎ ፍራንክፈርት ፈሳሽ ፈለግ ፋይሎች ፈጥረዋል ፊንፊኔ ፍሰቱ ፈልጌ ፈጽመው ፌስ ፈረንሣይ ፍሬው ፍኖተ ፍላጎቱ ፍቅርን ፍላጎታቸው ፍትህና ፍትህን ፈቺ ፍላጎታቸውን ፍንጮች ፋይናንስና ፌዴሬሽኖች ፈሊጥ ፊትም ፋይሉ ፋሲካ ፊገ ፊልሞች ፊልሙ ፈተናዎች ፍንዳታው ፈላጭ ፋንታዬ ፍርዱ ፎርቹን ፋብሪካውን ፍትሐዊነት ፍየሎች ፈፃሚዎች ፈቃዱን ፋብሪካን ፍራንኮ ፈቃዶች ፍርጥም";
            amharicWords[31, 2] = "ፈርተው ፈጠረ ፍጥጫው ፈፅሟል ፍራት ፍራፍሬና ፎርማሊቲ ፍሪዳ ፋብሪካዎችን ፋብሪካና ፌዝ ፍቅሩ ፍቺ ፍትሃዊነት ፍለጋና ፊደላት ፈረንጆቹ ፍትሐት ፉአድ ፌዴሬሽኑን ፈፅመው ፌዴራሊስት ፍላጎቶች ፈቅዷል ፈንዱ ፍርሃትና ፍንዳታዎች ፍሬዘር ፋብሪካዎችና ፉከራ ፈሪ ፌደራል ፈላሻ ፋሽስት ፈጽሟል ፈትለ ፈቀደ ፌዴራሊዝም ፍርቂ ፍሬያማ ፋክስ ፈረቃ ፎከስ ፈተናውን ፍራንክ ፍቃዳቸው ፈርጉሰን ፈርቶ ፈርመዋል ፈንድቶ ፊቷን ፍርዳቸውን ፈጻሚ ፍቃደኝነት ፈላሻዎች ፈላሾች ፍቅረ ፊንላንድ ፍጥረት ፈሰስ ፈጠሩ ፈርጀ ፈረሰ ፊታውራሪን ፎርጅድ ፈውስ ፎቶዎች ፉትቦል ፊውል ፌስቡክን ፈቃደኝነታቸውን ፍላጎቱን ፉት ፍሬህይወት";
            amharicWords[31, 3] = "ፍሪላንስ ፈልጌም ፋሽሽቱ ፈርጀው ፍጹምነት ፈንጥቋል ፍሬናቸው ፈለጋችሁ ፈርቸው ፍርሐታችንን ፈልሶ ፍጥነቱና ፈርሆንን ፎቶም ፈልጉና ፊንሐስ ፈ ፎርበስ ፋ ፍርሀት ፈንድና ፍቱን ፌዴሬሽንና ፍሰትን ፊትዋን ፊትዋ ፈቅደዋል ፈጣሪዎች ፈንጅ ፎርሙን ፈትቶ ፎርሙላ ፈረንሳይና ፍርኃት ፋካልቲ ፊታችንን ፊሊጶስ ፍርደ ፈለገ ፎረሞች ፋይዳው ፋኦ ፈይሳ ፋኑኤል ፈንጂውን ፍቃድና ፍራንሲስ ፊስቱላ ፋይናስ ፍለጋው ፍልሰታ ፍጅት ፊያሜታን ፈረሱ ፊልሙን ፈለጉ ፋካሊቲ ፈንታው ፊርማውን ፈቅዶ ፋጡማ ፌደራላዊ ፋብሪካዎቹ ፍርሐት ፊልጶስ ፎርት ፈርጅ ፊቅ ፈረንሳዊ ፍተሻና ፎርድ ፍሬነሽ ፈጸሙ ፋክሊቲ ፈኢማ ፍትሕና ፍራፍሬዎች ፍትሐ ፈጣሪነት ፋይናንሻል ፊትና ፍሰትና ፈርመው ፌስቲቫሉ ፋክልቲ ፈልገን ፊርማው ፍርደኞቹ ፍትሀዊ ፈርሷል ፈረንጅ ፈንጂው";
            amharicWords[31, 4] = "ፈነዳ ፋንታሁን ፋኖ ፎቶግራፎች ፍሪደም ፍፃሜው ፍጥጥ ፍቃደኞች ፌብሩዋሪ ፍትሐብሔር ፍርፋሪ ፍተሻው ፍራፍሬዎችን ፊሊፕ ፋሚሊ ፍጥነትና ፍሰቱን ፍጭት ፍረጃ ፈልገህ ፍፁምዘአብ ፈንታሌ ፋሶ ፈራሚ ፋሚሊያ ፊልሞችን ፍርዲሳ ፍዳ ፈቅደው ፈጅቷል ፊርማና ፈጠነ ፋኖስ ፋርማሲ ፊታውራሪና ፍተሻውን ፈት ፏፏቴ ፈይሰል ፈንጠር ፎረስትሪ ፈራሁ ፈልጋ ፈላጊው ፋሺስት ፋውንዴሽኑ ፍትሕን ፎቶውን ፊል ፍትሓዊ ፈቀቅ ፈርተን ፊቴ ፍሪሳ ፈቃድን ፍንክች ፋስት ፍዳዬን ፊቴን ፍላጎትም ፎገራ ፍዝዝ ፊታውራሪም ፈንጂዎቹ ፍሬዎች ፍቅረኛ ፊልምና ፍኖት ፉል";
            amharicWords[31, 5] = "ፏፏቴው ፍልፍሉ ፈረንጆቹን ፍልስጤማውያን ፊትህን ፍሬስብሓት ፈሪሐ ፎርቹንጋዜጣ ፈርኦናዊ ፉድና ፊሊፒንስ ፋርት ፍርህት ፍጥረቱ ፈርኒሺንግስ ፈለሰ ፌዴሬሽኖችም ፋዲጋ ፊልማቸውን ፈላጊዋን ፈረዳ ፍራፍሬን ፍቼ ፊርማዬ ፍስሃጽዮን ፋዘር ፎርፌ ፊልድ ፈጻሚው ፈሪዎች ፈዋሽ ፈሰሰ ፈልጋችሁ ፍረአ ፈላጊነት ፈታህ ፍልስፍናና ፌደሬሽኑ ፋሽን ፋራካን ፊንጫ ፈጻሚዎች ፈሪሳውያን ፈረሱላ ፈፀሙ ፎከር ፋኩሊቲ ፈጥረን ፋሽስታዊ ፍቅራችን ፈትለወርቅ ፈርቼ ፋይሎችን ፍትዊ ፊታችን ፈትል ፈንጂዎችና ፍጥጫና ፈቃደኝነቱን ፈጥሮአል ፈላስፎች ፍጥነቱን ፈጣሪውን ፈጥሮባቸዋል ፈርጆ ፍርድን ፍሰሐ ፉገራ ፈረሙ ፈጠራና ፌዴሬሽንን ፊትለፊት ፌስቲቫሎች ፍጡራን ፈራጅ ፍየልና ፈትተው ፍሬንድ ፋም ፍጥጫውን ፈንጣጣ ፈየራ";
            amharicWords[31, 6] = "ፍቅረሥላሴ ፎቆች ፈረሶች ፈጣሪው ፍጥጫን ፍራቻና ፎርስ ፈቅጃለሁ ፍሬም ፍሮንት ፋኖዎች ፍጆታን ፍቅረስላሴ ፍጡሮች ፍጥነቱ ፈንጂዎቹን ፊውዳላዊ ፈጥራ ፍልሚያው ፈልቅቆ ፈላሻዎችን ፍላጎቴ ፈተናው ፋካሊቲዎች ፍራሽ ፍሬወይኒ ፍላጎቶችን ፋሲካን ፈርሙ ፊልቱ ፈርኦን ፍላጎቶቹን ፍርድም ፈንቴ ፈፃሚው ፎርሲዶ ፍቅረማርያም ፋብሪካዎችም ፋሽስቱ ፈዛዛ ፍቃደ ፍሬድ ፋይንደር ፋራ ፈቀደች ፍለጋውን ፍረአዶም ፍቅርም ፊተውራሪ ፍቃዳቸውን ፈጥነህ ፋይሉን ፋብሪካም ፈጦ ፋሺስታዊ";
            amharicWords[31, 7] = "ፈርማለች ፍትፍቱን ፋቱ ፈርጌሳ ፋብሪካቸውን ፋክቶችን ፈቃደኛና ፊርማዋን ፍርሐታቸውን ፍሬናቸውን ፋንድያ ፍርግርግ ፍጹማዊ ፋኦን ፍሬያማነት ፍላትና ፉክክሮች ፍሎው ፍሉድ ፌይንማን ፍትኃዊ ፈርጉሰንን ፊርማዉን ፋብሪዎች ፍሪድማን ፋብሪካት ፋሺሽቶች ፈተሽ ፍኖተነፃነት ፍየልም ፋይዳዉ ፌንት ፊንሐስም ፈላስፋዎ ፈተናና ፊዴሬሽን ፋኩልቲዎች ፈትሾ ፈረደ ፍየሎችንና ፈጥረናል ፈረንሳዊው ፍራንክሊን ፈትቼ ፍትሐብሄር ፋናና ፈገግታዋ ፈርሟል ፍርድና ፍሬውን ፈጠን ፈፀመ ፍልውሃ ፍሬን ፈረስና ፍቅርንና ፈንታቸው ፊደሎች ፍርስራሽ ፍርደኛ ፈታ ፋክሊቲዎች ፈጣሪና ፋክክር ፈች ፍርዴ ፋይዳና ፈፅሜያለሁ ፊፋም ፈቃደኞቹ ፈረሰኛ ፈፅማለች ፈቃደኛነት ፈርሶአል ፈሳሾችን ፈጀ ፈጅ ፍዳቸውን ፍቃዱን ፎኢኖ ፈረንሣዊ ፈትነት ፈፃሚዎቹ ፍልሚያውን ፋኩሊቲዎች ፍርድቤቱ ፍላት ፉክክሩን ፍሬዎችን ፈረጃ ፌስታሎች";
            amharicWords[31, 8] = "ፋይሰል ፊራኦን ፍላጎትች ፌዘኛነት ፈርዳም ፍቅርህን ፍርሃታቸው ፍችውም ፊሊጶስን ፍፁምነት ፍርድቤትም ፈቷቸዋል ፊፊ ፈራንሲዮስ ፌደራሊዝምን ፈነጠቀ ፎኩዌት ፍቅረኛሞች ፈረሱን ፍቅራቸውን ፎርክሎዠር ፍዳውን ፍቅርተ ፈጥሮብናል ፈተው ፍሎሪዳ ፈለኩ ፈለክ ፌስስ ፍትጊያ ፈረስሜዳ ፈራርሰው ፍስሐዬ ፍርሀትና ፈጥራለች ፍጻሜውን ፈተናቸውን ፍኣኦ ፍተሻም ፍቅረኛዬ ፈሷል ፍልሰትን ፍሮንቲዬ ፈጣሪያቸውን ፍጥረትን ፈቃድም ፈረንጁ ፍሉይ ፋይዳም ፈቀዱ ፈቅዳለች ፈተናዎችን ፈቃደኝነቱ ፋት ፍንጣሪ ፈልጓል ፉጨት ፈቅዳ ፍቅርሽ ፈጅቶ ፋዳል ፈርዶባቸዋል ፍትሃዊነትና ፊልምም ፈችዋ ፈንጋይ ፈቲያ ፍራንቸስኮስ ፍርሃታችንን ፈዲስ ፍ ፍትሐዊነትን";
            amharicWords[31, 9] = "ፍቅረኛውን ፎቶው ፈርጥሞ ፍትሐዊነቱ ፈሳሾች ፍርድቤቱን ፊሊፕስ ፈረንጂ ፍጥነቱም ፋውዴሽን ፋንታን ፈርዶበት ፍሬህይዎት ፍስሐጽዮን ፍቺውን ፋራናይት ፍልስፍናውን ፈርስት ፎረሙን ፈተናም ፈራሚዎች ፍቅራቸው ፈጽመውታል ፍሩድ ፈረደበት ፍቃደኝነቱን ፍተሻዎች ፎረሞችን ፈገግታው ፋፋ ፍትሃብሄር ፊላዴልፊያ ፈላ ፊሽ ፍልሰተ ፍርሃትን ፈረንሳይን ፋርዳ ፈራ ፍልሚያዎች ፊቷ ፍላጎታችን ፈረስን ፊን ፍሮንቴር ፈቶ ፈላሽ ፌርማታ ፍላጎቱም ፈጌሳ ፊልሞችም ፎርቸስ ፈንቶ ፈንታና ፋይዳውን ፈለግሁ ፍየሎችን ፌስቡክና ፈቃደና ፌዴሬሽንም ፍጻሜው ፍጡርን ፍንትው ፈለገና ፍልሰትና ፍላወር ፍርደኞች ፈጥነን ፋርም ፈርተዋል ፈዞ ፊቱም ፊጣ ፌስታል ፎቶዎችን";

            amharicWords[32, 0] = "ፈለኩኝ ፈርቶና ፈንጥዘዋል ፋህሚ ፋውንዴሽንን ፍር ፍልስፍናዎችን ፎገር ፋሶው ፈርደዋል ፎርቹኑ ፍሬንድሽፕ ፍቅሯ ፈቃደኝ ፍርዶችና ፋሲሊቴሺኑን ፈጠራዎች ፈቃዶችን ፍኖተሰላም ፋርማሲዩቲካል ፈጸመ ፋኝዶ ፍትሃት ፌዴሬሽኑም ፍጡርዘአብ ፈጣኑ ፍካሬ ፈላስፋው ፎክሎር ፈርሰው ፈተናን ፎርቴን ፈራሽ ፋሬስ ፈንታችን ፈርኦንም ፊርማዎችን ፍቃደኝነታቸውን ፋብሪካንና ፋሽቃ ፈለገው ፍጆታና ፉክክሩ ፍግና ፍግ ፈላጊውን ፈረንሣይና ፋሲልና ፍርድቤት ፍትሃዊነትን ፈቃደኞችን ፎርማሊቲዎች ፈርኦኖች ፉከራና ፈርደው ፍቺዎች ፋካልቲዎች ፎርቶ ፈርሰዋል ፈንድን ፈርጊ ፈታኝና ፈቃድዎን ፌሽታ ፋናን ፍስሃዬ ፋይናንሲንግ ፍላጎች ፋአድ ፍጥረታት ፋሪስ ፍቅረኛው";
            amharicWords[32, 1] = "ፈልፍሎ ፈታሽ ፍልስጤማዊያን ፉፋ ፌደራሊዝም ፍሳሾች ፈጅቶብናል ፋይቶ ፍሮንቲየር ፈርሃን ፍልፍልና ፌዴሬሽኖችና ፋሮል ፈላስፋዎች ፈንጠዝያ ፍብእ ፋርማሲቲካልስ ፈረሱም ፈጥና ፍራቻቸውን ፈረንሳይኛ ፋናዬ ፈጣሪን ፍንዳት ፈተናችን ፈጥሮባቸው ፍርሀትን ፋንታቸው ፋውንዴሽንና ፋሲለደስ ፈንታን ፍልሰቱን ፈለግኩ ፍልሰታን ፊታውራሪነት ፍሩ ፍሪ ፍረጃውን ፎሮንቴርስ ፍቅሪ ፍሬድሪክ ፋርማሲዎች ፊጌ ፍላጻ ፊዩል ፈቅዶላቸው ፋካሊቲዎችን ፍልስትን ፍሬዎቹ ፍቆ ፍልቅልቅ ፈዬ ፈንታሁን";
            amharicWords[32, 2] = "ፍቅረኛየ ፎክስ ፌስቡክንና ፍላ ፋበሪካዎች ፎቶግራፋቸውንም ፈችነት ፍሬንዴ ፍርዶቹን ፈረንጅነት ፈሳቸው ፍራፍሬዎችና ፍሩሽ ፈትሑላህ ፍንትዉ ፈትጎ ፎቷቸውን ፈጁ ፋርስ ፈቅደውላቸዋል ፎቶግራፎችና ፈላጊዎቹ ፋንቱ ፍጹምዘአብ ፍልስጤም ፍርፍር ፋሽስቶች ፎቶዬ ፍች ፈሪሳዊ ፈቅደን ፋብሪካዎችንና ፍርሃቱ ፍጥነታቸው ፍጥነትም ፈርጦች ፈጠረላቸው ፍሬሕይወት ፈንጂዎችንና ፍጭትና ፈዴራል ፍራቲኒ ፍጆታዋን ፈሪሀ ፈቃደኝነቷን ፈሪሃ ፈጥሮላቸዋል ፈርጠም ፍላጎቱና ፍቺው ፋን ፍርሃትም ፍቅሬን ፎርብስ ፊትህ ፊልሞችና ፍልፍል ፍረወይኒ ፈብሪካ ፌዴራላዊና ፋካ ፈንዱን ፋሽዝም ፈጽማችኋል ፈንዲሻ ፊፋና ፈጭቶ ፈሷት ፊፋን ፎንት ፍሬሰንበት ፈቅጄ";
            amharicWords[32, 3] = "ፈላጊና ፊልጶስን ፌዴሬሽኑና ፈትፍቶ ፉኩዳ ፈንጥቆ ፍንታው ፈልፋይ ፊሊሞን ፈተናውና ፍርጃ ፈገግታና ፍፁማዊ ፋክት ፈልቶላችኋል ፌደራዊ ፋይዳቢስነቱ ፍዳን ፈጽማለች ፈጥሮልናል ፈረዱ ፍንጣቂ ፈለጉት ፉንድ ፍጥረታትን ፍላቴ ፊዚክስ ፍትሐዊነትና ፈንቅሎ ፋሁድ ፎምና ፍሬዴሪክ ፌሎውሺፕ ፌደሪሽን ፈረመች ፍሪጅ ፍሬሽ ፈጥሮለታል ፍላጎቷን ፋሶዎች ፈላጊዎችን ፋልሴቶ ፊልሞቹ ፈርዳ ፊ ፊሪሣ ፈቃደኝነትና ፈቅዶና ፌብሪዋሪ ፉክክርና ፊደሎችን ፍጪው ፎቁ ፏ ፍትፍት ፊታውራሪንና ፈላጭነት ፍሥሐ ፍልፈሎች ፍሬፍሬ ፋንዶ ፋይናንሰ ፌር ፋሲሊቲ ፍሰሀ ፈፀመች ፈጽሞም ፋሽኑ ፈልሰው ፍቅሩን ፊሽካ ፌንድ ፌስቲቫሉን ፍራሹ ፈቃዱቸው";
            amharicWords[32, 4] = "ፍተሻውና ፎክረዋል ፍጥም ፈንጂን ፈለግን ፉርጎዎች ፈጠራቸው ፍጽሱም ፋሶና ፊኛ ፉከራው ፋሶን ፍቤት ፈጅተው ፈረሰች ፍንዳታን ፍንጩ ፋሩቅ ፈጥኜ ፋርጣ ፈረሰኛው ፍፃሜውን ፊሊፕሰን ፈትለክ ፍላጎቶችና ፈርጥ ፎን ፍጥነቷን ፋይዳዎች ፊዴሬሽኖች ፍጻሜን ፊታውራሪዎች ፈልቶ ፊውዳል ፋውንዴሽኑን ፈቃጅ ፌስቲባል ፈሩ ፍተሻን ፈክቶ ፍርዷን ፋይቭ ፍልስፍናቸው ፈቺና ፍራንቺስኮ ፍረዱ ፍዳችንን ፈገግታውን ፈቅ ፍጆታቸው ፊርማቸው ፍልስፍናዊ ፈልቅቀህ ፍርዳቸው ፈጀባቸው ፍንዳታዎችና ፍጥረቶች ፌዴሬሸኑ ፈርም ፈርሞ ፈቃዱም ፎቶዬን ፎሊክ ፈንድም ፈርዳና ፍልስፍናው ፈጌሣ ፌርማታዎች ፎርማሊቲዎችን ፋይላቸው ፈፅማ";
            amharicWords[32, 5] = "ፌንጣ ፍቅረኞች ፈሪሳዊያን ፋንዳሜንታሊስት ፍጥጫቸውን ፈሶበት ፎቶሾፕ ፊቼ ፋራሃን ፌክ ፈፅመሃል ፈቃደኛነቱን ፍላጎቶቻቸውን ፈጠርን ፈርማ ፈጽመናል ፈንጂና ፋይናንሽያል ፋብሪካቸው ፊውዳሊዝም ፎቶግራፍና ፈጣሪያችን ፈለገች ፍንዳታዎችን ፍርደኛው ፍላግ ፈሩን ፈሪው ፍሬዉ ፈጻሚና ፍራትና ፎጣ ፈረጠጠ ፈቀዱላቸው ፈካ ፍሬንዶቼ ፊታችሁን ፈዕመናል ፍል ፈጠራም ፈታን ፍቅሯን ፈጽሜያለሁ ፍቅርህ ፍርጥርጥ ፎቶዎቹን ፉርሽ ፍም ፊዳ ፎረምም ፍራ ፍርዶች ፋድል ፈራጅም ፍግም ፈሮን ፋህ ፍጥረትና ፍጆታዎች ፊርማዎች ፍሪማን ፎቶዎቼን ፎርሞች ፎቶዎችና ፊጤ ፊጥ ፋይዝ ፊሸር ፊሊጳስ ፈቃድንና ፋር ፋሮ ፍላጎቶቹ ፊልምን";
            amharicWords[32, 6] = "ፍላጎታቸውንም ፋይናንሺያል ፈሪና ፌዝና ፈተዋል ፈጥሮበታል ፈርሸው ፍሪሣ ፍሪዳና ፎረምን ፈልገዋል ፈሶ ፎኮራ ፍረድ ፈራርሰዋል ፍጠር ፊትን ፈራርሷል ፍልስፍናም ፋልክረም ፌዴራሉ ፍቺን ፈጽመሃል ፈረንሳዮች ፍላጎታችንን ፈልቷል ፈርቀዳጅ ፋይናንስን ፋርሽ ፈልቅቀው ፍቱ ፊልምለዕይታ ፊልሙም ፋናወጊ ፋድስ ፍቶ ፋይዱ ፈልጉ ፊሲካል ፎቶግራፋቸውን ፊውቸር ፋካቱሬ ፈልግ ፈረዱበት ፉጨቱን ፈቀድ ፈጆች ፈረንሣዊው ፈነዱ ፋብሪካዎቹን ፈቅደኛ ፈፃሚዎችና ፈጣሪዋ ፈንታም ፈለጋቸውን ፎቶግራፎችን ፍርሃታቸውን ፊልሞቹን ፍታት ፍስሐፅዮን ፍቅረኛቸውን ፍልስፍናዎች ፈቃዴን ፋቸ ፈረሴን ፈፋ ፌዴእሬሽን ፋሺስቱ ፎርሙ ፈጥርቆ";
            amharicWords[32, 7] = "ፍሰሃየ ፍቱልኝ ፈሳሽና ፉርጎ ፈርመናል ፈላሾችን ፈትሸው ፈረመ ፍትሕም ፋቶማታ ፈውሱን ፈጠራን ፈርታችሁ ፈረንሣይም ፈሞ ፈቃደኝነታቸው ፈጽመውብኛል ፌደሬሽኖች ፍርሃቻ ፈጽሚ ፍርስ ፈዴራላዊ ፈጽማ ፈጽሜ ፈንታዋ ፈርዷል ፍራቻን ፈቀደኛ ፈልገናል ፈጥሮብኛል ፍቃዳቸዉን ፍትሀዊነት ፌብርዋሪ ፈጥጦ ፍስሐና ፍፃሜና ፍላወርስ ፎቶኮፒ ፍቅረንዋይ ፎርማት ፈጣሪዎችን ፍጡራንን ፈጥሯልም ፍጆታነት ፈጠረው ፋብሪካውም ፈጥሮላታል ፌርማታው ፈጣሪያቸው ፍራንክፈረት ፋሺስቶች ፍትሐቱ ፍሎትዴን ፈርጉሰንም ፎርሌሙ ፉጨትና ፋብሪካዎቻችንም ፈጅተዋል ፈረጀ ፍትሐዊም ፎሎ ፈጣኑን ፍቀው ፈሰዋል ፎቅና ፊዮሪና ፈዕሞ";
            amharicWords[32, 8] = "ፍፃሜም ፍቱልን ፈሊጣዊ ፈሪነት ፋርማኪዮር ፈሶባቸው ፈላሻዎቹ ፍቅረኛዋ ፍለጋም ፍጥነትን ፋንታየ ፈትተን ፌዘኛ ፋሺስትነት ፍልጥ ፌዴራሊዝምና ፋኑኤልን ፈጣጣ ፈርጀዋል ፍትሕንና ፍሪሳና ፍቅረኛሞቹ ፍሌሚንግ ፌደሬሽኑን ፈፀመችብን ፍርጥምታ ፈጠረባቸው ፊትሽ ፈትሸዋል ፊሪማ ፊደላትና ፍላጎቶቻቸው ፈገግታቸው ፈጥራችሁ ፈጀው ፈስሶ ፍረጃና ፊደላትን ፈርመን ፈትታ ፈርድ ፊቶች ፈርዶ ፍሎረንስ ፍቃደኛነታቸውን ፋሽት ፎረንሲክ ፌደራሊስት ፉክክርን ፈፅሞብናል ፈሪሳውያንን ፈልቆ ፉድ ፋንድ ፍልስፍናን ፌዴሬሽንስ ፌደራሎች ፉዓድ ፋይናንሱ ፎረሞችና ፈንድቀው ፍላጎቷ ፈረስሜዳን ፈተናዋ ፋሺዝም ፈጽሞታል ፈቃደኝነትን ፍርሃቱን";
            amharicWords[32, 9] = "ፌሮ ፋንዳሜንታሊስቶች ፈክተው ፍሊት ፍቅረኞቻቸውን ፈርጣጭ ፍቃዳችንን ፍቅሩና ፍንጮችን ፍቅፋቂውን ፈርዶብን ፌደራሊዝሙ ፍርስረሱ ፍራሼ ፍልሰትም ፍርሃታችን ፈርማቸዋለች ፋሺስትን ፎርዋርድ ፎቢያ ፊተኛ ፋፍሪካ ፈሉ ፍሬውና ፍረንሳዊት ፈዝዞ ፍልሰቱ ፈላጊዎችም ፈኢማው ፌዴሬሽንኑ ፌስቡካችን ፋክልቲዎችን ፍርኃትን ፍጅቱን ፈረሠ ፉገራም ፍትጊያው ፈርዲናንድ ፎቶግራፈር ፈርሀ ፍተሻዎችን ፍላቴን ፍቺም ፈልግና ፌዴራሊዝምን ፍጠሩ ፋቢዩስ ፌስታሎችና ፈንጠዚያ ፈኢማዎች ፈረሴ ፍፁማዊነትን ፍሬዎቻቸውን ፋክልቲዎች ፍልስምና ፈርሐ ፊቶ ፌደራሉ ፋፁም ፈትዋ ፎከረ ፊሊፒናውያን ፌደራልና ፈሩት ፋታም ፈልፍለሽ ፎቶኮፒውን ፍርኃትንና ፊደሉ ፍየሎቹና ፈረሶችን ፈርመዉ ፈሪሳዊው ፍሎራይድ ፎቆችና ፍርቱና ፈሳሹ ፍጥሩ ፈራችሁ ፎቶና ፌዴሬሽኖችን ፈልሳፊዎቹም ፍኖተሠላም ፈርሳ ፈርስ ፌስቡኩን ፍርሃትንና ፊቸር ፍላየር ፋዉንዴሽን ፍላጎትዋን ፈረንሳይም ፊሊጥ ፍትኅ ፎክር ፍጅትን ፍረደኛ";
            
            amharicWords[33, 0] = "ፕረስ ፐርማነንት ፕሬዚዳን ፓሎዎአንትሮፖሎጂ ፖሊዮን ፓርትነር ፕሬሶቹ ፖሊቲካዊ ፖሊሲች ፓሬኽ ፓይለቱን ፖሎሲ ፕላኔቶች ፕሮግራምህ ፕሮጀክቶችእየተፋጠኑ ፕሮፖዛሎች ፕሮፍን ፓንስሌት ፖስትና ፖሊሶቹና ፕሮጀክታችንን ፔድሮ ፓፓው ፐ ፕሪንሲፒ ፒተርን ፕሬዚደንታዊ ፖስታቸው ፕሬዚደንትነትና ፑባላን ፔሬዙ ፕሪንሲፔ ፓትሪያርክና ፓርቲውንና ፓርላማዉን ፒግሚ ፓስፖርቷ ፔንታገን ፖለቲካኛው ፓረቲዎች ፓኔታ ፖስተሮቹ ፓርለሳክ ፖለቲካውስ ፒኤም ፕሮሞተር ፓንክረሰት ፓሲፊክ ፕላቶ ፕሬዚንዳንት ፓልቶኮችም ፕርፓጋንዳ ፕሮግራሜ ፖርኖግራፊና ፓልቶክም ፒስኮሮችለመጀመርያ ፕሪስተር ፓትርያርኮችን ፕሪሚዬር ፓርቲንና ፔርቶኒያል ፒስኮር ፓሊዮአንትሮፓሎጂስት ፕሮፖጋንዳዉን ፕሮጀክቶቻችንን ፕሮጀክቱንም ፒዩፕልና ፓራሲታሞል ፕትርክናቸው ፓትሪአርክ ፖሊሱንም ፓኪስታናዊና ፒራሚዶቻችን ፒር ፕሮፌሽናሊዝም ፓለቲከኞች ፖለቲከኖች ፕሮቴስታንቱም ፓልቶክና ፔዳ ፓስፖርቴን ፕሌት ፕላስቲክና ፐሮግራም ፔስት ፓክ ፖስተኝነት ፕሩፍ ፔሪየዲክ ፕላኔታችን ፐርሶን ፔሌግሪኒ ፒዮንግዮንግ ፖስተርና ፓኪስታናዊያን ፑሪ ፓርቲያዊ ፖሊሲአቸው ፐርሰንቶች ፕሬዚዳንትንና ፐርሰንታቸውን ፓርላማውና ፖለቲካኛነትና ፕሮዲውስ ፖሊሲዎቻቸውና ፕሪንስፓል ፔዳጎጂ ፐርሰንታይል ፕላቲኒየም ፕሬዝዳንተ ፒኤልሲ ፓትሪሻ ፕሬዚዳንቶችም ፕሮፌሰርነትንም ፖሊታን";
            amharicWords[33, 1] = "ፓሊሲን ፕሮፌሰሯ ፕሮፖጋንዳው ፕሮቸስስ ፐሮፓጋንዳ ፓፓ ፐርሶኔል ፕሬዚድንት ፓርቲያችንም ፕሬዘዳንታዊ ፕላኖች ፕሬዚዳንትነታቸው ፓፓየ ፑንትላንድና ፖለቲከኞችንና ፕሮፖዛሉ ፕሮፓጋንዳዎች ፖትርያርኩ ፖሊሲዎቻቸውን ፕራይዙ ፕሬዝዳንቱም ፔትራም ፕሮፌሽናሎች ፕላቶን ፕሬዚዳት ፓነል ፕሮጄክትና ፕሬዚዳንትነትና ፓስተሮችን ፓርላማችን ፓትርያርኩንና ፕሮሲጀር ፖሲስ ፕሎት ፖለቲከ ፒትሮይፓ ፖቴንሻል ፒቴሽን ፕሬሲንግ ፕሬዜዳንት ፖለቲክ ፕሮግራሞቻቸው ፓርኮቹና ፖለቲክስ ፓትርያርክን ፕሮሰስ ፐሬዚዱንት ፕሮግራሟ ፖለቲካዋ ፓኬት ፐርፎርማንስ ፓርኮቹን ፕሮግራሙንና ፓርቲያቸውም ፒራሚዶች ፒአርአይ ፓውንድና ፖለቲከኛም ፕሬዚዴንት ፓርትነርስ ፖሊሲዎችም";
            amharicWords[33, 2] = "ፓርቲዎ ፐኦፕለስ ፕሮጄክቱን ፓስፊክና ፓርቲኒየም ፕሮግራሙንም ፕሮዲውሰርስ ፕሊስ ፓይለትና ፕትርክና ፓርላማዉ ፕሪንተር ፓርላማን ፒክአፕ ፕራይቬታይዜሽንና ፔትሮናለ ፕሬሶችም ፓርቱጋል ፓትርያሪኮች ፕሮሰሲንግና ፕሮግራሞቻችን ፖሊሲዋ ፔንሲልቬንያ ፓርቲያቸዉ ፖታሽየም ፒዩፕል ፖሊሲያችንን ፕሮፖጋንዳና ፖስተሮችና ፓስቶራሊስት ፕላዛ ፓርቲዬ ፕሮፌሰሮቹ ፔይን ፕሮቴስታንት ፓዲ ፒኤችዲ ፕሮዳክሽን ፕላንን ፓሪቲ ፓትሪያርክነት ፖለሲ ፕሬዝዳንቶችና ፖሊሲውንና ፕሬዝደንቱ ፕሮፖጋንዳን ፕላስ ፖስታዎችን ፒተርሰን ፕሮጄክቶቹ ፒትሽን ፔሪ ፓስፖርቱ ፓትራያርኩ ፔር ፕላኔቷ ፓርቲወች ፕሬስንና ፕሮፌሽን ፒተርና ፔትሽን ፕሬዝዳንቱንና ፕራይቬታይዝድ ፑና ፖለቲካቸውን";
            amharicWords[33, 3] = "ፕሮጀክታችን ፕሮቶኮሉን ፔትሮትራንስ ፕትርክናውን ፓርኮቹ ፕሮጅክት ፖላንድ ፕሮፓጋንዳም ፖሊሲዎቹ ፖስተሮችን ፕሪካስት ፕሬዚዳንቶችን ፕሬዝዳንታችን ፔፕሲ ፓኬጆችና ፕሮዤዎች ፕረስስ ፕሮግረስ ፐር ፔሪቶኒያል ፕሮፖጋንዳዎችን ፒያሳና ፓሊሲና ፕራይዞችን ፔሬዝ ፕሬዝ ፓፍ ፓንክረስ ፓርቲያችንን ፓትሪያሪኩ ፕሮጀከት ፕሮጀክቶቻችን ፓርቲዎችንም ፕሮፌሰርን ፔፐር ፕሮፌሰርነት ፓልታክ ፖለቲከኞችም ፕሬዚዳንቶቹ ፕሬዚዱንቱ ፓርቲያቹ ፕሬዚደንትነት ፓናሉ ፖለቲካውም ፓተርሰን ፓሴ ፕሬዝዳት ፑዤ ፑንትላንድን ፖሎቲካ ፓርክም ፓቪሊዮን ፓትርያርክም ፕሮፐጋንዲስቶች ፒፎርፒ ፓዝዋንግ ፓወል ፕሮፓጋንዳቸው ፖሊሱም ፓርኪንግ ፓቲ ፐርሽን ፕሬፌሰር ፓርኪንግን";
            amharicWords[33, 4] = "ፕሬዚዳንትን ፕሮፓጋንዳቸውን ፓትርያርክነት ፒኤምአይ ፕረዚዳንቱ ፕሬዚደንትና ፕሮፓጋንዳውን ፓኬጆቹ ፓልም ፒዩርፊኬሽን ፑንት ፔትሮናስ ፕሮቴስታንቶች ፕሮዲዩሰር ፓይለቶቹን ፖሊሱን ፖርላማ ፓሊስና ፓንክኸርስት ፕሮፋይል ፓትርያርኮች ፖለቲካውንም ፒኖ ፓሊሲዎች ፓትሪስ ፕሮፈሰሩ ፕረዝዳንት ፒቲሽን ፑት ፕሬዚደንቶች ፕሮፊሰር ፕሮፓጋንዱ ፓርቲውና ፕርግራም ፖለቲከኛው ፕሬዚዳንቱም ፔዳል ፓፓያ ፔካን ፓስተሮች ፖሊሳዊ ፖስተሮች ፕላት ፕሪዝን ፓትሪያርኩን ፓስ ፓርላማም ፖፕሌሽን ፖለቲካዉ ፖፑ ፒኮክ ፒራሚድ ፕሮፖዛሉን ፖሊሲውና ፔፕፋር ፓስካል ፕላውት ፕላንት ፖርቲዎች ፓምፕ ፖሊሲዋን ፓራግራፍ ፕሮቴክሽን ፓርቲያችሁ ፑል ፐርሽንና";
            amharicWords[33, 5] = "ፖስታዎች ፕሬዚዳንቱና ፕሮግራሞቹን ፖሊሲያችን ፕሮጀክትና ፕሬዚዳንትም ፖልቴርጋት ፐብሊክ ፒያኖ ፓውል ፖለቲካዊም ፓስፖርታቸው ፓኪስታናዊ ፕራይዝ ፓሻ ፓርቲያቸውን ፒያሣ ፔርሲ ፓኪስታንን ፕሮቲን ፖሊሲያቸው ፕሬዝዱንት ፕሪ ፓስታና ፕሮጀክቶቹም ፕሬሶችን ፓሊሶች ፕሮግራሞችም ፔቲሽን ፖሊሶቹን ፖስፖርት ፖውላ ፓልመር ፓትርያርክና ፐሬስ ፒካፕ ፕላዝማ ፕሮፈሠር ፕሮፌሰሩን ፕትርክናው ፕራይቬታይዝ ፑተር ፔተር ፓተንት ፕሮፓጋንዲስቶች ፓትሮል ፓርላሜንታዊ ፕራይቬት ፓምፖችን ፕሮሞሽንና ፓካርድ ፐሬዝዱንት ፕሮጀክቱም ፐፍ ፕሮግራሞችንና ፕሬዘደንቱ ፖለቲከኞቻችን ፕሮፎርማ ፓርቲዎችንና ፕራይዞች ፕሮቪደንት ፕራግ ፕሮቴስታንታዊ";
            amharicWords[33, 6] = "ፓትርያርኩና ፓትርያሪኩን ፖፕ ፒየር ፖሊዮ ፖሊሱ ፕሮፓጋንዳና ፕሮጄክቶችን ፖለቲከኞቹ ፕላኔት ፓምፖች ፓርኮችን ፕሬዚዳንቱን ፕሬዝዳንትም ፖሊሲዎቹን ፓስፖርትና ፐሮፌሰር ፓስፖርቱን ፒታርድስ ፑሽኪን ፖርቱጋል ፒት ፓርቲውም ፒን ፓርቲዎቹም ፕሮፌሰሮች ፖሊሲያቸውን ፖለቲከኞችና ፓርኮችና ፕሬዝደንት ፕሬዘደንት ፓስፖርቶች ፕሬዝዳንትን ፖለቲከኞችን ፖስተር ፓይለቶችን ፖሊ ፕላኑ ፓስት ፑቲን ፕላንቴሽን ፒፕል ፕራይቬይታይዜሽን ፓላስ ፖለቲካም ፒ ፖሊሲንግ ፓውላ ፖውል ፕሪንተሮች ፕላኒንግ ፕሪቶሪያ ፓትሪአርኩ ፓርላማውም ፓርቲዎቹን ፓርላሜንት ፕሬስም ፕሮጀከቶች ፓትርያሪክነት ፕሮግራማችንን ፓርላም ፕሮግራሞቻቸውን";
            amharicWords[33, 7] = "ፕሮሰሲንግ ፖለቲካውን ፖርቲ ፓርኩ ፓራ ፓርላማና ፓርቲም ፓኬጆችን ፓስፊክ ፓልቶክ ፕላንና ፖርት ፖሊሶችም ፕሬሱን ፓወር ፓኬጁን ፕሮጀክትን ፕሮጀክትም ፖለቲካል ፕሮጀክቶችም ፕሮፌሠር ፕሬዚዳንታዊ ፖታሽ ፕሬዝዳንታዊ ፕሮግራምም ፓል ፓለቲካዊ ፒዮስ ፓርት ፕሮጀክቶቹን ፓኬጅና ፖለቲካችን ፕሮፖዛል ፓርኩን ፓሊሲ ፔትሮሊየም ፓስፖርታቸውን ፓራዲዞ ፕላስቲክ ፓይለቶቹ ፓናል ፕሮፍ ፓትርያርኩም ፕሮቶኮል ፖሊሲም ፓይለቱ ፓስተር ፓርቲያችን ፓርክን ፕረዚዳንት ፕሬዚዳንቶችና ፕሮግራማቸው ፕሮግራሞቹ ፕሮግራሙም ፕሮፌሰርና ፓትሪያሪክ ፔን ፒስ ፕሮጄክቱ ፕሮጀክቶችና ፕሬዚደንቷ ፕሬዚዳንቷ ፖለቲከኛና ፕሮፓጋንዳው";
            amharicWords[33, 8] = "ፓንክረስትና ፒስታ ፖስቱ ፓርላማዊ ፔዛኒ ፕሮፌሰርም ፔጅ ፓሊሲው ፕላንም ፕሮፌስር ፖሊቲካ ፓዘቲቭ ፑሉ ፕሬዚዳንታቸውን ፓምፖችና ፔሮል ፒጃማ ፕሮፕጋንዳ ፓትሪያርኮች ፕላኑን ፓሪቲዎች ፕሮጀክታቸው ፖለቲካውና ፖሊቲከኞች ፓዌ ፒካርድ ፖሊሶቹም ፕሬዚድናት ፖሊሶችንና ፕሮጀክተር ፓስፖርትም ፕሮ ፖሊሲንና ፓንክረስትን ፕሮጀክቶ ፓርትያርኩ ፕርፌሰር ፓዝ ፕሬዚዳንትነቱን ፕሮግራሞቻችንን ፕሬዝዳንትነታቸው ፓትርያርኳን ፓናሎች ፖለቲካቸው ፕራይቬታይዜሽንን ፕሮዤ ፖሊሲዎቻቸው ፓርኪንሰን ፕሮግራማችን ፒለር ፓኔትራ ፕሮግራምን ፕሬሶች ፕሬስን ፓርቲውን ፖሊሲውን ፖስታ ፖሊሲዎችን ፖሊሲን ፓሊስ ፕሪሚየር ፖሊስም ፖለቲከኞች ፕሬዚደንቱ ፖሊሶቹ ፖሊሶችና ፕሮጄክቶች ፕሬዝዳንትና ፓና ፕሪምየር ፖለቲካን ፕሮጀክቱን ፓትርያሪኩ ፖለቲካና ፖለቲከኛ ፕሬዚዱንት ፓርቲዎችም ፕራይቬታይዜሽን ፓውንድ ፕሬዚዳንቶች ፖሊሶችን ፑንትላንድ ፒንግ ፕሮፌሽናል ፓኬጁ ፓርቲነት ፓስታ ፓትርያርኩን ፓንክረስት ፓኬጅን ፖሊሲዎችንና ፖሊት ፓርኮች ፕሬዝዳንቱን ፕሬስና ፖሊስን ፓትሪያርኩ ፕሬዚዳንትነት ፕሮግራሞችና ፕሬዝዳንትነት ፕሮግራማቸውን ፕሬዝዳንቶች ፖዘቲቭ ፓርቲን ፓለቲካ ፓን ፒያሳ ፕሬዘዳንቱ ፓትሪያርክ ፓኪስታን ፕሮፈሰር ፕሬሱ ፓርላማውን";
            amharicWords[33, 9] = "ፕሮፖጋንዳቸውን ፕሮጀክቶቻቸውን ፓርቲዋ ፓቶ ፕረዚደንት ፓትርያርኮቹ ፕሬዘዳንትና ፓሪሱ ፕሮፖጋንዳዎች ፓትሪሺያ ፓርሜሌ ፕሬዝዳንትነትና ፓርዲ ፑትላንድ ፑሊዶ ፐልስ ፒፓውን ፐ ፖሊስ ፓርቲ ፕሮግራም ፕሬዚዳንት ፓርቲዎች ፕሬዝዳንት ፕሬስ ፕሮፌሰር ፖሊሲ ፕሮጀክቶች ፕሮጀክት ፖለቲካ ፖለቲካዊ ፓርላማ ፖሊሶች ፕሬዚዳንቱ ፕሮግራሞች ፓርቲው ፕሮግራሙ ፓኬጅ ፕሮጀክቱ ፓርላማው ፕሬዝዳንቱ ፕሬዚደንት ፖሊሲና ፕሮፓጋንዳ ፓርቲዎቹ ፓትርያርኩ ፕሮጀክቶችን ፕላን ፓስፖርት ፕሮግራሙን ፖሊሲዎች ፖሊሲዎችና ፕሮግራሞችን ፓሪስ ፕሮጀክቶቹ ፖሊሲው ፕሮፌሰሩ ፖለቲካዊና ፓርቲዎችን ፓትርያርክ ፖስት ፓርክ ፐርሰንት ፖል ፖሊስና ፕሮፖጋንዳ ፓትርያሪክ ፕሮግራምና ፕሬዘዳንት ፓርላማዎች ፖለቲካው ፓኬጆች ፕሬዚዳንትና ፕሮጄክት ፓይለቶች ፓርቲዎችና ፓርቲያቸው ፓርቲና ፕሮሞሽን ፒተር ፓትሪክ ፓይለት";
        }
    }
}
